INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1000057', 'https://media.elcinema.com/uploads/_315x420_1f10ff8e7b5dced6f103d72aae7c66e1ee405add08b09b84a79adcf5b75c53b4.jpg', 'Mohamed El Tokhy', 'Egypt', ' 4 November 1926', NULL),
('1000239', 'https://media.elcinema.com/uploads/_315x420_9d85b72167f1bb95af89c6e92c7192a16a640a18fb2036400e59bbc82a7573f1.jpg', 'Rageh Daoud', 'Egypt', '23 November 1954', NULL),
('1000287', 'https://media.elcinema.com/uploads/_315x420_1ae60c74044f69af290239acd5833d899da000292e9808d1c41e3ffffa8da0b4.jpg', '‎‏‎‏Kariman Mahdi', 'Egypt', NULL, NULL),
('1000416', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed Mohsen', 'Syria', NULL, NULL),
('1000693', 'https://media.elcinema.com/uploads/_315x420_b4c6174768d429b7a7d78c82db1b6a157204ccde6622001ed035c87e5b42dd11.jpg', 'Diaa Abdulkhaliq', 'Egypt', '13 June 1965', 'An Egyptian actor, famous for his evil roles. From his leading films was \"Tito\"'),
('1000695', 'https://media.elcinema.com/uploads/_315x420_4abcae0a1e0ad3d3f644e341d9e3aed3424eb08a1531273c3af1a844a3c535d1.jpg', 'Khaled Bahgat', 'Egypt', NULL, NULL),
('1000935', 'https://media.elcinema.com/uploads/_315x420_b5d153de4aed04f63048409646b043a890f369fb249cad4af56d5d37b7a31bd7.jpg', 'Abdelrahman El Abnoudy', 'Egypt', '11 April 1938', 'Al-Abanoudy was born in the village of Abanoud in the Egyptian governorate of Qena. His father was a “Maazoun” – a religious man who formalizes weddings. Al-Abanoudy later moved to the city of Qena where he was influenced by the songs of “al-Seera al-Hilaliyah”. He is married to the Egyptian television announcer Nehal Kamal and the couple have two daughters, Ayyah and Nour. \nAl-Abanoudy is among the best recognized Egyptian colloquial poets of all time, among the best known of his works is “al-Seera al-Hilaliyah” which is in fact a compilation of poetry authored by poets across Upper Egypt. His work “Ayyami al-Helwa” (“My Sweet Days”) is perhaps his best known novel – the work was published over several phases in the Egyptian newspaper “al-Ahram”. Throughout the book al-Abanoudy recalls different stories garnered from his experiences living in Upper Egypt.'),
('1001149', 'https://media.elcinema.com/uploads/_315x420_748a56f197e5e0f2928f19199388da7ed4e943b3631d70c4fcfe841363e8a7f9.jpg', 'Menna Fadaly', 'Egypt', ' 4 September 1983', 'Menna Fadaly is an Egyptian actress. She was born in Cairo in 1983, and started acting in 2002 in the television series “Ayna Qalby?” (Where\'s my Heart?), after she was introduced by her mother to director Magdy Abu Emeira. She then appeared in numerous television series, including “Almalek Farouq” (King Farouq), “El Nas fi Kafr Askar” (People in Kafr Askar), “Lahazat harega” (Critical Moments) and “Afarit El Sayala” (The Ghosts of El Sayala).'),
('1001183', 'https://media.elcinema.com/uploads/_315x420_075fa6053db913fb87959ccdde16c6a612171d605582ade7fb87f889d5c9c3ea.jpg', 'Ayman Naguib', 'Egypt', NULL, NULL),
('1001574', 'https://media.elcinema.com/uploads/_315x420_2b2a9c81d61f9b446bf6ff1232b86e7c4f5fae96d3eae40faff0eccdeba3b391.jpg', 'Karim Abdulaziz', 'Egypt', '17 August 1975', 'Son of famous director Mohamed Abdel Aziz, Karim was no stranger to the world of film making. He graduated from the institute of high arts, directing division, in 1997. He worked as an assistant director for a short time before deciding to jump in front of the camera. Director Sherif Emara gave him his first role, but Karim\'s notoriety grew after his TV role in the series \"Lady from the Era of Love\" starring Samira Ahmed. Following the show, he was given his first lead role on the silver screen in the movie \"Why did you Make me Love You?\" opposite Mona Zaki and Hala Sheeha.'),
('1001601', 'https://media.elcinema.com/uploads/_315x420_be4109f3a7770bd0b60584015fa272ecaf2ad5f2fcd57506259f5ae9dd8df461.jpg', 'Mona Hala', 'Egypt', '25 October 1984', 'Mona Hala is an Egyptian actress who got her start on the children\'s show \"Yalla Bina.\" Afterwards, she got a small role in the film \"Basha Telmeez\" (His Excellency the Student) in 2004, which she followed with a bigger role in \"Leilet al-Baby Doll\" (The Baby Doll Night) in 2008. Her stints on \"Qalb Mayyet\" (Dead Heart), \"Kessat Hob\" (Love Story), and \"October Al-Akhar\" (The Other October) are among her most famous television roles. Mona played Princess Fawzeyya, King Farouk\'s sister, in two television series \"Al-Malek Farouk\" (King Farouk) and \"Maleka fel-Manfa\" (A Queen in Exile). Her calm features help her play a variety of roles.'),
('1001614', 'https://media.elcinema.com/uploads/_315x420_b795b23c808aa362b57ed2a0341ac6ea0866a2e823e2348e4da75442cdcb9e8a.jpg', 'Hussein Fahmy', 'Egypt', '22 March 1940', 'Hussein Fahmy is an Egyptian actor who was born in Cairo. He graduated from the Higher Institute for Cinema in 1963 and then studied directing in the United States of America. Following his return he was recruited by Hassan al-Imam for an acting role and thus he put off his directing project so that he could work as an actor in cinema, theater and television. Plays in which Fahmy has participated in include “Inqilab” (“Coup”), “Ahlan ya Bakawwat”, “Embrator ‘Emad al-Deen”, “Sahlab” and “Ka’b ‘Aaly” (“High Heels”. His television works include “Alf Leila wa Leila” (“A Thousand and One Nights”) and “al-Mal wa al-Banoun” (“Children and Property”). Fahmy first married a woman outside of art circles, he later married actress Mervat Amin and the couple had a daughter. Fahmy assumed the leadership of the International Cairo Film Festival beginning in 1998 and up to 2000. He received the award for best actor for the films “Damy wa Dimoo’y wa Ibtisamaty” (“My Blood, My Tears and My Smile”), “al-Ikhwa al-A’daa” (“Inmical Brothers”), “al-Rasasa La Tazal fee Habiby” (“The Bullet Remains in My Loved One”) and “Intabiho ayoha al-Sada” (“Your Attention Gentlemen”). Fahmy also received the award for best cinema research at the al-Neilein Festival in 1983 for his research into the relationship between the director and the performer. He has three children named Mahmoud, Neira and Mennat Allah. Fahmy successfully portrayed the role of the blonde haired handsome youth in many of his earlier movies before demonstrating that he is a first rate talented actor in films of the likes of “al-A’adaa” (“The Enemies”), “al-‘Aar” (“The Shame”) and “Intabiho ayoha al-Sada” (“Your Attention Gentlemen”). He may be observed in his best form in “al-Le’ib ma’a al-Kibar” (“Playing with the Elders”), moreover he matured as an actor with age and experience.'),
('1001916', 'https://media.elcinema.com/uploads/_315x420_0a3e9a39969fcd16ea10a975e5b96631832c2ebef55224b61ec4f501d4d6e82b.jpg', 'Samah Anwar', 'Egypt', '22 April 1965', 'Samah’s  father was the writer Anwar ‘Abd Allah and her mother was actress So’aad Hussein. She studied French at Cairo University’s faculty of Arts and thereafter earned fame for her vivacious roles in Egyptian cinema. Among her best known film works are “Halat Tilabis” and “Bint Mushaghba Gidan” (“Mischievious Girl”). Samah has also performed on stage and television. Her TV works include “Zeaab al-Geel” (“Wolves”) and “al-Hissab” (“The Account”) while her stage works include “Raqisat Qita’ ‘Amm” (“Public Sector Dancer”) and “Awlad al-Shaware’” (“Street Kids”).\nSamah withdrew from acting for several years following an auto accident but returned to the spotlight on the “Tagribty” (“My Experience”) program which aired on satellite TV.'),
('1002053', 'https://media.elcinema.com/uploads/_315x420_9b483d3d27d89e609db02780899fcb248a0ecd9e1d80d913dfe27bc292915bd8.jpg', 'Mahmoud Elwan', 'Egypt', NULL, NULL),
('1002070', 'https://media.elcinema.com/uploads/_315x420_632e04f155cf8e8e0c634b7a609d2c3d42d9b6b2c8033e6bbe3c620a66df6da1.jpg', 'Ahmed Zaher', 'Egypt', '27 April 1975', 'Ahmed Zaher graduated from the Faculty of Commerce before receiving a bachelors degree from the Higher Institute for Theatrical Arts. His television works include “Al Ragol al Akhir” (The Last Man), “Amshir,” “Li al ‘Adalah Wojooh Kathira” (Justice Has Many Faces), “Hadeeth al Sabah wal Masaa” (Morning and Evening Talk), “Al ‘Ussyan” (Disobedience), “Al Haqeeqa wal Sarrab” (Mirage and Truth), “Samehoony Makansh Qasdy” (Forgive Me I Didn’t Mean It), “Khalf al Abwab al Mughlaqa” (Behind Closed Doors), “Umm Kalthoum” and “Harat al-Tablawy” (al Tablawy’s Neighborhood). He has also worked on the 2002 play “Edla’y ya Doussa” in addition to “Wada’an ya Bakawat” (Farewell Tears).'),
('1002111', 'https://media.elcinema.com/uploads/_315x420_63573b38fa5c9c60ecaa20dc36aeffb7aea6b9665b95f006e5e0e76807ae657e.jpg', 'Ahmed Safwat', 'Egypt', '11 October 1977', 'Egyptian actor, graduated from the High Institute of Dramatic Arts. Nour al-Shereef chose him to play the role of “Khaaled al-Daaly” in the series “Al-Daaly”, for which he was awarded best young actor prize, after his success in “Sekkat al-Helaaly”with Yahia al-Fakharaany.\nSafwat also played the role of “Marshal Abdul Hakeem Aamer” in the series “Naasser”.'),
('1002113', 'https://media.elcinema.com/uploads/_315x420_17a4fbfc5b1886e731b11792b21e583a7c9ee9b86e19053499c1e022215ee248.jpg', 'Hany Fawzy', 'Egypt', NULL, 'Script writer Hani Fawzi had a unique way of writing. His topics were always new and tricky. Although he started writing very early, but his first presented idea was through the movie “The Land of Dreams” in 1993 starring legendary Fatin Hamama. Hani Fawzi worked with many directors such as Dawood Abdel Sayed, Osama Fawzi and Khaled Fawzi.'),
('1002134', 'https://media.elcinema.com/uploads/_315x420_874fd2af55886a13b27c23664a9ae83e0d9774bf5492ea0702583f1a3cba3421.jpg', 'Amr Abed', 'Egypt', '10 June 1984', NULL),
('1002254', 'https://media.elcinema.com/uploads/_315x420_22cafd2b815886e5a294701399d0878d8b06f13d5a4491ace8866b489ca30f37.jpg', 'Ali Khalifa', 'Egypt', NULL, NULL),
('1002388', 'https://media.elcinema.com/uploads/_315x420_80aff2270627b9a1cb1ba66f1d7c25674e9be6891d8d999dd62041d0d2d406f0.jpg', 'Mohamed Abo Seif', 'Egypt', ' 9 October 1950', 'He is an Egyptian director and script writer. His father was the infamous director Salah Abu Seif. Mohamed wanted to be like his dad so he studied directing at the High Institute for Cinema and graduated in 1976. He worked with several directors as an assistant director, including his dad in the movie “The Malateeli Bathroom” in 1973, then directed his attention to commercial advertising. His first ever movie was “The Apple and the Skull”.'),
('1002610', 'https://media.elcinema.com/uploads/_315x420_3e2660c90cf8c3a0ba2c76dc526ea7306506a335701c4d0ce82ea0b23cd6a343.jpg', 'Abdullah Ellkatib', 'Egypt', '13 March 1978', NULL),
('1002692', 'https://media.elcinema.com/uploads/_315x420_c76e2e945e1ad214e576d890c4910fc6cd954a0cb848c56e0c341bd595b8ef4b.jpg', 'Emad Rashad', 'Egypt', ' 3 December 1951', NULL),
('1002914', 'https://media.elcinema.com/uploads/_315x420_3630d2d7308a61e7e6f05f90d69a273d3a168064ec3666dd09b22b4f078d952c.jpg', 'Mahmoud Suleiman', 'Egypt', NULL, NULL),
('1003085', 'https://media.elcinema.com/uploads/_315x420_ba655fc6a7cb42cd1ed73d13d382badfecea8929af5fb095c7a99dddb78899cd.jpg', 'Ali Ragab', 'Egypt', '25 March 1964', 'Aly Ragab was born on the 25th of March 1964 in the city of Alexandria in Egypt. He studied engineering at Alexandria University. His extreme passion to art made his shift his interest art directing. Initially he worked as an assistant director in several movies such as “Maganeeno”, “Dantella”, “Hassan and Aziza” and in the year 2000 he directed his first movie “Macho Guy” or “Shagee El Ceema” starring Ahmed Adam. He then did several other movies such as “Saye Bahr”, “Khalti Faransa” and “Bolteya El Ayma” in 2008. He also directed his only television series called “Al Wadeea wal Theaab”. He is currently preparing for his new movie “Innocent Heart” or “Kalb Bareei”'),
('1003154', 'https://media.elcinema.com/uploads/_315x420_281f5e1ebf9dec64f1b879d94f27e8e3ce1a84e3f1c277aac524dc156f17e51d.jpg', 'Karim Kojok', 'Egypt', '22 September 1972', 'He fell in love with acting even before being an actor, and worked for 11 years as a TV presenter in various movie channels, and on Arab Radio and Television.\nHe never asked for help in regards to being introduced to the field of cinema. Until his friend director Wael Ihsan offered him a role in the movie “AL Lembi”\nAs for television he was nominated by director Adel Hossni for the series “The Lord’s Daughter”'),
('1003183', 'https://media.elcinema.com/uploads/_315x420_e4cf345d91f43b42a7dd208ba935caf1d65f80b2398662c220556b96f1a6e316.jpg', 'Alaa Awad', 'Egypt', ' 1 January 1960', NULL),
('1003363', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Amr Kamel', 'Egypt', NULL, NULL),
('1003580', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mustafa Imam', 'Egypt', '12 January 1934', NULL),
('1003694', 'https://media.elcinema.com/uploads/_315x420_3c9b41501b68ab5ae22e36347891320f2622f711d8f0e7fd14993b791528835f.jpg', 'Zeina', 'Egypt', ' 4 February 1981', 'Egyptian actress young - born in Aquarius - began her career when played a little in front of the star of the late Ahmed Zaki in the film (Fear Factor) and then disappeared untilil slightly appeared again in one of the clips music with singer / Tamer Hosni in one of his songs - and then quickly spread quickly claimed the rocket and the stardom and fame, and proved it has a special talent - so it jumped into the top ranks and occupied a privileged position among the stars of the first row were also able to win the best actress title for the years 2005.2006 in public referendums. - Launched by the late artist / title of Ahmad Zaki (Penelope Cruz) for close similarities between them - also praised by film director / Youssef Chahine when seen in the film (Joys) and was named (Sophia Loren the Arabs). - Participated in the radio series, Ramadan (Holiday at Real Madrid), with the artists / Ahmed Ezz, Nour, Antsarouselah Abdallah and Lotfi Labib - Stars and ball / Mohammed Abu Trika, Khaled Ghandour'),
('1003705', 'https://media.elcinema.com/uploads/_315x420_fbbcd3fa62877ae68edf62c4e4aad345151d7e96ee990e406621beb8aff2a356.jpg', 'Sharif Hilal', 'Egypt', NULL, NULL),
('1003808', 'https://media.elcinema.com/uploads/_315x420_529e1254da9def07b1f41eb27d8cde9965821e7685cd064756a6a914dd2df1ea.jpg', 'Sahar Kamel', 'Egypt', NULL, NULL),
('1003814', 'https://media.elcinema.com/uploads/_315x420_cb6b6924919d595adb2f2f2e0680407934b56c0fdb7b1fccb83d5dff2a815086.jpg', 'Emad El Raheb', 'Egypt', '30 June 1970', 'Emad El Raheb is an Egyptian actor who was born in 1970. he graduated from the college of Ain Shams. El Rahed participated in many drama and cinematic works. His TV drama works include “Awan El Ward,” and “El Malek farouq.” He also starred in important movies like Youssef Shahine\'s “Eskendereya- New York”and Waheed Hamed\'s “Maaly Al Wazeer.”'),
('1004016', 'https://media.elcinema.com/uploads/_315x420_b9f69ae91738a4ffddd0bc5bf32b21724c47469dc8a5913314bab29639ac46fe.jpg', 'Sherif Arafa', 'Egypt', '25 December 1960', 'Sherif is an Egyptian director, screenwriter and producer. He graduated from the Higher Institute for Cinema in 1982 and he is the son of director Sa’ad ‘Arafa in addition to being an elder brother to director ‘Amr ‘Arafa. Sherif began his cinema career in 1987 when he directed the film “al-Aqzam Qadimoon” (“The Dwarfs are Coming”), the screenplay for that title was authored by Maher ‘Awwad. Thereafter Sherif presented the film “al-Daragah al-Thanniyah” (“The Second Degree”) with performers Soa’ad Hosny and Ahmed Zakky but the work was not a success among audiences. The director was the first to notice the talents of many performers who include ( Mohamed Sa’ad – Ahmed Helmy – Mohamed Heneidy – Kareem ‘Abd Al ‘Azeez – Ahmed Makky – Mahmoud ‘Abd Al Ghany – Haitham Ahmed Zakky – ‘Alaa Waly al-Deen – Mona Zakky – Nour – Sullaf Fawakhragy – Gamal Suleiman). The large number of talent discoveries attributed to Sherif ‘Arafa have indicated that he has a special eye for fledgling performers. The director has worked with major performers from the outset of his career, performers of the likes of Soa’ad Hosny, Ahmed Zakky and ‘Adel Imam. He also discovered and presented several of the well known youthful faces in cinema, names such as ‘Alaa Waly al-Deen, Mohamed Heneidy, Mona Zakky, Nour, Mohamed Sa’ad, Ahmed Helmy, Haitham Helmy, Ahmed Zakky and many others. Sherif has also produced several cinema and television productions such as the film “Halim” and the television series  “Tamer wa Shawqqiyah”, “Lahazat Harija” (“Critical Moments”) and the program “al-Nas wa Ana” (“The People and Myself”) through his private production company Partner Pro. Moreover Sherif has also directed several television commercials for well known products such as Pepsi and Chipsy. Sherif made a forceful entry into the world of television production in 2006 when he produced three works, the two television series “Tamer wa Shawqqiyah” and “Lahazat Hariga” (“Critical Moments”) and the program “al-Nas wa Ana” (“The People and Myself”). That last production saw him collaborate with other producers from Egypt and the United States. Sherif ‘Arafa has directed several cinema titles that were milestones in the history of Egyptian cinema, titles such as “Teyoor al-Zalam” (“The Birds of Darkness” ), “al-Nazir” (“The Manager”), “Mafia” and “Halim”.'),
('1004198', 'https://media.elcinema.com/uploads/_315x420_46b1be7a2db14f84915f735b903f35eb9d11bf0bb2df151d0cb96605c6ec2b47.jpg', 'Salma Al Nagar', 'Egypt', NULL, NULL),
('1004494', 'https://media.elcinema.com/uploads/_315x420_2615158c7680e89a6e12b1e919778b22f5c9773b53b93a2cc020614b067fcb7e.jpg', 'Ragaa Al-Geddawy', 'Egypt', ' 6 September 1934', 'Nagaat Aly Hassan al-Geddaawy went to Franciscaines school in Cairo. She worked in the translation department of an advertizing agency where she was chosen “Miss Cotton 1958” giving her the chance to become a mannequin. She started acting in cinema and theatre with her aunt Taheyya Carioca. She got married to the football player Hassan Mokhtaar, gave him their only daughter. Al-Geddaawy stopped acting for some time to travel with him. Upon her return, she resumed fashion shows and acted with Aadel Emaam in several plays like “Al-waad Sayyed al-shagh-ghaal\" (Sayyed, the servant). In many TV series, she personalized aristocratic ladies to the point that no one could tell that she is acting.'),
('1004554', 'https://media.elcinema.com/uploads/_315x420_f618318726c74f7def42290c4165f90f4b39cc3026b0b58a148ec8617b0b920c.jpg', 'Olfat Emam', 'Egypt', '23 March 1964', NULL),
('1004658', 'https://media.elcinema.com/uploads/_315x420_8df47922a6d557e196b14717fdc70bb2fa915a5e2adcf91fd3b135a407ef6be8.jpg', 'Madiha Qassem', 'Egypt', NULL, NULL),
('1004865', 'https://media.elcinema.com/uploads/_315x420_f2f37b6fbd661147b304a57d9ecf647a3d75b6c47ebb1fb85f6f31a2ccb9fe95.jpg', 'Mohamed Nabawi', 'Egypt', NULL, NULL),
('1004907', 'https://media.elcinema.com/uploads/_315x420_e511d86037e3a9f6a91a53230eb0bd7bd0bffedff93058578226cdefc03b65ba.jpg', 'Amira Mukhtar', 'Egypt', NULL, NULL),
('1004929', 'https://media.elcinema.com/uploads/_315x420_a6ff4b03baff04bf7fe7c768e3288156a6b2b31678b7f3646769861a74b2cbe2.jpg', 'Mohammed Diaa', 'Egypt', NULL, NULL),
('1005302', 'https://media.elcinema.com/uploads/_315x420_0d970ea532837bd804cc862fd20fa420087c231f5827785b2ae1ec458de0c3b8.jpg', 'Azza Al-Husseiny', 'Egypt', NULL, NULL),
('1005341', 'https://media.elcinema.com/uploads/_315x420_750f0f3d65b8a04cf6e7413ac7ece36bb0ea1f2cf7d603dedeac02e1d80d780c.jpg', 'Ahmed Ezzat', 'Egypt', NULL, NULL),
('1005407', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmad Ismael', 'Egypt', NULL, NULL),
('1005423', 'https://media.elcinema.com/uploads/_315x420_d589a4977f7332488e6a57ad8affa9a6d03e08951e727015e883c48b31f235cd.jpg', 'Huda Al Saify', 'Egypt', NULL, NULL),
('1005549', 'https://media.elcinema.com/uploads/_315x420_408ed59f2277763d74a7658691367e48c9b4e5dde6b4590fd38eea9300a5057a.jpg', 'Khaled ElBakry', 'Egypt', NULL, NULL),
('1005677', 'https://media.elcinema.com/uploads/_315x420_e700869fbbaf2e3fc5f40cea5821410a6e94feeb207807772f475ad3924ee43e.jpg', 'Ezzat Al-Alaily', 'Egypt', '15 September 1934', 'E’zzat Hassan al-A’laly Hassan was born in the “Bab al-Sha’riyah” district of Cairo. He received his bachelor’s degree from the Higher Institute of Theater Studies in 1960. \nE’zzat is married and has a son named Mahmoud who works as a dentist. He also has a daughter named Ragaa. Ragaa has a degree in law and is married. \nIn his early stages, art was something of a dream for E’zzat as he had four sisters for whom he was responsible seeing as his father had passed away. He thereafter made his way into art and performed in several TV series an example of which is “A’bd Allah al-Nadeem”.\nAmongst the stage productions in which E’zzat has assumed leading roles are “Dimaa a’la Malabis al-Sahra” (“Blood on the Evening Gown”) and “Ahlan ya Bakwat”. \nE’zzat has also written several plays amongst which are “Thawrat al-Madina” (“The City’s Revolt”) and “Al-Touffan” (“The Flood”). E’zzat al-A’laly has received numerous awards and has also performed in Algerian and Lebanese cinema. He is considered a unique acting talent who can give lively depictions of any character he is asked to portray, no matter how diverse. His natural talents and build have helped him in his career.\nE’zzat can be observed in excellent form in “al-Ard” (“The Earth”), “al-Ikhtiyar” (“The Choice”), “al-Muwattin al-Masry” (“The Egyptian Citizen”) and “el-Sekka Matt” (“El-Sekka is Dead”).'),
('1005687', 'https://media.elcinema.com/uploads/_315x420_b8c8a2477c3221ac22addaf9d03d395a918c3d2da180ec9cc02cccb0f4fe7825.jpg', 'Amir Shaker', 'Egypt', NULL, NULL),
('1005695', 'https://media.elcinema.com/uploads/_315x420_cc1a249a0e5a165dacd2c0f5ffb1366a15a68c3e012201866e2a14fb73799b04.jpg', 'Ruby', 'Egypt', ' 8 October 1981', 'Ruby is an Egyptian actress and singer. Her real name is Rania Hussein Mohamed Tawfiq. Her career began with appearances in commercial advertisements. Director Youssef Chahine discovered her and chose the name “Ruby” for her. She then transitioned into singing and her music created much clamor in 2003. She has worked as a presenter for several satellite networks including “Dream” and “al-Mehwar.\" She\'s starred in a number of hit movies, including \"Film Theqafy\" (Cultural Movie) in 2000, \"Silence... On Tourne\" directed by Youssef Chahine in 2001, \"El Waed\" (The Promise) in 2008, \"El Shawq\" (The Passion) in 2008, and \"El Hafla\" (The Party) in 2013.'),
('1006091', 'https://media.elcinema.com/uploads/_315x420_af4d15c54c3dd599ca9b53fbd0969f25e2b9d207852e2c57410529eda9c36d99.jpg', 'Khaled Essawy', 'Egypt', NULL, NULL),
('1006221', 'https://media.elcinema.com/uploads/_315x420_aa9a1744d445ba27b241b966f02efd86bb2d0109efa0ffca11b245c7bed5b0ba.jpg', 'Mohamed Maghraby', 'Egypt', NULL, NULL),
('1006517', 'https://media.elcinema.com/uploads/_315x420_f86a993609f2bfbe83a00d85b3a6309b29629573520db6a6a6bda69897ae5cbf.jpg', 'Tayseir Fahmi', 'Egypt', '18 May 1955', 'Tayseer Hassan Mahmoud Fahmy is an Egyptian actor who graduated from the High Institute of Dramatic Arts She has starred in various TV series and as supporting actor in a few films. Tayseer has also established a production company with her husband Dr. Ahmad Abu-Bakr and produce acclaimed series such as “Amaaken fel-kalb i.e. Places in the heart” and “Kalb al-donya i.e. The center of the world”. She has also played significant parts in huge TV productions such as the Nagueeb Mahfouz Trilogy and “Ra’fat Al-Haggaan”.'),
('1006553', 'https://media.elcinema.com/uploads/_315x420_18d5333c8ccebb2182c527d8a05c5a8a0c02e819d8fbcd1af68f8d69063ad49b.jpg', 'Abdul Latif Zaky', 'Egypt', ' 1 February 1946', NULL),
('1006586', 'https://media.elcinema.com/uploads/_315x420_cdc704c446ff4820a39295f61df5e15de61d519ff5d792e80dac49f637ad716a.jpg', 'Samar Ali', 'Egypt', NULL, NULL),
('1006624', 'https://media.elcinema.com/uploads/_315x420_3db42e1f3ecd5742d31ce21061d67634d4d6edf5814760cc1bfaa850a5e0d9cd.jpg', 'Mohamed Azmy', 'Egypt', '17 July 1993', NULL),
('1006630', 'https://media.elcinema.com/uploads/_315x420_ac47ba2a42932a23be6de0a8bf4fa7e92c2bbdcbdd3f44fc2090561e8b0726da.jpg', 'Nedal Al-Shafeay', 'Egypt', '12 June 1978', 'Nedal El Shafey is an Egyptian actor. He was born in Cairo in 1978, and graduated from the acting and directing department of the high Institute of Theatrical Arts in 1999. He participated in a workshop organized by theater director and writer Khaled Galal, which gave him the opportunity to land roles in small plays produced through state funds like “Al Moganad 311” (Soldier 311) and “Mosafer Leil” (Night Traveller). His first film role was in the crime thriller “Malaky Eskendereya” (Alexandria Private). He then went on to star in the 2007 sitcom “Tamer we Shawqeya” as Shawqeya\'s brother, developing a character that was extremely successful among audience. His other work includes so-starring in the television series “Lahazat harega” (Critical Moments), “Hekayat Bena\'esh-ha” (Stories we Live), “Vertigo” and the films “Al Gezira” (The Island), “Badal Faqed” (Replacement), “El Dealer” and “Garsoneira”.'),
('1006642', 'https://media.elcinema.com/uploads/_315x420_e208b45d6d75c323fc53420cd5aab0c8e215fd41689db88444f510d24d6b38df.jpg', 'Ashraf Tulba', 'Egypt', '12 February 1958', NULL),
('1006699', 'https://media.elcinema.com/uploads/_315x420_4fce6ba3cad4ac557f5a013b5c8000e4d61c16e77468273d5e18dc6853db2c04.jpg', 'Aaidah Riyadh', 'Egypt', '23 January 1954', 'Her full name is ‘Aaidah Riyadh Ragheb Shahata and she was born in the district of Bulaq. ‘Aaidah was married to artist Muharram Fouad and their marriage continued for about four years. She started out as a dancer in the National Folk Art Troupe at the age of fourteen and excelled in that role. It was in that context that she was observed by director Ahmed Yaseen who recruited her for the film “Ma’a Tahhiyaty li al-Ustaz al-‘Azeez” (“With My Regards to the dear Professor”). Thereafter her career took off and she presented several plays including “Wahid Laymoun wa al-Thanee Magnoun” (“One is a Lemon and the Other is Mad”), “Gouz wa Louz” (“Nuts and Almonds”) and “Taksab ya Khashiya”. She also took part in the television series “Bareeq al-Sahab” (“Sparkle of the Clouds”), “Harra al-Mahrousa”, “al-Mal wa al-Banoun” (“Children and Property”), “Marid al-Gabal”, “Le’b al-Hobb wa al-Intiqam” (“The Game of Love and Revenge”), “Layaly al-Helmiyah”, “Hawanim Garden City” (“The Women of Garden City”) and “’Aailat al-Hajj Metwally” (“The Family of Hajj Metwally”). She received awards for her performances with the national troupe and for the films “Ahl al-Qimma” (“The People of the Summit”) and “Ahlam Hend wa Camelia” (“The Dreams of Hend and Camelia”).'),
