('1007439', 'https://media.elcinema.com/uploads/_315x420_918755fba4e6757f5e85a580a0b4a82a3d3185b23cbcfb13f83032a9119d6f3c.jpg', 'Sherif Mohsen', 'Egypt', NULL, NULL),
('1007446', 'https://media.elcinema.com/uploads/_315x420_6bff2e903c18c86d9fe554b0efaf1b211a93261fb6e6b62714df469602e05b7f.jpg', 'Hala Sedqy', 'Egypt', '15 June 1961', 'Hala Sedky George Younan earned her degree in literature in 1981. She excelled at sports and was a champion swimmer. As a child, Hala spent some time in the United States and began her artistic career upon her return to Egypt. Her role in the TV series “Rihlat Million” drew attention to her and she has since diversified her roles from comedies to tragedies. Among the plays that she has starred in are: “Al Wada’a ya Bakawat” (“Farewell Tears”), “727”, “Al Sa’aydah Wasaloo” (“The Sa’aydah are Here”), “Matloub Tagneed” (“Conscription Notice”), “Izay Al Sihha” (“How are you Doing?”) and “Bashweesh”. Among the television productions that she has taken part in are “Arabesque”, “Al Ragol wa Al Lail” (“The Man and the Night”), “Ragol fee Zaman Al A’awlamah” (“A Man in the Age of Globalization”) and “Dolly Dolly”.'),
('1007480', 'https://media.elcinema.com/uploads/_315x420_c6d5cd4e754a03a10ccfeec28943b1f2723c00c418e443daad18bee7dc8e0247.jpg', 'Magdy Fekry', 'Egypt', '19 September 1963', NULL),
('1008042', 'https://media.elcinema.com/uploads/_315x420_b54052e5584d5d3ab8081ecedbe3e8dcfed009f8075f36717630c0395a496adc.jpg', 'Louay Abdulla', 'Egypt', NULL, NULL),
('1008057', 'https://media.elcinema.com/uploads/_315x420_c0d0c4344d04b94b0330ff72a5eed12662237b9348ce6716abcdb27728d25760.jpg', 'Ahmed Habashy', 'Egypt', '15 August 1980', NULL),
('1008131', 'https://media.elcinema.com/uploads/_315x420_d373bf76e74bf887094750fd4dc92affc7ae9d63411b26a5624c37da1123f7b6.jpg', 'Mazhar Abol Naga', 'Egypt', '12 July 1940', 'Mazhar Abol Naga is an Egyptian actor who was born in Egypt in 1940. At first he worked in the textile industry in Alexandria. In 1969, he appeared in the play “Sayedaty el Gamila”, which was the launch of his acting career. In the 1970s, he worked on numerous cinematic movies including “El Sokareya”, “El Bahth aan el Mataeb” and ”Ehna betoo el Otobis”. Throughout the following years, he appeared in many movies, TV series and plays. In 2017, at the age of 77 he sadly passed away.'),
('1008272', 'https://media.elcinema.com/uploads/_315x420_f85edf8a92eb4d84f979d7fcc9df91e7cfa7c6e2f435784bae07bc20392694d8.jpg', 'Mahmoud Amer', 'Egypt', '28 October 1955', NULL),
('1008612', 'https://media.elcinema.com/uploads/_315x420_66e8a86829bc87f650f18cde3c0628e5c1793248084d214afa17e0e9f58f4eb5.jpg', 'Sayed Seif', 'Egypt', '13 October 1945', NULL),
('1008759', 'https://media.elcinema.com/uploads/_315x420_858187addd46510153eaf43468746773e91f36fe4648a87c8caf12ef89ad47f1.jpg', 'Hassan El Adl', 'Egypt', '21 March 1951', NULL),
('1008827', 'https://media.elcinema.com/uploads/_315x420_ccd060897795c0886dbd70db4b9a8a9f67bc0beca71bd7cecfe475428ef6cb63.jpg', 'Mohamed  Salem', 'Egypt', '13 November 1930', NULL),
('1008920', 'https://media.elcinema.com/uploads/_315x420_f2c3dc8d63e39ce084818b6b3b98a1e0bbf2f5fcc6e5ba0467657a01e3153797.jpg', 'Mahmoud Qabeil', 'Egypt', '19 May 1946', 'Mahmoud Kabeel is an Egyptian actor born in Alexandria in 1946. Kabeel joined the military in 1964 and served as an officer until 1973. He fought in both the Six Day Way in 1967 and the War of Attrition in 1970. After leaving the military, he made his first acting appearance in Youssef Chahine\'s 1972 film \"El Asfour\" (The Sparrow) and continued to act in films in the next few years. In 1980, he moved to the United States where he started a citrus farming business with his brother. He returned to Egypt after fourteen years in the U.S., after which he began working as a counselor for young people. He returned to acting with \"Darb Gaza\" and \"Lahm Rakhis\" (Cheap Meat) about young girls traded off to rich Gulf suitors. His performance in the latter was well received. In 2003, Kabeel launched a TV series on girls\' education and inheritance in Upper Egypt. That same year he was named a UNICEF Goodwill Ambassador, and has continued with UNICEF on various fundraising and awareness campaigns. Kabeel is well known for his television roles on \"Ayna Qalbi\" (Where is My Heart) and \"Hawanem Garden City\" (Ladies of Garden City). Like many Alexandrians, Kabeel speaks a number of languages, including English, Arabic, French, Hebrew and Italian fluently.'),
('1008945', 'https://media.elcinema.com/uploads/_315x420_63fad8fac5f0f3baf72dcbde8dd5d2973cec161001e43ddf0db165fedb7f1e04.jpg', 'Saffwa', 'Egypt', '31 March 1968', NULL),
('1009009', 'https://media.elcinema.com/uploads/_315x420_ddd2f54532769ef3b9febe152b627be6048f42d954684e0fdcc2d6adbc2639bf.jpg', 'Mahmoud Yousuf', 'Egypt', NULL, NULL),
('1009276', 'https://media.elcinema.com/uploads/_315x420_881ef166c129fa01bc3698bf56e231b1396e679e4d3e1bf2e405a298f4859421.jpg', 'Correct for Cinema', 'Egypt', NULL, NULL),
('1009322', 'https://media.elcinema.com/uploads/_315x420_3350a1010fd92db93cf6b5d63f9950fec18aa1341213b89ebefca4fcb0071679.jpg', 'Abla Kamel', 'Egypt', '17 September 1960', 'Abla Kaamel Muhammad Afeefy graduated from the faculty of Arts library and information department 1986. She began acting on stage at Al-Taleeaa Theatre with her monodrama “Nawbet Sahayaan i.e. Wakeup horn” then joined Muhammad Sobhy Troupe in “Weg-het Nazar i.e. Point of view”. With Lineen al-Ramly, Abla played lead roles in “Waga’ demaagh i.e. Headache”, “Al Hadetha i.e. The accident”. She excelled in her numerous TV roles such as: “Layaaly al-Helmeyya i.e. Helmeyya nights”, “Lan aeesh fee gelbaab aby i.e. I will not live in my father’s robe”, Al-shahd wal-domou’ i.e. Honey and Tears”, “Hawaanem Garden City i.e. Garden City ladies” Abla is married to Mahmoud al-Gendy, the actor, and has two daughters of a prior marriage.'),
('1009400', 'https://media.elcinema.com/uploads/_315x420_6bf3aacc5970256fa8d6f230d510e2ed0d06e82242cccacba527ba19caa6ec33.jpg', 'Ashraf Farouk', 'Egypt', '24 December 1964', NULL),
('1009567', 'https://media.elcinema.com/uploads/_315x420_7d272523c83582a179c4bc0b7ebc25677fadf5dc59d78e7ca781f85e5e7b859e.jpg', 'Mohamed Abdel Moaty', 'Egypt', NULL, NULL),
('1009591', 'https://media.elcinema.com/uploads/_315x420_35153fadf2d88b8c9102cea10f8a631655880f3d13400963d27b592f97a29aa4.jpg', 'Sherif Salama', 'Egypt', '12 July 1979', 'Sherif is an Egyptian actor who is married to artist Dalia Mostafa. Sherif is also the younger brother of artist Manal Salama. He has several works including the cinema productions “Dars Khosousy” (“Private Lesson”), “Damm al-Ghazal” (“Deer’s Blood”) and “Murgan Ahmed Murgan”. His performances were outstanding in television series which included “Hadrat al-Muttaham Abbi”. Sherif also enjoys a temperament which appeals to acting and this has made critics hopeful about his future.'),
('1009693', 'https://media.elcinema.com/uploads/_315x420_cac5f01ab720d89ff9467c94001f88df1f46983ed9ed61cc8c7d237cd7691b6e.jpg', 'Youssef Chahine', 'Egypt', '25 January 1926', 'Youssef Chahine (born in Alexandria, 1926) started studying in a friars\' school, and then turned to Victoria College until the baccalaureate. After one year in the University of Alexandria, he moved to the U.S. and spent two years at the Pasadena Play House, taking courses on film and dramatic arts. After returning to Egypt, cinematographer Alevise Orfanelli helped him into the film business. His film debut was Baba Ameen i.e. Father Ameen (1950)”. One year later, with “Ebn Aal-Neel Son of the Nile” he was first invited to the Cannes Film festival. In 1958, he directed “Baab al-hadeed i.e. Cairo Station” and”Djamila Bouhired”. In 1970, his film “Al-ard i.e. The land” wone a Golden Tanit at the Carthage Film Festival and was nominated for Palme d’Or. With “Al-osfour i.e. The sparrow (1973)”, he directed the first Egypt-Algeria co-production. He won a Silver Bear in Berlin for “Eskendereyya..leih? Alexandria..Why? (1979)”, the first of what proved to be an autobiographic set of films, completed by “Haddouta Masreyya i.e. Egyptian tale (1982)”, “Eskendereyya kamaan we kamaan i.e. Alexandria again and forever (1990)” and “Eskendereyya..New York i.e. Alexandria..New York (2004)”. \n\nIn 1992, French director Jacques Lassalle proposed him to stage a piece of his choice for the Comédie Française; Chahine chose to adapt Albert Camus\' \"Caligula,\" which proved hugely successful. The same year he started “Al-mohaager i.e. The immigrant (1994)”, a story inspired by the character of Prophet Joseph, son of Jacob. This had long been a dream-project. In 1997, 46 years and 5 invitations later, he was again selected Hors Competition in Cannes with “Al-masseer i.e. Destiny” and was awarded the Fiftieth Anniversary Prize (Lifetime Achievement Award for his whole works).\nBetween 1970 and 2002, Chahine won 7 awards from many International Film Festivals and was nominated 9 other times.\nWorth mention, Chahine always had his own way in acting which seems contagious to all his cast with a few exceptions. He established “Aflaam Misr al-Alameyya i.e. Misr International Films” along with Gabriel and Marianne Khoury.'),
('1009963', 'https://media.elcinema.com/uploads/_315x420_29fa4978175e80c60380356f188583510b5c0dc27a51f87bfabf0a1bb04e7fcd.jpg', 'Mohamed Al-Tagy', 'Egypt', '28 April 1954', NULL),
('1010520', 'https://media.elcinema.com/uploads/_315x420_81be931cbceba7a5b5d10433f3ea5de4083d0815d04e8b59661854970539b699.jpg', 'Kamal El Malakh', 'Egypt', NULL, NULL),
('1010679', 'https://media.elcinema.com/uploads/_315x420_1b92957bad94b8016a5104901eef98c32a6ddd5f9ca7f08c38c388f8b604ea54.jpg', 'Gamal Abdel Nasser', 'Egypt', ' 7 April 1959', 'Gamal Abdel Nasser is an Egyptian actor. He was born in 1959. He studied at the Faculty of Commerce in Cairo and the High Institute of Theatrical Arts. Since the beginning of his career, he worked mainly in television series, including “Hasad Elhob” (Love Harvest), “Layaly Elhelmeya” (Elhelmeya Nights), “Ahl Eltariq” (People of The Way), “Al Aa\'ila” (The Family), “Al Forsan” (The Knights) and “Al Sabbar” (The Cactus). Abdel Nasser also appeared in a few films, most of which were led by Nadia Elgendy, including: “Al Embratora” (The Empress) “Imra\'a Fawq Elqimma” (Woman Over the Summit) and “Imra\'a Hazzat Arsh Misr” (The Woman who Shook Egypt\'s Throne).'),
('1010983', 'https://media.elcinema.com/uploads/_315x420_8fd3a58d58717ca408a28500d444af59f49779bb7a2046bebb369859051c73e2.jpg', 'Mohamed Henidy', 'Egypt', ' 1 February 1965', 'Mohamed Heneidy Ahmed was born in the district of Giza and earned his bachelor’s degree from the Cinema Institute in 1991. Heneidy began his career acting in the play “Doctor Za’attar” and in the television series “A’la Asl Dawar,” “Al A’rdahalgy” and “Al Bakheel wa Ana”. Around the time that Heneidy made his cinema debut he also performed in some of his best known plays such as “ALabanda,” “Hazimny Ya” and “Al Mahzala Al Ardiyah.” Moreover Heneidy succeeded in demonstrating his comedic talent through a minor role in “Bakheet wa A’deela.” He achieved a high degree of success in the film titles “Isma’iliyah Rayeh Gayy” and “Sa’eedy fee Al Gam’a Al Amrikiyah.” Thus Heneidy was able to redefine the landscape of Egyptian cinema towards the end of the ‘90s. Soon afterwards Heneidy was recognized as a major star with high grossing movies. However Heneidy has lacked a lifelong relationship with artistically achieved directors or screenwriters. Following the success of his song “Kamannana,” Heneidy has integrated singing into many of his films.'),
('1010986', 'https://media.elcinema.com/uploads/_315x420_2829164edfc4e476a77271528ba256b765714d391a8650d32d140c1161f9a6ef.jpg', 'Omar Khairat', 'Egypt', '11 November 1948', 'Maestro ‘Omar Khairat is famous Egyptian composer, pianist, founder and conductor of \"‘Omar Khairat Band\". He was born in Cairo, raised in a family of musicians. His uncle is Abou-Bakr Khairat, the great Egyptian composer and architect, established the “Cairo Conservatoire” and enriched the Arab music with great symphonic pieces. Influenced by this legacy, ‘Omar Khairat discovered new musical dimensions in the emotions and memories of the Egyptian and Arab personality. He joined the Cairo Conservatoire in 1959, studied piano with Italian Maestro Vincenzo Carro and followed correspondence courses in music theory and composition with the Trinity College in England. ‘Omar Khairat shaped his musical identity as a professional independent composer achieving new musical visions characterized with deepness and richness. His debut performing in film music was “Leilet el-abd ‘ala Fatma i.e. The night of Fatma was arrested (1983)”. According to music experts and critics, ‘Omar Khairat\'s music bridges contemporary Arab music and Western music reflecting genuine maturity. Moreover, he is considered to be one of the most outstanding composers presenting successful works like “Al-‘arraafa wal-‘otour al-saahera i.e. The fortune-teller and the Magic Perfumes (1989)”, and the “Arab Rhapsody (1992)”. He also composed music for international events like the “National Feast of Oman (1993)”, the Inauguration Ceremony of “Bibliotheca Alexandrina (1996)”, “Carthage Festival”- Tunisia, “Operetta al-Sheikh Zaayed - Emirates (2000)”, “Panorama al-Abour” - Symphonic Poem - Cairo (1991), “Fine Arts Cycle - Spain (2004)”, “October Celebrations (2000)”, “Celebration of the Royal Jordan River Institution (2005)” , “Jarash Festival (2003), “Three Civilizations Celebration – Spain”, “Celebration of the Centennial Anniversary of the Egyptian Cinema” and many other. He regularly performed at the Cairo Opera House and all the Egyptian and Arab ceremonies during the last fifteen years. His repertoire includes more than fifty works for cinema and more than 20 in TV. \n‘Omar Khairat received more than Arab and international awards such as; “Oman Award (1993)”, a Certificate of Merit and the Shield from the “7th Cairo International Song Festival (2001)”, the “Emirate Ministry of Media Award (2004)”, the “Royal Jordan River Institution Award (2005)”, Certificate of Merit and the Shield from the “Alexandria International Song Festival (2006)”, Certificate of Merit and the Shield from the “30th Cairo International Film Festival (2006)”. In 2008, he received the Middle East Music Award (MEMA).\n‘Omar Khairat married actor Jala Fahmy nad they got divorced. He is now married to Mrs. Naglaa al-Ghannaam, he is the father of ‘Omar (junior) and Sherine and he is the grandfather of Adam.'),
('1011057', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أسامة حسين', 'Egypt', NULL, NULL),
('1011093', 'https://media.elcinema.com/uploads/_315x420_6e80461ac9afbeeccd86eba248fc117dc079212fe55abc35a462e89265de2dbd.jpg', 'Dalia Mostafa', 'Egypt', '12 April 1980', 'Dalia started acting through her aunt actress Nahed Roushdy. She acted in a children\'s play called \"Sinbad\" as well as the mini series \"give back my heart\". She graduated from the high institute of theater. She shone in her parts in the mini series \" The shade\'s shadow\" , \"defiance\" ,\"Ibn Barkook Alley\", \"The Secret Word\" and \"The Girls\"'),
('1011096', 'https://media.elcinema.com/uploads/_315x420_43ffe0c37effd8675a6ebed7fa83c50ff5dd988090627f66396a3be48d147365.jpg', 'Ines El Masri', 'Egypt', NULL, NULL),
