('1011497', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد شحات', 'Egypt', NULL, NULL),
('1011798', 'https://media.elcinema.com/uploads/_315x420_ecf11ed96cfefb6b2551fb6bfa282d82bd8a1c77044d04fec92be4d95623a389.jpg', 'Khaled Telmissany', 'Egypt', ' 1 December 1966', NULL),
('1011858', 'https://media.elcinema.com/uploads/_315x420_675d40fdbf0f6efd2257f738be713f12fce719d61d2148248a97d4453f71e61a.jpg', 'Bassem Samra', 'Egypt', '24 May 1971', 'Bassem Samra was born in the village of (Al Saff) in Giza. He has earned an (industrial diploma). His (cinematic career) began with his participation in the documentary film (“Al Qahira Munawara bi Ahlaha”). \nHe has worked as a teacher and (an autobiographical film has been made about his life titled (“Sibyyan wa Banat”). The film is a lengthy documentary directed by Yosra Nasr Allah.\nHe has also worked on several documentaries including. (“Amir min Misr”). He received the (Carthage film festival award) for (his work on the film) (“Al Madina”).'),
('1011913', 'https://media.elcinema.com/uploads/_315x420_fd9f3df6887c5195831bf90e7b47e136f0bbacbfd7b6297b236eea737c139128.jpg', 'Hayatem', 'Egypt', '22 July 1949', 'The famous dancer\" Hayatem-Sohair Hassan\" was born on the 22nd of July 1950 in Alexandria. She was married to actor Mohamed Khairy then they got divorced.\nShe started her career as a supporting actress in cinema and on stage. In 1997 she produced one of her plays \"Ya ana Ya enta\"-\"Either me or you\". She also starred in \"Haat Farkha\", \"Bedaya we Nehaya\", \"Mahragan El Haramya\", \"Al Sayeda Wasalo\", \"Ana We Heya We Meraty\". Moreover from her series \"Zaman Emad El Din\".'),
('1011944', 'https://media.elcinema.com/uploads/_315x420_75faa9a18b7224d8cc4830a711ba0961505b818f3124e9d74bf51ded2858893f.jpg', 'Wafaa Salem', 'Syria', '23 July 1964', 'Wafaa Salem is a Syrian actress. She was born in Aleppo in 1964, and studied philosophy at college, then travelled to Cairo to join the High Cinema Institute. There she met dierctor Atef Salem, who cast her as the female lead in his film “Al Nemr Al Aswad” (The Black Tiger) alongside Ahmed Zaki. She then starred in numerous films, including “Ibtisama fi Oyoun Hazina” (A Smile on Sad Eyes) and “Alzawaf wal Sayf” (Marriage and Summer). She then switched her career to television series, among which were “Haroun Alrashid”, “Maleka fil Manfa” (A Queen in Exile), “Al Daly” and “Al Amaleya Messi” (Operation Messi).'),
('1012220', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Abd El.Hakem Al.Remawy', 'Egypt', NULL, NULL),
('1012266', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Doaa Fadel', 'Egypt', NULL, NULL),
('1012454', 'https://media.elcinema.com/uploads/_315x420_1d0e2855edd2ad42b2f471659e80fbef51d2b83f8f4679f455e7e07f246fdbeb.jpg', 'Agamy El-Sayed', 'Egypt', NULL, NULL),
('1012542', 'https://media.elcinema.com/uploads/_315x420_7f53880eac932b8125e5710aaf0b5c310da988dc00f888b20538bac2d218f4e1.jpg', 'Doaa Nagy', 'Egypt', NULL, NULL),
('1012626', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Yehia Abbas', 'Egypt', NULL, NULL),
('1012745', 'https://media.elcinema.com/uploads/_315x420_038ab80f09ba1046486f50905a9824ed5613f2f876cee19822d6a9d4eb9d4f5c.jpg', 'Rajaa Hussain', 'Egypt', ' 7 November 1937', 'Ragaa Hussein, whose full name is Regaa Hussein Ismail, is an Egyptian actress who was born in the Qalyubiya Governorate in Egypt in 1937. In the beginning of her career, she worked in the Naguib El Rehaany acting troupe, and then film and television starting at the beginning of the 1960s. The films she has acted in include: “Afwaa We Aranib” (Mouths and Rabbits), “Hadouta Masriyya” (Egyptian Story), “Almutawahsha” (The Wild), “Abnaa’ Wa Qutla” (Sons and Killers). The television serials she has appeared in include: “El Shahid We El Domou’” (Honey and Tears), “Rihlat El Sayyid Abu El ‘Eila El Bashary” (The Journey of Sayyed Abu El ‘Eila El Bashary), “El Mal Wa El Banoon” (Progeny and Money), and “Zezenia.”'),
('1012784', 'https://media.elcinema.com/uploads/_315x420_d63373e1852ee0e76ec0175677bb44d0448f98cb1f76b5c04f075955dff9d75f.jpg', 'Nashwa Moustafa', 'Egypt', '15 October 1968', 'Nashwa graduated from the Institute for Theatrical Arts. She has worked on the television series “Khalty Saffiyah wa al-Deer” (“My Aunt Saffiyah and the Monastery”), “al-Ameer al-Maghoul” (“The Mysterious Prince”), “Nahnnu la Nazra’ fee al-Shawk” (“We Do not Sow Thorns”), “Raddya Raddya wa Arda mosh Raddy” (“Satisfied”) and “Zaman ‘Emad al-Deen” (“The Age of ‘Emad al-Deen”). Moreover she has also taken part in the theatrical productions “Iz’areena”, “Lan Tasqut al-Quds” (“Jerusalem Will not Fall”) and “al-Nass al-ly fee al-Talit”. Nashwa made an outstanding comedy actress when representing the character of the spinster looking for a husband. Thus she has portrayed such roles in “Film Thaqqafy” (“Educational Film”) and “al-Raggul al-Abbyad al-Muttawasit” (“The Average White Male”). However it should be noted that she has sometimes exaggerated her performances of such roles.'),
('1013266', 'https://media.elcinema.com/uploads/_315x420_08149f14f244a52db9558f436a6a72ce5d1db43c116ce9c63c2c019ec6b4aacd.jpg', 'Magdy Edris', 'Egypt', '10 August 1969', NULL),
('1013295', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'ستوديو نحاس (النيل)', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1013356', 'https://media.elcinema.com/uploads/_315x420_df4e551f1c56fde5608b9695f1bb6e1393c8fdc513acbbcc8e99eb13b4903bb2.jpg', 'Medhat Al-Adl', 'Egypt', '13 January 1951', 'Medhat Tawfeek al-Adl was born Mansoura (Delta of Egypt) in 1951. He graduated from the Faculty of Medicine in 1981 and worked for two years as a doctor. He started his career in art in the mid 1980’s when he wrote the lyrics of a number of songs of Amr Diab’s film “Ice cream fi Gleem” for which he wrote the dialogue. He also wrote the dialogue of a big number of films; “Amrika shikabika”, “Harb al-farawla”, “Qeshr al-bondok”, “Saeedy fel-game’a al-Amrikeyya”, “Short we fanella we cap”, “Walad we bent” and “Al-dealer”.\nMedhat also prepared the script of a number of TV series; “Mahmoud al-Masry, “Al-andaleeb”, and “Kessat hobb”.'),
('1013465', 'https://media.elcinema.com/uploads/_315x420_56d75147dfcef7aad16ebce83b08043703341d0a432aa1ca7842f0d403549353.jpg', 'Abeer Mikkawi', 'Egypt', '24 September 1978', NULL),
('1013507', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohammed Abdulhasib', 'Egypt', NULL, NULL),
('1013546', 'https://media.elcinema.com/uploads/_315x420_b0d10e57d401554b0b1aa3454a3b1ae0bc931cfb125b3093be0a1a0a152b2b1f.jpg', 'Ahmed Abdel Wareth', 'Egypt', '18 October 1947', NULL),
('1013725', 'https://media.elcinema.com/uploads/_315x420_a153552fa6c01d54013bd50664154ecaf041eba821eaf20659f1d2126f2933f6.jpg', 'Nelly Karim', 'Egypt', '18 December 1974', 'Nelly Mohamed was born in Alexandria to an Egyptian father and a Russian mother. She graduated from the Ballet institute at the Art’s Academy and thereafter pursued higher studies. Nelly Karim began dancing ballet at the Opera in 1991. In 1999, Nelly starred in the Ramadan trivia show. She has performed in the television series “Wajh al-Qammar” (“Face of the Moon”), “Hadeeth al-Sabah wa al-Masaa” (“Morning and Evening Talk”), “al-Houb al-Kabir” (“Major Love”) and “al-Bannat” (“The Girls”).\nNelly is married and has two sons.'),
('1013907', 'https://media.elcinema.com/uploads/_315x420_84bb5e0987d0e7c95bd74d077f29f262257bb6117a37b56458e62dbed9fda84d.jpg', 'Ibrahim Nasr', 'Egypt', '18 August 1946', 'Born in Shobra neighborhood in Cairo. He achieved a literature degree in 1972. He also won many awards in the acting team within the university. He started off by imitating thehe stars and singing especially stars like Ameen El Henaidy. He also did children’s programs and was involved in many television series, as well as plays. His most famous appearance was through the Egyptian program “Candid Camera” impersonating a female called “Zakeya Zakaria” which was imprinted in the minds of many Egyptians. He played various roles between the villain and the hero who saved the day.'),
('1014035', 'https://media.elcinema.com/uploads/_315x420_99c38d3ada6e83c73df3c8cadf490109b37453b7ac6e2797277bb9d256f1405a.jpg', 'Hanady Muhanna', 'Egypt', '28 July 1998', NULL),
('1014087', 'https://media.elcinema.com/uploads/_315x420_3b5d64df4107b6329983ea3837213758e5aee7e03459f3194133f697bcddd008.jpg', 'Ahmed El Sobky', 'Egypt', '14 September 1957', 'Ahmed Al Sabbky is an Egyptian producer, most of his films have been quite successful at the box office despite being subject to attacks from critics. Al Sabbky states that his works seek to engage the working classes from which he originates, thus he adds that he knows how to connect with normal moviegoers. Nonetheless Al Sabbky is constantly attacked by critics who describe his works as base and unsubstantial. Despite the views of critics Al Sabbky’s works are nonetheless very successful at the box office.\nAl Sabbky’s career in cinema began when he opened a video club in the 1980s atop a family owned butcher shop in the district of Al Dokki. Al Sabbky’s video club specialized in distributing and promoting foreign films in Egypt. The video club met with a high level of success and led to him and his brother owning one of the most successful film distribution houses in the Middle East.\nThereafter Al Sabbky began his run as a producer and collaborated with his brother Mohamed Al Sabbky to found a producing label in the early ‘90s – “Al Sabbky for Artistic Production”. Al Sabbky’s first work was “E’youn Al Saqr” (“Eagle’s Eye”) which featured the performance of Nour El Shereef. Subsequently Al Sabbky produced “Master Karateh” (“Karate Master”), “Sawwaq Al Hannim” (“Lady’s Driver”) and “Al Ragol al Thalith” (“The Third Man”) which starred Ahmed Zaky. The Al Sabbky brothers also produced other works, their most successful endeavors being “Al Lemby” and “El Bally Ballak” which featured the performance of Mohamed Sa’ad. Those two titles achieved a particularly high level of success at the box office.\nAhmed Al Sabbky has recently separated his activities from those of his brother so that both brothers now run independent production labels. His first production works following the split were “Cabaret” and “Al Farah” (“The Wedding”) which achieved  commercial success in addition to being well received by audiences.'),
('1014111', 'https://media.elcinema.com/uploads/_315x420_2178c1be51569dfdfeb35b143ba6fd2c492d1aa242b89f8df0900aff17046707.jpg', 'Hesham Maged', 'Egypt', '26 April 1980', 'An actor and a script writer, graduated from School of Engineering Cairo University. During university, he created a production company with his friends called “Tamr Hendi” that produced movies that ridiculed famous Egyptian movies. Most famous was “Men who do not know the impossible” \nThis work attracted the attention of Mohamed Hefzy who at the time was attempting production and he produced their first series “Afeesh wa Tashbeeh” which portrayed one of the Egyptian classics in a cynical way in each episode. \nHefzy then produced for them the movie “Coded Paper” which was a big hit in the box office. Hesham acted and wrote the script for this movie which familiarized his face to the audience. He won the award of the “Best New Faces” for the year 2008, in participation with his mates Ahmed Sabry and Chico.'),
('1014252', 'https://media.elcinema.com/uploads/_315x420_7a2d72944feca16407d1fbe516bb7389060c17b0a59b970a077231a42207b136.jpg', 'Khaled Saleh', 'Egypt', '23 January 1964', 'Khaled Saleh is an Egyptian actor born on January 23, 1964 in Giza. He began acting in college where he took part in stage productions. He then performed in amateur theaters like the Hanijjar then later on the Egyptian Opera House, where he stayed for a long time. Throughout this period, Saleh also did some business on the side. He completely devoted himself to acting in 2000, and at age 36 rose to prominence for his talented performances as complex, tyrannical villains. His most important films are \"Tito\" and \"The Yacoubian Building\" (2006) based on the best-selling Alaa Al Aswany novel. He\'s also known for his television work on \"Sultan El Gharram,\" which aired during Ramadan 2007, and \"Baad el Farraq\" (Post-Split) which aired during Ramadan 2008. In 2007, he appeared in films \"Ahlam Haqiqia\" (Real Dreams) and the Youssef Chahine and Khaled Youssef co-directed film \"Heya Fawda\" (Chaos, This Is). His recent film credits include \"Al Maslaha\" (The Benefit) and \"Black February\" in 2012.'),
('1014286', 'https://media.elcinema.com/uploads/_315x420_b6bf5a02b719e34b98b5f96904662488b71e9b2c65a4d3c8d70791cfae4aaffe.jpg', 'Menha Zaytoon', 'Egypt', '15 September 1960', NULL),
('1014315', 'https://media.elcinema.com/uploads/_315x420_b0a661c56c42efb99537a8075acc5b8ff524b387ce5b1ae7cf98af2b42fc16c9.jpg', 'Mahmoud Abdelmoghni', 'Egypt', '10 June 1979', 'Mahmoud Abd Al Moghny’s love for acting was evident from high school. After his graduation he enrolled in (the Institute of Theatrical Arts). He did this despite warnings from (those around him) that the entrance examinations are difficult and that (agency) is usually required for admission. Nonetheless, he placed his faith in God and in his talents. Among 12,000 applicants, only himself and eleven other individuals were granted admission.\nThrought Mahmoud’s period at the institute (he was known for his hard work ) and was regarded positively by the overlooking directors. Nonetheless, he rejected the idea that he should (act for free in the hope of making contacts here and there). Indeed he felt that his talents made him deserve something better and (chose to begin his acting career on the theatrical stage). \nMahmoud’s (keen spirit, together with his outstanding talents) had driven him to act while at college. He also participated in several (festivals) including the (Experimental Theater Festival) and a few festivals held in Jordan and Italy. Mahmoud received several awards at those festivals.\nMahmoud graduated from the (acting and directing division of the Institute of Theatrical arts in 2000). Thereafter, he acted in Sherif Arafeh’s film “Aboud Ala Al Hudoud”. This role made Mahmoud more familiar to cinema audiences. His debut in drama was in the television series “Al Raqs Ala Salalim Mutaharika” which was directed by Moustafa Al Shal. (?) (A fortunate coincidence of circumstances meant that he succeeded brilliantly in that role.\nFollowing that performance, Mahmoud took part in the television series “Zizinia” (where he acted alongside Jamal Abd Al Hamid. That role was followed by one in the film “Sayea Bahr”.\nThereafter, he would act in the television series “Al Rimmal”. In order to film the series, Mahmoud had to stay at Al Gouna for a period of nine months. While there he did some deep thinking about his career thus far and concluded that he would revise (his methods and approach) so that he has a (deeper effect on his audiences).'),
('1014397', 'https://media.elcinema.com/uploads/_315x420_164bd691aa0fca2e0b3465f8fcdc18e309680a26b6aa36487ef5a151b4f930d8.jpg', 'Enas Mekky', 'Egypt', '14 January 1973', 'Enas Mekky is an Egyptian actress born in Ouargla, Algeria to an Egyptian mother and Algerian father. She was raised in Egypt by her Egyptian family after her father leaving them at young age. Enas holds a B.A. of Arts from the Cairo University. Mekky started her acting career in mid 1990s in the Egyptian Cinema. She is well known for playing the American in the TV series “Lan a’eesh fee gelbaab aby i.e. I will not live in my father’s robe”. “Awaan El-ward i.e. A time for flowers”, “El-helm wal-alam i.e. The dream and the pain” and “Ya ‘aalam yahoo i.e. O people!” are among her famous TV series. On stage, she played a lead role in “Gonoun El-bashar i.e. Human Craze”.'),
('1014426', 'https://media.elcinema.com/uploads/_315x420_7684fb038041c5cd4e98016a7a2ea963c2a9a7cd6369657fe2fad5dbc398a23c.jpg', 'Yasmin  Alnagar', 'Egypt', ' 2 January 1972', NULL),
('1014466', 'https://media.elcinema.com/uploads/_315x420_fb618a52879effb61c8a5b9b9720cfbb4d89eeaf91915364f8fa57b1bf50f617.jpg', 'Medhat El Sebaie', 'Egypt', '25 August 1949', 'Medhat El Sebaie is an Egyptian director and writer. He was born in 1949. El Sebaie\'s career includes a prolific list of films and television series, and spans three decades. He started his directorial career in the early 1980s, with films like \"Wa Quyidat did Maghool\" (Filed Against Anonymous), \"Al Garih\" (The Injured) and \"Haret El Gohary\" (El Gohary Alley). Throughout his career, El Sebaie\'s films varied in themes and genres, like crime drama in \"Thalatha Ala Ma\'odat Eldam\" (Three Around the Blood Table) and social drama in \"Imra\'a Ayela Lel Suqoot\" (A Falling Woman). In 2013 he directed the television series \"Nazareyet El Gawafa\" (The Guava Theory), which he also wrote. He died in May 2014, at the age of 65.'),
('1014526', 'https://media.elcinema.com/uploads/_315x420_6eeb314021b60fd15de7ee917b6d24fd7c3147fe2c8cfa0331114782d2f61a07.jpg', 'Enayat Saleh', 'Egypt', NULL, NULL),
('1014539', 'https://media.elcinema.com/uploads/_315x420_f1eea428337e0124d5c1a8592ad23e0f1ebf4d0e1a311197c565f147fc9fbb76.jpg', 'Ali Hemeida', 'Egypt', '20 May 1965', NULL),
('1014560', 'https://media.elcinema.com/uploads/_315x420_dcf037e14ac085ed825687d25d7680f6b2e71bba8b3cc923d9797c95aae7a76b.jpg', 'Fayeq Azab', 'Egypt', ' 6 September 1943', 'Fayek Azaab is an Egyptian actor who was born on the 6th of September 1943. He is famous for his supporting roles. He participated in many movies that varied between being the evil and the kind character.'),
('1014656', 'https://media.elcinema.com/uploads/_315x420_83a22eeae04519ccc1571c55ee92aa03c82c205ea91288f5e057f8089cf9d288.jpg', 'Nabil Issa', 'Egypt', '24 October 1978', 'Nabil is a young Egyptian performer. (Mohamed Heneidy assigned him his debut role in the production “Ya Ana ya Khalti”).\nThereafter his career in cinema progressed.'),
('1014950', 'https://media.elcinema.com/uploads/_315x420_426332c58b47c4a1616fdb503926f2a53ae11330ab40a15beb2353f82d2c08cb.jpg', 'Madlyn Tabar', 'Lebanon', '26 February 1958', 'Madeline Taber, born Madeline Taber el Khouri, is a Lebanese actress originally from Beirut. In 1982, she graduated from college with a degree in media and worked as radio and television news correspondent in Lebanon. She began to act in Lebanon--her film work from this period includes \"Kafroon\" (1992) in which she co-starred with Syrian actor Duraid Lahham. She then moved to Cairo where she established herself in television with roles in the shows \"Farewell, Cordoba,\" \"Hearts of Gold and Copper,\" and \"Confused Hearts.\" She also acted in a few TV movies like \"The Road to Eilat.\" \n\n\nMadeline Tabar is a Lebanese actress who was born in Beirut and graduated from media school in 1982. She worked as a journalist and TV presenter for some time in Lebanon, and later on took up acting where she presented many movies, such as the movie “Kafroon” opposite the legendary Syrian actor Doraid Lahaam. \nShe then decided to come to Cairo in 1992. In Cairo she proved herself in series such as “Goodbye Cordoba” , “Souls of Gold and Brass”, “Wandering Hearts”, “Monira Days” and finally “The Knights”'),
('1015057', 'https://media.elcinema.com/uploads/_315x420_3f21372812a4c45378e8c97af80d6ced7edaf8b5a5f46ce78203a786469795a8.jpg', 'May Kassab', 'Egypt', ' 8 December 1981', 'Mai Kassab got her start in music as part of a musical duet with the Syrian musician Magd Al Kassem. Their band was called “Ghamid Eneyk” and released its first album “Hagga Tiksif” in 2005. In 2007, the band released another album called “Ahla al Kalam.” Mai’s first television role came in 2006 when she acted alongside the Ahmed Al Fishawi in a comedy television series titles “Tamir wa Shawqiyah.” Thereafter, Mai appeared in a number of film roles, the best known of which are “Cabareih,” “Al Farah,” and “Bobos.”'),
('1015062', 'https://media.elcinema.com/uploads/_315x420_4c12ea8b6cc2b1131c1da299d18ec690c154eb6bcb39a72d450133b7c6bcfb03.jpg', 'Ayman Shahin', 'Egypt', '26 February 1969', NULL),
('1015189', 'https://media.elcinema.com/uploads/_315x420_2f23ed41c40f97ab553f14255c6d56e1716e3128112a96e256c31d29ba1fcb69.jpg', 'Wafaa El Hakiem', 'Egypt', '17 November 1963', NULL),
('1015376', 'https://media.elcinema.com/uploads/_315x420_d75f3cf094b0af8c22c5cf2e145b7bc9c78bf3448a3d6b6bbc5aec9c59e18136.jpg', 'Hassan Abdulfattah', 'Egypt', ' 1 January 1965', NULL),
('1015623', 'https://media.elcinema.com/uploads/_315x420_f18076259e8dc06a5847d7f21b18a1b8e0a5010748361a211ae135991e9ce13f.jpg', 'Mohamed Hammam', 'Egypt', NULL, NULL),
('1015677', 'https://media.elcinema.com/uploads/_315x420_e972730ff109e8f26754f8f20db0df14eb1de90806629dea4e29cbabbaf948bd.jpg', 'Lekaa Elkhamissi', 'Egypt', '15 March 1978', 'Lekaa Abdul Malek al-Khameessy graduated from the High Institute of Dramatic Arts after finishing her commerce studies. She worked a as teacher at the University of 6 October. Lekaa participated in the play “Tehebb teshouf ma’ssaah i.e. Do you want to see a tragedy”. For TV, she played in many TV series such; “Al-‘attaar wal-saba’ banaat i.e. The perfumer and the seven girls”, “Haarat al-Tablaawy i.e. The Tabalaawy alley” and “Shabaab online i.e. Online youngsters”, she also played the radio series “Gaarat al-kamar i.e. The moon neighbor”.'),
('1015887', 'https://media.elcinema.com/uploads/_315x420_eb34c4df3a69824e46905e71b50b87216c56c3019cc013f89ad7bbaaf502494d.jpg', 'Abdel Moneim Riyadh', 'Egypt', NULL, NULL),
('1015899', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Hassan Shabaan', 'Egypt', NULL, NULL),
('1015958', 'https://media.elcinema.com/uploads/_315x420_01acc587360d1e3416f3e90a2d2e56dcaf0125f53c02b430c67806cabe4b2721.jpg', 'Fardous Abdel Hamid', 'Egypt', '25 February 1947', 'Ferdos Abdel Hamid Mahmoud was born in Alexandria. She achieved a B.Sc. from the High Institute for theatrical arts in 1969. She started her acting career in the theater where she offered “Daeret Al Tabasheer Al kookazeya”, “Al Naar wal zaytoon”, “Al Gnes Al Thaleth”, “Afareet Masr El Gedeeda” and many more. She was also involved in some block buster series such as “Meezo”, “Lailat Al Kabd ala Fatma”, “Al Mashrabeya”, “Al Borkan”, “Mohamed Rasool Allah”, “Ana wenta we baba fee el meshmesh”. However, she was strikingly most famous for her television roles.'),
('1015994', 'https://media.elcinema.com/uploads/_315x420_dbbdfaf90370c0181d7afaab1b8053695b01ced6019dd3985325a6d51120ee14.jpg', 'Khaled El Sawy', 'Egypt', '25 November 1963', 'Khaled El Sawy is an Egyptian actor. He was born in Alexandria in 1963. He studied law at Cairo University, and started acting while at college on the university\'s theater, and after graduating in 1985, he studied directing at the Academy of Arts till 1993. El Sawy then started working as an assistant director on the film “Samaka we Arbaa\' Oroush” (A Fish and Four Sharks), then as a director for several of the Nile International network\'s satellite channels. El Sawy co-founded the Egyptian Foundation for Theater Enthusiasts. He wrote the plays “Haflet Maganin” (Crazy Party) and “Operette El Darfil” (The Dolphin Operette), for which he won the Taymour Award for Theatrical Ingenuity in 1991 and 1992 respectively. El Sawy\'s career includes a variety of distinct roles on film, including “Emaret Yacoubian” (Yacoubian Building), “Keda Reda”, “Cabaret”, “El Farah” (The Wedding) and “El Feel El Azraq” (The Blue Elephant). He also starred as a lead in television series like “Tofahet Adam” (Adam\'s Apple) and “Khatem Suleiman” (Suleiman\'s Ring).'),
('1016014', 'https://media.elcinema.com/uploads/_315x420_d1176a5aeab23dd6d9e48afc8cfb8bca033bd313928563aa07a693615332201e.jpg', 'Hala Fakher', 'Egypt', ' 8 June 1946', 'Hala Fakher Mohamed Fakher began her career in entertainment as a child when she partook in the cinematic production “Lann Abky Abadan”. \nHala studied at (Saint Claire) school. (Following her graduation, she participated in theatrical and television performances where she stood out as a talented comedy actor). Among (the works and theatrical performances in which she has participated are “Wagaa Demagh”, “Shahid ma shafsh Hagga”, “Al Belyatsho”, (“Paulo”), “Malak Al Qarabin”, “Al Zeer Salim” and “Al Layla al Al Beyda”.\nAmong her television performances is the children’s show “Bougy wa Tam-tam”. Hala has been particularly successful in her comedy roles where she has displayed a (great ability to innovate).'),
('1016035', 'https://media.elcinema.com/uploads/_315x420_2b844c2e723229465a84bc7faac27b1db50b4d4c792ed7124646053b4d99b626.jpg', 'Alaa Zinhom', 'Egypt', '30 July 1950', 'Egyptian actor Alaa Zinhom is best known for his comedy roles, with performances on television and in other works alongside major celebrities. He is known for his distinctive laugh and innocent smile that captivate his audience.'),
('1016144', 'https://media.elcinema.com/uploads/_315x420_39c292cd6ee7e57fe2657d5ed964aa75c131f5ae7df30ca48a72419ccc482404.jpg', 'Hany Salama', 'Egypt', ' 4 July 1977', 'Hany’s father previously worked as a media consultant in Kuwait. Prior to his discovery by Youssif Chahine Hany had earned a degree from a computer science institute.'),
('1016153', 'https://media.elcinema.com/uploads/_315x420_0e4c7be218eae13279a8c622fbb2e651b55c43764dc49bebe1973baf3eb576c7.jpg', 'Ahmad Haroun', 'Egypt', ' 9 May 1978', 'Ahmad Haroun is a young Egyptian actor who began his career acting in television commercials. He played a small role in the film “Sahar al-Layaaly\" (Sleepless Nights). He got his first leading role in \"Farah\" (2004) opposite Egyptian actress Mai Ezz Eldin, which launched his career.'),
('1016385', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Halim', 'Egypt', NULL, NULL),
('1016462', 'https://media.elcinema.com/uploads/_315x420_3845357e3dc9a2e0cd82ec3f245838b54793680b006550d626a2d455cd1fcdeb.jpg', 'Abdulla Meshref', 'Egypt', '15 February 1942', 'Egyptian actor Abdullah Meshref was born in 1942 and graduated from the High Institute of Dramatic Arts in 1968. He joined the Vanguard Theatre immediately following graduation, working with Mohammed Sabhy in his theatre troupe and appearing with him in several plays including: ”Waghat Nazer” (Point of View), “Takhareef” and “Le’bet El Set” (The Lady’s Game). He also worked in television drama and is most well known for his public character (Abdullah) in the series, “Yawmiyat Wanees” (Wanees’ Diary). With respect to cinema, Abdullah played a number of prominent roles, appearing in films such as, “Katibat El Aadam” (Execution Squad), “El Bayda wal Hagar” (The Egg and the Stone), “El Haroub” (The Escape), and “El Hasat El Saba’a (The Seventh Sense).'),
('1016754', 'https://media.elcinema.com/uploads/_315x420_88fc78da22c0304b3bffbe3e4aa81f995a796cc47bb0652538ff753824aebf77.jpg', 'Mahmoud Talaat', 'Egypt', NULL, NULL),
('1016790', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'سامي المغربي', 'Egypt', NULL, NULL),
('1016949', 'https://media.elcinema.com/uploads/_315x420_41a858f4e7a4fecc09848ad398a2835e12bcac124cbb2f458180deabbb22864e.jpg', 'Awatef Helmy', 'Egypt', ' 4 April 1942', NULL),
('1016985', 'https://media.elcinema.com/uploads/_315x420_eef2263b999e6849e61ca0146e3dd23af056a514c91cd0bf2f1f6392cd9596e2.jpg', 'Azza Bahaa', 'Egypt', '22 November 1968', NULL),
('1017285', 'https://media.elcinema.com/uploads/_315x420_5fecca70280b700b24eb86f0159e12cc57e3443d29f392fd4ed72a223c9feaac.jpg', 'Tarek Kamel', 'Egypt', NULL, NULL),
('1017488', 'https://media.elcinema.com/uploads/_315x420_e9ee58f6b180ac8c3bf8f7c6521ec30c376a27f689b3eff7653d859d4dd39b2b.jpg', 'Magdy Abd Al-Ghanie', 'Egypt', '27 September 1959', NULL),
('1017783', 'https://media.elcinema.com/uploads/_315x420_6b6cf405584b3b099046bf852846c004167941c5da5843a69b8845c1953753da.jpg', 'Yasser Galal', 'Egypt', '16 April 1969', 'An Egyptian actor, is the brother of actor Raamez Galaal, belongs to cinema and TV rising generation that shined at the end of 1990s. Yasser studied in the High Institute of Dramatic Arts in 1990. After graduation, he played a role in “Rahma wa ameer al-ghaaba i.e. Rahma and Prince of the forest”. Upon finishing his military service, Galaal worked in TV and Theatre. He excelled in TV series like “Lan a’eesh fe gelbaab aby i.e. I will not put myself in my father’s robe”, “Al-waa’d al-hakk i.e. The right promise”, “Nahnu la nazraa’al-shawk i.e. We do not sow thorns”, “Awlaad hadret al-naazer i.e. Principal’s children” and “Al-batal i.e. The hero”.'),
('1017811', 'https://media.elcinema.com/uploads/_315x420_b1797538b463e992612d640ff47c1e8752a99847fd41226f8201fd6218d871fb.jpg', 'Lucy', 'Egypt', '11 December 1960', 'Lucy’s real name is En’am Sa’ad Mohamed ‘Abd Al Wahab. She was raised on Mohamed ‘Aly street and spent a while working as an oriental dancer at weddings and nightclubs, she also performed minor acting roles before being scouted. Thereafter she acquired television and cinema roles and adopted the name Lucy Sa’ad for her acting career. Her television performances in “Layaly al-Helmiyah”, “Arabesque” and “Zezina” made her standout, the actress also performed on Ramadan trivia shows on an Arab network. Lucy received an acting award at the Alexandria Festival in 1996 and she married businessman Sultan al-Kashef from whom she had a son named Fathy. The actress played a leading role in the “Qima wa Cima” trivia show. Lucy’s career shows that she was adamant to succeed as following several minor roles she proved that she had talents aside from dancing through her performance in “Sareq al-Farrah” (“Wedding Thief”). However she did not establish the role in her subsequent films.'),
('1017923', 'https://media.elcinema.com/uploads/_315x420_43da77e203d51adf075f3b5fc5c71358ba24b79810d74427ba91e96176dbebdf.jpg', 'Ashraf Meslehi', 'Egypt', '23 April 1974', 'Ashraf Meslehi began his involvement in cinema by running cinema venues belonging to Misr International Films company that falls under the control of Youssef Chahine and producer Gaby Khoury. Ashraf presently manages more than one cinema chain which include Galaxy, City Stars, Sheraton and Odeon. \nAshraf recently had the opportunity to act in a film titled “Rendezvous” and he performed with success. Subsequently Ashraf has been offered several other cinema and TV roles.'),
('1017946', 'https://media.elcinema.com/uploads/_315x420_66c5a948c651211ceb9945a44b8c4d74708fc9401589d34d09d4e5a6d0f58023.jpg', 'Amir Karara', 'Egypt', '10 October 1977', 'Amir Karara is an Egyptian actor and broadcaster. He rose to fame through hosting television contest shows like Star Maker and The Deal. He played in the national volley ball team, in a lot of national and international games. He has a degree in tourism from Cairo University. His most famous television roles include\"Shabab Al Hawa\" (Guys on line), and \"Lahazat Hariga\" (The Egyptian version of ER),\"Taraf Talit\" (Third Party) and \"Taht El Ard\" (Underground).'),
('1018071', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmed Qorany', 'Egypt', NULL, NULL),
('1018134', 'https://media.elcinema.com/uploads/_315x420_84643cfc7b0da5f4feb9512dbaa6ca0e68bb8a7350a31881796184e4ff2a93ce.jpg', 'Mohamed El Sawy', 'Egypt', '12 June 1956', 'Mohamed El Saway is a comedian Egyptian actor who participated in many plays, movies and Riddles show with the late actor Abdel Moniem Madbouly including \"Gedo Abdo\" and\" and \"Al Omda Elaly\".'),
('1018181', 'https://media.elcinema.com/uploads/_315x420_5382c20f421458d9d88413fa29a3b76bd55bfd9ba733ff898e39c98e49656755.jpg', 'Farid Shawqy', 'Egypt', '30 July 1920', 'Fareed Shawky is one of the most famous Egyptian and Arab world actors. Born Fareed Shawky Muhammad Abdou in 1922 in the popular quarter of al-Sayyeda Zainab –  Cairo. After receiving the Applied Arts diploma, Fareed joined the High Institute of Dramatic Arts. Meanwhile he started acting small roles with Anwar Wagdy. He later wrote his own films and became a super star. Of his famous titles are; “Malek al-Terso i.e. The King of the Third Class”, “Wahsh alShaashah i.e.  Beast of the Silver Screen” and “Al-malek i.e. The king”. \nFor the first decade he played the villain, yet ended up playing more human touching roles. His action films attracted great audience of simple people.\nHe won the State award in 1955 “Gaalouny Mogremann i.e. They made me criminal”, in 1956, his film “Al fotowwa i.e. The bully” was nominated for Berlin Film Festival\'s Golden Bear  . In 1962, he received the state Production Award and in 1994 he was honored by the Cairo International Film festival. His films “Hakatha al-ayyaam i.e. So are the days” and “La tabky ya habeeb al-omr i.e. Don’t cry sweet heart”, won several prizes. \nOn stage, with Naguib el Reehany Troup he played the lead role in “Al-dallouaa  i.e The spoilt”, “Hekaayet koll yowm i.e. The everyday story” and many other plays.  Fareed also starred in a number of Lebanese, Syrian and Turkish films.\nShawky married Hoda Sultan his acting partner who gave him two daughters. After their divorce, he got married to Soheir Tork who also gave him two daughters.'),
('1018416', 'https://media.elcinema.com/uploads/_315x420_621e60e45c5eff942a8c6c9a624b94f7ed5843455fa2a4f4e88e620cc22bff88.jpg', 'Abbas Saber', 'Egypt', NULL, NULL),
('1018516', 'https://media.elcinema.com/uploads/_315x420_e986d112f27ce95dade4b4a3345d4b1d8d6d7410d5779acb483b249b0b106671.jpg', 'Kamal Mansour', 'Egypt', ' 4 June 1971', NULL),
('1018671', 'https://media.elcinema.com/uploads/_315x420_d5500d298e6ecb2283bd374d4755a6aa3fe71f247dcb78b3ee2e657bc5fc5fe4.jpg', 'Elshahat Mabrouk', 'Egypt', '11 August 1959', NULL),
('1018692', 'https://media.elcinema.com/uploads/_315x420_7a1c032714edc574dc20a193f800ae584e08402f237d327ea2701af6e7ecf1f7.jpg', 'Khaled Abol Naga', 'Egypt', ' 2 November 1966', 'Khaled Abol Naga is a versatile Egyptian actor, model, TV host, producer and director. He was born in Cairo in YEAR, and began his career in films at the tender age of 12. He has degrees from both Ain Shams University and the American University in Cairo in communications. He continued his education in the United States where he studied film and theater. In the late 1990s, he became a popular TV show host, working on \"Good Morning Egypt.\" In the 2000s, Naga worked on a diverse array of projects, proving his dexterity and ability to deliver in bigger budget as well as smaller, indie flicks. His film credits include the hit \"Sahar El Layali\" (2003), \"Hob El Banat\" (2004), \"Banat Wust El Balad\" (2005), \"Civic Duty\" (2006), and \"Kashf Hesab\" (2008) which earned Naga critical attention. In 2008, he began what would be a continuing collaboration with independent director Ahmad Abdalla. Naga co-produced and starred in \"Heliopolis\" for then first-time director Ahmad Abdalla. They later worked together again on \"Microphone\" (2010), which was a huge success around the international festival circus. The drama revolves around Khaled returning to Egypt and discovering the underground music and arts scene in Alexandria. The film conveyed the political angst and disillusionment that helped bring about the January 25 Uprising, making the film, which was shot in the months leading up to the revolution, a freeze frame of Egyptian youth before the history-altering outburst in 2011. Naga has won over eight best actor awards from Egyptian and international festivals. In 2006, he won Best Actor at the Alexandria International Film Festival for \"Leabet el Hob.\" Naga is a Human and Child rights activist and has been a UNICEF Goodwill Ambassador since 2007. He has talked recently about his new project, \"Tahrir Tahrir,\" a docu-drama telling the inside story of the Egyptian Revolution.'),
('1018798', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed El Sisi', 'Egypt', NULL, NULL),
('1018885', 'https://media.elcinema.com/uploads/_315x420_4bfd528aacdef7c9d777ef916f376c56776502273acfa444fcbebbc699d03487.jpg', 'Farah Youssef', 'Egypt', '11 November 1982', 'Farah Youssef is an Egyptian actress who was born on November 11, 1982. She started acting at the age of 7 in plays and independent films. She made her real professional debut in the film \"El Magic\" with a group of fresh, new faces in the industry, and followed it with \"War\'a Shafra\" with the same group of actors. Both films were the product of the great Hussein El Qla. Her other film credits include \"Balad El Banat,\" \"Mafish Gher Keda,\" and lastly \"Qobolat Masrou\'a\" (Stolen Kisses), \"Ibrahim Al Abyad\" (White Abraham) with Ahmed El Sakka, and with Amr Waked in Ibrahim El Batout\'s political drama \"Winter of Discontent\" (2012) about the turmoil that foreshadowed Egypt\'s 2011 uprising against Hosni Mubarak and his security state.'),
('1018914', 'https://media.elcinema.com/uploads/_315x420_b280b71725988742acc9aba96bf5bd5c25335a972170d302c6f06b0f2cf57344.jpg', 'Moshira Ismaeil', 'Egypt', '26 September 1950', NULL),
('1018956', 'https://media.elcinema.com/uploads/_315x420_7053396db1ff98c74d5e926bad1008487c383102f13c40d5ca489a011815848d.jpg', 'Fouad Sharaf El Den', 'Lebanon', '12 April 1941', NULL),
('1018985', 'https://media.elcinema.com/uploads/_315x420_fcacaec0afe8fd48282ae0ae3f0ae2b33e7cb23247740bfc2153c27a44a544e0.jpg', 'Amal Ibrahim', 'Egypt', '12 January 1941', 'Aml Ibrahim is an Egyptian actress who started acting when she was young. During this time, she had a number of small roles in evening television shows, plays, and TV serials. Her big break came in 1973 with her role in the comedy “Madrasat Al Mushaghebeen” (School of the Mischievous), as well as later in the film “Bidour.” \n\nAml had successive roles in cinema and television and theater. Of her most important performances include: her performance in the early 1990s film “El Kit Kat” which started actor Mahmoud Abdel Aziz, as well as her role in El Hariban (The Fugitives), and her distinguished performance in the TV series “Sir El Ardh” (Secret of the Earth). She also had an important role in the second part of the TV series “Zezenia” which starred actor Yehia El Fekharany, actress Fardous Abdel Hamid, actress Hala Sedki, and other stars. One the last films she acted in was “El Prinseesa” (The Princess) with Ola Ghanem in 2013.'),
('1019067', 'https://media.elcinema.com/uploads/_315x420_4f0c1d38d889e24443b7a54f8e28757bd5e46c093500a2572b64bbb19869e835.jpg', 'Fathy Abdul Wahab', 'Egypt', '21 August 1971', 'Fathi is a bit of a rebel and a dreamer. He has succeeded in securing celebrity status for himself within the short span of a few years despite the fact that he does not place great value on being famous nor on assuming leading roles in performances. \nHis journey as an artist began in his college where he was enrolled in the faculty of commerce. At that point, Fathi used to perform on an amateur level. (This was until a friend of his applied on his behalf for a television production.) Thereafter, Fathi took part in three back-to-back seasons of the television show “Bilarabi Al Faseeh”. Following that stint, Fathi’s career in cinema took off.'),
('1019103', 'https://media.elcinema.com/uploads/_315x420_37aac9d4583a12e62333cca55b1e4a118d03876c59e3f0686b5f37e85ca22d47.jpg', 'Nabil Al Helfawi', 'Egypt', '22 April 1947', 'Nabil Mohamed El Halafawi was born in Giza and raised in Sayeda Zeinab. He achieved his B.Sc. in theatrical arts in 1970. He was known for his poetry and his serious roles in front of the camera. Some of the plays he was involved in were : “Afreet li kol mowaten”, “Daeret al tabasheer al kookazeya” and some of his series were “Domoo Sahebat Al Galaalaa”, “Hekayet Madina”, “Al Hob wa Ashyaa Okhra” , “Rafaat Al Hagaan” and “Al Afyal”. As for his movies there was: “Al Tareek ila Ilaat”, “Ghawayesh”, “Al Zeiny Barakaat” and “Hekaya bila bedaya we nehaya” and many more.'),
('1019247', 'https://media.elcinema.com/uploads/_315x420_caa7c5febdca20f407da0ea73a163081f2222711ee63aab280acdcf18be2c8e6.jpg', 'Sabri Abdulmonem', 'Egypt', '23 July 1947', 'Sabry Abdel Moneim Hussein achieved a bachelors degree in Theatrical arts. Worked in many plays and mini series for national television amongst the most famous is \"Gohaa in Town\"'),
('1019254', 'https://media.elcinema.com/uploads/_315x420_8a305d61f150916a7caaeb875a9f95e91c1fc98e7245eaf78759d61e837bebe8.jpg', 'Lobna Wanas', 'Egypt', NULL, NULL),
('1019263', 'https://media.elcinema.com/uploads/_315x420_099cfdcceb403c2ca2172ecf1eb9da8294b2492808dd909366ef9994ff039263.jpg', 'Ehab Mohamed Ali', 'Egypt', NULL, NULL),
('1019335', 'https://media.elcinema.com/uploads/_315x420_bd079015c3a9f53942890f8a45a9211d402f700e769b1493bd2a133483500596.jpg', 'Wafaa Amer', 'Egypt', '25 May 1968', 'Wafaa A’bd Al Ghaffar was born in Alexandria. She graduated from the literature faculty at Beirut Arab University. She also enrolled at the Higher Institute for Theatrical studies. Whilst at college, Wafaa took part in collegiate theater productions. \nWafaa’s acting career began when she assumed a part in the television production “al-Zawg Awal man Ya’raf” (“The Husband is the First to Know”). Her performances in “Layaly al-Helmya”, “Zaman al-Houb al-Da’e” (“The Age of Squandered Love”), “Ameera min A’bdeen” (“A Princess from A’bdeen”), “Imsik Hokouma”, “Zi-ab al-Gabal” (“Mountain Wolves”) and “Faris bela Gawad” (“Horseless Knight”) were particularly successful. “Feema yabdo Saraqo A’bah” (“It Appears that They have Stolen A’bdah”) is one of her plays.\nWafaa is married to Eng. Mohamed Mustafa Shamy.'),
('1019407', 'https://media.elcinema.com/uploads/_315x420_c8e6d5e57dd7935770225b41a90fb02802c63e5e0962aa4782495dd657a9794b.jpg', 'Adel El Maghraby', 'Egypt', '29 November 1962', NULL),
('1019457', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Magy Mokhtar', 'Egypt', NULL, NULL),
('1019493', 'https://media.elcinema.com/uploads/_315x420_ee5431046bad76e3bd42e711aa6401663c52003ccd5b49dd838f1e9e2d8c981f.jpg', 'Tamer Abdelmonem', 'Egypt', '12 July 1973', 'Tamer Abdelmoneaim is an Egyptian actor and screenwriter. He was born in Cairo in 1973. He graduated at the High Cinema Institute of Cairo from the screen writing department. He started working as an actor through minor roles in films like “Edhak Elsoora Tetlaa Helwa” (Smile For A Good Picture) in 1998 and “Etfarrag Ya Salam” in 2001. He co-starred in “Amir Elzalam” (The Prince of Darkness) alongside Adel Imam in 2002, for which he also wrote the screenplay. He also appared as the lead actor in “Al Meshakhasaty” (The Master of Disguise) in 2003, which flopped at the box office.'),
('1019700', 'https://media.elcinema.com/uploads/_315x420_eb8cac6661d15dc789d32c2caeddcfdb62d903a214ad161203bcdd3d9b0d6898.jpg', 'Khairy Beshara', 'Egypt', '30 June 1947', 'Khairy Beshara is an Egyptian film and television director. He was born and lived his first five years in Tanta, then moved to Cairo with his mother who worked there. He studied film directing at the High Institute of Cinema and graduated in 1967. He then worked as an assistant director, and moved to Poland for a year for his post-graduate studies, where he met his wife. Upon his return to Egypt, he continued working as an assistant director, in addition to teaching acting and screenwriting at the institute. In the period between 1974 and 1986, he directed 12 documentary and short fiction films. His first feature length film was an Egyptian-Algerian co-production, and took 4 years to produce. It finally premiered in 1982. He then went on to direct 11 other feature films, most of which were critically acclaimed and gained cult followings, and several television series.'),
('1019715', 'https://media.elcinema.com/uploads/_315x420_22d327963190294b26cb73adac08cb138dca1f403cdf319b4d995656b2f6241e.jpg', 'Mostafa Hassan', 'Egypt', '15 April 1908', NULL),
('1019746', 'https://media.elcinema.com/uploads/_315x420_4f7c0f204de1ae5406307261c45a4ca0e17f7c488fbce3eb9b0e9ac8bf489760.jpg', 'Sameh El Soreity', 'Egypt', '19 March 1951', 'Sameh El Sereity is an Egyptian actor. He was born in 1951 in Cairo, and studied at the faculty of commerce. He then embarked on a prolific acting career, appearing in numerous plays including \"Tazkara Lel Ganna\" (Ticket to Paradise) and \"Kora Kora\" (Ball Ball), and television series like \"Layaly Elhelmeyya\" (Elhelmeyya Nights) and \"Ahlam Elforsan\" (The Knights\' Dreams) and films like \"Kheyana Mashroua\" (Righteous Betrayal) and \"Elrahina\" (The Hostage).'),
('1019976', 'https://media.elcinema.com/uploads/_315x420_208f2558681f0b52737219420ea4901f8569c90aed1752ed3700872d0404b19b.jpg', 'Tamer Ismail', 'Egypt', NULL, NULL),
('1020067', 'https://media.elcinema.com/uploads/_315x420_de4de8d8bab3677c5cefa1b21a2b518e0d145e63a1f7bb56fd93fa58ce75b07a.jpg', 'Wesam Soliman', 'Egypt', NULL, NULL),
('1020216', 'https://media.elcinema.com/uploads/_315x420_7d3b8a3324bcdae6ff837dceadb90f38d92d45f1688a1232e34e555b739775fb.jpg', 'Salwa Mohamed Ali', 'Egypt', '29 October 1964', 'Salwa Mohamed Ali is an Egyptian actress who initially gained recognition playing the \"aunt\" role on television. She\'s had a number of supporting roles on television soaps, and has participated in many stage productions.'),
('1020249', 'https://media.elcinema.com/uploads/_315x420_63741a0beb2b3f23e9b71a9e82e812110ff9c45d36a4515495cf0d1def9377ff.jpg', 'Saeed Tarabeek', 'Egypt', '17 April 1941', 'Said Tarabik is an Egyptian actor. He was born in Cairo in 1941. He began his artistic career at the end of the 1960s, working in theatre, television and cinema. Tarabik connected with actor Adel Imam when the two worked on  several films and plays together, the most notable of which was the play “Shahid Mashufsh Haga” (Blind Witness; 1976). Tarabik has also played a variety of secondary roles in works such as the series, “El Kabir Awy” and the film, “Gezira El Shaytan” (Island of Devils) in 1990, as well as the film “Wesh Egram” (Born to be a Criminal; 2006).'),
('1020509', 'https://media.elcinema.com/uploads/_315x420_9d3e020cb577712bdcaf7780cacde8a164e8aadecb16d2e09cf7bbacb163356e.jpg', 'Amr Saad', 'Egypt', '26 November 1977', 'Amr Saad grew up in al Sayeda Zeinab and graduated from the design division of the faculty of Applied Arts.\nAmr began his acting career nice years ago when upon a visit to Youssif Chahine’s office he met Khaled Youssif who asked him for a photograph of himself. Thus his acting debut was in Yosry Nasr Allah’s “Al Madinah” where he presented the character of Doreen. He also acted in Youssif Chahine’s “Al Akhir”, additionally he also assumed a role in Magdi Ahmed Ali’s television series “Al Houb Mawttan”.\nThereafter he became well known to the general public when he took on the role of the wealthy businessman “Salah Al Beheiry” in “Khiyana Mashroua”. His role as “Adel Hashisha” in “Heyna Maysarah” marked a big transition from the previous archetype due to the fact that his new role depicted a much poorer character. It is for this reason that portraying the role effectively must have been a difficult task for Amr – the character he was asked to depict is one that the public would never have associated him with.\nNonetheless, he succeeded admirably in fulfilling the role those proving his ability to evade being restricted by character models that are often applied to actors. Amr is in fact from a (lower class) neighborhood as he was born in the neighborhood of Ain Shams and his family settled in the neighborhood of Al Sayyida Zeinab.\nAmr has strong roots in the proletariat segments of society. Moreover, he has succeeded in depicting that segment’s woes on the silver screen.'),
('1020534', 'https://media.elcinema.com/uploads/_315x420_192a624e40b87192732ed88009c9758e5fc96e35d952a00230ce11ae2cb11186.jpg', 'Dalal Abdelaziz', 'Egypt', '17 January 1960', 'Dalal Abdelaziz Mohamed is an Egyptian performer. She earned her bachelor’s degree in agriculture from Zaqaziq University. Thereafter, she decided to move to the capital.\nShe was first noticed by Nour Al Damerdash and she worked with the “Adwa Al Masrah” trio in the theatrical production “Ahlan ya Diktour”. She also took part in several other theatrical productions which include “Faris bany Khaiban” “Akhouya Hayiss wa Ana Layiss”, “Houb fee Al Takhshibah”.\nMoreover, her performance was exceptional in the television series “La”, “Demou Sahibat al Galalah” and “Abadan Lam Yakon Laha”.\nShe won the best actor category at the 1998 Television Awards Festival. It should also be noted that she participated in “Al Sayyid Kaf”.\nShe married the performer Sameer Ghanem and the couple had two daughters.\nHer performance in recent films is quite different from the performance style that characterized her at the start of her career. Her best performances include those in “Bulbul Mam Yahya Fakhrany” and “Asrar al Banat”.'),
('1020553', 'https://media.elcinema.com/uploads/_315x420_6fa0949d5d19a8d64a2b8941d13beccd58932d0a38ec5e08359280d4c711fa03.jpg', 'Bushra', 'Egypt', ' 5 October 1976', 'Bushra is a young Egyptian actress characterized by a variety of talents which range from singing to acting to presenting.\nShe is the daughter of the well-known Egyptian writer Ahmed Reza.'),
('1020620', 'https://media.elcinema.com/uploads/_315x420_f54bdfb5e0a2916fb643243b2e00ce48a855b139c67d592070cd08c14b61b68b.jpg', 'Lobna Abdelaziz', 'Egypt', ' 1 August 1935', '\"Lobna Abdel Aziz\" graduated from The American University and acted on its stage. she was known as \"University Girl\". She presented a radio European program form for children called: \"Mama Lulu\". Salah Abou Seif assigned her to present the radio series \" Al Wesada Al Khalya\". She got the scholarship of \"Fulbright \"and studied drama at the University of Washington. More over she married Ramsis Naguib and after divorce she married Dr.osama Barada whom she traveled with to the United States. There she used to write to El Ahram newspaper and she got her PhD. In 1988 she returned to Egypt and presented her old program that won the Radio Festival Award in episodes of \"St. in front of Roger Moore.\"'),
('1020677', 'https://media.elcinema.com/uploads/_315x420_3932e3ff7538e04865462c85cdd0a43c02fbdb30c73610bb194e8743631b8ebe.jpg', 'Inas Nour', 'Egypt', '20 November 1975', NULL),
('1020688', 'https://media.elcinema.com/uploads/_315x420_a965f5937d3945d8cbf5d47b6f674ed29b36ad7fd6e6fb2195837cfe8432601c.jpg', 'Mohamed Dardeery', 'Egypt', NULL, NULL),
('1020698', 'https://media.elcinema.com/uploads/_315x420_9278d0725a5c21f229d22f059229d225487963b7cdddc5e5f374355857599e76.jpg', 'Riko', 'Egypt', ' 1 January 1967', NULL),
('1020706', 'https://media.elcinema.com/uploads/_315x420_1a96f45f4ba2662c3adbf47f2956d87cdafd94da7c2d9711250fd31b45ecade3.jpg', 'Muneer Makram', 'Egypt', ' 1 January 1962', 'Monir Makram is an Egyptian actor who presented very small roles in the early nineties. After attracting attention by presenting Ramadan\'s program \"Edini Aklak\" he participated with Adel Imam starring the film \"The Danish Experience\". Afterwards he filmed many other movies.'),
('1020769', 'https://media.elcinema.com/uploads/_315x420_b79cd4ac09b8344ade957f1abb411e0c3e13f0cc35ce1fdc6a500d757d350997.jpg', 'Mohamed Shafiq', 'Egypt', '26 December 1966', NULL),
('1020884', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Khairy Farag', 'Egypt', NULL, NULL),
('1021151', 'https://media.elcinema.com/uploads/_315x420_ff1826694622d06bb211ae2c8aa98fab29d5c9f206011f448639f5b952fa2e08.jpg', 'Moataza Abdel Sabour', 'Egypt', NULL, NULL),
('1021395', 'https://media.elcinema.com/uploads/_315x420_ef5294f0bf9a91c2c6894dff16f68fd22c2b9e27371d16ea2ee732e46292e549.jpg', 'Jihan Salama', 'Egypt', '19 August 1970', NULL),
('1021410', 'https://media.elcinema.com/uploads/_315x420_306663c393999d4cedf9fcce9f794e6c0bf212541e188d7f06ec5354bd5a171c.jpg', 'Khaled Hammad', 'Egypt', '24 April 1971', NULL),
('1021636', 'https://media.elcinema.com/uploads/_315x420_1c9d4d3f9335058517168b7e2debd89fdee22b5befc216c017ca84322500f9eb.jpg', 'Rania Mahmoud Yassin', 'Egypt', '10 March 1972', 'Rania Mahmoud Yassin is an Egyptian actress who was born in Cairo on 1972. She graduated from the Department of English in the Faculty of Arts at Cairo University and then started acting in 1995 with the film “Qashr El Bondaq” (Hazelnut Shells) directed by Khairy Beshara. Afterwards, she started working more intensely in TV drama in series including “We Yebka El Amal” (And Hope Remains), “Reyah El Sharq” (Eastern Wind), “El Aseyan” (Disobedience), and “Hikayet Binayeesha” (Stories We Live).'),
('1021807', 'https://media.elcinema.com/uploads/_315x420_98cfccc186055db436edc20f9743ccdf3bb455bb74bcb2d27f8695cb93d973cb.jpg', 'Ahmed Salama', 'Egypt', '10 May 1960', 'Ahmad ‘Ali Hassan Salaama is an Egyptian actor who graduated from the High Institute of Dramatic Arts. He has started as a child to play small roles in TV and radio series. He is known for playing the roles of the rebellion teen, junior brother and later the role of the academic professor. “Lan a’eesh fe gelbaab aby i.e. I will not live in my father’s robe” and “Al-‘aar i.e. Disgrace” are among his most famous TV series. Ahmad played supporting roles in Chahine’s “Eskendereyyaa..leih? i.e. Alexandria..Why?”and “Al-muhaager i.e. The emigrant”.'),
('1021880', 'https://media.elcinema.com/uploads/_315x420_c677f797286f8a74bef58d24130a16c93ea894821aea59c990724967cb17237d.jpg', 'Hisham Gabr', 'Egypt', '17 January 1972', NULL),
('1021981', 'https://media.elcinema.com/uploads/_315x420_5bf28e0577893d0eb349034073a339f2dd5447fcbe9d3e37ef45d4a9c3fcb85f.jpg', 'Abdulraheem Hassan', 'Egypt', '10 June 1954', NULL),
('1022124', 'https://media.elcinema.com/uploads/_315x420_805ad39c47f41f87d4692602af4bdf012cb50f4c89fa320e38a884d68a541bad.jpg', 'Hassan Mostafa', 'Egypt', '26 June 1931', 'Egyptian actor Hassan Mostafa was born in 1933 and graduated from the High Institute for Theatrical Arts in 1957. He has worked for a variety of theatre troupes throughout his carer including the Ismail Yassin Theatre troupe, the Egyptian United Artists and  Egyptian Television Theater. He is best known for his numerous theatrical performances that were broadcast on television including: \"Hawa\' Elsa\'a 12\", (Eve at Midnight), \"Madraset Almoshaghbein\" (School of Bullies), \"El Eyal Kebret\" (The Children Grew Up) and \"Sayidaty Elgamila\" (My Fair Lady). Mostafa has also played supporting roles in numerous films including: “Adwa’a Elmedina” (City Lights) \"Nus Sa\'a Gawaz\" (Half Hour Marriage), \"Yawmiat Na\'ib fil Aryaf\" (Deputy’s Diary in the Countryside) \"Gharib fi Bayti\" (Stranger in my House) and \"Morgan Ahmed Morgan.\"'),
('1022278', 'https://media.elcinema.com/uploads/_315x420_ec67ad4a26a671565508b9bf5cf21533e87c6da02573440fe8e9a463a50620a6.jpg', 'Hend Taher', 'Lebanon', '22 June 1944', NULL),
('1022397', 'https://media.elcinema.com/uploads/_315x420_faea818ddd94962a764438560ae6617fef3e0b3f027ef9d172b2a42bc818d06f.jpg', 'Jihad Saad', 'Syria', '20 November 1953', NULL),
('1022633', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'جمال إمام', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1022759', 'https://media.elcinema.com/uploads/_315x420_7a9bef538bf171504f431f5c498890118321a1546012a2a2bac280a2481b4027.jpg', 'Mohamed Hefzy', 'Egypt', '13 March 1975', 'He is a producer and script writer who studied engineering in London. He returned to Egypt to work as a script writer. In 2 years’ time he built his own producing company, Film Clinic and became a partner in another television producing company called Media Clinic'),
('1022762', 'https://media.elcinema.com/uploads/_315x420_e39d62b2905317d7d57766def495154b48a0a45bb3af9b954ce8d82e90fe8b32.jpg', 'Iman Khalil', 'Egypt', NULL, NULL),
('1023044', 'https://media.elcinema.com/uploads/_315x420_ff10e2f42d9bb1b752fc197fd223774f22501d7457c08b30b63a3a727f1831d4.jpg', 'Mohamed Marzaban', 'Egypt', '24 February 1959', NULL),
('1023162', 'https://media.elcinema.com/uploads/_315x420_7cfe4c913e00a1dc3680adecde144273c88c9cafae77ee0553a0e50929ca5fef.jpg', 'Samir Sabri', 'Egypt', '27 December 1936', 'Muhammad Sameer Galaal Sabry is an Egyptian singer, actor and entertainer, born in Alexandria where he went to Victoria College. After his graduation from the faculty of Arts-English Department, he started to present “At your request” an Egyptian radio program presented in English language. He is a multi-lingual and cultured person. This helped him later when he presented his famous Egyptian TV program “Al-naady al-Dawly i.e. The International club” and with all his other accomplishments. His first appearance on the silver screen was among the masses with the famous Radio Star Amaal Fahmy in Abdul Haleem Haafez’s “Hekaayet hobb i.e. Love story”. When he started to really work in cinema he was not happy with what was offered to him so he formed his own production company.  Sabry played comic, musical as well as villain roles. Among his best roles are; “Al-mahfaza ma’aaya i.e. I’ve got the wallet”, “Al-Toot wal-nabboot i.e.  Bering and Clubs”, and “ Noshaaterokom al-afraah i.e. Our congratulations”.'),
('1023249', 'https://media.elcinema.com/uploads/_315x420_7fd184033edf4c6bccbba4aac10f7e313e7bc78230fb97af042537469926e1cf.jpg', 'Ahmed Farahat', 'Egypt', '23 July 1950', NULL),
('1023481', 'https://media.elcinema.com/uploads/_315x420_c880e1890ffcd8bf7a24071c4c71be21a80a06af2a5059134580fc94f7d96519.jpg', 'Ghada Adel', 'Egypt', '25 December 1974', 'Ghada is an actress who was born in Cairo. Her began her professional career with television commercials. Ghada graduated from the Faculty of Commerce. She took part in a play titled “Al Abanda” and in the “Abyad wa Iswid” (Black and White) trivia show. Ghada has also performed on television in a production titled “Wajh Al Qammar” (The Face of the Moon).'),
('1023536', 'https://media.elcinema.com/uploads/_315x420_e8fbe199d022ca633d4c102268bffc342f3502f073afdc10db0c93b5685e6085.jpg', 'Nabil Nour Eddin', 'Egypt', ' 1 January 1951', 'Nabil Nour Eddin (whose full name is Nabil Shafik Nour Eddin) is the son of the famous film actor Shafik Nour Eddin. From the start of his career, Nabil appeared in starring roles in films including “Oreed Hoban wa Hananan” (I Want Love and Affection) and “El Soud Ela El Hawiya” (The Climb to the Top). He later worked in both theatre and television, and then he disappeared for a period before re-emerging in a number of works.'),
('1023558', 'https://media.elcinema.com/uploads/_315x420_db5633d551d1d5c10fb2252c685a3132a70d78039dc97fa09c9a5b96f92d0999.jpg', 'Walid Youssef', 'Egypt', '15 January 1970', 'An Egyptian author and writer, who started his career at the end of the 90’s. He was famous for his movie “Why Did You Make me Love you” , but his real success came after the “Al Daly” trilogy, starring Nour El Sherif in 2007.'),
('1023754', 'https://media.elcinema.com/uploads/_315x420_ae7eba1265632795de96e83e046f6f8db55cfe144b8519d4f7f5d42d9727ba55.jpg', 'Ehab Lamei', 'Egypt', '25 November 1966', 'Eham Lamei is an Egyptian director and screenwriter. He graduated from the faculty of mass-com in 1987, and from the directing department in the High Institute of Cinema in 1995. He then went on to direct a number of short films. He then wrote the script for his first feature length film, which he also directed and designed the sets for: \"Men Nazret Ein\" (At An Eye\'s Glance). He also directed \"Kan Youm Hobbak\" (The Day I Loved You) and \"Ala El Hawa\" (On Air).'),
('1023968', 'https://media.elcinema.com/uploads/_315x420_487366ee8b3a1ad44f27c853620a831db8ba28ea70c0b6bf948f49a0acc31651.jpg', 'Galal El Zaky', 'Egypt', NULL, NULL),
('1023973', 'https://media.elcinema.com/uploads/_315x420_8d8c4e55111734e616769648e23da676232ba8f44595e0f2d69f0623deeaf9bc.jpg', 'Hanan Turk', 'Egypt', ' 7 March 1975', 'Hanan Hassan Mohamed A’bd Al Kareem was born in Cairo. She studied at the Ballet Institute and while performing in a production of “Macbeth” she was noticed by director Kheiry Bushara who nominated her for a role in the film title “Raghba Muttawahisha” (“Monstrous Desire”). Hanan has performed in several television productions amongst which is “al-Suqoot fee Bir Saba” (“Falling into Bir Saba”), “al-Mal wa al-Banoun” (“Property and Progeny”), “al-Sabr fee al-Mallahat”, “lan A’eesh fee Jalbab Abby” (“I Will not Live in My Father’s Robes”), “Opera A’ydah”, “Ameera fee A’bdin” (“A Princess in A’bdin”), “Nisf Rabee’ al-Aakhar” (“The Middle of Next Spring”). Moreover the actress has also partaken in the cinema production “Fee al-Ou’shq wa al-Saffar” (“Love and Journeying”). Hanan is considered among the most talented performers of her generation and can be seen in her finest form in “al-Mohajjir” (“The Emigrant”), “al-Aakhar” (“The Other”) and “Sahr al-Layaly” (“Staying Up”).'),
('1024119', 'https://media.elcinema.com/uploads/_315x420_33aa3eaeac28521a416795f4e65c3773eb535225bb3312f74a07def83c63f853.jpg', 'Nasser Seif', 'Egypt', '17 November 1960', NULL),
('1024208', 'https://media.elcinema.com/uploads/_315x420_f52e261036a9a322943263356d1770234bbdaf51bbb94d04b364e2ab88da8d10.jpg', 'Rehab Al Jamal', 'Egypt', '20 April 1974', 'Rehab EL Gamal is an Egyptian actress of film and television. She debuted back in 1998 in the television series \"Al Mesdaweya\". She had her breakthrough in the acclaimed 2009 film \"Ehky ya Shahrazad\" (Tell Us, Shahrazad). She is most known for her roles in the television series \"Ma\'a Sabq Al Esrar\" (Premeditation), KHotut Hamraa\" (Red Lines) and the film \"Abdo Mota\".'),
('1024506', 'https://media.elcinema.com/uploads/_315x420_594dba19cdbd5b81a7c5501f22f22285e9024ae75b807d8c5e5594aa437d8244.jpg', 'Menha El Batrawy', 'Egypt', NULL, NULL),
('1024576', 'https://media.elcinema.com/uploads/_315x420_8bbc21b091c620bdacae7a5ed513dcb318c53e0795a7346e9c24095a223c89b7.jpg', 'Mohamed El Dafrawi', 'Egypt', '29 May 1931', NULL),
('1024671', 'https://media.elcinema.com/uploads/_315x420_f1218b2b1f687c475b431e9494f616b5c4ee5ccdc9098cd3f4f7efe10d19edfc.jpg', 'Ahmed El Sakka', 'Egypt', ' 1 March 1973', 'Ahmed Mohamed Salah El Din El Sekka graduated from the Institute of Theatrical Arts in the year 1993. He is the son of the director Salah El Sakka.\nAhmed started his acting career in television where he took part in the series: (Al Nawa), (Ali Baba wa Al Arbain Harami), (Nisf Rabie Al Akhir), (Min Al Lazi La Yohib Fatma), (Hilm Al Janoob) and (Al Zawag Ala Waraq Solifan).\nHe also took part in the plays (Afrooto) and (Kidah Okay) and won the award for the “Best Actor” category in the (Cairo  Films Festival) for his role in \"Africano.\"\nSince then, Ahmed has been successful in expanding his role beyond comedy into the action and drama categories, playing roles like the body guard and the local thug in \"Ibrahim El Abyad\", and also adding a touch of comedy to some action/drama roles like in \"Ibn Al Qunsul\" (Son of the Council).'),
('1024737', 'https://media.elcinema.com/uploads/_315x420_14ec8f936ee2801ba1f39892227cad0a447caec62d2adbf7dfe02e055e0650a7.jpg', 'Hamdy Elramly', 'Egypt', '27 March 1960', NULL),
('1024895', 'https://media.elcinema.com/uploads/_315x420_0a2cef61f7b727ef2d9b20f6e4ed3dbe1eccd94ecd4f9d2cf24cd5588c87c8f4.jpg', 'Ahmed Fouad Selim', 'Egypt', ' 6 February 1957', 'Egyptian actor, Ahmed Fouad Selim was born in Al Sharqia governorate in 1957. Selim graduated from the High Institute for Theatrical Arts in 1978 and began his career in theatre. He has appeared in many plays including “El Soa’eda Wasalu” (The Upper Egyptians Arrived; 1989). Regarding cinema, Selim has appeared in a variety of films including:”El Hadaq Befhem” (Hadaq Understands) and “El Mohagir” (The Immigrant) both in 1994. In 1997, he was offered a role by director Youssef Chahine in “El Masir” (Destiny), which was a turning point in his career. He continued to appear in television dramas including, “Zu Al Nun El Masry,” “Qasim Amin,” “El Layl wa Akhro” (At the End of the Night), “Muwatin X” (Citizen X) and “El Khawaga Abdel Kadr” (The Foreigner, Abdel Kadr).'),
('1025118', 'https://media.elcinema.com/uploads/_315x420_a0d2e39c615f66dae5f9ff9dfbf4abe10d8a04b804e02933e7cfe5dfa6dcb65f.jpg', 'Ahmed Abdelaziz', 'Egypt', '30 December 1955', 'Ahmed Abdel Aziz is an Egyptian actor. He was born in Alexandria in 1956, and received a bachelor\'s degree from the Faculty of Commerce and the high Institute of Theatrical Arts. He started his acting career from the faculty\'s theater, and later joined the “Forefront Theater” in 1976. His rise to stardom came after his extensive work in television series, at which the majority of his career was focused. His most famous roles were in the television series “Meen Elly mayhebbesh Fatma” (Who Doesn\'t love Fatma?), “Al Forsan” (The Knights) and “Zia\'ab Elgabal” (Wolves of the Mountain). Although Abdel Aziz\'s film roles were few, they were mostly acclaimed performances in artistically important productions, like “Awdet Mowaten” (The Citizen\'s Return), “Haret bergwan” (Bergwan\'s Alley), “Wadaa\'an Bonaparte” (Farewell Bonaparte) and “El Touq wel Eswera” (The Collar and the Lace).'),
('1025363', 'https://media.elcinema.com/uploads/_315x420_05e28f09b68b3125fdfcb81c988871dbbe360e5785718b87390420890a2100e9.jpg', 'Abdel Moneim Elmarsfy', 'Egypt', '31 December 1951', NULL),
('1025415', 'https://media.elcinema.com/uploads/_315x420_a2b943014119f0ee74d4f902fbc5b74fbd6f73217dbd6d663ce61e7cd2e04fc7.jpg', 'Mohsen Mohie Eldein', 'Egypt', ' 1 November 1959', 'Born in Cairo. He achieved his degree from the high institute of cinema majoring in directing.He worked in the radio in 1969 then in 1970 he worked in the theater where he was part of the play \" The Minister\'s wife\" He later on produced alot of plays for theater then moved on to TV in  1970 where he directed his first series \"The Killer\". He did many more movies after that and he received an award for his role in the movie \"Why Alexandria\" later on he took a prize for the national cinema contest, for being part of the play \"Lock your girls in\". He married the actress \"Nesreen\" and then decided to step out of the spot lights.'),
('1025509', 'https://media.elcinema.com/uploads/_315x420_8ba34ce9afd9234a3c1715f5c7aa442af38239d8a0b0e13c5b9c48daac89c728.jpg', 'Mohamed Abo Dawood', 'Egypt', '10 November 1944', 'Mohammed Abo Dawood is an Egyptian television actor and theatre director. Born in 1944, he appeared in a number of television shows including: “Ragil Gheni Fakeer Gidan” (The Very Poor Rich Man), “Malak Farouk” (King Farouk), “Om Kulthum,” \"Nesr Alsharq\" (Eagle of the East), “Ya Rigal El Alam Ithidu” (Men of the World, Unite) and “Bab El Khalk” (The Gate of Creation). He also directed a several plays including: \"Afreet Li Kul Muwatin\" (A Ghost for Every Citizen), “Tazwir fi Awrak Atefeya” (Forgery of Love Letters) and \"Mawlid Sidi El Mora\'eb\" (The Mawlid of the Terrifying Saint).'),
('1025622', 'https://media.elcinema.com/uploads/_315x420_d1fc6449b65a63f3eb66565d012e9ec47f6d8e6ff47fb5d6f527408acff35af9.jpg', 'Sherif Ramzy', 'Egypt', ' 1 January 1981', 'Shereef Ramzy is a young Egyptian actor. His father, producer Muhammad Hassan Ramzy, helped him to debut in cinema with the film “Asraar al-banaat i.e. Girls’secrets” in which he played an adolescent and performed to critical acclaim. After that, Shereef became a prominent actor, appearing in a diversity of roles, including those in films like \"Agamista\", \"Alwan El Sama El Saba\'a\" (The Seven Colors of the Sky), \"Orido Khula\'an\" (I Want a Divorce) and \"El Eyal Herbet\" (The Kids have Escaped).'),
('1025702', 'https://media.elcinema.com/uploads/_315x420_7adfa351e0d3c4d33a076e77a047be0fbe54e59c14d6f046b1dafb045c070e0f.jpg', 'Razan Moghrabi', 'Lebanon', '19 August 1973', 'Razan Moughrabi is a Lebanese TV presenter, actor and singer. With the support of her mother, Razan started her TV career presenting her famous 3 and half hour-program “Al-leil al-maftouh i.e. Open night” on Future TV, to be the youngest Lebanese TV presenter ever.\nBy mid 1990s, she joined the MBC network in London where she presented the “Top of the pops”Arabic version. She also covered numerous International artistic events. For her overwhelming success, Moughrabi was given another program “Shahrazan” where she showed her talents in dancing and singing. She is known for her ability to manage interviews perfectly in Arabic and English. She also presented the program “Album” and “Deal or no deal” on al-Hayat TV.'),
('1025740', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed Hassan', 'Egypt', NULL, NULL),
('1025785', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Hani Muhammad', 'Egypt', NULL, NULL),
('1025881', 'https://media.elcinema.com/uploads/_315x420_ab39e3d6b97d19688d55f9eb08876973e9e731c006a1890d91fd1c6e37245eeb.jpg', 'Hossam Ali', 'Egypt', '20 February 1982', NULL),
('1025914', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'مصطفى سامى', 'Egypt', NULL, NULL),
('1025998', 'https://media.elcinema.com/uploads/_315x420_c8022c3866934f7a06d2ccd61d97513960f296ca84fef749ea973ac546b77c21.jpg', 'Majdy Ahmad Ali', 'Egypt', '26 August 1952', 'Magdy Ahmed ‘Aly’s creative career began when he worked as an assistant director for several directors who included Mohamed Khan, Khairy Bushara and Youssif Shaheen. Fourteen years later in 1996 Magdy directed his first film title “Ya Donya ya Gharamy” (“Life My Love”). That work was followed by other titles such as 1998’s “al-Battal” (“The Hero”) which starred Ahmed Zakky, “Assrar al-Bannat” (“Girl’s Secrets”) and “Khaltat Fawziyah” (“Fawziyah’s Recipe”). Moreover, Magdy Ahmed wrote and directed “’Assafeer al-Ganna” (“Birds of Paradise”) which starred Fathy ‘Abd Al Wahab in addition to directing the television series “Frisca” and “Mamlakat al-Gabbal” (“Mountain Kingdom”) which aired in Ramadan, 2010.\nMagdy Ahmed ‘Aly studied directing at the Higher Institute for Cinema after completing his education at the Pharmaceutical Faculty.'),
('1026031', 'https://media.elcinema.com/uploads/_315x420_687046712767dddb400003f2a871b018d524cc9e1ebb1e0c36f7a934ddb099e4.jpg', 'Nabiha Lotfy', 'Lebanon', '28 January 1937', 'Nabila Lotfy is a Lebanese actor and documentary filmmaker. She has lived most of her life in Egypt. She studied at the American University in Cairo in 1953, where she was sacked due to her political activism, then moved to Cairo to join the Faculty of Arts, then the Hihg Institute of Cinema in 1960.\nShe graduated as a film director in 1964, becoming one of the first institute\'s graduates, and worked as an assistant director in numerous feature films, before focusing almost entirely on directing documentary films. She was one of the founders of the New Cinema Group in 1986, and worked in the Experimental Film Centre with Shady Abdel Salam. She wrote several articles about cinema, and was a member of the Arab Documentary Filmmakers Guild.\nShe also appeared as an actress in Daoud Abdel Sayed\'s \"Rasa\'el Elbahr\" (Messages of the Sea), Ibrahim El Batout\'s \"Ein Shams\", and in the television series \"Elkhawaga Abdel Qader\", and the short film \"Zeyara Yawmeya\" (Daily Visit).'),
('1026152', 'https://media.elcinema.com/uploads/_315x420_512eec066e39717328cca775314157a492726cf0df83554f888aef9d485ff018.jpg', 'Zeinab Wahby', 'Egypt', '12 June 1952', NULL),
('1026173', 'https://media.elcinema.com/uploads/_315x420_532066bb0f2112bc89fb7edaef58eeb43aa9092d57fb2bddaea98202562bb3e9.jpg', 'Ahmed El Gendy', 'Egypt', '15 January 1980', 'Ahmed El Gendy began his career as an actor where he participated in the film “Wahed min al Nas” (“One of the people”), a title which starred Kareem A’bd Al A’zeez and Muna Shalaby. Ahmed also worked as an assistant director in that same production following his graduation from the Institute of Cinema. This was followed by his participation as an assistant director in the film “Zarf Tareq” (“Urgent Circumstances”) which starred Ahmed Helmy in the leading role. \nAhmed’s participation in those works was followed by his directing a sitcom titled “Ahmed Itgawiz Muna” (“Ahmed Married Muna”) in addition to several movies such as “Hawish ely Wa’aa’ Minak”, “Etsh Dabour”, “Teer Enta” and “La Tarago’ wa la Istislam”.\nAhmed’s son, Mahmoud El Gendy (born in 1980) has also done some directing in addition to contributing to the screenplays of several films such as “Teer Enta”. Mahmoud’s works are unique in that they derive comedy by making sarcastic remarks with regards to popular culture. He has also directed several works which were parodies of other cinema titles.'),
('1026190', 'https://media.elcinema.com/uploads/_315x420_7a4d00a0be5d4bf1887687980a662c97622721ab2bbcbc1f596d693847a93e3b.jpg', 'Salah Elhanafi', 'Egypt', NULL, 'Salah Mohammed is an Egyptian actor and producer. He is best known for Ibrahim El Batout\'s \"El Shita Elli Fat\" (Winter of Discontent), in which he starred as the antagonizing State Security officer. He also contributed a lot to the production side of making the film.'),
('1026639', 'https://media.elcinema.com/uploads/_315x420_ccc14906aaad5b2eb0049f4068f814019b4c9ad42736572460f0ddcd1f9b9657.jpg', 'Khaled Al-Nabawy', 'Egypt', '12 September 1966', 'Khaled Mohamed El Nabawy is a theater and film performer that was born in the city of Al Mansoura. He graduated from the Institute for  Theatrical Arts in 1989 and has performed in several theatrical productions, including “Al Bahr Beyidhak Leih”, “Al Ginzeer” and “Kefah Teeba”.\nHe has also performed exceptionally in several television series which include “Bawabat Al Halawany”, “Sharea Al Mawaridy”.\nKhaled mainly assumed minor characters before Youssif Chahine assigned him leading roles in the films “Al Mohajer”, “Zaman Al Hilm Al Daea”, “Al Hilm Al Moajal”, “Al Maseer”. This followed his success in the short film “Al Qahira Menawara Be Ahlaha”.\nKhaled worked as an announcer for a Gulf television channel in 2002. His most notable works were those that were directed by Youssif Chahine and it should be noted that he is unique among a generation of performers that were mainly engaged in comedy.'),
('1026773', 'https://media.elcinema.com/uploads/_315x420_b45163ad873dc2ae7d7db0f6b8a0ff0fcc407433ebadc4ee6bb45eb9670f4190.jpg', 'Sherif Shimi', 'Egypt', NULL, NULL),
('1026920', 'https://media.elcinema.com/uploads/_315x420_e21229dded15d7114a3ac080d4496a4cd541abc5cdad42eaf324d54ffbedd8c7.jpg', 'Amr Mahdi', 'Egypt', '10 September 1970', NULL),
('1027236', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'حسين بكر', 'Egypt', NULL, NULL),
('1027524', 'https://media.elcinema.com/uploads/_315x420_665a0430be1e7a37492eba06c72df2e362720a5e71eac573f4550586a9f5c6ae.jpg', 'Ola Roshdy', 'Egypt', '19 August 1980', 'Ola Roshdy is an Egyptian comedy actress born into a diplomatic family that moved all around Europe when she was young. She is fluent in Arabic, English, Italian and French and can get by in Spanish. As a third grader, she won the \"story-tell-a-thon\" at school. She got a degree in Business Administration from the University of Maryland in the United States. She began her professional career with the famous movie \"El Selem wel Teeban,\" which she followed with a role in the first Egyptian sitcom \"Shabab Online.\" She starred in an independent short film \"Al Onf wel Sokhreya\" (Violence and Sarcasm). She then starred in a string of hit movies including \"Dam Ghazal\" (2005), \"Halim\" (2006), as well as the comedy series \"Pisso\'s Family.\" She\'s acted in four seasons of the hit Egyptian sitcom \"Tamer & Shawkeya.\" Roshdy is credited as one of the pioneers of stand-up comedy in Egypt. She resumed her main role of Mounira in the third season of the TV series \"Lahazat Harega\" (2007-2012). In 2013, she stars alongside Ahmed Helmy in the dark comedy \"Ala Gothety\" (Over My Dead Body).'),
('1027647', 'https://media.elcinema.com/uploads/_315x420_0d148dcedb273501189e7bbaba95a4aced7cd550cb55adf4bd034392fc5b95ba.jpg', 'Tarek El Tilmisany', 'Egypt', '25 April 1950', 'Tarek has worked as (camera manager) in several important Egyptian films such as “Al Muwatin Al Masry”, “Aaraq Al Balah”, “Ayam Al Sadat”, “Baheb El Seema”  and “Qus wa Laziq”.\nHe has also acted in several films which include “Al Silim wa Al Thoaban”, “Qadiyat Amn al Dawlah” and “Istighamiyah”. He has also acted in series that include “Masalat Mabdah”, “Liqaa Aal Hawa”, “Mahmoud Al Masry”, “Lahazat Hareja” and “Awqat Faragh”.'),
('1027772', 'https://media.elcinema.com/uploads/_315x420_1ee8cd3d776574b247f2a3f12b3fd572cfb1130f8b1bb58be8786aab36646e4c.jpg', 'Kamal Al Hummusani', 'Egypt', NULL, NULL),
('1028220', 'https://media.elcinema.com/uploads/_315x420_cdffad34e130c6a16b2ab1cf4bc5766d9adeff4ead33bfedfe8b7b2bf7a798c4.jpg', 'Mohye Ismail', 'Egypt', ' 8 November 1946', NULL),
('1028261', 'https://media.elcinema.com/uploads/_315x420_4fbe96854e0c633a7cf133b12f980b501b9010611f4645404392afee6294827f.jpg', 'Tamer Habib', 'Egypt', '29 June 1963', 'A special script writer that proved himself in his very first movie “Late nights”. He added a new approach, which is a combination between romance and reality in a magical way.'),
('1028300', 'https://media.elcinema.com/uploads/_315x420_6a572cff8f7fe7f268677c2fe480450cf3dcd3fdaaf54ad08c81d39f1bdfb5d3.jpg', 'Ashraf Zaki', 'Egypt', '29 December 1960', 'Ashraf Zaky is an Egyptian actor and the current head of the Actors’ Syndicate. He is the brother of actress Magda Zaky. Zaky has recently caused a great deal of controversy following his decision to limit the number of cinema and television projects assumed by foreign actors in Egypt within a given year.'),
('1028350', 'https://media.elcinema.com/uploads/_315x420_f1323913f2f89aceeba58de88ebec44f427591cc6db06f8429092da86f1251d0.jpg', 'Ramsis Marzouq', 'Egypt', ' 1 June 1940', NULL),
('1028476', 'https://media.elcinema.com/uploads/_315x420_4da75d51e6b32165390d6c67f3471410d75178d7e6de7b6cf396372135cc9b96.jpg', 'Aboul Seoud Al Ibiary', 'Egypt', ' 9 November 1910', 'Egyptian scriptwriter and songwriter, born in 1910 – Cairo.\nAs a child, Aboul So’oud wrote colloquial poems (zajal) that was published in “Al-Awlaad i.e. Children” magazine. He was fond of the great Badee’ Khairy’s colloquial poetry and plays thus, he followed his steps and Badee’ encouraged him.\nHis first monologue “Borreih men al-settaat i.e. Oh! Women” chanted by “Sayyed Soulaymaan” was of great success. He also prepared comic sketches for Badee’a Massabny troupe and his first play was “Ew’a tetkallem i.e. Don’t talk” in 1933. His abundant effluent vocabulary was acquired from the common language of the people as he sat at Badee’a Massabny’s café smoking hookah and watching the crowds come and go.\nAl- Ebiaary wrote some of the best comic film scripts. His characters were authentic. His fluent dialogue was very clear starting from the very first film “Law kont ghany i.e. If I were rich” and continued through all his films; “Fatma, Marika and Rachel”, “Aakher kedba i.e. Last lie”, “Al-hamawaat al-faatenaat i.e. Charming mothers in law” and “Al-zoga al-13 i.e. Wife number 13”.\nThe majority of Ismaeel Yasseen’s films with his name in title were also written by Aboul-So’oud al-Ebiaary”.'),
('1028517', 'https://media.elcinema.com/uploads/_315x420_4378df22c29a8e5a1602868aa45e44bdc2eada02c75916ecc9ffa339c87605b1.jpg', 'Kamal Abdelaziz', 'Egypt', NULL, NULL),
('1028809', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'سيد أمين', 'Egypt', NULL, NULL),
('1029232', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'مصطفى ماهر', 'Egypt', NULL, NULL),
('1029243', 'https://media.elcinema.com/uploads/_315x420_90da968cad25fba2f1350a8b36886b6271304eeb95c56174a90e631637447d6b.jpg', 'Mohsen Ahmed', 'Egypt', NULL, NULL),
('1029334', 'https://media.elcinema.com/uploads/_315x420_bcb47fd0f3a9e1ed1d711b3d6d07afb712e6ab5332ff2c39dbfc0250ac974b09.jpg', 'Mohamed Emam', 'Egypt', '16 September 1984', 'Egyptian actor Mohamed Emam was born on December 16, 1984 and graduated from the American University in Cairo. He first began his career in the arts as a child when he starred alongside his father Adel Emam in the film “Hanafi El Abha” (The Magnificent Hanafi) in 1990. In 2003 he appeared in the well-known series “Canaria wa Shariko” (Canaria and Co,) and later in a number of films including: “Amaret Yacoubian” (The Yacoubian Building) (2006) and “Hassan wa Marcos” (2008). His first film as the main protagonist was “Al Beeh Romansy” (The Romantic Bey) in 2009. He has continued to act in various television series including: “Bilshama’a El Ahmar” (Red Tape) (2010), “Firqet Naggy A\'t Allah”  (Naggy A\'t Allah’s Squad), and “Khatut Hamra” (Red Lines) (2012).'),
('1029340', 'https://media.elcinema.com/uploads/_315x420_cd4ac6c6f05c44e6b67678444c0a93e2be0a11c6bf10cca0025c595ad4baee4a.jpg', 'Tamer Ezzat', 'Egypt', '22 February 1971', 'Graduated in 1994 from the American University in Cairo majoring in electronics, but was overcome with passion to art and cinema and studied film directing in New York Film Academy and graduated in 2001.Then studied the visual effects for digital movies at New York University and graduated in 2002'),
('1029470', 'https://media.elcinema.com/uploads/_315x420_1679d13031be9533367ff1adf16bfc866520f37a49ec7238f5f134d458ca904e.jpg', 'Sherif Desouqy', 'Egypt', NULL, NULL),
('1029694', 'https://media.elcinema.com/uploads/_315x420_b14eebc6fb7b030ad7713ffd293a2aff47b37080df7d6c2cc4dbf901dd941764.jpg', 'Nour Qadri', 'Egypt', '13 January 1982', NULL),
('1029840', 'https://media.elcinema.com/uploads/_315x420_777bbf66da1f9e17cebef26f3b31b1e736a037993091ae5c21dacc031437f89e.jpg', 'Soliman Eid', 'Egypt', '17 October 1968', 'Soliman Eid is an Egyptian comedic actor and has one of the most recognizable faces on screen for his plentiful comedic roles. He comes from a modest family in southern Egypt. He was born and raised in Kitkat in the Cairo neighborhood of Imbaba. His older brother, Sheikh Khalifa, is a reciter of the Holy Qur\'an, and shares the same lightheartedness and humor as Soliman.'),
('1029934', 'https://media.elcinema.com/uploads/_315x420_1eb76c14b3c10d1243c82cd7ecc023339a394d096b2c9970e9b5a8d026e8a483.jpg', 'Hidy Karam', 'Egypt', '27 August 1980', 'Heidi Karam is an Egyptian actress who started off modeling for commercials. This was her gateway to television. Her role in the miniseries \"The Nightingale\" was her ticket to many more roles.'),
('1029939', 'https://media.elcinema.com/uploads/_315x420_b5d9e7acecb8bf45c77c7df4e3026fc99a2774d91d607bb2742bc324f1869d06.jpg', 'George Anwar', 'Egypt', NULL, NULL),
('1030513', 'https://media.elcinema.com/uploads/_315x420_1db58f6f8093925d4c5abacadd2ad6f25023e5acaefdfe48febd84d7324d5824.jpg', 'Saied Barakat', 'Lebanon', NULL, NULL),
('1030640', 'https://media.elcinema.com/uploads/_315x420_f93693aa25d2c428bcd74c9535f524c4c738798859781f368aae410f267026fe.jpg', 'سامح سليم', 'Egypt', ' 1 August 1958', NULL),
('1030740', 'https://media.elcinema.com/uploads/_315x420_52f265fda94b6d162a5ab0e9f1ebe1699d01782e181f8430c81b515e74139393.jpg', 'Hakim', 'Egypt', ' 8 October 1962', 'Abdul Hakeem Abdul Samad Kaamel is an Egyptian folk singer who was born on 1962 in Maghaaga – Menya (Upper Egypt).'),
('1030939', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Nehad Fahmy', 'Egypt', NULL, NULL),
('1030963', 'https://media.elcinema.com/uploads/_315x420_0998c4779b1176c6e8c68028a4930e3e5cbb1b0fa040d5213ba8a970a3c9a887.jpg', 'Masstora', 'Sudan', NULL, NULL),
('1030967', 'https://media.elcinema.com/uploads/_315x420_4c3b6b4649fcbd13d090b47a42b837bccfd5e8be604ff146689a90f147240425.jpg', 'Oscar for Disttribution and Theaters', 'Egypt', NULL, NULL),
('1031002', 'https://media.elcinema.com/uploads/_315x420_848aaa23811257b10ebc6c3e1715a269cf739d33cf85196995d17ae97eda69d2.jpg', 'Mahmoud Al-Bezzawy', 'Egypt', '25 September 1963', 'Mahmoud El Bezawy is an Egyptian actor and screenwriter. He wrote and collaborated in the writing of several television series, including “Al Adham”, “Lahazat Harega” (Critical Moments), and the highly controversial series “Al Rayyan”. He appeared in supporting roles in numerous films and television series, including “Zaky Shan”, “El Taaweeza”, “Sa\'idy Rayeh Gay”, “Hamam fi Amsterdam” and “El Andalib”.'),
('1031204', 'https://media.elcinema.com/uploads/_315x420_74376550b707146322ee498e272d79e0ab7622a2510c1bd957b87ce0d7cabf17.jpg', 'Hala Khalil', 'Egypt', '23 July 1967', NULL),
('1031303', 'https://media.elcinema.com/uploads/_315x420_2e1892f861f1c9c1829277048895c89288a14f1d8a8a333a1e9f5e1b5b647760.jpg', 'Omar Shama', 'Egypt', NULL, NULL),
('1031529', 'https://media.elcinema.com/uploads/_315x420_d25de3b11a76e3139503a1550b0b79772c779c9c0e9d80c09de0195d3f4a0050.jpg', 'Faten Hamama', 'Egypt', '27 May 1931', 'Faten Hamama is an acclaimed Egyptian actor and producer. She was born in 1931 in Al Mansurah in the Dakahlia Governorate. Hamama graduated from the the High Institute for Acting in 1947. She began her acting career as a child, appearing in a number of small roles including her film debut, “Youm Sa’eed” (A Happy Day; 1938), alongside Mohamed Abdel Wahab. Hamama also took part in a series of short television shows that were titled “Hekaya Wara Kul Bab” (“A Story Behind Each Door”), which was later compiled into a movie by the same name starring Hamama. In 1963, Hamama starred in an American crime film called “Cairo.” Throughout her career, she has appeared in only a few television series including, “Dameer Abla Hekmat” (The Conscience of Mrs. Hekmat;1992) and “Wagh Al Qamar” (Face of the Moon) which premiered in 2000. Faten Hamama has been dubbed the “Lady of the Screen,” having starred in more than two dozen films and received various awards and honors throughout her career. In 1977, she won a prize at the Tehran Festival for her film  “Affwah wa Aranib” (“Mouths and Rabbits”). She was also chosen as the “Star of the Century” at the 2001 Alexandria International Festival, honoring her lifetime of achievement in Egyptian cinema.'),
('1031573', 'https://media.elcinema.com/uploads/_315x420_c78f20d9c20bbcf1b9275fcc91268aaa6649fbc9e78f0c5bc56c173d81f82dd1.jpg', 'Ahmed Ezz', 'Egypt', '23 July 1971', 'Ahmed Ezz was born on July 3, 1971. He began a career in modeling after graduating from the Faculty of Arts from the English division. Ezz began working as a model in the hopes that it would later give him access to acting jobs. However the venture was not successful. After some time, Ezz met director Enas Al Daghdaghy who gave him a minor role in the film “Kallam Al Layl” (Night Talk) in 1999. The director would later give him the lead role in “Muzikirat Murahiqa” (Memoirs of a Teenager) in 2001. Although the film was not a major success it nonetheless contributed to Ahmed’s fame. Despite the fact that Ahmed’s entry into the world of acting occurred abruptly he has nonetheless committed himself to studying cinema and even joined a few actor training workshops such as “Studio Al Mumathil” which is run by Mohamed A’bd Al Hady and Mahmoud Hemeida. In 2013, Ezz stars in the anticipated \"El Hafla,\" a mystery thriller involving a businessman\'s wife who\'s disappeared and the sinister abduction plot unraveled in the investigation.'),
('1031659', 'https://media.elcinema.com/uploads/_315x420_ff383455827aa8fc71aaff746b9ac38831dc455e0627dbc81f030f861339f11e.jpg', 'Ahmed Samir Farag', 'Egypt', '27 September 1970', 'Ahmed graduated from the directing division at the Institute of Cinema and worked as an assistant director. Ahmed worked as an assistant director for 12 years during which he worked alongside several renowned directors including Shereef Arafeh, Nader Galal, Amr Arafeh, Sa’eed Hamid, Ahmed A’wad, Samir Seif, Dareed Laham, Tareq Al A’ryan and Mohamed Al Naggar. Ahmed has also directed several music clips.\nFarag’s first feature length work was “Code 36”. Also noteworthy is the fact that Ahmed’s father, Samir Farag is a filming director.'),
('1031707', 'https://media.elcinema.com/uploads/_315x420_58e72c8365ed5e94925297eeb4e8a207081e867f976f36bba026601919fd5425.jpg', 'Mahmoud Shoukoko', 'Egypt', ' 1 May 1912', NULL),
('1031740', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Wael Mandour', 'Egypt', NULL, NULL),
('1031753', 'https://media.elcinema.com/uploads/_315x420_6c877d395abdb6184cc0906b8a6922ce1dc6bfa311915560f31411a98fd8b61b.jpg', 'Ahmed Azab', 'Egypt', '11 November 1978', NULL),
('1031839', 'https://media.elcinema.com/uploads/_315x420_1e6515d144c43be0411ee132c47983d3193917232c1581d40fe73f14ef3599f4.jpg', 'Magdy Nour', 'Egypt', '25 January 1963', NULL),
('1031917', 'https://media.elcinema.com/uploads/_315x420_9cae9d5f0d6bff47f775c5fe16775899536627c9c99c5d77c503e07b03dfa3cf.jpg', 'Maged El Kedwany', 'Egypt', '10 December 1967', 'Maged El Kedwany is an Egyptian film and television actor. In 1967, he was born in Shubra in Cairo, but lived in Kuwait up until age 18. He began his professional career while studying design at the Faculty of Fine Arts. He began acting in a number of amateur plays, which led to him being cast in various TV shows like \"Qanfad\" (Hedgehog) and \"Nahnu al Nazre el-Shook.\" He\'s worked on dozens of films, among them are some of the most well-known films of the 1990s, like \"Afareet el-Asphalt\" (Asphalt Ghosts) in 1996 and \"Saidi fe Gaea al-Amrikeya\" (Saidi at the American University in Cairo) in 1998. His other films include \"Harameya Ki-Gi-To\" (Ki-Gi-To Thieves), \"Harameya fe Thailand\" (Thieves in Thailand), \"Al-Ragel al-Abyad al-Motawast\" (Average White Guy), and \"Khaly min Kolesterol\" (Cholesterol-Free). In 2012, he appeared in two high-profile movies, \"Hafla Montasif al-Leil\" (Midnight Party) and \"Saaa we Nos\" (Hour and a Half).\n\n\nstudied in the (design) division of the faculty of fine arts. Thereafter he enrolled in the Institute of Theatrical Arts and graduated in 1995.  Amongst the theatrical productions that he has performed  in are “Pallo” and “Diwan Al Baqar”. Maged has also made several television appearances, which include roles in “Nahnu la Nazra Al Shawk”, “Al Farar Men Al Hob”, “Al Shara’a Al Jadeed”, “Zayzenia” and “Arabesque”.'),
('1032009', 'https://media.elcinema.com/uploads/_315x420_d7255eb82b271ab0a793b6d07e3c197afc5daa78e6c378ad79e9b5654bd601c4.jpg', 'Mohamed magdy', 'Egypt', '17 December 1979', NULL),
('1032058', 'https://media.elcinema.com/uploads/_315x420_3327039d290a629283d8fa749b1130ceeaf4998d530025882654a594cf96418e.jpg', 'Essam Al Ashry', 'Egypt', NULL, NULL),
('1032066', 'https://media.elcinema.com/uploads/_315x420_cb555494203cf6327780787a65aa569fa8bd88d86d5e7f1d9c27b2e51fedfc3a.jpg', 'Ahmed Dawood', 'Egypt', '31 January 1983', 'Ahmed Dawood earned his bachelor’s degree in engineering and took part in several (theatrical productions) while at college. He also performed at the French Cultural Center where he took part in a production of Sartre’s (“Death without Graves”). \n(He would later) take part in the graduation project of the young director Omar Rushdy who was a (colleague) Karim Al Adl. While taking part in this project, Ahmed Dawood’s (talents were noticed by Karim Al Adl who decided to work with him after a demonstrative performance).'),
('1032208', 'https://media.elcinema.com/uploads/_315x420_5d98073acb1d18dd97a6e09285f3932eec669bf01c319fe4e9bc91c41657c162.jpg', 'Amr Al Saifi', 'Egypt', NULL, NULL),
('1032480', 'https://media.elcinema.com/uploads/_315x420_756dc46bc74443061e68ad7e1483a5c5c2d06237ffc5e7031ac1ed18b034fc77.jpg', 'Magdy Al-Hawwary', 'Egypt', '30 June 1977', NULL),
('1032542', 'https://media.elcinema.com/uploads/_315x420_6cc40012b79cbbd5d09a128add74fb53a5ae3f3d48f543653a20eb2a96bfc7b0.jpg', 'Hanan Suliman', 'Egypt', '22 August 1960', 'Hanan Soliman is an Egyptian actress. She was born in 1960, and studied acting at the High Institute of Theatrical Arts of Cairo, graduating in 1984. She has appeared in several films, including “Etnein Ala Eltariq” (Two on the Road), “Al Goua\'” (Hunger), “Ard El Ahlam” (Dream Land) and “Wahed Sahih” (Complete One). She enjoyed a prolific career in television, appearing in tens of series, including “Mouga Hara” (Heat Wave), “El Ataba El Hamra” (The Red Sill), “Sarah” and “Aldoua\' Alshared” (The Stray Light).'),
('1032543', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'إيهاب طاهر', 'Egypt', NULL, NULL),
('1033219', 'https://media.elcinema.com/uploads/_315x420_2cd7a1360568a8394ebfb928a28c359f3cd72c2aaab2ff1a67db919153172a70.jpg', 'Essam Imam', 'Egypt', '10 September 1956', NULL),
('1033316', 'https://media.elcinema.com/uploads/_315x420_ab83f99f3168d266f86a0b0f8abddc5ba7e244d8962d1400e1947994a7b97d51.jpg', 'Omar Taher', 'Egypt', '23 July 1975', 'Omar Taher is an author of many productions such as “Special Operations” in 2007, “Super Henaidy” in 2008 and “You Go Fly” in 2009. He was born in Suhaag on the 23rd of July 1973.\nAlthough he has a bachelor’s degree in commerce he worked in many newspaper agencies and magazines such as Al Dostoor , Voice of the Nation, Half the World and Ein.\nHe wrote many books and was involved in the making and writing of lyrics for many songs for a couple of artists such as “Asala” and  “Rami Sabry”. He was also involved in the making of many programs for several television stations such as MBC , Mazzika and Channel One.'),
('1033474', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أمير فؤاد', 'Egypt', NULL, NULL),
('1033591', 'https://media.elcinema.com/uploads/_315x420_aec966a3577bf511c4e4be71589eac16672447917af6a75aa677dd33aed041de.jpg', 'Yasser Zaied', 'Egypt', '24 March 1971', NULL),
('1033632', 'https://media.elcinema.com/uploads/_315x420_aaf33d9cbd321db2f8dbd23cffb5f7f790b95b571e545fc8f4da060ffe8b4b49.jpg', 'Ahmad Saeed Abdulghani', 'Egypt', '10 January 1976', 'Ahmed Said Abd Al Ghani is an Egyptian performer. He was born in the town of Nussa Al Gheit in Al Daqhiliyah governorate. Ahmed was brought up in an artistic household as his father was the renowned artist Said Abd Al Ghani while his aunt, Zahra Al O’la was also a well known artist.\nAhmed received a law degree and initially worked as a journalist for Al Ahram. That occupation was to eventually pave the way for his career in art. Ahmed would later act on stage and then in a number of TV productions. Ahmed was particularly successful at assuming the roles of villains.'),
('1033676', 'https://media.elcinema.com/uploads/_315x420_3078a16e736503f4d16e29b454321a3b7d29a098e8b5cb78142f78575f99d3fb.jpg', 'Georges Kazazian', 'Egypt', '25 January 1953', NULL),
('1033792', 'https://media.elcinema.com/uploads/_315x420_58a0e4d2ccd209a0dd815c582e7ca84ea54e113a322887b553cc2861072777de.jpg', 'Samiha Ayoub', 'Egypt', ' 8 March 1932', 'Samiha was born in Shubra and was educated at the Nun’s School. She is a first rate theater performer and her real name is Samiha Ayyoub U’thman.\nSamiha graduated from the Acting Institute in 1952 where she studied under Zakky Taleimat. She had an outstanding performance in the radio series “Sammara” and “Rab’aa al-A’dawiyah”.\nSamiha first married actor Mohsen Sarhan and then Mahmoud Morsy. She would later marry writer Sa’ad Wahba.\nAmong her plays are “al-Bakheel” (“The Miser”), “Sitt al-Batt”, “Kisibna al-Primo” (“We’ve Won the Primo”), “Kobry al-Namoos”, “Sikkat al-Salama” (“The Right Way”), “Daaerat al-Tabasheer” (“Chalk Circle”), “Feeh Raay”, “al-U’mar Lahza” and “al-Khedewy”.\nSamiha later joined the al-Qawmmy theater which she would later manage twice between 1975-1985. Samiha also managed the Modern theater on two occasions. Her cinema appearances were not as outstanding as her stage performances.'),
('1033813', 'https://media.elcinema.com/uploads/_315x420_9309d0a3f3a186fd2acc006224121881015b7821c0acd5dd4a7c18e4d15483c1.jpg', 'Hamdy Ahmed', 'Egypt', ' 9 November 1933', NULL),
('1033875', 'https://media.elcinema.com/uploads/_315x420_d106f34786c2a5dc196f480d72c07cda93b424e4147848d865a88806c1e8f49b.jpg', 'Samah Abdel Rahman', 'Egypt', NULL, NULL),
('1034327', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'إيهاب فؤاد', 'Egypt', NULL, NULL),
('1034366', 'https://media.elcinema.com/uploads/_315x420_0b8da392a3950421439660c34ac6ad5681c5ea02a2a6118d33e498ce6ce8fe60.jpg', 'Amani Elbahtiti', 'Egypt', ' 1 April 1972', NULL),
('1034697', 'https://media.elcinema.com/uploads/_315x420_5ba71a81f67f124664ea2dec74f60d36f3473381be4fe6ce63c54be35aa2ea5c.jpg', 'Ahmed Atef', 'Egypt', '17 April 1971', NULL),
('1034966', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Camilia Hussein', 'Egypt', NULL, NULL),
('1035005', 'https://media.elcinema.com/uploads/_315x420_554e667ac487a9435853b9d4d8c3aeda86401abfc675b8d1b295cfeb1758faff.jpg', 'Muhammad Salama', 'Egypt', NULL, NULL),
('1035060', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'مجموعة إعلام المصريين', 'Egypt', NULL, NULL),
('1035119', 'https://media.elcinema.com/uploads/_315x420_9d8cde7356263da07b6d531f4b7049cedfd43b56c0e973704df7b394294154b4.jpg', 'Nana', 'Lebanon', '23 April 1980', NULL),
('1035172', 'https://media.elcinema.com/uploads/_315x420_ee034c77683d5d6bcbb3272304e89c0bb029e68ff8570e40c3ee647e5873dedc.jpg', 'Maha Ahmed', 'Egypt', '16 November 1974', 'Maha Ahmed is an Egyptian actress. She was born in 1974. While studying at the High Institute of Dramatic Arts, she appeared on a number of television series including: “Sou’ Magra Al-Oyoun” (Magra Al-Oyoun Market) “Helw al-Kalaam” (Sweet Talk) and “Al-Dababeer” (The Wasps). After graduation, she appeared in several plays such as, “Shorom Borom” (Hardship), and several television series such as: “Al-Watad (The Peg), “Aida,” “Hadeeth al-Sabaah wal-Masaa’” (Day and Night talk), “Tarweedh al-Sharessa” (Taming of the Fierce), “Abyad f-abyad” (White and white) and “Al-Kadaa fel-Islam” (The Judiciary in Islam). Maha Ahmed has also been in many films including: “Abdo Mawasim” (Abdo of the Seasons; 2006), “Lakhma Ras” (2006) and “Al-Basha Talmeez” (2004).'),
('1035185', 'https://media.elcinema.com/uploads/_315x420_649fc9d0318ebfe93170f882d185672e6b3d11eab9f3354090c7c315f5ddf00d.jpg', 'Amr Abdul Gelil', 'Egypt', '10 January 1963', 'Despite his great talent and the fact that his career took-off to a promising start with an involvement with Youssef Chahine, Amr was nonetheless assigned minor roles in his first few years in cinema. \nThereafter, Amr proved his talents as a comedy actor when he performed in Khaled Youssef’s films “Heyna Maysarah” and “Dukkan Shehata”. Amr finally found a leading role in Youssef Chahine’s “Kalimny Shoukran”.'),
('1035282', 'https://media.elcinema.com/uploads/_315x420_49ded3859bff17820d3327823d513b9fb1113b950da94ecd4d99c33b8f425cc3.jpg', 'Ayman Makram', 'Egypt', NULL, NULL),
('1035569', 'https://media.elcinema.com/uploads/_315x420_7a2db9381048bf7285f33c86d966c267e44ffad4f31da52f33c2062338b2a4fe.jpg', 'Hassan Hosny', 'Egypt', '19 June 1936', 'Hassan Housny was born in the Al Qal’aa neighborhood of Cairo, his father was a construction contractor. Housny’s mother passed away when he was only six years old and he was educated at the Radwaniyeh Elementary school. Housny participated in theater productions at his school and received several awards for his efforts. Thereafter he took part in theatrical works whilst in the army and joined the “Al Keim” theater. \nHousny’s performance in “Kalam Faregh” (Idle Talk) was particularly talented. He has taken part in several theatrical productions including “Hazimny Ya”, “Qishta wa A’sal” (“Cream and Honey”), “Jouz we Louz” (“Nuts and Almonds”), “Awlad Rayya wa Sakkina” (“The Children of Rayya and Sakkina”), “A’la al Raseef” (“On the Sidewalk”), “Sukkar Ziyadeh” (“More Sugar”) and “Al Mahaba Al Hamraa”. Among the television productions he has taken part in are “Awlady Al A’izaa Shukran” (“Thank You my Dear Children”), “Al Sanbasah”, “Jawary bella Qioud” (“Unhindered Maidens”), “Nass Modern” (“Modern Folk”), “Bawabat Al Halawany”, “Al Mal wa Al Banoun” (“Property and Children”), “Amira fee A’bdin” (“A Princess in A’bdin”), “Ayn Qalby” (“Where is my Heart?”), “Joha Al Masry” and “Zaman E’mad Al Din”. \nHousny received an award for his role in the film “Dimaa A’la Al Asfalt” (“Blood Stains on the Tarmac”). Moreover Housny can be considered among the most active performers of the last two decades. He has assumed a variety of roles ranging from comedy, to portrayals of peasants and businessmen. Housny\'s most critically acclaimed roles were in “Dimaa A’la Al Asfalt” and “A’fareet Al Asfalt”.'),
('1035581', 'https://media.elcinema.com/uploads/_315x420_80d85977ea2a77c605b3db071a4cf38fee4abeb9bd5dc3e6a41d678d5d18ab98.jpg', 'Mahmoud El Hefnawy', 'Egypt', ' 7 March 1954', 'Mahmoud El Hefnawy is an Egyptian actor. He started his career in the mid 1970\'s, and has since then appeared as a supporting actor in numerous television series, including “Bab El Khalq” (El Khalq Gate), “Al Daly”, “Yawmiyat Wanis” (Wanis Diary) and “Al Suqoot fi Bia\'r Sabaa” (Falling in Sabaa Well). He died in 2014 of heart failure.'),
('1035695', 'https://media.elcinema.com/uploads/_315x420_ead7dc2129ea470eb62df5177ec8e4f72915af624ed3b32ba28f51a54f635a2a.jpg', 'Nasser Shahin', 'Egypt', '13 July 1960', NULL),
('1035705', 'https://media.elcinema.com/uploads/_315x420_87043bf7da764ff149c302564f27dfc5b22dad23555574757a4396a38e585863.jpg', 'Farid Al Noqrashi', 'Egypt', NULL, NULL),
('1035984', 'https://media.elcinema.com/uploads/_315x420_8ad39d8be56528ed323acc3ad740be6674e5eff6f5d5a84038e86235f711cfad.jpg', 'Edward', 'Egypt', ' 7 December 1973', 'Edward is an Egyptian actor and he started his career singing and playing guitar in a band called Gypsy. He also produced many of their music videos. He was cast by the famous director Osama Fawzy to play a small role in his film \"Beyheb El Cinema,\" which won him a number of other film roles, like \"Mahmoud Hamida\" in 2004. He often plays supporting, sidekick characters in films like \"Leila Alawi,\" \"Bahebak wa Bamoot Fik,\" \"Kalaam fi al Hob,\" \"Gaaletny Mogrem,\" and \"Fi Mohatat Masr.\" He\'s also starred in the TV sitcom \"El Ayada.\" In 2013, he\'s starring in the Ahmed Helmy comedy \"Ala Gothty\" (Over My Dead Body). He\'s enjoyed moderate success and has long been a steady choice for secondary characters.'),
('1036066', 'https://media.elcinema.com/uploads/_315x420_b2e7d9590f820c4d05536b536ecd48050fafbf0d7f0bbec047903ffa14515aba.jpg', 'Maher Selim', 'Egypt', NULL, NULL),
('1036278', 'https://media.elcinema.com/uploads/_315x420_dcbeaefb5979966e1677f64edfe4c1b57a9a6c51c8130472bb61bed19dab5d50.jpg', 'Kamal Suliman', 'Egypt', NULL, NULL),
('1036619', 'https://media.elcinema.com/uploads/_315x420_5edb5d386fb956ab01199a9ad36cf498066eba8f4d8b7e12534149be7736f1f0.jpg', 'Kamla Abou Zekri', 'Egypt', ' 8 January 1974', 'Director Kamilla Abou Zekry began her career as a second director’s assistant in the film “131 Ashghal” (“131 Works”) which was directed by Nader Galal in 1993. Thereafter Kamilla director her first short which was titled “Qittar Al Sa’aa Al Sadisah” (“The Six O’ Clock Train”). Following that experience Kamilla went back to working as a directing assistant in the films “Hello America”, “Itfarrag ya Salam” (“Watch and be Amazed”), “Al Lemby” - which starred Mohamed Sa’ad and “Izzay Tikhaly Al Banat Tihibak” (“How to Make Girls Love You”). \nThereafter Kamilla directed her own feature length movie in 2004. The film was titled “Sanna Oulla Nisb” (“Introduction to Swindling”). That production was followed by “Mallik wa Kitaba” (“A King and Scripture”), “’An Al Ou’shq wa Al Hawa” (“On Love and Passion”) and “Wahid Sifr” (“One Zero”). Kamilla also directed the sitcom “6 Meedan Al Tahrir” (“6th at Tahrir Square”). \nAbou Zekry has taken part in several international film festivals, the most important of which involved her representing Egypt through the title “Wahid Sifr” (“One Zero”) at the 66th round of the International Venice Film Festival.'),
('1036968', 'https://media.elcinema.com/uploads/_315x420_ea1c58744ff1610807ca8914a037088c708e1551694dba79b379c4fe53d8c8bd.jpg', 'Afaf Shoaib', 'Egypt', ' 2 November 1948', '‘Afaf Ahmed ‘Aly Shoaib was born in Kafr al-Dawar and moved to the capital to study at the Higher Institute for Theatrical Arts in 1972. Her talents drew attention after she took part in several television series. Thereafter she transitioned to cinema after earning experience on the series “Afwah wa Aranib” (“Mouths and Rabbits”), “Qays wa Lubna”, “al-Yateem wa al-Houbb” (“The Orphaned and Love”), “Du’aa al-Karan” and “al-Hadd wa al-Dimoo’. ‘Afaf married Lebanese producer Riyad al-E’ryan. She later withdrew from acting before starting again but with the veil on.\nDespite her promising start her performances where somewhat devoid of expression. Her best roles were perhaps as those of the dying mother.'),
('1036976', 'https://media.elcinema.com/uploads/_315x420_1215a08b97a46a47a8fd0c6419b9f0c5782a5c01e36a26929973e8ac70d4888e.jpg', 'Ahmad Rahhal', 'Egypt', NULL, NULL),
('1037026', 'https://media.elcinema.com/uploads/_315x420_e254a1db14298ca55aad692db695d79bb1e1429bc28a480614b063bd47672fba.jpg', 'سامية علي السيد', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1037117', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ali Al-Zaidi', 'Egypt', NULL, NULL),
('1037252', 'https://media.elcinema.com/uploads/_315x420_d9ea91bda30b1c6f3c5f69850b0fcd28f8c231c52abecb50170c94a40b934054.jpg', 'Saeed Saleh', 'Egypt', '31 July 1938', 'Sa’id Saleh Ibrahim was born in Cairo. Saleh earned a degree in arts in 1960 and worked on theatrical productions of the likes of “Hallo Shalaby”, “Madrasat al-Mushaghbeen” (Mischief at School), “al-‘Eyal Kibrit” (The Kids Grew Up), “Ka’baloun” and “Nahhnu Nashkur al-Zuruf” (We’re Indebted to the Circumstances). Saleh contributed singing and musical scores to some plays as well as playing the leading role in video and cinema productions.'),
('1037464', 'https://media.elcinema.com/uploads/_315x420_e870e164b3149a98d3f8a051dcfcb472e042fe38844e32b90a497ea80548bf2b.jpg', 'Lubna Mahmoud', 'Egypt', NULL, NULL),
('1037555', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'وليد الكردي', 'Jordan', NULL, NULL),
('1037605', 'https://media.elcinema.com/uploads/_315x420_747ec702764d9d2bc120bca067cfdbd8729c016e34ab888649fc6143012c4040.jpg', 'Ahmed Helmy', 'Egypt', '18 November 1969', 'Ahmed Helmy was born in Banha. He graduated from the Higher Institute of Theatrical Arts. He moved to Cairo to pursue a diverse career including interior design and media production. He later on settled on the media path, working as a host for multiple TV programs mainly aired on Egyptian satellite networks. Following his successful and popular TV run, he ventured into feature films. His first acting job was in \"Aboud Ala Hodood\" (Aboud on the Borders) (1999), which proved to be his huge breakout performance. Since then, Helmy has become a well-established comedian and a leading man. He\'s starred in \"Omar 2000\" (2000), \"Sahar El Layali\" (Sleepless Nights) (2003), and most recently \"Assal Eswed\" (Black Honey) (2010) and 2013\'s \"Ala Gothety\" (Over My Dead Body). Ahmed Helmy is married to actress Mona Zaky and they have one daughter, Leila.'),
('1037756', 'https://media.elcinema.com/uploads/_315x420_fe3fef3d47a0db5e6d044dd4bf178ef94c991fa8028fddee493ef769aa1923d1.jpg', 'Ahmed Algbili', 'Egypt', ' 8 August 1964', NULL),
('1038124', 'https://media.elcinema.com/uploads/_315x420_2bf67a1485703430442a375f8c932ec19129c29390f76b4dd4fe990730e38437.jpg', 'Mohamed Hassib', 'Egypt', NULL, NULL),
('1038318', 'https://media.elcinema.com/uploads/_315x420_13123b523dc5a850c559732d00e96e712014a334cca86195309e0637e00be0e5.jpg', 'Mona Mokhtar', 'Egypt', NULL, NULL),
('1038343', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Timor Al-Aasar', 'Egypt', NULL, NULL),
('1038371', 'https://media.elcinema.com/uploads/_315x420_4c8a8c330222f6b249f152226e52ba3b6ce932126a578f1458b228af50480739.jpg', 'Mohamed Yasine', 'Egypt', NULL, NULL),
('1038528', 'https://media.elcinema.com/uploads/_315x420_99ec2eccda597c1f707f0a3f7e144dcdffaac484bd254b07b9f8b6f11ecaa4ef.jpg', 'Magda Kamel', 'Egypt', '22 September 1957', NULL),
('1038638', 'https://media.elcinema.com/uploads/_315x420_42395862f16bec836af7ce2c5d8ab69f8faa7552a4149a5c8a60f047395e27c9.jpg', 'Haitham Al-Khamisy', 'Egypt', '11 July 1977', NULL),
('1038657', 'https://media.elcinema.com/uploads/_315x420_77a16eb1709196c386c7424efe2f0310732ee2ff90acf967c8cb70d6df282dcf.jpg', 'Al-Masa Media Production', 'Egypt', NULL, NULL),
('1038960', 'https://media.elcinema.com/uploads/_315x420_7d5714d2ed216e4a1140feb8fb80e51c39ad7e2e5cfe506870fe3d4ed0f290ff.jpg', 'Ahmed Seyam', 'Egypt', '20 November 1954', 'Ahmed Seyam is an Egyptian actor who was born in Mansoura, Dakahleya Governorate in 1953. He graduated from the Faculty of Commerce of Cairo University in 1953. He was drawn to acting by coincidence when he was discovered by director Shakir Khadeer when he was still a university student. Sayem accepted Khadeer’s offer of the starring role of his play “Karnifal El Ashbah” (Carnival of Ghosts). Yet Sayed continued to consider acting as a hobby until he graduated from university. Afterwards, play director Galal El Sharkawy suggested that he enroll in the Higher Institute of Dramatic Arts. He was hired by director Fahmy El Khouli to play a minor role in the play “El Raha’in” (The Hostages), which subsequently paved the way for a number of supporting roles in tens of television dramas, including: “Akho El Binat” (The Sisters’ Brother), “Leylat El Qabdh Ala Fatima” (The Night Fatima Was Arrested), “Rihla El Sayyed Abu El Aila El Bashary” (The Journey of Sayyed Abu El Aila El Bashary), “El Rayaa El Beydha” (The White Flag), “Um Kulthoum,” “Lil Adala Wegouh Keteera” (Justice Has Many Faces), “Neran Sadeeqa” (Friendly Fire). He also appeared in a number of films, including “Isteghatha Min El Alem El Akher” (Appeal From Another World), “El Bahr Beyadhak Leh?” (Why Does the Sea Laugh?), “Malf Fe El Adaab” (Prostitution Police), “Gana El Bian El Taly” (We Received the Following Announcement), and “Bousbous.”'),
('1039127', 'https://media.elcinema.com/uploads/_315x420_12cb01551146fb7f1ba84df55ef8cff2639ed55276fb11bf38833511eac07847.jpg', 'Mona Zaki', 'Egypt', '18 November 1977', 'Mona began her career acting in the play “Bila’raby al-Faseeh” (“In Formal Arabic”). She studied in England while young and travelled to Kuwait and the United States with her family before enrolling in a Media Faculty. Mona has appeared in the television productions “al-A’ailah” (“The Family”), “Ahlina” (“Our People”), “Zezina”, “Gohha al-Masry” (“Gohha the Egyptian”).\nMona Zaky married actor Ahmed Helmy in 2002.'),
('1039222', 'https://media.elcinema.com/uploads/_315x420_7e6e7102908ece85a9e040b4ef8d6bab221bf618990a3240856fd2d4d70a63c8.jpg', 'Mohamed Farid', 'Egypt', '24 December 1940', NULL),
('1039400', 'https://media.elcinema.com/uploads/_315x420_d47a019be63864a32f693a24a2c374f5139d6e86b492bfade155cd70a30bfbfa.jpg', 'Nagwa Fouad', 'Egypt', ' 6 January 1939', 'Nagwa Fouad is a famous Egyptian belly dancer. Her real name is ‘Awaatef Muhammad ‘Agamy, she was born in 1939 to an Egyptian father and a Palestinian mother. \nNagwa performed at the Abdeen Casino where she met Ahmad Fouad Hassan (her future husband for 6 years), a producer of stage shows that later became a famous conductor. He convinced her to perform live at the most prestigious music and dance show in the 1960s called “Adwa al-Madeena i.e. City Lights” which had featured such superstars as Shadia, Abdul Haleem Haafez, Fayza Ahmad, and Sabaah.\nIn 1976, the famous composer Mohammed Abdel Wahab wrote an entire musical piece exclusively for her belly dancing show titled “Aamar Arba\'tashar i.e. Full moon” it was her transition from traditional oriental dance to a choreographed stage performances. Her stage performance to this special piece allowed her to change the way belly-dancing was presented on stage, transforming it from traditional oriental dance to more of a choreographed lavish spectacle adding more dramatic elements to it than ever before.\nNagwa featured on many of the covers of the Ahmed Fouad Hassan LP\'s/CD\'s. Nagua took every career step well calculated: \"Hassan was 17 years older than me, but I needed him. He nurtured my amateur\'s talents... He taught me the importance of studying and working on my talent if I wanted to be a big star. He trained me at the Nelly Mazloum Dance School and I joined the National Dance Troupe to study folklore with Russian teachers.\" Nagoua Fouad learned showmanship and eye-catching techniques, which were obvious in her performances of \"Ayyoub al-Masry\" and \"Baheyya we Yasseen\". Ahmad Fouaad Hassan wanted to have a baby from Nagwa, something she did not accept so this eventually led to her first divorce after six years of marriage. Nagwa established her own dance group yet it did not last long and later tried to retire dancing to become actor. She played on the stage and in the cinema and finally became cinema producer.\nShe played a great role in the film “Hadd al-seif i.e. The edge of the sword”.'),
('1039555', 'https://media.elcinema.com/uploads/_315x420_638230582d33725afcc10ce3c61910cf3b3470674a52ee12d0d35a53f5df292a.jpg', 'Amal Helmy', 'Egypt', NULL, 'Amal Helmy is an Egyptian actress. Her debut was in “El Keif” (The High) in 1985. Her other notable roles were in the films “Ahlam Hend Elkhashab” (Hend Elkhashab\'s Dreams), “Dumouaa\' fi Hodn Elgabal” (Tears at the Mountain\'s Bosom) and “E.U.C”.'),
('1039799', 'https://media.elcinema.com/uploads/_315x420_a5ae031195b776797ae94223314771ac8b440971d6db56e611d606aaa76b8943.jpg', 'Saeed Abdulnaeem', 'Egypt', NULL, NULL),
('1039904', 'https://media.elcinema.com/uploads/_315x420_e63c49017df78f0aae61ab69f097e2fdf30346d40629b9727ea5a8ab941f8b06.jpg', 'Basma', 'Egypt', ' 7 December 1976', 'Basma was born in Cairo. Her father worked as a journalist while her mother (was a women’s rights advocate).\nBasma’s acting career began in college where she acted in the movie “Al Madina” directed by Yousry Nasr Allah.\nPrior to performing in “Al Madina”, Basma had tried to enter the world of acting through applying for the state radio and television service. She applied for the position and took the required examinations. However, she was selected by Yousry for the leading role in “Al Madina” before she had completed the application process. \nFollowing her graduation from the English division of the Faculty of Literature at Cairo University, Basma worked as an announcer for the Nile Variety channel between 1998 and 2000. \n(Towards the end of that period) she was contacted by the office of the director Sherif Arafah who had seen her in “Al Madina”. Two weeks after meeting with the director, Basma was offered a role in the movie “Al Nazir,” where she would perform alongside Alaa Waly Al Din, an actor who has passed away since then.\nFollowing her performance in “Al Naama wa Al Tawous”, Basma returned to her old job as announcer, only this time she would announce for Dream channel. She held this position from 2001 to 2002. Thereafter, she would assume a leading role in the television series “Rimal” which was broadcast on MBC. \nSubsequently her acting career took off after having left her old occupation as television presenter behind.'),
('1040182', 'https://media.elcinema.com/uploads/_315x420_a16081ecee6c92a25bf911016ab65612b32896881ae264eddc8eb706a5cb9231.jpg', 'Amr Adib', 'Egypt', '23 October 1963', NULL),
('1040337', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Muhammad Nabil', 'Egypt', NULL, NULL),
('1040341', 'https://media.elcinema.com/uploads/_315x420_894919d22b49ebdb1569fa7a51f18358cc8df71dec10fa5974896a8f45150c16.jpg', 'يحيى زكريا', 'Egypt', ' 4 March 1938', NULL),
('1040495', 'https://media.elcinema.com/uploads/_315x420_4d969a56fa2a4aaa2663a785b94b6db28d8d390ce773235067576bb85374e99a.jpg', 'Sameh Abdelaziz', 'Egypt', '18 September 1976', 'Sameh Abdel Aziz is an Egyptian film director. He was born in Cairo in 1976. He received a bachelor\'s degree in editing from Cairo\'s High Institute of Cinema in 1996. He started his career as a television shows director in the Egyptian state television, then in Dream satellite channel. He then moved to Rotanna channels network, where he started directing several successful music videos, which was his bridge to directing film. His film debut was directing the comedy “Dars Khosusy” (Private Lesson) in 2005 which starred Star Academy winner Mohamed Ateya. He then followed with a series of films, most of which were produced by box office gurus El Sobky brothers, including the critically acclaimed “Cabaret” and “El Farah” (The Wedding), in addition to “Asad we Arbaa\' Otat” (A Lion and Four Cats) and the banned and highly controversial film “Halawet Rouh” (Rouh\'s Beauty) in 2014.'),
('1040695', 'https://media.elcinema.com/uploads/_315x420_a1b5c9d404124e3cf02a2f5922671944c59abc6b03c68983e36cf2d7f4243cf9.jpg', 'Hamza Khater', 'Egypt', NULL, NULL),
('1040706', 'https://media.elcinema.com/uploads/_315x420_7fae7f28ff6c8627fb65e2b464b374273388cf272aa1e9786567257ff1882e33.jpg', 'Safwat Ghattas', 'Egypt', NULL, 'Descending from Lebanese origins he was married to Egyptian actress \"Samira Ahmed\" for some time then they got separated. \nHe was one of the first people to work in video distribution. He is a cinematographer along side being  a producer.'),
('1040732', 'https://media.elcinema.com/uploads/_315x420_232a6c118677f0f8682c019532f1eb6a8721941454a9ddaf6b2514aa6cef9ac7.jpg', 'Mohamed Khan', 'Egypt', '26 October 1942', 'In his early life, Muhammad Khaan travelled to England to study architecture but returned with a cinema diploma. He became one of realistic cinema pioneers, which flourished at the end of the 1970s and through 1980s. Most of Khaan’s films visualize the life of ordinary Egyptian people and he is known for his interest in characters more than the story, which reserved for him a place in Arab cinema hall of fame.'),
('1040892', 'https://media.elcinema.com/uploads/_315x420_95cbf15a329f2d80fbad60c652390c5b5efadc1b643e9cc506afd26e8e2e4d07.jpg', 'Caroline Khalil', 'Egypt', '27 February 1975', NULL),
('1040924', 'https://media.elcinema.com/uploads/_315x420_c2cad157e035cb5a87e9600eb7bf650f95c29e8ebd609417a9b19547a1c6f8ee.jpg', 'A United Bros. Cinema Distribution', 'Egypt', NULL, NULL),
('1041063', 'https://media.elcinema.com/uploads/_315x420_b2ca32236c0d26033c3c928b8139d9e844fe8cf84feeb19bb9ac3887e05002ad.jpg', 'Maha Rushdy', 'Egypt', NULL, NULL),
('1041139', 'https://media.elcinema.com/uploads/_315x420_cc4e8926ac368267b513cc13524ad1b8977e3acdd3c24d76bebef29fbb2c145d.jpg', 'Tamer El Demerdash', 'Egypt', '13 October 1975', NULL),
('1041140', 'https://media.elcinema.com/uploads/_315x420_5940c19a85b5c6acadc26227ab72d2fc9b314e667b7a6994cb169e0cef802285.jpg', 'Hanan Motawee', 'Egypt', '23 February 1979', 'Hanan Karam Motawie is an Egyptian television and film actress. She is the daughter of Soheir Al Morshedy and the late actor Karam Motawie. She graduated from Cairo University from the faculty of commerce. She began her career on \"Hadeeth El Sabah we el Masaa.\" She\'s played a number of memorable characters in both television and film, including \"Qas we Lazq\" by Hala Khalil, \"Al Ghaba\" (The Forest) and \"Heliopolis\" by Ahmad Abdalla. She won Best Supporting Actress for her performance in the film \"Qas we Lazq.\" Her television credits include \"Sara,\" \"Awlad El Shawarea,\" \"Aghla men Hyati,\" \"Azmet Sokkar\" and \"Wekalet Ateyya.\"'),
('1041233', 'https://media.elcinema.com/uploads/_315x420_f0d78cecb5e50cb3e5196ccc217bf364696a8d7070daaa0dd83ecab43768725a.jpg', 'Menna Shalaby', 'Egypt', '24 July 1982', 'Menna Shalaby is one of the brightest stars in the younger generation of Egyptian actors. She was born on July 24, 1981 in Cairo. She is the daughter of the famous dancer and performer Zizi Mustafa. Shalaby displayed a passion for performing from a very early age, no doubt due to the exposure to the industry her mother\'s fame provided. She would often sit in front of the mirror and pretend to be her famous mother, and also fake being sick to get out of going to school, which her mother declared was also acting. Menna made her film debut in \"Al Saher\" (The Magician) as Nour in 2001. She next scored a leading role beside Layla Elwy in \"Baheb El Seema\" (2004). Since then she\'s gone on to work with some of the most talented actors and directors, like Youssef Chahine with \"Heya Fawda\" (2007), Ahmed Abdallah with \"Microphone\" (2010) and Yousry Nasrallah with \"After the Battle\" (2012) about the infamous Battle of the Camel during the January 25 uprising. Her other film credits include \"Banat Wust el Balad\" (2005), \"Ouija\" (2006) and \"Ezaet Hob\" (2011).'),
('1041408', 'https://media.elcinema.com/uploads/_315x420_b90a30a59fc6eb0bef1345280c3575f56bbc953b2a3d15a4e4ffa480aac9737c.jpg', 'Mona Abd El Ghani', 'Egypt', '14 November 1964', NULL),
('1041478', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Neveu Orvalenelli', 'Egypt', NULL, NULL),
('1041486', 'https://media.elcinema.com/uploads/_315x420_d71b8e0bb30bfec3b66aff6fe767a81ca11b12c36475f285031b20e448806cc7.jpg', 'Majdi Kamel', 'Egypt', '18 September 1970', 'Magdy is an actor who has performed in theatrical and cinematic productions. He graduated from the (Institute of Theatrical Arts).'),
('1041517', 'https://media.elcinema.com/uploads/_315x420_9523582acb308410ac5e4291ca3c6dc6dd0721cbfe096d620472d6dc9b4d54ac.jpg', 'Nabil Ali Maher', 'Egypt', ' 8 August 1954', NULL),
('1041695', 'https://media.elcinema.com/uploads/_315x420_1a7bc1c601eac676a590888e83c5a3636d8122824fbfb56080974a9c9ef02e27.jpg', 'Hesham Abdelkhalek', 'Egypt', NULL, NULL),
('1041746', 'https://media.elcinema.com/uploads/_315x420_66819b4407370188ddf229de5e8d11647c889b18d63eb15bfee48f9c69555387.jpg', 'Ahmed El Halwany', 'Egypt', '20 June 1965', 'The actor Ahmed Mohamed Ahmed \"Mohamed El Halawany \" has participated in lots of Cinema and television work. Although he presented few honorary roles, he succeeded to impress us in the series \"Who\'s with a charming smile\", \"The band of mom and dad\". He also joined the syndicate of dramatic arts and presented commercials'),
('1041817', 'https://media.elcinema.com/uploads/_315x420_22a54d58aefc08837bf1797e2cfe2248e60364a3d01cb1dbc39c788032ea5e16.jpg', 'Ahmad Kamel', 'Egypt', ' 1 January 1959', NULL),
('1041889', 'https://media.elcinema.com/uploads/_315x420_a1d056f198d837432ea13a00f0e131cce9bb78988417928ad86fcc482b509a96.jpg', 'Nasser Abdulrahman', 'Egypt', ' 7 December 1970', 'Anyone who has been following developments in Egyptian cinema over the previous years would certainly have noticed that the industry has suffered from declining standards with regards to screenplays. Screenplays represent the backbone and the fundamental element for all films.\nAmong the many personalities active in the field of cinematic screenwriting, one name stands out – the youthful writer Nasser ‘Abd Al Rahman. Nasser first drew attention to himself when he took part in the writing of “al-Madina” (“The City”) alongside director Yousry Nasr Allah. Thereafter Nasser withdrew from the profession for a few years before making a comeback and writing two titles, namely “Geneinat al-Asmak” – which also saw him collaborate with Yousry Nasr Allah, and “Heyya Fawdah” (“Chaos”) which saw him work with renowned director, the late Youssif Chahine. That last effort was particularly significant as it marked the first time in more than 30 years that Youssif Chahine had delegated (or even shared) the task of screenwriting. Nasser is a first rate writer with unique talent.'),
('1041982', 'https://media.elcinema.com/uploads/_315x420_32537186258ba5865d569d5de24741875b0334fa5ea71d23b6eb96fd1f7bd113.jpg', 'Ahmad Wafiq', 'Egypt', '15 January 1970', 'Born in Mansoura in the Egyptian Delta, Ahmad studied Commerce at Mansoura University where he joined the theatre group with which he directed stage plays, did set design, and won the university level award. In cinema, Ahmad has starred in Chahine’s “Sokout Hansawwar\" (Silence, We\'re Rolling) and on the stage in “Bel ‘araby al Faseeh\" (Eloquent Arabic) and “Dostour Ya Syadna\" (Constitution Oh Masters).'),
('1042058', 'https://media.elcinema.com/uploads/_315x420_fa67d11cd52b224fdf5fc143004070ace55d11fcfae6df1c8946e8ac4df11845.jpg', 'Mohamed El Sobky', 'Egypt', '14 November 1953', 'Mohamed Al Sobky is an Egyptian producer whose films have fared consistently well at the box office despite attracting negative reviews from critics. Al Sobky states that his works seek to engage the populist classes from which he himself originates, adding that he knows how to connect with that cohort of society. Critics, however, attack his work and label it as base. \nAl Sobky\'s career began in 1985 when his brother opened a video club atop the butcher shop owned by his father, Hassan Al Sobky, in the Dokki district of Al Giza. The video club focused on promoting foreign movies in  Egypt. Mohamed Al Sobky teamed up with his brother and in a few years the two became joint owners of one of the largest film distributors in the Middle East.\nInitially Mohamed worked as a producer in concert with his brother but they recently decided to separate their activities so that now each brother owns his own producing label.'),
('1042059', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Nadia Ben Rachid', 'France', NULL, NULL),
('1042231', 'https://media.elcinema.com/uploads/_315x420_28fd14064e6d234b0591125196697c033a69a409653348db63ef2b2cffefdf25.jpg', 'Medhat Morsi', 'Egypt', '16 December 1949', NULL),
('1042542', 'https://media.elcinema.com/uploads/_315x420_77ea7a94767d641b63576dfb4f120fa645113278493fbcc2ef454784869f6d5a.jpg', 'Abdelaziz Makhyoun', 'Egypt', ' 3 June 1943', NULL),
('1043012', 'https://media.elcinema.com/uploads/_315x420_53d67dd45d5285357cf7e2bf46e2dfc092acfbbc8b11b73a5b4c0d4279f88271.jpg', 'Hanan Youssef', 'Egypt', '28 June 1966', NULL),
('1043027', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Bassant El Bakri', 'Egypt', NULL, NULL),
('1043049', 'https://media.elcinema.com/uploads/_315x420_2ba5a008ea8577410384abebcd496e628212049537d6b6f5b24a79179058d553.jpg', 'Talaat Zakareia', 'Egypt', '18 December 1960', 'Tal’at is an Egyptian comedy actor who was born in Alexandria. Among his most important works was “Haha wa Tuffaha” (“Haha and the Apple”) which  saw him work with Yasmine ‘Abd Al ‘Azeez and Hassan Housni. The actor also took part in the film “Sayyid al-‘Attafee” with Tamer Housni and the film “Ew’a Wishak” with Ahmed ‘Eid and Ahmed Rezk. Thereafter he worked on one of his most important projects, “Tabakh al-Raees” (The President’s Chef), in his first independent lead. \nIn September 2007, Tal’at Zakkariyah suffered an inflammation in a blood vessel in his brain and fell into a coma. However he later recovered and “Tabakh al-Raees” achieved good returns. Among his most important leads which saw him being awarded prizes was the film “al-Sayyid Abou al-‘Araby Wissil” (“Mr. Abou al-‘Araby has Arrived”). Tal’at collaborated with Hani Ramzi and Wahid Youssif on that work. Another film of his was “Abou ‘Ali”, a work which saw him collaborate with Kareem ‘Abd Al ‘Azeez and Mona Zaki. \nThe actor also presented a film titled “Qissat al-Hayy al-Sha’bee” (“The Tale of the Lower Income Neighborhood”) but it was not up to the high standards which audiences were used to.'),
('1043067', 'https://media.elcinema.com/uploads/_315x420_e22cb4ca14446c9025d2e1a4a8f55de46687470e1ba6edb63872445be06db83f.jpg', 'Muhja Abdulrahman', 'Egypt', NULL, NULL),
('1043175', 'https://media.elcinema.com/uploads/_315x420_b3f0afb6c0732cc09988dbb0e45efb573403f2e1b86539b926cf28f9e9cdb929.jpg', 'Adel Abu Al Gheet', 'Egypt', '12 June 1951', NULL),
('1043352', 'https://media.elcinema.com/uploads/_315x420_073c7f93dc7fac72c24ebd3b0beb1d0afd9036fc99d541446f412502b2ed3e97.jpg', 'Ismail Farghaly', 'Egypt', ' 3 January 1961', NULL),
('1043462', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'عبدالعزيز عمار', 'Egypt', NULL, NULL),
('1043597', 'https://media.elcinema.com/uploads/_315x420_7659aa1d1bdbdb9835776c55140ec09d517d7f3e69e991b3c98e267667101540.jpg', 'Khaled Selim', 'Egypt', ' 6 November 1975', 'Khaled Selim is an Egyptian musician and is among the most successful of the country’s youthful musical performers. His songs appeal to youths and moreover he is adept at singing in several different dialects which include the Lebanese, Gulf and Egyptian dialects. The artist received the title “Premier Musician of Cairo University” in the years ’97, ’98 and 99 in addition to the title “Premier Musician of Egyptian Univerisities” in ’99.\nKhaled has frequently held concerts at opera theaters in Cairo and Alexandria.'),
('1043924', 'https://media.elcinema.com/uploads/_315x420_479f39be983528efdf6103dc155c261aee03940425fa1e59e336c554c80bd06e.jpg', 'Osama Munir', 'Egypt', '24 February 1970', NULL),
('1043930', 'https://media.elcinema.com/uploads/_315x420_24eefaa8a35a018d2e04bbd96b3445cd4ab2b7b4ab5effca7fa94945a62078e1.jpg', 'Essam Karika', 'Egypt', '13 May 1969', 'An Egyptian singer from a Sudanese father and Egyptian mother. He graduated from the  faculty of Hotel Tourism in 1994. He started composing music in 1993 and his first song was for the singer Mohamed Mohi. He achieved best music composer for this year . In the year 2000 he moved on to the cinema where he composed music for films and opening titles and so on. He the year 2003 he took a shot at singing and produced his first single.'),
('1044025', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'بسنت الهواري', 'Egypt', NULL, NULL),
('1044038', 'https://media.elcinema.com/uploads/_315x420_047c9eddaf071225842db0473eea380946780fd20323c6f4170b690f330b2413.jpg', 'Amr Mostafa', 'Egypt', '31 December 1979', '‘Amr Mustafa was born in Cairo to a middle-class family composed of two parents, a brother and a sister. His talents were apparent during his childhood as he composed some of the Arabic poems presented in his Arabic textbook. He received a guitar as a gift when he was three years old – one of the earliest gifts that he received. \n‘Amr enrolled at the Military Aviation Secondary School and studied there for a year. Thereafter he elected to leave the school thereby choosing a life of freedom in exchange for his ambitions to become a career aviator. ‘Amr then joined the law faculty at the University of Cairo and studied there until he graduated in 2001.'),
('1044170', 'https://media.elcinema.com/uploads/_315x420_de0df133f4f5257d65ff924f96c39f8affb1193d8f2df74f8376e265fdf9a0e6.jpg', 'Shaaban Abdel Rahim', 'Egypt', '15 March 1957', 'Sha’ban was born in al-‘Assal, an area in al-Shurabiyah. He worked with his father on laundry by day while singing at weddings by night. He realized fame by singing to Ahmed Helmy’s “Atgawiz ‘Aydah”. He also became well known for singing songs that had a political air, songs such as “Bakrah Israel” (“I Hate Israel”) which caused significant clamor. Sha’ban also worked on several musical plays and on series such as “Samhooni Makansh Asdee” (“Forgive Me, I Did not Mean to”). He also sang on the film “’Afareet al-Asfalt” (“Spirits of the Asphalt”).'),
('1044316', 'https://media.elcinema.com/uploads/_315x420_0fe8d6c81bb0180fcc073a2a9d9f7f32324ac28784c1d3f03126f5df9c5d7b20.jpg', 'Tarek El Nahry', 'Egypt', ' 8 October 1952', 'Taarek al-Nahry Haazem Hassan is an Egyptian cinema and TV actor and director who was born in Cairo. He studied graduated from the faculty of commerce before studying, director section, at the High Institute of Cinema 1987. Taarek started his career in Nour al-Demerdaash’s TV series “Sarkhat baree’ i.e. The screm of an innocent”, followed by “Akhou al-banaat i.e. The girls’ brother”, “Zokaak al-Madakk i.e. Madakk’s alley”, “Man al-gaany? i.e. How is the offender?” and “Nawaa’em”. He participated in the TV film “Al-tareek  ila Eilat i.e. The road to Eilat” and he also directed a number of songs for tevelvision and the film “Law kaan da helm i.e. If it was a dream”.\nAl-Nahry won “Al-Momath-thel al-Mesry i.e. The Egyptian actor” award for newcomer actors in Alexandria 1973.'),
('1044427', 'https://media.elcinema.com/uploads/_315x420_46227214c7ceced7cdd1932fd9f070b30819743e8d7191ba82492fc764ad35f4.jpg', 'Ahlam Al-Gritly', 'Egypt', '20 February 1948', NULL),
('1044513', 'https://media.elcinema.com/uploads/_315x420_60393f8ddaf12c0b187168a986ecd0c51d84d5bef96ae3d88b6d04374338e523.jpg', 'Khaled Marei', 'Egypt', '22 November 1970', 'Khaled Mar’ie began his cinema career after graduating from the montage division at the Institute of Cinema. He has taken part in numerous film productions such as “Korsy fee Al Klub’, “Ayam el Sadat”, “Africano”, “Janat Al Shaytan”, “Muhamy Khal’”, “A’skar fee Al Mu’askar” and “Tito”. Khaled Mar’ie has also contributed to the production of several titles including “A’marat Yacoubian”, “Zarf Tarea” and “Ja’alatny Mugriman”. Khaled’s debut as a director came in 2007 when he directed “Taymour wa Shaqiqa” starring Ahmed El Sekka and Mona Zaky. The film was a commercial and critical success. Following that work, Khaled directed “Asif A’la Al Iz’aj” which starred Ahmed Helmy and Mahmoud Hemeida.\nKhaled’s most recent work was “A’asal Aswad” which brought in a revenue that was in excess of 17 million Egyptian pounds. Khaled Mari’e spent a long time working with the ART network and he has also worked as a director on several programs. However, Khaled has come to work exclusively in cinema since then.\nIn 2013, Maraie began a series of successful collaborations with writer Mohamed Amien Rady with the television series \"Neiran Sadiqa\" (Friendly Fire), which featured a big ensemble cast of stars. After receiving acclaim for his immaculate direction and the series\' daring content, Maraie teamed up again with Mohamed Amien Rady in 2014 to make the more successful and controversial series \"El Sabaa Wasaya\" (The Seven Commandments), which also featured an ensemble cast and received widespread acclaim. The collaboration was also repeated in 2015 with the series \"Al Aahd\" (The Pledge).'),
('1044602', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed Fadl', 'Egypt', NULL, NULL),
('1044776', 'https://media.elcinema.com/uploads/_315x420_e3e122343374b53c7453ccf6c4959f29b0ca517598f66821973f4f451a6e3ead.jpg', 'Nour El Sherif', 'Egypt', '28 April 1946', 'His full name is Mohamed Gaber Mohamed A’bd Allah and he was born in the al-Khalifa neighborhood of Cairo. Nour earned a diploma from the Higher Institute for Theatrical Studies incal Studies in 1967. Upon his graduation he was classified as first tier. Nour married fellow actress Poussy in 1972 and the couple have two daughters named Sara and May.\nNour’s father passed away at the age of 26 when Nour el-Shereef was only one. El-Shereef began acting while at school where he joined an acting troupe. Nour also played soccer in al-Zamalek’s junior team and had it not been for his passion for acting he would have probably have sought a career in football. Following his graduation from highschool Nour enrolled at the faculty of commerce but later transferred to the Higher Institute for Theatrical Arts. He got to know Sa’ad Ardash who nominated him for a minor role in a play titled “Shaware’ al-Khalifa” (“The Streets of al-Khalifa”). Thereafter director Kamal E’id chose him to perform in a theatrical production titled “Romeo wa Juliet”. Whilst rehearsing for the play Nour met A’del Imam who was to nominate him to director Hassan Imam. The director had him participate in the film “Qasr al-Shawq” (“Fort of Passion”). Nour el-Shereef received a special honor for his part in the production – his first such award. \nAmong the television series that he has participated in are: “Al-Qahira wa al-Nas” (“Cairo and its People”), “Adeeb” (“The Scholar”), “Lan A’eesh fee Galbab Abby” (“I Will not Live in My Father’s Robes”), “Al Tha’lab” (“The Fox”), “U’mar bin A’bd Al A’zeez”, “Haroun al-Rasheed”, “Ibn Rushd”, “A’ailat al-Hajj Metwally” (“The Household of al-Hajj Metwally”) which aired in 2001, “Al A’ttar wa al-Bannat al-Sab’”(“The Perfumer and The Seven Girls”) which aired in 2002 and “Ragol al-Aqdar” (“Man of Destiny”) which aired in 2003. Nour also hosted the television program “Shouf Bakhtak”. \nAmong his plays are “Kont feen ya A’ly” (“Where Were You A’ly”), “Al-Muttafael” (“The Optimist”). His directorial debut took place at the Al-Hanajir theater where he directed “Al-Kahin” (“The Priest”). Nour has received numerous awards as he received honors for the film “Qitt’a A’la al-Nar” and four prizes for “Ya Rab Tawba”, “Da’ Al U’mr ya Walady” (“We’ve Squandered the Years, My Son”), “Habeeby Daeiman” (“My Lover, Always”), “Al Karnak”, “Hadouta Massriyah” (“An Egyptian Tale”), “Al Taouss” (“The Peacock”), “Al A’ar” (“The Shame”) and “Ahl al-Qimma” (“Those of the Summit”). \nNour was also awarded the prize of the New Delhi film festival for the film “Sawwaq al-Autobis” (“Bus Driver”), in addition to the 1996 Cairo Cinema Festival award for best actor for his role in “Leyla Sakhina”. In 2001 Nour directed the movie “Al-A’ashiqan” (“The Two Lovers”).'),
('1045010', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمود كامل', 'Egypt', NULL, NULL),
('1045036', 'https://media.elcinema.com/uploads/_315x420_1f1374cd20cbdf4d9353b946d04ccaabeac26d4db37ba1a32e30f25fdf1d4745.jpg', 'Naguib Mahfouz', 'Egypt', '11 December 1911', 'Born on December 11th 1911, he was an Egyptian writer who won the 1988 Nobel Prize for Literature.  He is regarded as one of the first contemporary writers of Arabic literature,e, along with Tawfiq el-Hakim, to explore themes of existentialism He published over 50 novels, over 350 short stories, dozens of movie scripts, and five plays over a 70-year career. Many of his works have been made into Egyptian and foreign films.\nMahfouz\'s central work in the 1950s was the Cairo Trilogy, an immense monumental work of 1,500 pages, which the author completed before the July Revolution. The novels were titled with the street names Palace Walk, Palace of Desire, and Sugar Street.  Mahfouz set the story in the parts of Cairo where he grew up. They depict the life of the patriarch el-Sayyed Ahmed Abdel Gawad and his family over three generations, from World War I to the 1950s, when King Farouk I was overthrown. With its rich variety of characters and psychological understanding, the work connected Mahfouz to such authors as Balzac, Dickens, Tolstoy, and Galsworthy. Mahfouz ceased to write for some years after finishing the trilogy.'),
('1045187', 'https://media.elcinema.com/uploads/_315x420_6c4df0be90d74c1b3e1ad3865f4dffc4f58caab9165ff5c998588d4188eef1a8.jpg', 'Tarek Lotfy', 'Egypt', '20 November 1965', 'Taarek Lotfy is a talented Egyptian actor, he studied at the High Institute of Dramatic Arts and got the director diploma from the High Institute of Cinema at the 1980s. Lotfy participated in various works that helped him to him to book a place in audience’s hearts, among his most famous TV series are; Esma’eel Abdul Haafez’s “Al-‘aaela i.e. The family” and “Al’hakeeka wal saraab i.e. The truth and the mirage”. Taarek played an excellent role in the successful film “Se’eedy fel gam’a al-Amerikeyya i.e. An upper Egyptian at the American University”.'),
('1045241', 'https://media.elcinema.com/uploads/_315x420_0bf4abfef8e47d6902ba64141c9c8559538383b39be6217805d986229127bd88.jpg', 'Afaf Rashad', 'Egypt', '30 December 1957', NULL),
('1045300', 'https://media.elcinema.com/uploads/_315x420_849b5d7302bec42dc3707b5639016543c3265bda684d4c6fe910d48607039444.jpg', 'Belal Fadl', 'Egypt', ' 5 September 1974', 'Belal Fadl was born in 1974 in the Cairo district of Manshiyet al-Bakry. He spent his childhood in Alexandria where his family resides in the district of Mahram Beyk. Fadl studied at the Journalism department at Cairo University’s Media faculty from which he graduated in 1995. Fadl was ranked first in his class and graduated with distinction and honors. Thereafter Fadl worked as a trainee for the “Rose al-Youssif” newspaper, that position was followed by a stint as a secretary editor at the al-Dastoor newspaper until the government temporarily closed that publication towards the start of 1998. \nBelal Fadl then spent  a while writing for newspapers and magazines of the likes of “al-Kawakib”, “Sabah al-Kheir”, “al-Mussawar”, “al-Hilal”, “Wighat Nazar”, the Emirati publication “al-Ittihad”, London’s “al-Wasat” and the Egyptian publication “al-Isboo’”. Belal also worked for the ART television network before working as the deputy director of MBC’s Cairo office. Moreover, Belal also worked as an editor at the “al-Geel” Egyptian newspaper before taking part in the founding of the “al-Qahira” newspaper which was published by the Ministry of Culture. Belal was the chief editor for the paper for several month before leaving journalism behind altogether and beginning a career as a screenwriter. His first screenplay was released in 2001 after six years of attempts. Belal then returned to journalism and wrote for the al-Dastoor weekly paper after a court ordered its opening in 2005. He edited a weekly publication titled Qalamein and then contributed a weekly column for the “al-Masry al-Youm” newspaper. In 2007 Belal began writing a daily column in the al-Dastoor newspaper, he continued the effort for eight months before stopping. Thereafter Belal wrote his first television work, a series titled “Heyma”. After the work was screened Belal went back in November 2008 to writing daily articles but this time he wrote for the “al-Masry al-Youm” where he contributed a column on the last page titled “Istibaha”. The column discussed contemporary events. Belal also spent a while presenting a segment on the “al-Qahira al-Youm” (“Cairo Today”) television program alongside television presenter ‘Amr Adeeb. Today Belal presents a weekly program on the Dream 2 channel titled “’Aseer al-Kutub”, the program discusses books and airs every Sunday at seven in the evening. The same program is also repeated every Monday at four in the evening and Wednesday at 2 am.'),
('1045331', 'https://media.elcinema.com/uploads/_315x420_c7aa5cc5314f9566c3789325a91469f8a8c1d064928f7e9ea6cf5f1f4ff36219.jpg', 'Mohamed Diab', 'Egypt', NULL, 'Mohamed Diab is a screenplay writer and director from Ismalia. Originally an economics major, he worked in a major international bank while writing scripts on the side as a hobby. His love for writing outweighed his decision to work as a steady employee, so he quit his job and moved to New York where he studied screenplay writing at the New York Film Academy.'),
('1045389', 'https://media.elcinema.com/uploads/_315x420_4dbed892acc88f3d61e41ca0d59511898f1d3312941fc1c233387f722390a795.jpg', 'Youssef Eid', 'Egypt', '14 November 1948', 'Youssef Mohamed Eid was born in the (town) of Al Gamaliyah. (He received a high school degree from Al Azhar in 1987). (?) His (theater debut took place in 1975 when he participated in) “Nahnu la Nohib Al Kowsa”, “Intaha Al Dars ya Ghaby”, “Aashan Khater Eiounak”, “Sharaa Mohamed Ali”, “Raqs Al Deyouk” and “Zqaq al Madaq”.\nAmong the television (series) in which he has assumed roles are “Al Sira Al Hilaliyah”, “Al Bashair”, “Safar Al Ahlam” and “Alo Rabie Mara”.'),
('1045552', 'https://media.elcinema.com/uploads/_315x420_a48418ee3227255ed594c8a7280922a48813ee09abae7256bf102930c6a389af.jpg', 'Yousra', 'Egypt', '10 March 1955', 'Born Civene Muhammad Haafez Nasseem (1955 Cairo), is an Egyptian actress who was first discovered by photographer Abdul Haleem Nasr who gave her a role in his debut as filmmaker. She played several TV roles like “Arees we aroussa i.e. Groom and bride”, “Al-shaahed al-waheed i.e. The only witness”, “ Hayaat al-Gohary”, “Raafat al-Haggaan”, “Sayyedat al-fondok i.e. The Lady of the hotel”,  “Awaan al-ward i.e. A time for flowers”, “Ayna Kalby? i.e. Where is my heart?” and “ Malak rowhy i.e. King of my soul”.\n“Entadher la taktolny i.e. Wait, don’t kill me” is among her radio series. She played stage roles like “Ka’b aaly i.e. High heels” and “Lamma baba yenaam i.e. When daddy sleeps”. Superstar Youssra is married to Khaaled Seleem, the son of football Legend Saaleh Seleem and the actor Heshaam Seleem’s brother.\nYoussra represents a special blend of acting and stardom mixed survival and freshness, she formed a very successful duet with Aadel Emaam and played several roles with Ahmad Zaky. Youssra has a unique artistic talent which flourished in Chahine’s “Eskendereyya kamaan we kamaan i.e. Alexandria again and forever”, “Al-mohaager i.e. The immigrant” and “Eskendereyya New York i.e. Alexandria New York”.\nAmong her most famous cinema roles; “Al-‘assefa i.e. The tempest”, “Al-gou’ i.e. Hunger”, “Al-mansy i.e. The forgotten” and “Toyour al-zalaam i.e. The birds of darkness”.'),
('1045672', 'https://media.elcinema.com/uploads/_315x420_997d9566c30619d95da5287c23f760b874bbaa3516ec7f3ab1542f643a8dbbbe.jpg', 'دانا للإنتاج والتوزيع الفنى', 'Egypt', NULL, NULL),
('1045936', 'https://media.elcinema.com/uploads/_315x420_f62abff282dacdff5537b08465dd2595bf08180ecf62eabc99ee33137d9dece4.jpg', 'Haitham Zaki', 'Egypt', ' 4 April 1984', 'Haitham Zakky is a rising Egyptian actor. His family was active artistically as his father was the late Ahmed Zakky and his mother is artist Hala Fouad. Haitham began his career in 2006 when he filled in for his deceased father in the remaining scenes of the film “Haleem”. Haitham’s father, Ahmed Zakky, was the title’s lead prior to his death. Thereafter Haitham presented his first independent lead in the film title “al-Plagio” and the endeavor was a great success.'),
('1045963', 'https://media.elcinema.com/uploads/_315x420_47e108621c81ebd843410c8808b8bb6231a5e157afdff370b452a7aaa682f0c4.jpg', 'Hamdy Hikal', 'Egypt', '25 July 1959', NULL),
('1046134', 'https://media.elcinema.com/uploads/_315x420_dc124f677b7f0375d450ce17244cb16f7554ab248b3730c0c2b7df8521d4570d.jpg', 'Shams', 'Egypt', ' 9 April 1976', NULL),
('1046195', 'https://media.elcinema.com/uploads/_315x420_36cd79854357069142dc5d26a2eac4d1be91347698d8073c67c6befeb53485d0.jpg', 'Rashwan Tawfek', 'Egypt', '24 November 1933', 'Rashwan Tawfek is an Egyptian actor who was born in Sayyeda Zeinab, Cairo in 1933. He got his Bachelor’s degree in acting and directing from the Higher Institute for Dramatic Arts and after graduating worked in Egyptian TV. After this, he joined a TV theater troupe that was getting started, and during this period of time was the star of a number of plays, including: “Sheia’ Fi Sadri” (Something in my Chest), “El Showaria El Khalfia” (The Backstreets), “Thawra Qareya” (Revolution of a Village), “Bayt El Fananeen” (House of Artists). Tawfek also performed with the Tafik El Hakim Theater Troupe, The Modern Theatre Troupe, and the National Theatre Troupe. After long years of acting in the theater, Tawfek moved to acting in TV drama at the end of the 1970s. The most famous serials that he acted in include: “Abna’i El-A’za’ Shukran” (Thank You, My Dears), “El Ayam” (The Days), “Mohamed Rusul Allah,” El Shahid We El Domou’” (Honey and Tears), “El Zayni Barakat,” “Len Ayesh Fe Galabab Abi” (I Won’t Live My Father’s Life).'),
('1046295', 'https://media.elcinema.com/uploads/_315x420_a0130323037dd39fa573bd40857f507323ab90b3bb99c0df853625a0eda27a8c.jpg', 'Hosam Al-Gohary', 'Egypt', NULL, NULL),
('1046306', 'https://media.elcinema.com/uploads/_315x420_a1e1fb33be2cacd1c7a77f30a56de52c92923c9a6028c10dce1d0f511d017953.jpg', 'Hamdy El Sakhawy', 'Egypt', ' 1 July 1955', 'Egyptian actor Hamdy El Sakhawy was born in 1955. Directors have often cast him in roles as a foreigner, taking advantage of his European appearance. He is best known for his television acting, including such works as: “La Ahad Binam Fi Iskandria” (No One Sleeps in Alexandria), “Meen Atlak El Risas ‘Ala Hind Alaam” (Who Shot Hind Alaam), “El Malak Farouk” (King Farouk), “Ragil wa Sit Sitat” (One Man, Six Ladies) and “El Sa’irun Nayiman” (The Sleep Walkers).'),
('1046457', 'https://media.elcinema.com/uploads/_315x420_2cdda64d60a9b3c3b37db8655c94daf686687ce10fd3ff04726246cf6ce32b49.jpg', 'Ahmad Bedir', 'Egypt', ' 1 May 1945', 'After finishing his high school studies in 1966, he graduated from the faculty of Arts in 1970. Ahmad was an actor, play writer and director in the Youth centers theatre. As actor, he also worked in a number of radio series, it was his appearance in TV series that started his fame.  One can never forget his roles in “Taaer al-leil al-hazeen i.e. The sad night bird”, “Al-Zeiny Baraakat”, “Holm al-layl wal-nahaar i.e. Night and day dream”, “Abwaab al-madeena i.e. City gates”, “Nahr al-malh i.e. Salt River”, “Al-madeena i.e. The city”, “Al-hessaar i.e. Embargo”, “Soraakh al-samt i.e. Silence scream” and “Zizinia”. On stage Bedeir excelled in a number of plays; “Rayya we Sekeena”, “Bacalorios fee hokm al-sho’oob i.e. B.A. ruling people”, “Al-sa’ayda wassalo i.e. Upper Egyptians arrived”, “’Al-rasseef i.e. On the sidewalk”, “Koromb zabaady i.e. Cabbage Yogurt”, “Dostour ya syadna i.e. Constitution oh masters” and “Al-Comandan i.e. The Commander”.\nThe silver screen shows how Ahmad was patient enough to play small roles that bit by bit proved his talent. Though he played lead roles in different films, yet he was in his best with Youssef Chahine. His vitality in “Sokoot hansawwar i.e. Silence ..We’re rolling” was a value added to Chahine’s film. His roles in “Abnaa wa qatala i.e. Sons and killers” and “Batal men warak i.e. Paper Hero” show his real talent. Ahmad Bedeir is married and has two daughters; Sara and Do’aa.'),
('1046532', 'https://media.elcinema.com/uploads/_315x420_b336f132f4877576ee0d57bf61a993207e1635d923c32c6cf9c5cd389a1c2a8f.jpg', 'Albatrous film production', 'Egypt', NULL, NULL),
('1046535', 'https://media.elcinema.com/uploads/_315x420_4110a075465f86b4f3bddd891e9ac2a38242cd86039b02a53aa1a204c1bb643f.jpg', 'Adel Adeeb', 'Egypt', NULL, NULL),
('1046834', 'https://media.elcinema.com/uploads/_315x420_66539c56b3da54690a8590fc420c09293e50718afb711be95d1ce8851637e623.jpg', 'Ahmed Abdelhamid', 'Egypt', NULL, NULL),
('1046835', 'https://media.elcinema.com/uploads/_315x420_7e76f6c3ec93e527690388e62eb5e13d14db9baf894ded3cb9048153a515c9e2.jpg', 'Tamer Shaltout', 'Egypt', '15 January 1986', 'Tamer Shaltout has worked for the channel (Mazzika) as a presenter in the (music news segment). He has also presented many of the channel’s concerts in addition to conducting interviews with several (performers). \nFollowing his (stint) at (Mazzika), Tamer Shaltout worked for several other channels where he met with a great deal of success in presenting a range of (distinctive) programs. \nFollowing his success in television, Tamer was attracted to the world of cinema and he (assumed) his first acting role in the film (“Al Shaytan”). Subsequently, he has acted in several other movies, the latest of which was (“Qataa Shahn”).'),
('1047138', 'https://media.elcinema.com/uploads/_315x420_768020961e0cff104fe2166f95de93b0d936ca27e587405c9ff7f8c2f6056390.jpg', 'Ahmed Maher', 'Egypt', '13 August 1946', 'Ahmed Maher is an Egyptian actor, who was born in the town of Boulaq in 1946. He received a Bachelor\'s degree from the Institute of Theatrical Arts in 1973. Maher worked mostly in theater and television. He started on theaters of youth centers and public culture foundations. Among his most popular theatrical works are “Al Motazawegoon” (The Married) and “Agaza Momtea\' Giddan” (A Very Entertaining Vacation). In television, Ahmed Maher was best known for his depiction of historical characters, in major hits like “Al Forsan” (The Knights), “Al Abtal” (The Heroes) and the famous eponymous espionage series “Raa\'fat El Hagan.”'),
('1047212', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Wafaa Soliman', 'Egypt', NULL, NULL),
('1047283', 'https://media.elcinema.com/uploads/_315x420_520322ca621d8577a7a275e391e4367b4967e4235c52f41308dd1a2b4d1c7d7e.jpg', 'Motawea Oweis', 'Egypt', ' 6 August 1929', 'Metaweaa\' Eweiss is an Egyptian actor, born in 1929. He worked as a silent extra in a lot of films at the start of his career. He then started taking small roles, the majority of which being as a doorman, fruit/vegetable seller, broker and gangster. He died in 2010.'),
('1047359', 'https://media.elcinema.com/uploads/_315x420_876f1465f6e700e48123efa35508ec98585fb12e38d14ca0dc98427a9373256f.jpg', 'Mohamed Zedan', 'Egypt', '29 May 1983', NULL),
('1048267', 'https://media.elcinema.com/uploads/_315x420_57ad0cf15572725a80c0a4696f775bebe5cd3f6048603bb7f9c95f454fdf90fa.jpg', 'Nader NourAlddin', 'Egypt', ' 7 July 1961', NULL),
('1048339', 'https://media.elcinema.com/uploads/_315x420_346363ea07439026aae032f8c91acd0e47e36bcc6816c73d446e11893f0e47df.jpg', 'Emad Hamdy', 'Egypt', '25 November 1909', 'Egyptian artist ‘Emad Hamdi is among the most capable and most outstanding artists throughout the history of Arabic cinema. His full name is Mohamed ‘Emad al-Deen ‘Abd Al Hameed Hamdi and he was born in the governorate of Sohag. ‘Emad received a diploma from a commerce school and was married four times. His first marriage was to an oriental dancer named Houriyeh Mohamed while his second marriage was to Fathhiyah Shereef who worked as a monologist for a group named Badee’a Musabny. The couple had a boy which they named Nadir and their marriage lasted between 1945 and 1953. ‘Emad later married an artist named Shadya and the pair presented a few movies together. They later separated in 1956. In 1961 ‘Emad married an artist named Nadia al-Guindy. The pair had a son named Hashim and their marriage lasted 13 years. At the outset of his career ‘Emad worked at Studio Misr, thereafter he worked at the Abou el-Reesh Hospital. He progressed in his job, starting out as a head accountant then becoming production manager and later becoming a distribution manager. He was fond of acting and that led him to take part in Ministry of Health promotional films which were produced at Studio Misr. His real beginnings in cinema came about in 1945 when he took part in a film titled “al-Souq al-Sawdaa” (“The Black Market”) and acted alongside artist ‘Aqilah Ratib. ‘Emad also took part in the production of several films as he founded a production company. Some would consider him among the most important of Egyptian actors as he had a cool demeanor with soft features which made him resemble Marlon Brando. He also has a very distinct voice. The distinction in his voice grew with his age as can be observed in “Umm al-‘Arousah” (“Mother of the Bride”), “al-Muzniboon” (“The Guilty”) and “Tharthara Fawq al-Neel” (“Chatting on the Nile”). Despite the fact that he was a hard worker he would reserve his talents for particular films and for directors that could bring out those talents.');
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1048346', 'https://media.elcinema.com/uploads/_315x420_f75cf0c77fdcb06ef2a9c84824dcaf634112fade771c424a6716ba53088097cb.jpg', 'Enaam Salosa', 'Egypt', '15 December 1939', 'Egyptian actor Enaam Salosa (born: Enaam Ibrahim Hassan Ahmad) was born in the city of Dumyatt in 1939. While studying at Ayn Shams University, she participated in a number of theatrical performances in the College of Literature. After graduation, she enrolled at the Higher Institute of Dramatic Arts. Some of her most important works are television dramas including: “Layaly Al Helmya” (Al Helmya Nights), “El Liqa’ El Tani” (The Second Meeting), “Imraa min Zamn El Hub” (A Woman from the Time of Love), “Ya Rigal El Aalam Ithadu” (Oh Men of the World, Unite), and “Ailet El Hag Mitwali” (The Family Hag Mitwali). Salosa has also appeared in many films, including: “Mawad ala Asha’” (A Dinner Date; 1998), “El Irhab wal Kebab” (Terrorism and Kebab; 1992), “El Noom fil Aasel” (Sleeping in Honey; 1996), “Hammam fi Amsterdam” (Hammam in Amsterdam; 1999), and “Aasel Eswed” (Molasses; 2010).'),
('1048366', 'https://media.elcinema.com/uploads/_315x420_8adc1a65b4997e500860263b646edc7e3ed23fea00bcdedeb9bc4c1fbcf3831a.jpg', 'Mohammed Al-Shura', 'Egypt', NULL, NULL),
('1048373', 'https://media.elcinema.com/uploads/_315x420_7f556ea15ef77f179612163abc98479deac8f8f9d1cc3117a141444dff1bedcd.jpg', 'Youssef El Sherif', 'Egypt', '14 September 1978', 'Muhammed Esmaeel, known as Youssef al-Shereef was born in Cairo on the 14th of December 1978. He is a mechanical engineer, graduate of Ain Shams University, and a clever Karate player who played in international championships in Tunisia and Hungary. He also played football at al-Ahly as well as volleyball. He participated in six films and three TV series. Youssef played the role of director Aly Badrakhaan, Soaad Hosny’s husband in TV series “Al-Cindrella\" (The Cinderella). In TV series “Ala naar hadya\" (On low fire) he played the role of Hishaam, Rasha Mahdy’s fiancé. He was also Essaam in “Al-‘ameel 1001\" (Agent 1001). On the big screen, Shereef played the role of Shereef, the D.A. in “Heya Fawda\" (Is this Chaos..?) with Khaaled Saaleh and Menna Shalaby, Hossaam, the army officer in “Fattah Eineik\" (Open your eyes) and Ahmad Abdul Hayy in “Saba’ war’aat kotsheena\" (Seven play cards). He also participated in “Haleem” and “Al-gazeera\" (The Island). The year 2012 saw the rise of his fame on TV when he starred in \"Rakam Maghol\" (Unknown Number), then he went on to play another very successful role in \"Ism Mo\'aqat\" (Temporary Name).'),
('1048491', 'https://media.elcinema.com/uploads/_315x420_ad65343b6f25d2708d846ecd1b066386b90be9584353797035dd47c6957c5a94.jpg', 'Tamer Hosny', 'Egypt', '16 August 1977', 'Born in Cairo on August the 16th – a determined Leo-,Tamer Abbas Hosy earned his degree in Mass Communication from 6 of October University then started to purse his singing career. His early beginnings started by his introduction to renowned TV presenter ‘Salma Al Shamaa’, who gave him a lifetime opportunity to perform at the Opera House alongside  other emerging talents such as, ‘Shereen Abd El Wahab’, where famous producer ‘Nasr Mahrous’ attended.Ever since, Hosny worked closely with Mahrous- whom he regards as his elder brother- releasing his first successful album, which marked the beginning of his career, opening gates of stardom and fame, not only in singing, but also in the movie industry.                                                      \nHis famous songs include (Kol Mara), (Bent El Eh), (Aktar Haga) and his famous works in Cinema include (Omar and Salma)-which was a big success in the Egyptian box office-,(Captin Hema), while his first movie debut was in(Halet Hob), starring ‘Sherif Ramzy’ and ‘Hind Sabry’'),
('1048561', 'https://media.elcinema.com/uploads/_315x420_4133a302f5e45e6cab6c10c3584ea127d2221c91b08c495f21d30d54de2020c7.jpg', 'Emad Al Bahhat', 'Egypt', '20 May 1970', NULL),
('1048597', 'https://media.elcinema.com/uploads/_315x420_b0b8ebf23698a5fcad33edfcdcb8ac9c527847260dc8ebce65d32c3510da3d2c.jpg', 'Adel Imam', 'Egypt', '17 May 1940', 'Adel Imam is an Egyptian comedic actor, and one of the most iconic figures in Arab cinema. He\'s starred in over 100 movies and 10 plays, earning the adoration of audiences and critics alike. He was born in Mansoura on May 17, 1940, but at an early aged moved with his family to Sayyed Zeinab where he grew up. The actor got his bachelor\'s degree in agriculture from the University of Cairo, where he became passionately involved in college theatre productions. He joined a television troupe in 1962 while still a student, and began starring in TV plays like \"Ana wa Howa wa Heya\" (He, She and I) and \"Al Nassabin\" (The Swindlers) which was performed at the Al Hakim Theater. In the following years he acted in several well received plays like \"Al Bijamma Al Hamra\" (The Red Pajamas), \"Fardet Shamal\" (Left Shoe) and \"Gharammiyat A\'feefy\" (A\'feefy\'s Love Affairs). In the 1970s, he starred in the hit play \"Madrassat Al Mashaghbeen\" (Mischief at School), which screened from 1971 to 1975. He then did \"Shahid Mashafsh Hagga\" (The Witness Didn\'t See Anything) which was screened over a period of seven years. Afterwards, he did \"Al Wadd Sayyid Al Shaghal,\" which screened from 1985 to 1993. Imam has had one of the longest acting careers. More recently, he starred in \"The Yacoubian Building,\" adapted from Alaa Al-Aswany\'s celebrated novel. The film, a poignant piece of social commentary, is known to be the highest-budgeted film in Egyptian cinema history. In 2012, an Egyptian court convicted Imam for defamation of Islam (not the first time this has happened). The films targeted in this particular case were \"Al Irhabi\" (The Terrorist) and \"Al Zaeem\" (The Leader) in which he satirizes Arab autocratic rulers. Imam, however, won his appeal against the conviction. In 2000, the United Nations named him a Goodwill Ambassador for UNHCR.'),
('1048632', 'https://media.elcinema.com/uploads/_315x420_35fddc8f76c5c2005d60d7643df118ac68b5979edb34bb8f9f9eb097c69406d3.jpg', 'Mohamed Ragab', 'Egypt', '27 May 1975', 'Mohamed Ragab began his career as an actor on children’s programs. He also worked as an assistant director and studied at the Cinema Institute. Mohamed worked on the television series “al-Zainy Barakat” in addition to working as an assistant director for Tareq al-‘Eryan on \"El Silim we Al Thu\'ban\" (Snakes and Ladders). He also appeared on the television series “al-Banat” (Girls). In 2013, he stars in the mystery thriller \"El Hafla\" (The Party).'),
('1048981', 'https://media.elcinema.com/uploads/_315x420_033206518603239be55fd3fa8d35a9de333e64d7d158f563a0397de6e311a19b.jpg', 'Ayman El Shewy', 'Egypt', '23 June 1965', NULL),
('1049024', 'https://media.elcinema.com/uploads/_315x420_58c7fe489476a1d0a2d5b91ce10d9ec1df251dc016721dbebe6020e601bc6267.jpg', 'Daoud Abdel Sayed', 'Egypt', '23 November 1946', 'Daoud was awarded a bachelor’s degree in directing from the (Cinema institute) in 1967. As a child, he had not aspired for a career in directing but rather wanted to become a journalist. His cousin, who was a big fan of cartoons, had a strong influence on him in this respect. \nDaoud eventually bought a camera and experimented with it at home. Gradually, he got to know several people that worked in the film industry. When he was 16 years old his cousin took him to visit “Galal” studio where the director Ahmed Diaa Al Deen was shooting a movie. Daoud’s cousin knew the director (as they were both colleagues). While on the visit, Daoud was greatly impressed by the world of cinema and decided thereafter to enroll in the (Cinema institute).\nDaoud started working as an assistant director, at this early stage he contribute to several films, the most important of which were Youssef Chahine’s “Al Ard”, Kamal Al Sheikh’s “Al Rajul al lazy Faqad Zolah” and Mamdouh Shokry’s “Awham Al Hob”. At this point, Daoud discontinued this type of work.\nDaoud took his camera to the streets of Cairo and went looking for real life sociological accounts to make documentary films.\nThus, he presented several documentary films, the most important of which are “Wassiyat Rajul Hakim fee Shoun Al Qaryah wa Al Taalim” (1976), “Al Aamal fee Al Haql” (1979) and “Aan Al Nas wa Al Anbya wa Al Fananeen” (1980). Work on these films provided Daoud with the opportunity to interact directly with common folk, this gave him a deeper insight into Egyptian society with all its divisions. Moreover, the experience allowed Daoud to appreciate the sensations of dynamic day-to-day lives.'),
('1049062', 'https://media.elcinema.com/uploads/_315x420_230e3dae762b51670415c372b5494046f147513b3e7ff6f6776ded5c699c81b7.jpg', 'Natasha', 'Lebanon', '14 January 1994', NULL),
('1049096', 'https://media.elcinema.com/uploads/_315x420_e857e88bf5ced668df769183c4871789411ac0e4d3a6da74fb0479466ed17578.jpg', 'Nayef Bassiouni', 'Egypt', NULL, NULL),
('1049208', 'https://media.elcinema.com/uploads/_315x420_aa98c43117f9b7a3e2e3537e566d994569e55d42d2972fa891235ac6443be302.jpg', 'Ahmed Eid', 'Egypt', ' 6 January 1968', 'E’id was born in the district of Dahlia. He enrolled at the faculty of agriculture but did not complete his degree. Rather he transferred to the Institute of Theatrical Arts and thereafter performed in several plays including “Souq Al Halawa” (“Candy Market”), “Al A’yn Al Hamraa” (“Red Eye”) and “Al Abanda”.'),
('1049209', 'https://media.elcinema.com/uploads/_315x420_2c493aba02be3769b01df2e8b82a83acb80dac30fca1019d219f5a03b182455a.jpg', 'Mohamed Saad', 'Egypt', '14 December 1968', 'Mohamed Saad was born in Sayeda Zeinab, Cairo. He studied in the High Institute of Theatrical Arts of Cairo. He started his career by appearing in small roles in TV series like “Mazal Alnahr Yagry” (The River is Still running), and films like “Al Tariq Ila Eilat” (The Road to Eilat) and “El Gentle” (The Gentle) in 1997. His big break was in the blockbuster “El Nazer” where he portrayed the character of “El Lemby”, which earned him a great popularity that was increased enormously in the film “El Lemby,” in 2002, where he portrayed the same character and was the lead actor this time. He then went on to portray single farcical characters with flashy names in a series of films that followed the success of “El Lemby” like “Okal”, “Booha”, “Tattah”, and “Bushkash.”'),
('1049223', 'https://media.elcinema.com/uploads/_315x420_c7f9e847e3efc9f1459694b7c92a1343c985e4513f7a84719617cf52dc4ca2a2.jpg', 'Mahmoud Abdelghaffar', 'Egypt', '20 January 1961', 'Mahmoud Abdel Ghaffar has worked on a number of feature films and television shows. Of his most memorable roles are Gowany in \"Rasha Gari\'a\" (A Brave Act), Lulu Elu El Nahes in \"Belia we Demagha Aliya,\" and Salah Jaheen in the show \"El Andleeb\" (The Nightingale).'),
('1049257', 'https://media.elcinema.com/uploads/_315x420_100ef5fdfdc94c44b1ac4f094cf3e035dbb17a10814637b61bce08bb67849539.jpg', 'Amr Arafa', 'Egypt', ' 9 December 1962', 'An Egyptian cinema director, he is also the younger brother of famous director Sherif Arafa, and the son of director Saad Arafa. In a short period of time Amr Arafa was able to set foot in the cinema field and succeed throughout the competition. He worked with big names in the cinema and acting field such as actors Adel Imam and Ahmed Ezz.'),
('1049310', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'رأفت حمدي', 'Egypt', NULL, NULL),
('1049333', 'https://media.elcinema.com/uploads/_315x420_27416f4eb01955daddebbf8fc455e71b5ed5fffe71fcc4ac8795c0023067285b.jpg', 'Zaki Fateen Abdel Wahab', 'Egypt', '15 December 1955', 'Zaky is the son of singer Laila Mouraad and director Fateen Abdul Wahhaab. In 1983, he graduated from the High Institute of Cinema. Zaki worked as second unit and assistant director with ‘Aly Badrakhaan and with Youssef Chahine in “Adieu Bonaparte i.e. Farwell Bonaparte” and “Al-yowm al-saades i.e. The sixth day”. Zaki also was the location manager of American films and miniseries shot in Egypt like “Fortunes of war”, “Mysteries of Egypt” and “The mummy returns”. His only film as director is “Romantica (1996)”.'),
('1049412', 'https://media.elcinema.com/uploads/_315x420_c3ee6a2bf02337d08c874f871d5848d1be8f14ed824d0734f5ae7449f016915b.jpg', 'Falak Nour', 'Egypt', ' 7 September 1963', NULL),
('1049455', 'https://media.elcinema.com/uploads/_315x420_7ef59c541138074a160d71325012feaeb6dcdfe8838a9dddac962c78e8603271.jpg', 'Sherifa Maher', 'Egypt', '30 September 1932', 'Egyptian actress Sherifa Mahear was born in 1932 in the Cairo neighborhood, Helwan. She graduated from a French high school and was discovered by the prominent Egyptian singer and musician Mohamed Abdel Wahab, who signed her on for a three year contract. She went on to work in cinema, appearing as both a singer and an actress. Mahear is best known for playing an an aristocratic woman and for her roles in the films: “Irham Dmoo’y” (Pity my Tears), “Karamet Zawgaty” (My Wife’s Dignity), Aaz El Habayeb\" (Dearest Beloveds), and “El Masir” (Destiny).'),
('1049617', 'https://media.elcinema.com/uploads/_315x420_382e5aed8b515d01bc8d2f764e50b0657f788382e9006d572ea5be6231f2d1d1.jpg', 'Mahmoud El Gendy', 'Egypt', '24 February 1945', 'Mahmoud Hussein El Guindi was born in (the town of Abou Al Mattamir), Al Beheira governorate. (He has nine siblings).\n(Mahmoud was enrolled in a vocational school where he trained as a (tailor)). After graduating, he worked at a factory. \nThereafter, Mahmoud was admitted to the (Institute of Cinema) and graduated in 1967. Following his graduation he worked in cinematic, television and theatrical productions. Among the plays in which he has performed are “Antarah”, “Mawloud Al Malik Maarouf”, “Shakespeare fee Al Ataba”, “Alashan Khatir Eyounik”, “Al Maleem bi Arbaa”, “Bahebak ya Mojrim”, “Al Brenseesa”, “Innaha Haqan Aaila Mohtarama”, “Al Rouaab Al Laziz”.\nFollowing an accident that took the life of his lover, Mahmoud directed the film “Al Morshid” in 2003. Abla Kamel starred in that picture.\nMahmoud has succeeded in bringing together music and comedy in his film.\n(His performance was not particularly outstanding in the movies (that were financed by the real-estate boom)), however, his talents are obvious in his performances in “Qalb Al Layl” and “Shahateen Nobala”.'),
('1049773', 'https://media.elcinema.com/uploads/_315x420_1d339ca037c270b473e2dd7a4a963a824fb921190e13b5b65912df21e196b75c.jpg', 'Salah Abdullah', 'Egypt', '25 January 1955', 'Salah was born in Cairo and he has studied at the (Institute for Theatrical Arts). \nHis acting career began with his performance in the series “Sunbol Baad Million” and thereafter he has performed exceptionally in several series which include “Ziab Al Jabal” and “Abou Al Alla 90”.\nHe has also performed in several theatrical works which include “Howda Karama”, “Feema yabdoo Saraqoo Abdah”, “Imsik Hakooma”, “Al Askary Al Akhdar”, “Al Barachot” and “Abou Zeid”.\nHe has received several awards for his (performance) in the film “Muwattin wa Mukhbir wa Haramy”.'),
('1050215', 'https://media.elcinema.com/uploads/_315x420_59c65522d3ea332c0d7ddb9ac66ae5286bfb58a560b4f0e1bca845ae4dc4fabe.jpg', 'Khaled Youssef', 'Egypt', '28 September 1964', 'Khaled Youssef is an Egyptian director. His father was a mayor. \nKhaled studied in the electrical engineering division of the faculty of engineering at Banha University. He graduated in 1990.\nWhile a student at university he held the post of Student Union president, he also directed a play titled (Al Moharej). The screenplay for that production was authored by the deceased Syrian writer Mohamed Al Maouz and was performed at the Taliaa theater as part of a university students production.\nKhaled Youssef had the opportunity to get to know the departed director Youssef Chahine while a student through his film screenings and also through the seminars he held at the university. Khaled Youssef also performed in Chahine’s 1991 documentary film “Al Qahira Menawara bi Ahlaha”. Moreover, Khaled contributed to the screenplays of “Al Mohajer”, “Al Maseer” and “Al Akhir” and also worked as an assistant director on the set of “Eskandiria New York”. Thus, Khaled Youssef had a long history of partnership with Youssif Chahine.\nIn 2001, Khaled Youssef began directing his first cinematic production which was titled “Al Asifa” and starred Yousra, Hanan Tourk, Hani Salama and Mohamed Nagaty. The film was a big success. Later in 2003 he directed the film “Gawaz bi Qarar Jamhoury” that starred Hanan Tourk and Hani Ramzy, this was followed by “Anta Oumry” which featured Nelly Kareem and Hany Salama.\nIn 2005, Khaled Youssif presented his fourth film titled “Ouija”. This film starred Shereef Mounir, Hani Salama, Mouna Shalby and Hend Sabry. In the following year he presented “Khiyana Mashroua” which starred Hani Salama, Sumayah Al Khashab and May Ezz Al Deen. In 2007 he presented “Heena Maysara” that starred Sumaya Al Khashab and Amr Saad. Later that same year, in a collaborative effort with his mentor Youssif Chahine, Khaled directed “Heya Fawda”. In 2008 Khaled directed “Al Rayyis Omar Harb”, this was followed in 2009 by “Dukkan Shahata” that starred Hayfa Wehbe and Amr Saad.'),
('1050524', 'https://media.elcinema.com/uploads/_315x420_c0943072340c8a186c698864661ce26b5c23b72eb8cc26b63615fdc2d8034714.jpg', 'Mohamed Abdel Razek', 'Egypt', NULL, NULL),
('1050673', 'https://media.elcinema.com/uploads/_315x420_2088af15e1827b9273c1a47f17c916eef71c24e019ad62beb550e49ecdd2d846.jpg', 'Maged Magdy', 'Egypt', NULL, NULL),
('1050844', 'https://media.elcinema.com/uploads/_315x420_02af0b6c60ae8b27abf33da64de6aac4c718b633285da3b3dd3e5d16157b95ab.jpg', 'Reda Idrees', 'Egypt', '26 January 1960', 'Reda Idryes is an Egyptian actor famous for his comic supporting roles. He participates with many actors where he always proves himself.'),
('1051054', 'https://media.elcinema.com/uploads/_315x420_f78af94fc4212c2fd0b24ed5f35bcdf104709fdf734de0717ca5e06d8abffb39.jpg', 'Samir Ghanem', 'Egypt', '15 January 1937', 'Samir Youssif Ghanem graduated from the faculty of agriculture in 1967. He became friends with George Seydhom and al-Deyf Ahmed and the three formed “Adwaa al-Masrah” (Theater Lights), which was a singing and acting troupe. Ghanem had outstanding stage performances in the productions “Tabeekh al-Malayka” (Angelic Cuisine), “Romeo wa Juliet,” among others. Ghanem also had an outstanding performance in “Fawazir Ramadan” – Ramadan Trivia Shows – where he assumed the character Fatouta. Among his most successful television performances was his role in “Hekayat Captain Mizo” (The Tales of Captain Mizo). Although having a career containing several flops and mediocre efforts, Ghanem is considered among the most talented, spontaneous and resourceful comedic actors in the middle east.'),
('1051086', 'https://media.elcinema.com/uploads/_315x420_e14bc382eb81c8334b3f69923435f1f56e1ee349933add94d29ca91efed10bfb.jpg', 'Safie Eddeen Mahmoud', 'Egypt', ' 1 June 1969', NULL),
('1051106', 'https://media.elcinema.com/uploads/_315x420_830e9410c0d93d74800b2d15f804f3b4e4eff0c98f7b5fb3ee0c245a659b7192.jpg', 'Zainab Aziz', 'Egypt', NULL, NULL),
('1051294', 'https://media.elcinema.com/uploads/_315x420_8b8433f4bd219ff35e5b035e7f8f0d6b517d5ad00c3e8bd5af519d86d92423c3.jpg', 'Mai Ezz El-Din', 'Egypt', '19 January 1980', 'Mai Ezz Eldin was born in Abu Dhabi, Emirates. She studied sociology in the Faculty of Arts in Alexandria. She was granted her first role as an actress when director Monir Rady referred her to director Mohamed El Naggar to star in his hit film “Rehlet Hob” (Love Trip) opposite famous singer Mohamed Fouad. She then rose to fame and starred in TVG series like “Ayna Qalby” (Where\'s my Heart). Her biggest success was in the romance “Omar & Salma” where she starred opposite pop star Tamer Hosny, and they formed a duo that continued in two other sequels to the first film. She was engaged for a short period to footballer Mohamed Zidan in 2009.'),
('1051379', 'https://media.elcinema.com/uploads/_315x420_1474137376dd1cdc02faee758dc85407bec60316428f536c0a6311ab5cefa494.jpg', 'Adel Al Far', 'Egypt', '20 December 1961', NULL),
('1051556', 'https://media.elcinema.com/uploads/_315x420_c7bf121dbeb822d55085799f65260b47404ce293ecf705490cdbed28851a3882.jpg', 'عبدالعزيز عمارة', 'Egypt', NULL, NULL),
('1051908', 'https://media.elcinema.com/uploads/_315x420_5f75c4189f0f389c7058c9913631af11a181ac1285c152a429ade979819a9cc5.jpg', 'Ghassan Massoud', 'Syria', '20 September 1958', NULL),
('1051973', 'https://media.elcinema.com/uploads/_315x420_98f4848eeacce0f3f070c414eb0e42ff6256ed704bd277b1c19e4be683c4c8c6.jpg', 'Farida Saif Al-Nasr', 'Egypt', '10 September 1959', 'Farida Said Al-Nasr is an Egyptian actress who was born in the Agouza area of Cairo. She began her acting career when she was discovered by director Hossam Al-Din Mostafa and artist George Sidhom, who included her in the “Tholathy Adwa’a El Masrah” (The Theatre Lights Trio). Her most famous cinematic performances include “Min Fina Al-Haramy” (Who Among Us Is The Thief), “Badia Masabni,\" “Abnaa’ Al-Samt” (Children of Silence), and “Deil al-Samaka” (Fish Tail). Some of her most famous television performances include “Bedoun Zikr Asma’” (Anonymously), “Hamam Shaykh al-Arab,\" “Afareet Al-Seyalla” (The Demons of Al-Seyalla), and “Al-Rehaya.\"'),
('1051991', 'https://media.elcinema.com/uploads/_315x420_49de9cb43d924be0118a1ddc3cc6cc268d0ee9f8fecf31e058a99ad46b717a1d.jpg', 'Nermin El Feky', 'Egypt', '21 June 1972', 'Nermeen Abdul Raazek al-Fiky, born in Alexandria, graduated from Victoria College and studied Commerce. In early nineties, Talaat Youhanna helped her to enter the TV advertisement field. Few months later, Nermeen started acting and played stage roles like “Dastour ya asyadna” and “Ana we meraaty we Monica i.e. Me, my wife and Monica”. Excelled in TV series like “Rodd Kalby i.e. My heart is back”, “Al-leil wa akhro i.e. Till the end of night”, “Lan tasrek omry i.e. You won’t steal my life” and “Al-ketaar al-akheer i.e. The last train”.'),
('1052273', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed Nasr', 'Egypt', NULL, NULL),
('1052289', 'https://media.elcinema.com/uploads/_315x420_51a0244ebe60c58ff90876e62378c0aa8c6b54ca29279f46011719b851f9f33e.jpg', 'Nadia Fahmy', 'Egypt', ' 6 January 1950', NULL),
('1052449', 'https://media.elcinema.com/uploads/_315x420_2565197472acdfd85dd98320f68e75ca4ed06d01eb709b384983c0b40a7a63dc.jpg', 'Mohamed Younis', 'Egypt', NULL, NULL),
('1052458', 'https://media.elcinema.com/uploads/_315x420_dfe1b9a77551eb60879f1b32caf41d092bb6d659f8e4b9095490338d77ca8639.jpg', 'Ahmed Essa', 'Egypt', '20 January 1979', NULL),
('1052483', 'https://media.elcinema.com/uploads/_315x420_40e55d5ae196d081f419a77c2619c5ead60c3e1315ccc8f2b7708dfa215ff12f.jpg', 'Ahmed Falawkas', 'Egypt', '22 June 1981', 'Ahmed Farouq Falawkas is a rising actor, his father is renowned actor Farouq Falawkas. Ahmed’s mother is a Turkish citizen and his wife, Rabia, is Moroccan but holds Spanish citizenship who works as a fashion model. The couple have one son, Seif Al Deen, who is between 2 to 3 years old. Ahmed graduated from the broadcasting faculty at Cairo University and his distinguished acting career is ongoing.'),
('1052496', 'https://media.elcinema.com/uploads/_315x420_d692763979c170472d5b0f77d6fffc40a594b9c9aa754118f102350a19532e88.jpg', 'Abir Sabri', 'Egypt', '14 March 1971', 'Abir Sabri is an Egyptian actress. She was born in 1971 in Cairo, and studied law at Ain Shams University. She started her artistic career as a show host, until she was picked up by director Ali Abdel Khaliq for a role in “Al Nagun min Alnar” (Those Who Were Saved from The Fire) with Amr Abdel Gelil and Tareq Lotfy in 1994. Her second collaboration with the same director came in the film “Atabet El Settat” (Women\'s Doorstep) alongside Nabila Ebeid and Farouq Al Fishawy. She worked afterwards in numerous films, before taking a temporary hiatus after wearing the Islamic veil. While wearing the veil she worked as a host on religious shows, but then returned to acting in 2010 to appear in films like “Ahasis” (Feelings), “Nour Einy” (Light of My Eyes) and “Asafir El Nil” (Birds of the Nile).'),
('1052521', 'https://media.elcinema.com/uploads/_315x420_17aa06c45eb230137b148446486b070b6bf8d5e1780968b360418ed8a5504b78.jpg', 'أحمد سليمان', 'Egypt', NULL, NULL),
('1052554', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohammed Al-Essawi', 'Egypt', NULL, NULL),
('1052809', 'https://media.elcinema.com/uploads/_315x420_e2460464bd8ea6804fb07f6212ab8bd49debdb2f8a26c38c8cd3a08898a74aac.jpg', 'Studio Masr', 'Egypt', ' 7 March 1935', NULL),
('1053043', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Nabil Shoeib', 'Egypt', NULL, NULL),
('1053072', 'https://media.elcinema.com/uploads/_315x420_152d093b1ccdeeb326adc759763ec4b4997cf7ba0eef3cec1a83f5315966aac9.jpg', 'Khaled Talaat', 'Egypt', NULL, NULL),
('1053422', 'https://media.elcinema.com/uploads/_315x420_9ffdd3271b3eed62832aa80cfc947fedddc5344750d6c9aedbe492f44bf021ab.jpg', 'Zizi El Badrawi', 'Egypt', ' 9 June 1944', 'Zizi El Badrawi was born in 1944. Born as Fadwa Gamil Al Bitar, she was renamed by director Hassan Al Imam. She started her acting career with director Ezz El Din Zolfakar in a small role in “Port Said” before Hassan Al Imam chose her for “Aawatef,” changed her anem and cated her in multiple roles afterwards. El Badrawi got married twice, the first time was from director Adel Sadeq in 1966 whom she\'s met during the making of “Hobi Fel Kahera” (my Love in Cairo). She got a divorce  soon after and by the beginning of the seventies she got married to Tawfiq Abdel Guelil, a lawyer that she loved very much as she said to the press. El Badrawi kept a distance with drama and acting during her second marriage. Divorced in 1988, she participaed in many drama series and plays. She died on the 31st of January, 2014.'),
('1053428', 'https://media.elcinema.com/uploads/_315x420_bedabcec7eb6ac17628d3ed64898fbcdde1fd8a3c94386b8971cda41c584e65d.jpg', 'Hesen Abo Hagag', 'Egypt', ' 2 December 1954', NULL),
