('1053966', 'https://media.elcinema.com/uploads/_315x420_5c5048e8db3fed573ba62ffa5518b5199699fa1b34f344692863aab335ca036a.jpg', 'Sharif Eddris', 'Egypt', NULL, NULL),
('1054096', 'https://media.elcinema.com/uploads/_315x420_fda8682730114b982801abca78f20d4fe621ef54594429e9d50c7c153497717d.jpg', 'Muhammad Al Saqqa', 'Egypt', NULL, NULL),
('1054429', 'https://media.elcinema.com/uploads/_315x420_8fb9b6eed100e601b92fd0e4f010372981b6eab7bd463678e0fd90daed91aebb.jpg', 'Ahmed Mokhtar', 'Egypt', '18 April 1958', NULL),
('1054530', 'https://media.elcinema.com/uploads/_315x420_f330b829d8d84ba8753268adf693657f900d5311e3c3d65800dd510ba084e5ce.jpg', 'Laila Fawzy', 'Egypt', '20 October 1918', 'Laila Fawzy was an Egyptian actress. She was born in 1918 to a Syrian father and a Turkish mother. Her debut role was in the 1941 film “Masnaa Alzawgat” (Wife Factory). She then went on to star in numerous roles between film and television, until the beginning of the 21st century, the  she retired a few years before her death. Among her most notable roles were those in “Alnaser Salah Eldin” (The Victorious Salah Eldin), “Safir Gohanam” (Hell\'s Ambassador), and “Hawanem Garden City” (The Ladies of Garden City).'),
('1054644', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'رمضان عامر', 'Egypt', NULL, NULL),
('1054832', 'https://media.elcinema.com/uploads/_315x420_6eb610c43bfd70352af56f8b5ecb7ac917607c1e9a8695f3fcfacff029e06588.jpg', 'Tarek Abd El-Galil', 'Egypt', NULL, NULL),
('1054917', 'https://media.elcinema.com/uploads/_315x420_de59f31ea5b2bbae13e8be484bd493360efdec57086b851a17427025ed957b22.jpg', 'Ahmad Refaat', 'Egypt', '19 March 1979', NULL),
('1054961', 'https://media.elcinema.com/uploads/_315x420_5ca6da799263889ab8781cb36c2e2bd00cdd2f5669d1eea5475340e2a5c86425.jpg', 'Amr Ismail', 'Egypt', '11 April 1971', NULL),
('1055349', 'https://media.elcinema.com/uploads/_315x420_c504dc8768e226bc49ba86a7d06f0e7670fb20517aeea61e096dc17583f002b3.jpg', 'Hassan Abu Jabal', 'Egypt', '10 October 1976', NULL),
('1055396', 'https://media.elcinema.com/uploads/_315x420_c92e1505cc7c04a9f95db536b2a445011bc01b8b5fac77f7e0b7f9f2b7720aae.jpg', 'Atef El Mahdy', 'Egypt', NULL, NULL),
('1055941', 'https://media.elcinema.com/uploads/_315x420_263df1e89978a6f7ae924ff056c08c4fa525d2d16e1c9810016f4ad238493dff.jpg', 'Tarek Abdelaziz', 'Egypt', ' 4 August 1968', 'Tarek Abdelaziz is an Egyptian actor. He was born on August 4, 1968. He\'s appeared in many films made by graduates of the High Cinema Institute. He began acting in university stage productions in 1986. He acted in a few theater troupes, including one called Haraka and another called Al Wersha with Hassan Al Gareetly. Abdelaziz graduated from law school in 1991.'),
('1055957', 'https://media.elcinema.com/uploads/_315x420_eed1ccdc32f10801b85a9c8a9d6f54a30b1aefa6a408820447aa90b963c7c51e.jpg', 'Mais Hamdan', 'Jordan', '31 October 1982', 'Mais is an actress and a singer. Her father is Lebanese while her mother is a Palestinian-Jordanian. She is the sister of musician May Selim.\nMais was born in Dubai. She has performed in several films such as “’Umar wa Salma”, “Keif al-Hal” (“How’s it Going?”) and “Zarf Tareq” (“Urgent Circumstances”). Mais began her career in the satirical show CBM which saw her acting alongside several well known performers.\nMais is skilled at imitation and she has imitated many famous Arab figures. Her talents were discovered by Ahmed Sobhy who at the time was the Director of Public Affairs at the MBC Group. Thereafter, her career took off.'),
('1055985', 'https://media.elcinema.com/uploads/_315x420_3d3b9419aa1b4f143078168e748f994cbd0bcd1fca02f910589cdf9ecd78ba55.jpg', 'Tamim Abdou', 'Tunisia', ' 1 April 1958', 'Tamim Abdou is a Tunisian film, stage and television actor. His relationship to acting began with stage productions in his hometown of Siliana, Tunisia, and despite beginning law school in Tunisia, he decided to travel to Iraq to work as a translator, after which he went to Egypt, where he joined the Institute of Theater Actors to train in acting and directing. He also joined Youssef Chahine\'s production company, where he\'s worked for 22 years. Over time he rose to production manager there, overseeing foreign films shot in Egypt. Abdou also worked in advertising. His close friendship with Yousry Nasrallah also ended up having great professional benefits, as Nasrallah cast him in several of his most famous films. Abdou has also appeared in shows like \"Ahl Cairo\" from director Mohamed Ali, in which he co-starred with Khaled El Sawy.'),
('1056153', 'https://media.elcinema.com/uploads/_315x420_7cfaf0784641d3c87290a65674fd4d3455e537d096f6a3e524d7ff8c8c2b3769.jpg', 'Nicole Saba', 'Lebanon', '26 June 1974', 'Nicole Saba is a Lebanese actress and musician. She began her artistic career through a music band called “Four Cats.” Adel Imam realized her talents and assigned her a leading role in one of his films.'),
('1056194', 'https://media.elcinema.com/uploads/_315x420_f7efca7e59a442e6e574364e6c7054efaca6e3dca7e307298e4d3d47ce65df63.jpg', 'Menna Arafa', 'Egypt', ' 1 May 1999', 'Mennat-Allah A’rafeh had her debut in the television series “Cinderella” where she acted alongside Mona Zaky and the rising star Mohamed Ramadan. Menna portrayed a juvenile So’aad Housny in that title. Menna’s second work was a film titled “Mattab Sina’ee” (“Industrial-Age Speed Bump”) where she acted alongside comedy star Ahmed Helmy. Menna has also performed alongside Hamadeh Hilal in “Al Houb Kidda” (“Such is Love”) and  beside Hassan Housny and Madeleine Mattar in “Akhir Kalam” (“Final Word”) . Besides her cinema works Menna has also taken part in a few TV commercials. Moroever, Menna is also partaking in the well known TV sitcom “Raggil wa Sitt Sittat” (“A Man and Six Women”), a work which sees her performing alongside Ashraf A’bd Al Baqee, Liqaa Al Khamissy, Sameh Hussein, Intissab and In’aam Al Garitly.'),
('1056283', 'https://media.elcinema.com/uploads/_315x420_2645b85c2e6b07e2324b89328cb52ed70cd054b69215b7a0abb14a53b13ecb18.jpg', 'Ghada Ibrahim', 'Egypt', ' 1 November 1972', NULL),
('1056389', 'https://media.elcinema.com/uploads/_315x420_1b1edac0eb34d271998ed3c9c0b0e136f92c8166cc02becf035375f35428c0ec.jpg', 'Dolly Shahin', 'Lebanon', ' 2 July 1980', 'Dolly Chahine was born in Lebanon to a Lebanese father and a Brazilian mother. The young musician was the source of much clamor from her very beginnings and had her cinema debut in Cairo where she assumed a variety of roles in the company of a host of distinguished actors.'),
('1056421', 'https://media.elcinema.com/uploads/_315x420_d4b2240869fabcc983d3d641f97cffbf0d50a16a69e4eb17e7b54f2f2d40b7cd.jpg', 'Wael Ehsan', 'Egypt', '13 May 1963', 'Wael Ihsan is an Egyptian director. He graduated at the faculty of commerce in 1986, then studied film production at the High Cinema Institute of Cairo until 1991. His breakthrough came at the early 2000s, with his debut “El Lemby”, which was one of the most successful films in Egyptian cinema history. He followed El Lemby with “Elly Baly Balak”, a sequel that was as successful as the first film. Ihsan then went on to make A-list star-led blockbuster comedies, like “Zaki Chan”, “Amir El Behar” (Prince of the Seas), “Bobbos” and “Nour Einy” (Light of My Eyes).'),
('1056488', 'https://media.elcinema.com/uploads/_315x420_15a60dd07332a0733f5aea7fef5ac1ce7c2e6eb9dfb99ce24a859597f4cc091a.jpg', 'Ahmed Hatem', 'Egypt', '25 December 1987', 'Ahmed Hatem is an Egyptian actor who was born in Dokki, Egypt. He studied Media and Sciences before joining the acting workshop of Mohamed Abdel Hadi, who recommended him for his debut role in Awqat Faragh that won wide audience and critical acclaim. Hatem\'s repertoire includes several blockbuster films such as: the two installments of El Kenz (The Treasure), El Haram El Rabe\'a (The Fourth Pyramid), Qeset Hob (Love Story), and El Ghassala (The Washing Machine). In addition, he starred in a plethora of TV hits, including: Vertigo, Ibn Halal (A Good Guy), Fo\'k Mostawa Elshobohat (Above Suspicion), Hekayty (My Story), and Haret El Yahoud (The Jewish Quarter).'),
('1056530', 'https://media.elcinema.com/uploads/_315x420_1f1a9c28348ded79b64ce1bac9b1d1594adbc58a5afdfa7c202b108593dab5f9.jpg', 'Ahmed Nader Galal', 'Egypt', NULL, 'Ahmed Nader Galal is the son of renowned director Nader Galal and grandson of one of Egyptian cinema’s pioneers, Ahmed Galal.'),
('1056531', 'https://media.elcinema.com/uploads/_315x420_8697aaebb014eab1529641288fa767daf6932915ddb14f513d158e414a6c2743.jpg', 'Ahmed Rizk', 'Egypt', '23 March 1976', 'Ahmed Rizk is an Egyptian actor who was born in Alexandria. He is characterized by a heavy stature and a good sense of humor. Rizk moved to Cairo and began his performing career with a film titled “Sitt al-Sittat” in 1998. Thereafter he worked on several films, “Film Thaqafy” (“Educational Film”) was particularly helpful for his career. Rizk also starred in “Sharm Baram”, “Shabab ‘ala al-Hawa” (“Youths on the Air”) and “Mafia” where he acted alongside Ahmed al-Sekka. Following those efforts he acted in “Ew’aa Weshak” (“Watch Out”). His most recent title was the film “Hawishy elly Waqa’ Mennik”(“Pocket what You Lose”) where he starred with ‘Ola Ghanem. Rizk has also taken part in several television productions including “Gohha al-Masry” (“The Egyptian Gohha”), “Awraq Massriyah” (“Egyptian Papers”), “Sara” and the sitcom “Foush”.'),
('1056613', 'https://media.elcinema.com/uploads/_315x420_394fc562f16aa9f1a6b98676ed5af08ae1aeb18d6dcb3d2b65ec2dc04c2cf295.jpg', 'Lotfy Labib', 'Egypt', '18 August 1947', 'Lotfy Labib, born on August 18, 1947, is an Egyptian stage, television and film actor. He also worked as announcer at one point. Despite having graduated from the Institute of Theatrical Arts in 1970, Labib\'s career was delayed for a whole decade. First he was drafted in the army for six years, and then traveled outside Egypt for four years. His career truly started in 1981, when he acted in the play \"The Bald Singer,\" which he followed with another stage production \"The Hostages.\" Labib has since then worked profusely, in many supporting but memorable roles, with over 200 film and television credits. Though many of his screen appearances have been brief, Labib has performed admirably and has shown himself to be one of the strongest performers of his generation.'),
('1056639', 'https://media.elcinema.com/uploads/_315x420_cad527a38515d2fc96c4d39d22158bf7e1070210763baa3e26afce62a5192c98.jpg', 'Sayed Ragab', 'Egypt', '16 November 1950', 'Sayed is an Egyptian actor. His debut came in the cinematic production “Ahlam Saghira” (“Minor Dreams”). Thereafter Sayed appeared in a variety of minor roles.'),
('1056647', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'منى جمال', 'Egypt', NULL, NULL),
('1057161', 'https://media.elcinema.com/uploads/_315x420_510724ebaa01acf9a47059a1b33360e771e8c178bc1d9361ced493ef5770ad45.jpg', 'Naeim Issa', 'Egypt', ' 6 January 1937', NULL),
('1057293', 'https://media.elcinema.com/uploads/_315x420_f7b8c7de548ea0749db3b9240d976d854896460bd1421a69b534a8cc85dec785.jpg', 'Entsar', 'Egypt', ' 8 January 1971', 'Originally an economics major, Entesar began her career as an actress completely by chance.  She starred in a few college plays and her friends encouraged her to try out for the movie \"Apple\" which she later landed a role in.  She was discovered by Ra\'fat Elmeehy, and would star in many TV shows including \"The Stake\" \"The Earthquake and its After Shocks\" and \"Adventures of a Modern Husband.\"'),
('1057345', 'https://media.elcinema.com/uploads/_315x420_d8465f9b0aa237662d2eb1cea3587226453984c4bb5351710790483e81f8352f.jpg', 'Mona Youssef', 'Egypt', NULL, NULL),
('1057658', 'https://media.elcinema.com/uploads/_315x420_e87dc2fda366bc3993b06584afc3575f21e7bf1c88e9c9a35e78b7cfec9480cf.jpg', 'El-Sobky Film Productions', 'Egypt', NULL, NULL),
('1057698', 'https://media.elcinema.com/uploads/_315x420_494ec1b6cfea0485886b1807f3dd77d1eb5ffb5e80f53b82315df07aaf0c46b1.jpg', 'Ali Idris', 'Egypt', '14 November 1963', 'Aly Idris started his career upon his graduation from the High Institute of Cinema in 1988, and working as an assistant director starting with the movie  “Youth On The Edge”  in The Edge”  in 1990. Following this movie were many more hits. He worked as an assistant director for 23 movies as well as some very famous television series such as  “The Miser and I”. \nAfter that he moved on to work with big directors such as Sherif Arafa and Aly Abdel Khalek and more. His first exclusive direction was “Friends or Business” starring Mostafa Kamar and Hani Salama then following that were many more including the “Danish Experience” that received an award for direction. \nAly Idris is married to author and script writer Zeinab Aziz working together in more than one movie.'),
('1057836', 'https://media.elcinema.com/uploads/_315x420_0f3b86ce905103793be631ee3fe5753c1280f8f8cb6ab335f40b35ed8f64a923.jpg', 'Nader Hassan', 'Egypt', '23 March 1978', NULL),
('1057910', 'https://media.elcinema.com/uploads/_315x420_39e39158afcf193b7db51b43c31a6eb0bed2863fe39b71dc22c0d22d95f8fe16.jpg', 'Ali Abdulmonem', 'Egypt', NULL, NULL),
('1058209', 'https://media.elcinema.com/uploads/_315x420_ce319136da707cc27adcd38e478bfdf417685f5ba33d25fe768aad3314b1974c.jpg', 'Ali Hassanein', 'Egypt', '13 January 1939', NULL),
('1058236', 'https://media.elcinema.com/uploads/_315x420_d9015b5845c2cd32f413317669fc4b3e4475e05e9f2fb5c47910c1b7c7fa981e.jpg', 'New Century Art Production', 'Egypt', NULL, 'In 2004 Dollar Film Company opened its new production branch “New Century” to produce high quality Egyptian movies. Where it started with the movie “The 7th Sense” written by actor Ahmed Mekky for the first time, before achieving his current success as an actor, it was also the first movie for actor Ahmed El Fishawy.\nThe company also introduced script writer Mohamed Diab, and director Mohamed Gomaa for the first time in the movie “Real Dreams” in 2007.'),
('1058442', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Bondok', 'Egypt', NULL, NULL),
('1058484', 'https://media.elcinema.com/uploads/_315x420_be56952c43f3b0b3822369550bc500cc50418143e9583e9fb7c4bcbd90203ed8.jpg', 'Muhammad Sabri', 'Egypt', NULL, NULL),
('1058666', 'https://media.elcinema.com/uploads/_315x420_9ac87f7abc789abc5c3648008d5056c0d98433590e08c2b346b2dbe13a7fd343.jpg', 'Nohir Amin', 'Egypt', ' 5 March 1945', NULL),
('1058849', 'https://media.elcinema.com/uploads/_315x420_09f529d8e9cbbdc2b837dbbb7651d2ce27fd2ea44bb0e326c9c1e1f7a62d5601.jpg', 'Raouf Moustafa', 'Egypt', ' 1 October 1940', NULL),
('1058870', 'https://media.elcinema.com/uploads/_315x420_9d327fcf9c826f9d271db8560e90aba1d2d73fa5e26d6e283370587ca5ed1ca2.jpg', 'Ashraf Saleh', 'Egypt', NULL, NULL),
('1059122', 'https://media.elcinema.com/uploads/_315x420_986ea5e51d191aaf3f19a78a61ed97915c127746e57726abe7c29e3c89acdc8e.jpg', 'Moustafa Haridy', 'Egypt', ' 8 December 1975', NULL),
('1059208', 'https://media.elcinema.com/uploads/_315x420_8f9533a77a7196f9a770a6fdebf46d409149ce87f4d63d1638ff75fcaf82d844.jpg', 'Ehsan Abd El Kodos', 'Egypt', ' 1 January 1919', 'Ihsan Abdel Quddous was an Egyptian writer. He studied at the faulty of Al-Azhar, and also studied law. His literary career spans nearly 50 years and 600 novels, and is known to have written 49 novels that have been adapted to films, including \"La Anam\" (I Don\'t Sleep), \"La Tasa\'alny Man Ana\" (Don\'t Ask Me Who Am I) and \"Ana Horra\" (I\'m Free). As a journalist, he was involved in political activism, and was sentenced to prison several times as a result of criticizing the regime. He died in 1990.'),
('1059331', 'https://media.elcinema.com/uploads/_315x420_82c6a55caf163f32c9b2cf596d1b1f30f1667f628f7004c442ed2e6f01e4a430.jpg', 'Mohamed El Hadidi', 'Egypt', NULL, NULL),
('1059338', 'https://media.elcinema.com/uploads/_315x420_564f1bbbb778ce519e96e93a43bddc3910e306efebb509b38b783a61fbb6d91b.jpg', 'Ahmed Samir', 'Egypt', '28 September 1974', NULL),
('1059342', 'https://media.elcinema.com/uploads/_315x420_b2dc9bb2d1d324fb245d3d46d974b2f6a6b1274905dd1c5e66ea8149f322cb60.jpg', 'Mahmoud Masoud', 'Egypt', ' 3 September 1952', 'Mahmoud Masoud, born in 1952, is an Egyptian actor who received his Bachelor’s degree from the Higher Institute of Dramatic Arts in 1975. After graduating, Masoud worked at the Vanguard Theater, then starred in a number of films, among them “Maganeeno,\" “Al-Motamarid” (The Rebel), “Al-Sharisa” (The Fierce), and “Hikaya To” (The Story of To). Afterwards, he had roles in several television serials, including “Al-Liqa’ Al-Thani” (The Second Meeting), “Mughamarat Zakia Hanem” (The Adventures of Zakia Hanem), “Gomhorreya Zefta” (The Republic of Zefta), and “October Al-Akher” (The Other October).'),
('1059476', 'https://media.elcinema.com/uploads/_315x420_c6d9bdfa63449180c626068fc36eaae38e11bf1c65ecd6ef5a2ea9dd4b95269a.jpg', 'Nabil El-Hegrassy', 'Egypt', '31 January 1937', 'The famous actor Nabil Ahmed El Hagrasy was born in Alexandria. He was married to actress Isaad Younis when she was still an anchor after a while they got divorced.\nNabil Ahmed has presented many plays including \"Asl Wa Soura- Origin and Copy\", \"Ana We Meraty We Gozha- Me, My wife and her husband\" in addition to \"Alsalouka\", \"Al Tartour\" and \"Makaleb Makhrous- Mahrous Tricks\".\nHe also starred in \"Alaab Al Masry- The Egyptian dad\". He was always known for his comic humor and playing the role of the hero\'s friend. He proved himself on stage more than cinema.'),
('1059493', 'https://media.elcinema.com/uploads/_315x420_8ab1f8b850072aad4b2021c2568d9233c39fac39968abdc9952bc8d3f41c10b2.jpg', 'Mirna Al Mohandes', 'Egypt', ' 3 May 1976', 'An actor who personalized the sweet naughty girl in TV series “Banaat Afkaary i.e. My brainchildren”, “Ta’aala nehlam be bokra i.e. Let’s dream for tomorrow” and “Nagmat al-gamaheer i.e. The superstar”.\nCharacterized by simplicity, Mirna returned after being retired for health reasons.'),
('1059705', 'https://media.elcinema.com/uploads/_315x420_3e0cccc490706d7307d9382f638781602ef740962add15509a85d10cb7bfb93f.jpg', 'Essam Al Shammaa', 'Egypt', '29 November 1955', NULL),
('1059728', 'https://media.elcinema.com/uploads/_315x420_6926d7dadd7bec7453cfaaccc7b659551d83ca903f202b96972ba9d3f98d1801.jpg', 'Ayman Abu Makarem', 'Egypt', '18 December 1964', NULL),
('1059843', 'https://media.elcinema.com/uploads/_315x420_2eddee11e01cc22848ab4f963daeecfbc4278510931d485993db0ae0f1ca3579.jpg', 'Reda Hamed', 'Egypt', '29 August 1954', NULL),
('1059892', 'https://media.elcinema.com/uploads/_315x420_87ab46b166f0a127c055ace20649dff4b67d69c35bdb2d74d2c979f1cc85735c.jpg', 'Hamid El Shaeri', 'Egypt', '29 November 1960', 'Famour singer, composer, mixer, producer since 1982. His father is Libyan and his mother is Egyptian. He has made the musical arrangements for many other singers of his generation including Simone, Ali Hemayda, Hisham Abbas, Faris, Hanan, Mona Abdel Ghany, Amr Diab, etc.  He also tried his hand in acting such as in the film “Hazelnut Shells.”'),
('1059896', 'https://media.elcinema.com/uploads/_315x420_c871c4c4e7ac4b9a4f6dbdb693ef9e2f8da7641d4c6e0f0efda2cb8c16d9ab42.jpg', 'Youssef Fawzy', 'Egypt', '16 July 1945', 'Youssef usually protrays powerful and villainous characters in his performances. He has assumed several minor roles in productions but (the filmmaker) Nadia Al Guindy has assigned him greater roles in her pictures. \nYoussef also participated in several television series.'),
('1059990', 'https://media.elcinema.com/uploads/_315x420_974c5ef29d29c0b2f0f26f1f63db50847869d8897029ca73c25ce8c98a884ea9.jpg', 'Hady Al Bagouri', 'Egypt', NULL, 'Haady al-Baagoury in an Egyptian director born to an artistic family; his father Gameel is a producer and journalist, his brother Saameh is a scriptwriter and his maternal aunt is superstar Zizi al-Badraawy. Haady started his career as an executive producer, later on; he directed more than 300 hundred video clips and TV commercials.\nAl-Baagoury entered the field of TV drama, but a in different way, he has decided to use cinema techniques in terms of directing, filming, editing and casting. His series “Ard khaas i.e. Special offer”, is the first series in the Arab World to sustain cinema technicalities.'),
('1060134', 'https://media.elcinema.com/uploads/_315x420_7b01afb077bba3328428028bf64ac056b33559e68d66baed25b05b325b02b8d2.jpg', 'Majdi Abdulhaleem', 'Egypt', NULL, NULL),
('1060239', 'https://media.elcinema.com/uploads/_315x420_8bb893ef8cda98aa93007b783ee6a26c88e2413cd8c6b36775d5d3b5c6c2cc05.jpg', 'Mayar Al-Beblawy', 'Egypt', '24 December 1972', NULL),
('1060487', 'https://media.elcinema.com/uploads/_315x420_50471d73a20abe9b0904005eadd6530c99125e27af5fd4d46ab081204cd9e297.jpg', 'Nesreen Youssef', 'Egypt', '26 October 1979', NULL),
('1060742', 'https://media.elcinema.com/uploads/_315x420_943eae1f6194611d04446b004c4e2de04a388f9b5ae2c4484a95b5aeea50ff22.jpg', 'Hany Gerges Fawzy', 'Egypt', NULL, 'Hany is among the(most significant producers in Egypt). His father is the well-known producer Girgis Fawzy. His first experience as a producer was on the film “Bedoun Reqaba” which met with great success at the box office.\nHany’s films are bold with regards to their methods and content. When working on his first film, “Bedoun Reqaba”, Hany took the bold step of forbidding the promotion of the film on satellite television due to the fact that it included (controversial) scenes. Moreover, (regulating bodies) deleted several scenes from the film and classified it as suitable for adults only. Hany continued his career with the film “Ahasees”.\nOn art, Hany has said “Art has no relationship to mores, however, there are those who abuse this notion in order to present films that are void of meaning and purpose and are intended simply to generate revenue.”'),
('1060808', 'https://media.elcinema.com/uploads/_315x420_efbe5ed0016532b0b846b9b7cf0c53576580d9aaed46680585f9ac144ed98899.jpg', 'Ryad El Kholy', 'Egypt', '29 January 1953', 'Reyaad Ebraheem Metwally al-Kholy, graduated from the High Institute of Dramatic Arts in 1976. In 2001, Reyaad was appointed director of the Comedy Theatre. Among his notable TV series are; “Shaare’al-Mawardy i.e. Mawardy street”, “Nour al-kamar i.e. Moonlight”, “Al-‘aaela i.e. The family”, “Gesr al-khatar i.e. Bridge of danger”, “Al-faraar men al-hobb i.e. Escape from love”, “Ams la yamout i.e. Yesterday never dies”, “Al-Zeiny Barakaat”and “Om Kolthoum”. “Mama America” and “Al-naas elly fel-taalet i.e. People in third floor” are among his famous stage roles.'),
('1060952', 'https://media.elcinema.com/uploads/_315x420_b56d23fe7b89093e621f47c6de599ac426589692a6a80559e64f518ce4946657.jpg', 'Hanaa El Shorbagy', 'Egypt', '22 December 1946', NULL),
('1061102', 'https://media.elcinema.com/uploads/_315x420_3a718b69caff42aea8d7a638955f07f3e9eaff8ee628a82fa9e4b571005c22bf.jpg', 'Nashaat Abdel Latif', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1061156', 'https://media.elcinema.com/uploads/_315x420_5fe03ff6631ad22b23b5c8f3335b3e52f6c0c5172828453af8d196747d82ea9b.jpg', 'Hussien El Emam', 'Egypt', ' 8 February 1951', 'Hussein is an actor, a musician and a producer. He is the son of director Hassan el-Emam and has sung at several events. Hussein is married to the female artist Sahar Ramy. He holds a bachelor’s degree in fine arts and he has had a brilliant performance on the 2002 comedy show “Hussein ‘ala al-Hawaa” (“Hussein On the Air”) which was followed by “Hussein fee al-Studio” (“Hussein in the Studio”) in 2003.'),
('1061167', 'https://media.elcinema.com/uploads/_315x420_6dbf7d401b86ae2a54c054146b3b3c97c61b2f47d5c06624838917b3a5d8790e.jpg', 'Talaat Zein', 'Egypt', '14 February 1955', 'Although Tal’aat was born in Alexandria he was raised in Cairo. His grandfather was an officer in the Egyptian army during the reign of King Fouad and was the governor-general of the town of Port Sudan. Whilst there his grandfather married a Sudanese woman.\nZein began his career as a musician in a group called “Qittat Sagheera” (“Miniature Cats”) but later transferred to singing. He first rose to fame when he performed a song titled “Ta’aaly” (“Come Here”) with A’mr Diab. Zein has performed alongside Yahya Al A’alamy in the television series “Al Hawwy”.'),
('1061285', 'https://media.elcinema.com/uploads/_315x420_44d97f88a158961d828e202c2fb9f8e78aca62c4d1a52ba79e7c7066225606b5.jpg', 'Sherein Reda', 'Egypt', '12 July 1968', 'She is the daughter of artist and star Mahmoud Reda. She started off her career working in advertisments and doing Ramadan riddles. Shereen then married pop star and singer Amr Diab, only to get a divorce from him after having her first born daughter \"Nour\".'),
('1061518', 'https://media.elcinema.com/uploads/_315x420_06ffda05805362ccabdb275fd6d05527c82f13a8e36bf8401e6ae4ecdabfe496.jpg', 'Rami Wahid', 'Egypt', '17 April 1975', 'Ramy Wahed’s love for art began at a young age. This was due to the attachment he had to his departed father Samir Wahid, who worked on theatrical productions in which Ramy participated. While at university, Ramy formed an inter-university acting troupe. His cinema debut was in the film “Al Garaj” where he acted alongside Nagla Fathi and Farouk Al Fihawy. Ramy had strong relations with the director Mohamed Al Naggar who was his father’s friend. Ramy acted in “Qalb Garea,” after which he was cast in many television series. Director Ahmed Yahya took note of his talent, and later gave him a major role in the series \"Al Banat.\" Wahed continued to prove himself as a versatile actor in a number of television and film roles. His best known work, however, is his performance in the film \"Omar wa Salma\" (2007).'),
('1061893', 'https://media.elcinema.com/uploads/_315x420_3263bd4e6bc63f52e591847ded58f7d3ae160e3804739ae215a5b417e1853f6c.jpg', 'Sameh Ser Al-Khetum', 'Egypt', NULL, 'Author and script writer Sameh Ser El Khetm created success when he wrote the script for movies such as “Howa Fee Eih” or “What’s Going On” in 2002 which was considered a hit comedy. The comedy starred Ahmed Adam and singer Mohamed Fouad.\nFollowing this success was the movie “Eli Bali Balak” in 2003 for actor Mohamed Saad. Sameh also participated with writer Walid Seif  and Mohamed Nabawi in writing other scripts such as “Without Censorship”'),
('1061901', 'https://media.elcinema.com/uploads/_315x420_e19127bfe83a34fe32a96925dce59eacbecb1d38bc5ef6c2ee7be987282cd3ec.jpg', 'Mohamed Sharaf', 'Egypt', '19 February 1963', 'Mohamed Saharf is an Egyptian actor born on the 19th of February 1963. He graduated from the Commercial Technical Institute in 1984. Afterwards he head to Cairo to begin his artistic career with \"Arabisc\" series and \"Houda Karama\" theatrical play.'),
('1062733', 'https://media.elcinema.com/uploads/_315x420_9369506380011b66a67a5881c8fb7632088ac80eb21e40186ab6c3e3b465cec8.jpg', 'Ali Jamalelddin', 'Egypt', NULL, NULL),
('1062773', 'https://media.elcinema.com/uploads/_315x420_85e085a5699e0bc3ff5031f25589a2eb39720d5c98f1188bee489d95d51e81f4.jpg', 'Jalal Rajab', 'Egypt', '16 July 1961', NULL),
('1062814', 'https://media.elcinema.com/uploads/_315x420_58b70542939f776df6918daf27008fece872427d816e1194721ef04e1327e0a7.jpg', 'Bashir El Deek', 'Egypt', '27 July 1944', 'Bashir El Deek is an Egyptian cinema figure. El Deek earned his Bachelor’s Degree in commerce from Cairo University in June 1966. Prior to the start of his career as a screenwriter he authored several short stories, publishing them in magazines in Egypt and across the Arab World. \nHis debut as a screenwriter came in the film “Ma’aa Sabaq Al Assrar” which was directed by Ashraf Fahmy. The film starred Mahmoud Yassin, Nour El Shereef and Mervat Amin and began screening on February 1978.\nBashir has directed “Al Toufan” (“The Deluge”), a movie which starred Mahmoud A’bd Al A’ziz, Farouq Al Fishawy, Mahmoud Al Guindy and Amina Rezk. He has also directed “Sikkat Saffar” (“Traveller’s Way”) which starred Nour El Shereef, Noura, Hassan Moustafa, A’bd Al Salam Mohamed, Ahmad Badeer and others.\nBeginning in 1984 and continuing till today, Basheer has provided screenplays for several television series. Basheer has also worked on animations whereby he wrote the screenplay for “Al Faris wa Al Amira” (“The Knight and The Princess”) and directed the work following the death of the original director Mohamed Hassib.'),
('1062884', 'https://media.elcinema.com/uploads/_315x420_fea073892e44b138b2aa18b9cbabda40c2b73282ddd46491796a7a1277294fca.jpg', 'Fathy Al-Gendy', 'Egypt', NULL, 'Fathi El Guindi is a young script writer who shone amongst the many script writers with his unique work, and in a very small amount of time was able to prove himself against all odds. He did the series “Kareoka” which is the biography of the late legendary Taheya Kareoka. He also wrote the series “Nouna the Matrimonial Lady” which played during Ramadan 20111, staring Hanan Turk.'),
('1063170', 'https://media.elcinema.com/uploads/_315x420_7c896aa563b763d0902b40a62fdd4c1c6e1983e9525042239aa0a9c89554f613.jpg', 'Gamal Ismail', 'Egypt', '20 February 1933', 'Gamal El Din Ismail Hussein was born in Cairo. He earned a degree in history from the Faculty of Arts of Ain Shams University in 1957, and a bachelor\'s degree from the Institute of Theatrical Arts of Cairo in 1956. He started working as a theater supervisor in the city of Alexandria in 1958. He then directed plays made by university and public companies acting troupes. He was first recognized when he played a role in the play “Sheia\' Fi Sadry” (Something Inside Me), after which he appeared frequently in many successful plays, like “Sayedaty el Gameela” (My Fair Lady). In television, Gamal Ismail worked in many shows that were considered landmarks of their periods, like “Ze\'ab El Gabal” (Wolves of the Mountain) and “Layaly El Helmeya” (Nights of Helmeya). His last appearances were in the TV series “Al Qasirat” (The Minors) and “Khalaf Allah”. He died in his house in 2013 after suffering a heart attack.'),
('1063300', 'https://media.elcinema.com/uploads/_315x420_2bee9e18d5269721834bf4c80a6d6abc28b86a82144691740537f832bd3196e1.jpg', 'Dina', 'Egypt', '27 March 1965', 'Dina Talaat Sayed Mohamed, born in Sayeda Zainab, studied folkloric art and has a Masters in Theater. She was married to director Sameh Elbagawry and they had a son together before he passed away. She is one of the most famous belly dancers in the world, and often portrays a belly dancer in her TV and silver screen roles, including the lead in \"Ibn Ezz\" opposite Alaa Wali Eldin.'),
('1063500', 'https://media.elcinema.com/uploads/_315x420_d108ae3d5cac79636a61bf9fb65b2c67aa4f7117e97911dd75f96edde4b95859.jpg', 'Youssef Maaty', 'Egypt', '25 August 1963', 'Youssef is an Egyptian (screenwriter) who began his career as an (announcer) on television. He (became well-known) after he presented a television program titled “Al Sitt di Umee” after which he (has issued some publications).\nThat was until he got to know “Adel Imam”. Thereafter the two collaborated closely in what many have characterized as a (?) association due to the fact that he is the scriptwriter for all of Adel Imam’s cinematic, theatrical (and television) performances. \nYoussef has also worked with Ahmed Adam and Mohamed Heneidy and can be considered one of the best (satirical) writers in Egypt and the Arab World.'),
('1063608', 'https://media.elcinema.com/uploads/_315x420_fe7bf1df766109f46d3ee18a1305e58a81398591c4c942254db1dc8c7953dc15.jpg', 'Khaled Sarhan', 'Egypt', '25 September 1979', NULL),
('1063681', 'https://media.elcinema.com/uploads/_315x420_a61c3dc7125c11eb84eb68334a1dffa64cb2e97a30c2498b38c3e55c717e5704.jpg', 'Nagy Saad', 'Egypt', NULL, NULL),
('1063978', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'صفوت عبدالخالق', 'Egypt', NULL, NULL),
('1064111', 'https://media.elcinema.com/uploads/_315x420_7d431add3c2ad122b3bdc298aca2ceef988c795a062913073fc79852a30a4266.jpg', 'Sanaa Shafea', 'Egypt', '25 January 1943', 'Sanaa Shafea is an Actor, theater director and Egyptian academic professor. He was born in the village of Mocha in Assiut Governorate in Upper Egypt. He stayed in the village for about 8 years before moving to Cairo with his father, who was a scholar of Al-Azhar Al-Sharif. He studied primary school at Al-Gamaliya Primary School. He discovered his passion toward art and joined the amateur teams on Emad Eddin Street until he went through the academic studies to graduate from the Higher Institute of Dramatic Arts.. Sanaa worked as a teacher and became the dean of the Institute, and worked on television, cinema and theater. Where he directed the play Don Quixote in 1975, and one of his most important film works was Raouf\'s (Not to Smoke) and Ibrahim\'s role in the famous TV movie Fawzia the Bourguine. He played a pivotal role in most of the film\'s events. , Has participated in several series of the most important (Zinni Barakat) and (Hazrat accused father) and (Hanan and Hanin) and (Bab al-Khalq) and (slap) and (after the beginning).'),
('1064356', 'https://media.elcinema.com/uploads/_315x420_bd863e291380d4ba4452d9069ff48f43e94030401f26a1f084725a7f969ce160.jpg', 'Ehab Ayoub', 'Egypt', NULL, NULL),
('1064418', 'https://media.elcinema.com/uploads/_315x420_8414119c9df86797c2ed91d29211460937e98a894f0a2d848560c702637b3aed.jpg', 'Mohamed al Moatasem', 'Egypt', ' 2 July 1972', NULL),
('1064421', 'https://media.elcinema.com/uploads/_315x420_f7582e298ddc509a2329ceb47e6f1b61a34d195175cafca87829acdb2481fb45.jpg', 'Tamer Hagras', 'Egypt', ' 6 November 1972', 'Born on November 6, 1972, Taamer Hagras is an Egyptian actor who started his career as a model in fashion house owned by the Palestinian producer Muhammad ‘Aayesh. \'Aayesh instantly spotted Taamer’s talent and pushed him to his first cinema role in “Borkaan al Ghadab\" (Volcano of Anger). His second leap forward was his role with the legendary Adel Imam in the film “Al-tagreba al-Danimarkeyya\" (The Danish experience).  Taamer has worked on a number of TV shows: “Amaaken fel-kalb\" (Places in the Heart), “Kalb al-Donya\" (The Center of the World) and “Kalby Yonaadeek\" (My Heart is Calling You). In 2006, Taamer played a leading role with Yousra in the film “Ma teegy Nor’os\" (Let’s Dance) and appeared that same year as a guest of honor in the first four episodes of the series “Lahazaat Harega\" (Critical moments). Hagras\'s other film credits include  \"Amalaeyaat Khaassa\" (Special Operations) and Abdul ‘Azeez Hashshaad’s “Al-balad Di Fiha Hokouma!\" (There\'s a Government in this Country!).'),
('1064474', 'https://media.elcinema.com/uploads/_315x420_4061d0ce8231048f7b8dccfe1e16bf9e7e1cfc66dba24b213bd5bcc1c0a88991.jpg', 'Hala Shiha', 'Egypt', '23 February 1979', 'A retired actor, is the daughter of the plastic artist Ahmad Zulficar Sheeha and sister of actors Hana, Inaas and Maya. As a young actor playing the role of super star Hussein Fahmy’s daughter in the TV series “Kalemaat i.e. Words” has caught the audience eye. However playing the role of Manaar with great talent in series “Al-ragol al-aakhar i.e. The other man” with super stars Nour al-Shereef and Mervat Ameen launched her career. Hence, filmmakers gave her lead roles in “Al-sellem wal-tho’baan i.e. Snakes and ladders”, “Al-Lemby” and “Arees men Geha Amneya i.e. A Security Service Groom”. Young as she is, Hala decided to retire gradually after becoming more religious. She appeared veiled in her last film “Kaamel al-awsaaf i.e. The perfect man” with Aamer Mouneeb then she retired acting. She joined Nesreen, Hanaa Tharwat, and Hayaat Kandeel in retiring at such a young age. Hala lives away from the lights of fame in Alexandria where she leads a quiet life with her husband Youssef Harrison, an Italian/Canadian who converted to Islam.'),
('1064489', 'https://media.elcinema.com/uploads/_315x420_c227f9e1f4f68023dc2fc4e61f73343598088504c3bdefb2e0c76fff8e504dd1.jpg', 'Adel Ammar', 'Egypt', '17 June 1965', NULL),
('1064635', 'https://media.elcinema.com/uploads/_315x420_852b86a50a8253c07f3142d9fc2798875e4195b396afc3e45fa1e4da5e17a9da.jpg', 'Ahmed Rashwan', 'Egypt', '23 October 1969', 'Ahmed Rashwan is an Egyptian director, screenwriter and producer. Rashwan also manages a production company called “Dream Production”.\nRashwan earned a degree in law from the University of Alexandria in 1990. In 1994 he earned a Bachelor’s degree from the Higher Institute for Cinema at Cairo. He has directed several documentary and short titles which were screened at several international film festivals where some won awards. Rashwan has also produced several documentaries and shorts and has worked on several foreign titles which were filmed in Egypt. Moreover, Rashwan has also served on the judging committees which looked at documentaries and shorts in all of Egypt, Lebanon, Tunis and Italy. \nAhmed Rashwan has authored a book about the documentary director Samir ‘Ouf and has also prepared a book on independent cinema in collaboration with Hussam ‘Elwan. Furthermore Rashwan has taken part in the organization of several film festivals and other similar programs which include the organization of awards ceremonies for Egyptian and Tunisian film festivals. \nRashwan has written film reviews for several Arab and local magazines and newspapers which include the “al-Hayaa” international newspaper. Ahmed Rashwan has also been involved in cultural programs and workshops set up in Cairo, Lebanon, Spain and the United States. The filmmaker has also taught documentary filmmaking in Cairo between 2005 and 2006. \nRashwan is a member of the executive committee for directing young filmmakers at the “Rusul al-Hourriyah” workshop. His first experience writing and directing a narrative film came in 2008 when he wrote and directed “Basra”. The work was screened at several local and international film festivals and received several awards. Rashwan is currently working on his second narrative title “Ta’mm al-Hayaa” (“Taste of Life”).'),
('1064706', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أفلام مصر العالمية للانتاج والتوزيع', 'Egypt', NULL, NULL),
('1064718', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'عبده أمين', 'Egypt', NULL, NULL),
('1064853', 'https://media.elcinema.com/uploads/_315x420_64eafce1f1831a475b8f2bc94e8eb1fbc7c4720cd1b5dba7a9068e32f9fedc30.jpg', 'Abdel Megid Khedir', 'Egypt', '10 January 1953', NULL),
('1064927', 'https://media.elcinema.com/uploads/_315x420_e24b291b589cd7804eda9311bdffc9e9f0e3ebbe7bf54aec536202fe2f718b91.jpg', 'Sahar Rami', 'Egypt', '20 June 1961', 'Sahar Rami is an Egyptian actress who joined the Higher Institute for Dramatic Arts with her sister Ola Rami to study ballet. She started her career as commercials actress where she attracted the casting agents\' to her. She worked in Ramadan\'s famous riddles with comedian Samir Ghanem and from there she participated in many movies and plays with stars like Adel Imam and others.'),
('1065282', 'https://media.elcinema.com/uploads/_315x420_b802d47073c617e3d7c91c34e34905a6f98e2eb09df415982b97f76720a4f337.jpg', 'Tarek Al Amir', 'Egypt', NULL, NULL),
('1065295', 'https://media.elcinema.com/uploads/_315x420_8bff092fb4916d0a6c3d6ed91c953771cdb3c8648719089e3be5df6bdaa115c0.jpg', 'Ashraf Amin', 'Egypt', NULL, NULL),
('1065379', 'https://media.elcinema.com/uploads/_315x420_9449efaeec99e1ee3d2807b9ff39cd362998606524776bf6c4eb28dd67725e5f.jpg', 'Nahed Nasrallah', 'Egypt', NULL, NULL),
('1065389', 'https://media.elcinema.com/uploads/_315x420_265068c8877d8c682140d877ef2ac11e8741ea1b489c44825b7968bb0ac1d074.jpg', 'Huda', 'Egypt', '29 July 1976', NULL),
('1065477', 'https://media.elcinema.com/uploads/_315x420_1ca06288098c6dc6c35da337e8d4a83a48da61efeb1c7bc6913bf73c0c851d6e.jpg', 'Wael Abdallah', 'Egypt', '18 May 1965', 'Wael is an Egyptian producer, director and distributor. He was born on the 18th of May, 1965 and began his film career when he directed “Hayyat Al Gawhary” (“Al Gawhary’s Life”), a television production which starred Yosra and went on to become one of the ‘90s most successful series. Wael then proceeded to provide a unique adaptation of a Naguib Mahfouz novel through a series titled “Al Seyra Al A’shouriya”. That work featured the talents of Nour El Shereef. Thereafter Wael set up his own production company in 2003. The first film produced by that company was “Mallaky Al Iskandiriyah” (“Licensed Alexandria”). Wael provided the screenplay for that production which went on to achieve great success, thus supplying him with momentum to continue his career. Some of the titles which followed were “Badal Faqed”, “Masjoon Transit” and “Samir wa Shahir wa Baheer”. The producer now seeks to bring together the talents of performers Ahmed El Sekka and Ahmed E’zz in a production titled “Al Maslaha”. That latest title is directed by Sandra Nashaat and is set for release in 2011.'),
('1065713', 'https://media.elcinema.com/uploads/_315x420_db60fd7d28743d7bc5b10c20c2dbbfac4b0fe2ecc1b1f09cef0a6dea4ac2d414.jpg', 'Maher Maher', 'Egypt', NULL, 'Mokhtar El Sayed is an Egyptian actor who started acting at the beginning of the 1950s with the film “El Zohour El Fatina” (The Tempting Flowers) in 1952. He had a number of small roles in films, such as a doctor, officer, or employee. He continued to play distinguished smaller roles, but he never had a starring role in his 40 year acting career. His last film was “El Sageena 67” (Prisoner 67), and his most famous work was “El Ra’aasa We El Tubal” (The Dancer and the Drummer).'),
('1065773', 'https://media.elcinema.com/uploads/_315x420_e4cc9a017b38854a4e6e30082ef6342d6877416a90fd923f78837f1fb08bc707.jpg', 'Mostafa Amar', 'Egypt', '22 September 1966', 'Mustafa Ahmed Mohamed Ahmed Amar was born to a father who worked as an engineer. Mustafa birthplace is Alexandria, he studied at the faculty of agriculture and was married at a young age. Mustafa is a musician and a composer, he rose to fame by virtue of the success of his albums of the likes of “Quloo li fein Habibti” (“Tell Me Where My Loved One Is”), “Ya Wad Ya Iskandarani” (“Oh, Alexandrian”), “Taal Al Leil” (“It’s been a Long Night”) and “Ya Ghazali” (“My Precious”).'),
('1065831', 'https://media.elcinema.com/uploads/_315x420_d219b4ebfeaf686c36b10d175f78bb25277ff33aeadfd01c9743e40d969e50ba.jpg', 'Ashraf Abdulaziz', 'Egypt', NULL, NULL),
('1066039', 'https://media.elcinema.com/uploads/_315x420_a068c082fc666bcf1debf116a39c965427b8d88dfd2b1c6d396b4106c7087f5f.jpg', 'Mohamed Lotfy', 'Egypt', '17 October 1968', 'Mohamed Lotfy is an Egyptian actor who was born in Alexandria in 1968. He graduated from the acting division of the Institute of Cinema in Cairo. Lofty began his acting career in cinema with the film “Caberia” (1990) starring alongside Ahmed Zaki. He has since appeared in many films in supporting roles including: “Amreeka Sheeka Beeka” (1993), “El Bahar Byadhak Leh?” (Why Does the Sea Laugh?), “Isharet Marour” (Traffic Signal), “Hysteria,” “Cabaret” (2008), and “Halwet Ruh” (Rouh’s Beauty; 2014). Lofty has also appeared in numerous television series such as “El Sira El Hilaleya” (The Hilaleya Biography), “Milh El Ard” (Salt of the Earth), “Sharaf Fetah El Bab,” and “El Adham.”'),
('1066059', 'https://media.elcinema.com/uploads/_315x420_c7fcccb716f2a366ba345f057ae452ef61ee44e8d7d59911d935724a9cc94644.jpg', 'Ahmed El Morsy', 'Egypt', '10 March 1977', NULL),
('1066119', 'https://media.elcinema.com/uploads/_315x420_3e1df8914441c483be8064edb3f038e466139f21111b1ece727d903e193c88e0.jpg', 'Nader Salah Al-Din', 'Egypt', NULL, 'Nader began his career in cinema by writing the script for “Howa fee Eih?” which starred Mohamed Fouad and Ahmed Adam. Thereafter Ahmed moved on to write films which starred most of Egypt’s comedy actors, performers of the like of Ahmed Helmy and Mohamed Sa’ad. \nNader has also directed a theatrical production in 2009 titled “Braksa”.'),
('1066196', 'https://media.elcinema.com/uploads/_315x420_47112beaaec9424a4fcc2ed5968b2d60d56c9e3dd0912f2459d633643dad04d8.jpg', 'Hamdi Abdel Rahman', 'Egypt', NULL, 'The famous Egyptian decoration designer, Hamdi Abdel Rahman was born on the 10th of November 1977. He designed the decoration of many movies and received many awards.'),
('1066321', 'https://media.elcinema.com/uploads/_315x420_600314b082f378978e7481a5a16134430e82c70fb93d87efac6cf377107b4206.jpg', 'Dina Farouk', 'Egypt', NULL, NULL),
('1066339', 'https://media.elcinema.com/uploads/_315x420_60869a165c7510953927b75409cd67b9d4965b85cf207bd449bdeaf0b7221450.jpg', 'Salma gharib', 'Egypt', ' 5 October 1970', NULL),
('1066415', 'https://media.elcinema.com/uploads/_315x420_b77e441f65a04aa5e4e538520745be1ee91fa353877eeeaa4dd35c0370fbe978.jpg', 'Mohanad Hosny', 'Egypt', '21 October 1992', NULL),
('1066435', 'https://media.elcinema.com/uploads/_315x420_34398d7695a7fe61bf52c0279eab7e656187c76b8d84419edc6c1ec312f950fe.jpg', 'Serag Mounir', 'Egypt', '15 July 1904', 'Seraag and directors ‘Abbaas Kaamel and Fateen Abdul Wahhaab were born of the same family. He was sent, by his family, to Europe to study medicine, but instead he studied German language. It was Muhammad Kareem, the director whom he met in Germany, who gave his first role in “Zeinab” the silent film. Mouneer joined the Acting Supporters Society and started acting on stage, in films as well as in the radio. He married actor Mimi Shekeeb who remained his wife till the end of his life though at the beginning they suffered a lot from her family’s refusal.'),
('1066468', 'https://media.elcinema.com/uploads/_315x420_a93de5bb31a2936eab2a6a8ca1154e327aca8c67d2b134775204d4bcc92ee48f.jpg', 'Muhammad Al Swasy', 'Egypt', NULL, NULL),
('1066588', 'https://media.elcinema.com/uploads/_315x420_5b07b9ae421538cf787aa8276c7d86da29a755f3fa584d88e12909dcbb618209.jpg', 'Karim El Houssiny', 'Egypt', ' 9 February 1984', NULL),
('1066612', 'https://media.elcinema.com/uploads/_315x420_07745c03adfd3028673d8ab88fa90dbe3f82fafbbd71ffb7cb84d309f5b81eab.jpg', 'Safaa Al Toukhy', 'Egypt', '22 August 1964', 'Actress Safaa El Tokhi (full name Safaa Abdallah Mohammed El Tokhi) was born in Cairo on February 8, 1964. El Tokhi comes from an artistic family; her father Abdallah El Tokhi and mother Fatheya El Assal are famous writers. Safaa El Tokhi studied at Higher Institute of Dramatic Arts from which she graduated with a Bachelor’s Degree in 1985. At the beginning of her career, Safaa El Tokhi worked as a writer, and in 1995 worked at the Institute of National Culture. \n\nSafaa El Tokhi began her acting career in 1979 with the television serial El Bahitha (The Researcher); even though she was trained as a stage actress, she only acted in one play “El Ayyam El Makhmoura” (The Drunken Days) in 1999. She acted in several films, among them “El Zaman El Saa’b” (The Difficult Time), “El Mohagir” (The Emigrant), and “Bekhit we Adila” (Bekhit and Adila). Of Safaa El Tokhi’s most famous television performances, which distinguished her in the realm of TV Drama, are “Leyali El Hulmiyya” (Dream Nights), “Lan Ayesh Fi Galbab Abi” (I Won’t Live In My Father’s Galabiyya), “Mahmoud El Masry,” as well as her striking performance in “Qadhiya Rai’ ‘Am” (The Case of Public Opinion) with the star, Yousra.'),
('1066785', 'https://media.elcinema.com/uploads/_315x420_c169741beca737efa6d66b1532582b24b6e804d084b3bce8b766c9460f7413ac.jpg', 'Mohamed Ezz Elarab', 'Egypt', ' 1 January 1981', NULL),
('1066810', 'https://media.elcinema.com/uploads/_315x420_9c7eb06ed8cd72236f06662c95ab81a666947f98ac92c6ac5a61b53096c1be2b.jpg', 'Simone', 'Egypt', '14 June 1966', 'Her full name is Simone Philip Kamel, she was born in Shobra Cairo. She used to sing in school, her real talent came to the surface when she sang a Greek song at the Egyptian Greek friendship festival. She acted opposite singer Amr Diab in the movie “Ice cream in Gleem”. She also acted in the movie “Good Day Hard Day” opposite infamous actress Fatin Hamama. \nShe was also involved in several television series such as “Black and white”, “Time of the knights”, “Abu El Ela El Beshri”, “A Husband’s Diary”, “The Southerner’s Dream” and “Strangers in Town”. Some of the plays Simon was involved in opposite Mohamed Sobhi were “Seket el salama”, “siam Siam”, “Carmen”, Lebet El Set”.\nAs for some of her most famous songs they were, A look and a smile, Taxi, be afraid of me, happy, again and again, Merci and Casanova'),
('1066890', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'كمال مجدي', 'Egypt', NULL, NULL),
('1067127', 'https://media.elcinema.com/uploads/_315x420_97dd1fe2193350542c765ec89043614bf023265bd42e360545e1579453f97623.jpg', 'Ola Ramy', 'Egypt', '12 December 1959', '‘Ola Nehaad Raamy is an Egyptian actor since young age; she is the sister of actor Sahar Raamy. ‘Ola studied Ballet. “Al-la’eeba i.e. The players”, “Al-bahlawaan i.e. The clown” and “’Afreet le koll mowaaten i.e. A genie for every citizen” are among her stage roles. She excelled in many TV series such as; “Raafat al-Haggaan” and “Hadath fee beit al-kaady i.e. Happened in al-Kaady’s house”.'),
('1067219', 'https://media.elcinema.com/uploads/_315x420_ab1ea927f7fd641bbf159675318e280b2a23122e204a457479bece1db1a841fb.jpg', 'Diaa El Merghany', 'Egypt', '21 June 1952', 'Mohamed Diaa Mohamed Al Merghany received his bachelors degree in theater. He writes and acts in films and has worked on several plays and TV shows. The characters he portrays vary, from goofballs to villains. He has written and directed many plays, including \"Al Wamanji\" and \"Abou Khatwa.\"'),
('1067549', 'https://media.elcinema.com/uploads/_315x420_bda01b91bc103ef2f58c8d4c41559de9c691964379e65af5e054a3786e6ee5ed.jpg', 'Galal Issa', 'Egypt', '17 July 1937', NULL),
('1067697', 'https://media.elcinema.com/uploads/_315x420_54f31829303b2ffaced455ef3d7cd97344917275e0bd4856f7e25358085976f3.jpg', 'Tamer Samir', 'Egypt', NULL, NULL),
('1067776', 'https://media.elcinema.com/uploads/_315x420_95d8add0975210efe5b8e945e29c61ae39f9e2161e31fecff63fed39185ac509.jpg', 'Ghada Abdelrazek', 'Egypt', ' 6 July 1965', 'Ghada Abdel Razek is an Egyptian actress who studied computer science at Cairo University. Her career in television began with several appearances in television commercials. Ghada started getting film roles in the early 1990s, and scored her first sizable film role in Mohamed Abd Al Aziz\'s “Lamadah” (Chatterbox) in 1999. Among the television series which she has performed in are “Amanah Ya Leil,” (Oh Please, Night), “Aailat Al Hajj Metwaly,” (The Hajj Metwally Family) “Nijoom Kol Youm,” “Wadi Al Feran,” (Valley of the rats), “Dahab Qishra,” (Fake Gold), “Seraa Al Aqwiyaa,” (Clash of the Strong) and “Al Ala wa Al Nas.” Ghada has also performed in the theatrical productions like “Al Ikhwa Al Andal” (The Wicked Brothers) and “Houda Karama.” In 2003, Ghada took part in the Ramadan trivia show “Farah Farah,\" (Joy Joy) and in 2012 starred in the popular Ramadan drama \"Ma\'a Sabq Al Israr\" (Premeditiation). She repeated the successful experiment with director Mohamed Samy in the following year in \"Hekayet Kayat\" (The Story of Hayat).'),
('1067876', 'https://media.elcinema.com/uploads/_315x420_b3cf61cc5fca35f6cc5ad0ff5552b3dcc215c9cb87b180dd80d39050f0b3fd2d.jpg', 'Amina Rizq', 'Egypt', '15 April 1910', '1910, Ameena Muhammad Rezk was born in Tanta (Delta of Egypt) where she joined the elementary school and would watch the circus during “Mouled al-Sayyed al-Badawy”, which gave her a taste for performing. Following the death of her father, Rezk moved to Cairo with her mother, grandmother and Aunt Ameena Muhammad, an aspiring actress with whom Rezk would sneak out to visit the nightly carnival at “Rod al-Farag” on the banks of the Nile. Muhammad acted with the Ramses troupe, established by Youssef Wahby. Inspired by her aunt, Rezk also began acting and, at the age of 13, won a supporting role in a stage production of ‘Rasputin’ next to Youssef Wahby. Her performance was impressive enough to ensure she became a valued member of the company, acting in approximately 500 plays until the troupe’s dissolution in 1944, and her friendship with Wahby endured until his death in 1982. Wahby tried unsuccessfully attempt to revive the company five times over the next twenty-six years, and Rezk always made herself available for his productions at these times.\nIn 1928, Rezk embarked on a film career that would span eight decades when she appeared in the title role of Stelio Chiarini’s “Souaad al-ghagareyyaa i.e. Souaad the gypsy). Four years later, she appeared in “Awlaad al-thawaat i.e. Sons of Aristocrats”, Egypt’s first talkie.\nAlthough she never married - apart from, as she would regularly claim, the theatre - Rezk carved a niche for herself in motherly roles, including the part of a young Omar Sharif’s mother in Salaah Abu-Seif’s “Bedaaya wa nehaaya i.e. Dead among the living (1960)”. In addition to films and plays, Rezk regularly appeared on Egyptian TV and radio.\nIn 1997, Rezk became the first female artist to be appointed to the “Shoura Council”, the lower legislative body of the Egyptian government.\nRezk, a much-loved figure in Egyptian cinema, died of heart failure in a Cairo hospital on 24th August 2003, just two months after giving her final performance.'),
('1068127', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'عماد مراد', 'Egypt', NULL, NULL),
('1068180', 'https://media.elcinema.com/uploads/_315x420_42e9587b9f28899e53cbc0264daa73a90ac07304b568360160cc4a3f3cc654de.jpg', 'Nadia Rafeek', 'Egypt', ' 8 February 1935', NULL),
('1068301', 'https://media.elcinema.com/uploads/_315x420_be19157b319338328d51bd4ef078f73a78085b4cf7450b64303ac0911ff1a288.jpg', 'Camba', 'Egypt', NULL, NULL),
('1068535', 'https://media.elcinema.com/uploads/_315x420_39501b6c145aaa4200125179dabda88a7f964c6b2634766ec67f069040f0b22d.jpg', 'Saad Hendawy', 'Egypt', NULL, 'Sa’ad Hendawy began his career directing short films which included 1993’s “al-Bukaa” (“Sobbing”), 1994’s “Zeyara fee al-Khareef” (“A Visit in Autumn”) and “Fuqa’at” (“Bubbles”) which was released that same year. Thereafter Hendawy worked as an assistant director on the 1995 television drama “al-Wahm wa al-Silah” (“The Illusion and the Arms”) before returning to directing shorts. In 1996 Hendawy directed the short narrative film “Yawm al-Ahad al-‘Aady” (“A Normal Sunday”) which was followed by “al-Mashhad al-Akhir” (“The Final Scene”) and “Ayyam al-‘Araby fee Paris” (“An Arab’s Days in Paris”). \nHendawy’s first cinematic work was “Hallat Houb” (“Amorous Circumstances”). That title was followed by “Alwan al-Samaa al-Sab’a” (“Seven Colours of Heaven”) which starred Leyla ‘Elwy and 2007’s “al-Saffah” (“The Murderer”) which starred Hany Salama.\nHendawy graduate from the directing department at the Higher Institute for Cinema in 1994 and received the institute’s directing diploma in 1996.'),
('1068587', 'https://media.elcinema.com/uploads/_315x420_8f196f32183ba2d9a7b79dc25c7737606deb22406d19cbe34612973ae82af6e0.jpg', 'Ahmed Diab', 'Egypt', ' 9 August 1945', 'Ahmed Diab is an Egyptian actor. He was born in 1945, and has worked as a supporting actor throughout his whole career in numerous television series, including “Opera Aida”, “Alragol Al A\'khar” (The Other Man), “Lel Adala Wugooh Kathira” (The Many Faces of Justice) and “Al Osyan” (Disobedience).'),
('1068590', 'https://media.elcinema.com/uploads/_315x420_0066860b906bfd86e9653d224d57f74c0f1cf095aaf2dd0d793c88f6b4fb4c32.jpg', 'Marwan Hamed', 'Egypt', NULL, 'Marwan Hamed is an Egyptian director. He graduated from the High Cinema Institute in 1999, and worked as an assistant director in films by Samir Seif and Sherif Arafa. He directed several short films, including the award-winning “Lili”, which was screened at many film festivals worldwide and on Arab world television channels. His feature film debut was the 2006 best-seller novel adaptation “Emaret Yacoubian” (Yacoubian Building), which was then the most expensive film to be ever produced in Egyptian cinema history. He followed Yacoubian\'s success with the moderately successful action film “Ibrahim El Abyad”, and another best-seller adaptation “El Feel El Azraq” (The Blue Elephant), which was his most successful film critically and financially.'),
('1068696', 'https://media.elcinema.com/uploads/_315x420_f48a4a03ee0c7a3df82cf09c6d5cd3d1ec14ede1735940b1ff4dba83d38e9fd6.jpg', 'Kamal El Shennawy', 'Egypt', '26 December 1921', 'Started his career on the silver screen as a star, After graduating from the Teacher’s College Muhammad Kamaal al-Shennaawy taught art education  at secondary schools. Meanwhile, as a plastic artist he held a number of art exhibitions. After two years, he left teaching to acting.  During his first stage, he was very popular playing light comic lead roles. He formed a successful duet with super star Shadia where he joined her in some of the songs; “Al-hawa maloush dawa i.e. Love All the Way”, “Hamaamet al-salaam i.e. The dove of peace” and “Lessaanak Houssaanak i.e. Guard Your Tongue”. Kamaal produced a big number of films through his production company; “Wadaa’ fel-fagr i.e. Farewell at dawn”, “Nessaa al-leil i.e. Women of the night” and directed “Tanablet al-Sultaan i.e. The Sultan\'s idle followers”. His films “Al-mar’a al-maghoula i.e. Mrs. X”, “Akwa men al-hayaah i.e. Stronger than life” and “Tareek al-Domou’ i.e. Tears Road” mark the beginning of maturity as an actor playing more complicated roles. “Al-Karnak” declared the beginning of a new stage for the grand Al-Shennaawy. Of his popular TV series are: “Zeinab wal–‘arsh i.e. Zeinab and the throne” , “Hend wal-doctor No’maan i.e. Hend and Dr. No’maan”, “’Oyoun al-hobb i.e. Eyes of love”, “Le dawaa’y amneyya  i.e. Security measures” and “Aakher al-meshwaar i.e. The end of the road”.  Kamaal married several times. Among his ex wives was belly dancer Haaguer Hamdy, actors ‘Afaaf Shaaker and Naahed Shereef.'),
('1068873', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mona Fouad', 'Egypt', NULL, NULL),
('1069339', 'https://media.elcinema.com/uploads/_315x420_8a5db97f18bb5f2102029d21dd50e712e382401c21ca94488222d9249be09bdb.jpg', 'Samir Bahzan', 'Egypt', NULL, NULL),
('1069429', 'https://media.elcinema.com/uploads/_315x420_462aa8574174239e8aa38e07ee81723f4e8cfe0714fd8a50a1c23c34949f34e4.jpg', 'Mervat Amin', 'Egypt', '24 November 1948', 'Mervat Amin is an Egyptian actress who received her degree from the English department at A’yn Shams University’s literature faculty. Her full name is Mervat Mostafa Amin. Amin has been married four times. Her first marriage was to Syrian musician Mowafaq Bahgat whilst her second was to guitarist O’mar Khourshid. Amin’s third marriage was to Hussein Fahmy with whom she had a daughter named Mennat Allah. Finally, Amin’s fourth marriage was to businessman Mostafa Al Beleidy. \nMervat Amin’s acting career began in college where she joined an acting troupe and subsequently performed in Tawfiq Hakim’s play “Ya Tale’ Al Shagara” (He Who’s Climbing the Tree). Following her graduation Amin became a professional performer and took part in the theatrical production “Mattar Al Houb” (Love at the Airport) which saw her act alongside performer A’bd Al Mone’im Madbouly.\nAmin’s talents were noticed by fellow performer Ahmed Mezhar who nominated her for cinema roles beginning in 1968. Thus Amin performed opposite Mezhar in the 1968 film “Houb Al Mourahiqat” (Adolescent Love). Thereafter her acting career took off and she took part in several television and nighttime productions such as “Al Zawgah Awal Man Ta’lam” (The Wife is the First to Know) and “Sahibat Al Galala Al Houb” (“Majestic Love”).\nMervat Amin is unique in her talents. She is cool minded and acts out her roles with passion. Some of her best known roles were in “Zawgat Ragol Mohim” (A VIP’s Wife) and “Oula Thanawwy” (Freshman Year). Most of her early roles portrayed her with a seductive air.'),
('1069439', 'https://media.elcinema.com/uploads/_315x420_4e1faa6798846d7aa97afe640dc53b4574c593da1892d062c8ffa2cf6a6af5cc.jpg', 'Mohammed Farag', 'Egypt', NULL, NULL),
('1069552', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أفلام حسن الإمام الجديدة', 'Egypt', NULL, NULL),
('1069588', 'https://media.elcinema.com/uploads/_315x420_5c0e349715eed17fcc506927b865fe35fad97287524334dd549a93fb015598ea.jpg', 'Youssriya Al Sayed', 'Egypt', NULL, NULL),
('1069659', 'https://media.elcinema.com/uploads/_315x420_92c066323656d72da3e345349c2ca0fd38bb090813c1ee0c3bc2d63eb17d5ca0.jpg', 'Mahmoud El Meleigy', 'Egypt', '22 December 1910', 'Mahmoud ElMeligi started his career as an actor in the Fatma Roushdy theatrical Troupe and moved between different troupes. Al-Meleegy participated in a big number of radio and TVTV works. Not only was a talented actor especially when it came to the role of the villain, but also wrote the scenario and/or dialogue of a number of films; “Al-malaak al-abyad\" (The white angel) in 1946, “Al-omm al-qaatela\" (Mother murderer) in 1952, “Segn Abou-Zaabal\" (Abou-Zaabal prison) and “Al-mabrouk\" (The blessed). In 1964 al-Meleegy received the Science and Art Medal for his lifetime achievement and the Lebanese Cedar Medal.   Although he was known for his evil roles, yet towards the end of his career he excelled playing the role of Mohamed Abu-Sweilam in Chahine’s “Al-ard\" (The Land) which uncovered his great talent.'),
('1069813', 'https://media.elcinema.com/uploads/_315x420_c033d6278ceffbb8b207f6d35565d92f0820a7d30c2d4f269cf39f5010409569.jpg', 'Farouk Naguib', 'Egypt', ' 7 March 1940', 'Farouk Naguib Mikhail was an Egyptian actor who was born in Cairo. He graduated from the faculty of arts, Ain Shams University. His talent was discovered by the legendary playwright Naguib Surur, and he presented him for the first time in his play “Waboor El Tahin” (The Wheat Mill). He was best known for his comedic roles, in which he developed his own unique method and jokes. His most successful roles were in television series, the field his career was mostly focused on. His latest famous roles were in the Yehia el-Fakharany-led-series “El Khawaga Abdel Qader” (The Foreigner Abdel Qader) and the comedy series “Hamiha Haramiha” (The Protector and the Thief).'),
('1069829', 'https://media.elcinema.com/uploads/_315x420_60a7f2c6bf00db07df2e5201f1d9fd0ec3e7e6007a71754c89c0a4e6fd533d6e.jpg', 'Fatma Roshdi', 'Egypt', '15 February 1908', 'Fatma Roshdi is an Egyptian actress who was born in Alexandria in 1908. She began her acting career at a young age, when (director) Ameen Attallah cast her in one of his acting troupe’s plays. Afterwards, she acted with a number of theater troupes, working alongside Abdel Rahman Rushdi, Sayyed Darwish, Aziz Eid, and Youseff Wehbe. Starting in the mid-1920s, Fatima starred in a significant number of plays, including: “El Sahraa’” (The Desert), “El Qan’aa El Azraq” (The Blue Mask), “El Nasr El Sagheer” (L’Aiglon), and “El Horreya” (Freedom). After separating from Aziz Eid, Fatima created her own private theater troupe, which became one of the most illustrious theater troupes. At the end of the 1920s, Fatima began her cinematic career. Her first film was “Fag’aa Foq El Haram” (Tragedy on the Pyramids) in 1928. She starred in a number of films until the 1950s, including “Thamin El Saa’da” (The Price of Happiness), “El A’mil” (The Worker), “El Tareeq El Mostaqeem” (The Virtuous Path), “Medina El Ghajer,” “El ‘Azeema” (Determination), “El Jassid” (The Body). She stopped acting at the end of the 1960s, and died in 1996 at the age of 87.'),
('1069877', 'https://media.elcinema.com/uploads/_315x420_73d917a1acb5d9cbe27611c5b78d6bf8d25cd368c733bf93f9eef62a238dba40.jpg', 'Hesham Nazih', 'Egypt', '23 October 1972', 'Hesham Nazih is an Egyptian music and film/television series score composer. He started his career in 1992, composing the scores of very famous and successful films, including Hysteria, Tito, and Elfeel El Azraq (The Blue Elephant). He also composed scores for the television series Sharbat Louz (Almond Nectar), Niran Sadiqa (Friendly Fire) and Al-Aahd (The Covenant).'),
('1070073', 'https://media.elcinema.com/uploads/_315x420_8472a5fa0d7fa3f3bcd217235fc55b58a4a68815791afd9c1fd017e2505dc265.jpg', 'Mohamed Mostafa', 'Egypt', NULL, NULL),
('1070112', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mona Saad', 'Egypt', NULL, NULL),
('1070175', 'https://media.elcinema.com/uploads/_315x420_5e0059827fb47bd0dd30cbd5438172dc5182336505d47df3738aac27facb0808.jpg', 'Thuraya Ibrahim', 'Egypt', '10 May 1939', 'Thuraya Ibrahim was an Egyptian actress. She started her career on the people\'s cultural theater in Tanta, before moving to Cairo to start landing roles in television series, then on film. She appeared in numerous productions since the late 1970s, including “Al Eshq wal Dam” (Passion and Blood), “Katkoot” and “Elhaqiqa wal Sarab” (The Truth and the Mirage).'),
('1070468', 'https://media.elcinema.com/uploads/_315x420_5e496c4d56827ebadda400dee728b8688229fcc2a81829e7c55abcca9759c673.jpg', 'Nehal Anbar', 'Egypt', ' 9 October 1961', 'Nehal Amber was born in Cairo but she would later study (high school) in the United States. She married the musician Magdy Al Husseiny but the couple later (divorced).\nAt the (university level), Nehal studied tourism.\nAmong the theatrical performances in which she has assumed roles are “Al Laaib bil Nar”, “Al Nisaa wa Al Gharib”, “Ayam Al Ghariba”.\nMoreover, she has assumed roles in the following television productions: “Al Aaila wa Al Nas”, “Souq Al Asr”, “Al Maraa Aslaha Nimr”, “Dimouaa Al Ghadab”, “Hawanim Garden City”, “Souq Al Hareem” and “Akhir Meshwar”.'),
('1070488', 'https://media.elcinema.com/uploads/_315x420_de2c47ae8429928e921a320b46405a6bd3ea023d2e2d96c17b621042da1fb5cb.jpg', 'Fadel El Garhy', 'Egypt', NULL, NULL),
('1070571', 'https://media.elcinema.com/uploads/_315x420_cdb452fad1eefb0ee119047c08c9b30f7f2c51163649106f23f07a8899df325e.jpg', 'Mahmoud Yassine', 'Egypt', ' 2 June 1941', 'Mahmoud Fouaad Yasseen was born in Portsaid. \nHe graduated from the faculty of law in 1964. One year before graduating he joined the National Theatre where he was the narrator in a number of plays: “Solaimaan al-Halaby”, “Al-Zeer Saalem”, “Daaerat al-tabasheer al Kokaazeya i.e. The Caucasian chalk circle”. He played lead roles in “Laylat masra’ Guevara i.e. The night Guevara was killed”, “Watany Akka i.e. Akka..my Nation”, “Laila wal-magnoun i.e Laila and her fool”, “Al-zeyaara entahet i.e. Visit is over”, “Ahlan ya Bakawaat i.e. Hello Sires” and “Al-Khedeiwy i.e. The Kedive”.\nDuring the seventies, Yassin became one of the most popular romantic film stars, starring in films like “Al Khayt El Rafia\'” (The Think Line), “Hob wa Kibriya\'” (Love and Pride) and “Al Rosasa La Tazal Fi Gayby” (The Bullet is Still in my Pocket). He formed a starring duo with actress Naglaa\' Fathi, making a lot of highly successful romantic dramas. \nIn the nineties, Yassin shifted his career to television, starring in series like “Abu hanifa Al Noa\'man,” “Did el Tayyar” (Against the Current), and “Souq El A\'sr” (Afternoon Market).'),
('1070603', 'https://media.elcinema.com/uploads/_315x420_790adc1720ce19b2cb6be0d93e3fc2323fb57bff58dc6662c5352196afacae69.jpg', 'Helmi Bakr', 'Egypt', ' 6 December 1937', NULL),
('1070617', 'https://media.elcinema.com/uploads/_315x420_8559ee0ac049de572e13122af12efbeefb243e6c38d8584666caacbf79ba314b.jpg', 'mamdouuh Qotb', 'Egypt', NULL, NULL),
('1070656', 'https://media.elcinema.com/uploads/_315x420_9a508a7e60503216b6cef47488738f2986648c585af38ad7f6dc03f852854df9.jpg', 'Salloum Haddad', 'Syria', '29 March 1953', NULL),
('1070745', 'https://media.elcinema.com/uploads/_315x420_de5edb74819bb67a17a4d39ad385a697ef5a67ce298c85ceb311d422ab1babe9.jpg', 'Magda El-Khatib', 'Egypt', ' 2 October 1943', 'Magda El Khatib is an Egyptian actor who was born in Cairo in 1943. She began her acting career with a small role in the film “Hob wa Delaa” (Love and Endearment; 1959). El Khatib then went on to play starring roles in a numerous films including “El Bayt El Mela’un” (The Cursed House; 1987) alongside Kamal El Shenawi. Throughout her career, she has appeared in more than 130 works and won several acting awards, including the “Golden Pyramid” for her role in “Dalal Masriya” (Dalal, The Egyptian; 1966), which was her first starring role. El Khatib also won Best Actress for her role in the film “El Tufaha” (The Apple).'),
('1070975', 'https://media.elcinema.com/uploads/_315x420_8156a8ab068c8a8b9dd1f1455867db61e6ccc146ee3694c71e201d5cfcc8422d.jpg', 'Assad Fouladkar', 'Lebanon', NULL, 'Assad Fouladkar is a Lebanese television director of Iranian descent. He studied in Lebanon, and majored in film direction in Boston University, where he also made several documentaries. He then moved to Australia to work as an assistant director in a number of sit-coms. Assad then returned to Lebanon, now working as a film critic and university teacher. After he made his award-winning debut feature “Lama Hekiet Mariam” (When Mariam Told her Story) in 2002, he went on to focus his career on sit-coms, the most famous of which being “Ragel we Set Settat” (A Man and Six Women).'),
('1070999', 'https://media.elcinema.com/uploads/_315x420_527661ece6ff7b2c4193062df980cc433a3b30c73b3ff71e9cf410d83e8c59b4.jpg', 'Tamer Ibrahim', 'Egypt', '23 October 1980', NULL),
('1071459', 'https://media.elcinema.com/uploads/_315x420_d2826f1c0877cdf32a1cdfdacbf04abbe387e1fb3ce1e56b08fc19221bbcdb80.jpg', 'Esaad Younes', 'Egypt', '12 April 1950', 'Isaad Hamed Gamal El Din is her real name and she was born in Cairo. She achieved a bachelor of tourism in 1972. Her dad who was a journalist at “Rozal Youssef” magazine was a bigig inspiration to her. She worked as a radio host at the Middle East radio station. Then she worked in the theater and became very well known after her role in the play “Al Dokhool Bel Malabes Al Rasmeya” .\nShe acted in many movies and television series some of the most famous were “Bakeeza and Zaghlool”. She married actor Nabil El Hagrasy then later on remarried a business man and created her own production company. \nSome of the most television series she worked in were Mizo’s story, A Lie, The bet, The way to Beir Sabei. She was a very successful comedian after her fantastic role in the famous play “Al Dokhool Bel Malabes Al Rasmeya” where she was involved in more comedy such as “ya Rab Walad”'),
('1071554', 'https://media.elcinema.com/uploads/_315x420_c54ffa8bf913d071b3eca61d6986031396ca744c1d836a96c4e9916de07f675a.jpg', 'Ahmed Halawa', 'Egypt', ' 7 January 1949', 'Ahmed  Salah Ragab Ramadan Halawa graduated from the High Institute of theatrical Arts. He is the nephew of late Fayez Halawa. He has achieved his PHD and is currently teaching theatrical arts at the university. He was involved in many plays such as “The High Door”, “They are Laughing” , “Isis”, “Long Live the Wafd” and “Alley of Lovers” and many more.\nHe was also involved in many television series such as “We Won the Case”, “Fasting and God only knows”, “The Way to Jerusalem”, “ Tears in bald Eyes” and his infamous role in the series “Raafat El Hagaan” part 2 where he played as an Israeli officer called “Bekhoor Shatreet”'),
('1072084', 'https://media.elcinema.com/uploads/_315x420_525c52a67573787581df7a14c2db0441c72515c25264c569621bd7d161633b95.jpg', 'Mohamed Refaat', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1072130', 'https://media.elcinema.com/uploads/_315x420_a7802f68df7524de1d0e176092a4a330fce00657b0706597cd782f9671ea7242.jpg', 'Abdelrahman Abo Zahra', 'Egypt', ' 8 March 1934', 'Abdul Rahmaan Abdul Rahmaan Mahmoud Abu-Zahra is an Egyptian actor and director who was born in Damietta (Delta of Egypt). He is married (1962) with three children; May, Sahar and Ahmad. His first stage role was “’Awdat al-shabaab i.e. The rejeunesse” than he participated in may plays like; “Telmeeth al-shaytaan i.e. The devil’s student”, “Masra’ Cleopatra i.e. The death of Cleopatra”, “Bedaaya wa nehaaya i.e. Dead among livings”, “Sanf al-hareem i.e. Women”, “Afraah al-anthaal i.e. Joys of bastards”, “Al-lahza al-harega i.e. The critical moment”,”Al-mawt ya’khoth agaaza i.e. Death takes a holiday”, “Fee baytena ragol i.e. A man in our house”, “Shakka lel-‘eegaar i.e. A apartment for rent”, “Al-mahroussa”, “Don Juan”, “Al-kadeyya i.e. The case”, “Hallaak fee Baghdaad i.e. A barber in Baghdad”, “Yasseen and Baheyya”, “Al-dafaade’ i.e. The frogs”, “Beer al-sellem i.e. The stairwell”, “Al-farafeer”, “Halaawet zamaan i.e. That sweet time”, “Mas-houk al-thakaa i.e. The intelligence powder”, “Zahrat al-sabbaar i.e. The catus flower” and “Masra’ Guevara i.e. The death of Guevara”. Abu-Zahra also directed the play “Faylassouf i.e. Philosopher” and staged it on the National Theatre.\nAbdul Rahmaan played a number of TV series and drama, among them are; “Sanawaat al-dehk wal-domou’ i.e. Years of laughter and tears”, “Al-sokout fee Be’r Sab’ i.e. Falling in Beersheba”, “Nehaayat al-‘alam layssat ghadan i.e. The end of the world is not tomorrow”, “Lan a’eesh fee gelbaab aby i.e. I will not live in my father’s robe” and “Lamma al-ta’lab faat i.e. When the fox passed”.  Abdul Rahmaan Abu-Zahra presented the children radio show “Sondouk al-donya i.e. Pandora’s box” for more more than twenty years.'),
('1072283', 'https://media.elcinema.com/uploads/_315x420_3ee51e2d0d9c614e36bb8d40beefba05ec1aedc76b644a087a532aef2a86f8a0.jpg', 'Amir Ramses', 'Egypt', '12 October 1979', 'Amir Ramses is an Egyptian director. He was born in 1979, and graduated in 2000 from the High Institute of Cinema. He directed numerous short films and documentaries. He also worked as an assistant director and producer in several independent films. He is best known for directing the two-part documentary \"Jews of Egypt\" and the feature film \"Betawqit Elqahera\" (Cairo Time).'),
('1072328', 'https://media.elcinema.com/uploads/_315x420_0c14ced1a56b52b2a48339c1d78ecc6bd26c9587c1392239343d1157999c4996.jpg', 'Amal Abu Shadi', 'Egypt', NULL, NULL),
('1072547', 'https://media.elcinema.com/uploads/_315x420_e27dae4ed7911beb27d63d4c0703a3e3c766eb3affeafd8b3fb49e746d6df11a.jpg', 'Samia Gamal', 'Egypt', ' 5 March 1924', 'Samia Gamaal was an Egyptian belly dancer and actor. She was born in the village of “Youn al-kass”- Beni Sweif . In 1940, Samia joined Badee’a Massabny troupe where she participated in group dancing. After that, she played small roles in many films and succeeded to play lead roles next to Muhammad Abdul Mottaleb and Nagueeb al-Rihaany.\nSamia performed in “Entessaar al-shabaab i.e. Triumph of the youth (1941)” where she danced in the finale sketch and appeared in a scene with Fareed al-Atrash. Samia together with Fareed formed a successful duet starting with the film “Habeeb al-‘omr i.e. The love of my life (1946)”. Through five famous films; “Ahebbak enta i.e. I love you only (1949)”, ”’Afreeta Haanem i.e. Little Miss Devil (1949)”, “Aakher kedba i.e. The last lie (1950)”, “Ta’aala sallem i.e. Come and say hello (1951)” and “Ma t’olsh le had i.e. Don’t tell anyone (1952)”, where Fareed sang his own melodies and Samia danced her great dances. They fell in love, yet not married and left each other. Samia costarred in a dozen of films with many of the well known actors of that period such; Muhammad Abdul Muttaleb, Nagueeb al-Reehaany, Muhammad Fawzy, Abdul Azeez Mahmoud..etc\nLater on, Samia played lead roles next to famous vedettes as Kamaal al-Shennaawy, ‘Omar Sharif, Mahmoud al-Meleegy, Anwar Wagdy, ‘Emaad Hamdy, Yehia Shaheen, Youssef Wahby, Ahmad Maz-har and Shoukry Sarhaan.\nIn late 1950s, Samia married superstar Roushdy Abaaza and they featured together a number of films, including; “Al-ragol al-thaany i.e. The second man (1959)”, “Tareek al-shaytaan i.e. Devil’s path (1963), “Saa’at al-sefr i.e. Zero hour (1972)” and “Al-shaytaan wal-khareef i.e. The devil and the fall (1972)“, in which Samia was dedicated to acting more than dancing.\nSamia\'s charismatic performances in Egyptian and international films gave Oriental Dance recognition and admiration in Egypt and worldwide.'),
('1072719', 'https://media.elcinema.com/uploads/_315x420_d7605c38ee64e88f34a1b0f7f81be89171d0dd7acd421866919f3bf010f065ce.jpg', 'Mohamed Eltohamy', 'Egypt', NULL, NULL),
('1073101', 'https://media.elcinema.com/uploads/_315x420_44c82955b4b611bf9c810200dd631434f490ad150968f52185a8351a0666eeec.jpg', 'Menna Galal', 'Egypt', ' 7 June 1982', NULL),
('1073302', 'https://media.elcinema.com/uploads/_315x420_20ed06cbd89ea202a0ed8582381af760b2459a559e159fda3cae99a8fbcc43ac.jpg', 'Laila Gamal', 'Egypt', ' 1 August 1944', 'Laila Gamal is an Egyptian actress. She was born in Alexandria in 1944. She worked mostly in television dramas, picking up supporting roles in series like “Hawanem Garden City” (The Ladies of Garden City), “Mirath Alreeh” (Inherit the Wind), and Ragel we set Setat” (A Man and Six Women). She dies in 2014 at the age of 70 due to complications of lung cancer.'),
('1073339', 'https://media.elcinema.com/uploads/_315x420_cc2d47f6141c35de17884a9217b720995ac88d8f3f92f99e287c4e84977e02b6.jpg', 'Ahmed Allam', 'Egypt', '20 July 1899', NULL),
('1073426', 'https://media.elcinema.com/uploads/_315x420_cc65058f9e069c49a83abdd40e011e8fc9e697978b1aeac7cf3a2846ebe753d8.jpg', 'Youssef Al-Assal', 'Egypt', '14 May 1947', 'Youssef El Assal worked at an airline company and can speak more than one language fluently. His wife is a relative of the actress Nelly. At the beginning of his career, directors usually chose him to play the role of the “foreigner” due to his knowledge of English and French and the fact that he looks foreign. He has also been cast as police and airforce officers.'),
('1073456', 'https://media.elcinema.com/uploads/_315x420_655292661a75fe0d0a7b695e6b66ec250b2564995d2a6416a684617d38306432.jpg', 'Sayed Sadek', 'Egypt', '18 June 1945', NULL),
('1073515', 'https://media.elcinema.com/uploads/_315x420_cff13731d650afece44639dce4eca7db1d17158e4c5ae96c4ac80d6182c293ba.jpg', 'Mona Rabie', 'Egypt', NULL, NULL),
('1073580', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Nadia Seddiq', 'Egypt', NULL, NULL),
('1073676', 'https://media.elcinema.com/uploads/_315x420_2bbc4a7e125883ab6536151d51c66062c9248a4930be3d2fdc2a9f8e10dcb1e6.jpg', 'Yasmin Abdulaziz', 'Egypt', '16 January 1980', 'Yasmin Mohamed Abd Al Aziz was born in Cairo (where her father worked as a hotelier). She enrolled in (the Modern Academy) in Maadi and began her television career at the age of five with appearances in commercials. Yasmin was (recruited into the industry through a friend of her mother’s who managed an advertising production firm). \nThereafter, Yasmin was (nominated for roles in cinematic and television productions). Thus, she performed on the television series “Imraa min Zaman Al Houb”. That production achieved a great measure of success and brought Yasmin’s talents to the attention of the public. Whilst a student at the Modern Academy in Maadi, Yasmin also (partook) in the trivia show “Al Aiyal Itganinit”. (Most of her roles have had her assume the character of a mischievous girl).'),
('1073679', 'https://media.elcinema.com/uploads/_315x420_48b2a7227739fe1b2c96a909ef7858e994633bc117fc267980629cdff46ac757.jpg', 'Mohamed Mourad', 'Egypt', ' 4 June 1972', NULL),
('1073717', 'https://media.elcinema.com/uploads/_315x420_63af271c0bda2ed1fb8921468720d0bdb91c16b5f1e37bd4ce72b9914aef3419.jpg', 'Safia El Emary', 'Egypt', '20 October 1949', 'Safiyah Mustafa Mohamed El Imary is a performer that has taken part in television and cinema productions. She was born in the city of Al Mahala Al Kubrah and earned a bachelor’s degree in commerce.\nShe has studied Russian and worked as a translator in international conferences. \nShe was discovered by the (performer) Galal Issa, they got married and had two children.\nAmong her theatrical works are “Fananah Mutazilah”, “Al Malak Al Azraq”, “Rajil Mafeesh Minho”, “Al Bahr Beyadhak Leih”, “Tisbah Ala Kheir ya Habat Einy” and “Muzakirat Mumathila”.\nShe worked (alongside) Al Sayed Bedeir in the television series “Al Qalb la yamtalik Zahaban” and her performance was outstanding in the “Layali Al Helmiya” television series which included “Al Shatee Al Mahjoor”, “Hawanim Garden City”, (“Abyad fee Abyad”), the opera “Aida”, “Baad Al Toufan”, and “Khan Al Qanadeel”.\nShe was selected as the United Nations ambassador in the Middle East (in 1997).\nShe has assumed several secondary roles in several cinematic roles. The director Youssif Chahine was perhaps the one who profited most from her ability to perform in “Al Mohajir” and “Al Maseer”. Her performance was also noteworthy in “Al Muwattin Al Masry”.'),
('1073836', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed Rizk', 'Egypt', NULL, NULL),
('1074022', 'https://media.elcinema.com/uploads/_315x420_dadc4a3f16470de208b6dfc07e879bd8afa75d0b927d6b16e6ffdd0e0c3c1e91.jpg', 'Layla Olwi', 'Egypt', ' 4 January 1962', 'Layla Alwi is an Egyptian actress, born to an Egyptian father and a Greek mother. Her full name is Leyla Ahmed E’lwy and her career began when she was still quite young with Abla Fadeela at the Radio broadcast and Mama Samiha on children programming on television. Leyla studied at French schools and graduated in 1991 from the faculty of commerce. She took small parts in films as a child and performed in several titles. Nour el-Shereef noticed her talents on stage. Leyla took part in the television series “Dimoo’ Fawq al-Haqiqa” (“Tears Over the Truth”) in her first television role as a mature actress. Among the stage productions which she has taken part in are “al-Brenseesa” (“The Princess”), “Gamilla wa Wahshayn” (“Two Beasts and a Beauty”), “Baklarious fee Hokm al-Sha’b” (“A Degree in Governing the People”), “8 Sittat” (“8 Women”) and “Sahlab”. Her television performances have included “al-‘Aaila” (“The Family”), “al-Tawaam” (“The Twins”), “’Atfet Khoukha”, “Teyoor al-Sayf” (“Birds of Summer”), “Akho al-Bannat” (“Brother to the Girls”), “Ta’aaly Nahlam bi Bokra” (“Let’s Dream of Tomorrow”) and “Alf Leyla wa Leyla” (“One Thousand and One Nights”). \nLeyla has received numerous film awards and has worked as a producer on the film “Ya Mihalabiya ya”. The actress was also honored at several festivals including the Love Festival of 2002. She could be considered among the most intelligent actresses in her generation and her performances were particularly memorable in “al-Muzniboon” (“The Guilty”) and “Kharag wa lam Ya’od” (“He Left but did not Return”).'),
('1074059', 'https://media.elcinema.com/uploads/_315x420_69618e58606e0e82c22b2d7486a99bfda6b8e8860cc81f23e59f07abbe39a0c8.jpg', 'Khairy Hassan', 'Egypt', '24 February 1952', NULL),
('1074068', 'https://media.elcinema.com/uploads/_315x420_c6dd54f6551180d214c55fb8a168beaf7c77f57e71e5538c67e84cf0322333ac.jpg', 'Ahmad Rateb', 'Egypt', '23 January 1949', 'Ahmed Kamal Eldin Rateb was born in the Sayeda Zaynab neighborhood of Cairo. His interest in acting began at an early age, where he performed in most of his school plays. He continued to act in college, where he was enrolled in Cairo University, College of Engineering, but quit after 2 years to pursue his passion for acting, and joined the High Academy of Arts, graduating with a degree in performing arts in 1974.\n\nHis first work was in the TV series \"Fagr (Dawn)\" after which he had many roles in plays, the most notable of which was \"sok ala banatak (Beware of Your Daughters)\"\n\nHis TV series work includes Bilad elGhorba, Elmal wal Banoon, Elabtal, and Om Kalthoum, in which he won many awards for his realistic portrayal of the legendary violinist Mohamed el Asabgy.\n\nHe married his cousin in 1978 and has 3 girls, Lamia, Lobna and Lameece. \n\nAlthough he is famous for his comedic roles, especially alongside fellow actor/comedian Adel Imam, Rateb has many distinguished roles in more dramatic works such as his role as a political patriot in \"Toyoor elZalam (Birds of Darkness)\" and other works such as \"Ya rab walad\" and \"Akhir elregal elmohtarameen\"'),
('1074168', 'https://media.elcinema.com/uploads/_315x420_dd9a3e1050332ffc0c660b2c87a019d843df40dcbb7087de613ad3085d07ea9e.jpg', 'Maya Nasry', 'Lebanon', '14 August 1976', NULL),
('1074180', 'https://media.elcinema.com/uploads/_315x420_8a08f55923d4636f02affc967aebcf29582f3b6a1d951028ec8f4a7f23868c42.jpg', 'Sabrin', 'Egypt', ' 4 October 1967', 'Sabreen was born into the household of ‘Akef which excelled at circus stunts. She is the niece of actress Na’eema ‘Akef. Sabreen took part in acting, acrobats and oriental dance whilst a child. Thereafter she acquired a degree in philosophy before taking part in several television series such as “Halla wa Derwish”, “Rihlat Abou al-‘Ella al-Bushry” (“The Journey of Abou al-‘Ella al-Bushry”), “Leilat al-qabd ‘ala Fatma” (“The Night of Fatma’s Arrest”), “al-Donnia Warda Baydaa”, “Dameer Abla Hekmat” (“The Conscience of Mrs. Hekmat”), “Omm Kalthoum” and “Al-liqaa al-Thanee” (“The Second Rendezvous”). Her stage performances include “Hammra Gamrra” and “Atfal al-Shaware’” (“Street Children”).\nSabreen married a businessman and bore him a son.'),
('1074207', 'https://media.elcinema.com/uploads/_315x420_0fc8a40a72ad83bfbfcc7aa452aabcdd7f8102d9ddc3ad7754156c1824b53ae9.jpg', 'Alvise Orfanelli', 'Egypt', ' 1 January 1901', NULL),
('1074237', 'https://media.elcinema.com/uploads/_315x420_fab059ef76ebcf67aeb215a7c624c8eba97941853fea514703b16dd2700a7cf6.jpg', 'Moataz El Kateb', 'Egypt', NULL, NULL),
('1074816', 'https://media.elcinema.com/uploads/_315x420_ca8f7eb401cdc7428af66b7e35cd797055e1100a3b8ec72bdee21aedd0ce6eff.jpg', 'Ola Ghanem', 'Egypt', '26 November 1971', 'Ola Ghanem was born in Cairo. Her father worked as an architect while her mother was an interior designer. Ola graduated from the Photography division at the Faculty of Fine Arts in 1994 but elected not to continue her studies at the Institute of Theatrical Arts. She came to the public’s attention through her involvement in Mohamed Fouad’s song “Hansaak” (“I will Forget You”). Ola has also appeared on TV commercials. The television productions in which Ola has assumed roles include “Al Qalb Yakhtea Ahyanan” (“The Heart is Sometimes Wrong”), “Zizinia”, “Ahlam Wardieh” (“Rosy Dreams”), “Jissr al Khatar” (“A Bridge to Danger”), “E’qal ya Majnoun” (“Wise Up”). Ola realized fame after taking part in an exceptional television production that was titled “Amakin fee Al Qalb” (“Places in the Heart”). Aside from her television appearances Ola has also acted in a play titled “Al Tayyib wa Al Shereer” (“Good and Evil”). She recently starred in \"El Brinseesa\" (The Princess).'),
('1074856', 'https://media.elcinema.com/uploads/_315x420_06c600e1b1e11561a91c4e65ef3f8b7bec0b694e57c95d3e38e6981a2ba329d5.jpg', 'Afaf Mustafa', 'Egypt', '17 November 1960', NULL),
('1074887', 'https://media.elcinema.com/uploads/_315x420_7155c3642f3180b25a6a457c76668fe474ac62cf793487c09e8d8b6a67d045c5.jpg', 'Ahmed El Fishawy', 'Egypt', '16 February 1980', 'Ahmed El Fishawy is an Egyptian actor, and the son of actor Farouq El Fishawy. He started acting at the age of nine, debuting alongside his father in “Al Morshed” (The , appearing in small roles in several films, among which was “El Batal” (The Champion) with Ahmed Zaki in 1998. His breakthrough came with his role in the television series “Wagh Elqamar” (The Moon\'s Face) alongside Faten Hamama in 2000. He then appeared in the epic television drama “Hadith Elsabah wal Masaa\'” (Morning and Night Dialogue) in 2001, and “El Amma Nour” (Aunt Nour) in 2003 alongside Nabila Ebeid. His first lead role on television was in the series “Afarit El Sayala” (The Ghosts of Sayala), after which he landed his first lead role on film in Ahmed Mekky\'s action comedy “El Hasa Elsabaa” (The Seventh Sense). His most successful roles include the multi-season sit-com “Tamer we Shawqyea” (Tamer and Shawqeya) and the thriller/drama film “45 Youm” (45 Days).'),
('1075183', 'https://media.elcinema.com/uploads/_315x420_8eae8429aef4c447c61581f4a1c8a96bad8a55b5d836cbbf838dd4759cfd1416.jpg', 'Gihan Fadel', 'Egypt', '11 March 1973', 'Jehan Fadel is an Egyptian actress who was born in Cairo to a father who worked as an architect and a mother who worked as a college professor. Jehan graduated from the American University in Cairo. Her talents were first noticed by director Kheiry Bushara while she was still a student at college. Kheiry presented Jehan in his 1992 cinema title “Ice Cream fee Gleim” where she acted alongside the Egyptian musician and actor ‘Amr Diab. Thereafter Jehan transitioned to television roles.'),
('1075293', 'https://media.elcinema.com/uploads/_315x420_d43ee3089d4a3f37ac8159978fe46b5f5cdd0351723c2108a7e5199944a2e907.jpg', 'Fifi Abdou', 'Egypt', '26 April 1953', 'Feefy A’bdu is an actress and dancer that was born in the governorate of al-Manoufiyah. She began her career as a dancer as part of the folklore group “A’akef” and thereafter appeared as a dancer on cinema productions before being assigned a leading role in the Enaas al-Daghdaghy’s title “Imraa Wahida la Takffy” (One Women Is not Enough). Amongst her theatrical productions are “Shabbab Imraa” (1979), “Hazimny Yaa” (1992), “Ishta wa A’asal” (Honey and Cream) and “Edla’y ya Dousah”. The performer has also taken part in several television productions which include “al-Aanissah Kaf” (Lady K), “Ma zal al-Neel Yagry” (The Nile Still Runs) and “Wazeer fee al Jibss”. Feefy is married to Jordanian businessman Mohamed al-Deedarry.'),
('1075398', 'https://media.elcinema.com/uploads/_315x420_211d3162d92065de288434ea9c5ed9ffdf9896903a96277d83352e38f10cf1b3.jpg', 'Saeed Hamed', 'Sudan', ' 5 February 1958', 'Sudanese, born in February 5 1958 – Khartoum, studied cinematography editing at the Higher Institute of Cinema. Started his career as assistant director with many notable Egyptian directors like Saad Arafa, Muhammad Khaan, Sherif Arafa and Raafat al-Meehy in films “Waad Maktoub i.e. Destined”, “Al-mouled”, “Samaa Hoss i.e. Shhhht”, “Al-le’b maa al-kobaar i.e. Playing with the big guys” and “Ya mahalabeyya ya”. 1989 witnessed his first film as a director “Al-hobb fel-tallaaga i.e. Refrigerated love”. Nine years later, directed the box office record breaker “Saeedy fel-gamaa al-Amrikeyya i.e. Upper-Egyptian in the AUC” starring Muhammad Heneidy. Heneidy starred other films by Saeed Hamed like “Hammaam fee Amsterdam i.e. Hammaam in Amsterdam” and “Ga’ana al-bayaan al-taaly i.e. Breaking news”, other films “Short we fanella we cap i.e. Shorts, T-shirt and cap” and “Tabbaakh al-rayyes i.e. President’s cook”.\nHe also directed two TV series Hanaan Turk’s “Haanem bent pasha i.e. Her highness” and Heshaam Seleem’s“Ekhtefaa Saeed Mahraan i.e. Disappearance of Saeed Mahraan”.'),
('1075529', 'https://media.elcinema.com/uploads/_315x420_8785416928e87b0dbbd1f5b94e430ae0210e9c51eb8da572dd80f392067ef24d.jpg', 'Shorouq', 'Egypt', '20 March 1952', NULL),
('1075555', 'https://media.elcinema.com/uploads/_315x420_5133a26fd0c4050c1ff37b849cfd1551dbaea63baace581b7dc072930b793f13.jpg', 'Atef Shokry', 'Egypt', NULL, NULL),
('1075657', 'https://media.elcinema.com/uploads/_315x420_5aa2c14a8a7a32c0a69690ec8b7310bd758de99857594cc35be67570cf337426.jpg', 'Onsi Abo Sief', 'Egypt', NULL, 'Onsi Abo Seif is an Egyptian set designer and art director. He graduated from the High Cinema Institute in 1967, and worked at the start of his career as an assistant designer in Shady Abdel Salam\'s \"Al Mumya\" (The Mummy). The next year, he worked as a set designer on the film \"Yawmiyat Naa\'ib fil Aryaf\" (Diary of a Delegate in the Countryside). Abo Seif\'s filmography includes numerous landmarks of Egyptian cinema, like \"Eskendereya Kaman we Kaman\" (Alexadnria Again and Again), \"El Kit Kat\", \"Araq El Balah\" (Date Wine), \"Ayam El Sadat\" (Sadat\'s Days) and \"Rasa\'el Elbahr\" (Messages of the Sea).'),
('1075716', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد طاهر', 'Egypt', NULL, NULL),
('1075813', 'https://media.elcinema.com/uploads/_315x420_02277baa00f16ff2dfcecfbd2b3a90e784a87c95e76671a0e365cbc3077ed480.jpg', 'Wahid Farid', 'Egypt', ' 2 August 1919', NULL),
('1075828', 'https://media.elcinema.com/uploads/_315x420_eb6681d06b3103305fada5b170ffbb3668c1d20ccf580a6e5ff70d4e4c7a3ed0.jpg', 'Wael Nour', 'Egypt', '24 April 1961', 'Born Waael Muhammad Salaaheddeen Morsy, Waael Nour is an Egyptian actor who completed his studies at the High Institute of Dramatic Arts after graduating from the Institute of the Secretariat. He pursued an acting career playing mostly the roles of the naughty and the corrupt young man. Waael starred with actress Sherihan in the film “Kafas al-Hareem i.e. Harem cage” and has played a memorable role in the film “Al-hobb fee Taba i.e. Love in Taba”.\n“Al-bakheel wa ana i.e. The miser and me”, “Saaber ya ‘amm Saaber i.e. How patient is Saaber!” and “Khayaal ‘aashek i.e. A lover’s silhouette” are among his famous TV series.\nWaael played a number of stage roles, the most prominent is “Al-ganzeer i.e. The chain”, written by Muhammad Salmaawy and directed by Khaaled Saeed. Although absent from the film and television scene for years, Wael has managed to maintain a stable career in theater and is still leading plays in private and public theaters.\nHe was married to actor Ameera al-‘Aidy.'),
('1075832', 'https://media.elcinema.com/uploads/_315x420_a4da326bd76601449b061904466670d5a41c03a6db3e9d23729c1de053b474e1.jpg', 'Mostafa Shaaban', 'Egypt', '19 May 1970', 'Mostafa Shaban was born in Cairo. He received his bachelors degree from the Media Faculty at Cairo University in 1975. Whilst a student, Mostafa had directed some college productions. In his stage acting debut Shaban appeared alongside Mohamed Sobhy in the production “Bil’arabi al-Faseeh” (“In Standard Arabic”). He received the award for best actor from the Film Association for his role in “Fatta men Israel” (“A Girl from Israel”). He also received an award for “al-Sharq” (“The Orient”) from the Alexandria Film Festival.\nShaban has taken part in the television productions “Ahlam Moajjala” (“Deferred Ambitions”) and “’Aailat al-Hajj Metwally” (“The Household of al-Hajj Metwally”) and in the play “Tihib Tishoof Massa”.'),
('1075923', 'https://media.elcinema.com/uploads/_315x420_587bea68ef2eedc2e62749de023547edb3fd679876305766999448804ee15bc8.jpg', 'Magdy Abd-Elmessih', 'Egypt', NULL, NULL),
('1075939', 'https://media.elcinema.com/uploads/_315x420_b33bf66fa8686ae8f45d3d3abf63e9ec2bdbbe648acfce121b262ae654348d9b.jpg', 'Abdallah Saleh', 'United Arab Emirates', NULL, NULL),
('1076031', 'https://media.elcinema.com/uploads/_315x420_04e6ff0efbbe5161f5d15df31379f209a4635336a7f0d7b4eeca7902a4ce65e4.jpg', 'Mostafa Al-Shamey', 'Egypt', ' 2 August 1944', 'Moustafa al-Shaamy is an Egyptian actor who started his career through small roles in a number of films; “Mak’ad begewaar al-Shaytaan i.e. A chair beside Satan”, “Azwaag taaeshoon i.e. Stray couples” and “Ommahaat fee al-manfa i.e. Mothers in exile”. He also participated in a number of TV series; “Mata tabtassem al-Domoue’ i.e. When will tears smile” and “Dedd al-tayyaar i.e. Against the stream”. During his 30 year of acting, Moustafa participated in important works and earned a big number of awards. His last role was in the TV series “Abu dehka genaan i.e. The man with the fascinating laugh” which tells the story of the late comedian Esma’eel Yasseen who was a phenomenon among Arab comedians.'),
('1076150', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'باسل حسام', 'Egypt', NULL, NULL),
('1076374', 'https://media.elcinema.com/uploads/_315x420_26996f2726c79dbc474249d25d1eec1bed68574c11209825d2c55824af6f06f6.jpg', 'Lamiaa El-Amir', 'Egypt', '27 August 1957', NULL),
('1076376', 'https://media.elcinema.com/uploads/_315x420_451e264e131c9150a4a42616a715ca41643471141dfcb3c00c8ccf9d6d2b72d6.jpg', 'Khaled El Hagar', 'Egypt', ' 3 January 1963', 'Director Khaled El Hagar graduated from Law School 1987 from Cairo University. He worked as an assistant to the legendary director Youssef Shaheen.\nLater on he went to study cinema at Beaconsfield in the UK and graduated from that in 1994.\nKhaled El Hagar was one of the lecturers in the Berlin workshop for young talents as the only Egyptian to do so.\nHis films were playing in almost 150 international film festivals such as Caan, Montreal, Rotterdam and New York. He won 27 awards both internationally and nationally.'),
('1076383', 'https://media.elcinema.com/uploads/_315x420_9abbc7c920f87d1892d07b87dafc81435e0b6f027050e45f610267a65c77ef9c.jpg', 'Omar Hassan Yousuf', 'Egypt', '19 August 1980', 'Amr’s parents are the (performers) Hassan Youssef and Shams Al Baroudy.\nHis first acting role was in the film “Shareaa 18” where he achieved moderate success which paved the way for future roles.'),
('1076411', 'https://media.elcinema.com/uploads/_315x420_b707f5601eda484898a9588736e6001e0309b1867c34526098dfb2631c762124.jpg', 'Ehab Rady', 'Egypt', '12 February 1969', NULL),
('1076604', 'https://media.elcinema.com/uploads/_315x420_3c24ee9c347146adf7e144dc5072859827acbb8412113b89794c72af40966122.jpg', 'Olfat Sukkar', 'Egypt', '27 December 1942', NULL),
('1076659', 'https://media.elcinema.com/uploads/_315x420_d868de836ed41c3883fafebd0e7724240c44c4b09ead90976536a6bd048b65c1.jpg', 'Salah Marei', 'Egypt', NULL, NULL),
('1077196', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'رباب عبداللطيف', 'Egypt', NULL, NULL),
('1077324', 'https://media.elcinema.com/uploads/_315x420_14c5cca3219713b43633c13d84671f15e077dd7cb677011820d06588413b66ca.jpg', 'Juma Abdullatif', 'Egypt', '21 June 1968', NULL),
('1077335', 'https://media.elcinema.com/uploads/_315x420_089ceb3f86d215447a30a13d743f1c9f01cdc52ae2508ec90b966e592295887b.jpg', 'Safaa Jalal', 'Egypt', '20 February 1974', 'Elle est diplômée de la Faculté des Arts, Université d\'Alexandrie. Elle  a commencé sa carrière artistique depuis son entrée dans l\'université, où elle a été découverte par le réalisateur de publicité Georges Dawes et il l’a recommandée  pour la représentation d’un rôle dans une pièce mise en scène par Galal El Charkawy, qui a attribué son nom à Safaa pour que son nom artistique devienne Safaa Galal, et de là était le début d\'un d’un chemin fructueux de rôles distincts, en effet elle a travaillé avec un grand nombre de d’acteurs géants en Egypte, y compris Kamal El Chénawi, Fouad El Mohandess, Maali Zayed. Ses rôles ont varié de la jeune fille saidienne, la jeune fille, ou la bien aimée et elle a ajouté encore à ses rôles du drame à la comédie.'),
('1077607', 'https://media.elcinema.com/uploads/_315x420_c717138e33e64c60ff2ca40bc1ffb30fa74d3ed2d1e7f8d473fd1834fb2bfd39.jpg', 'Amr Diab', 'Egypt', '11 October 1961', 'Diab is the best-selling Arab recording artist of all time, according to Let\'s Go Egypt. He was awarded the World Music Award for Best Selling Middle Eastern Artist four times: 1998, 2002 , 2007 and 2009. He has also sold over 50 million albums worldwide.\n\nAmr Abdel Basset Abdel Azeez Diab was born October 11, 1961 in Port Said. His father was an accountant and his mother a French teacher. Both his parents encouraged their children to sing from a young age. Amr sang for the first time in public radio on a national holiday (Galaa’ Day) where he sang the national anthem in 1968.  The mayor of Port Said awarded him with a guitar for his efforts. Amr was only 6 years old at the time.\n\nDiab studied music at the art academy in Cairo, performing with his band “Mo Music.” He moved to Cairo in 1982 to study at the High Institute of Arabic Music. He taped his first song “Time” in 1983, but it was never officially released. In 1983, Diab released his first studio album, “The Road.” He graduated from the institute in 1986. Diab released three more albums between 1984 and 1987. 1988\'s \"Mayaal\" garnered huge success all around the Middle East. It was produced, arranged and remixed by German musicians, Frank Von Dem Bottlenberg and Jörg Evers, with various releases. More success followed in the following years including the albums Shawakkna, Matkhafesh, and We Yloumouni. By 1992, he became the first Arabic artist to start making high-tech music videos.\n\n\"Habibi Ya Nour el Ain\" from Diab\'s 1996 album, Nour El Ain became a worldwide hit, and was remixed by many of the world\'s top DJs. Diab\'s album El Leila De was released in the summer of 2007 and topped the Arabic music charts for 22 weeks. Diab received a World Music Award for Best Selling Middle Eastern Artist for the album. In 2008, Diab renewed his contract with Rotana for five more years. In 2009, Diab released a new album Wayah.'),
('1077679', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Medhat Nassar', 'Egypt', NULL, NULL),
('1077680', 'https://media.elcinema.com/uploads/_315x420_c716b005036afcb96c775dc8fa44215afad328de7597d8855109f6ecdab7add0.jpg', 'Riham Abdulghafour', 'Egypt', ' 6 September 1978', 'Reham Abdel Ghafour was born in Al-Mahalla al-Kubra in 1978. She is the daughter of Egyptian actor Ashraf Abdel Ghafour and she studied in the College of Commerce (English Section). Reham starred in the film  “Saaheb Sahbo” (Best Friends), alongside Muhammad Heneidy and Ashraf Abdul Baky. She also appeared in numerous television series including, “Al Aiela wal Naas” (Family and People), “Hadeeth Al Sabaah wal Massaa” (Day and Night Talk), and “Zizinia.” With regard to cinema, Reham has appeared in films such as, “Malaky Eskendereyya” (Malaki Alexandria), “Kaan Yowm Hobbak” (The Day of Your Love), “Gaay fel Sareea” (I’m coming!) and “Bel-Araby Cinderella” (Cinderella in Arabic). She always appeared with Yahia al-Fakharaany in a theatrical performance of “Al Malek Lear” (King Lear).'),
('1077842', 'https://media.elcinema.com/uploads/_315x420_99256be9e83f7a2e91d27fa03c1c28be6ebec29837cdf57288c8021c8b68e476.jpg', 'Amina', 'Egypt', ' 6 December 1971', 'Born in Alexandria, on the 6th of December. Graduated from Egyptian Arts Academy (Acting and Directing Department) . Her real name is \" Wafaa Mohamed Naeeam\" but she chose the name of \"Aminaa Alfakharani\" in 1999, when she joined \"High Quality\" production company to be one of its Stars with Producer Tarek Abdallah… she chose the name Aminaa because of the resemblance her voice carries to an Algerian Singer called Amina . When she was at the Academy, she participated in many plays. As she wanted to be an actress originally, She started singing by chance, when she was somewhere with her friends and they asked her to sing and one of them was the Poet \"Ahmed Sheta\" who took her next day to the producer Tarek Abdallah, who was already impressed by her voice and signed a contract. She then Participated with a group of singers in the album \"High Quality 7\". Her song was \"Uday al-Ghazal\" written by Ahmed Shata and composed by \"Hussein Mahmoud\" . After that she filmed the song \"Maine\" which had great success. Her Supreme ideals are Ahmed Adaweya , Mohamed Alezaby and Mohamed Roshdy . Won Best Arabic song “Baladna\" in 2011 with Lebanese Singer Hisham Alhag at Mourex D’or . Won Best Single at Oscar Art in 2008.\"'),
('1077845', 'https://media.elcinema.com/uploads/_315x420_ab61824ba47e686104299c7a0aaf4c22fe9d9071dd47f713a027a84a9571e76b.jpg', 'Mahmoud Hemeida', 'Egypt', ' 7 December 1953', 'Mahmoud Hussein Hemeida earned his bachelor’s degree in commerce in 1981. He is married and has four daughters.\nMahmoud’s acting career began with performances on television. He participated in the series “Harat Al Shurafa” and “Al Wassiyah”. His performance in that last series drew a lot of praise and acclaim for his talents and marked the beginning of his rise as a star.\nThe start of Mahmoud’s cinematic career began with (his performing a leading role alongside Ahmad Zaky) in the film “Al Embrator” (1990). Mahmoud has also founded a production company that has released several films including “Janat Al Shayytan”.\nMoreover, Mahmoud has also founded an (entertainment) magazine titled “Al Fann Al Sabeaa”. \nMahmoud has proved his uniqueness in his ability to embody the characters he is assigned and can be seen in his best form in “Faris Al Madinah” and “Aafarit Al Asfalt”. \nInas Al Deghidy (has offered him a role representing a very masculine character) in “Dantella”.'),
('1077955', 'https://media.elcinema.com/uploads/_315x420_bc62c8bb829f2bb29f27066b0fff4fb849928692cdccebb99e61ea62c319f44c.jpg', 'Mostafa El Tokhy', 'Egypt', NULL, NULL),
('1078019', 'https://media.elcinema.com/uploads/_315x420_b2ecdc5332ecba8846be09fb723da4def11c3aef1b376e070ba7ae9f1b156fb6.jpg', 'Hind Rostom', 'Egypt', '12 November 1931', 'Rostom’s first appearance on cinema was in a role as an extra in 1954 whereby she appeared in only two scenes as an odd-acting girl in a film titled “al-Sittat ma Biya’rafoosh Yakdiboo” (“Women don’t know how to Lie”), the title was directed by Mohamed ‘Abd al-Gawwad. The film starred Shadya, Isma’il Yasseen and Shokry Sarhan. Prior to having roles as a voiced extra Rostom was assigned roles as a silent extra who sang songs on the film “Ghazal al-Bannat” with artist Leila Murad. She ended up at the United Films office in 1964 after which she had a minor role with artist Yahya Shaheen in “Azhar wa Ashwak” (“Roses and Thorns”) in 1947. The role was followed by other minor parts until she met director Hassan Reda whom she married. The couple had a daughter named Basant and Hend began her cinema career. Director Hassan al-Imam assigned her major roles. She never acted on stage and she presented several works with Isma’il Yasseen, the most important of which was “Ibn Hamido” in 1957 which was directed by Fattein ‘Abd Al Wahab. That was followed by a glowing performance alongside Salah Abou Youssif in “La Annam” (“I Do not Sleep”) in 1957. Her skills as an artist had matured by the time she presented “Sira’ fee al-Neel” (“Conflict on the Nile”) with ‘Aatef Salem in 1959. Hend Rostom was adept at expressing the volatility of women and their strong emotions in a respectable manner. She did this in “Ragol bella Qalb” (“Heartless Man”) opposite Yahya Shaheen in 1960 and once again on a few scenes in the film “Isha’at Houb” (“Rumor of Love”) that same year, that production was directed by Fatteen ‘Abd Al Wahab. Hend Rostom was successful at standing out and at becoming the actress whom people adored thus becoming the model of the talented actress on Egyptian cinema. Her performances represented a unique stream as her characters’ profiles had changed by the time she acted on “Bab al-Hadeed” and “Imraa ‘ala al-Hamish” (“A Woman on the Margin”). She presented a distinguished comedy role in “Houbb wa Houbb” (“Love and Love”). Hassan al-Imam was successful at employing her skills and presented her in some of her best roles. Her performance was also outstanding in a short role in “Kalimat al-Sharaf” (“Word of Honor”). Her acting talents were displayed in the film “al-Khoroug men al-Ganna” (“Exit from Heaven”) where she performed alongside artist Fareed al-Atrash. Hend Rostom received several awards for her films, especially “al-Gabban wa al-Houb” (“Love and the Coward”) in 1975. She also married the famous doctor Mohamed Fayyad. By the end of the ‘70s Rostom decided to retire from acting and her last work was “Hayyaty ‘Azab” (“My Life is Torture”) in 1979.'),
('1078316', 'https://media.elcinema.com/uploads/_315x420_272f3932e8524343acdd86efab89e997a2e51c2249c6571f6ab6297306ad4c6d.jpg', 'Fakher Fakher', 'Egypt', ' 3 March 1912', NULL),
('1078369', 'https://media.elcinema.com/uploads/_315x420_1a03fa6571ab9940aa793b3e9b4943ecc3b8b75ea7f5df795d176be26bab4d3d.jpg', 'salah hassan', 'Egypt', NULL, NULL),
('1078384', 'https://media.elcinema.com/uploads/_315x420_633306bb08ad50c276384824915c08cc29e036271e88425cbd884d8da6c1bef3.jpg', 'Firas Saayed', 'Argentina', '15 April 1966', 'Firas Sa\'id is a Syrian/Argentinian actor. He studied architecture in the university of Belgrano, Argentina, and worked as an interior designer. He now resides in Egypt and has picked up a career in acting by appearing in TV shows, starting with Al Jamia\'a (The University), “Serr A\'lany” (Public Secret) and “Hekayat Hayat” (The Story of Hayat). He had his big break in the Ramadan season of 2013 when he played “Adham” alongside Laila Alwi in “Farah Laila” (Laila\'s Wedding). He is married to an Egyptian and he has two kids who hold Egyptian citizenship, unlike him who hasn\'t received it yet.'),
('1078649', 'https://media.elcinema.com/uploads/_315x420_dceb3cddba2b7a60df78fd04238c42d412803e8fbcdd9ca864ca88cf1377e215.jpg', 'Hagag Abdel Azim', 'Egypt', '16 August 1960', NULL),
('1078715', 'https://media.elcinema.com/uploads/_315x420_a3915b912bb2f9bf0decf34ba0259d06c8effbc1baea6e974f32b755ff5fa2e2.jpg', 'Samy El Adl', 'Egypt', ' 2 November 1946', 'Samy was born in the city of Mansoura in Dakahlia governorate. In addition to being an actor, he is also a  producer.\nHis career in entertainment started with work in theater and television. He graduated from the Institute of theatrical arts. His full name is Samy Tawfiq Aladl.\nAmong the television series he has participated in are “Al Samman wa Al Khareef”, “Al Burkan”, “Gawary bila Qyood”, “Al Harmalak”, “Balagh ila Al Naib Al Aam”. Among the most important of his theatrical performances are “Loly”, “Ahl Al Hawa”, and “Kalam Faregh”.\nHe is currently married to the actress Nadia Nour Al Deen and he was previously married to another actress by the name of Nadia Shoukry.\nHis career in cinema began towards the end of the 1970s when he assumed a minor role in “Ragab Fawq Safeeh Sakhen” which was a production that starred Adel Imam. In that performance, Samy assumed the role of a charlatan that worked with “Bolbol” (Saeed Saleh). His career in cinema continued into the 1980s where he usually assumed roles depicting evil characters such as drug dealers, gangsters, corrupt businessman and other roles of that nature. Samy continued performing roles of that type for a long while. His participation in movies increased with the (increase in the number of movies produced between 1987 and 1994). \nBy the end of this period, Samy developed a greater interest in film production and founded a company with his brothers Mohamed and Medhat Adl.  The company they founded was named “Al Adl Group”.\nThus, Samy achieved a great measure of success in film production and thereafter developed his acting skills. Samy was assigned roles that were positive than those he had assumed previously and among the best known of these roles was a role in the 2007 television series “Qadiyat Raey Aam” where he presented the role of an investigator leading a case that involved the rape of two doctors and a nurse.'),
('1078743', 'https://media.elcinema.com/uploads/_315x420_5b15d78902558667f5dc14d1654e59533878eb3623cffc3f88a449855e846524.jpg', 'Aida Abd El Aziz', 'Egypt', '27 October 1936', 'Aida Abd El Aziz, whose full name is “Aida Abd El Aziz Abdel Rahman is an Egyptian actress who was born on October 27, 1936. She graduated from the Higher Institute for Dramatic Arts in 1959. After she completed her studies, she worked in the Ministry of Education as a supervisor to train school theater troupes. In 1962, she traveled to London with her husband, actor Ahmed Abdelhalim to complete her graduate studies in acting and directing and took a course in theater movement and voice. Of her most important works in stage theater include: “Shei Fi Sadri” (Something in My Chest), “El Ardh” (The Land), “Shagara El Dhulm” (Tree of Injustice), “Don Juan,” “Thamn El Horeya” (The Price of Freedom). She also worked in cinema, with the films: “Yomeyyat Na’ib Fil Areyaf” (Diary of a Country Prosecutor) in 1969, “Shahid El Malika” (The Queen’s Honey) in 1985, “El Namr Wa El Untha” (The Panther and the Female) in 1987, “Bawabet Eblis” (The Gate of the Devil) in 1993, “El Wad Mahroos Betou’ El Wazir” (Mahrous the Minister’s Boy)  in 1999, and “Heliopolis” in 2000. She also appeared in a number of TV serials, including: “Zeynab Wel ‘Arsh” (Zeynab and the Throne) in 1979, “Hala We El Darwish” in 1990, “Dhameer Ibla Hikmat” in 1991, “Yomeyat Wanis” (Wanis’s Diary) in 1994, “El Firar Min El Hob” (Escape from Love) in 2000, “Kanariya We Shoraka” (Canaria & Co.) in 2003, “Mowga Hara” (Heatwave) in 2013, and others.'),
('1078805', 'https://media.elcinema.com/uploads/_315x420_b864b67ce9a3a170c3aabf9c94c4eb026afd50eb484ea1530e413b3ab69e8e33.jpg', 'أيمن فتحي', 'Egypt', NULL, NULL),
('1078855', 'https://media.elcinema.com/uploads/_315x420_85fba8b9aa1f58059ded4d8b05bc1ce7538c6533773940dcb94acf250600c631.jpg', 'Said Naciri', 'Morocco', '25 September 1960', NULL),
('1078897', 'https://media.elcinema.com/uploads/_315x420_605bacb04c73b7f3b6f600bdbb53ab7772d833a61310436445dfb3290e45be95.jpg', 'Ayman Ismail', 'Egypt', NULL, 'An Egyptian actor famous for his leading roles. He participated in many movies including:\"Wahed Sefr\", \"El Hekaia Feha Menna\", \"Kabaret\", \"Wahid Capochino\" and \"Shewayat Horya\" in addition to many series like \"Nos Ana We Nos Howa\" and \"El Zanaty Megahed\". He also presented many sitcoms like \"Asaad Allah Masaakom\" and \"Hadotat Ma Kabl El noum\".'),
('1078978', 'https://media.elcinema.com/uploads/_315x420_fa359d49e149ff891951ad7c7f0adc2ee30c65bd4672ce37a23b7d76d28f14b8.jpg', 'Lebleba', 'Egypt', '14 November 1946', 'Ninochka Manoug Kupelian better known by her stage name Lebleba is an Egyptian film actor and entertainer of Armenian origins. Started her life mocking actors and the entrepreneur “Ma’allem Seddeek” discovered her and presented her to “Al-masrah al-kawmy i.e. The National Theater” where she became famous for stand-up comedies. Anwar Wagdy and Hassan al-Seify gave her some small roles in cinema. Abul-So’oud al-Ebiaary gave her the name Lebleba (The eloquent) after seeing the multi-talented child actor, comedian and dancer. She married actor Hassan Youssef, but they were divorced later on. She never remarried. Lebleba played a number of different roles with renowned Egyptian comedian Adel Emaam. The director Aatef al-Tayyeb gave her two noteworthy roles in “Dedd al-hokouma i.e. Anti-Government” and “Layla saakhena i.e. Hot night”, winning many awards. As she grew up, she took on more serious roles like a mother in Chahine’s “Al-aakhar i.e. The other” and a prostitute in “Gannat al-shayaateen i.e. Fallen angels paradise”.'),
('1079175', 'https://media.elcinema.com/uploads/_315x420_cedcc3e4498a370b47a0a284b2dc36e6667cf977f45baa013276ccfb38b47bbf.jpg', 'Shaaban Hussein', 'Egypt', '24 November 1940', 'Shaaban Hussein has earned a bachelor’s degree in Agriculture. He is an actor who has appeared on stage, television and film productions. In the mid 1960s, Hussein performed at the al-Dawla theater. Thereafter he transferred to the Mohamed Sobhy theater.\nAmong the best known television series which Shaaban has appeared in are “Ahlan Be al-Sokkan” (“Greetings to the Inhabitants”), “Yawmeeyat Wannis” (“Wannis’ Diary”), “al-Abla” (“The Teacher”), “Sunbul ba’d al-Million”, “Qaqees Waraq” and “al-Qarar al-Akhir” (“Final Decision”). His theatrical performances have included roles in “Nargis” (“Narcissus”), “Gawaz ‘ala Waraqat Talaq”, “al-Jokkar” (“The Joker”), “Anta Horr” (“You’re Free”), “al-Hamagy” (“The Barbarian”), “Takharif”, “Le’bat al-Sitt” and “Waghat Nazar” (“Point of View”). \nSha’ban has also assumed minor cinema roles.'),
('1079283', 'https://media.elcinema.com/uploads/_315x420_717f7dac069b2b7cde24ac9147f4ab3a5364cdc1ad0a18d49f7371f5d6768f45.jpg', 'Khalil Morsy', 'Egypt', '21 September 1946', 'Egyptian actor Khalil Morsy was born in 1946. He received a bachelor’s degree in agriculture and later received a second degree in theatre, as well as a doctorate. He then became the head of the theatre department at October 6th University, where he worked until his death. Morsy played diverse roles - from the hero to the villain - working in theatre, cinema and television. Some of his most important works included the film, “El Embratour” (The Emperor) with Ahmed Zaki, and the play, “Laibet El Sit” (Lady’s Game) directed by Mohamed Sobhy.'),
('1079289', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Salah El Sayeh', 'Egypt', NULL, NULL),
('1079547', 'https://media.elcinema.com/uploads/_315x420_76c4505dd35e9410f595fd6a7038a511c96ee1db65f938d90f23b1bfa491951d.jpg', 'Randa', 'Egypt', '25 September 1964', 'Randa is an Egyptian/Lebanese actress. She was born in Saida, Lebanon in 1964, and moved to Egypt with her family due to the start of the Lebanese civil war. She graduated from the High Institute of Theatrical Arts in 1990, and since then has worked between film and television, in works including \"Alhob Fawq Hadabet Elharam\" (Love Over The Pyramids Plateau), \"Al-Gouaa\" (Hunger) and \"Crystal\".'),
('1079555', 'https://media.elcinema.com/uploads/_315x420_b42200886967b193c6fa8dfa93777daeccbf5813e4d65d4d42a4c4b27210817c.jpg', 'Hassan Kamy', 'Egypt', ' 2 November 1936', NULL),
('1079923', 'https://media.elcinema.com/uploads/_315x420_14944875a9dc6bc4c8b4ddda465a6e139b1cc17f4f16683189a2c09725ed1ed2.jpg', 'Fawzi Al Sharqawi', 'Egypt', NULL, NULL),
('1079972', 'https://media.elcinema.com/uploads/_315x420_ed0bac78a874f001cf8e00a36df5728db572206f8eba894ef6493c470af19950.jpg', 'Zayed Fouad', 'Egypt', '10 September 1949', NULL),
('1080154', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'mohmed genina', 'Egypt', ' 1 January 1978', NULL),
('1080206', 'https://media.elcinema.com/uploads/_315x420_51b38c689b6571aa6adfacc0b1ca6705882f2b8c600ed1baa806f24e383568ef.jpg', 'Rasha Samy Eladl', 'Egypt', NULL, NULL),
('1080352', 'https://media.elcinema.com/uploads/_315x420_dbe796b81a19c8ef93f60653825417a7802ae3d6d4c2d3c1ac67eaae6f4cec25.jpg', 'Magdy Badr', 'Egypt', '14 October 1970', NULL),
('1080361', 'https://media.elcinema.com/uploads/_315x420_ef25dc7a7f0084c2c10e38a8b148a2f7b66d59445b065c2a4ded072d7ac35e3a.jpg', 'Kamal Abu Raya', 'Egypt', '23 October 1962', 'Kamal Abu Raya is an Egyptian actor. He graduated from the Hihg Institute of Theatrical Art in 1985. In the mid 1980s, Anu Raya\'s career started taking shape, as he appeared in numerous television series, including “Al Saraya” (The Palace), “Bein El Qasrein” (Between the Two Palaces), and “Ma\'a Martabet Alsharaf” With Honors). He also appeared in several films, including “Abaa\' wa Abnaa\'” (Fathers and Sons) and “Wadaa\'an ya Walady” (Farewell my Son). He is most known for playing Qassem Amin, in the televisions series with the same name about the life of the early 20th century feminist activist. He also played critically acclaimed roles in the televisionse ries “Om Kulthum” and “Suq Al Aasr” (Afternoon Market).'),
('1080395', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmed Hamza', 'Tunisia', '14 December 1930', NULL),
('1080533', 'https://media.elcinema.com/uploads/_315x420_47b5a4b719f48bfe5d539076817199929d11aca91c42a349c4ea754307b47de4.jpg', 'Hamada Helal', 'Egypt', '20 March 1980', 'Hamaada Helaal is an Egyptian singer with a unique style, his success in singing lead him to become a cinema actor in a number of light comedies.'),
('1080752', 'https://media.elcinema.com/uploads/_315x420_387314ae7a6b1cf29de3d73932eb0cbc23f59443a26f030c9da0ef2e66b40a72.jpg', 'Yousry Nasrallah', 'Egypt', '26 July 1952', 'Yousry was born in Cairo in 1952 to a Coptic family. He studied economics at Cairo University before studying cinema at the Higher Institute for Cinema in Cairo in 1973. Initially Yousry worked as a cinema critic for a Lebanese paper named al-Safeer and as a director’s assistant in Beirut. He also worked as a director’s assistant with Youssif Chahine on the film projects “Wada’an Bonaparte” (Farewell Bonaparte) and “Hadoutta Masriyah” (An Egyptian Tale) (1981). Furthermore Yousry also worked with Folker Shlondorf on “al-Muzayyaf” (Counterfit) and with ‘Umar Amiraly on the documentary title “Massaib Qoum” (The Woes of a People). Next he participated in writing the screenplay for “Iskandiriyah Kaman wa Kaman” (Alexandria Again and Again) (1989) with Youssif Chahine and worked with him again in directing “al-Qahira Menawara bi Ahlaha” (Cairo is Alive with its People).\nYousry directed his first feature length film in 1990, the work was titled “Sariqat Sayfiah” (Summer Thefts), his second feature length direction work was “Mercedes” (1993). Thereafter he directed “Sibbyan wa Banat” (Boys and Girls) in 1995 and “al-Madeena” (The City) in 1999. One of his best recognized works “Bab al-Shams” (Gateway of the Sun) came about in 2004 and his last work was 2008’s “Geneinat al-Asmak” .\nYousry has offered audiences a unique view through his works and has tried to use his films to portray clearly the mindset of Egyptian society and its psychological constituents. His first feature length work “Sariqat Sayfiah” (Summer Thefts) was perhaps influenced by his own life story as it relates the life of his wealthy Coptic feudal family and the farmers.'),
('1080849', 'https://media.elcinema.com/uploads/_315x420_9685f8f9aca240757e80b15561452d5a8e7d674a0903bac888816b405cd44fb3.jpg', 'Miral', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1080872', 'https://media.elcinema.com/uploads/_315x420_ecf0ab183ddbc56dd1b39b3501b08cc56c0e275c3049ea8b9022f5ba3f75a772.jpg', 'Ahmed Azmy', 'Egypt', '23 April 1972', 'Ahmed Azmy started his career at a very early age. His career path began at the age of 11, when he used to write poems and send them to a children\'s radio show. His poems and letters were so moving, that they grabbed the attention of Mohamed Hamdy, the president of radio broadcasting at the time. Hamdy introduced him to Abla Fadila, who personally invited him to be a regular on her famous children\'s radio show. From children\'s radio, he was introduced to the actress Inaam elKretili, who helped launch his career in television. He first appeared as a child actor in the TV show \"Elforsan (The Knights)\" starring Ahmed Abdel Aziz.\n\nAfter finishing high school, he enrolled in the High Academy of Performing Arts to cement his talent and work experience with a formal education in acting. He also enrolled in the director Youssef Shahin\'s talent agency, which gave him his first job as an adult in the movie \"Elabwab elmoghlaqa\" after passing rigorous auditions and casting calls.  In 2001, he won numerous \"Best Actor\" awards in 3 different movie festivals for his role in this film.  He later went on to act in Yousry Nasrallah\'s film \"Elmadina\"\n\nAzmy gained notoriety through his role in the popular TV show \"Abbas elAbyad\" starring Yehia elfakharany, whom Azmy considers his godfather in this industry. \n\nHe lives with his wife Dina and son Adam.'),
('1081145', 'https://media.elcinema.com/uploads/_315x420_45772cbb895303d0a9f9b7d7231de4177f9165d371c8b0a8c7efb3e12e605ac8.jpg', 'Omar Ezz Eldein', 'Egypt', NULL, NULL),
('1081364', 'https://media.elcinema.com/uploads/_315x420_75a9630037b2b84a2f5bcc69e7e738176968cb423a933e4dd3b7f4d201852305.jpg', 'Muhammad Ali', 'Egypt', NULL, 'He started off as an assistant director in 1995 with the movie “Joy Thief” then in 2005 he did “Booha” which was a great success. Finally, he did his first solo directing for the movie “The Game of Love” followed by many more movies.'),
('1081733', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Amira Salem', 'Egypt', NULL, NULL),
('1081749', 'https://media.elcinema.com/uploads/_315x420_64c1ac1e05946c7c02d9fd0ad0bcf1cf93efd042b8aee1c456f229b9b884498e.jpg', 'Shady Youssry', 'Egypt', '20 December 1975', NULL),
('1081944', 'https://media.elcinema.com/uploads/_315x420_4470fc597b225d56e8d4001aecf6a381957bf59af7411a65350d4bdf4b427b11.jpg', 'Othman Abu Laban', 'Egypt', '15 January 1973', 'Lebanese director was born in Beirut 1973. Started his career directing video clips for stars like Moustafa Amar then directed a group of “action” films.'),
('1082085', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد عباس', 'Egypt', NULL, NULL),
('1082104', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Sayed Fadl', 'Egypt', NULL, NULL),
('1082123', 'https://media.elcinema.com/uploads/_315x420_c5603ad77bfbc89f14c889e6164b65df9f01632de3699cf79665ccb756e1046a.jpg', 'Karim Qassem', 'Egypt', ' 8 October 1986', 'Karim Qassem is an Egyptian actor. He was born in 1986 in Cairo, and graduated from the American University in Cairo. Karim studied acting in several workshops in London and Paris, and joined Ahmed Kamal\'s acting studio. He was chosen by producer Hassan Elqalla to be one of the three leads in the critically and commercially successful drama film “Awqat Faragh” (Void Times). He then went on to appear in several films, including “El Magic” (The Magic Hour), “Bel Alwan El Tabia\'eya” (In Natural Colors), and “AUC”.'),
('1082130', 'https://media.elcinema.com/uploads/_315x420_976e8d9005dfe59d72b7f431e12b44fb3b099d801cf90666069597fdf001829d.jpg', 'Amr Waked', 'Egypt', ' 7 August 1970', 'Amr Waked is an Egyptian film, television and stage actor. Western audiences best know him for his roles as the terrorist leader in \"Syriana\" (2005) opposite George Clooney, Rafik in Soderbergh\'s \"Contagion\" (2011), and as Yemeni Sheikh Muhammad in \"Salmon Fishing in the Yemen\" (2011) alongside Emily Blunt and Ewan McGregor. Waked graduated from the American University in Cairo with a degree in political science. He worked full-time as a stock trader and moonlit as an actor before fully committing to his acting career. He got his break in 2001 with \"Ashab Wala Business\" (Friends Or Business). His performance was so convincing, audiences left the theater believing he was a Palestinian actor. He got his first lead role in \"Deil el Samaka\" (The Fish\'s Tail) in 2003, for which he won a Best Actor award at the Alexandria International Film Festival. He was one of the first high-profile celebrities to openly join the 2011 anti-Mubarak protests. The next year, he honored the revolution in his critically acclaimed film \"Winter of Discontent\" directed by documentary-maker Ibrahim El-Batout. He made headlines in 2011 when he boycotted the Cannes screening of \"18 Days\" (he starred in and produced one of the short vignettes in the film) because of the festival\'s inclusion of certain anti-revolutionary figures.'),
('1082135', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Shady Al Ramly', 'Egypt', NULL, NULL),
('1082145', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'سيد شعبان', 'Egypt', NULL, NULL),
('1082499', 'https://media.elcinema.com/uploads/_315x420_46a10753d38f5dbd666db3aa84ede695defa1f20df2d733f04c101727199f96b.jpg', 'Mohamed Wafik', 'Egypt', '24 September 1947', 'Mohamed Wafiq is an Egyptian actor who has appeared in over 16 films and 100 television series. He was born in Alexandria to a father who worked as a college professor. He finished his high-school education in Alexandria, then received a bachelor\'s degree in theatrical arts in 1967, in the same class that contained Nour Elsherif, Magdy Wahba and Abdel Aziz Makhyoun. During his years at the High Institute of Theatrical Arts, and while he was working in the Television Theater as a trainee for extra money, he acted as a surrogate to Hussein Elsherbiny, who was absent one day, and took his role of a United Nations soldiers. The director of the show was impressed, and gave him the part instead of Elsherbiny. He then participated in the play “Sindbad”, during which he was approached by Youssef Chahin for a lead role in a film project that was later halted. Wafiq\'s big break came with his role in the television series “Almorshedy Antar” and “Alketaba Ala Lahm Yahtariq” (Writing on Burning Flesh) in which he played the role of Aldhahir Beibars. He also appeared as the Islamic leader Amr Ibn Al-Aas in the Prophet Muhammad biopic “Al Ressala” (The Message) which was directed by Mostafa Al-Aqqad. In the q980s, Wafiq performed his most famous role to date, that of the Egyptian Intelligence officer Aziz Al-gibaly in the three-season espionage series “Raafat El-Haggan”. His most notable role on film was in “Al Horub” (The Escape) alongside Ahmed Zaki.'),
('1082589', 'https://media.elcinema.com/uploads/_315x420_2dcbe8c1652097cc4fcd1ae283d0546559c23325c631526e8e4984e89369fe96.jpg', 'Ahmed Shahm', 'Egypt', '24 March 1979', NULL),
('1082609', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمود الصافى', 'Egypt', NULL, NULL),
('1082726', 'https://media.elcinema.com/uploads/_315x420_a193ee981db49f67345b8a8ba899f18f8c15b74aa3c597480e9a725c0f1c2a52.jpg', 'Sayed Hamed', 'Egypt', NULL, NULL),
('1082738', 'https://media.elcinema.com/uploads/_315x420_fd519a04c08733f342ac99ddb197afc0c0a3b84a6c448fd5ef89abbdad35a598.jpg', 'Youssef Hussain', 'Egypt', NULL, NULL),
('1082742', 'https://media.elcinema.com/uploads/_315x420_3be9ceb8a1fd0b21c76e9f61364a220f3824c20c85cae443370e59705b47ded6.jpg', 'Hend Sabry', 'Tunisia', '20 November 1979', 'Hend Sabry is a Tunisian actress. She was born in Kebili province in Tunisia, and holds a degree in Intellectual Property. She started to become a recognized actress since she appeared in the films “Mousem Alregal” (Men\'s Season) and “Samt Alqosur” (Silence of the Palaces) by director Mofida Altelaly. She attracted the attention of Egyptian director Inas Eldegheidy, and she eventually cast her as the lead in her film “Mozakirat Morahiqa” (Diary of an Adolescent) in 2001. Among her most notable roles were those in films like Dawood Abdel Sayed\'s “Mowaten we Mokhber we Haramy” (A Citizen, an Informant and a Thief) “Ayez Haqy” (I Want my Rights), “Ahla El Awa\'at” (Best Times), and the television series “Aywa Atgawez” (I Want to Get Married) and “Embratoreyet Meen” (Who\'s Empire?).'),
('1082768', 'https://media.elcinema.com/uploads/_315x420_98ae20adf1269dd04543d4719f3426e81826967786bab8cf44e8e68f442db7d2.jpg', 'Youssef Dawood', 'Egypt', '10 March 1938', 'Youssef Girgis Salib was born in (the neighborhood) of Seiyouf Shamaa in Alexandria. He graduated in 1960 from the (electronic engineering division of the faculty of engineering). Thereafter he worked as an engineer before devoting himself to (acting) in 1985.\nAfter (undertaking general studies) for a year he performed his acting debut in the theatrical production “Zqaq al Madaq”.\nAmong the television productions that he has participated in are “Al Souq”, “(Kasabna) Al Qadiyah” and “Al Dish wa Al Mish”. Youssef’s roles have varied from comic ones to portrayals of a police officer and a family head.'),
('1082826', 'https://media.elcinema.com/uploads/_315x420_67613bbbbf61c90d76a79c68a2fdbcba46549df06690b657992c4df133f04a7d.jpg', 'Somaya El Khashab', 'Egypt', '20 October 1966', 'Summaya Sa’eed al-Sayyid Fathiyya was born in Alexandria. She studied at the faculty of commerce. Summaya has taken part in theatrical productions such as “Ballo” and “Kharbasha” (Scribbles) in addition to the television series “al-Hissab” (The Account), “Sammihny Makansh Asdee” (Forgive Me, I didn’t Mean to), “’Aaillat al-Hajj Metwally” (The Household of Hajj Metwally), “Haddrat al-Muhtarram” (Sir) and “al-Dawwe al-Sharrid” (Stray Light).'),
('1082855', 'https://media.elcinema.com/uploads/_315x420_0b495d2f2f8582bcfcc8565d22e471af749a20d9fbe1bb99f29004559001886a.jpg', 'Samira El Hawary', 'Morocco', NULL, NULL),
('1083191', 'https://media.elcinema.com/uploads/_315x420_0e259b1fe4f5a24c3a0e8f5d653a748fae048f3a8bec40842e13c1f66111fcdf.jpg', 'Amir Shahen', 'Egypt', ' 1 January 1977', NULL),
('1083228', 'https://media.elcinema.com/uploads/_315x420_51257b7819868297c0fbf5ea8bce47eb6769c6f25bbc30124d0d84f8bb6f6ec5.jpg', 'Ali Abd al-Rahim', 'Egypt', '13 May 1961', NULL),
('1083264', 'https://media.elcinema.com/uploads/_315x420_4764ca63a0e29500c0c31c4c687b2b279dcb1b5ff315598966cc744049f4f660.jpg', 'Fawzy Al-Awamry', 'Egypt', NULL, NULL),
('1083465', 'https://media.elcinema.com/uploads/_315x420_fcfd585da86daf46ebbda558555672d3ca6d0c730bfc614c14bb255fc9ade422.jpg', 'Galeela Mahmoud', 'Egypt', '12 September 1946', 'Galeela Mahmoud Abdul Raheem is an Egyptian actor who studied at the High Institute of Dramatic Arts. She played several roles in cinema and theatre. She is more famous for her TV roles, like “Maha” and “Al-shahd wal-domou’ i.e. Honey and tears”.'),
('1083680', 'https://media.elcinema.com/uploads/_315x420_cf8643868fe1f96d4264ac5595097d51456c4f4a67bc9c4f868e107d3f13c266.jpg', 'Sabah Mahmoud', 'Egypt', NULL, NULL),
('1083779', 'https://media.elcinema.com/uploads/_315x420_b94b6e91d23643ca8b858e5cb19647cbbe857c376099eb1cbae2493a36210bcc.jpg', 'Ahmad Attiya', 'Egypt', NULL, NULL),
('1083902', 'https://media.elcinema.com/uploads/_315x420_c7d9b75445f67a831939265238d8d86a0504317022568c9f8ebc0078fd77ff86.jpg', 'Karim Mahmoud Abdelaziz', 'Egypt', '15 June 1985', 'Karim Mahmoud Abdel Aziz is a young artist known for his handsome face that looks very similar to his father’s at the beginning of his career. He didn’t know that he would be one day be an actor and in the world of cinema, despite the fact that his father is one of the most famous actors in the history of Egyptian cinema, Mahmoud Abdelaziz. Karim got his start by way of a video camera - one of his hobbies was to film and make movies with his friends. His talent led him to boldly interrupt his father’s meetings with directors Essam El Shama and Mohamed Abdelaziz to show them what he’d created with his camera. Essam was impressed with his talent, and after a few days, director Mohamed Abdelaziz chose him to act in the film “Shagaret El Ahlam (Tree of Dreams). Karim insisted on starting his career in cinema without assistance from anyone, even his father who objected to his son’s way of doing things. But Karim’s performance in the TV series “Ragil Min Zaman El Alouma” (Man from the Age of Globalization) made Karim’s father acknowledge his son as an actor. Karim participated in a number of films and TV series, including “El Nazzer” (The Observer) in 2000, the series “Mahmoud El Masry” (Mahmoud the Egyptian) in 2004, and “Ahzan Mariam” (Mary’s Sorrows) in 2006.'),
('1083969', 'https://media.elcinema.com/uploads/_315x420_dcc5cff300b3f220917a367ca874ba42f8b59413f0913b3d4f96717db34d9e96.jpg', 'Mohamed Abu Al-Hasan', 'Egypt', '19 July 1937', 'Mohamed Abo El Hassan was an Egyptiana actor. He was born in Cairo in 1937, and graduated from the faculty of agriculture in 1960. He worked as an agricultural engineer for some time, before landing a job in national television as an actor and director in a show for kids, which was presented by the famous hostess Nagwa Salem in 1971. He then took parts in theatrical plays including “Al Mutazawigun” (The Married Ones), “Min Agl Hefnat Nisaa” (For a Bunch of Women), “Hawel Tefham Ya Zaki” (Try to get It, Idiot). His most famous theatrical role was in the comedy play “Sok Ala Banatak”. Abo El Hassan also worked in television, in highly successful series like “Al Weseya” (The Village) and “Almal Wal Banun” (Fortune and Sons). In 1986, Abo El Hassan suffered from a stroke while shooting in location, and was rushed to fly to Paris as seven of his arteries needed replacement. Since then, his career started a downfall, as disease kept striking him and limiting his abilities, until his death in June of 2014 after suffering from a stroke.'),
('1083987', 'https://media.elcinema.com/uploads/_315x420_a526a5938ab82354baacd704e7cc8cbb4e76e65fce8567779278003936af43f1.jpg', 'Adel Alaasar', 'Egypt', '28 February 1955', NULL),
('1083995', 'https://media.elcinema.com/uploads/_315x420_414474cd07cb56a0053c9dfe899d8048b8fe8e0ba8eef7c78c42bcaefab98baf.jpg', 'Ghassan Matar', 'Palestine', ' 8 December 1938', 'Ghasan Matar was a Palestinian actor. He was born in Jaffa, and got interested in performing arts at a very early age. His debut as an actor was in the Egyptian television series “Da\'irat Aldaw\'” (The Circle of Light), and due to his unique looks and low-register voice, he was then often cast as a villain in numerous films, television series and theatrical plays. He also served as president of the Arab Artists Union, and wrote several screenplays, including the 1996 Palestinian film “Al Tha\'er” (The Rebel).'),
('1084040', 'https://media.elcinema.com/uploads/_315x420_20d99911c371c8748c9656f4b141e8b703d87d66752144ca1bde041b48a29ba8.jpg', 'Rania Yousef', 'Egypt', ' 1 December 1973', 'Rania Youssef is an Egyptian actress and model. She was born in Cairo in 1973 to an officer and a flight attendant. Prior to her acting career, Rania worked as a model. She\'s appeared in a number of television series, including \"Riyah Al Madina\" (City Winds), \"A\'ilat Al Hajj Metwaly\" (The Household of Al Hajj Metwaly), and \"Al Nisaa Qadimat\" (The Women Are Coming). She\'s taken on increasingly controversial and racy film roles, which has ruffled the feathers of many in Egypt and the Middle East. She played a gynecologist in \"Wahed Sahih\" (2012) alongside Hani Salama, Ghada Adel, Kinda Alloush and Yousra Al Lozi. Her personal life has also attracted much attention. She married Egyptian producer Mohammad Mokhtar, with whom she has two daughters. Four months after her divorce from Mokhtar, she surprised everyone by announcing a secret wedding ceremony to an Egyptian businessman.'),
('1084141', 'https://media.elcinema.com/uploads/_315x420_4544f08052b52f30c41f0c679b625da3ce54a1d4633b234ae09db11666f52199.jpg', 'Abdalla Mourad', 'Egypt', NULL, NULL),
('1084154', 'https://media.elcinema.com/uploads/_315x420_2d199f188852941fd9e30d45e1635f16cb03158f841503e8d1a1530569864173.jpg', 'Sherif  Mandour', 'Egypt', NULL, NULL),
('1084171', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Osama Sobhy', 'Egypt', NULL, NULL),
('1084241', 'https://media.elcinema.com/uploads/_315x420_08682ba99c036a361c1ef92af0b540a1e4c3db95d7347a21b23f8680002ba4dd.jpg', 'Mohamed Ezz', 'Egypt', ' 7 September 1978', NULL),
('1084484', 'https://media.elcinema.com/uploads/_315x420_83a6cc8df6a855154dca3ca04cb22162d12422fddbb6160c90db7b60f5e851d6.jpg', 'Ahmed Adel', 'Egypt', NULL, NULL),
('1084543', 'https://media.elcinema.com/uploads/_315x420_02970beccf33a68829d724c7c43893fc66ac49b7845bfb2e6c0dda04f585d8a8.jpg', 'Ibrahim Haggag', 'Algeria', '14 May 1934', NULL),
('1084645', 'https://media.elcinema.com/uploads/_315x420_cd674f5ff6c766b84dae9187602a20aa2b34cba05b56a882dbaead767001232a.jpg', 'Mona Hussein', 'Egypt', '20 April 1969', NULL),
('1084658', 'https://media.elcinema.com/uploads/_315x420_e8d0120fb5088fcca1f2ce69d5d0bb8b33cf1b2a38c3a878f9d85e57b223a501.jpg', 'Sherif Mounir', 'Egypt', '14 May 1959', 'Sherif Mounir is an Egyptian actor who was born in Mansoura, Dakahlia governorate in 1959. Following the advice of poet Salah Jahin, Mounir enrolled in the acting department of the Higher Institute of Theatrical Arts. He started his career in the mid 1980s appearing in the television serials “Rihla El Milion” (Journey of a Million), “Bakeeza We Zaghloul,” and “Leyyali El Haleema” (Nights of El Helmeya), as well as films “El Tawfaan” (The Flood), “Darbet Maalim” (Master Stroke), “Abnaa’ Wa Kutla” (Children and Murderers). Yet his big break came in the 1990s when he played Youssef in the film “El Kit Kat.” Since that time, he has appeared in a significant number of films, including “Diso Disco,” “Romantica,” “Short Wa Fanila Wa Kab” (Shorts, Tanktop, and Hat), “Sihr El Layyali,” (Sleepless Nights), “Welad El ‘Am”, and “Hysteria.”'),
('1084751', 'https://media.elcinema.com/uploads/_315x420_ebdbe19de6f2b9e4a6ed650617f7ecc3ca3ea66b07f0de3a2e376ea6de7fffd9.jpg', 'Saeed Seddiq', 'Egypt', NULL, NULL),
('1085012', 'https://media.elcinema.com/uploads/_315x420_9935c054553172eac855cfa86db93b465ef941d021b2841b97f3a650cae65676.jpg', 'Aida Fahmy', 'Egypt', '27 December 1958', NULL),
('1085016', 'https://media.elcinema.com/uploads/_315x420_aedb5bf8260161b0f0ec5faf1560ba9deecf946d03ab3f5cf5493ae3304ef6ac.jpg', 'Sawsan Bader', 'Egypt', '25 September 1957', 'Sawsan Badr (born Suzan Abu Taleb) is an Egyptian film, stage and television actress who was born in Cairo, Egypt, on September 25, 1957. She graduated from the High Institute of Theatrical Arts in 1979, after discontinuing her studies in the faculty of science. She\'s appeared in many theater productions, including \"Al Wad Sayyid Al Shaghal.\" She got her start in film in the British film “Mot Amira” (Death of a Princess) by British director Antony Thomas in 1980. This film made quite a stir at its premiere in Britain, as it infuriated the Saudi Arabian government for its portrayal of the kingdom’s history. Badr was blacklisted from Egyptian and Saudi television, and for this she lost many roles directly following the film. Though it made her very popular, she did try multiple times to leave Egypt, but finally decided on changing her name to Sawsan Badr. She delivered a memorable performance in her second role in the 1980 film “Habibi Da’iman” (Always My Love) directed by Hussein Kamel. She won the best actress award for the \nplay \"Al Ard La Tanbit Al Zuhur” and for her role in the television series “Dawlat Fahmy,\" as well as a number of international awards for her role in “Al Dawair Al Mughlaqa” in 2001. She received the Best Actress Award at the 34th Cairo International Film Festival. Badr was cast to play Nefertiti in Shady Abdel Salaam’s film about Akhnaton, though the great director passed away before finishing the movie.'),
('1085020', 'https://media.elcinema.com/uploads/_315x420_dd6633e5296e10b5107d927af705a6648336dcec6fa2157c6a28dda39257e0e0.jpg', 'Hatem Jamel', 'Egypt', '18 September 1971', NULL),
('1085077', 'https://media.elcinema.com/uploads/_315x420_53c19783fb18b6b459cc86afc312f586625e0f299cdf72b2872020ed6de1c196.jpg', 'Wafaa Al Sayed', 'Egypt', NULL, NULL),
('1085158', 'https://media.elcinema.com/uploads/_315x420_09c3f91ea9c3c2889b41afc1bb76f588578a3890d28c8e60d2260fd435841b10.jpg', 'Manar Hosny', 'Egypt', NULL, NULL),
('1085168', 'https://media.elcinema.com/uploads/_315x420_797c109db710c3ea52fc591d3633b2497e52390c46eb0fec8c94b782017217cb.jpg', 'Akram Farid', 'Egypt', ' 6 March 1972', 'Director Akram Farid was actually a veterinarian, graduating veterinary school in 1995 before quitting medicine to pursue his love of film. He graduated from the High Institute of Arts- directing division in 2001, and shortly thereafter made a number of documentaries and small budget independent movies, including \"3 Papers.\"\n\nAfter only 1 year since graduation, he was offered the opportunity to direct a big budget movie, thereby jumping to a position that normally takes his counterparts 15 years to achieve.  He made several big budget \"commercialized\" movies as \"Haha and Tofaha\" \"Omar and Salma\" and \"Love is Like That.\"  Critics received him poorly, citing that these types of films lacked substance, despite being financially successful.\n\nFarid has recently attempted to break free of being type-casted as the \"commercialized director\" by taking on more deep films as \"Mickey\'s Family.\"'),
('1085218', 'https://media.elcinema.com/uploads/_315x420_62d4e7134cf3e8366a182a1d78319e96f382b96160a71f40b3b081498ac0b68f.jpg', 'Madiha Anwar', 'Egypt', NULL, NULL),
('1085363', 'https://media.elcinema.com/uploads/_315x420_864b5f107b4544515bef8c2a00f42b2bd0b7471ea0dbff6ae6ea5ebfe009db3c.jpg', 'Yasser Ali Maher', 'Egypt', '23 April 1958', 'Yasser Ali Maher is a talented Egyptian actor. Despite the fact that he\'s mostly portrayed marginal characters, he\'s succeeded in capturing the attention of the audience.'),
('1085366', 'https://media.elcinema.com/uploads/_315x420_8765b975eb2e8992dc2507f170261548b1aa6b9fd60401cfced41c9fed8a98fc.jpg', 'Maysara', 'Egypt', '24 March 1967', NULL),
('1085651', 'https://media.elcinema.com/uploads/_315x420_44d3a6bfd1f7b8a5dd6c83437bc5dad16a4c981bc94578f79a61bd0a3e88d047.jpg', 'Salah Afifi', 'Egypt', NULL, NULL),
('1085805', 'https://media.elcinema.com/uploads/_315x420_1e7d063cc50b50821332ee41a3ea798419274c462a1c3b87902a01e7ffcfffad.jpg', 'Fekry Sadek', 'Egypt', ' 9 January 1945', NULL),
('1085948', 'https://media.elcinema.com/uploads/_315x420_9e584e09a13aa5c5bed671871de34fbe91a26b94089f09655a993111deac415e.jpg', 'Hany William', 'Egypt', NULL, NULL),
('1086147', 'https://media.elcinema.com/uploads/_315x420_b9b27b8fd97711ffb56ea4d9c4b20e908328601b21ab22ea8ed1248ae0c86015.jpg', 'Maha Abou Ouf', 'Egypt', '28 November 1959', 'Egyptian actor, Maha Abou Ouf is the sister of Dr. Ezzat Abou Ouf the actor and one of the Abou Ouf’s who formed the 4M band at the end of 1970s. 4M performed their original tracks, covered many others and stage played “Mousheera ala baab al-wazeer\" (Mousheera at Al-Wazeer’s gate). Maha studied at the American University in Cairo. Her films include “Ana la aktheb wa lakenny atagammal\" (I Don’t Lie, I Beautify), ”Matloub hayyan aw mayyetan\" (Wanted Dead or Alive), “Ahla al-aw’aat\" (The Best Moments) and “Maalesh ehna benetbahdel\" (We Are Being Tarnished). On TV, Maha has appeared in \"Sayyedat al-fondok\" (The Lady of the Hotel), \"Al-ragol al-aakhar\" (The Other man) and in the sitcom “Raagel we sett settaat\" (A Man and Six Women).'),
('1086427', 'https://media.elcinema.com/uploads/_315x420_4c518da1d2fcce91048e2a65e8f91aa6d63bf8222ae6b8594aa6897048d0a363.jpg', 'ibrahim desoky', 'Egypt', '21 February 1982', NULL),
('1086549', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'essam saber', 'Egypt', NULL, NULL),
('1086595', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'علاء الكاشف', 'Egypt', NULL, NULL),
('1086823', 'https://media.elcinema.com/uploads/_315x420_29d52c8ee548a944efbd86741fecab981ef6d50e585a5744483c0d834ae74146.jpg', 'Kamal El Alfy', 'Egypt', '13 May 1955', NULL),
('1086924', 'https://media.elcinema.com/uploads/_315x420_13114e2df146575c2fd02b60ea6e93b9a54d7b7721be6f4961fd2a11deb5d67d.jpg', 'Salwa Othman', 'Egypt', '20 March 1959', 'Studied English in the faculty of Arts, Salwa is the daughter of actor Othmaan Muhammad ‘Aly. Through her acting career, which began in 1980, she played several roles in radio, cinema, theatre and TV. Among her famous TV series are; “Al-bashaayer i.e. Tidings”, “Al-hall al-waheed i.e. The only solution”, “Al-nahr la yahtarek i.e. The river never burns”, “Al-dayaa’ i.e. Loss” and “Bawwaabat al-Metwally i.e The gate of al-Metwally”.'),
('1086930', 'https://media.elcinema.com/uploads/_315x420_6f81ec376e52ab612193dd0db54576fe3e0bfbb35c152d83234f437390988d2b.jpg', 'أيمن العرب', 'Egypt', NULL, NULL),
('1086934', 'https://media.elcinema.com/uploads/_315x420_1af55f6f194ceb7f4a37b73d00dedf9cbcd21fc4c38b7408300c00445351fdff.jpg', 'Ramez Galal', 'Egypt', '20 April 1973', 'Ramez Muhammad Tawfeek Galal is the son of the great director Tawfeek Galal and the brother of actor Yaasser Galaal. He went to school at Kasr al-Tefl primary school, Orman preparatory school and Giza secondary school. He joined the Higher Institute of Dramatic Arts to fulfill his great passion of acting, a passion that was developed through accompanying his father during rehearsals. Among his graduating group are: Ahmad al-Sakka, Ahmad Helmy, Muhammad Saad, Magdy Kamel, Manal Afeefy, Manaal Salaama and Ayman Azab. Ramez joined the Infantry for his military service. \nDuring his study he acted in “Goaz we Loaz\"  ( Nuts and Almonds) and other TV productions. After a period of absence, Ramez returned with “Hayaat al-Gohary”, a TV series starring Youssra and Moustafa Fahmy, that brought him fame.\nOn stage Ramez participated in one play: “Feema yabdou saraou Abdou” (It seems they stole Abdou). For children, Raamez presented “Al-shabaka al-mas-houra” (The magic net).\nAlthough for his first film he played a small role in Magdy el Hawwaary’s “55 Esaaf” (Ambulance 55), yet he was able to catch the eyes of the audience. Then came the films “Meedo maashakel” (Meedo troublemaker), “Al Baasha Telmeez” (His Excellency the student) and “Hobbak Naar” (Love burns) that paved his way to become a star.'),
('1087034', 'https://media.elcinema.com/uploads/_315x420_52931b884320e0bc3b70cc312a0845c966d2157b43d0fa091d0846a4ed820182.jpg', 'Wahid Hamed', 'Egypt', ' 1 July 1944', 'Wahid is among the best known screenwriters in Egypt. He was born on the 1st of July, 1944 in the village of Beni Quraish in the governorate of Sharqia. Hamed received a Bachelor of Arts degree in sociology in 1965 and began writing drama works in the late 1960s. He first began to realize success through a television series titled “Ahlam Al Fatta Al Taaer” (“Dreams of a Fly Boy”) which aired in 1978 and starred A’del Imam. The series achieved a great deal of success and began a long term collaboration between Imam and Hamed in cinema works that began with the film “Intakhibo Al Doctor Suleiman A’bd Al Bassit” (“Vote for Doctor Suleiman A’bd Al Bassit”) and “Al Insan Ya’eesh Marra Wahda” (“A Person Lives Only Once”) which were released in 1981. The working relationship continued throughout the 1980s. Also in the 1980s Hamed wrote screenplays for the films “Al Takhshiba”, “Al Bareea” (“The Innocent One”), “Al Donnia A’la Gannah Yammama” and “Kashf Al Mastoor” (“Revealing the Hidden One”) which were directed by the renowned director A’tef Al Tayyib . The 1990s saw Hamid collaborate with director Shereef A’rafeh and performer A’del Imam, a collaboration which led to the release of five films titled “Al La’ib ma’a Al Kibar” (“Out of Your League”) (1991), “Al Mansy” (“The Forgotten One”), “Al Irhab wa Al Kabab” (“Terrorism and Kabab”) (1994), “Teyour Al Zhalam” (“Birds of the Night”) (1995) and “Al Noum fee Al A’sal” (“Carefree Sleep”).\nLater in 2006 Hamid penned the screenplay for “A’marrat Ya’coubian” (“The Ya’coubian Building”) which adapted the novel by the same name which was authored by A’laa Al Asswany. That production featured the involvement of a large number of stars including A’del Imam and Nour El Shereef. The work was also the first directing experience of Hamed’s son, Marwan Hamed. Hamed’s last cinema work was “Ehky ya Scheherazade” (“Tell us, Scheherazade”) which was directed by renowned director Yousry Nasr Allah. The writer’s last television work was a series titled “Al Gama’a” (“The Community”) which aired in Ramadan 2010. That series is a biographical work about Imam Hassan Al Banna who founded the Muslim Brotherhood. Hamid is known for his opposition of religious fundamentalism and is considered a staunch opponent of the Muslim Brotherhood. He is married to Zeinab Al Suweidan who heads Egyptian television. The couple have one son named Marwan.'),
('1087051', 'https://media.elcinema.com/uploads/_315x420_bec3cdc01990ec21f366160c52c1f0a89b4485cffd6fc1891f6df286c3c0a2d0.jpg', 'Othman Abdelmonem', 'Egypt', '15 June 1941', 'Othman Abdel Menaem is an Egyptian actor born in the city of Mansoura in 1941. At the start of his career, he worked for years in theatrical productions. He then moved his career to film, where his overweight body and his low-registered voice were used by filmmakers to portray comic characters in tens of feature films. Though his roles were mainly small or supporting roles, he gained wide popularity among Arab audiences. Among his best known works are “Ahlam Hend we Kamilia” (Hend and Kamilia\'s Dreams), “El Kitkat,” and “Batal men Waraq” (Paper-made Hero).'),
('1087277', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'فالكون فيلم', 'Egypt', NULL, NULL),
('1087348', 'https://media.elcinema.com/uploads/_315x420_8a3d5ebb41572b16a99454d0cce28d66bfd72e6dbf66303bf5181221cb66d439.jpg', 'Ahmed Khalil', 'Egypt', '15 January 1941', 'Ahmad Muhammad Ibraheem Khaleel joined “Al-habeeb” Institute after finishing his studies at the High Institute of Cinema in 1965.\nPlayed stage roles like ”Khaadem sayyedayn i.e. A servant for two masters”, “Yasseen we Baheyya i.e. Yasseen and Baheyya” and “Hobb taht al-heraassa i.e. An under guard love”.   \nIn 1970’s, Khaleel travelled to a Gulf country and did not show as an actor then returned heavily to TV in “Yamout al-zammar i.e. Piper dies”, “Hadeeth al-sabaah wal-massaa i.e. Morning and night talk”, “Zaman Alaa al-Deen i.e. The time of Alaa al-Deen”, “Bawwaabet al-Halawaany i.e. Halawaany’s gate” and “Al-forsaan i.e. The knights”.\nParticipated in Haany Lasheen’s film “Al-aragoz i.e. The puppeteer” along with superstar Omar Sharif and among his important roles in cinema; Shaady Abdul Salaam’s “Al-momiaa i.e. The mummy”, Aatef al-Tayyeb’s “Katibat al-e’daam i.e. Execution troop” & “Dedd al-hokouma i.e. Anti-government” and Muhammad Faadel’s “Naaser 56” and “Kawkab al-shark i.e. Orient Star”.   \nAhmad Khaleel played different successful roles in TV yet he did not make the same success in cinema.'),
('1087852', 'https://media.elcinema.com/uploads/_315x420_59d6e596baf5e429980af29b04d48ca197d0c720f6e1905164ebf6f34f11cfe7.jpg', 'Mohamed Barghot', 'Egypt', NULL, NULL),
('1087938', 'https://media.elcinema.com/uploads/_315x420_c37a77daf89823bb8774ac4a2614f408a187013f924490a743b814f33933985b.jpg', 'Kamel Abu Ali', 'Egypt', '26 August 1954', NULL),
('1087969', 'https://media.elcinema.com/uploads/_315x420_d7042c3ff901fc1693296e157a2d0eaecc8ad52d29b998c6b973bbdb7c91c7a3.jpg', 'Salwa Khattab', 'Egypt', '26 February 1959', 'Salwa Khatab (Salwa Mohamed Morsi Khatab) was born in Cairo in 1964. She graduated from the Higher Institute for Dramatic Arts in 1978. Her acting career began when director Henry Barakat cast her in the film “‘Ashaq Taht El Ashreen” (Love Under 20), but her big break came with the TV series “Hend We El Doctor Noman” (Hend And Doctor Noman). Since that time, Salwa Khatab has alternated between roles in television and cinema. Her cinematic performances include those in: “Shawader,” “Desouky Afendy Fil Mussayef” (Desouky Afendy At the Resort), “Afareet El Asfalt” (Road Demons), and “El Sahir” (The Magician). Some of her television performances include those in: “Raafit El Higan,” “El Dhou El Sharid” (Stray Light), “Hadeeth El Sabah We El Mesaa,” (Morning and Night Talk) and “Neran Sadika” (Friendly Fire).'),
('1088023', 'https://media.elcinema.com/uploads/_315x420_e43a330208add86e7edbb571f63e4398a22984251aa28de847e0aa74f86690d4.jpg', 'Karim Abo zaid', 'Egypt', ' 9 July 1980', NULL),
('1088244', 'https://media.elcinema.com/uploads/_315x420_e35f90dc9e30dd9094a6e3cff7570b5825c5e4304fa2cc411aaf6b13389aee6d.jpg', 'Yasser Abdul Rahman', 'Egypt', '22 April 1961', 'In 1983, Yaasser graduated from the Higher Institute of Arab Music at the Egyptian Academy of Arts.'),
('1088274', 'https://media.elcinema.com/uploads/_315x420_1556a0818c004081d9e7dd7a525d2faaebb08f98e80b09b19a470d6ae59c409b.jpg', 'Mohamed Metwally', 'Egypt', '11 March 1945', NULL),
('1088277', 'https://media.elcinema.com/uploads/_315x420_13c3212e62df795fdea9d02d00956f53c1a27c192662247b2698bf99347ac830.jpg', 'Mohamed Shoman', 'Egypt', '25 March 1958', NULL),
('1088389', 'https://media.elcinema.com/uploads/_315x420_abf87296da3981ee50872c6fa89cf42fbfac67b696e289bde9d44c756b0eca58.jpg', 'Omar Naguib', 'Egypt', '18 June 1982', NULL),
('1088393', 'https://media.elcinema.com/uploads/_315x420_70cbd8ef86dc97132a5891c8104034d037fd60d697b081e28cbfa97cf33d3e63.jpg', 'Doaa Hegazy', 'Egypt', NULL, NULL),
('1088394', 'https://media.elcinema.com/uploads/_315x420_b96a6eb78a1a1b064e8acd331c453464f19004765140c9f2bac1905bf55b8342.jpg', 'Nahed Farid Shawqy', 'Egypt', '25 December 1950', 'Nahed Farid Shawki is an Egyptian film producer, and the owner of her eponymous production company. Her productions include “Hysteria” (1998) which starred Ahmed Zaki and Abla Kamel and was directed by Adel Adeeb, and “Men Nazret Ein” (From a Glimpse) (2003) which starred Amr Waked and Monza Zaki and was directed by Ihab Lama\'y. She has also worked as an executive producer in several television series.'),
('1088417', 'https://media.elcinema.com/uploads/_315x420_0c10062969aa3160b02fe93123c83c8ddb61938c42ef940efc0a8bd6b8bb6cec.jpg', 'Majed El Masry', 'Egypt', '19 March 1963', 'A singer and actor who was born in Tanta. He graduated from Al Azhar University and his talent was discovered in school where he studied the art of popular and classical dance and ballet. He started by singing in night clubs with his wife at the time singer “Mona Ish Ish” where they made their own duet called Maged and Mona. \nMaged had compiled a singing album that was released in the market but unfortunately it wasn’t very successful. He was discovered and introduced to the cinema by late director Hussam El Din Mostafa in the movie “Hekmat Fahmi the Spy” \nMaged also did some series such as “The Twins”, “Bird Dreams”, “For Security Reasons”  and “The Shadow’s Image” and he participated in one play.'),
('1088539', 'https://media.elcinema.com/uploads/_315x420_5d548fd1482d99bb2457d5000de040cd188b66867533b1cad5470f661cbbee5d.jpg', 'Mohammed El Sadaany', 'Egypt', NULL, NULL),
('1089323', 'https://media.elcinema.com/uploads/_315x420_32a60afd9785a4a76907d42a2a8dc04b1db751604c543e0b19399a42ee3e3bb1.jpg', 'Mostafa Hashish', 'Egypt', '13 May 1953', NULL),
('1089352', 'https://media.elcinema.com/uploads/_315x420_03284523a1e677cdd884829d4c6bce433a4c7bb57e2e9c194ce32a3077885048.jpg', 'Ehab Sobhi', 'Egypt', NULL, NULL),
('1089468', 'https://media.elcinema.com/uploads/_315x420_86b1be24ee7999e49234d65566f259043880e4db4fa8189543b05a8ab0abb5fc.jpg', 'Ahmed Kamal', 'Egypt', '22 August 1959', 'Ahmed Kamal is an Egyptian actor and acting coach who was born in 1959. He started working in film during the eighties of last century in several important films like Khairy Beshara\'s \"Youm Mor we Youm Helw\" (A Bitter Day and a Sweet Day) and Dawood Abdel Sayed\'s \"El Kit-kat\" and \"Mowaten we Mokhber we Haramy\" (A Citizen, an Informer and a Thief). He also worked in several successful television series like \"Farah Layla\" (Layla\'s Wedding) and \"Zat.\" He has been running his own acting workshop for years.'),
('1089793', 'https://media.elcinema.com/uploads/_315x420_eb471342f41c9b6126576073a4a465316849bc3ee59f3db10f3e271ba5b68a0f.jpg', 'Ezzat Abu Ouf', 'Egypt', '21 August 1948', 'Ezzat Ahmed Shafiq has earned a bachelor’s degree in medicine. \nHe is a member of the family of the (performer Ezzat Abu Ouf) which includes three daughters as well. Together they formed a troupe in the early 1980s that was known as (“The Four Ms”) which assumed roles in several theatrical performances which include “Ashra Alla Bab Al Wazeer”.\nHis sister Maha would later take up acting as a career and after the troupe was disbanded he was free to work on television and cinema projects. \nAmong the acting performances where his talents were most apparent were “Hawanem Garden City”, “Nisf Rabie Al Akhir” and “Ziziniyah”.\nHe is married to someone he met outside of the acting community and he has two children named Kamal and Mariam.'),
('1089818', 'https://media.elcinema.com/uploads/_315x420_aa5094e1034bbdb6fb918720a11e16a46ff0b987b6bf484717c0cfa37eb41eed.jpg', 'Samy Fahmy', 'Egypt', NULL, NULL),
('1089829', 'https://media.elcinema.com/uploads/_315x420_8b271ce52195b471bea40d2d10c0fa9b808182415445cc4b32412343310b53b7.jpg', 'Randa Al Behiry', 'Egypt', '18 August 1983', 'Randa is a young Egyptian actress. She loved theater from an early age and would often go to the theater with her mother, who worked there as a designer. Randa studied the English language at the faculty of arts. Randa began her television career as a model in commercials, and soon transitioned into music videos. Her success and popularity in music videos brought her more and more attention. From 1998 onwards, she began pursuing roles in television, theater and cinema. She has proven herself a performer to watch. Critics and the general public have praised her performances despite the fact that her roles have varied in terms of character and setting. Though she is young and just at the beginning of her career, her success has brought her many important roles. Randa has performed alongside several major actors including Yahya Al Fakhrany, Elham Chahine, Yousra, Ahmed Eid and the Lebanese musician Rola Saad.'),
('1089996', 'https://media.elcinema.com/uploads/_315x420_52b435a98b4efaef7693cb7cb696c758a9de6bf7a7868edae819c06b560d2d26.jpg', 'Raghda', 'Syria', '26 November 1957', 'Raghda’s full name is Raghda Mahmoud Na’na’. She was born and raised in Syria to a Syrian father and an Egyptian mother. She grew up in the Syrian town of Aleppo where her father’s house included 14 children. Raghda enrolled at the Arabic language division of a literature faculty in Cairo. She worked in Syrian cinema before assuming the leading role in the series “A’sr Al Houb” (“The Age of Love”) in 1982. Her activities are varied and include work on theater, television and cinema. Amongst the television productions that she has taken part in are “A’sr Al Houb” (“The Age of Love”), “Istabl A’ntar” (“A’ntar’s Stables”), “Al Dawaer Al Mughlaqa” (“Exclusive Circles”), “La Ilah Ila Allah” (“There is no Deity But God”). Her well known theatrical performances include “Saloumy” and “Al Rahaen” (“The Hostages”). She has assumed roles in several series in Syria, amongst which is a series titled “Al A’bbayid”. In 2002 Raghda worked as an announcer on “Garrat Al Qammar” (“Neighbor to the Moon”). Throughout her career Raghda has utilized her intelligence in order to consciously mould her stardom. Most of the roles that she has undertaken, and in particular those in cinema were directed by Kamal Al Sheikh and  Darid Laham. Raghda\'s most famous roles were in  in “Al Embrator” (“The Emperor”) and “Raghbat” (“Wishes”), and \"Kaborya\" (Crab).'),
('1090208', 'https://media.elcinema.com/uploads/_315x420_fc418fcc34f7f4a8dc3f9fb187dfd99b6d75b580c885d6081998b5d80549e06b.jpg', 'Samy Maghawry', 'Egypt', '16 September 1951', 'Samy Maghawry is an Egyptian actor. He was born in 1951 in Cairo. He graduated from the faculty of law in 1975. He debuted as an actor in the television series \"Leilet Elqabd Ala Fatma\" (The Night Fatma Was Aressted) in 1982, after which he went on to appear in numerous television series, theater plays and films. His other notable work includes roles in \"Bein El Wasrein\" (Between the Two Palaces) in 1987, \"Ana Wenta We Baba Fel Meshmesh\" in 1989, \"Zezenia\" in 1989 \"Heena Maysara\" in 2007, \"A\'ilat Mickey\" (Mickey\'s Family) in 2010 and \"Moga Harra\" (Heat Wave) in 2013.'),
('1090281', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ismail Gamal', 'Egypt', '22 November 1947', NULL),
('1090408', 'https://media.elcinema.com/uploads/_315x420_952972c75d79ac2d1dde622b984354282fbffd1ffbf05fffe51ecda494d5995f.jpg', 'Wissam Sabbagh', 'Lebanon', '19 March 1974', NULL),
('1090694', 'https://media.elcinema.com/uploads/_315x420_d07c91f0cf985d1418b058f789ad760c87de8263e0a508fe8a754c6188f288bf.jpg', 'Screen 2000', 'Egypt', NULL, NULL),
('1090981', 'https://media.elcinema.com/uploads/_315x420_ddd51d1a66fa56a1d20e8786dc6de2e699148d61ac88a08d90e72eef6e61a027.jpg', 'Jumana Murad', 'Syria', ' 1 April 1973', 'Jumana Murad is a prominent Syrian actress. She earned her degree from the University of Damascus, then made her TV debut in 1998 when she began acting on television dramas. She worked on eighteen TV shows for the next decade, until she made her film debut in \"El Shayateen\" (Devils) in 2007. She\'s acted in over thirty productions, including \"El Farah\" (The Wedding) in 2009. Murad also owns her own production company, Jumana International. Murad made headlines this year when she announced she was in a romantic relationship with a man (his nationality remained a secret) whom she did not intend to marry.'),
('1091210', 'https://media.elcinema.com/uploads/_315x420_c16f864481a4e36fc4002956583c1995b8111a0ba4cc66c2ac55a56efed107d7.jpg', 'Zahrat Al Oula', 'Egypt', '10 June 1934', 'Zahra al-‘Oula Bakir was born in the district of Muharram Bey in Alexandia to a family originally from al-Mahala. Her talents for acting and imitation were apparent when she was in secondary school. Her father was a friend of Youssif Wahbi and so he presented her to him and she enrolled at the Acting Institute with the help of Zaki Tuleiman. Zahra acted in several plays including “Hourriyah men al-Mareekh”, “al-Bakheel” (“The Miser”), Mareed bi al-Wahm” (“Illusory Illness”), “Fattish ‘an al-Maraa” (“Look for the Woman”), “al-Ghabi wa Anna” (“The Idiot and Myself”) and “Sab’a Farkhat wa Deek” (“Seven Hens and a Rooster”). Thereafter she was assigned major cinema roles. Zahra enjoyed a romantic aura and she received a diploma from the Higher Institute for Cinema in 1954. Zahra was the first in her class and she continued her stage career on modern theater. Zahra married Salah Zu al-Faqqar and later director Hassan al-Saifi. Among the television series which she has acted in are “Waffiyat Nas Tayebeen”. Zahra was honored at the Feature Films Festival. While a youth, Zahra represented the model of the innocent and suppressed girl. She has not portrayed any evil characters as her appearance does not lend itself to such roles. Zahra also acted in “Radd Qalbi”, “Du’aa al-Karwan” and “Tareeq al-Amal”. Despite the fact that she has acted in some comedies her roles were generally not comedic.'),
('1091387', 'https://media.elcinema.com/uploads/_315x420_6cb1be9b821fe49b81c72534c3854278331b015103a58ea6a5001de5be722f22.jpg', 'Youssef Shabaan', 'Egypt', '16 July 1936', 'Egyptian actor, born Youssef Sha’baan Shemeis in Cairo has studied acting. Played several stage roles and caught many an eye. Great cinema director Hassan al-Emaam gave him a leading role in “Al-mo’geza i.e. The miracle” and several roles; “Zokaak al-madakk i.e. Madakk alley”and “Baae’at al-garaaed i.e. The newsgirl”.\nSha’baan excelled in TV series like “Raafat al-Haggaan”, “Haala wal-daraweesh i.e. Haala and the Dervishes”, “Eilet al-Doghry i.e. Doghry’s family” and “Al-taw’am i.e. The twins”.\nYoussef married actress Laila Taaher, actress Sihaam Fat-hy and her Highness Princess Nadia Sherine mother of his daughter Sainaa.\nIn his early life, Youssef Sha’ban was the racehorse in cinema especially in “Miramar” and “Hammaam al-Malateely” then gradually went to TV.\nStarting 1997, Sha’ban was elected Chairman of Egypt’s Actor’ Union for two consecutive periods.'),
('1091450', 'https://media.elcinema.com/uploads/_315x420_1712244d400270db5eb3f34e05e7baecbc36b2feb2bfc3c90a5f8f1cdc2ba83d.jpg', 'Nour', 'Lebanon', '23 December 1977', 'Marianne Philip Aby Habib, known professionally as Nour, is a Lebanese actress.  She began her career as an advertisement model after graduation from the Faculty of Fine Arts in Beirut in 1995.  Her first major film role was in “Short w\' Fanella w\' Kab” (Shorts, T-Shirt and a Cap) opposite Ahmed El Sakka in 2000. She then starred in many Egyptian blockbusters like “Ashab Walla Business” (Friends or Business) in 2001, “Okal,” (2004), “Matab Senaa\'y” (Artificial Speed Bump) and “Zarf Tareq” (Urgent Incident) opposite with Ahmed Helmy in 2006. She also starred in the television series “Al Amil 1001” (Agent 1001) in 2005, and “Domoa\' Al Qamar” (Moon\'s Tears) in 2008.'),
('1091522', 'https://media.elcinema.com/uploads/_315x420_bba07e3b3844108ccf8a5de28d427f09557c92cd74b634ea5e19f15bff238c4a.jpg', 'Islam Yousuf', 'Egypt', '27 January 1973', NULL),
('1091563', 'https://media.elcinema.com/uploads/_315x420_ecbd68346f7e26f22169506f5ff799de46aa63002430560bdba1ba96dcdf95fb.jpg', 'Madiha Al-Bakry', 'Egypt', ' 4 April 1968', NULL),
('1091632', 'https://media.elcinema.com/uploads/_315x420_4f32dc15d8d5389edc04a8054fa3dd37af5d7a19f7bc98b11485c1f80e5db68f.jpg', 'Hadi Al Jayyar', 'Egypt', '15 October 1949', 'Hady El Gayar is an Egyptian actor. He studied acting at the High Institute of Theatrical Arts. His breakthrough came with his role in the popular play “Madraset Elmoshaghbeen” (School of Rowdies). He appeared in numerous television series, including “Almal wal Banun” (Fortune and Progeny), “Elraya Elbeida” (The White Flag), “Alnawares wal Soqur” (Albatrosses and Falcons). His notable film roles include those in “Thom Tashreq Alshams” (Then The Sun Rises) (1971) and “Ihtares Esabet Alnisaa” (Watch Out for the Women\'s Clan) (1986).'),
('1091891', 'https://media.elcinema.com/uploads/_315x420_3e07e08bb810554455679a9bdfb866c0a576bacf436a736dc0f060aa1e3ec75d.jpg', 'Amr Abd Al-Aziz', 'Egypt', ' 9 December 1982', NULL),
('1092032', 'https://media.elcinema.com/uploads/_315x420_81cb57d7351eab9f40a83ec06a929c63e1a464daccc8b469edb9ea55d57e2575.jpg', 'Ahmed Yousri', 'Egypt', ' 2 June 1975', NULL),
('1092165', 'https://media.elcinema.com/uploads/_315x420_7c056d966addda92d8e8b3468d7b3ca703873b5e82f68663be6a3e7e16c0562c.jpg', 'Mostafa Ali', 'Egypt', ' 5 October 1975', NULL),
('1092318', 'https://media.elcinema.com/uploads/_315x420_e0e69ea142cd08a02418ebcccd2219828d0f6557110595e7b5ac18f5264556bd.jpg', 'Amira Naif', 'Jordan', '20 October 1980', NULL),
('1092357', 'https://media.elcinema.com/uploads/_315x420_10de3ee047532982ef7f0a73f56e3f40317e05d67c28e505335c6194a23c2b9a.jpg', 'Rojina', 'Egypt', '16 April 1973', 'Egyptian actress, graduated from the High Institute of Dramatic Arts yet never played a stage role. “Al-‘aaela i.e. The family”, “Shayy men al-khawf i.e. Some fear”, “Awraak Mesreyya i.e. Egyptian documents” and “Yawmmeyyaat zowg mo’aasser i.e. Diaries of a modern husband” are among her TV series. Roujina is married to actor and director Ashraf Zaky.'),
('1092421', 'https://media.elcinema.com/uploads/_315x420_01bcf9223e1d09c7d871a6f98a689ab4ae3779f5061763b78aa43400cb3875fa.jpg', 'Hani Khalifa', 'Egypt', ' 6 March 1970', 'Hani Khalifa originally from upper Egypt started as an assistant director in movies such as “Joy Thief” and “Nut Shells”\nIn 2003 he decided to direct the movie “Sahar Al Layali” or “Staying Up Late Nights” which impressed many, but then he disappeared for a long time, he was offered to direct the movie “Free Time”  but declined due to his disagreement with the producer.\nHe stayed away from the sport lights until 2011 when he directed his series “The University” that impressed many fans and audience.'),
('1092534', 'https://media.elcinema.com/uploads/_315x420_bff8b82c3987a34c76c008a5bcb2d545b7c5d69eaa6ea61418cd5e0964dec17d.jpg', 'Hussein Riad', 'Egypt', '13 January 1897', 'Born 13 January 1897 in al-Sayyeda Zeinab (popular district of Cairo), in 1916 he quit school to start acting and joined the Arab Acting Institute. In 1923 he worked with Youssef Wahby Theatrical Troupe then worked with Abdul Rahman Roushdy, Moneera al-Mahdeyya, al-Reehany, Al-Kassaar, Awlaad ‘Okaasha and Fatma Roushdy Troupes. He worked in silent films starting 1926 and since then he acted in more than 100 films. He received the State Award and Medal of Science and Arts (1963) and died in 1965.'),
('1092795', 'https://media.elcinema.com/uploads/_315x420_e1c50dfc4ada073ec0416c0ca912bb431a6f6ec16a0b1d7ace57bc3a8cb82b32.jpg', 'Nahed Roshdy', 'Egypt', '14 September 1956', NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1092854', 'https://media.elcinema.com/uploads/_315x420_f861261981165438a283ac11b018a34795f13e85b353f5615f11a1524adc7854.jpg', 'Mostafa Fahmi', 'Egypt', ' 7 August 1942', 'Mostafa Fahmi is an Egyptian actor. He was born in 1942, and studied cinematography at the High Institute of Cinema. He then worked as an assistant in \"Amira Hobby Ana\"\" (Amira My Love) in 1974, and started his acting career the same year with a role in the film \"Ayna Aqly\" (Where is My Mind?). His breakthrough came two years later, when he appeared in four other films, and since then, he has worked in numerous films and television series.'),
('1093004', 'https://media.elcinema.com/uploads/_315x420_fe06ec11b5db68e61f8deb9b3471b323b15032539ebbfd7fbab8685bd1c3d638.jpg', 'Hussain Ismael', 'Egypt', '29 October 1922', 'The Egyptian actor Hussein Ismaeil was born on the 29th of October 1922. He was known for his supernumeraries\' roles where he presented the Barber, the butcher and the concierge. His brother Abdel Monien Ismaeil was one of his competitors in the artistic field.\nHe passed away on the 25th of July 1974.'),
('1093286', 'https://media.elcinema.com/uploads/_315x420_aca8119d79a0f8347bb12ca386234e1861c98bf0a748580c787a34b77f03bc76.jpg', 'Mohammed Elshershaby', 'Egypt', '27 October 1965', NULL),
('1093291', 'https://media.elcinema.com/uploads/_315x420_369a51a8c5dab965c5ed5124a6eef64d7b52baae6711872017be91badff97a3a.jpg', 'Sandra Nashaat', 'Egypt', ' 2 February 1970', 'Sandra Nashaat Bassaal, in 1993, graduated from faculty of Arts French section a year after finishing Director studies at the Higher Institute of Cinema.\nHer first short film was “Akher sheta i.e. Last winter” and directed “Al-moviola i.e. The moviola” a documentary film about the editor Kamaal Abul-Ela. “Mabrouk we Bolbol i.e. Mabrouk & Bolbol” was her  first feature film (1996) starring Yahia al-Fakharaany and Dalaal Abdul Azeez, then directed the successful “Leih khalletny ahebbak i.e. Why did you make me love you?” (1999) starring Karim Abdel Azeez, Mona Zaky, Hala Sheeha and Ahmed Helmy. Also directed “Harameyya fee KG2 i.e. Thugs in KG2” starring Karim Abdel Azeez, Hanan Turk and Maaged al-Kedwaany which tells the story of a safe burglar who fell in love with the kindergarten teacher of his friend’s daughter who helped him to quit stealing, the film was shot by Ihaab Muhammad Aly and written by Belaal Fadl.\nSandra directed video clips like Muhammad Fouad’s “Fakrak ya nasseeny i.e. I remember who forgot me”, Khaled Aggaag’s “Asaab hobb i.e. Toughest love” and Ghada Ragab’s “Lemaatha i.e. Why”.'),
('1093354', 'https://media.elcinema.com/uploads/_315x420_99dd1b8177cd1e07d1e60c2f56f7cb301b564cff0de45b32905aa5c675ba4649.jpg', 'Mohamed Rady', 'Egypt', '14 October 1939', NULL),
('1093646', 'https://media.elcinema.com/uploads/_315x420_bd402202d2bcc7275669f0b75f19b9fea7180fdd1a8a849d286beb16f4b9c070.jpg', 'Shady Ali', 'Egypt', '20 May 1975', 'Shady Aly is an Egyptian television and film director. He graduated from the cinematography department in the High Cinema Institute in 1997. He is most known for being the cinematographer in films including \"Ezaa\'at Hob\" (Love Broadcast) and \"Bolteya El Ayma\" (Swimming Tilapia). He directed the film \"Hayaty Mebahdela\" and the television series \"Alragol Al-Ennab\" (Hibiscus Man).'),
('1093781', 'https://media.elcinema.com/uploads/_315x420_6dd74164b04dbda09e8f610375a02cddb956f208f79786511011a66c906806a3.jpg', 'Maher Essam', 'Egypt', ' 5 October 1979', 'Maher Essam was born in Imbaba. He started his acting career when he was only 5 years old with the famous director Youssef Chahine. Hassan Abd El Salam cast him in the adapted play “Zoqaq El Madaa.”'),
('1093917', 'https://media.elcinema.com/uploads/_315x420_b23e2e28e6086733f472d465bb4a6ef70aefd45f2369060884836d5aef0e1005.jpg', 'Elham Shahein', 'Egypt', ' 3 January 1960', 'Elham Shaheen was born in Heliopolis, Elham graduated from the Institute of Performing Arts, acting division in 1982.  Director Kamal Yassin launched her career by giving her a role in his made-for-TV-play \"Hooreya men Al Marikh\" (Mermaid from Mars).\n\nShe starred in many TV shows including:  \"Akhu El Banat\" (Brother of the Sisters), \"Al El Bahr\" (The Ocean Said), \"Hatta la Yakhtaniq Al-hob\"(So Love Doesn\'t Suffocate) \"Nisf Rabia\' Al Akhar\" (The second half of Spring), \"Layaly Al Helmeya\" (Nights of Helmeya), and \"Samhoony, Makansh Asdy\" (I\'m Sorry...I didn\'t mean to).\n\nShe also won many awards for her film roles in \"The Gentle\" and \"Ya Dunia Ya Gharamy\" (Oh World, Oh my Love).\n\nElham is known for her versatility in choosing different types of roles both in film and the small screen.\n\nIn her personal life, Elham was married briefly to Egyptian producer Adel Hosny, then to a Lebanese business man.'),
('1094321', 'https://media.elcinema.com/uploads/_315x420_a88960eb2314ee91ba68db18521ffc8f639307bd6397c104ef6fe988576ce710.jpg', 'Nezar Shaker', 'Egypt', NULL, NULL),
('1094402', 'https://media.elcinema.com/uploads/_315x420_01313f471694de88ce22a115a8ecaa0db288198ad4b1fa6d338bc557629a8a05.jpg', 'Farouk El Feshawi', 'Egypt', ' 5 February 1952', 'Farouk is an Egyptian theatre, cinema and TV actor. Graduate of both the faculty of Arts and the Higher Institute of Dramatic Arts. His booming in TV series “Abnaa’y al-a’ezzaa shokran i.e. My dear children..thank you” and his role in “Al-mashbooh i.e. The suspect” with Aadel Emaam, paved his way to stardom.  Among his popular TV series are: “Alf leila we leila i.e. One thousand and one Nights ”, “Al-haawy i.e. The magician”, “’Aly al-Zeibaq”, “Domou’ saahebat algalaala i.e. Her majesty’s tears”, “Laylat al-kabd ‘ala Fatma i.e. The night Fatma was arrested”, “Zeynaat wal-talat banaat i.e. Zeynat and the three daughters”, “Canaria wa shorakah i.e. Canaria and Co.”. Among his stage plays are: “Al-dokhaan i.e. Smoke”, “Tharthara fawk al-neel i.e. A Drift on the Nile”and “Bedaaya wa nehaaya i.e. The Beginning and the End”.  His career included king Farouk and beggers and a variety of roles in between. During the 1980’s and the 1990’s he was the most productive movie star. Farouk married several times. His first wife was Soumayya al-Alfy, mother of his only son actor Ahmad al-Feeshaawy. He also married actor Soheir Ramzy and other women.'),
('1094642', 'https://media.elcinema.com/uploads/_315x420_63774bdf5ff5b4ab5f8eb2c6558c8f09585062ff54bd8f9fc15655954deb368c.jpg', 'Ahdy Sadek', 'Egypt', '16 November 1950', 'Ahdy Sadek is an Egyptian actor. He was born on November 16, 1950. He graduated from the High Institute of theatrical Arts, and started his career in the mid 1970\'s. His career consisted of small and supporting roles in numerous television series, plays and films, and had never landed a lead role throughout his whole career. Among his memorable roles in television series are “Layaly El Helmeya” (El Helmeya Nights), “Raafat El Haggan”, “Bawabet El halawany” (El halawany\'s Gate), and “Arabesque”, and in films are “Al Mutawahisha” (The Savage), “Anyab” (Jaws), “Shahazun wa Nubalaa\'” (Beggars and Nobles) and “Al youm Al Sades” (The Sixth Day).'),
('1094675', 'https://media.elcinema.com/uploads/_315x420_ea2a3492caa3ea6561dc1e6202dd575daff7be1d51601998826a4cf8c91daf0f.jpg', 'Mohamed Abdul Rahman', 'Egypt', NULL, 'Mohamed Abdel Rahman is an Egyptian actor and comedian. Following his graduation from Ain Shams University, he was discovered by Ashraf Abdel Baqy and appeared in his sitcom \"Ragel we Set Settat\" (A Man and Six Women). He is best known for his roles in the series of plays \"Teatro Masr\" and the television series \"El Kebir Awy\".'),
('1094794', 'https://media.elcinema.com/uploads/_315x420_99972d3a63510abb2307892aa91178916c789503175f1da8b2043d20b52582d4.jpg', 'Ahmed Gaber', 'Egypt', '12 October 1966', NULL),
('1094915', 'https://media.elcinema.com/uploads/_315x420_306ed019b6ecb18b99b37a6ed2feae35fbabbf13057ea530fe1a667b96ddb205.jpg', 'Enji Sharaf', 'Egypt', '24 November 1978', NULL),
('1094932', 'https://media.elcinema.com/uploads/_315x420_88dd9c38b02939bb70dd685e677429379a203fb48b6483abc0f5c5625de94b13.jpg', 'Ashraf Barhom', 'Palestine', ' 8 January 1979', NULL),
('1095095', 'https://media.elcinema.com/uploads/_315x420_17261b24c729b260de565d23287dc70b489b38ee881bae9d3bc0497765f277a8.jpg', 'Mahmoud Abdallah Bakr', 'Egypt', NULL, NULL),
('1095893', 'https://media.elcinema.com/uploads/_315x420_a9f9dbb6a287ef5aaa4fdf2875126fecb5e52b1acf878ad8088baa1979d09597.jpg', 'Mimi Gamal', 'Egypt', '21 June 1941', 'Ameena Mostafa Gamaal was born to an Egyptian father and a Greek mother. She started her career in acting at a very young age. She was Emaad Hamdy and Madeeha Youssry’s daughter in “Akwa men al-hobb\" (Stronger than love). Mimi continued acting as a young woman. She worked on stage with Al-Fannaneen al-Mottahedeen  (The United Artists) Troupe and in several individually owned theatre troupes. She became widely known through her numerous TV roles. Among her very successful plays are; “ Nemra etnein yeksab\"(Number two wins), “Al-abeet\" (The fool), “Motreb al-awaatef\" (The emotional singer”,” and ”Esh al-maganeen\" (Coo coo’s nest). Mimi also participated in TV series; “Hawaanem Garden City\" (Ladies of Garden City) and “Al-dawwaama\" (The whirlpool) are two successful examples. \nMimi is married to Hassan Moustafa the actor who was her partner in many plays and she gave him two daughters.'),
('1096064', 'https://media.elcinema.com/uploads/_315x420_3b5e4627f5ef170929b65603fe779405834cdbaf73f24a5653d5cc27a4843615.jpg', 'Nada Bassiouny', 'Egypt', ' 2 November 1968', 'Nada Basyouni is an Egyptian actress. She studied acting in the High Institute of Theatrical Arts. Her breakthrough came with her role in the 1988 film \"Algawhara\" (The Jewel). She then embarked on a prolific television and theater career, including notable roles in successful series like \"Hawanem Garden City\" (The Ladies of Garden City).'),
('1096138', 'https://media.elcinema.com/uploads/_315x420_0624f1cd99fd872ea9ecf9fdba7d36cb247ca64b998d44e7d00306f9f41b5d25.jpg', 'Mohamed Soliman', 'Egypt', '12 October 1977', 'Mohamed Soliman is an Egyptian actor. He was born in 1977. He studied at the Egyptian Consevatoire until high school, and had a few chances to act on stage there. He then joined the faculty of commerce at Cairo University, and worked in tourism following his graduation. His breakthrough as an actor came after he appeared as a model in a television advertisement, and was cast in Sherif Sabry\'s film “Sabaa Wara\'at Kotshina” (Seven Playing Cards). He went on to star in several films including “Ehna Eta\'belna Abl Keda” (We Have Met Before), “Fattah Eneik” (Open your Eyes), “Leabet Elhob” (The Love Game). He also appeared in several television series including “Dumoa\' Alqamar” (The Moon\'s Tears), “Man Atlaq Alrosas Ala Hend Allam” (Who Shot Hend Allam) and “October Al A\'khar” (The Other October).'),
('1096178', 'https://media.elcinema.com/uploads/_315x420_e16894de918a55c1458f1bb8439fb26df6333cb9a7ee0124110efa05b0297686.jpg', 'Hamdi Al Wazeer', 'Egypt', '29 April 1955', 'Ahmed Sayed Ahmed El Wazeer was born in Port Said. He achieved a B.Sc. in engineering from Kena University. He worked in the theater directing plays such as “Harb El Basoos” and “Tokoos al isharaat wal tahawolat”. Some of his works for the television include “Al mazad”, “Awarak Masreya” and “Al Koni”. He a multi award winner and comes from a family with artistic background such as actors and directors. Although he had an excellent head start, however, his glamour faded quickly.'),
('1096341', 'https://media.elcinema.com/uploads/_315x420_429d11cbbce6bbe2a88237cdefc3d4c1a901695091b7518d1c60ddd249f7f2b1.jpg', 'Lamia Adel', 'Egypt', NULL, NULL),
('1096534', 'https://media.elcinema.com/uploads/_315x420_d643555a357b3b8cb0c77c170a6ecbf7e5db18c2864b2578842f857bbbe8cc04.jpg', 'Samira Abdelaziz', 'Egypt', ' 5 May 1935', 'Born in Alexandria, Sameera Abdul Azeez studied commerce and then graduated from the High Institute of Dramatic Arts. She married the writer Mahfouz Abdul Rahmaan. Started her career in Alexandria Radio (1957) and presented the famous program “Kaal al-faylassouf i.e. The philosopher’s talk” for Egyptian Radio along with Muhammad al-Sab’.\nAbdul Azeez played many TV roles like; “Dameer abla Hekmat i.e. The conscience of principal Hekmat”, “Om-Kolthoum”, “Banaat Zeinab i.e. Zeinab’s daughters” and “Imam al-do’a i.e. The Imam of Islam advocates”.\nSameera Abdul Azeez is telling children stories in the program “Ahlaam sa’eeda i.e. Sweet dreams” in Egyptian TV channel 3.'),
('1096702', 'https://media.elcinema.com/uploads/_315x420_b4da4a6c692bb3dda2a08114bba54318b64f89716bc2997ddd58b9eecc30843d.jpg', 'Adel Shukri', 'Egypt', NULL, NULL),
('1096796', 'https://media.elcinema.com/uploads/_315x420_b6c098851e553c0ce0fc0eb0b3c2ba83906b002eda3cdae86f4dab4824632df4.jpg', 'Mohsen Sarhan', 'Egypt', ' 6 January 1914', 'Mohsen Sarhan was an Egyptian actor who was born in Port Said in 1914. He was raised in Port Said, and after graduating from university, he moved to Cairo and worked as an employee for the Ministry of Agriculture until 1939. In 1944, he started taking free classes in theater and cinema, and also joined the National Troupe in the 1940s. The films he acted in include: “Kas El Azzab” (Cup of Agony), “El Liqaa El Akheer” (The Last Meeting), “Samara,” “Baeat El Ward” (The Rose Seller), and “Seraa Fil Jabal” (Struggle in the Mountains). He passed away in 1993 at the age of 79.'),
('1097024', 'https://media.elcinema.com/uploads/_315x420_d1abfb1f8a1f30677b150fb75ee57d20afffe1e6898c4fc850d121538028787b.jpg', 'Hisham Al Meleji', 'Egypt', ' 1 December 1972', NULL),
('1097101', 'https://media.elcinema.com/uploads/_315x420_2c34d659cff1143efeeb1b9c39cd4e437c84bedeb4efc60a1510eab83144a1cd.jpg', 'Medhat Saleh', 'Egypt', ' 2 November 1960', 'Muhyy Mahmoud Saleh was born in Shubra, Egypt. He studied there and memorized the Holy Quraan. His talent was noticed by Dr. Youssif Shawqqy and he spent a while working in a children’s program at the radio broadcast. He successfully performed the songs “Akeed” (“Definitely”), “Kawkab Thanee” (“Another Planet”) and “Hadd Yeqoul li Habiby” (“Someone tell My Lover”). He also performed on Ramadan trivia shows for several years including 2003. The performer has also taken part in the stage productions “Eshta wa ‘Asal” (“Cream and Honey”) and “Hazimny Ya”. Some of his other songs include “Hekayya Wardiyah” (“A Rosy Story”) and “Ghany al-Mizmar” (“Play the Flute”).'),
('1097108', 'https://media.elcinema.com/uploads/_315x420_57038716ce110dd88cc59eb24cb407fbe67119e8b5551bd04f778817f7ca4a27.jpg', 'Omar Khorsheid', 'Egypt', ' 9 April 1945', NULL),
('1097168', 'https://media.elcinema.com/uploads/_315x420_d7336006f7bc2ffa7c1c38d6af1ae88758dce310b320819cd96ca5caecf813a0.jpg', 'Tarek Kamal', 'Egypt', '20 July 1960', NULL),
('1097185', 'https://media.elcinema.com/uploads/_315x420_e8864cc07720da71c449df55c1b98945809bbb37def5cc298c3529227c54613b.jpg', 'Nourhan', 'Egypt', '15 January 1982', 'Nourhan is an Egyptian actress who was born in Alexandria in 1982. She graduated from the Faculty of Arts from Alexandria University then started acting at the beginning of the 21st century. Most of her acting appearances have been in television, among them: “‘Aila El Haj Mitwali” (El Haj Mitwali’s Family), “Souq El “Asr” (Market of the Era), “Qassim Amin,” “El “Asseyan” (Disobedience), “El Masrawya.”'),
('1097310', 'https://media.elcinema.com/uploads/_315x420_e7f411c99887e7132df85685c248f8445a3c61e31d94ca2e56910a404c10ab6d.jpg', 'Ashraf Fayeq', 'Egypt', NULL, 'Ashraf Fayek began his directing career working as an assistant director for director Mohamed Fadel on the television series “Ana wa Antee wa Baba fee Al Mishmish” which starred Hassan A’bdin. Thereafter, he worked alongside director Nadia Hamza on the film “Hams al Gawaree” and several other titles. \nAshraf’s first experience directing his own film was in 2001 when he directed “Al Labees” which starred Medhat Saleh and Shereef Mounir. Following that film, Ashraf took a hiatus from feature film directing and began directing documentary films and shorts thus distancing himself from the box office.\nSoon afterwards, Ashraf (who graduated from the décor division at the Institute of Cinema) returned to direct “Qisat Al Hob Al Sha’bee” (“A Story of Popular Love”) which was his own brainchild. That film featured the talents of several actors and football stars. Ashraf’s most recent work as director was the film “Al Lemby 8 Gega” which starred Mohamed Sa’ad.'),
('1097382', 'https://media.elcinema.com/uploads/_315x420_cdb9e84064db43faf73914351d8dacb041a18c4f13883091fa7030acc546e06b.jpg', 'Hind Abdulhaleem', 'Egypt', ' 7 April 1993', NULL),
('1097471', 'https://media.elcinema.com/uploads/_315x420_c16bba19417fa62a75cb0f12907aa7da3693cd3f5a34a25cb6c0d8bc4766bd6f.jpg', 'Marwa Abdel Monem', 'Egypt', '18 November 1978', 'Marwa is a young female charismatic actor, who left significant marks in all her TV roles. She considers Yahia al-Fakharaany her actual discoverer. Marwa is still taking slow steps towards the silver screen.'),
('1097802', 'https://media.elcinema.com/uploads/_315x420_a4a64ff4ca11c48ccc942f6f1619e1f876b5d9d626815a7063b4979147b995c1.jpg', 'Abdullah Hefni', 'Egypt', '18 July 1953', NULL),
('1097878', 'https://media.elcinema.com/uploads/_315x420_2acaa66043489a6e9659b34acfae75b52408df1108a134c12c48f8c823e687bc.jpg', 'Hany Ramzy', 'Egypt', '26 October 1964', 'Hany Adel Ramzy Hana was born in Bani Mazar. A business major, he graduated from the Institute of Performing Arts in 1991.  He started his acting career with Mohamed Sobhy in plays such as \"Point of View\" and \"Nonsense\". He also shined in the play \"That\'s Ok\" and tv shows \"Twins\" and \"Ladies of Garden City.\"'),
('1097924', 'https://media.elcinema.com/uploads/_315x420_e6c77f4a72bb8f4b5cecf1156f5ebcfcd547b739c35a866b82ba8fa26f8e5055.jpg', 'Karima Mokhtar', 'Egypt', '16 January 1934', 'Karima is an Egyptian film and stage actor. Her full name is ‘Attyat Mohamed al-Badry. Karima earned her bachelor’s degree in Theater in 1963 and was active in the Egyptian television entertainment industry since its outset. The actress has taken part in well known television series of the likes of “Abou Dar al-Ghafarry” and “Risalat al-Samaa”. On stage she has presented “al-Ardd” (“The Earth”), “Ayyoub al-Gadeed” and “al-‘Eyal Kibrit” (“The Kids have Grown Up”). Towards her later years on television Karima presented numerous works and stood out in her portrayal of motherly characters. She married actor and director Nour al-Demerdash and the couple have had more than one child who have also went on to make a career in theater and television. \nKarima took part in preparing information segments connected to the national drought campaign. She also received an award from critics for her role in “Wa Mada Qattar al-‘Umr” (“The Train of Time has Passed”). The actress was tied to motherly characters since early in her career and was unable to sway away from that niche despite her skill at portraying the role of the traditional wife in “al-Mustaheel” (“The Impossible”).'),
('1098083', 'https://media.elcinema.com/uploads/_315x420_011d10e78841b555e9f39c9e0be008326cc7b22b201c775e5a5becfd9a5f396b.jpg', 'Jamal Hejazi', 'Egypt', ' 3 December 1972', NULL),
('1098237', 'https://media.elcinema.com/uploads/_315x420_d271de0feefcd6113dba07f7ae8ffb3d5e240ca230cb9f8d8162153802189a5b.jpg', 'Fatma Eid', 'Egypt', '18 January 1962', NULL),
('1098238', 'https://media.elcinema.com/uploads/_315x420_c57e5713c523ba87755da555b30ca0e42b6f869bc530fc8faa92bf295a23ea47.jpg', 'Shawqi Shamekh', 'Egypt', '25 July 1949', 'Mohamed Shawqy Shamekh Mohamed Bayoumi was an Egyptian actor. He was born in Elhelmeya district of central Cairo, and received a bachelor\'s degree in business management from Ein Shams university in 1972. He worked as a accounting auditor in the ministry of education, before starting a career in acting. He first acted on stage in several plays, including “Shahed Mashafsh Haga” (ِ A Witness Who Didn\'t See Anything) and “El Erd” (The Monkey). He then went on to star in numerous television series and films, including “Arabesque”, “Zizenia” and “Raafat Elhaggan”. He died inside the Cardiac Institute\'s hospital of a stroke in 2009.'),
('1098330', 'https://media.elcinema.com/uploads/_315x420_336bd38227499515cce56f4052ec48305f7858f165ba081cb64c9320e878074f.jpg', 'Abbas Abo El Hassan', 'Egypt', ' 1 August 1964', 'Abbas Abo El Hassan is an Egyptian actor and screenwriter. His most famous role as an actor was that of the mafia boss in the action film “Mafia”. He wrote the screenplay for the controversial action film “Ibrahim El Abyad”, which was directed by Marwan Hamed and starred Ahmed El Sakka and Amr Waked. He also wrote the television series “Asia”, which starred Mona Zaki and Bassem Samra.'),
('1098628', 'https://media.elcinema.com/uploads/_315x420_e08708b7eb9c6b88b70dce2bfc5059ea90f0e89d22eff8cb70737081ba9ff825.jpg', 'Ahmad Bayoumi', 'Egypt', NULL, NULL),
('1098660', 'https://media.elcinema.com/uploads/_315x420_1a7985ca5755eb07318c238b07e4590fb5dd4737ecb1f3aec74882645d012e64.jpg', 'Ibrahim Issa', 'Egypt', ' 1 November 1965', 'Ibrahim Issa is an Egyptian journalist and television presenter. He started his career in journalism while studying mass communication at the University of Cairo. He had a long history of disputes with the Hosni Mubarak\'s ousted regime, which ended in a reconciliation before the January uprising. He currently presents a talk show on the satellite channel ONTV. Issa is most known for his sarcastic style of writing, and his flashy performance when talking politics in front of the camera.'),
('1099288', 'https://media.elcinema.com/uploads/_315x420_4e5393faca7c0f5d8f7fbe1616c93c9c42e276ab43b64c11397a51eaaff1b6ad.jpg', 'Tamer Karawan', 'Egypt', '11 February 1969', 'Tamer Karawan is an Egyptian music composer. He was born in Cairo in 1969, and studied mechanical engineering at the American University In Cairo until 1991. He then studied music at the Royal Music Academy in London, and worked as an editor in the British radio in 1994, then as a documentary film director in Orbit satellite network. Karawan debuted as a film score composer in 1998, by scoring the music for the Youssry Nasrallah film \"El Madina\" (The City). Since then, he scored for numerous films and television series, including \"Bab Elshams\", \"Cabaret\" and \"Segn Elnesa\" (Women\'s Prison).'),
('1099305', 'https://media.elcinema.com/uploads/_315x420_e87a16be99fe974febfb6572b59c54b374d91272b6d93ca1bfc1d0e6d3b02cb6.jpg', 'Ahmed Adam', 'Egypt', '15 May 1958', 'Born Ahmad al-Sayyed Muhammad Adam in Ghorbaal –Alexandria. Studied Commerce, married with children Eslaam and Sarah. Adam started his career through Children’s Theatre at al-Horreyya Culture Palace in Alexandria, then developed his acting abilities and played comics. He used to mock actors in his early life.\nAl-Karmouty’s role was the milestone for Ahmad Adam in the program “Serr al-ard” in the Egyptian TV. After that, he acted in “Enta horr i.e. You are free”, “Al-Hamagy i.e. The Barbarian” and “Al-mahzouz i.e. The Shaken” with Muhammad Sobhy Troupe. He also played other stages roles; “Al-ghash-shaash i.e. The cheater”, “Al-bo’bo’ i.e. The bugaboo”, “Bahebbak ya mogrem i.e. I love you criminal”, “Atteyya al-erhabeyya i.e. Atteyya, the terrorist”, “Feema yabdou sara’ou Abdou i.e. Apparently they stole Abdou” and “Khally baalak men Gom’a i.e. Take care of Gom’a”. Adam acted in many TV series; “Hayaat al-Gohary”,”Al-nawwa i.e. The storm” and “Hawadeet Fekry Abaaza i.e. The tales of Fekry Abaaza”. Having a great ability of improvising, Adam became a star and took leading comedy and tragedy roles. For cinema, Ahmad Adam acted in “Shagee’ al-ceema i.e. Cinema Hero” and “Al-ragol al-abyad al-motawasset i.e. Mediterranean man”.'),
('1099451', 'https://media.elcinema.com/uploads/_315x420_d7539aebca89d55c0c4bf4685eec871257abfd3832a7791ff2705104e1a80cdf.jpg', 'Gaby Khoury', 'Egypt', ' 4 May 1952', NULL),
('1099530', 'https://media.elcinema.com/uploads/_315x420_93ce6a6973b5856363faf1087e3babe0983627f2344e08790d6db9bc7921847d.jpg', 'Sayed Mustafa', 'Egypt', '20 October 1955', 'Sayed Mostafa is an Egyptian actor, who was born in 1955. He started his career as a silent extra in the seventies of last century, and went on gradually to pick up roles with few dialogue lines in both film and television. He hasn\'t appeared as a lead in any of the productions he took roles in, but he managed to sustain a career of numerous secondary and supporting roles throughout the eighties and the nineties.'),
('1099833', 'https://media.elcinema.com/uploads/_315x420_e34fbcd6fb4bdf912bebdfb62c3a4a2ba4941b7552571b1933a24f4f7ca3aacd.jpg', 'Loai Omran', 'Egypt', NULL, NULL),
('1099873', 'https://media.elcinema.com/uploads/_315x420_ced91564269927269d8cec64a4b1b4ca2f926ee2bce7b3f380a24d5007766216.jpg', 'Mostafa Saad', 'Egypt', ' 7 November 1949', NULL),
('1099918', 'https://media.elcinema.com/uploads/_315x420_53e7ba5efc1dc94fd251748c74f57922537f01f5633473015f9b257321b860c2.jpg', 'Misr International Films', 'Egypt', NULL, NULL),
('1099929', 'https://media.elcinema.com/uploads/_315x420_4a17d6f6fac2268ecef3b52b229f0f3834d29c8b89763210ef7a5ef0fbdd1fd0.jpg', 'Mostafa Elsobky', 'Egypt', NULL, 'Coming from a massive production family Mustafa El Sobky decided to direct his attention to story and script writing. He was a great success producing some of the finest stories such as “Hassan Tayara”, “Shabab Fee El Mamnoo” or “Forbidden Youth”, “Shagee El Ceema” or “Macho Guy”'),
('1099997', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'المجموعة المتحدة', 'Egypt', NULL, NULL),
('1099999', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmed Thabet', 'Egypt', NULL, NULL),
('1100000', 'https://media.elcinema.com/uploads/_315x420_4eb8dfac897aa3b5d8cc946ffda921aefa64d0399e1285ae99913771d3c5c1cf.jpg', 'Ahmed Al-Badry', 'Egypt', ' 3 October 1954', 'Ahmed Elbadry is a distinguished director with over 20 years of experience in the industry.  He has worked with a number of notable directors including the late Hussein Kamal, Gamal Abdel Hamid, Nader Galal, Sherif Arafa, and Mohamed Abdel Aziz. \n\nElbadry graduated from the High Academy of Arts, majoring in performing arts/acting in 1977 and directing in 1985. He began as an assistant director to Mohamed Fadil in \"My Children...Thank you\" starring Abdel Minim Madbouly.  \n\nMost of Elbadry\'s works are true-to-life situational comedies interspersed with musicals. Ebadry\'s first directorial debut was in the 2003 play \"Raya & Sikeena\" starring Abdel Minim Madbouly, Nahla Salama, and Maged elMasry. His first major film as director was \"Ghawy Hob (Addicted to Love)\" starring the singer Mohamed Fouad, Hala Sheeha, Khaled elSawy, and Ramez Galal.'),
('1100001', 'https://media.elcinema.com/uploads/_315x420_87af4d6bfa803513b0c90a7cd6dc6a5708fb50d60ffa48ec010a450b090eada1.jpg', 'Saad El Soghayar', 'Egypt', '30 January 1970', 'Saad El Soghayar is an Egyptian Shaabi singer and actor. He first saw success through his song \"Esha...Fouq\" (Rise and Shine). He was then introduced to the big screen by producer Mohamed El Sobky in the successful film \"Lakhmet Ras\" (Head-spin), a role which made him famous among audience. His songs in the movie became the most heard Shaabi song at the time, and are still played in weddings all over the country. His success in \"Lakhmet Ras\" and the movie being a major box office hit made producers invest in the format, and a streak of movies helmed by Saad El Soghayar and including his hit songs have been released annually since then, specially during the Islamic feast season.'),
('1100006', 'https://media.elcinema.com/uploads/_315x420_2e592e886ac144e1d4ab50ab5f35bf8b20e746985b30a0cebe0149e09ddd5a6b.jpg', 'Aya Hemeda', 'Egypt', ' 3 June 1988', 'Ayah Hemeida is a young Egyptian actress. She is the daughter of the actor Mahmoud Hemeida. She enjoyed acting from a young age and took part in several (workshops in order to refine her acting skills). \nHer first acting experience was in (Alakat Khasa) and her performance in that role was quite exceptional.'),
('1100008', 'https://media.elcinema.com/uploads/_315x420_fccde89ea188dd15733a0d0e5ab842eab4d3b3cd2074d091120034a3ceea100c.jpg', 'Ahmad Abu AlNour', 'Egypt', ' 7 July 1979', NULL),
('1100009', 'https://media.elcinema.com/uploads/_315x420_11d4c6eba49b2b8fbf67bb16a0437b97fd99d91ea77f1163a6d3d9ecdc65c8ca.jpg', 'Tatiana', 'Lebanon', '28 April 1985', 'Lebanese actor Tetyana was born in Beirut in 1985. She got her career started as a model, appearing in commercials and music videos as well as fashion shows. In order to pursue greater opportunities in acting, Tetyana moved to Egypt, where she enrolled in a workshop with Dr. Mohammed Abdel Hadi. She worked as a host for the show “Doqi Yaa Mazzika,” which aired on “El Mehwar” TV channel, and went on to pursue film acting. Her first work in cinema was the film “Alaqaat Khasa” (Private Affairs; 2006) directed by Hany Girgis Fawzy. She has since appeared in numerous films such as: “Binat wa Motocyclette” (Girls and Motorcycles; 2008), “Samy Oksed El Carboon” (Samy Carbon Dioxide; 2011), “A\'elat Mickey” (Mickey’s Family; 2010), and “Tom wa Jimmy” (2013). Tetyana has also worked in Egyptian dramas including the television series: “Wanees wa Eyamo” (Wanees and His Days; 2010), “El Safa’a” (Smack; 2012), and “An El Awan” (Now Is the Time).'),
('1100010', 'https://media.elcinema.com/uploads/_315x420_b7f0a3cdda6c50acf13f1164495c0bb3b4f6591c58d74700f13941f2a3c261d1.jpg', 'Magdi Alkdash', 'Egypt', NULL, NULL),
('1100011', 'https://media.elcinema.com/uploads/_315x420_027d3619269b989ebb004e590d238a7a3971cfec4172d9333778ece9816fb900.jpg', 'Ahmad Saleh', 'Egypt', NULL, 'Director Ahmed Saleh began his career in cinema following his graduation in 2000 from Brentwick University in England with a Bachelor’s degree in the arts. Ahmed has worked as an assistant director for several well known directors such as Shereef Arafeh, Mohamed Abu Seif and Shereef Sabry. \nHis first film was “Harb Italia” (“Italy’s War”) which starred Ahmed El Sekka and Khaled Saleh. Ahmed has also worked as acting director for the film “A’la Ganby Yasta”, which saw him work alongside Sa’eed Hamid. That same film also starred Ashraf A’bd Al Baqee. Ahmed also directed “Al Dealer” which starred Ahmed El Sekka and Khalid Al Nabawwy.\nAside from his work in cinema, Ahmed Saleh (who has an Algerian father and an Egyptian mother) has also directed several television productions including “Lahazat Harija”, “Hurmat ya Baba” and “Tsunami”.'),
('1100014', 'https://media.elcinema.com/uploads/_315x420_33ad353a73112ed84b6d650324258ce6eabe1ac013a116f3edef2c95478a2d25.jpg', 'Feisal Abdul Samad', 'Egypt', NULL, NULL),
('1100015', 'https://media.elcinema.com/uploads/_315x420_1995db35af2efefccfe9a3c530a0580b05dd84d329d6442e75a40fd1cfc6d6a1.jpg', 'Ahmed Hussein', 'Egypt', '14 March 1976', NULL),
('1100017', 'https://media.elcinema.com/uploads/_315x420_0ca07af053faa84549d42966e0acd81756a7c8f12b01197e33a14d87baf20e05.jpg', 'Sherine', 'Egypt', '10 October 1956', 'She is an Egyptian actor, studied Ballet and Law. Well known for her aristocratic roles through TV series “Alf Leila we Leila i.e. Thousand and one nights” and “Aaker al-meshwaar i.e. End of the journey”, plays like “Al motazawwegoon i.e. The Married”, “Haawel tefham ya zaky i.e. Try to understand you clever”, “Ne’oul eih? i.e. What shall we say?” and “Fallaah fee madrasset al-banaat i.e. A farmer in girls school”. Sherine has a daughter “Mirette” from her ex-husband director Muhammad Ussaama.'),
('1100029', 'https://media.elcinema.com/uploads/_315x420_47832299ac4184116e359dc2aca2209b03ebde893d0f1f3b9836d4b4b95d072e.jpg', 'Mohamed Amin', 'Egypt', NULL, 'Mohamed Ameen director and script writer presented a movie in the year 2000 called “Film Thakafi” starring all new cast at that time like Ahmed Rezk, Ahmed Eid and Fathi Abdel Wahab. \n\nThe movie was such a success amongst audience and critics. \nLater on he wrote the script for “Gaana Al Bayan Al Tali” and “Africano”. 5 years later in the year 2005 Mohamed Ameen surfaced as a script writer and director in the movie “The Night Baghdad Fell”starring Ahmed Eid and Hassan Hosni. \n\n5 years later in 2010 Ameen came back again to present the movie “2 Girls from Egypt” starring Zeina and Saba Mubarak.'),
('1100033', 'https://media.elcinema.com/uploads/_315x420_5b2ba1d37c92cf9f0a447c2b39d34c1fc4e8099ec11bfc4fef390ae96fa622e8.jpg', 'Mai Selim', 'Jordan', ' 6 November 1983', 'May Selim is an Egyptian (musician) with Jordanian roots. Her sister is the actress Mais Hamdan. \nMay has achieved a great measure of success as a musician and thus was chosen by Ahmed El Sekka to perform a leading role (alongside) him the film “Al Dealer”.'),
('1100036', 'https://media.elcinema.com/uploads/_315x420_1fb5c68b7a7834ded096d4a43f750ed646325e3dcfb53cdf80aa6c7f3f926bc3.jpg', 'Cyrine Abdel Nour', 'Lebanon', '21 February 1977', 'The Lebanese actress has studied at St. Courier. Thereafter she studied accounting before taking classes in fashion design in late 1993. When Sireen later began work as a model, her first modeling work involved presenting Christmas designs to a group of designers including Zuhair Mourad, Abu Mahfouz and others. Sireen also took part in a commercial for a washing detergent – the commercial was filmed in Lebanon but was aired in Saudi Arabia. In early 1998 she began appearing on LBC as an actress taking part in several works including “Marianna”, “Ghadan Youm Akher” (“Tomorrow is another Day”) and others. In 2002 Sireen came first in a large competition involving many models and in 2003 she had her first leading role in a series titled “Ibnatti” (“My Daughter”). More roles followed and the artist had her first forays into music in 2004.'),
('1100038', 'https://media.elcinema.com/uploads/_315x420_0704a2d63b02d6cf46e6efb7270331442b2102a8b17b21dd286a6b5ec3fb18a8.jpg', 'Ahmed Kardous', 'Egypt', ' 1 January 1975', NULL),
('1100039', 'https://media.elcinema.com/uploads/_315x420_43ee4b31523ee79b440a7a99d8e2febc24a44d1be46f799927b005d06c6fd501.jpg', 'Mohamed Samir', 'Egypt', '30 November 1981', NULL),
('1100040', 'https://media.elcinema.com/uploads/_315x420_6353d85a237033f9e788601d4c8904322823696f589cc75f933f2855cd9ba320.jpg', 'Ahmad Badawi', 'Egypt', NULL, NULL),
('1100044', 'https://media.elcinema.com/uploads/_315x420_2317d7bfc0950967f346dba693e2fd23d1d22c522ba702518be8495f2445e3e0.jpg', 'Adel Haqqy', 'Egypt', NULL, NULL),
('1100051', 'https://media.elcinema.com/uploads/_315x420_51ea9f4fd9b53c21955ac8ba7409d4c3e29a68f71277f68476bbd2a58404c361.jpg', 'Samih El-Nakash', 'Egypt', NULL, NULL),
('1100054', 'https://media.elcinema.com/uploads/_315x420_36ff80e958b5fb26d9b59567e46ccbad9b1d0924201aa3a27d737e76515d0eb7.jpg', 'Hani Abdallah', 'Egypt', NULL, NULL),
('1100055', 'https://media.elcinema.com/uploads/_315x420_056055fdf3136b178a859608666640b5840eb510b9d829d258ecfdd04cbd7842.jpg', 'Ahmed Abdallah', 'Egypt', '19 December 1979', 'Ahmed is an Egyptian performer who began his career with a role in “Howa fee eih”. Thereafter, he also worked on director Ibrahim Al Batbout’s film “A’yn Shams”. Following his work on that film, Ahmed became enamored with the idea of working in independent cinema.\nAhmed presented his first work as an indie cinema writer and director in the film “Heliopolis”, this was followed by “Microphone”.'),
('1100057', 'https://media.elcinema.com/uploads/_315x420_01acd86e402e96028857e09143dbb7da8b3e583423d8cae003a4b0d76f7aa480.jpg', 'Ahmed Owise', 'Egypt', ' 6 July 1977', NULL),
('1100059', 'https://media.elcinema.com/uploads/_315x420_610403ee612cd65767e163839adb8640eb64820cdf55a1f14dbf95dc6300ae7e.jpg', 'Sherif Makkawi', 'Egypt', '24 June 1977', NULL),
('1100060', 'https://media.elcinema.com/uploads/_315x420_f6e36cf1ef74d0a197cf0bbcd5c97187054f39e1415b9560c0f2334e627efd79.jpg', 'Mamdouh Farag', 'Egypt', '16 August 1951', 'Mamdouh Farag is a sports newscaster and a former Egyptian wrestling star. He was born in 1951 and spent more than 20 years of his life in Austria, where he got his doctorate in Physical Education from Shebroot Institute. He free-style wrestled for many years, and managed to win the world championship 5 times. He continued wrestling even after his return to Egypt in 1996. After his competition with Hercules Fernando, and afterwards, he turned to sports news, where he was the presenter on a number of special TV programs covering wrestling, including: “Masaara’ El Muhtarafeen” (Professional Wrestling), “Lams Aktaf” (Smack Down), “El Darba El Qadiyya” (Knockout), and “El Mosaara’” (The Gladiator). Farag died in 2014 at the age of 63.'),
('1100063', 'https://media.elcinema.com/uploads/_315x420_781d5e900df3b5d0072457151f0ded7faaa8eb6ab0501dd5bc83fa83f7dbd22a.jpg', 'Hussein Mamluk', 'Egypt', NULL, NULL),
('1100066', 'https://media.elcinema.com/uploads/_315x420_e5b0d2163b7b8d61e274072532187fbd97f27a468def8ee1adc1d2d13cbd8aff.jpg', 'Ahmed Abdullah', 'Egypt', ' 1 April 1965', 'Scriptwriter Ahmed Abdallah was born in Bein Al-Sarayat in Cairo on April 1st, 1965. He graduated from Cairo University Law school.  While in college, Abdallah did some acting, but mainly directed stage plays based on translated scripts. \n\nAfter graduation, he began working for the theatre, producing \"Alam Qetat\" (World of Cats), \"Alabanda\" (Nonsense) and \"Hakim Ouyoon\" (The Eye Doctor). Since then, he has written scripts for some of the biggest box office comedies of the last decade including Abboud Ala Elhodoud (Abboud on the Borders), Al-Nazer (The Headmaster), Ibn Ezz (Born to Money), Al-Lembi, Karkar, Askar fil Moaskar (Soldiers in the Camp), Yana Ya Khalti (Me or My Aunt), Foul Elseen Elazim (Great Beans of China), and Ghabi Mennu Feeh (Natural Born Imbecile).\n\nIn 2008, Abdallah ventured into a totally new genre, adopting darker dramas like his film \"Cabaret\" that went on to win several awards. Following its great success, Abdallah has opted to work with the same cast in his next movie \"Elfarrah\" (The Wedding) and again in his first TV series \"Elharah\" (The Alley) in 2010.\n\nThe multi-talented writer\'s work scopes beyond film and theater. Abdallah has recently published his first collection of poems, and has written songs for some of his stage plays as well as a song for the late singer Zekra.'),
('1100069', 'https://media.elcinema.com/uploads/_315x420_af7b039ca034cfc7ef6a59f37f3b9249a0b2e21871563c14e810b8fa003fc436.jpg', 'Alaa Atef', 'Egypt', NULL, NULL),
('1100071', 'https://media.elcinema.com/uploads/_315x420_202c2bc692af1c9ea07720519c6ee45b785f8fff89a9f1d9d97f52bcf0b91943.jpg', 'Youssra Al Lozy', 'Egypt', ' 8 August 1985', 'Yousra is an Egyptian actress that was born in her home country. Her father is Egyptian while her mother is Syrian.\n(Her talents were first noticed by the famous director Youssef Chahine who assigned her a role in “Alexandria New York”).\nYousra’s father is the (theater director) Mahmoud El Lozy. Prior to her performance in Youssef Chahine’s cinematic productions she had performed in several plays at the American Univerity in Cairo. Moreover, she has also (provided voice dubbing in Arabic) for several films and television series.'),
('1100073', 'https://media.elcinema.com/uploads/_315x420_aade82ab47033d7f57d2cfedfe889af3ab23c6989acac6a8284eee50036c579c.jpg', 'Mahmoud El Lozy', 'Egypt', ' 9 September 1958', 'Mahmoud El Lozy is an Egyptian stage director, actor, playwright, and professor of drama and theatre at the American University in Cairo. After getting a B.A. and an M.A. in English and comparative literature from AUC, he moved to the United States where he earned his PhD in dramatic arts at the University of California, Santa Barbara. His writing on contemporary Egyptian theatre has brought special attention to the issue of censorship. His daughter is the actress Yousra el Lozy. He\'s starred in Ahmed Abdallah\'s first two features \"Heliopolis\" (2009) and \"Microphone\" (2010) and has co-starred with his daughter in \"Koblat Masrouqa\" (Stolen Kisses) and Youssef Chahine\'s \"Alexandria... New York\" (2004). His other film credits include \"The Situation,\" Mohamed Khan\'s \"Faress el Madina,\" and Maggie Morgan\'s independent ensemble drama \"Asham\" (2013).'),
('1100075', 'https://media.elcinema.com/uploads/_315x420_f989ad4f3ebf7d952628731dd4a6ecd907dd5885365d86f294045165270b3863.jpg', 'Atef Youssef', 'Egypt', NULL, 'Attef is an amateur Egyptian actor who appeared in the title “Heliopolis”. He originally worked in dubbing.'),
('1100076', 'https://media.elcinema.com/uploads/_315x420_1c7754bd1db5912822fc4b33dcd660a4e11f6e80c4bc9ee491f4a632f719ecd3.jpg', 'Aya Soliman', 'Egypt', NULL, NULL),
('1100077', 'https://media.elcinema.com/uploads/_315x420_4669a23b636af922fb47e5ccd63e55a388cc900829a653a47a3b90b03aa6425a.jpg', 'Mohamed Boraiqa', 'Egypt', NULL, NULL),
('1100079', 'https://media.elcinema.com/uploads/_315x420_3d74e7b132fca744896703c67bb06fbceefa9d2882e9c23e6140a84dd4995ab5.jpg', 'Hany Adel', 'Egypt', ' 8 September 1976', 'Hany Adel began singing at a young age. He has (been intent) on forming a band since 1999 when he used to sing and play the guitar at (hotels and parties). It should be noted that he could sing in both French and English. Due to the fact that he believed that music and song are best (within the context of a band), he put together the band “Wust Al Balad” which is formed of seven members.\nHany graduated from the faculty of law and has since (achieved a great measure of success) in music. (Thereafter) he progressed to cinema where his good-looks and acting skills have served him well.'),
('1100081', 'https://media.elcinema.com/uploads/_315x420_77f547efd6d6aa3a4b2e7fe15cd1f6878423418fbfb5c7b04a70940f605d535f.jpg', 'Aida El Kashef', 'Egypt', '17 June 1990', 'Aida El Kashef graduated from the High Cinema Institute in Cairo in 2009, she specialized in film directing. Her graduation project \"Rhapsody In autumn\" won several awards including the Silver Arab Muhr Award at the Dubai International Film Festival. After graduation she worked on her own short projects as a director and producer. First acting experience was in the Egyptian tv series \"Al jam3a\" directed by Hani Khalifa.'),
('1100083', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Inas Marzouk', 'Egypt', NULL, NULL),
('1100084', 'https://media.elcinema.com/uploads/_315x420_281abf3bd1e2bddc7f273af424afe79ab1fb8f23516ca03e787636be8bdd4a31.jpg', 'Tarek Hefny', 'Egypt', ' 3 October 1983', NULL),
('1100085', 'https://media.elcinema.com/uploads/_315x420_2b7f22f027d4d5c6b46eae58e0d1ef812ac556f6c7c2856117887746a62395bd.jpg', 'هانى صقر', 'Egypt', NULL, NULL),
('1100086', 'https://media.elcinema.com/uploads/_315x420_7af3d5e746a4418a2f119113f1924bc5ec257b7e52d4a72362a8aa884d390ad8.jpg', 'George Azmy', 'Egypt', ' 4 July 1983', NULL),
('1100089', 'https://media.elcinema.com/uploads/_315x420_9c8d9eef128098296fbdfd181586adb641a2d3c2934ef39dc34425c0f2474cc3.jpg', 'Ramadan Khater', 'Egypt', '31 January 1963', NULL),
('1100091', 'https://media.elcinema.com/uploads/_315x420_b749ed776bf8b85ca3eaa8bf74570e27fc0746b6c007f29f656d958fe2cf89e7.jpg', 'Mohammed Hamdi', 'Egypt', '29 January 1977', NULL),
('1100092', 'https://media.elcinema.com/uploads/_315x420_53a4ac89ebfaf8dfd00320a26fc0dbce3c4bc62fe86d4447b3355e7670a55bee.jpg', 'Tamer El Said', 'Egypt', '14 August 1972', 'Tamer is a well-rounded artist as he performs as well as write scripts. He worked as a screenwriter for the film “A’yn Shams” and acted in “Heliopolis”. \nTamer is an all-round ambitious person who likes a challenge.'),
('1100093', 'https://media.elcinema.com/uploads/_315x420_9d1274cdfba041e2b6474dfa606598807e488b598558257ab2407d69279ca3b2.jpg', 'Boutros Ghaly', 'Egypt', NULL, 'Acting is a favorite hobby of his and thus he excels at it. He first came to public attention when he took part in the film “A’yn Shams”.\nGhali presents his character with simplicity and ease and his talents have brought him attention. Ghali took part in “Al Mussafir” (“The Traveler”) where he acted alongside a group of distinguished artists.'),
('1100096', 'https://media.elcinema.com/uploads/_315x420_f4aaa3cf8ccfebb1f3fdf7ff7e11e4b24b1df07626eeda6572511c7ac7890513.jpg', '(Mohamed Abdel Fatah (Kalabala', 'Egypt', '15 July 1980', NULL),
('1100098', 'https://media.elcinema.com/uploads/_315x420_8d7f9cd91046bdb833bab52c401a4140f6e93d87c7f0b71310585548f9fdfe57.jpg', 'Hani Al Metnawi', 'Egypt', NULL, NULL),
('1100099', 'https://media.elcinema.com/uploads/_315x420_a3f50bb308781d804a5a401515ffdcb412a401e92b5a0f7e2ead33df9642851f.jpg', 'Ibrahim El Batout', 'Egypt', '20 September 1963', 'Ibrahim El-Batout was born on the 20th of September, 1963 in Portsaid, Egypt. He majored in Physics from the American University in Cairo in 1985.'),
('1100101', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أمير خلف', 'Egypt', NULL, NULL),
('1100105', 'https://media.elcinema.com/uploads/_315x420_013a566a98bf2283c620bc4e79c613d4105767e7d2272473991ca26a668b7d32.jpg', 'Hisham Saqr', 'Egypt', NULL, NULL),
('1100107', 'https://media.elcinema.com/uploads/_315x420_2269355701a93d5924e0dc2ac8365dccad94795dc2c4bf992d3f27038805d298.jpg', 'Ahmed Gabr', 'Egypt', NULL, NULL),
('1100121', 'https://media.elcinema.com/uploads/_315x420_cb52c9c98927dadaa9fa58383b43b29028a58569cb72b3dac5698de46ca2e94b.jpg', 'علي السعيد', 'Egypt', NULL, NULL),
('1100124', 'https://media.elcinema.com/uploads/_315x420_4a10abe3249639a72b8c80a56c8f12cb76fe5b770822698b6495f43356f34064.jpg', 'Mona Assaad', 'Egypt', NULL, NULL),
('1100125', 'https://media.elcinema.com/uploads/_315x420_41d70251acc9cceddc5fd5c60769ea0d6297450cb99ebdc0e776c9b4e3be7d46.jpg', 'Ramy Gheit', 'Egypt', ' 9 July 1979', 'Ramy Gheit is an Egyptian actor and assistant director. He was born in 1979. He worked as an assistant director in numerous films, and also worked as an actor in several supporting roles that were exclusively comic, including roles in the films “Dokkan Shehata” (Shehata\'s Shop), “Kalemny Shokran” (Please Call Me), “Ana Badiaa Ya Wadiaa” (I\'m Getting Lost, Wadiaa), in addition to a recurring role in the successful television series “Sharea\' Abdel Aziz” (Abdel Aziz Street).'),
('1100126', 'https://media.elcinema.com/uploads/_315x420_0222eb6279c87511cea07fefada2798fea6639f17f0bc2c7277d0e903137ea87.jpg', 'Karim elmehy', 'Egypt', NULL, NULL),
('1100133', 'https://media.elcinema.com/uploads/_315x420_cbad85691abd5ff19f6f44f3077ab39d3835967a5b290e3b4faf9444a1921484.jpg', 'Chico', 'Egypt', ' 4 July 1980', 'During university, he created a production company with his friends called “Tamr Hendi” that produced movies that ridiculed famous Egyptian movies. Most famous was “Men who do not know the impossible” \nThis work attracted the attention of Mohamed Hefzy who at the time was attempting production and he produced their first series “Afeesh wa Tashbeeh” which portrayed one of the Egyptian classics in a cynical way in each episode. \nHefzy then produced for them the movie “Coded Paper” which was a big hit in the box office.'),
('1100140', 'https://media.elcinema.com/uploads/_315x420_e2f3693e7f1bf32b9364c4fe9a10b359aec54e4b3b63ab00a37c1f2d54e2dec9.jpg', 'Sherif Nagib', 'Egypt', '19 January 1981', 'An Egyptian script writer who was born in Cairo on the 19th of January 1981. He graduated from the Faculty of Engineering, Cairo University in 2003, and then moved to Canada to study graphics and animation.  He then moved back to Egypt and directed his attention to story writing for movies.\nIn 2010 her wrote episodes for the series “Special Screening” or “Ard Khaas.” He also wrote the script for Ahmed Mekki’s movie “No Retreat No Surrender” , which was a massive success, making more than 25 million Egyptian pounds in the box office.'),
('1100150', 'https://media.elcinema.com/uploads/_315x420_ccc556bee4e5c4357d63b0799f1dc58d4b0182a52eea0f838a81b0c155b57dc2.jpg', 'Shery Adel', 'Egypt', '19 April 1988', 'Shereen began her career with appearances on advertisements as a child and thereafter she transitioned to television series. At 15 she had her cinema debut in the title “Hamada Yel’ab” (“Hamada is Playing”) which was followed by roles on several television dramas such as “Hayyati Inta”, “al-Mersyo al-Bahar” and “’Efreet al-Qirsh”. Thereafter Shereen acquired fame following her portrayal of Queen Neriman in the television series “al-Malik Farouk” (“King Farouk”). She then took part in several cinema works including “Kharig a’n al-Qanoon” (“Outlaw”) and “Kalashnikov” before playing a role in the film “Hassan wa Morqoss”. That effort led to her delaying her studies for a little while as she was studying at the French language division of the faculty of commerce. Shereen intends to study at the Institute of Theatrical Arts or at the Institute of Cinema after concluding her present studies.'),
('1100164', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Yasser Shama', 'Egypt', NULL, NULL),
('1100166', 'https://media.elcinema.com/uploads/_315x420_83b2056264610a12cb60b17e4295bf714cb6979930dfc373f4c1a05981214c79.jpg', 'Islam Gouda', 'Egypt', '21 October 1977', NULL),
('1100173', 'https://media.elcinema.com/uploads/_315x420_c31bfc260f1f2220a6835df7714c3bc1a2387fb75734270736ae0cb58080b228.jpg', 'Ahmad Yousef', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1100178', 'https://media.elcinema.com/uploads/_315x420_6bf0791ce45f6547451fbf922524f73a4f5413571c35f761a5a3b7d3e9d7e014.jpg', 'Hasan Al-Raddad', 'Egypt', ' 2 January 1984', 'Hassan is the son of renowned Egyptian actor Nabil el-Raddad and his full name is Hassan Nabil el-Raddad. The actor was born in the city of Port Said and his debut appearance came about as a minor role in the title “Kheyanna Mashrou’a” (“A Legitimate Betrayal”). Thereafter he assumed a role in the first part of the series “al-Daly” as Bassem al-Daly who was Sa’ad al-Daly’s middle child. He reappeared once again in the second part of that series. The actor made another appearance in the series “Ibn al-Arnadly” where he portrayed ‘Aly al-Arnadly, the son of Yahya al-Fakhran.'),
('1100180', 'https://media.elcinema.com/uploads/_315x420_960557c8933d38fac4db65b684f5ce31119873acd53f98ea8125c43081e84559.jpg', 'Abd el-Wahed el-Ashry', 'Egypt', '16 April 1955', NULL),
('1100182', 'https://media.elcinema.com/uploads/_315x420_547c6ac18085c614ab64ad4572b938ae49391328e958d90d4d62f2acbba50eb0.jpg', 'Maged Abdul Azim', 'Egypt', '30 August 1969', NULL),
('1100191', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Nashaat Nnizmi', 'Egypt', NULL, NULL),
('1100200', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'دعاء فتحي', 'Egypt', NULL, NULL),
('1100226', 'https://media.elcinema.com/uploads/_315x420_e3f1414655728c6661fa4582b8f8b7bcfeae121549051cddbf24b0c66017601e.jpg', 'Mohamed Al Shakankeery', 'Egypt', '12 September 1973', 'A talented Egyptian actor who played various TV roles, yet he appeared once on silver screen in the film “Al-‘Aalamy i.e. The International”.\nHis father is TV director Ebraheem al-Shakankeery.'),
('1100227', 'https://media.elcinema.com/uploads/_315x420_cebf5e0fccbb586dc5b69114beb147835c8b8682805c72a4c32af8547153afa3.jpg', 'Sabry Fawaz', 'Egypt', '22 November 1968', 'C’est un acteur, écrivain et metteur en scène égyptien. Il a incarné  le  personnage de Baligh Hamdi dans la série de « Oum Kalsoum » et le film « Halim ». Il a également participé à de nombreux rôles dans des feuilletons égyptiens parmi lesquels : « El Wesséya, la  Famille, une Femme de l’ère de l’amour, les Amis,  Moments critiques, les Jardins de Satan,  les Nuits de Hélmiya, la côte Ouest, Question de principe, Une femme de feu, La Proie et le chasseur, et El Masrawéya ; et les films : Mabrouk et Bolbol, les Jours de Sadate, le Sang du chevreuil,  et le gang de Dr Omar. Il a mis en scène de nombreuses pièces : les plus importantes : On va dire encore, Isis, l’écho des échos, les Nuits d’El Husseinieh, Celui qui a peur rentre, la ferme des lapins, Yassin et Bahia, la mariée du Sud, le renfort, Leil Ya Ein et a écrit et mis en scène la pièce « Appel en absence de la part de Hulaco » et a écrit le scénario et le dialogue de la série « Les contes de Bahia ». Il a écrit des articles multiples dans certains journaux et périodiques publiés au Caire.'),
('1100228', 'https://media.elcinema.com/uploads/_315x420_d4a465b3cebcb23ad4f7ea76aa6c655a9b69de2f0b68f6dd4d8afb51e4a8d1b3.jpg', 'Assem Nagaty', 'Egypt', NULL, NULL),
('1100229', 'https://media.elcinema.com/uploads/_315x420_e0687224c114baaac39307389e35e76b29c86d6b5eba666029007eb552f78393.jpg', 'Sharif Awad', 'Egypt', '14 January 1966', NULL),
('1100236', 'https://media.elcinema.com/uploads/_315x420_b39d2905161cbc41b8b1f7081df14c162687d200d2d36219beb61299cc033966.jpg', 'Ehab Fahmy', 'Egypt', ' 4 June 1969', NULL),
('1100238', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'طارق مهران', 'Egypt', NULL, NULL),
('1100254', 'https://media.elcinema.com/uploads/_315x420_171fa99c3a1180b2de5282c8b2a31d98708fe9ac70e2310d5e62715ce047536f.jpg', 'Ahmed Mekky', 'Egypt', '19 June 1978', 'Ahmed Mekky is a popular Egyptian-Algerian actor, writer, director and rapper. He was born in Algeria to an Algerian father and an Egyptian mother, but grew up in the Cairo neighborhood of Haram. He began his career in cinema after graduating from the directing division at the Institute of Cinema. Mekky started out directing several short films such as “Yabanee Asly” (An Original Japanese) before directing “Al Hassa Al Sab’a” (The Seventh Sense), which starred Ahmed Al Fishawy, in 2005. That work was adapted from a short film that Mekky had previously directed in 2003. Ahmed Mekky has collaborated with his sister Inas Mekky in directing several television productions, including “Lahazat Harija” (Crucial Moments) and “Tamer wa Shawqiyah” (Tamer and Shawqiyah) in which he also played the role of Haitham Dabour. Mekky has found success as a slapstick, comedic actor. In this respect, the manner of speech adopted by Mekky’s characters have proved immensely popular. Mekky stars in the popular Ramadan comedy \"El Kebir Awi\" in which he plays both main characters, two brothers vying for the inheritance of their deceased father. In 2013, the third season of \"El Kebir Awi\" introduces a third brother, also played by Mekky. Besides his career in cinema, Mekky has also continued to write rap songs that he performs in movies or uploads onto the internet.'),
('1100257', 'https://media.elcinema.com/uploads/_315x420_1cef704c81ece6aa5690e58136deecfcd355edc769126d55e2db9cf7ce659d79.jpg', 'Engy Wegdan', 'Egypt', ' 7 July 1983', 'Engy Wegdan graduated from the American University of Cairo in 2004, with a major in Mass Comm. and a double minor in architecture and theater.'),
('1100258', 'https://media.elcinema.com/uploads/_315x420_eae89001512cad3d2dc4a9e7a734b7f84baf29afcb94003d092114f270173799.jpg', 'Sameh Hussein', 'Egypt', '16 December 1975', 'Sameh is an Egyptian actor who had studied at the theater division of the faculty of law and the arts. The actor also graduated from the Innovation Center at the Opera House. Sameh became well known for his sense of humor and his knack for making audiences laugh despite the fact that he had also presented several minor roles on cinema and television productions. His real beginning came about when he took part in the Egyptian sit com series “Ragel wa Sitt Sittat” (“A Man and Six Women”) where he presented a naive young man, the cousin of ‘Aadel (who was portrayed by Ashraf ‘Abd Al Baqy). Hussein was widely liked by audiences and became well known for the phrase “Dooolat Habiby”. Thus Hussein became one of the keys to the success of the television series. In its turn the show contributed to the fame of Hussein and he thereafter assumed roles in several films and shared the leading role with Ahmed Makky on the film title “H Dabbour”.'),
('1100259', 'https://media.elcinema.com/uploads/_315x420_47e8c2f790b2148de2eaa8953937130ba743bb0d7760b5d59a671cc77859bf78.jpg', 'Ahmad Afifi', 'Egypt', ' 8 November 1981', NULL),
('1100262', 'https://media.elcinema.com/uploads/_315x420_2e46cc307651241e17be9c4e2d3da9a6adc4de2ee32f6bfa2ad9a4053376e89c.jpg', 'غادة عز الدين', 'Egypt', NULL, NULL),
('1100263', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'حسن جاد', 'Egypt', NULL, NULL),
('1100264', 'https://media.elcinema.com/uploads/_315x420_386f8c321185f8402eb3b9c76ffdb9c521a91f677b3785d0fd67eb8ef6408a91.jpg', 'Sabri Al Sammak', 'Egypt', '19 March 1968', NULL),
('1100270', 'https://media.elcinema.com/uploads/_315x420_81ba363c56c4ccaebb04ca59000fd91baabf51a406bfadad5613aeb6125a63d1.jpg', 'Abdul Rahim Kamal', 'Egypt', '30 October 1971', 'He graduated from the High Institute of Cinema majoring in script writing in the year 2000. Some of the stories he wrote were published such as “A Trip to Denmark and other Countries”. He also wrote a novel called “Luxurious Torture”, because he was born in Sohag (Upper Egypt) most of Abdel Rehim Kamal’s writing were describing the socioeconomic environment in this area.'),
('1100271', 'https://media.elcinema.com/uploads/_315x420_991c9f3866f9cfba5bc274373985f356fc7d1f353732089687917186c003bad1.jpg', 'Arwa Gouda', 'Egypt', '27 September 1979', 'Arwa is a young Egyptian performer who was born in Saudi Arabia. She spent the majority of her life there before returning to Egypt five years ago. Arwa studied marketing at the Naval Academy. She hoped to attain a postgraduate degree but was unable to realize that ambition. \nArwa’s career began at the age of 12 when she assumed work as a model. She was selected as the best model in 2004 and thereafter assumed an acting role in the cinematic production “Muntaha al-Laza” where she represented a minor role alongside musician Yuri Marqady and actress Hanan Tourk. The role brought her attention and led to her nomination for a role in the film “Mafeesh Gheir Kidda” (“That’s All there Is” where she appeared alongside screen beauty Nabila and the young performer Khaled Abou al-Nagga. That title was directed by Khaled al-Haggar. Through her role in that production Arwa proved that she has a lot of talent and that she can present singing roles too.'),
('1100272', 'https://media.elcinema.com/uploads/_315x420_7931bc6601f3e97c5fdfaf86728ab9e505b2debd1d58f75a81516931a8a3df71.jpg', 'Asser Yassine', 'Egypt', '25 February 1981', 'Asser Yaseen was raised in a middle class home. His father is from Sohag (but lived) in Alexandria. His mother, Mona Al Dagheidy, is from Port Said.\nHe has a younger brother called Islam and they are both graduated from the faculty of engineering.'),
('1100273', 'https://media.elcinema.com/uploads/_315x420_201effe16bda59fa1e0aa3c95f6209daf06d8fdf2527b88e6411cbd28be61a25.jpg', 'Dawood Hussein', 'Kuwait', ' 5 November 1958', NULL),
('1100278', 'https://media.elcinema.com/uploads/_315x420_5d023e934d985caa59e503a0f3db35112262e930991a0544712698db3464f07b.jpg', 'Loai El Sayed', 'Egypt', NULL, NULL),
('1100286', 'https://media.elcinema.com/uploads/_315x420_3d27503d781f583796d783b08e6c56cb8616e36661a57b314103764d731f81dc.jpg', 'Haifa Wehbe', 'Lebanon', '10 March 1972', 'Haifa Wehbe is a Lebanese artist. Her career began at the tender age of 16 when she took part in the “Miss South Lebanon” beauty contest. That opening provided her with the opportunity to work as a fashion model in addition to granting her with slots in video clips and TV commercials. Haifa soon became among the most famous models active in the Arab World and her stunning beauty and femininity  saw her featured on the covers of many Arab magazines. Haifa thereafter adopted a position as an announcer on the A.R.T. television network. However, Haifa’s love of music and singing meant that she would soon make her first foray into that field by releasing her first album which was titled “Hazza Al Zamman” (“These Times”). Haifa Wehbe has often been dubbed “Malikkat Al Eghraa” (“The Queen of Seduction”).'),
('1100294', 'https://media.elcinema.com/uploads/_315x420_4d075426a43908304f0765cafdd4dd1e8ccc382369c5824d8922e5e58c31dc62.jpg', 'Dina Nadim', 'Egypt', NULL, NULL),
('1100295', 'https://media.elcinema.com/uploads/_315x420_e98d6c3829bf849d1b87fc62ba39855de486be9587051e5e5493e84cf79073a7.jpg', 'Tareq El Eryan', 'Palestine', '12 September 1963', 'Tareq El Eryan is a Palestinian-American director and producer living and working in Cairo, Egypt. He received his high eduction in Egypt, before moving to The United States to study film in the University of South Illinois. He then returned to Egypt and started his career as a director by making several music videos for Egyptian and Arab pop stars and television advertisements for multinational franchises like Coca Cola, LG, and Hyundai. As a film director, El Eryan made a few films that were box office successes and are still highly regarded by fans and critics. These films are “Al Embrator” (The Emperor) (1990), “El Basha” (The Pacha) (1993), “Elselem wel Teaaban” (Snake and Ladder) (2001) and “Tito” (2004). He is married to Syrian singer Assala Nasry, with which he had two sons.'),
('1100296', 'https://media.elcinema.com/uploads/_315x420_48dce006f1ef141ce8ea0ad2da49020682836bc8c62ca29402f4ef93ccd6804f.jpg', 'Hanaa Atteya', 'Egypt', NULL, NULL),
('1100299', 'https://media.elcinema.com/uploads/_315x420_2254544bebcfc14daf702484cbf155947e5058dc1ceb594ffa6d9cce0c400193.jpg', 'Amr Salama', 'Egypt', '22 November 1982', 'A’mr is an eminent director who graduated from Cairo University’s faculty of Commerce in 2005. A’mr chose not to pursue a career in commerce but rather elected to pursue a career in art. He has nonetheless made use of his education in commerce in making his films. Salama has directed numerous works which include shorts, advertisements, documentaries and video clips. He has also managed the art divisions of several production companies including the Affkar Company for Media Services.'),
('1100301', 'https://media.elcinema.com/uploads/_315x420_123fc43c7cab6aad7df1c6d41d700bdd76447407c2c5631dc0670047796efe36.jpg', 'Amr Zaki', 'Egypt', ' 1 April 1983', NULL),
('1100307', 'https://media.elcinema.com/uploads/_315x420_1bd68cdb92d97fa4f2df2bebaad3c36857101477452b0e191d2be7badf556f57.jpg', 'Shady Shamel', 'Egypt', ' 1 January 1982', 'Shady Shamel is an Egyptian actor. His talents came to the public’s attention when he participated and won in a contest to choose the lead actor for a series about the life of Andaleeb Abd Al Hakeem. The uncanny resemblance between himself and the departed (performer) helped secure his win.'),
('1100308', 'https://media.elcinema.com/uploads/_315x420_885d696632932469321d00ad4707556728d28a41416520150620e8401462b6ee.jpg', 'Eman Ayoub', 'Egypt', '18 January 1978', 'Is a graduate of the High Institute of Dramatic Arts who started her career on the stage. She acquired her experience by working with great stage actors like Sameer Ghaanem and Sanaa Younes. Her  popularity after her role in TV series “Hayaat al-Gohary” lead to another role in “’Eesh Ayyamak i.e. Live your life” that has proved her talent in playing the most difficult roles. Although she disappeared for a while for family reasons after her proven success, yet she is back again.'),
('1100310', 'https://media.elcinema.com/uploads/_315x420_aae1f903573e45474bdf58543b894587e6c60c0713356de859f7d091545a7a10.jpg', 'Ismail Farouk', 'Egypt', ' 3 May 1974', 'An Egyptian director born in May 3, 1974, Esma’eel Farouk is known for his B-films, low budget and technically poor films, made for the sake of money. Starting “90 dakeeka i.e. 90 minutes”, the film produced by “Waleed al-Tab’yee” to apologize to his wife “Ghaada Abdul Raazek”, through “Eb’a aabelny i.e. Impossible to happen”, Sa’d al-Soghayyar’s “Welaad al-balad i.e. Good guys” and “Al-Academeyya i.e. The Academy”.\n\nCritics consider him an extension to the - so-called - the 1980s B-films of the Egyptian Cinema.'),
('1100312', 'https://media.elcinema.com/uploads/_315x420_8642824a94e9eaea33104bbb6c9bf8f3a5bf9ffe6161d07ae82248f237948881.jpg', 'Hana Shiha', 'Egypt', '25 December 1985', 'She is a new actor daughter of artist Ahmed Thu El Fakar Sheeha  she has 3 sisters in the field of acting and cinema Hala , Maya  and Inas.'),
('1100321', 'https://media.elcinema.com/uploads/_315x420_2efadec115b939a4115ab2ce825743b833637bafd47278ddf571748e16cb0b85.jpg', 'Dorra', 'Tunisia', '13 January 1980', 'Dorra is a Tunisian actress. She earned her degree in political science in Tunis. Dorra made her way into the acting arena by joining a theater group. Her first performance was in a play titled “Magnoun” (“Insane”) which  was directed by Tawfiq Al Gibally. Thereafter Dorra assumed several roles in Tunisian cinema in addition to working on international works such as “Collosseum” which was directed by the English director Telman Reem in 2003. In that production Dorra portrayed the role of the Emperor’s consort. She also took part in another foreign work titled “Louisa’s Journey” which was directed by French director Patrick Foulsan in 2005. Dorra assumed the role of a woman named “A’isha” in that work. As of 2007, Dorra has started participating in Egyptian cinematic works.'),
('1100327', 'https://media.elcinema.com/uploads/_315x420_47d4f97f37b4c7fb8c5a619a6a321740faee277b9b797e0e989fa046bc130ae3.jpg', 'Reem Al Baroudi', 'Egypt', ' 6 October 1978', 'Reem El Baroudy is an Egyptian actress who was born on October 6, 1978. Even though she graduated from the Faculty of Tourism and Hotels, she continued to pursue acting, which she started when she was 15 years old when she appeared in commercials. Her first acting role was in the play “Nashnat Ya Naseh” (Aim, Smart Guy). She got her start in television with the TV serial “The Hedgehog” and also appeared in “Hamza We Binato El Khamsa” (Hamza and His Five Daughters), “Hada’iq El Shaytan” (The Devil’s Gardens), “Azhar” (Flowers), “Ahlamak Owamir” (Your Dreams Are Orders), “Jidar El Qalb” (Wall of the Heart), “El Rahaya Hagr El Quloub,” “El Bataniyya,” “Mamlaka El Jabl” (Mountain Kingdom), “Ihna El Talaba” (We’re the Students), and “ِAbed Karman.” She also acted in a number of films, including “Ya Ana Ya Huwa” (Me Or Him), and “El Fil Fel Mandil” (The Elephant in the Handkerchief).'),
('1100328', 'https://media.elcinema.com/uploads/_315x420_15acd503e68863e23a2533232a24673f6eb59b42ce42a5562d5a98585d25a7cb.jpg', 'Basmala Emad', 'Egypt', NULL, NULL),
('1100333', 'https://media.elcinema.com/uploads/_315x420_6a2c72c6b2aa9a0644fe3fbcad4e4efecf102b708e2e6375532948908eaa33c9.jpg', 'Nesrine Imam', 'Egypt', '22 January 1986', 'Nesreen Studied at the Marine academy in Cairo and became a professor at this same university for 2 months. \nNesreen Imam started her acting career after one of her friends recommended her to director Inas Bakr who was preparing for the miniseries “Nostalgia and Tenderness” starring Omar Al Sharif.\nNesreen also attended an acting crash course with theatrical director Kamal Atteya, who put her on the right track. From there she picked up her pace and acted in the series “Dead Heart” for Magdi Abu Emaira and actor Sherif Monir.\nShe also worked with Sherif and Magdi again in Ramadan 2010 in the series “Outside the World”'),
('1100334', 'https://media.elcinema.com/uploads/_315x420_bcd6c3fbab3dd35c3cc4c890f4c0c08dcb25a9d650d5e6ccb6a3aa04d32f5307.jpg', 'Emmy', 'Egypt', ' 9 February 1982', 'Emmy is an Egyptian singer and actress. Following a brief singing career, she started appearing in short films, until she had her breakthrough in 2005 with her role in the romantic drama \"Ahlam Omrena\" (The Dreams of Our Lives). She then went on to star in many films and television series, including \"Ma Tigy Nora\'os\" (Let\'s Dance), \"Qadeyet Nasab\" (Parentage Case) and \"El Amaleyya Messi\" (Operation Messi).'),
('1100343', 'https://media.elcinema.com/uploads/_315x420_8f20d7604e7e72ec2f4fd01c18df833f22921ef3523c32fde75ba161f66a2413.jpg', 'Hasnaa Saif  Aldeen', 'Egypt', '24 October 1976', 'She is Hassnaa Seif El Din Al Kelany granddaughter of the Jordanian ex minister of housing and construction. Her first appearance on screen was playing the role of actress Youssra’s sister in the series “Embarrassing moments” in 2007. She also acted in the movie “ Feminine moments” and in several series such as “The Night Of The Foxes” along side actor Farouk El Fishawy in 2007 and “Girls in their 30’s” featuring Mahmoud Kabeel and “The Shadow of a Fighter” featuring Hesham Selim.'),
('1100347', 'https://media.elcinema.com/uploads/_315x420_232e73d40b795e03f104e1d5ce8b073f3423243666c97939d67a7cd73fc22304.jpg', 'Tamer Mursy', 'Egypt', '28 August 1968', 'Tamer Morsi is one of the biggest producers that presents work involving many celebrities. He is also considered on the highest paying wages. He produced work such as series “Outside the World” for actor Sherif Monir and series “The Beach” and many others.'),
('1100354', 'https://media.elcinema.com/uploads/_315x420_95c90b6fd40cd0b264bdf380a17759d26ac0724b7e2a50b62cf1941e4ab3aba3.jpg', 'Sherif Abdin', 'Egypt', '13 February 1977', NULL),
('1100356', 'https://media.elcinema.com/uploads/_315x420_311e26a4daab757804b09d217c5d7864857f1d589fa3189ed1bb9c5a5b80951a.jpg', 'Madeline Matar', 'Lebanon', '29 August 1972', 'Madeline Michel Matar a Lebanese singer born in Gabal Lebanon in 1972. She studied eastern singing in the “national high institute for music.” The legendary “Wadee El Safi” heard her and liked her voice and asked her to join him in a charity fund raiser for Lebanon in London. This was her first step towards being a star then upon returning to Lebanon she was involved in a program on the LBC  called “Star Trophies”  then a record company helped her  record her first single which was a hit called “to describe” .'),
('1100358', 'https://media.elcinema.com/uploads/_315x420_eff328f3ac5799ae81aad52bcd51856692eedef6fd5b74b0b7c9268109d04d79.jpg', 'Robert Bechara', 'Egypt', NULL, NULL),
('1100362', 'https://media.elcinema.com/uploads/_315x420_aefa874a521a2f3780ce4ea790e836ee3dfd5a38880c1e223dcb5331219f71d1.jpg', 'Heba Magdy', 'Egypt', '28 July 1988', 'Heba Magdy is a young Egyptian actress who graduated from the Faculty of Arts at the University of Ain Shams in the department of theater criticism. She also studied Arab music in the Academy of Art, and was a ballet dancer. Heba started acting when she joined the Egyptian Opera House under the leadership of Dr. Gamal Salaama, and then trained under Maestro Salah Aram. Afterwards, Heba appeared in TV series “Boogy We Tamtam” (Boogy and Tamtam) and in “Fawazeer Amo Fouad” between 1998 and 2003. \n\nHeba’s first experience in television was in the TV serial “El Aid Al Wan,” directed by Mohammed Regany when she was still young. Heba also appeared in several children’s TV programs, including Fathy Abd El Wahab and Rania Farid Shoky’s “A’ila Magnuna Gedan” (A Really Crazy Family). Heba’s career really took off with the TV series “Ana We Ha’ola’” (Me and These Guys) with the famous actor Mohamed Sobhy. Afterwards, she appeared in the series “El Farisa We El Seyad” (The Prey and the Hunter) with actor Mamdouh Abdelalim and director Khairy Beshara. In the past few years, Heba has increased her television appearances, which has made her one of the most famous TV stars.'),
('1100363', 'https://media.elcinema.com/uploads/_315x420_a3e934f836b651685aece8863c9a3114e076b42fd4bcc87978a5e1abd7b0fb2a.jpg', 'Eyad Nassar', 'Jordan', ' 9 November 1971', 'Eyad Nassar is a Jordanian actor and director. He was born in Amman in 1974, and worked as a teacher, before switching his career to art. He started by working as an assistant director in many television series, after which he directed theater plays. Nassar\'s acting talent appeared strongly in the popular Syrian series “Al Amin wal Ma\'moun,” after which he moved to live in Cairo and started a new phase in his career through working in Egyptian television dramas like “Sarkhet Ontha” (A Female\'s Cry). His breakthrough performance was that of the Muslim Brotherhood leader Hassan El Banna in the historical series “Al Gama\'a” (The Community). He received wide critical acclaim for his depiction of the Brotherhood leader and earned a big fan base in Egypt. From then on, his work shifted majorly to Egyptian television series, and he went on to play successful roles in series like “Al Mowaten X” (Citizen X) and “Moga Harra” (Heat Wave). Nassar also worked in film, starring in works like “Bentein min Masr” (Two Girls from Egypt) and “Basra.”'),
('1100365', 'https://media.elcinema.com/uploads/_315x420_ada5d0804f7f8fdc46e6e8f029a138a3c8154cc5cd4c6e8bb679087abc21d825.jpg', 'Sanaa Muzian', 'Morocco', ' 4 November 1970', NULL),
('1100371', 'https://media.elcinema.com/uploads/_315x420_a4a685eef7529abf8f7eae896a1fec636dfc577ba58c1fca19b4807c3fccee6e.jpg', 'Ahmed Shaker', 'Egypt', ' 7 June 1970', 'He is the son of director Abel Latif Shaker. He presented many roles whether in the cinema, theater or television. He portrayed many characters the best known one was the portrayal of Farid in the series “Asmahaan”'),
('1100382', 'https://media.elcinema.com/uploads/_315x420_3aaaf960bccb4cd4368008626bb6dabd5f92c722e88275362c148781b420fc4a.jpg', 'Sabry Fahmy', 'Egypt', NULL, NULL),
