('1100390', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'حسين خليل', 'Egypt', NULL, NULL),
('1100391', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'ماجد يوسف', 'Egypt', NULL, NULL),
('1100446', 'https://media.elcinema.com/uploads/_315x420_ecdbcfcb02982dc43074f9478fab83e960cbfad9bbaaa42f99b0a058b80e3bf6.jpg', 'Esam Ismaiel', 'Egypt', ' 8 February 1975', NULL),
('1100447', 'https://media.elcinema.com/uploads/_315x420_6a98e22db1f34c4bf75c595990e6459d500981c58079ddc27dc2c799cd3c89f5.jpg', 'Mohamed Ahmed Maher', 'Egypt', ' 6 October 1981', 'Mohamed Ahmed Maher was born in October 6, 1981. He is the son of actor Ahmed Maher and graduated from the Faculty of Science. He began his acting career with the TV series “Amira Fi Abdeen” (Princess in Abdeen) for which actress Samira Ahmed suggested him for the role. Mohamed quickly proved himself within the acting world. He appeared in the series “El Sanderella” (Cinderella), “Canaria We Shoraka” (Canaria & Co.), “Souq El Khodar” (The Vegetable Market), and others. One of his most recent successes was his performance of the role “Kareem” in the series “El Hara” during the 2010 Ramadan season.'),
('1100455', 'https://media.elcinema.com/uploads/_315x420_0706ac6a16e3ed0209c8da8300b0395776ea07df1f717fc648a41192a889adcf.jpg', 'Amr Al Qadi', 'Egypt', '12 September 1974', NULL),
('1100456', 'https://media.elcinema.com/uploads/_315x420_97265295de59e53ffd92a1ec3e200032b2389dcde7c7e17304f5a580264dd3a9.jpg', 'Yahya Zakariya', 'Egypt', NULL, NULL),
('1100457', 'https://media.elcinema.com/uploads/_315x420_8a509f4df61737f13350e1e7322baa6ab644236f44d56d32b985895a2e104e0e.jpg', 'Amr Mamdouh', 'Egypt', ' 4 January 1980', NULL),
('1100458', 'https://media.elcinema.com/uploads/_315x420_0ee351b556edf46d089d64a38207ead77e2824676cf1163db80d0607220e414d.jpg', 'Mamdouh Maddah', 'Egypt', ' 1 February 1958', 'Mamdouh Madah was an Egyptian actor. He graduated from Cairo University\'s faculty of law in 1990, and worked as a lawyer after his graduation, before switching his career to art. He participated in Al Haraka troupe\'s theatrical shows in the Cairo Opera House, and landed his cinematic debut in the 1999 comedy “Aboud Alal Hodoud” (Aboud On The Borders). He then started appearing frequently in films like “Kalemny Shokran” (Please Call Me), “Al Saher” (The Magician) and “Kaf Elqamar” (Moon\'s Palm). He died in February of 2015.'),
