('1100472', 'https://media.elcinema.com/uploads/_315x420_9dcfd0fb654f8923fbeb866ce4a691bab91dcb819c7fd04a718242d7e58bbe47.jpg', 'Heidi Sleim', 'Egypt', NULL, 'Heidi Sleim is an Egyptian actress who began her career with the film “Ma’ali El Wazir” (His Excellency, the Minister) in 2002. Afterwards, she acted in a number of other films, including “Howa Fi Eih” in 2002, “El Rayes Omar Harb” in 2008, and “El Alamy” in 2009. She also appeared in a number of TV serials, including: “Mahmoud El Masry” in 2004, “Adham El Sharkawy” in 2008, “Qanun El Maraghy” in 2009, and “Doktor Amradh Nesaa” (Gynecologist) in 2014, among others.'),
