('1100546', 'https://media.elcinema.com/uploads/_315x420_4b4ecc75430a7c95b22f15362a87e957dff2afe323dab32a634910e22ddaf4a6.jpg', 'Doaa Teama', 'Egypt', ' 2 May 1982', NULL),
('1100547', 'https://media.elcinema.com/uploads/_315x420_f4b62d04a378fbe90437af9357ede19e38171e3f1df955398ada67399a3b5cf5.jpg', 'Shady Khalaf', 'Egypt', '13 October 1977', 'Shady is the son of renowned poet Nabil Khalaf. He appeared in one of Youssif Chahine’s latest works “Heyya Fawda” (“Chaos”) and the experience was a sort of launch point for his career in cinema.'),
('1100548', 'https://media.elcinema.com/uploads/_315x420_3c30e5b65e2785a931f30a321452083023ce54e008b62357fcb5f59e7b5cd942.jpg', 'Nermin Maher', 'Egypt', ' 9 October 1984', 'Nirmeen Maher is an Egyptian actress. She started her career as a model in television advertisements and music videos, until she debuted on film in Adel Imam\'s comedy “El Sefara fel Emara” (The Embassy in The Block) in 2005. She also co-starred in the comedy film “Dars Khosusy” (Private Lesson) in the same year, and “El Eyal Herbet” (The Children Have Escaped) in the year after. Among her other notable film roles are “El Zamahlaweya”, “Qoblat Masruqa” (Stolen Kisses) and the television series “Dawaran Shubra” (Shubra Square).'),
('1100552', 'https://media.elcinema.com/uploads/_315x420_96df23de7dd7c16f9a791857f3a25d8ffc118ef00ba238de80c333aa43cf7714.jpg', 'Mohamed Karim', 'Egypt', ' 2 January 1980', 'Mohamed Karim is an Egyptian actor. He was born in 1980, and started working in the arts in Los Angeles after finishing his high school. He started appearing in television series like \"Ahlam Moa\'agala\" (postponed Dreams) and \"Banat Afkary\" (My Dear Thoughts) and \"Mas\'alet Mabdaa\'\" (A Matter of Concept). His real breakthrough came with his roles in Khaled Youssef\'s films, like \"Hina Maysara\" and \"Dukkan Shehata\".'),
('1100567', 'https://media.elcinema.com/uploads/_315x420_01b0a2c32d5bd398c3ec8aa71deaf371815c2e980908ba7d11b288f595e4c8c2.jpg', 'Mohamed Abdel Khalek', 'Egypt', '18 June 1969', NULL),
('1100569', 'https://media.elcinema.com/uploads/_315x420_4bdaf40fae03da4c1ff99b2cd5a4a78d96b035f08198f509077b974a042795cc.jpg', 'Hany Hussien', 'Egypt', '15 May 1980', NULL),
('1100602', 'https://media.elcinema.com/uploads/_315x420_64e391a9bcd85155a4584a92fec5b672380323dcf7f1ecd33918b656b784468f.jpg', 'Marwa', 'Lebanon', '15 July 1974', 'Marwa is a Lebanese musician who can perform the role of the temptress. She headed to acting when she collaborated with producer Mohamed al-Sobkky and thus she has performed the role of the temptress with limited acting talent.'),
('1100611', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ehab Amr', 'Egypt', NULL, NULL),
('1100612', 'https://media.elcinema.com/uploads/_315x420_f69183f24df5d4de5698e3ed1a6532b0f710089f68426e0514e7f0769e2e777d.jpg', 'Ahmed Nour', 'Egypt', NULL, NULL),
('1100613', 'https://media.elcinema.com/uploads/_315x420_1bc82606fa44b7b236aa741f158ac6540abbc283db6f98fe9fb38dfffd86e034.jpg', 'Tamer Eissa', 'Egypt', ' 8 January 1984', NULL),
('1100614', 'https://media.elcinema.com/uploads/_315x420_4e352a18a4c180945cb40bac42d327c52118c65f386348cd9138e582bf5d0c60.jpg', 'Hamdi El-Tunisi', 'Egypt', NULL, 'Egyptian actor and director, Hamdi El-Tunisi began his career in theatre with the play, “El Milad” (The Birth) in 1997. In 2002 appeared in television series “Faris Bila Gowad” (A Knight Without a Horse). El-Tunisi has since appeared in several films including: “Dem El Ghazal” (Blood of the Gazelle; 2005), “Amara Yacoubian” (The Yacoubian Building; 2006), “El Showq” (The Passion; 2011) and “Farsh wa Ghata” (Rags and Tatters; 2013). In 2011, he also appeared in the television series, “Dawaran Shubra\" (Shubra Square). El-Tunisi also worked as the assistant director on the film “Qoblat Masrouqa” (Stolen Kisses) in 2008.'),
