('1100671', 'https://media.elcinema.com/uploads/_315x420_28cb9ebfc41d2003fabf749c267255c1e2937de846f8fe27d0e2d52987070eb6.jpg', 'Sayed Al Jazzar', 'Egypt', NULL, NULL),
('1100673', 'https://media.elcinema.com/uploads/_315x420_bd796ad1900ffd9e67dcaeb368bffff4f0b6ad09bc2748b5f5dc7d26818449ef.jpg', 'Muhammad Adel', 'Egypt', '14 April 1986', NULL),
('1100677', 'https://media.elcinema.com/uploads/_315x420_a26a034a0c4325ab39a450d2fc82b3a10379c8f8d92d3898707c46aa9b8f8169.jpg', 'Ayten Amer', 'Egypt', '22 November 1986', 'Samar Ahmed Abd El Ghaffar was born in Alexandria and moved to Cairo when she was 4-years-old. She\'s the sister of the Egyptian actress Wafaa Amer. She studied Acting and directing in Cairo and worked as a model which benefited her to overcome her fear of the camera. Her first true step was her role in “Hadret El Motaham Aby” (Mr. Lawyer, my Father) with Nour El Sherif. From there she was cast in many movies and series like: “Ramy El Itesamy,” (Sit-in Ramy), “Share\' El Haram,” (El Haram str.) “Banat El Am,” (Female Cousins) “Hassal Kheir,” (It\'s Alright), “Sa\'a we Nos” (An Hour and a Half) and “Harag We Marag\" (Hubbub).'),
('1100681', 'https://media.elcinema.com/uploads/_315x420_ece2fff94c72972893afa6e3b7388db1184573d4bb865ab2ad0951d8f8af2041.jpg', 'Mahmoud Kamel', 'Egypt', '21 September 1975', NULL),
('1100687', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'جورج رمسيس', 'Egypt', NULL, NULL),
('1100701', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'نسرين فهيم', 'Egypt', NULL, NULL),
('1100704', 'https://media.elcinema.com/uploads/_315x420_edd7326244027c53dc6c59cd6f499a49df53ec220ee22ab3845448791836217e.jpg', 'Heba El Sisi', 'Egypt', '28 April 1983', 'Heba Alsisy was a law student at Mansoura University who entered the spotlight after moving to Cairo where she began working as a model and dancer. She became well-known after appearing in several commercials, and she later represented Egypt in several international beauty pageants. In 2004, Alsisy was named Miss Egypt. She then took courses in singing and acting and began working in the entertainment industry.'),
('1100707', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'جمال إبراهيم', 'Egypt', NULL, NULL),
('1100721', 'https://media.elcinema.com/uploads/_315x420_02444b188c6a0d057d88212bc4b3d92b0a0ec9a1a0fccb6f05671903a7af5845.jpg', 'Ayman Bahgat Amar', 'Egypt', '15 April 1974', 'Ayman is a poet and a musician. He is among the most prolific poets of the contemporary period and he is the son of renowned playwright Bahgat Qammar. Ayman has authored yrics to some of Egypt and the Arab World’s most distinguished artists. Ayman also has experience writing cinema screenplays including “Bahebek” (“I Love You”) and “Anna Kaman” (“Me Too”) in 2003 for Mostafa Qammar, “’Andaleeb al-Dokky” in 2007 for Mohamed Heneidy, “Assif ‘ala al-Iz’ag” (“Sorry for the Disturbance”) in 2008 for Ahmed Helmy. Moreover Ayman has also been credited for several film songs along with opening and closing themes for television series. \nAt the start of his career Ayaman used to write lyrics for songs used in advertisements for mobile phones and electronics. Thereafter Ayman got to know a couple of youths who were working on a music album titled “Akhadatho al-Seema” in 1991, however Ayman did not feel accomplished through that effort. Nonetheless he felt that the project was a good way to achieve recognition. Afterwards Ayman got to know the composer Hassan Donya who helped him make his way into the music tape industry. Thereafter Ayman had the chance to collaborate with a number of musicians of the likes of Samira Sa’eed, Faris, Ehab Tawfiq, ‘Amr Diab and others.'),
('1100732', 'https://media.elcinema.com/uploads/_315x420_8aa1ccebff3f9c50d044b3cfb4167576a12c44f3135e855c81636fea88de4e1d.jpg', 'Ahmad Al-Sayed', 'Egypt', NULL, NULL),
('1100733', 'https://media.elcinema.com/uploads/_315x420_f835c9f3d6b4dee6c337dbb3341db171034279b57a18961ad49b9d186cbdca72.jpg', 'Nabil Sobhy', 'Egypt', NULL, NULL),
