('1100745', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'تامر ربيع', 'Egypt', NULL, NULL),
('1100747', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'صالح القاضي', 'Egypt', NULL, NULL),
('1100750', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمود الخراط', 'Egypt', NULL, NULL),
('1100751', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'خالد الفخراني', 'Egypt', NULL, NULL),
('1100766', 'https://media.elcinema.com/uploads/_315x420_e2fa6dcdf197343e4be1994a327deb475d240482763d85fa935f469e6421ea18.jpg', 'Medhat Shalaby', 'Egypt', '22 November 1944', 'Medhat Shalaby is an Egyptian television presenter specializing in football. He started his career in the Egyptian ministry of interior affairs as a police officer, where he also started his failed attempts at playing football alongside the ministry\'s team. Shalaby stayed at the ministry until he reached the rank of major general, and then retired to focus on working in the media. He first worked with the Egyptian television as a presenter in several contest shows, while also working as a football coach in a number of infamous League 2 and League 3 teams. After failing as a football coach, he started working in the Egyptian Football Association, and since 2007, he has been working solely as a football programs presenter.'),
('1100767', 'https://media.elcinema.com/uploads/_315x420_596fa192ae39aaa94c37a46aa5bc685a672625f6fc67f7074097dae4a3e6427c.jpg', 'Raouf Abdul Aziz', 'Egypt', NULL, 'Raouf Abdel Aziz is an Egyptian director and cinematographer. He started his career in \"Kheyana Mashroua\" (Licit Infidelity), then as a focus puller in \"45n \"45 Youm\" (45 Days). He worked as a cinematographer in television series including \"Bab Elkhalq\" and \"Saheb El Saada\", and films including \"Asham\" and \"Wahed Seaidy\". He debuted as a director in the television series \"Alf Leila we Leila\" (One Thousand and One Nights).'),
('1100771', 'https://media.elcinema.com/uploads/_315x420_d1aaa9a9573d7912038d4701f5d96b93def81d8e6e832b14cd76b97802876255.jpg', 'Hassan Harb', 'Egypt', '17 October 1979', NULL),
('1100774', 'https://media.elcinema.com/uploads/_315x420_ad628c7de666ddd348f07d9c2c3e7e07f9198963b6087c3fe00fd249e45fc6d7.jpg', 'Yassmin Jamal', 'Egypt', '15 June 1984', NULL),
('1100776', 'https://media.elcinema.com/uploads/_315x420_a9d7d0c76aa5ccb79c62693c2a2d1b83fcfd53c9e197f2d01aa6018fa5e573ea.jpg', 'Youssef Othman', 'Egypt', '14 July 1994', NULL),
('1100778', 'https://media.elcinema.com/uploads/_315x420_da601812d485623bff5891a050219e2770e33ada9d7378979296624bbf7fc346.jpg', 'Hossam ElHusseini', 'Egypt', NULL, NULL),
('1100783', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmed Yousef', 'Egypt', NULL, NULL),
('1100784', 'https://media.elcinema.com/uploads/_315x420_a68d8074ccb28ef5f7d13c8036fd66687650930930f94597af57232e3059accf.jpg', 'Ahmed Fahmi', 'Egypt', '17 March 1980', 'Ahmed Fahmy is a young Egyptian actor who began his artistic career as a musician in the group “Wama”. Through relying on his abilities as a musician and his training at the conservatory Fahmy achieved a great measure of success when he assumed his first acting role. After his first acting break, Ahmed went on to achieve one success after another.'),
('1100796', 'https://media.elcinema.com/uploads/_315x420_ce3336ce35ca13d5652247a01982241075041c7229c384672e19af199641e970.jpg', 'Maryan Khoury', 'Egypt', ' 2 October 1958', NULL),
('1100798', 'https://media.elcinema.com/uploads/_315x420_1f66dab785a169c9e29ecf5f72b0eb5f7ee6ff98810932eaa60e1a48085dd2f0.jpg', 'Mohammed Nader', 'Egypt', NULL, NULL),
('1100802', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Omar Hassan', 'Egypt', NULL, NULL),
('1100808', 'https://media.elcinema.com/uploads/_315x420_4d93ee2bb1c6d61e88e1bfeafb01c375ebe067a7396c883024c5b074735b3ffa.jpg', 'Muhammad Atef', 'Egypt', NULL, NULL),
('1100810', 'https://media.elcinema.com/uploads/_315x420_43808f2eabb4667c6f0a2a1c75d8d10996346239fba37fc49b5eafefddce32a4.jpg', 'Amira Hany', 'Egypt', ' 5 July 1985', 'Amira Hany is an Egyptian actress. She started her career in 2003 while still a student at high school, through a role in the successful television series \"El Amma Nour\" (Aunt Nour). She then went on to appear in the series \"Mahmoud El masry\" the next year, then took a hiatus until she finished her graduate studies. She came back to appear in television series and films including \"Saa\'a we Nos\" (An Hour and a Half), \"Ebn El Arandaly\" and \"Camp\".'),
('1100811', 'https://media.elcinema.com/uploads/_315x420_9f166419d09f1fe938a1d1b05726eee6de23e6557a3541afb75e1db36247bb32.jpg', 'Abdul Aziz Hashad', 'Egypt', ' 6 November 1979', NULL),
('1100812', 'https://media.elcinema.com/uploads/_315x420_080333f614c468ba4f7ae19e592d3b078ae56c8bb7f929531ccbfd790a6d2069.jpg', 'Haitham Wahid', 'Egypt', NULL, NULL),
('1100817', 'https://media.elcinema.com/uploads/_315x420_a5cb0036423479cd8f4e101425a052a222faaf3811a8a19b9e1ec40e714df058.jpg', 'Adel Karam', 'Lebanon', '20 August 1972', NULL),
('1100820', 'https://media.elcinema.com/uploads/_315x420_785781edc88afb91525ea0da46f09cc526262aae77c9646f7a522633f7156b41.jpg', 'Fatma Safa', 'Lebanon', NULL, NULL),
('1100835', 'https://media.elcinema.com/uploads/_315x420_9645f9a83942acc9e7a57af64cc4ee69ba7b268b8390fe2376a39b57138b3ec8.jpg', 'yousra karam', 'Egypt', NULL, NULL),
('1100845', 'https://media.elcinema.com/uploads/_315x420_423a82c91b0596a4abe7223eed14740174ab2f1f86f20c7ebb0e7986bfefcb38.jpg', 'Hazem Fouda', 'Egypt', NULL, NULL),
('1100846', 'https://media.elcinema.com/uploads/_315x420_07968ee427eba4c9da1b6994866042e381b22ee604d2bad73b76235e78ee0edd.jpg', 'Ayman Shawky', 'Egypt', NULL, NULL),
('1100848', 'https://media.elcinema.com/uploads/_315x420_5283d9fe70a4d91526ffcfad61a497840bf6f7652adbb2f5794fdbfe1d4e4561.jpg', 'Feryal Youssef', 'Tunisia', '11 December 1980', 'Firyal Youssif is a Tunisian actress, her real name is Firyal Farageh. Firyal began her acting career in Tunisia with a television series titled “Qamrat Sayyidi Mahrous” (“Master Mahrous’ Cabin”). She subsequently spent 12 years acting on Tunisian television before transferring to Egypt where she performed in the film “Bi Al Alwan Al Tabee’yha” (“In Natural Color”).\nDespite the former being Firyal’s first work in Egypt it has nonetheless led her to receive an award at the Alexandria Film Festival. Thereafter Firyal took part in the television series “Kallam Niswan” (“Girl Talk”) and “Malikah fee Al Manfa” (“Queen in Exile”). Her most recent work was “Al Ragol Al Ghamid be Salamatoh” (“A Mysterious Man”) which saw her work alongside Hany Ramzy and Nelly Karim.'),
('1100851', 'https://media.elcinema.com/uploads/_315x420_c9c23cf1ee71bbe112e6dde1903c0cf1ff2dccd092cc2b8d03324898e956a2dd.jpg', 'Mohsen Mansour', 'Egypt', ' 1 March 1973', 'Mohsen Mansour is a talented Egyptian actor who participated in many supporting roles. He attracted attention through his role in film \"Tito\".'),
('1100854', 'https://media.elcinema.com/uploads/_315x420_8c896dda26981a9d0a0c80e13a64b40a44743b91542265c7f19d4b46a82c299f.jpg', 'Islam Khairy', 'Egypt', NULL, 'Islam Khairy is an Egyptian director. He started his career as an assistant director in the film \"Ahlam Omrena\" (The Dreams of Our Lives) in 2005. He also worked in then the films \"Keda Reda\" and \"Khareg Ala Elqanun\" (The Outlaw). He debuted as a director in 2010 by becoming one of the directors of the first season of the television series \"El Kebir\".'),
('1100855', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'حسن السيد', 'Egypt', NULL, NULL),
('1100856', 'https://media.elcinema.com/uploads/_315x420_519fff58c50da6ee9fc01695b2cfe390deb525ef178ce625a2e54ec7bd77abad.jpg', 'مروان صابر', 'Egypt', NULL, NULL),
('1100858', 'https://media.elcinema.com/uploads/_315x420_685bea5120bacdb705ac674fc4ccd7e585633fed8a2f06303cc47729b3904eff.jpg', 'Khalid Hassan', 'Egypt', ' 9 May 1976', NULL),
('1100859', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد عبدالغني', 'Egypt', NULL, NULL),
('1100865', 'https://media.elcinema.com/uploads/_315x420_1d32e5cab09d85cb9da7e795c624f8178435e3adb2e3a31b4c113334beec63ba.jpg', 'Saba Mubarak', 'Jordan', '10 April 1976', 'Saba Ahmed Suleiman Mubarak Al Suyoof is a Jordanian actress that was born in the Northern province of Jordan on the 10th of April, 1976.\nHer mother is the departed artist Hanan Al Agha. She graduted from Yarmouk University in 2001 where she had studied theater.\nSaba can be considered a first rate performer in the field of Arabic drama. She has been dubbed “Queen of Hearts” and it should also be noted that she is divorced from the director Shawqi Al Magiry to whom she has bore one son called Ammar.\nSaba has preformed remarkably in a variety of roles which include “Qamar”, “Sihr”, “Al Kawathir”, “Al Hajaj”, “Al Arwah Al Muhajira”, “Al Shams Tashriq min Jadeed” , “Al Wardah Al Akhira” and “Khaled bin Al Waleed” where she assumed the role of Hend bint Utbah, a role that has since become famous. \nAlso of note is her performance in “Nimr bin Adwan” which has secured her position as a first-rate performer and “Al Ijtiyah” which has come to be known internationally. \nMost recently, she has performed in “Siraa Ala Al Rimmal” and “Eioun Ulyah”.'),
('1100867', 'https://media.elcinema.com/uploads/_315x420_fc451ecb2d5d524f82ce29806b291f7a1a9e84a7b0caab89192c733785ba2733.jpg', 'Ezzat Badran', 'Egypt', NULL, NULL),
