('1100873', 'https://media.elcinema.com/uploads/_315x420_e075234d4cc33aebad0acd14b379eb9ecbc3edff25afff7ff8089569c5c795a6.jpg', 'Ahmed El Shamy', 'Egypt', '12 September 1979', NULL),
('1100876', 'https://media.elcinema.com/uploads/_315x420_fcde49b7287bcdddefb70e8e34ec09ccfe6a0bc8485b28411ced8a3c8f27fb62.jpg', 'Eid Abu Al-Hamd', 'Egypt', NULL, 'Eid Abul Hamd\'s simple features have played a big role in his success in playing labor-intensive, brutish roles. He\'s become famous in Egyptian cinema for playing mostly poor, rough and tumble characters, both on stage and on television. Abul Hamd has worked with many top actors and directors.'),
