('1100885', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Omnia Wagih', 'Egypt', NULL, NULL),
('1100886', 'https://media.elcinema.com/uploads/_315x420_b84a923e4281b5b8bf0c7b79d1e36e6609eb8a2efe15d0aba4df6278905b6535.jpg', 'وائل خلف', 'Egypt', NULL, NULL),
('1100888', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد مصطفى', 'Egypt', NULL, NULL),
('1100892', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'عادل الليثي', 'Egypt', NULL, NULL),
('1100897', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد حسن', 'Egypt', NULL, NULL),
('1100903', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'عماد صبحي', 'Egypt', NULL, NULL),
('1100906', 'https://media.elcinema.com/uploads/_315x420_6bd3b8a94a157cb73ea179172630bf8671e9a9d9d7d53d301e1ae7b01b0231d1.jpg', 'Ahmed Elbeh', 'Egypt', '29 March 1969', 'Screenwriter Ahmed Al Baih had his writing debut with the 1990 film “Shabab A’la Kaff A’freit” (“Youths in the Palm of a Demon”). Later in 1997, Ahmed wrote the film “Al Isma’iliyah Raieh Gayy” (“Two-Way Ticket to Isma’iliyah”). The film served to contribute to the fame of all those involved in the production, including Ahmed Al Baih.'),
('1100924', 'https://media.elcinema.com/uploads/_315x420_6a211f25cc603b780dbb78be6e6a01550003994ffc7487b40d5bc3c516db7762.jpg', 'Karla Boutros', 'Lebanon', ' 1 July 1967', NULL),
