('1100983', 'https://media.elcinema.com/uploads/_315x420_4768603e59b4b13fdecfd3718c9db04f92f923f5d14988a32d33f0f96ec5bc6a.jpg', 'Noha Ismail', 'Egypt', NULL, NULL),
('1100986', 'https://media.elcinema.com/uploads/_315x420_0ca580adc7b4673a45f71f6cad05435855146470115a0a62c3de34abf89b6b77.jpg', 'Adel Al Kumi', 'Egypt', NULL, NULL),
('1100991', 'https://media.elcinema.com/uploads/_315x420_1dbc06e3985399876b2052d8db7377b7ea84edd2b67de83792b0eec749e34aa7.jpg', 'Susan Negm Eldein', 'Syria', '24 November 1973', 'Suzan Negm El Deen is a Syrian actress born in Duraykish – Tartous where she finished her school studies before moving to Damascus to study architecture.\nIn 1990s, Suzan started her acting career by some small roles in TV, he first role was in Saalem al-Kourdy’s “Al-dakheela i.e. The stranger” with Jihaad Sa’d and Radwaan ‘Akeely.\n“Nehaayat rajol shoujaa’ i.e. The end of a courageous man”, “Al-kawaasser i.e. The birds of prey”, “Al-thourayya i.e. The pleaides”, “Khaan al-hareer i.e. The silk inn”, “Haneen”, “Saladin”, “Ommahaat i.e. Mothers”, “Al-Zaaher Beibars”, “Molouk al-tawaa’ef i.e. Kings of Tribes”, “Toyour al-shakk i.e. Birds of   doubt”, “Zawj al-sett i.e. The lady’s husband” and “Forsat ‘omr i.e. Lifetime opportunity”.\n\nSuzan is married to a businessman with two boys and two girls. She owns a fitness club “The champions” in Maza - Damascus and has her own production company.'),
('1101004', 'https://media.elcinema.com/uploads/_315x420_7f96844577a5d9b7d4bb5e304d33480caf9d99f27cc5b740ee54ffc4185c14d8.jpg', 'Essam Shahin', 'Egypt', NULL, NULL),
('1101009', 'https://media.elcinema.com/uploads/_315x420_c7885bf128eb5f6548a205d343556c7a44ef87167b499a8c0d971d500db4a886.jpg', 'أشرف محمد', 'Egypt', NULL, NULL),
('1101029', 'https://media.elcinema.com/uploads/_315x420_e7ea246c7cbae5aa675819cb96dd91fc5d12aee69651fffb6380c9a361f8b910.jpg', 'Rania Shaheen', 'Egypt', '22 August 1981', NULL),
('1101067', 'https://media.elcinema.com/uploads/_315x420_747485e292279477e37a3581613495c8f4d7f09e69d02fd6de74463869fe34a1.jpg', 'Yara Goubran', 'Egypt', NULL, 'Yara graduated in the summer of 2004 from the American University of Cairo where she had studied media and theater. She took part in several theatrical productions whilst at college and thereby gained stage acting experience. \nYara’s cinema debut occurred through “Basra”. The title received the award for best screenplay at the Cairo International Film Festival, a screenplay which was authored by Ahmed Rashwan. Besides her role in “Basra”, Yara Gobran has taken part in the works of esteemed directors of the like of A’ly Idrees, Kamla Abou Zikry and Shereef A’rafeh.'),
('1101079', 'https://media.elcinema.com/uploads/_315x420_f5fecfc2352d058bf360f01ae0c3038abe348b90c0d3f7de46ce6ca7a84ca67f.jpg', 'Moataz Abdelwahab', 'Egypt', '12 June 1977', NULL),
('1101097', 'https://media.elcinema.com/uploads/_315x420_d28eed2cecb842d16fd5335bea320cd4640a2633311c256c806dd16dc6993c00.jpg', 'Tariq Tamim', 'Lebanon', NULL, NULL),
('1101104', 'https://media.elcinema.com/uploads/_315x420_793974cc059a2965d797a24a8f1910a6f88eb045b371b954ad03521a3b833f14.jpg', 'Mahmoud Gharib', 'Egypt', '15 September 1977', NULL),
('1101153', 'https://media.elcinema.com/uploads/_315x420_3430c56c340e8bcf38443fe5e571aef1a17a45a17352eec73c94b0eb66fff122.jpg', 'Moataz El Tony', 'Egypt', '14 July 1979', NULL),
('1101154', 'https://media.elcinema.com/uploads/_315x420_40105469875224bb4a2b44f70f91ca21719d628c45a7046eb13a662eeca5f7dc.jpg', 'Eiad Saleh', 'Egypt', '27 August 1985', NULL),
('1101155', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'منى الزرقاني', 'Egypt', NULL, NULL),
('1101172', 'https://media.elcinema.com/uploads/_315x420_a0ab5f43b63f9cd3c4cb03120c98906c3899d6320b69553902a3025af00e7caf.jpg', 'Mariam Naoum', 'Egypt', NULL, 'Mariam Naoum is an Egyptian screenwriter. She stopped studying economics in France to return to Egypt and study screenwriting at the High Institute of Cinema. Following her graduation, she started working in the advertisement field, before writing her critically acclaimed film debut \"Wahed Sefr\" (One Nill). She then went on to become one of Egypt\'s most acclaimed screenwriters, with screenplays like \"Segn El Nesa\" (Women\'s Prison) and the adaptation of the novel of the same name by Ibrahim Aslan \"Zat\".'),
('1101175', 'https://media.elcinema.com/uploads/_315x420_5a8312ee83cc01fb1a1480928dfcc57e95a2864e70945d96c40fa6eae8f236ba.jpg', 'Donia Samir Ghanem', 'Egypt', ' 1 January 1985', 'Donia Samir Ghanem is an Egyptian actress. She is the daughter of the performers Dalal Abd Al Aziz and Samir Ghanem.\nDonia completed her university education at MSA university in Egypt and she has assumed roles in several cinematic and television productions. She has also presented several songs.\nHer profile was raised by her performances in “Cabareh” and “Al Farah”. More recently, she has acted in “Teer Enta” and has become recognized as one of the premier performers of her generation.'),
('1101177', 'https://media.elcinema.com/uploads/_315x420_00d48f92baa5d07b15d96db5cd47526ef4fb737ecf84fb79d0389f592ced6145.jpg', 'Mohamed Al-Ahmedy', 'Egypt', '16 August 1981', NULL),
('1101178', 'https://media.elcinema.com/uploads/_315x420_3aa03878518e86eafea1c3a54a8d7fb5a65dab61cfe3743eac1e62e8c9b0afd1.jpg', 'Nahed El Sebai', 'Egypt', '27 May 1987', 'Nahed is an Egyptian actress who has assumed several minor roles in Egyptian cinema.'),
