('1101223', 'https://media.elcinema.com/uploads/_315x420_565389c32c260081d6e9ae478bbe02e1961a1338784763cffbdf3c585f438dcd.jpg', 'Taim Hassan', 'Syria', '17 February 1976', 'Tim Hassan was born on the 17th of February in 1976 in the coastal city of Tartous, Syria in an area known as ‘Sheikh Badr\'. In 1980, Hassan moved to the capital Damascus with his family, where he lived and studied to join the Higher Institute of Drama &Theater; (specialized in acting). He was firstly rejected, and then re-applied to be admitted at the same time when Actor Gamal Soliman was the head of the judging panel. He finished his studies and graduated in 2001'),
