('1101269', 'https://media.elcinema.com/uploads/_315x420_0e1b0ca639e14cfb7621f685d956c3de9b1f610241e202f612dce8cdc304342b.jpg', 'Mahmoud Al-Banna', 'Egypt', NULL, NULL),
('1101270', 'https://media.elcinema.com/uploads/_315x420_8638c8d818eeed26865559012a3855258ae327ba75bb36954865f6a1261b65ac.jpg', 'Hisham Al Sherbini', 'Egypt', NULL, NULL),
('1101294', 'https://media.elcinema.com/uploads/_315x420_8e50cf45a31450cd6b0222a1996054bbafd680a478b2bd55a3cbed77b67de81b.jpg', 'Ahmed Salah Al-Saadany', 'Egypt', '16 July 1979', 'Ahmed is a young Egyptian actor. His father, Salah Elsaadany, provided him with his first opportunity to act alongside him in a television series entitled \"A Man from the Globalization Era.\" Ahmed proved successful as an actor, but was restricted to television roles as the series \"Who fired the Shot at Hind Allam?\" and \"Words of Truth\" until he was given his first role  on the silver screen alongside Adel Imam in the film “Morgan Ahmed Morgan”.\n\nSince then, Ahmed\'s career has taken off and his been in several other films including \"Best of Friends\"'),
('1101295', 'https://media.elcinema.com/uploads/_315x420_0fd1e23cbff7f05862de58e7375f6e6363ad7308698a95ab33afd5f435bb4e3f.jpg', 'Eman Al Assy', 'Egypt', '28 August 1985', 'Pre stardom, Eman El Aassy studied Business Administration for she had no intention to join the cinema world. Her introduction though to the movie industry came by sheer coincidence when she took part of a photo shoot session that ended with the photographer’s admiration with one of her shots, asking her permission to publish it in a female magazine. Eman agreed, for the shot was a respectable one that expressed and reflected who she truly was.\n\nThe shot was later published as magazine cover that was seen by renowned director Khaled Bahgat, nominating her to take part in the TV series ‘Ams la yamoot’, co-starring with ‘Raghda’and ’Ryad Al Kholy’. The nomination was based on Aasi’s resemblance in looks with ‘Raghda’ whom she was to play her daughter in the series. Eman was once again nominated by director Haitham Hakky to cast in the TV series ‘Ragol w emraatan’ co-starring with Samira Ahmed.\n \nEman then took part in the TV series ‘Ahlam fel Bawaba’, playing both Dalal Abd El Aziz and Farouk El Fishawy’s daughter. She also took part in the TV series ‘Daawt Farah’ to co-star once again with Samira Ahmed.\n\nHer golden opportunity came, when director Rabab Hussien nominated her to co-star with Nour El Sherif in the renowned TV series ‘Hadret El Motaham Abby’, where Hussien insisted due to her absolute conviction and belief in Eman’s talent to wait for Eman until she finishes her busy schedule at the time to take part of her hit series.'),
('1101296', 'https://media.elcinema.com/uploads/_315x420_efe97f7e1001ec8f54b50bd6893fcaa0ed64e10ab68ab721ca6349299b74f2d2.jpg', 'Khaled Galal', 'Egypt', ' 3 November 1967', NULL),
('1101297', 'https://media.elcinema.com/uploads/_315x420_9aa69018a83c1c8bde3ecc449f5a5cef99c0cf722ca16268b70f1c97b3c0b5cf.jpg', 'محمد إبراهيم طه', 'Egypt', NULL, NULL),
('1101306', 'https://media.elcinema.com/uploads/_315x420_1912adce1c48f1db111c71962cf83bd01566c75b3871bf2764b9d4983e33cedb.jpg', 'Wael Alaa', 'Egypt', ' 3 October 1976', 'An Egyptian comedian actor who appeared in many advertisements. He participated in many Sitcoms where he achieved a huge success and proved himself.'),
('1101307', 'https://media.elcinema.com/uploads/_315x420_c742e49f4529638d124b2abc48e4b4ab44ed60da8edb724f092ced7cbace6d01.jpg', 'Amr Ramzy', 'Egypt', '17 July 1981', 'Amr Ramzy is an Egyptian actor and television presenter. He was born in 1981 in Mansoura, and studied law at the University of Mansoura. He started his artistic career by joining an acting troupe, then worked as an assistant director in the satellite channel OTV. He rose to fame when he presented the prank show \"Helhom Benhom\" in 2007, after which he went on to appear as an actor in several films and television series, including \"Ferqet Najy Atallah\" (Najy Atallah\'s Squad), \"Fazzaa\" and \"Haramt Ya Baba\".'),
('1101308', 'https://media.elcinema.com/uploads/_315x420_11b39a115b48a32151afa9c0889c86367724df8b2c0d7c67d4f9989af893aa50.jpg', 'Sayed El Sobky', 'Egypt', NULL, NULL),
