('1101627', 'https://media.elcinema.com/uploads/_315x420_9899406f9c0f17f64600fcc9f1779b8c24b576f82e591e96eae5f4ffe924ccf0.jpg', 'Osama Elabd', 'Egypt', NULL, NULL),
('1101628', 'https://media.elcinema.com/uploads/_315x420_a2b1ae98fcc7e0056e472921104a05a380bab2d38b9de1099c7eaf0c093fa83f.jpg', 'Sherif Madkour', 'Egypt', '17 September 1972', NULL),
('1101633', 'https://media.elcinema.com/uploads/_315x420_5d0207f918a858852bea6d27cc1b9e0475a0a59c20b117fb581b5d48e8826d77.jpg', 'Eva', 'Egypt', '16 April 1953', NULL),
('1101642', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohammed Saeed', 'Egypt', NULL, NULL),
('1101646', 'https://media.elcinema.com/uploads/_315x420_75b08d8ac563e0b0133d80456b2799e64beb180e24670897548ca89b77c3026b.jpg', 'Nesreen Tafesh', 'Syria', '15 February 1982', 'Nisreen Youssif Tafesh is among the most beautiful Syrian actors. Her father is Saudi Arabian in origin while her mother is Algerian with Moroccan roots. Thus Nisreen carries traits from across various parts of the Arab World. She has thus far been successful in her works and has attracted positive attention to her name. Her latest work is the Syrian production “Sabbaya” (“Youths”). Nisreen has received a number of awards.'),
('1101647', 'https://media.elcinema.com/uploads/_315x420_31f499289771b0e1ae613bc46c2bf75d0663f02bf076c0d1485fe220deffee2a.jpg', 'Kosai Khauli', 'Syria', ' 1 April 1976', 'Qusay’s father was the journalist A’meed Al Khouly. He graduated from the Higher Theater Institute in 1999. Prior to that Qusay had spent two years studying law. Natural talent drew Qusay to acting and despite his family’s strong objections Qusay insisted on enrolling at the Higher Theater Institute. The resultant  dispute with his family led to his leaving his home for two months. Although Qusay is a gifted actor he is nonetheless modest. Among the theatrical performances he has participated in are “Kusoor”, “Madinat Al Kharab” (“The City of Ruins”), “Al Diblomassiyoun” (“The Diplomats”) and “Al Rahan Caligula”. He has also participated in the cinematic productions “Roaa Halimma” (“Dreamy Visions”) and “Al Ou’shaq” (“The Lovers”).\nQusay graduated from the Higher Theater Institute in the company of distinguished actors such as Bassil Al Khayyat, Sulaffa Me’mar, Raghda Shu’ayrany. Whilst at the institute, Qusay studied under Ghassan. \nIn 2006 Qusay won the award for Best Arab Actor for his role in “Ghuzzlan fee Ghabbat Al Ziaab” (“Deer in the Wolves’ Forest).'),
('1101665', 'https://media.elcinema.com/uploads/_315x420_42724265f9ed54f7fdc40d5873c568f443ef406158cc80b6b62780982fdd85be.jpg', 'Hosam Al-Gendy', 'Egypt', '29 May 1981', 'Hossam El Gendy is an Egyptian actor. He was born in 1981, and started working by the beginning of the 21st century. His television roles include \"Boshra Sara\" (Good Omen) and \"Marka Mosagala\" (Registered Trademark). His film roles include \"Bentein min Masr\" (Two Girls from Egypt) and \"Hogum Montasaf Elleil\" (Midnight Attack).'),
('1101669', 'https://media.elcinema.com/uploads/_315x420_ea90c2682f290148658830e29bb1788ab9be9cfd5432a14a695c1d1d719a7ca2.jpg', 'Ramez Amir', 'Egypt', ' 1 December 1988', NULL),
('1101695', 'https://media.elcinema.com/uploads/_315x420_e133d8e163b1b040c4c86d503ac84ef25bea34079e74e5b44483802a3eadb560.jpg', 'Amal Rizk', 'Egypt', '13 January 1969', 'Amal Rezk is an Egyptian actress. She was born on January 13, 1969. Her resume of television roles is long and extensive; she\'s appeared in \"Asmahan\" (2008), \"El), \"El Anida\" (2011), and \"Adam\" (2011). Her film credits, usually in dramatic or comedic roles, include \"Game Over\" (2012) and \"Black February\" (2013).'),
('1101699', 'https://media.elcinema.com/uploads/_315x420_1cd1e4cb87084c29667eb6623d808d9175dee00d1bf7df6f526c2928de8cf991.jpg', 'Mohsen Rezq', 'Egypt', NULL, NULL),
('1101708', 'https://media.elcinema.com/uploads/_315x420_5b4eaf3a08969571ecee60492002b14d29db69f424408179227bda71d8306a17.jpg', 'Amr Youssef', 'Egypt', '23 December 1980', 'Amr is a young Egyptian actor. He was born on December 23, 1980. His career in entertainment began with television commercials and music videos. Thereafter, Nour Al Shereef brought his talents to the public’s attention when he cast him in the television series “Al Daly” in 2007. Following this crucial step forward, Amr’s career as movie star took off. Since then, he\'s appeared in \"Nour Ainy\" (2010), \"Rad Fa\'al\" (2011), and the popular 2013 Ramadan drama \"Niran Sadeeka\" (Friendly Fire).'),
('1101718', 'https://media.elcinema.com/uploads/_315x420_3257d55d7dd30570ee7dd1a46fb8b853b075349f02d13de4fc0cec96d2d3597a.jpg', 'Ahmed Elekiaby', 'Egypt', '31 July 1987', NULL),
('1101727', 'https://media.elcinema.com/uploads/_315x420_414442b7a56ae453a5e821b6e034eeed20d1e58283154ce3736e65fff625b922.jpg', 'Ahmed Khaled', 'Egypt', ' 1 April 1979', 'He is considered one of those directors who are very active in the field of independent cinema. He participated in many European and Arabic festivals. He presented 2 shortrt documentaries “The Fifth Pound” and “Eye of the Fish”. He also directed a lot of television advertisements and documentaries.'),
('1101728', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohammed Hammad', 'Egypt', NULL, NULL),
