('1101741', 'https://media.elcinema.com/uploads/_315x420_afb4311079e5775b2f081bfe358917b30d7b7a286cd016c3af7a8cabeac04deb.jpg', 'Maya Haddad', 'Lebanon', NULL, NULL),
('1101743', 'https://media.elcinema.com/uploads/_315x420_3ec02ff1f80a33da315851233b1ac243aa5e5d4c7e3d8558dc4c9774356d1523.jpg', 'Emad Kassem', 'Egypt', '25 July 1972', 'خريج كليه الفنون التطبيقية عام ١٩٩٤ بدا فن التصوير الفوتوغرافي سنة ١٩٩٨ قام بتصوير عدد كبير من اغلفة المجلات \nقام بتصوير عدد من الافيشات منها امير الظلام \nمرجان احمداحمد مرجان\nبوبوس\nاللمبي\nالي بالي بالك\nبوحه \nعوكل\nمافيا\nملاكي اسكندرية\nخلي الدماغ صاحي\nاللمبي ٧ جيجا\nابن القنصل\nاعسل اسود\nاكس لارج\nالف مبروك\nزكي شان\nكده رضا\nجعلتني مجرما\nميدو مشاكل\nمن ٣٠ سنه'),
