('1101757', 'https://media.elcinema.com/uploads/_315x420_93ed51e526e8e58cb1042e5f343ccb90d4c38e517af6958bb9b0b0ceaec17014.jpg', 'Amr Rajab', 'Egypt', NULL, NULL),
('1101764', 'https://media.elcinema.com/uploads/_315x420_510e91811c3296474caadd455f8eeba7314e941652c4bc917b140b3f41eb24d3.jpg', 'Mohamed Samir Mabrouk', 'Egypt', NULL, NULL),
('1101785', 'https://media.elcinema.com/uploads/_315x420_9b16458b2f1c32cda0fbfb478a05ec73f5ab95d9a36781a416e26ad1e4f40771.jpg', 'Mohammed El-Zawawi', 'Egypt', NULL, NULL),
('1101790', 'https://media.elcinema.com/uploads/_315x420_8201852370be98bd27dd646a851d93b99fa898fdd0254211ad7356d018ddcdf4.jpg', 'Mohamed Ramadan', 'Egypt', '23 May 1988', 'Mohamed Ramadan began acting while at school. He has received the award for greatest nationwide talent three times consecutively – an unprecedented achievement. He started his career with small roles in TV series like “The Cindrella,” until he had his big break in Yousry Nasrallah\'s “Ehky Ya Sharazad” (Tell me, Shahrazad). He then went on to star in blockbusters produced by the the famous Egyptian producers Mohamed and Ahmed El Sobky, which made him one of the most valuable actors in the middle east. Mohamed Ramadan is perhaps the only Egyptian actor to have been praised by the internationally renowned performer ‘Umar el-Shereef who stated that he had chosen Mohamed to perpetuate his acting legacy.'),
('1101812', 'https://media.elcinema.com/uploads/_315x420_6e2c87363b9978fb4c462f4e5e8cf19cbc53a717cb5daf3fb075279c091f2ecc.jpg', 'Abdel Imam Abdalla', 'Kuwait', '15 August 1947', 'Kuwaiti actor Abdel Imam Abdalla has appeared in a number of artistic works throughout Kuwait, Saudi Arabia and Egypt. He is considered one of the top actors from the Gulf to work in the Egyptian industry. Abdalla is known for his performance in Gulf television series such as: “Dunya El Muhabeel” (The Crazy People’s World, 1977), “El Zeer Salim” (1980), “Zawaj Bidoun Rasid” (Marriage Without Balance; 1985), and “El Madi wa Kharif El Amr” (The Last Autumn Years; 1992). He has also appeared in several Egyptian television series including:  \"Qissat Al Ams\" (Yesterday’s Story; 2008), “El Hara” (The Neighborhood; 2010) and “Dila’a Binat” (Girls’ Indulgence; 2014). With regard to cinema, his works include “Cabaret” (2008) and “Sarkhet Nimla” (Cry of an Ant; 2011). In addition, Abdalla has been in many successful plays including: “Almakshouf” (Exposed), “Sah Elnom ya Arab” (Wake Up, Arabs), and “Hami El Diyar.” (The Home Protector).'),
('1101818', 'https://media.elcinema.com/uploads/_315x420_c864715a8d07bb8288c96ed92b20b899d85e1ce0c21216d77d52ce165527089d.jpg', 'Hesham Elshafei', 'Egypt', '10 April 1965', NULL),
('1101819', 'https://media.elcinema.com/uploads/_315x420_3eb3704eb6557d34699688560c6c19916777965dba5c6b9c399be2a7b24ab5ac.jpg', 'Nadine Shams', 'Egypt', ' 1 January 1972', 'Nadia Shams (Known as Nadine Shams) was an Egyptian novel and screen writer. She was born in 1972, and graduated from the screen-writing section of the High Cinema Institute of Cairo. Her bibliography includes many novels and short stories, among which is her famous short story “El Dakhel wel Khareg” (The Entering and Exiting). Nadine started writing for the screen recently. She co-wrote the television series “Qanun Al Maraghy” (Al maraghy Law). Her most known script for film is “Ehna Eta\'belna Abl Keda” (We Have Met Before). In 2013, Nadine was part of the writing workshop of the series “Moga Hara” (Heat Wave), which was met with acclaim from critics and audience alike. Shams died on March 22, 2014 at the age of 41 after a mistake during a surgical operation led to fatal complications.'),
('1101822', 'https://media.elcinema.com/uploads/_315x420_3750e9cd00a72f77a1d681cff91fcc9077d6d924aea3c932da059ca7283b46dc.jpg', 'Amr Gamal', 'Egypt', NULL, NULL),
