('1101860', 'https://media.elcinema.com/uploads/_315x420_7cec4805599c0a3b2912f2fe2bb625b7f2c0bb7599c5f516f7331d16d2c8d21d.jpg', 'Nancy Abdul Fattah', 'Egypt', NULL, NULL),
('1101868', 'https://media.elcinema.com/uploads/_315x420_9f029978e34f22abaee1b44c786dbd92049b54f52c9abbe9a062ccd6e8acfce0.jpg', 'Samya Atef', 'Egypt', '11 February 1982', NULL),
('1101878', 'https://media.elcinema.com/uploads/_315x420_eb54588a4447d4ff36676267aa8216be07e387b99d746f74eb3bc3117aaa24e4.jpg', 'Ayman Salama', 'Egypt', NULL, 'Script writer Ayman Salama graduated from the High Institute of theatrical drama, majoring in drama, graduating with honor in the year 1989. Achieving a degree in theatrical drama Ayman Salama won tens of awards in Egypt and the Arab world, most importantly best composer in the TV and Radio festival of 2006. A lot of his works targeted television, radio and theater.His most predominant mini series were ,\"Nights\" starring actress \"Zeina\" also \"The case of Safeya\" starring actress \"May Ezz el Din\",also \"A woman in jeopardy\" starring actress \"Ilham Shaheen\" and for the radio he composed \"Beautiful Days\" starring actress \"Somaya el khashaab\" and \"Shamoos El Nasr\" starring \"Yehia El Fakharani\"'),
