('1102120', 'https://media.elcinema.com/uploads/_315x420_e7ba68a4227bc0d2ddeae1a9dcc34a814cb425a7d93d779cfc1025670effa93a.jpg', 'Heba Abdelaziz', 'Egypt', '21 December 1984', 'Egyptian actor, Heba Abdel Aziz played the role of Nabila Obeid in the series “El Bawaba El Tania” (The Second Gate) in 2009. Following that performance, she has appeared in numerous television series including, “El Siyad” (The Hunter) and “Saraya Abdeen” (Abdeen Palace) in 2014, as well as the films “El Talata Yeshtghalonha” and “Lameh El Basar” (Jiffy).'),
('1102121', 'https://media.elcinema.com/uploads/_315x420_58b286bbbe6909d0a623ca4e55ba37d2e05426b5b606aa27419afa0c440992bd.jpg', 'Sameh Kamal', 'Egypt', NULL, NULL),
