('1102185', 'https://media.elcinema.com/uploads/_315x420_9606504abe721fa69bbb7d19b235fd657b9b9694b640d1d285e98fae169c8402.jpg', 'Mourad Sadek', 'Egypt', ' 1 October 1981', 'Mourad Sadek was born on October 1, 1981. He studied directing at film school and has worked in a number of fields from drama to cinema and radio. Sadek has appeared in the films “Magnoun Amira” (Crazy Amira; 2009) and “El Almani” (The German; 2012), as well as various television series such as: “El Seif El Madi” (Last Summer; 2010), “Hayati Enta” (My Life; 2006), “El Raks Maal Zahur” (The Dance with Flowers; 2005).'),
('1102189', 'https://media.elcinema.com/uploads/_315x420_7e789ef60f29c8de053e64a4774353a6efc8f6734c9997459156e003fc0333ee.jpg', 'Mohamed Al-Sharnuby', 'Egypt', ' 4 January 1995', NULL),
