('1102205', 'https://media.elcinema.com/uploads/_315x420_fbd333150d63a2c4d12e72b3ef51ddaec5e085cc8ca694b4603abb3d5d8a40e2.jpg', 'Fayez Al-Malki', 'Saudi Arabia', '12 September 1969', NULL),
('1102213', 'https://media.elcinema.com/uploads/_315x420_e00140f94051d4d884b3e1344398ca44a3aeb61bbbea2593e415a8600c20d1d3.jpg', 'Mohsen Hadid', 'Egypt', '17 January 1980', NULL),
('1102214', 'https://media.elcinema.com/uploads/_315x420_b3619913d35b445198b8ccda7a332bcff56289c28b199d80a697b2e82685a0ac.jpg', 'ياسر النجار', 'Egypt', NULL, NULL),
('1102219', 'https://media.elcinema.com/uploads/_315x420_37da9a9dec8921ea383e3584508d15d589063e70db29014fbfc0c30122c6a332.jpg', 'Mostafa Fahmi', 'Egypt', NULL, NULL),
('1102225', 'https://media.elcinema.com/uploads/_315x420_052926b28319f3d037601d9a5a4d27537515a3fcf3fd056092809cbadd83c97b.jpg', 'Amr Samir Atef', 'Egypt', '27 November 1971', '‘Amr was born in the city of Dummyat. He concluded his higher studies at the English language division of the faculty of education and thereafter headed to Cairo where he received a diploma in Theater Arts from Cairo University. ‘Amr began his career in screenwriting, the first of his works to draw attention was the animated production “al-Sindibad al-Bahry” (“Sindibad the Sailor”). The work was directed by Mona Abou al-Nasr and received more than 27 local and international awards. Thereafter ‘Amr continued working on children’s productions, one of the most important of which was the series “Bakkar” which involved nine parts. The screenwriter also contributed to the writing of the well known series “’Alam Simsim” (“Simsim’s World”). Thereafter ‘Amr transitioned to writing sitcoms and put together the first professional writing workshop in the Arab World. Under his supervision the workshop turned out the series “Ragel wa Sit Sittat” (“A Man and Six Women”) which involved five parts, “Tamer wa Shawqqiyah” – four parts, “al-E’yadah” (“The Clinic”) – two parts and “’Aailat al-Ustaz Amin” (“The Family of Professor Amin”). Those productions are considered among the region’s most important sitcoms, they have contributed to changing television comedy in the Arab World.\nThereafter ‘Amr moved to writing for cinema and his first such work was the film “Awlad al-‘Am” (“Cousins”) which was directed by Sherif ‘Arafa and features the performances of Kareem ‘Abd Al ‘Azeez, Sherif Mounir and Mona Zakky.'),
('1102229', 'https://media.elcinema.com/uploads/_315x420_3d6ae158db7930c970095398a145fa12101dc937910f36652c7e182450c603cd.jpg', 'Tamer Mohsen', 'Egypt', NULL, 'Tamer Mohsen is a film director, who studied directing at the Higher Institute of Cinema after graduating from architecture. He worked as an architect for seven years before devoting himself to cinema. Mohsen showed interest in several fields in the film industry alongside directing such as screenwriting, editing, production and landscape design. His work also varied between writing, directing, theater acting, creating and directing puppet drama shows for children. Mohsen also wrote and directed several short films that have won a number of awards, both locally and internationally. For ten years, he has worked on a large number of documentaries as a director, screenwriter, editor and producer. He then worked on developing creative ideas and directing TV commercials.'),
('1102230', 'https://media.elcinema.com/uploads/_315x420_b6408d5adce6e2652813093eff84c8fd03bdbb891f739a99542950b7b0f4e63d.jpg', 'Badr sabry', 'Egypt', NULL, NULL),
('1102232', 'https://media.elcinema.com/uploads/_315x420_e5448dd19bdf73115d54b24457f43336c07eb6a7f1f2221856af80b7779ede5d.jpg', 'Nermine Zazza', 'Egypt', ' 1 January 1972', NULL),
('1102271', 'https://media.elcinema.com/uploads/_315x420_31cea74c9374e9b3d92a61b85e827c783d884459ca9816bc8e6aefc4b62298d4.jpg', 'Muhammad Nasr', 'Egypt', ' 7 December 1969', NULL),
('1102279', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'سامر الجمال', 'Egypt', NULL, NULL),
('1102300', 'https://media.elcinema.com/uploads/_315x420_04a8454eaf2e8e234e8b34d52d1025f4ed76b0a066fc1833ec835f4385e2082f.jpg', 'M. H. R Films', 'Egypt', NULL, NULL),
('1102306', 'https://media.elcinema.com/uploads/_315x420_f54d89c0c2ce3fa42ee550e60237f470315509a939d46037ae65902db036157f.jpg', 'Hosny Saleh', 'Egypt', NULL, 'Hosny Saaleh studied Cinematography at the Faculty of Applied Arts. He started his career in 1982 as director of photography with TV director Esma’eel Abdul Haafez, but the dream of becoming a director did not stop anticipating him. He worked also as technical production manager with al-Gabry company, where he participated in a number of drama works, like “’Amr Ebn-al-‘Aas”, where he met superstar Nour al-Shereef and they became friends. Al-Shereef surprised Saaleh by choosing him to direct his TV series “Al-rahaaya i.e. The quern”.'),
('1102310', 'https://media.elcinema.com/uploads/_315x420_bc7e41805d5ac7d4f776d46dbf6791199fa16b2aa9664bd459fe1b9374a4b5f8.jpg', 'Mahmoud Azzazy', 'Egypt', '16 October 1983', NULL),
('1102312', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد أمين', 'Egypt', NULL, NULL),
