('1102330', 'https://media.elcinema.com/uploads/_315x420_98145cb27802e7b31e68ade9283157cceb9681a2d9ea8bc1f146dd98af901c96.jpg', 'Ahmed osman', 'Egypt', NULL, NULL),
('1102331', 'https://media.elcinema.com/uploads/_315x420_a06e596a22a23249c36629af31e2e47f53e0565cc38642b4d8302a335f84222b.jpg', 'Doaa Adel', 'Egypt', NULL, NULL),
('1102336', 'https://media.elcinema.com/uploads/_315x420_fe20b52733e38e5803355fc98f47171d1743a7b05234cfb4527e1b89d2076da6.jpg', 'Nader Hamdy', 'Egypt', '17 September 1979', 'Nader Hamdy is an Egyptian musician and music producer. He was born in an artistic family, to singer Ahmed Hamdy and actress Afaf Hamdy. He started studying music at the Academy of Arts, where he learned playing the piano, and performed in numerous international venues. He co-founded the singing band WAMA, which released several pop hits during the early 2000s. He also worked as a musical producer with many singing stars, including Amr Diab, Samira Said, Mohamed Fouad, Assala and Sherin Abdel Wahab. His debut as an actor was in the film \"Al Academeya\" (The Academy).'),
('1102337', 'https://media.elcinema.com/uploads/_315x420_94384e8706a484aa754cb0ff16f95ad4bc9eba65bf41a9418701c831efbfdb77.jpg', 'Verdi Production House', 'Egypt', NULL, NULL),
