('1102534', 'https://media.elcinema.com/uploads/_315x420_6754437ffda69c59abcad9befedd40f2062ec80a4db6269beeb0992fd74f34a7.jpg', 'Mohammed Tahon', 'Egypt', ' 9 December 1979', NULL),
('1102576', 'https://media.elcinema.com/uploads/_315x420_617204d24caf0305b21fa0b001c6ead4dd396c666a411b5b01dbd63e3667f8d1.jpg', 'Mina El Naggar', 'Egypt', '25 August 1985', 'Mina Elnagar is an Egyptian stage and film actor, radio voice actor, and theatre director. he graduated from medical school in 2008 with a BS in Medicine and Surgery. Following this he pursued theatre, with roles in a number of theatre productions like “Om el Donya,” an Egyptian production of Mikhail Roman’s “Al Mazad” (The Auction) in 2008. Film wise, he’s appeared in Hisham Saqr’s short film “Bakara” (Hymen), “Borg el Hammam,” and Maggie Morgan’s independent feature “Asham” (2013). Elnagar also voiced the role of Fahmy in the BBC4 radio production of Naguib Mahfouz’s “Cairo Trilogy.” Elnagar has also pursued his passion for theatre directing with “Coma” (2003), “The Mirror” (2005), “Sin Number 5” (2006) and “Pleasure” (2008).'),
('1102578', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'زاد للانتاج الاعلامي', 'Egypt', NULL, NULL),
