('1102627', 'https://media.elcinema.com/uploads/_315x420_79ad3fc5bf7609d0fc64f3ae2c546b9da036ce9554159187b6ad9f3f7123afda.jpg', 'Mohamed Gomaa', 'Egypt', ' 9 December 1978', NULL),
