('1102663', 'https://media.elcinema.com/uploads/_315x420_6790a32d132ca700dcb001b94f161ae7eb8a2c89d93cc8329075cc7cdcd03241.jpg', 'Ali Saif', 'Egypt', ' 9 June 1980', NULL),
('1102674', 'https://media.elcinema.com/uploads/_315x420_59a21eaededdb44914dd9ba2de2860fd1a3782800f3a301aa360f5053d3ff7ca.jpg', 'Ali Al Ghreer', 'Bahrain', '30 September 1972', NULL),
('1102700', 'https://media.elcinema.com/uploads/_315x420_a4a8015a59cf30c5ef4349f3bd695b7d66a3b490a390232b13995d92fb97c3d5.jpg', 'Shaimaa Sabat', 'Bahrain', '26 October 1977', 'Shaimaa Sabat is a Bahraini actress. She was born in 1977, and started her career in 1988 through acting in stage plays made for children. She then went on to appear in numerous television series and theater plays, including \"Oyoun min Zugag\" (Glass Eyes), and \"Al-Harir wal Nar\" (Silk and Fire).'),
('1102703', 'https://media.elcinema.com/uploads/_315x420_9897d8189cf08278132fdf1191045ad14a0c067cabd0ec2dac6d4ffafba2210d.jpg', 'Shehab Hajeia', 'Kuwait', ' 1 April 1963', NULL),
('1102712', 'https://media.elcinema.com/uploads/_315x420_1f857ad6609c62b902e2abf5d72e620718165e79722ecb4663003bbb6ad50acc.jpg', 'Habib  Ghaloom', 'United Arab Emirates', '19 November 1963', NULL),
('1102714', 'https://media.elcinema.com/uploads/_315x420_8e6cb236c19431e08884b2aa0e7957205ce765c174c2c14904a32eb9b72ce989.jpg', 'Khaled Al Ajeerb', 'Kuwait', '16 February 1971', NULL),
('1102777', 'https://media.elcinema.com/uploads/_315x420_eee60279da87a1d17aa58083eab36f206649881be0d36fe6699733c257882c4b.jpg', 'Mohammad Al Kashif', 'Egypt', ' 2 February 1953', NULL),
('1102856', 'https://media.elcinema.com/uploads/_315x420_bc8ec4bfd325bef8a380cc30cc5a4676bafff2255377441badd2873bd5980f1e.jpg', 'Ahmed Sobhi', 'Egypt', NULL, NULL),
('1102868', 'https://media.elcinema.com/uploads/_315x420_51b548acfc4b548b713b08973a60ef94a7e9ad0ae04d0961194b781f40b5dade.jpg', 'Nedal Nejem', 'Jordan', '26 May 1973', 'Nadal Negm is a Jordanian actor of Palestinian descent who was born in 1973. He graduated from the Higher Institute of Dramatic Arts in Damascus, and then appeared in a significant number of Syrian television shows, including “El Ejteyah” (The Invasion), “Rasaa’il El Hub We El Harb” (Love and War Letters), “Seraa Ala El Remal” (Conflict on the Sand), “Wishaa’ El Hawy,” “Zikreyat Min El Zaman El Qadim” (Memories from Next TIme), “Faris Bany Marwan.” He also played the role of “Marwan” in the film “Said Kalakeet.”'),
('1102877', 'https://media.elcinema.com/uploads/_315x420_dc4d1e5bd0c8b9ba877b757d78f8d2e26847ff0be5be8da0be279c9d6625080e.jpg', 'Hazem Fouad', 'Egypt', NULL, NULL),
('1102889', 'https://media.elcinema.com/uploads/_315x420_fbaa343b414496343494c3f4969977df57620310b14d929d8f25f46fad080d0a.jpg', 'Abdul Hakim Darwish', 'Egypt', NULL, NULL),
('1102895', 'https://media.elcinema.com/uploads/_315x420_24d4ede3514c86540ea15ff442edb62cc81c1c67ce7d497c45fed8e9585d9206.jpg', 'Mjdy Alsibaei', 'Egypt', NULL, NULL),
('1102915', 'https://media.elcinema.com/uploads/_315x420_ec3f3e49887d5abd67715187ea03a2f5005e8ad1ccfdff8e649c998638a59301.jpg', 'Mohamed Shahin', 'Egypt', '13 February 1980', 'Mohamed Shahin is an Egyptian actor. He was born on February 13, 1980, and graduated from the faculty of commerce in Cairo University, where he started acting on stage. He then joined Khaled Galal\'s creative acting workshop. Shahin\'s film debut was in the comedy “Harem Karim” (Karim\'s Harem) and “Halim” in the years 2005 and 2006. His breakthrough role was in the sitcom “Tamer we Shawqeya”, in which he appeared in the complete run of four seasons and was met with praise from audience. He then formed a duo with Ahmed Mekky and co-starred with him in the series “El Kebir Awy” (The Very Grand) and the film “La Taragoa\' wa La Esteslam” (No Reatreat and No Surrender) and “Sima Ali Baba” “Cinema Ali Baba”. In 2013 and 2014 he appeared in several television series that were highly successful, including “Niran Sadiqa” (Friendly Fires) and “El Sabaa Wasaya” (The Seven Commandments).'),
('1102939', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Rania Al Najjar', 'Egypt', NULL, NULL),
('1103017', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'مصطفى فوزي', 'Egypt', NULL, NULL),
('1103043', 'https://media.elcinema.com/uploads/_315x420_672397206ead5cd86867164bfccde1b388d8e499dcd96f9f170c47fe06620989.jpg', 'Mohamed Farrag', 'Egypt', '15 November 1982', 'Mohamed Farrag is an Egyptian actor. He was born in 1982. He joined the High Cinema Institute, but was forced to quit it and join the faculty of commerce in Cairo. He also joined Khaled Galal\'s acting workshop in Cairo\'s creativity center, and participated in the acting troupe\'s play “Ahwa Sada” (Black Coffee) in 2009, which premiered to widespread acclaim from audience and critics alike. He then went on to land supporting roles in television series and films, including “Elrahina” (The Hostage) and “Alf Mabrook” (Congratulations) alongside Ahmed Helmy. In 2013, Farrag made his debut leading role in the action film “El Qashah” (The Sweeper).'),
('1103045', 'https://media.elcinema.com/uploads/_315x420_fda42dcb70f888c9d461fbeb3e7bf194ce81698c7fbdf75ce5950e138c5e8137.jpg', 'Mai Mishal', 'Palestine', '20 September 1958', NULL),
('1103050', 'https://media.elcinema.com/uploads/_315x420_3ed2d8054a41122b66c30634163c4afc7234b85835e6e96a8bdde2a5faec36a8.jpg', 'Anoushka', 'Egypt', ' 9 March 1960', 'Born in Heliopolis in 1960 to an Egyptian father and Armenian mother. She graduated from AUC Business Management and Administration. She worked as a secretary and an advertisement singer in Tarek Nour\'s company. \n\nShe began her singing career when she won first place in a worldwide competition in France.  Since then, she\'s been competing in many worldwide competitions in France, Turkey, Latin America, Bulgaria, Czech republic and Finland.  She\'s been honored by the Ministry of Tourism, who sponsors the Music Festival in Egypt.\n\nShe sang in the World Cup ceremonies in 1997, and the World Cup handball closing ceremony in 2000. She also tried her hand in acting, but mostly is a singer.'),
('1103094', 'https://media.elcinema.com/uploads/_315x420_9eab754a4c6600eb2f1239f492959aa7edf4ad4c2f16efc229240539f87cf0e4.jpg', 'Farhan Al Ali', 'Pakistan', ' 5 April 1972', NULL),
('1103109', 'https://media.elcinema.com/uploads/_315x420_86690032311c13adc3e07d5cc9dfbb9337855690c7e3d1887bbec9fc2f9b7a22.jpg', 'Amr El Daly', 'Egypt', ' 3 July 1981', NULL),
('1103113', 'https://media.elcinema.com/uploads/_315x420_e7a7463fb02dc617dcf23fab5057b3db596dd06a4f55d4ea8acfb8239abc0e08.jpg', 'Hossam Saleh', 'Egypt', ' 6 January 1967', NULL),
('1103157', 'https://media.elcinema.com/uploads/_315x420_f00a292979fd5a4a921168a4361f74ca9a865378ac81403bec8d1fd0dc7252ce.jpg', 'Essaf', 'Egypt', '23 October 1977', 'Essaf grew up with a love of music ranging from rock to the classics. He was discovered by his neighbor who encouraged him to study music to cement his natural talent as a singer. This encouragement led Essaf to try out for the reality TV show \"Star Maker\" where he was chosen by the audience during season 2 as a crowd favorite.\n\nAfter winning Star Maker, he was supposed to sign on with them for 1 year, but the two parties were unable to resolve their differences in the contract, and thus parted amicably. \n\nEssaf suffered a personal tragedy when he lost his mother and disappeared from public view for a year. A year later, he met with producer Ahmed Eldessouky and negotiated a contract for his next album, which was delayed when Essaf again faced a personal tragedy with the loss of his father in the same year.  His first major album \"Has My Heart\" was released in 2007, and contains a song entitled \"Everyday\" which he has dedicated to his deceased father.'),
('1103167', 'https://media.elcinema.com/uploads/_315x420_81ea1ba20586b39eddb89f6f5995515f00f10ec9d67ec9e78f053134c719ab9b.jpg', 'Ahmed ELTmana', 'Egypt', NULL, NULL),
('1103183', 'https://media.elcinema.com/uploads/_315x420_44e5bb8de96f5289e243c83af5cde7261eb39b09bd334a011dab0ae78e2ba0c6.jpg', 'Yasser Al Massri', 'Jordan', '22 November 1970', 'Yasser Al Masri is a Jordanian actor born in Kuwait in 1970. He graduated from the Jordanian Academy of Music. His breakthrough role was in the series “Nimr bin Udwan,” in which he played the lead. He played roles in other television series with historical or nomadic settings, like “Abu Ja\'afar Almansour” and “Thy Qar.” His first role in an Egyptian series was in “Taht El Ard” (Underground) in 2013.'),
('1103187', 'https://media.elcinema.com/uploads/_315x420_195d53cffacd3725d34c6cfb1c8f30483fa0ed28765e5d2a63ff3bfbc7ec5767.jpg', 'Manzer Reyahna', 'Jordan', ' 8 April 1979', 'Monzer Reyahna is a Jordanian actor. He was born in 1978, and started acting while studying in Yarmouk University, where he was a student of television and theater directing. He graduated in 2004, and went on to work in several television series, including “Akher El Forsan” (The Last of the Knights), “Khalid ibn Alwalid,” and “Al Igtiyah” (Breaking and Entering).  Reyahna also worked in Egyptian television series like “Khutoot Hamraa\'” (Red Lines) and “Al Aqrab” (The Scorpion). His first lead role in a film was in the Egyptian film “Garsoneira” alongside Ghada Abdel Razeq.'),
('1103231', 'https://media.elcinema.com/uploads/_315x420_4012746717a63dbd447096b9979b820b08d98a49d8c183d7d1ca3ec415d78fa6.jpg', 'Samah Alsaed', 'Egypt', '20 September 1967', NULL),
('1103234', 'https://media.elcinema.com/uploads/_315x420_e0dfdd226b38c097e748bc98eb0d694bcf165ab4e97d8b264630c0e7323084fc.jpg', 'Sara Wafiq', 'Egypt', NULL, NULL),
('1103243', 'https://media.elcinema.com/uploads/_315x420_b75e764bcacbea2a769a87da39acf7faa5bce72b897de10ab479723f224f3c44.jpg', 'Mustafa Suliman', 'Egypt', NULL, NULL),
('1103251', 'https://media.elcinema.com/uploads/_315x420_3a7dc53ba926d308e1151a9c3e5492dea4f286a80ce67708809f3d1d29a55e91.jpg', 'Heba Abdelghany', 'Egypt', ' 5 December 1976', 'Heba Abdelghany is an Egyptian actress. She was born in Alexandria in 1976, and studied stage acting and directing at the faculty of arts in the University of Alexandria. She started pursuing artistic activities at an early age, singing at school and acting on her college\'s stage. She appeared in many television series, including \"Segn El Nisaa\" (Women\'s Prison) and \"That El Saytara\" (Under Control).'),
('1103252', 'https://media.elcinema.com/uploads/_315x420_32b1a9b92b1ad9ab49faf6a7beff9d3046617e2fbfe01a32095298cba6963be0.jpg', 'Azza Saeed', 'Egypt', NULL, NULL),
