('1103299', 'https://media.elcinema.com/uploads/_315x420_5a46d3c87ea59472d1f7761a08b9b42b26a8d5f6d8d2e7ae31c6f81c98a7df0b.jpg', 'Amr Hanafi', 'Egypt', '17 August 1979', NULL),
('1103302', 'https://media.elcinema.com/uploads/_315x420_9908489117c2d0b4cb74b74a706f8d1c8a519085a11b80a621724785fc29e71f.jpg', 'Tarek El Ebiary', 'Egypt', '23 March 1986', 'Being born in an artistic family, his father is producer and writer Ahmad al-Ebiaary, his grandfather Abul-So’oud al-Ebiaary the great writer, lead him to love art.\nIn 1998, he began acting and studied Theatre at AUC where he acted in and directed many plays.'),
('1103316', 'https://media.elcinema.com/uploads/_315x420_a16486f3b88038b058fac3eb8a63139fd0ecd8a074f95b2c1ab87f744f58bb42.jpg', 'Mohamed Hamdy', 'Egypt', NULL, 'Mohamed Hamdy started his career as director of filming for many movies. He then shifted his interest to directing and started with the movie “Suspect” or “Al Moshtabah” in 2009. Following that was the movie “Mohtaram Illa Robo” or “three quarters decent” for actor Mohamed Ragab in 2010. Currently he is preparing for more than one production.'),
('1103347', 'https://media.elcinema.com/uploads/_315x420_fcdd280ac0075e59e8acc92bced69ed6c6ce60824c73daf4e37e50289d0605dd.jpg', 'Sanaa Fouad', 'Egypt', NULL, NULL),
('1103429', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mahmoud Mohammad', 'Egypt', NULL, NULL),
('1103458', 'https://media.elcinema.com/uploads/_315x420_f3a23028d04906c0c9fbbbdfffa4187d8b507c3d4d297beabc084476950db034.jpg', 'Mirhan Hussein', 'Egypt', '28 October 1982', 'Mirhan Hussein is an Egyptian actress. She was born in Cairo in 1982, and appeared in the film “Omar we Salma 2” (Omar and Salma 2), and worked extensively in television series, including “Dawaran Shubra” (Shubra Square), “Khorm Ebra” (Eye of a Needle), “Adam we Gamila” (Adam and Gamila) and “Esm Moa\'aqat” (Temporary Name).'),
('1103462', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmad Abdel Ghany', 'Egypt', NULL, NULL),
('1103498', 'https://media.elcinema.com/uploads/_315x420_a21299a14586c0f2f79754de28c96bc4051321d073498ba41df16c495aff5cb7.jpg', 'Hazem Samir', 'Egypt', '13 February 1977', 'Hazem Sameer is an Egyptian actor. He was born in 1977, and graduated from the faculty of hotels and tourism, specializing in tour guiding. As an undergraduate, Sameer worked in the faculty\'s thatrical productions. In 1997, he made his professional acting debut in the play “Hikayat 1882” (1882 Stories) with director Roger Assaf. He also worked as a model from 1996 to 2008, and hosted on the satellite channel Nile Drama for a year and a half. From 2001 to 2003, Sameer worked as a post-production supervisor in a film studio, and since 2003 he has been working in editing, post production and visual effects. His television series roles include “Tamer we Shawqeya,” “Fi Ghamdet Ein” (In the Blink of an Eye) and “Heba Regl Elghorab” (Heba the Crow\'s Leg).'),
('1103573', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Abdul Hamid Abu Shady', 'Egypt', NULL, NULL),
('1103578', 'https://media.elcinema.com/uploads/_315x420_7784cdb46952d02fcaaed780a839c1d83c8b00f3dd6504d4595235c4575af6f4.jpg', 'Magdi Khalaf', 'Egypt', NULL, NULL),
