('1103650', 'https://media.elcinema.com/uploads/_315x420_fce715fc687e9afd02704d01ca998af4dbedb8197daa736b6cf14596762056ce.jpg', 'Sherif Ismail', 'Egypt', '20 April 1976', 'Sherif Ismail is an Egyptian director. He has worked as an assistant director since 2005 mainly in feature films inckuding \"Zaki Chan\" and \"Amir El Behar\" (Prince of the Seas). His directorial debut came in 2015 with the television series \"Leaabet Eblis\" (The Devil\'s Game).'),
('1103651', 'https://media.elcinema.com/uploads/_315x420_c2c547a27eb5af32aeb4e501eddb5f58b45eba28d0ba1a4a87a891b92216dd0d.jpg', 'Ahmed Omar', 'Egypt', NULL, NULL),
