('1103742', 'https://media.elcinema.com/uploads/_315x420_052eeedc7e0a663a81488f2f87648021ec62d4caf07988eafe60cc7eb7403676.jpg', 'Amr Farouk', 'Egypt', NULL, 'Amr Farouk is an Egyptian cinematographer. He worked as an assistant cinematographer and cameraman in many films including: “Hobbak Nar” (Your love is Like Fire), “Hassan we Morqus,” “Al Rahina” (The Hostage). He then started to work as a cinematographer, making film and televisions series like “Ana Badeea\' Ya Wadie” (I\'m Lost, Wadie), “Asrar A\'ileya” (Family Secrets) and the series “Hekayat we Bena\'eshha” (Stories we Live).'),
('1103744', 'https://media.elcinema.com/uploads/_315x420_7a41390c54e2025d5ee08c87295ab59e5cf999ea600cb1324a259ceb0250526f.jpg', 'شريف النمر', 'Egypt', NULL, NULL),
('1103745', 'https://media.elcinema.com/uploads/_315x420_96b7de7f3d895bc91a34ae46adb4bc5cfc9916272bf7cccaa3af4d907498e4f3.jpg', 'Joseph Louis Mokadem', 'Egypt', NULL, NULL),
('1103765', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد الشحات', 'Egypt', NULL, NULL),
('1103772', 'https://media.elcinema.com/uploads/_315x420_f349de7711f90517637b92c0ad735d5bb4d4d2b8fd039a3ca5d55b6ad0f044e3.jpg', 'Malak Koura', 'Egypt', '11 January 1993', 'Malak Koura was born in Cairo in 1993. She started her career as a model in a lot of TV ads with renowned directors like Sherif Arafa and Ahmed El Mahdy, for brands like Mobinil, Pepsi, Pizza Hut and Tide. She then started appearing in TV shows made for children, like “Yalla Bina” (Let\'s Go) and several educational programs. Her first acting role in a major film was with singer Mohamed Fouad in the film “Ghawy Hob” (Love Addict).'),
('1103774', 'https://media.elcinema.com/uploads/_315x420_80ce53ed57d4f563e480a296f4ea191b2caf07d068fec1d900df38ab59098872.jpg', 'Injy Al Moqaddem', 'Egypt', '23 July 1977', 'Injy El Mokkaddem is an Egyptian actress and TV host who studied psychology at the American University in Cairo. In the beginning of her career, she worked as a TV host and presenter on the Orbit TV network on the program “El Salem We El Thaaban” (Snake and Ladder). She also participated in presenting the show “Mesaa’k Sukr Ziyada” (Your Evening Is Extra Sugar) on the OTV station, owned by businessman Naguib Sawiris. Injy started acting in 2006 with the TV comedy “Ahmed Itgawiz Muna” (Ahmed Married Mona). Following the show, she acted in: “Lahazat Harega” (Critical Moments), “Haramet Ya Baba,” “Si Omar We Layla Afendy,” “Qulub” (Hearts), and Heba Rigll El Gharab” (Heba the Crow’s Foot).'),
('1103795', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'خالد سعد', 'Egypt', NULL, NULL),
('1103816', 'https://media.elcinema.com/uploads/_315x420_fb9024f4b307225fe043a5ed23a76a49213b6ad1b4aa347faf74181df0dd1083.jpg', 'Attia Amin', 'Egypt', NULL, NULL),
('1103823', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أحمد حسن', 'Egypt', NULL, NULL),
('1103825', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'كولاج بوست', 'Egypt', NULL, NULL),
('1103841', 'https://media.elcinema.com/uploads/_315x420_e4cdc7624c90b2b4ded278a0894844b7c27f8115ba46707b8490eb4cd2a7805e.jpg', 'Mayar El Gheity', 'Egypt', ' 7 June 1992', 'Mayar El Gheity is an Egyptian actress who was born on June 7, 1992. Al Gheity is the daughter of screenwriter Mohamed El Gheity, and took part in her first production at age 5 on the 1997 show \"Al Haseida.\" She made her second screen appearance in 2008 with pop star Tamer Hosni in \"Captain Hema,\" after which she veered towards more television roles than film. \" Her performance in \"Captain\" was well received, and the young talent followed the film with her third role in the show \"Bint min Zaman Di.\" She plays Shawkeya, the sister of Shorouq, who is a poor girl working as a maid and hoping to find a young man in her social class to marry. Her next role could not have been more different: in \"Qalb Meet\" (Dead Heart), she plays Ghada, an aristocratic and romantic girl who loves Haitham, who died in front of her eyes. Her other credits include \"Ayam El Hob wel Raab\" (Days of Love and Terror). In 2012, she appeared in the film \"Black February.\"'),
