('1104074', 'https://media.elcinema.com/uploads/_315x420_4028b594d2ac7d40fbc6aeccba49803462884f908e3d2f0d1de6e296b12f5ca9.jpg', 'Ahmad Hanafy', 'Egypt', '22 September 1984', NULL),
('1104096', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ahmed Gamal', 'Egypt', NULL, NULL),
('1104097', 'https://media.elcinema.com/uploads/_315x420_b7978be9f6fee7ad1d1c3f07d5ae573894f82a32ad7c6bd24a1e18cdaf3e6220.jpg', 'Dina Fouad', 'Egypt', '25 July 1987', 'Donia Fouad began her career as a presenter on the al-Hurra network. Thereafter a half hour meeting with Nour el-Shereef in his office was to change her life forever as a few days later the veteran actor nominated her for a role on the television series “al-Daly”. Thus Donia was introduced to audiences in the role of “Heba”, daughter of “Sa’ad al-Daly” and took part in the aforementioned series alongside Nour el-Shereef. Through this participation Donia became one of the junior actors introduced by Nour el-Shereef through his works. Following that endeavor Donia took part in cinema productions and performed alongside Hamada Hilal, Tawfik ‘Abd Al Hameed and Hala Fakher in the film “Helm al-‘Umr” (“Dream of a Lifetime”).'),
('1104098', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Waleed Hosny', 'Egypt', NULL, NULL),
('1104099', 'https://media.elcinema.com/uploads/_315x420_07c8b34ecdf23dcb03696120f4d807c024f619ee788ab14512205491b185ec63.jpg', 'Noureen Amin', 'Egypt', NULL, NULL),
