('1104104', 'https://media.elcinema.com/uploads/_315x420_972ac59ef6c4dbacf693cdb32ce288a31ef27113eb256e7521e48e6fa4ff5571.jpg', 'Mohamed El Keblawy', 'Egypt', '30 July 1983', NULL),
('1104175', 'https://media.elcinema.com/uploads/_315x420_f142e44da41e62063792f50c451682624e9ab42aee77440d7b0f0bc1651ad780.jpg', 'Samy Abdel Halim', 'Egypt', '15 November 1951', 'Samy Abdel Halim is an Egyptian actor. He is known for playing minor and supportive roles in television series and theatrical plays. His most famous roles were in the series “Khalty Safeya wel Deir” (Aunt Safeya and the Monastery), “Qassem Amin” and “El Seera el Ashuriya” (The Ashuryan Stories), and the playes “El Joker” (The Joker), “Tabib Raghm Anfo” (Forced to be a Doctor) and “Ateya Al Irhabeya” (Ateya the Terrorist).'),
('1104176', 'https://media.elcinema.com/uploads/_315x420_2ede79e2b2050e5a657d7f736f6d68137c3ace2443c6b05c1d5f37c1c0836f58.jpg', 'Jalal Abdulqader', 'Egypt', '12 December 1955', NULL),
('1104201', 'https://media.elcinema.com/uploads/_315x420_d0854a5ad2e8890cd35dcf6587e6e9a84c3290f1cb518abe34f15fd8c0f2ae0e.jpg', 'Kinda Alloush', 'Syria', '27 March 1982', 'Kinda A’loush is a rising Syrian actress. She received an award for her role in the television drama “Hidou Nisbee” (“Relative Silence”) and thereafter progressed to a cinema role where she performed alongside Shereef Arafeh in “Wilad al-A’am” (“Cousins”).'),
