('1104469', 'https://media.elcinema.com/uploads/_315x420_8a965a5ae6605caa4cef7b85a0b368ff94f71a1c9b574bfe3cedf03319621ce5.jpg', 'Mahmoud Samir', 'Egypt', '14 November 1981', NULL),
('1104513', 'https://media.elcinema.com/uploads/_315x420_6a9109f4ed77b471b7a11a5306a39a3d4c88e00247252b4b57ba38248cd3e01d.jpg', 'Enass Kamel', 'Egypt', '11 September 1979', 'Enass Kamel is an Egyptian actress. She was born in Cairo on September 11, 1979. She started her career as a television program host, until she was chosen by Nour El Sherif to co-star in the successful series “Al Daly” in 2007. She then went on to star in many television series, including “Fi Mahab Elreeh” (In the Wake of the Storm), “Al Rayan”, “Al Montaqem” (The Avenger), “Fadd Eshtebak” (Cease Fire), and “El Sayyad” (The Hunter). She also starred in the film “Nazareyet Ammety” (My Aunt\'s Theory).'),
