('1105152', 'https://media.elcinema.com/uploads/_315x420_096a1d863e520f7863bc25b8fafc46673248d70751b975684a2a1e64a8295be4.jpg', 'Mahmoud Ayman', 'Egypt', NULL, NULL),
('1105167', 'https://media.elcinema.com/uploads/_315x420_0b79cd17c92880ec2e54d4e6eec0470b283aeec2ef2c77064361c176eafd7719.jpg', 'Amy Samir Ghanem', 'Egypt', '31 March 1987', 'Amy Samir Ghanem is an Egyptian actress. She was born in Cairo in 1987. She studied business management at the Modern Academy, but she started acting immediately after graduation, accompannying her father Samir Ghanem in the comedy play “Tara Lam Lam”. She then started working in film and television, starring in films like “X-Large,” “Bolbol Hairan” (Confused Bolbol) and “Ghesh Elzawgeya” (Marital Infidelity), and televisions series including “Lahazat Harega 2” (Crucial Moments 2) (An Egyptian adaptation of ER), “Captain Effat” and “Heba Regl Elghorab” (Heba the Crow\'s Leg).'),
('1105180', 'https://media.elcinema.com/uploads/_315x420_312cf0e1d5553799cda74517b15e5c053c77b46e56ceeb9679dd23f8156ca4ad.jpg', 'Ali Kandil', 'Egypt', NULL, 'Ali Qindeel is a distinguished actor with a variety of talents. Qindeel started out as a journalist working for the “al-Dostoor” newspaper and thereafter witnessed his career skyrocket when he took part in the short “’Abkweim” which did remarkably well. That performance was followed by a successful trial at stand-up comedy. Thereafter Ali took part in a few sitcoms which included “Hermat ya Baba” and “al-‘Eyadah”. Qindeel also took part in the writing of a few television works which have included “Tamer wa Shawqiah al-Juzzea al-Akhir” (“Tamer and Shawqiah the Finale”), “6 Meydan al-Tahrir” (“6 Tahrir Square”) and “Hermat ya Baba”.'),
