('1105453', 'https://media.elcinema.com/uploads/_315x420_70d719808ecd96c30d5995b30fa6f918b171fcde62633391d0be415b83a17492.jpg', 'Tarek Essam', 'Egypt', NULL, NULL),
('1105454', 'https://media.elcinema.com/uploads/_315x420_dc7addee7c3432b28e4396afc02dfdfb62f3d684a0be94be2a1e9f69894580f4.jpg', 'Mona Mamdouh', 'Egypt', ' 4 April 1984', 'Egyptian actor Mona Mamdoh was born in Cairo in 1984. She began her acting career in 2007 when she appeared in the film “Morgan Ahmed Morgan” alongside Adel Imam. Mamdoh played several small roles including her appearance in “Alf Mabrook” (A Thousand Congratulations; 2009) starring Ahmed Helmy. In 2012, she appeared on the television series “Tarf Talat” (Third Side), starring Mahmoud Abdel Moghny, Amir Karara, and Amr Youssef. The next year Mamdoh was hired by director Hatem Aly for the series “Teht El Ard” (Underground). With regard to cinema, some of her other films include: “X Large” (2011), “El Ansa Mommy” (Miss Mommy; 2012), and “Abdo Mota” (2012).'),
