('1105550', 'https://media.elcinema.com/uploads/_315x420_f47279dce2fe48b4bad59eecaf5f2a887153b61b081533abb00559c308d56578.jpg', 'Gamila Aziz', 'Egypt', '28 August 1968', 'Egyptian actor Gamila Aziz started her acting career in the mid-1990s, appearing in numerous supporting roles. She was a member of Mohammed Sabhi\'s theatre troupe when they presented the play “Mama Amrika” in 1998. Aziz later appeared in the entirety of the television series “Youmiat Wanees” (Diary of Wanees). Her other major works include: “Amaken fil Qelb” (Places in the Heart), “Faris bilaa Gawad” (A Knight Without A Horse), “El Shek” (The Doubt), and “Bab El Kholq” (The Gate of Creation).'),
