('1105898', 'https://media.elcinema.com/uploads/_315x420_ef8b85ab06317245c4864119091e61383069a0612661f37d6a33585987824b48.jpg', 'Abu Alsaud Attia', 'Egypt', '30 April 1932', NULL),
