('1106081', 'https://media.elcinema.com/uploads/_315x420_79ebfd48dcab4b7c2ae85d761bc9088f0a860b1d5524ba9a693854ab8c169adc.jpg', 'Walaa Elshrif', 'Egypt', ' 3 February 1988', NULL),
