('1106178', 'https://media.elcinema.com/uploads/_315x420_8535704db805cf648011d51e6920b2689102514fc9e3486261fc59f0dace09e2.jpg', 'Yasmine Rahmy', 'Egypt', '12 September 1994', 'Yasmine Rahmy is an Egyptian actress. She graduated from Misr University of Science and Technology, and appeared in several television series, including “Hanan we Hanin” (Hanan and Hanin), “High School”, “Matkhafush” (Don\'t Be Afraid), “Napoleon wel Mahrousa” (Napoleon and El Mahrousa) and “Arafa Albahr”.'),
('1106201', 'https://media.elcinema.com/uploads/_315x420_5927c4ee355de97143e0b6207155c978829d67c6692e5e0131dffde25af94159.jpg', 'Magdy Shokry', 'Egypt', NULL, 'Magry Shoukry is an Egyptian television actor who started his acting career at an older age at the beginning of the 21st Century. He has played a number of secondary roles, usually as a doctor, judge, businessman, or an important official and his career has been prolific. He can be seen in the TV series “El ‘Araaf” (The Oracle) in 2013. His other television appearances include: “El Sanderalla” (Cinderella) in 2006, “Asmahan” in 2008, and “Bidoun Zikr Asmaa’” (Without Mentioning Names) in 2013.'),
('1106211', 'https://media.elcinema.com/uploads/_315x420_761f3e998c6d93a00017ff9f291e9a3268eac085590336ab2145e879576a23bb.jpg', 'Eman Lotfy', 'Egypt', NULL, NULL),
('1106212', 'https://media.elcinema.com/uploads/_315x420_063c20fd76760823f8a8192399f6db31f4745432f01c66e522a5b7e4988bd5ad.jpg', 'Hosam Dagher', 'Egypt', '26 April 1979', 'Hossam Dagher is an Egyptian actor and director. He was born in Kuwait in 1980, and then moved to live in Egypt, where he received a bachelor\'s degree in medicine from Cairo University in 2002, followed by a master\'s degree in blood and immune system diseases in 2006. He then studied acting in TVI Actor Studio NY in New York until 2009, and flew back to Egypt to join Khaled Galal\'s acting workshop in Cairo Opera House\'s Creativity Center, where he had his big break, performing in the highly successful and controversial play “Ahwa Sada” (Black Coffee) in 2011, which was shoen in several Arab countries besides Egypt. Dagher continued his acting career afterwards through roles in numerous films and TV series, including the films “Safari” and “Amir Albehar” (Prince of the Seas), and the series “Ayza Atgawwez” (I Need to Get Married), “Khorm Ebra” (Pin Hole) and “Ibn Halal” (A Good Guy).'),
('1106213', 'https://media.elcinema.com/uploads/_315x420_3375b70a1856b606c9666c01e1698eeaeaaa1d436b26ca771e4ae4918a53c906.jpg', 'Laila Nagaty', 'Egypt', '10 May 1966', NULL),
