('1106540', 'https://media.elcinema.com/uploads/_315x420_91fdb9075850a9207dfd992feede4bbb259a59571fda9e63e075a3d27eb8c625.jpg', 'Ahmad Haiba', 'Egypt', NULL, NULL),
('1106543', 'https://media.elcinema.com/uploads/_315x420_1a1c741c412311700560fc9ab80e2cfee1b3fd480369788d33d33b9d2fd3ea8c.jpg', 'Hisham Ali', 'Egypt', NULL, NULL),
('1106732', 'https://media.elcinema.com/uploads/_315x420_526e41b8cf2dcf04aa291b7fb9fb9c131d7ecfbc208c6776ebcad32d53857ee1.jpg', 'Mariam Abou-Ouf', 'Egypt', NULL, 'Mariam Abo-Ouf is an Egyptian director, and daughter of the famous actor Ezzat Abo-Ouf. She was born in Cairo and studied political science at college, before moving to England to study filmmaking. She debuted with the short film \"Taxi\", and also worked as an assistant director to several directors including Kamla Abo-Zekry and Sherif Arafa, after which she started directing episodes in the television series \"Lahazat Harega\" (Critical Moments) in 2007. Her first television series was \"Hala wel Mestakhabby\" (Hala and the Unleashed), which was critically acclaimed.'),
('1106756', 'https://media.elcinema.com/uploads/_315x420_f2edf93b36424b4179d1f5178b69e02a76a38741c5761f918eba086a32af6b9b.jpg', 'Moustafa Youssef', 'Egypt', '29 November 1983', NULL),
('1106760', 'https://media.elcinema.com/uploads/_315x420_248c9f7f65e3603ae7bb3236ebdc244e6215eb315f90a428ef8dc3731252e6b5.jpg', 'بسام فرحات', 'Egypt', '11 April 1988', NULL),
('1106776', 'https://media.elcinema.com/uploads/_315x420_cfd24a56467d2c8172a0f073a2971cd1aab26fa0115cbea56615155243feb858.jpg', 'Peter Mimi', 'Egypt', ' 9 April 1987', NULL),
('1106789', 'https://media.elcinema.com/uploads/_315x420_45c9eca197578c985dc87c44dd35f29824b1b94f9bdf3d28a4c8be6ae1c69daf.jpg', 'Yasser Gouda', 'Egypt', NULL, NULL),
('1106793', 'https://media.elcinema.com/uploads/_315x420_18ef81717565b777efbac4e8caf02782fab564fd85c3e83bfd1a87bcddf9823d.jpg', 'Hesham Ismail', 'Egypt', '30 March 1977', 'Hesham Ismail is an Egyptian actor. He was born in Saudi Arabia in 1977, and studied commerce in Helwan University, where he graduated in 1998. In 2007 he joined Khaled Galal\'s acting troupe, and participated in their play \"Ahwa Sada\" (Black Coffee), from which he had his breakthrough in acting, specially as a comedian, as he went on to get cast in numerous television series and films, including \"Assal Eswed\" (Black Honey), \"El Bab fi El Bab\" (Door to Door), and \"Zat\". He is best known for his recurring role in the comedy series \"El Kebir Awy\" in its first 4 seasons.'),
