('1107812', 'https://media.elcinema.com/uploads/_315x420_ddb0d30c89e78a527cf6a70cdc23c67018a49c7b106fdcd654be191c35de8ad3.jpg', 'Ahmed Fathy', 'Egypt', '29 April 1978', 'Ahmed Fathy is an Egyptian actor. He graduated from the theater department of the Faculty of Arts in Helwan. Following his graduation, he landed roles in many theatrical plays, including “Ya Msafer Wahdak” (You Who\'s Travelling Alone), “El Shabaka” (The Web), and “Al Eskafy Malikan” (The Shoemaker King). He also appeared in many television series, including “Saheb El Saada” (His Happiness) and “Bedun Zikr Asmaa” (Anonymously), and films including “Halawet Rouh” (Rouh\'s beauty) and “El Harb El Aalameya El Thalitha” (World War III).'),
