('1107847', 'https://media.elcinema.com/uploads/_315x420_038dad7d3775bc3e147558d44888fcaa81acc17afed13fb19c07edd1cc7a2b46.jpg', 'Subhi Khalil', 'Egypt', '14 May 1961', NULL),
('1107848', 'https://media.elcinema.com/uploads/_315x420_4c89ce624b5dbb3e302aed23d54b5a85acea2c41620f52301e2492160b04dd1b.jpg', 'Hesham Issawi', 'Egypt', NULL, 'Hisham E’issawy was born in Egypt but moved to the United States in 1990. Whilst residing in the United States Hisham enrolled in the film faculty at Columbia College, Chicago. His first short film, “The Interrogation” (2002), earned an award for most creative short film at the New York Film Festival. Another short film by Hisham, “Terrorism” (2003) won awards at film festivals in Boston and San Francisco. \nHisham’s latest film, “Escape from Cairo” relates a love story between a Coptic girl and Muslim boy who are forced to yield to societal pressures. The film was screened at the Dubai Film Festival following a dispute with regulatory authorities in Egypt.'),
('1107883', 'https://media.elcinema.com/uploads/_315x420_9d08c8370d408e87efc3cf7353aa5cd74df67743d2113c6a2398e8740119d960.jpg', 'Aly Mourad', 'Egypt', '24 October 1983', NULL),
('1107894', 'https://media.elcinema.com/uploads/_315x420_280b15a93f9969f5cd3cfdc627860a72c6e929967364c32c76c2a15fb835cd42.jpg', 'Sanaa Yosef', 'Tunisia', '27 April 1983', 'In 2008 she achieved her B.Sc. in experimental science. She is currently studying assisting and directing at the High Institute of Multimedia. She is also a member of the actors and artists union in Tunisia. She was involved in some Tunisian work such as: (The eye and the night) directed by Mohamed Ali Mayhoob, (Shatr mahaba) directed by Kalthoom Bernaz, (The accident) directed by Rasheeb Fershio.\n\nAs for her roles in European cinema, she starred in: The Mysterious Roman, Delilah, Saint Augustine, Chritian Dugai. She was also involved in Tunisian television series such as; Life and hopes for director Mohamed El Ghadban, He who sold his parents for director Al Habib Al Gemni, The White Nights for Al Habib Al Mesalemani and many more. \nFinally so of her involvements in Arabic drama included: “Sadak Waado” for director Mohamed Azizeya, “Sleep Walking” for Mohamed Fadel. In 2007 she won the best rising actress award at the Cairo Arabic Media Festival for her role in the series “White Nights”'),
