('1108291', 'https://media.elcinema.com/uploads/_315x420_6eee619fdcb7cfbe91858d2a78bb1f4138e98f28106e02cb5e8bae69d2bf74b2.jpg', 'Ahmed Saleh', 'Egypt', NULL, NULL),
('1108343', 'https://media.elcinema.com/uploads/_315x420_09e820a3cb0cd3403e7de8c3657971c281688af6defbc84115c528133c846f8e.jpg', 'Moataz Al-Demerdash', 'Egypt', NULL, 'Moataz is an Egyptian media figure. He is the son of artist Karima Mokhtar and director Nour el-Demerdash. Moataz travelled to the United States where he spent a while studying, however he later got the opportunity to work in British television and he moved to London before returning to Egypt. Upon his return to Egypt Moataz became well known for presenting headlines in English and French, he also spent a while working for the MBC network. Moataz currently works as a presenter on the dialogue program “90 Daqeeqah” (“90 Minutes”) which is broadcast on the al-Mehwar satellite network. Prior to that position Moataz worked as a presenter on the weekly analysis and news program “Anbaa wa Araa” (“News and Opinions”). The program was aired on Egyptian television channel 2 on Friday afternoons.'),
('1108352', 'https://media.elcinema.com/uploads/_315x420_c0ac72875485ffa48df1c668fb88663ead1691c2af714fb6a16db81a4b27f5eb.jpg', 'Naglaa Badr', 'Egypt', ' 6 October 1974', 'Naglaa Badr graduated from Mass Communication school in 1996. She was the first Egyptian hostess to present aired programs in Oman, where she worked with Mohamed El Margeby in “Leka\' El Zahira.” (Afternoon Date). Television shows were her access to movies and series. She hosted shows like “Tashkileya,” “Sowareya,” “Enta wel Million,” (You and the Million) and the Arabic version of “Money Drop,” on Al Mehwar channel. She acted in many movies and series like “Share\' Abd El Aziz,” (Abdel Aziz Street), “Rich Naam,” (Ostrich feathers), “El Zoga El Tanya,” (The Second Wife) and “Gedo Habiby.” (Grandpa, I Love You). Her most acclaimed role was that of a corrupt minister in \"Taraf Talet\" (Third Party). Her most recent appearances were in the TV series \"Bedoon Zikr Asmaa\" (Anonymously), \"Hekayet Kayat\" (The Story of Hayat) and \"El Zowga El Tanya\" (The Second Wife).'),
('1108354', 'https://media.elcinema.com/uploads/_315x420_fb0929dd70b992a477e8ac302b322c1702fa5107df4bab66887f0cdd12cea294.jpg', 'Rahma Hassan', 'Egypt', '15 December 1988', 'Rahma Hassan is an Egyptian actress who was born on the 15th of December 1988. She started her career as a model in two of Nadeem Nour\'s music videos, as well as some commercials. Her first role in a movie was in “Alf Mabrouk” (Congratulations) with Ahmed Helmy in 2009, followed by breakthrough role as a co-star in “Al Alamy” with Youssef El Sherif. From there, she went on to star in “Samir we Shahir we Bahir” in 2010, then in multiple drama series like “Azmet Sokkar” (Sokkar\'s Crisis), “Al Da\'eya” (The Preacher), and “Moga Harra” (Heat Wave) in 2013.'),
