('1108967', 'https://media.elcinema.com/uploads/_315x420_bdfdbad0170c3aec2fa8da941bce5227701483d761311b61ee4326eca1350d63.jpg', 'Mahmoud Glefoun', 'Egypt', ' 7 March 1945', 'Mahmoud Glefoun is an Egyptian actor. He was born in 1945. He started his acting career in the late 1970s, appearing exclusively on television since then. He participated in more than 150 television series and television films, debuting in “Alragol Allazy Faqad Alzakera Marratain” (The Man Who Lost His Memory Twice) in 1978. His prolific career also includes the series “Elraya Elbeida” (the White Flag), “Tager Elsaada” (The Happiness Dealer) and “Dahsha”.'),
('1108996', 'https://media.elcinema.com/uploads/_315x420_349bbf10536cf2b1dcd55e2546cc491b43e0cf3432aa3814bc1c02f46f6d9c55.jpg', 'mohamed el salamony', 'Egypt', NULL, NULL),
('1109031', 'https://media.elcinema.com/uploads/_315x420_af272be04bd9a8511461147e77e2e655bd1b696d2860fcc4ad627254aeb0a479.jpg', 'Muhammad Abdulhaleem', 'Egypt', NULL, NULL),
