('1109038', 'https://media.elcinema.com/uploads/_315x420_22c42df6d7e943f7a65601261cd413174c969fda14e03d564b3f0ceca0334244.jpg', 'Nesreen Amin', 'Egypt', ' 9 March 1984', 'Nesreen Amin is an Egyptian actress who was born in Cairo in 1984. She graduated from the Department of Communications from the Faculty of Applied Arts from the University of Helwan, then joined the Actors’ Studio in order to study acting. After she was cast in a number of smaller roles, director Yusri Nasrallah cast her in an important role in the film “Ihkee Ya Schehrazade” (Scheherazade, Tell Me a Story). Afterwards, she appeared in a number of TV serials, including “Abwab El Khof” (Doors of Fear), “Sharbat Louz” (Almond Syrup), “Zaat,” “El Sabaa Wesaya” (The Seven Commandments), and “Segn El Nisaa” (Womens’ Prison).'),
