('1109666', 'https://media.elcinema.com/uploads/_315x420_a1d4a21ce1670b4c478f101e2b4cb74ef033485b40200acd1f85dfc7d783ccf5.jpg', 'Khaled Diab', 'Egypt', ' 5 March 1979', 'Khaled Diab’s father was a surgeon while his mother was a housewife. In sharp contrast to his nature as a child, Khaled’s character today is vibrant and lively. \nAs a child, he always looked up to his brother the screenwriter Mohamed Diab as a role model.\nAs Khaled grew up, his personality changed gradually so that by the time he was in the preparatory and secondary stages he had become quite daring and willing to experiment. This new character helped sustain him while he was attending university in Cairo and living away from his parents. Thus, the bold character that had come to characterize him helped him to live alone and to take decisions independently.\nHe originally intended to enroll in the faculty of engineering but due to the fact that his test scores were only two points shy of the admission cut-off, he would enroll instead in the architecture division of the faculty of fine arts. He had a miserable time there as he felt lacking after years of superior academic performance in his previous academic stages.\nIn his second year, he decided to travel to the United States in order to seek new experiences there. His father financed his trip with the understanding that he would repay his father following the trip. Khaled ended his academic career feeling that he had not accomplished enough.'),
('1109674', 'https://media.elcinema.com/uploads/_315x420_f7ec55f5573343df8b8c093d1ef7287643fe2afdfc1cca22e0cc385332cfcd87.jpg', 'Sandy Ali', 'Tunisia', '12 February 1981', 'Sandy is a Tunisian actress born in a family of five members. She was famous for playing volley ball in Tunisia. She graduated from Commerce Faculty in 2003 and head to Cairo. She started her career through a supporting role in \"Malalki Alexandria\" followed by film \"Zarf Tarek\". The director Khaled Youssef presented her through his movie \"Kheyana Mashrouaa\"-\"Legal Betrayal\" where she proved her talent.'),
('1109681', 'https://media.elcinema.com/uploads/_315x420_3d4c3c34cb19ae85537e1cbb027e6d168ae6d2fc1ad7bdcf98671e5457d83e86.jpg', 'Ahmed Fahmy Abdul Zaher', 'Egypt', NULL, NULL),
('1109684', 'https://media.elcinema.com/uploads/_315x420_251c7702359e6e953a16a1f6beab5ff030422bfbff81d590ff55c0a89aac44ef.jpg', 'Eman Ragaey', 'Egypt', ' 1 December 1983', NULL),
('1109710', 'https://media.elcinema.com/uploads/_315x420_11e252f85956c7109d4027f7534d3438b0ab1dcc6f021ffd8b975dbc1399b6ad.jpg', 'Maha Al-Ashqar', 'Lebanon', NULL, NULL),
('1109766', 'https://media.elcinema.com/uploads/_315x420_f60869d5462001dbba20810b3c9a4116b4b515298b5988b8ca2a14384dc5ac27.jpg', 'Karim Maghawry', 'Egypt', ' 4 December 1985', NULL),
('1109786', 'https://media.elcinema.com/uploads/_315x420_51b2dbe84b8a6d1d8e4b716f908c54a4c9cbe913802a43d379aa84cdc40156bd.jpg', 'Walid El-Zourkany', 'Egypt', '26 October 1982', NULL),
('1109891', 'https://media.elcinema.com/uploads/_315x420_1b1771d8c42aa6fb8792cf6871616d0df609642e15af350cd4c2a0adeb7c8e26.jpg', 'Lamitta Frangieh', 'Lebanon', '15 November 1981', 'Lamita is a Lebanese model, TV host and actor. In 2004, she participated in “Miss Lebanon beauty pageant”. She acted in LBC’s series “Asr al-Hareem i.e. Harem age”. Raamez Galaal chose her to play the female leading role in his film “Hadd saame’ haaga i.e. Anybody hears anything?” Thus giving her the chance to excel and draw the attention to her.'),
('1109923', 'https://media.elcinema.com/uploads/_315x420_fd667da8b20821a9fe7d86f9e03336eae3eb318bc8830bce9061d5add4a1d849.jpg', 'Michel Nabil', 'Egypt', NULL, NULL),
('1110013', 'https://media.elcinema.com/uploads/_315x420_4d5c8240b89dbb0ce3a95747a56b7a87529036c4cdddfdaa4e1c6c1efee1779c.jpg', 'Spot 2000 for the production of film (Video 2000) Safwat Ghattas', 'Egypt', NULL, NULL);
INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1110017', 'https://media.elcinema.com/uploads/_315x420_a6433715ca9ed28ecfd50a2f9e015a1cfc71661c7c870126b78a76ff1f52e6c0.jpg', 'Bayyumy Fouad', 'Egypt', '16 June 1965', 'Egyptian actor, Bayoumi Fouad was born in Cairo on June 16, 1965. He was part of the first class at the Center for Creative Arts and graduated from the Directing Department. Fouad got his start playing supporting roles in films including: “Ihki ya Scheherazade” (Sherazade, Tell Me a Story; 2009), “678” (2010) and “Asmaa” (2011). He also appeared in several television series such as: “Abwab El Khouf” (Gates of Fear; 2011), “Raqm Maghoul” (Unknown Number; 2012), and “Ism Mua’at” (Temporary Name; 2013). Fouad gained fame when he appeared the television series “El Kebir Awi,” which ran for four seasons (2010-2014). He is also well-known for his role in the series “Mawjet Hara” (Heatwave; 2013).'),
('1110018', 'https://media.elcinema.com/uploads/_315x420_e61480ccd88a1947eb5ffc81908ef5ae1c43c9493e7ebad9301e2222b7405b3a.jpg', 'Riham Ayman', 'Egypt', '19 November 1988', 'Riham Ayman is an Egyptian actress. She started her career at a young age, appearing as a model in commercials. She turned to singing, and started as a member of the female trio “Virus.” She then changed her career once again to acting, as she was introduced to actor Karim Mahmoud Abdel Aziz, who referred her to play a role in the hit series “Mahmoud El Masry” alongside Karim\'s father Mahmoud Abdel Aziz. She then went on to take many roles in popular TV shows, like “Hekayat Banat” (Tales of Girls) and “Al Araaf” (The Oracle).'),
('1110024', 'https://media.elcinema.com/uploads/_315x420_c8d96fca66b1ec280276866f30a90ff092e9a3ebf1d605692b28cda019a032e1.jpg', 'Rafal', 'Syria', NULL, NULL),
('1110026', 'https://media.elcinema.com/uploads/_315x420_7b0e64f0d89248dc1b7cda7856ebd89ca8c9c8210d3d30277c1864a1cd8aaee7.jpg', 'Ahmad Thabit', 'Egypt', NULL, NULL),
('1110027', 'https://media.elcinema.com/uploads/_315x420_b63976b13480694234a629bc792d8d84e32b3c7bbf7032b3d3a72fe0aa458417.jpg', 'Mohamed Mamdouh', 'Egypt', ' 9 May 1981', 'Mohamed Mamdouh is an Egyptian actor. He started acting on stage, and came to prominence in the early 2010\'s with roles in films like \"Bebo we Beshir\" (Bebo ando and Beshir) and \"Elfeel El Azraq\" (The Blue Elephant). He also starred in several television series including \"Niran Sadiqa\" (Friendly Fire) and \"Embratoreyyet Min\" (Who\'s Empire).'),
('1110029', 'https://media.elcinema.com/uploads/_315x420_6837efcca217b9f8a22234295aaee42aea5d5dcf0beaf20ce8de2741b3b49605.jpg', 'Shady Abu Shady', 'Egypt', '15 September 1986', NULL),
('1110034', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Hi sham Ali Abdul Khaliq', 'Egypt', NULL, NULL),
('1110037', 'https://media.elcinema.com/uploads/_315x420_f00959ad4d743540bd93353375ef037f7c86b03f904c637cd98f4c2c18f0da6c.jpg', 'Mohammed Abdullah', 'Egypt', NULL, NULL),
('1110041', 'https://media.elcinema.com/uploads/_315x420_dd9c4f19f4cb249bf5c16cd2d3326ce5a7bfda636762476330eb8f3511f06753.jpg', 'Horeya Farghaly', 'Egypt', '18 October 1976', 'Horeya Farghaly is an Egyptian actress who was born in the United Emirates in 1977. She studied business management in the U.K, and started her acting career in 2010 with her appearance in the Khaled Youssef film “Kalemny Shokran” (Please Call Me). She then joined the Marwa Gebril school for acting where she studied for a year. Her second appearance was in the TV series “Al Shawarea\' Al Khalfeya” (Back Streets) in 2011. She later went on to play a variety of roles, from the local low-class girl to the sophisticated lady, and a belly dancer in “Kaf Al Qamar” (Moon\'s Palm). In her most recent roles to date she was the lead female in the TV series “Al Montaqem” (The Avenger), the blockbuster “Qalb al Assad” (Lion Heart) and “Al Qashash” (The Sweeper).'),
('1110042', 'https://media.elcinema.com/uploads/_315x420_fc5589eab1d7bbd407d2b968283aeb9324e4d972067f0edfe6dfe57123a3754d.jpg', 'Marwa Abdelsamie', 'Egypt', '18 April 1978', NULL),
('1110043', 'https://media.elcinema.com/uploads/_315x420_16b302380210e428c6eb769a6d03ec0a28fecc806480fee1f1031443b124a476.jpg', 'Sulafa NourAlddin', 'Egypt', NULL, NULL),
('1110053', 'https://media.elcinema.com/uploads/_315x420_964bd33af35ebd9c3c5d317869cb1e3ea20b5bbf1a40f9ebbc03e3e68528cbfc.jpg', 'Tareq Hasan', 'Egypt', NULL, NULL),
('1110055', 'https://media.elcinema.com/uploads/_315x420_5460408ebac57db2e236209c3462c0c80579785ca1ff3c46d1f09e10c544ff22.jpg', 'Ahmed Ebada', 'Egypt', ' 9 May 1962', NULL),
('1110058', 'https://media.elcinema.com/uploads/_315x420_d927240f6ec1cd0acdaa383e57d5819ec01fa4c1c8057c93f6ffe352cd8b5998.jpg', 'Walid Fawaz', 'Egypt', '17 December 1980', 'Waleed Fawaz (Waleed Fawaz Abdelaziz El Sayyed) is an Egyptian actor who was born on December 17, 1980. He graduated from the Higher Institute of Dramatic Arts, department of drama and theater criticism. He began his career as a stand-up comedian. Of his most notable performances in TV drama include those in: “Qatil Bila Ogr” (Murderer Without Pay) in 2009, “Ahl Cairo” (People of Cairo) in 2010, “Abwab El Khof” (Doors of Fear) in 2011, and “Raqm Maghol” (Unknown Number) in 2012. His big break came after performing the role Moatamad of in the TV series “Bidoun Zikr Asmaa” (Anonymously) in 2013, and then in the TV series “El Sabaa Wesaya” (The Seven Commandments) in 2014. He also appeared in the films “Zahimer” (Alzheimer’s) in 2010, “El Maslaha” (The Deal) in 2012, and “Ba’d El Tawfan” (After the Flood) in 2012.'),
('1110061', 'https://media.elcinema.com/uploads/_315x420_3934faf4309d24d9f1c97739fd3a77f9bdcfaaa502266c3128aca13cdc2341c6.jpg', 'Mustafa Tulba', 'Egypt', NULL, NULL),
