('1110414', 'https://media.elcinema.com/uploads/_315x420_2dc38d529fb43f678c0d74edc6761b2368aa96a764d04b6bc871a01494d02c53.jpg', 'Ahmed Saad', 'Egypt', '21 August 1981', 'Egyptian singer who sang many film scores like “Al-shabah i.e. The ghost” and “Dokkaan Shehaata”.\nHis brother is actor Amr Saad.'),
('1110449', 'https://media.elcinema.com/uploads/_315x420_d6eda5a3f0193468af2b68884bbf4d281dbed3d25835adff116713f316749305.jpg', 'Farida Al-Gready', 'Egypt', '30 September 1977', NULL),
('1110473', 'https://media.elcinema.com/uploads/_315x420_b89932383b2e94fd6d52e2f2288832cd390808a67220e7d2870595055719dafc.jpg', 'Karious Wadie', 'Egypt', '31 May 1988', NULL),
('1110531', 'https://media.elcinema.com/uploads/_315x420_69ba11a648368bf11b78e1fc86ae12c3fa3a712d0a86b8c5b5ce4f38b6942263.jpg', 'Ahmed El Ashry', 'Egypt', '23 November 1974', NULL),
('1110533', 'https://media.elcinema.com/uploads/_315x420_f775af3648de349d3a172d7d07d698b3b339eaf5adf4d82a863022c8226a10a1.jpg', 'Akram Hosny', 'Egypt', '10 September 1974', 'Akram Hosny is a radio and Television presenter. He started his a career at Nogoum FM radio station. His first television appearance was in “The 25th Hour News” program where hehe presented the comic character of “Sayed Aby Hafiza.” He satirically criticized the social, political and economic conditions in Egypt. The program was a big hit and audiences were strongly attached to it. It\'s worth mentioning, Akram Hosny graduated from the Police Academy and started his life as a police officer, but soon after changed his career and headed to the audio and visual media.'),
('1110591', 'https://media.elcinema.com/uploads/_315x420_9e05a8b142a1eea843e8718ad3455ee5b5649d0d77ad6d65a68fb00385789343.jpg', 'Muhammad Osama', 'Egypt', NULL, NULL),
