('1110776', 'https://media.elcinema.com/uploads/_315x420_58fb16e9fde8d6a5f0511cec7885aaa16e7cd8acf0fc653819bac63063be3c2a.jpg', 'Ahmad Mazhar', 'Egypt', NULL, NULL),
('1110783', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ali Adel', 'Egypt', NULL, NULL),
('1110790', 'https://media.elcinema.com/uploads/_315x420_125d072f541e037dbb25b2b2d357eff004ad57dedf08c2acfe37221705c4b0f6.jpg', 'Walid Mansour', 'Egypt', NULL, 'Walid Mansour is an Egyptian event planner and party organizer, known to have many friendships with people working in the film and television field, which led him to land roles in several television series, including “El Set Assila” (Lady Assila) (2005), “Afreet Elqersh” (The Shark Ghost) (2006) and “Farq Tawqeet” (Time Difference) (2014).'),
('1110798', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Eslam Kamal', 'Egypt', NULL, NULL),
('1110805', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Khaled Zaki', 'Egypt', NULL, NULL),
('1110905', 'https://media.elcinema.com/uploads/_315x420_727a179854d2960808d64ad2a06831b9caf7482faef3d0650117bddfc8d0888c.jpg', 'Kamel Elbasha', 'Palestine', '14 March 1962', NULL),
('1110919', 'https://media.elcinema.com/uploads/_315x420_dad9241beda963cca246b095479ca755708f308f69ab9bf2a87b28c0d495c1bf.jpg', 'Ahmed Bassiouny', 'Egypt', NULL, NULL),
('1111096', 'https://media.elcinema.com/uploads/_315x420_40364a3b196d20658553840dd8ded27e39455be64cf259ee9653e47a4c1e2e17.jpg', 'Iman Al Baloushi', 'Bahrain', '10 October 1981', NULL),
('1111133', 'https://media.elcinema.com/uploads/_315x420_5f0598681b7b8feda48054b2f6b3f5c80e0195f0e156e1b2f61cafe5a5f7a0e7.jpg', 'Abdelhamid El Awwam', 'Saudi Arabia', '29 October 1973', NULL),
('1111250', 'https://media.elcinema.com/uploads/_315x420_f409f5e64d76eb643b7fb930d30cdc7de2c1e4a42ba29e8a870ccd474d814413.jpg', 'Fatna Layla', 'Syria', NULL, NULL),
('1111298', 'https://media.elcinema.com/uploads/_315x420_5ade3c34702bb1eb7a345968e5bfb38edd3af44900fa52e270ab9bb3716c3f35.jpg', 'Dalia Shawky', 'Egypt', NULL, NULL),
('1111299', 'https://media.elcinema.com/uploads/_315x420_8545845b0ca38dbebe9cfbb8e9b017c9c0263bc8d893f4cb7669084b6d064914.jpg', 'Haidy Michel', 'Egypt', NULL, NULL),
('1111313', 'https://media.elcinema.com/uploads/_315x420_6c1b07524a51cd2668105fdfa149d5612164bbc43cec7fe32be62d528614eb82.jpg', 'Amr Saleh', 'Egypt', NULL, 'Amer Saleh is an Egyptian actor and TV anchor who was born in Cairo. He began his career as a host on the Hayat channel and then moved to Dream channel where he was the host of the famous youth show, “Shababik” (Windows). He began acting when director Ghada Salim cast him in the TV series “Khas Gidan” (Very Special) in 2009. After this, Amer appeared in a number of other shows, including: “El Hara,” “Ardh Khas” (Special Offer) in 2010, “El Baltegy” (The Thug) in 2012, “Hekayet Binat” (Tales of Girls) in 2013, “Nekdab Lo Ulna Mabnbebsh” (We’d Be Lying if We Said We Didn’t Love) in 2013. Amer was also the star of the film “Wahed Saheeh” (The Whole One) in 2011.'),
('1111364', 'https://media.elcinema.com/uploads/_315x420_cac16b63b9b6e090378b2b9def00127c7287b2c5bcb6c42366dbaea7fc77bac8.jpg', 'Mahmoud Saber', 'Egypt', NULL, NULL),
('1111377', 'https://media.elcinema.com/uploads/_315x420_86610f33ac3e2c1e90e83eabe9933cd6b260447a470544aae088c9ee0ccd6631.jpg', 'Rania Mansour', 'Egypt', '21 May 1986', NULL),
('1111378', 'https://media.elcinema.com/uploads/_315x420_d4514501ce833e795ef690d09fbf1e67163c54428fed6617342c76535b423fb2.jpg', 'Hany Abu-Assad', 'Palestine', '11 October 1968', 'Hany Abu Assad is a Palestinian director and screenwriter born in Nazareth, Palestine on the 11th of October, 1961. He holds both the Israeli (where he was born) and the Dutch (to where he moved in 1980 to study engineering) passports.In 1992, Assad made his directorial debut, the short film \"Manzel Waraqy\" (Paper House). He then made \"Alganna Al-aan\" (Paradise Now), which won the Golden Globe award for best foreign film in 2005, in addition to three awards at the Berlin International Film Festival. In 2013, his second feature film \"Omar\" was nominated for an Academy Award for Best Foreign Film, and won the Jury Prize in the Un Certain Regard competition at the 2013 Cannes Film Festival.'),
('1111386', 'https://media.elcinema.com/uploads/_315x420_460cae974914910bef251ea12977bb41ffdda18338bf11f648ba48d1a0c9c14a.jpg', 'Fekri Salim', 'Egypt', NULL, NULL),
('1111396', 'https://media.elcinema.com/uploads/_315x420_51c45ea867a858b9df2ca8021171e266574248613ba90bc60156ae12266f334a.jpg', 'Ahmed Bekhit', 'Egypt', NULL, NULL),
('1111397', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Lujain', 'Egypt', NULL, NULL),
('1111416', 'https://media.elcinema.com/uploads/_315x420_a23dee5101d152d9067380a9de94025f7d4c19ae6c5962c877cf7dcde7baba80.jpg', 'Donia El Masry', 'Egypt', ' 1 February 1984', '\"Donia El Masry\" a young actress who started her career in 2008 when the director \"Mosaad Fouda\" nominated her starring in movie \"Masheen Belaks\". After wards she presented many great works. Her talent appeared in 2010 when she participated in three series at the same time \"Kadeyat Safya\", \"Al Atabaa El Hamra\" and \"Shaheed Isbat\".'),
('1111419', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Sahar Kamel', 'Egypt', NULL, NULL),
('1111487', 'https://media.elcinema.com/uploads/_315x420_a3e51877fa92876c07146ebcc729970a614eee2d204df087380af52b06a29432.jpg', 'Talab Alduws', 'Palestine', '11 March 1968', NULL),
('1111489', 'https://media.elcinema.com/uploads/_315x420_8aa6acb427229c33579cc69537ddf9bdf6c5dfd4458b18801888b22a849d20c6.jpg', 'Majdi Al Basousi', 'Egypt', '14 March 1983', NULL),
('1111491', 'https://media.elcinema.com/uploads/_315x420_9baf7c8057184e5dbf87731cc3cd448791a4ecaf5d7a78ffb0efbe6568b76595.jpg', 'Dhaffer L\'Abidine', 'Tunisia', '26 November 1972', 'Dhaffer L\'Abidine is a Tunisian actor. He was born in 1972. He studied computer science, while simultaneously working as a model in Paris. He then moved to London to join the Birmingham Acting School, from which he graduated in 2002. A year later, he started appearing in several American films, including Children of Men, The Black Forest, and Centurion. In 2008 he started appearing in Arab productions, debuting in the Tunisian series \"Maktub\", and having his breakthrough in the Egyptian series \"Niran Sadiqa\" (Friendly Fire).'),
('1111498', 'https://media.elcinema.com/uploads/_315x420_8e6e9c9180ab16d5003969ebd5b2309bd6bbf4166987e98cb7876286ed3ba44d.jpg', 'Samira Magroun', 'Tunisia', '24 January 1987', NULL),
('1111507', 'https://media.elcinema.com/uploads/_315x420_14493642ffbb8e6c26ac01491c6e2c132accda2e06b541da77898a76eb84ae8d.jpg', 'Gamal El Sametti', 'United Arab Emirates', NULL, NULL),
('1111509', 'https://media.elcinema.com/uploads/_315x420_4a453f18f16452e5640e85dd6b60075135966d916f96f85bde0703c6296accaf.jpg', 'Kareem El-Adl', 'Egypt', ' 7 December 1985', 'Kareem el-A’dl began his career at an early age before enrolling in the High Institute for Cinema. Prior to his formal training Kareem worked as an assistant director alongside several major directors. He also directed four shorts, the most important of which was “al-Harb al-A’alamiyah al-Rabi’aa” (“The Fourth World War”).\nKareem el-A’dl, who is the son of renowned producer Mohamed el-A’dl, directed his first feature length film in 2010. The film was titled “Walad wa Bent” (“A Boy and A Girl”). Newcomers Mariam Hassan and Ahmed Dawoud were cast in the leading roles.'),
