('1112013', 'https://media.elcinema.com/uploads/_315x420_e95afbcac73d7bdda84ef63cc4f2e383538fd3e299c92adfec56508d4f639760.jpg', 'Shady Sorour', 'Egypt', NULL, 'Shady Sorour is primarily a director, and was the head of the Puppet Theater Youth Troupe in Attaba. His works include the play “El Mahroos We El Mahroosa,” which starred actors Sawsan Badr, Ahmed Ratib, and Liqa’ Sowedan. Sorour also had several acting experiences; he appeared on the TV serial “El Gamaa’” (The Association) and “El Forigy” and the film “Mahemet Sa’ba” (A Difficult Mission).'),
