('1112814', 'https://media.elcinema.com/uploads/_315x420_471b0ca209029936b169b990b0d611f25cad79436671fd91338dbe1f268e5485.jpg', 'Reem Al-Adl', 'Egypt', ' 6 June 1982', 'Reem El Adl is an Egyptian fashion designer who was born in 1983. After graduating from the Faculty of Fine Arts, she worked as an assistant to a number of fashion designers, including Nahed Nasrallah. She also received a diploma from an Italian school in film and theater fashion design. In 2005, she started working in cinema with the film “Ureed Khola’n” (I Want a Divorce). Afterwards, she worked on the films: “Waraet Shafra,” (The Code Letter) “El Saffah” (Killer), “Sameer We Shaheer We Baheer.” She also worked on the films “Sayyedna El Sayyed” (Our Master El Sayyed), “El Daa’ya” (The Preacher), and “Sign El Nesaa” (Women’s Prison).'),
