('1113287', 'https://media.elcinema.com/uploads/_315x420_b560c03b943f23a93cc7bd097f9b0c236f83bdaa0260a872209055f6e4ff6208.jpg', 'Ahmad Abdulaziz', 'Egypt', ' 8 April 1984', 'Ahmed Abdel Aziz is an Egyptian actor. He studied computer sciences and graduated from the Modern Academy. He started working as an actor in 2008. His film roles include \"Helm El Omr\" (Life\'s Dream), \"Habiby Na\'iman\" (Sleeping Beauty) and \"Saa\'a we Nos\" (An Hour and a Half). His television roles include \"El Kebir Awy\" and \"Aghla Min Hayaty\" (More Precious Than My Life).'),
('1113292', 'https://media.elcinema.com/uploads/_315x420_25269e1c240654cb72b61199d0a4b23fd75c986424a19192578058c8a06e7495.jpg', 'Sayed Al-Sherwedy', 'Egypt', NULL, NULL),
('1113293', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'وائل أبو السعود', 'Egypt', NULL, NULL),
('1113313', 'https://media.elcinema.com/uploads/_315x420_ae0530f831c8c7f1058e09e9096c71a673228d6c70070b7e69c4f36cb94685c1.jpg', 'Dominique Hourani', 'Lebanon', ' 7 August 1985', 'The Lebanese singer actress, model and designer \"Dominique Youssef Hourani\" was born on the 7th of August 1985. She got her Masters Degree in Business Administration from the Lebanese American University along with two other degrees in psychology and accounting. She married \"Ali Reza Almassi\" in November 2007 and they had a baby girl called \"Delmara\".'),
('1113316', 'https://media.elcinema.com/uploads/_315x420_f79d851dadace7a31d6da9f300b771af5bdeb60d5209dcc3eaa83f32110b866b.jpg', 'Michell Abu Suleiman', 'Lebanon', NULL, NULL),
('1113337', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ramy Ramzy', 'Egypt', NULL, NULL),
('1144629', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'محمد حمدي', 'Egypt', NULL, NULL),
('1518189', 'https://media.elcinema.com/uploads/_315x420_b382963cc7e4fca5da1ed35052fd47078e5e0423520907b58d0970bcda789b5b.jpg', 'Claudia Hanna', 'Iraq', '25 April 1988', 'Claudia is an Arab musician with Iraqi roots. She was born on the 25th of April in Baghdad. Apart from her work in music Claudia also acts. She currently lives in Egypt and attends the American University in Cairo where she is enrolled in a literature program. Claudia’s career began as a child when she worked as an announcer for children’s shows in Iraq and Jordan, she also did some theater work at that stage. At some point Claudia was nominated for a spot on a beauty pageant that was held in Switzerland and at the age of 14, Claudia began working as a model for several years. In 2006 Claudia took part in a pan-Arab beauty contest that was held in Sharm El Sheikh. Claudia joined the competition as Miss Iraq and subsequently won the title. Worthy of note is the fact that Claudia is the first Iraqi model. Following that competition Claudia joined “Qafillat Al Kheir”, a philanthropic organization that took her across the Arab World. Thereafter Claudia assumed her first acting role which was on a television series titled “Masha’er fee Al Borsa” (“Passions at the Stock Exchange”). That role was followed by work on her first album which is titled “Al Waqqt Dah” (“This Time”). The album is unique in that it employs both Egyptian and Iraqi dialects.'),
