('1734303', 'https://media.elcinema.com/uploads/_315x420_bd384bd46f351e459810ab2553840ed373a989893c922b77d2503431a5bc59db.jpg', 'Inas Ali', 'Tunisia', NULL, NULL),
('1755885', 'https://media.elcinema.com/uploads/_315x420_4a489a5641ca10af311c87f2640db132386db5d22f16bb0d5723521bfb62f9db.jpg', 'Mohamed Soliman Abdul Malek', 'Egypt', ' 1 May 1979', 'Mohamed Soliman Abdel Malek is an Egyptian screenwriter and author. He studied medicine at the Suez Canal University, where he started writing, beginning with a series of short stories. He also worked in independent journalism, before focusing on screenwriting through participating in writing workshops for sitcoms including \"El Eyada\" (The Clinic) and \"Tamer we Shawqeyya\" (Tamer and Shawqeyya). Since 2007, he started developing his own television series and films, including \"Ism Moa\'akat\" (Temporary Name) and \"Shadd Agzaa\" (Gun Racking).'),
('1852996', 'https://media.elcinema.com/uploads/_315x420_4e9748c7e585a47ed1817f776308f086f07e70be57769d67faccf2989670cbd4.jpg', 'Nader Abul Leif', 'Egypt', '30 April 1968', 'Nader Abul Leif is an Egyptian singer. He was born in Alexandria in 1968, and studied violin in the conservatory. After a lot of attempts to appear in the field, he moved to Libya seeking various careers, in which he also failed and eventually returned to Egypt. Following his return, his friend Ayman Bahgat Amar offered him to assist him in making a debut album, which they eventually did and released, to overwhelming commercial success.'),
('1935807', 'https://media.elcinema.com/uploads/_315x420_86885d2aa5eb030adc1aa706acd68e72b3fc182c75b43a3b41195897d7fc7ced.jpg', 'Elissa', 'Lebanon', '27 October 1972', 'Elissa is a Lebanese musician with a melodious voice. She achieved moderate success in Lebanon before moving to Cairo at the turn of the new century where she succeeded greatly and established herself as one of the great singing voice of the Arab World.'),
