('1976947', 'https://media.elcinema.com/uploads/_315x420_a497f86b3ce0bbf7859c20dbfe9dabd3c496d11d77e90846f04add57e81d932c.jpg', 'Rami Ayash', 'Lebanon', '18 August 1980', 'A Lebanese pop start, who shined during the 90’s. He produced many songs that put him on the top of the chart and sang with legendary local singer “Ahmed Adaweya” in the famous duet “AL Naas Al Rayaa” or “The Cool People” which was a hit during that time. He dreams of acting but has not made up his mind yet.'),
