('1976952', 'https://media.elcinema.com/uploads/_315x420_f9520d0f75575869c4c06f0624776745b4ba049e86944da12aeef57d8eede484.jpg', 'Abd El Rahamn Mahmoud', 'Egypt', '10 August 1985', NULL),
('1976953', 'https://media.elcinema.com/uploads/_315x420_fe37cbbf24d40838e8731b9cb09da9d3eed62443bbc5dde430d8662ffaabbf66.jpg', 'Moustafa Shaaban', 'Egypt', NULL, NULL),
('1976955', 'https://media.elcinema.com/uploads/_315x420_0d11d897ee512c63c71530074fb6ebad31c88694d1d0deefa05168a9b02cb998.jpg', 'Ahmad Al-Awady', 'Egypt', '12 December 1985', 'Egyptian actor Ahmed Al-Awadi graduated from the College of Business at Helwan University in 2006. He was discovered by well-known actor Nour El Sherif who offered him a role on the television series “Matkhafoush” (Don’t Be Afraid; 2009). Al-Awadi has also appeared in several other television series including: “Al Daly 3” (2011), “Mirath El-Reeh” (Legacy of the Wind; 2013), and “El-Seba’a Wisaya” (The Seven Commandments; 2014).'),
('1976956', 'https://media.elcinema.com/uploads/_315x420_724b90ea30cdefb2d31056aeb56d8db74b8de71adb5606f3380e0c3b5b8e8a47.jpg', 'Sahar Al Sayegh', 'Egypt', ' 1 January 1990', 'Sahar El Sayegh is an Egyptian actress who was born in 1990. She began acting in TV serials when she was a child, the most famous of which was “Om Kolthom” which starred Sabreen inred Sabreen in 1999. In the series, Sahar played Om Kolthoom as a young girlه. The role was Sahar’s “big break into the world of acting, which she pursued alongside studying at the Faculty of Dentistry. In 2008, she appeared in the TV serial “Fi Ed Amina” (In Amina’s Hand) alongside the actress Yousra. She also acted with Yousra in the series “Khas Gedan” (Very Special) in 2009 after having been proposed for the part by producer Gamal El Adl. In 2010, she appeared with a star-studded cast in the most famous TV series she has acted in, “El Hara.”'),
('1976958', 'https://media.elcinema.com/uploads/_315x420_3a57c3df5c91339a0d7dbacf03c6d24bcfece444396b8ebde62c8c2119ddfce5.jpg', 'Ahmed Gamal Saeed', 'Egypt', '21 January 1989', NULL),
('1976984', 'https://media.elcinema.com/uploads/_315x420_c8255606a201e1475c67f7a74bcd84a57f98e72960610c8d4b38e879ce6bdab3.jpg', 'سماح عوض', 'Egypt', NULL, NULL),
('1977038', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'أحمد عبدالخالق', 'Egypt', NULL, NULL),
('1977048', 'https://media.elcinema.com/uploads/_315x420_6ffb4c971a1dfcadbd373408107ea998ee62fe0ca70c8ea30978d1b42c08d202.jpg', 'Mohamed Fahim', 'Egypt', NULL, NULL),
('1977085', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Amr Saeed', 'Egypt', NULL, NULL),
('1977128', 'https://media.elcinema.com/uploads/_315x420_f0019598310a2b0a232a6602f20db28689651cff54fbbc3bcbee2e8ad7e03520.jpg', 'Alaa Hosny', 'Egypt', NULL, 'Alaa Hosni is an Egyptian actor. He earned his bachelor\'s degree in accounting then another degree from the Institute of Theatre Arts in acting and directing. He\'s appeared in a number of television series, notably \"Moled we Sahbo Ghayeb\" (2012). In 2013, he stars in the mystery thriller \"Al Hafla\" starring Ahmed Ezz and Ruby.'),
('1977129', 'https://media.elcinema.com/uploads/_315x420_63c470badecf6c8d9d48be1d7e64ae8002219fe50fc924aa31a01f930917b2df.jpg', 'Dina El Sherbiny', 'Egypt', '17 March 1985', 'Dina El Sherbiny is an Egyptian actress. She started as a TV host for the program “Shababeek” on Dream satellite channel, but her growing admiration to acting made her join the Marwa Gebril acting school, where she studied for a year. She then auditioned for the TV show “Ard Khas” (Special Screening), where she was chosen to play her real life character. After that she went on to star in TV series like “Moga Harra” (Heat Wave), “Taht el Ard” (Underground) and films like Al Hafla (The Party) and “Sameer Abu Elneel.”'),
('1977130', 'https://media.elcinema.com/uploads/_315x420_7e18fb6017d6ac23bcf2ab775af0ddca8c1477d6c99d0c6704563138e6254e3f.jpg', 'Karim Fahmy', 'Egypt', ' 3 December 1982', 'Karim Fahmy is an Egyptian actor, and brother of screenwriter Ahmed Fahmy. He studied in the Faculty of Dentistry in Cairo. He then entered the media after being selected to participate in the TV show “Ard Khas” (Special Screening), playing his real life character: a dentist dreaming of becoming an artist and leaves his job to pursue this dream. However, Fahmy never left his occupation as a dentist. Fahmy also wrote feature film scripts like “Bebo we Basher,” “Mr. and Mrs. Eweys,” and “Hatoli Ragel” (I Need a Man), in which he also starred.'),
('1977131', 'https://media.elcinema.com/uploads/_315x420_76a49c58785bc980bf1e60234646e1e9c4574179d3fa6679482badce10e95ace.jpg', 'Yasmin Raeis', 'Egypt', '15 September 1985', 'Egyptian Actress, She was born in Cairo in 1985, After Working Several Years as a model, she decided to start her Acting Career in 2010 With TV-Series (Special Screening) and later Participated in Several Movies, Including: (X Large, A Whole One, The Benefit), But she drew a lot of attention when she collaborated with Director Mohamed Khan in Movie (Factory Girl) in the main role, which made her gain several awards including Best Actress Award from Dubai International Film Festival.'),
('1977132', 'https://media.elcinema.com/uploads/_315x420_46d7a23860212cf90d933bf16e3175a5c7a15cb851e9b88da6e0a055f2dcbdb7.jpg', 'Mustafa Al-Ridi', 'Egypt', NULL, NULL),
('1977134', 'https://media.elcinema.com/uploads/_315x420_8d935497f37cea90ae10d4ffa5e453fa569b7bfbae726c9d5ae2f94ed655b5d0.jpg', 'Mohamed Shaker Khodeir', 'Egypt', ' 2 February 1983', 'Mohamed Shaker Khodeir is an Egyptian director. He directed the programs \"Khatawat Elshaytan\" (The Devil\'s Steps) and \"Rehlat AL Yaqin\" (The Journey of Certainty) with Islamic preacher Moaez Massoud. He also directed the mini-series \"Ard Khas\" (Special Screening) and the film \"Hatuly Ragel\" (Bring Me a Man).'),
