INSERT INTO `CAST` (`id`, `img`, `Name`, `Country`, `date_of_birth`, `Biography`) VALUES
('1977421', 'https://media.elcinema.com/uploads/_315x420_5a14e2344d5e2598656929364b190afaf3c2abc76de5de68d3ac79d4f6195576.jpg', 'Ahmed Magdy', 'Egypt', ' 4 May 1986', 'Ahmed Magdy graduated from the law faculty at ‘Ain Shams University but did not work as a lawyer. Rather Magdy joined the al-Tamy theater troupe and worked as an actor, assistant director and actor trainer for many performances over a period of three years. His first film was the independent six-minute 2007 documentary work “Magra al-Seil” (“Riverbed”). Thereafter Magdy took part in a workshop titled “al-Zatt wa al-Madina – al-Qahira” (“The Self and the City- Cairo”) which was produced by the European Union and al-Sammat production company which saw the direction of a 9 minute documentary work titled “Zeezo”. Magdy also joined the Cairo Jesuit Cinema School for a year and directed three low budget short titles.\nMagdy has taken part as an actor or assistant cameraman in more than 30 independent works. He was also in the 10 minute narrative film work “Keika Sagheera” (“Small Cake”). The title was his graduation project that was submitted to the workshop and received an honor from the judging committee at the Algeria Independent Cinema Festival.\nMagdy’s final work as a director was “Illa al-Bahr…” (“To the Sea…”), the title was produced by the Forced Migration and Refugee Studies department at the American University in Cairo. Magdy also participated as an actor in “’Asafeer al-Neel” (“Birds of the Nile”). That title also starred Fathy ‘Abd Al Wahab and was directed by Magdy Ahmed ‘Aly. The work was adapted from a literature work by the same name which was authored by the renowned writer Ibrahim Aslan.'),
('1977426', 'https://media.elcinema.com/uploads/_315x420_c02b0fd2f5fc22e75a26ecfbbe06c0c5d06f0f9d3f1da0b43cc25bca8b561b15.jpg', 'Murad Makram', 'Egypt', '16 April 1975', NULL),
('1977432', 'https://media.elcinema.com/uploads/_315x420_24c4469b170ee625b562d03a667b51b372c0c1e1232496deeabf40ab13ab2e28.jpg', 'Habi M. Seoud', 'Egypt', ' 7 May 1984', NULL),
('1977443', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Mohamed Jamaica', 'Egypt', NULL, NULL),
('1977444', 'https://media.elcinema.com/uploads/_315x420_de012af3fcb3c73c273a812e8f2325809aeb406c9e1f19ccad4250de9db5310a.jpg', 'Ahmad Fahmy', 'Egypt', ' 6 November 1980', 'Satirical writer and actor, Ahmed Fahmy, graduated with a degree in political science and economics. He began his career in acting as an amateur in an independent film group called \"Tamr Hendy\" during his college years. Tamr Hendy produced many satirical films, among the most famous \"Regal la Ta3rif Elmostaheel\" a parody of the Egyptian movie \"Eltareeq Ila Ilat\"  which quickly spread on the internet and was screened in many local cafes. \n\n\"Regal la Ta3rif Elmostaheel\" captured the interest of writer Mohamed Hefzy, who was making the transition into movie production at the time.  After meeting with Fahmy, Hefzy decided to produce his work \"Affiche we Tashbeeh,\" a TV series that makes fun of various Egyptian films in each episode. Later on, Hefzy would produce Fahmy\'s movie \"Waraqit Shafra\" which Fahmy wrote and acted in, along side his Tamr Hendy colleagues and long time friends Hisham Maged and Chico.  All 3 actors won the critic\'s choice award in 2003 for Best New Actors.  \n\nFahmy also wrote the screenplay for \"Keda Reda\" starring Ahmed Hilmy, as well as \"Sameer, Shaheer, & Baheer\" in which the Tamr Hendy trio costarred once again.'),
('1977459', 'https://media.elcinema.com/uploads/_315x420_a338930efb46a61c2762ced003e6c9e4831d8d712ab4bc7edcf83088aa7c9fbc.jpg', 'Nahla Zaki', 'Egypt', ' 9 August 1987', 'Nahla Zakky is a young Egyptian actress. Her cinema debut came in 2009 when she assumed a role alongside Imam Mohamed Imam in “al-Bey Romansy” (“Romantic Beyy”). Critics welcomed her as a promising new edition to cinema with characteristic and beautiful Egyptian features.'),
('1977461', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Khlaed', 'Egypt', NULL, NULL),
