('1977509', 'https://media.elcinema.com/uploads/_315x420_13fe68679acff70efd2e5f4847ffd5b70d3ac84ae3b1d2ce0ba4b524ff9b51c5.jpg', 'Khader Mohammed Khader', 'Egypt', '29 April 1980', NULL),
('1977514', 'https://media.elcinema.com/uploads/_315x420_bbd48c54c004b5258e6e655b65191689bc4ffde0cc27aa782d60c17c82046065.jpg', 'Diamond Bou Abboud', 'Lebanon', NULL, NULL),
('1977525', 'https://media.elcinema.com/uploads/_315x420_9dea5fcd4ea0d41cee6d4438701dbd76b8ceb97c0931455cc83acea6e8d8398b.jpg', 'Amir El Masry', 'Egypt', ' 2 August 1990', NULL),
('1977526', 'https://media.elcinema.com/uploads/_315x420_ca59a69b1e29743cb963608a4e1ad72dce75da6354bb87baa2fa9c12d0b2e1e4.jpg', 'Omar Mustafa  Metwally', 'Egypt', ' 1 August 1983', 'Omar Mustafa Metwally is an Egyptian actor who was born on August 1, 1983 in Cairo. His father is the actor Mustafa Metwally and his uncle is the producer Essam Imam, brother of actor Adil Imam. He began his acting career with the film “Ramadan Mabrook Abo El Alamein Hamouda” in 2008, and then appeared in several films including “Safari” in 2010, “Saa Wi Nos” (Hour and a Half) in 2012, “Tattah” in 2013, and “Qalb El Assad” (Lion Heart) in 2013. He also was the star of the TV series “9 Gameat El Dowal” in 2012.'),
('1977527', 'https://media.elcinema.com/uploads/_315x420_e6345c6d5cc57900be1064f766ab807023be9b957507a972702ba404a731b8f3.jpg', 'Ziad El Weshahy', 'Egypt', ' 3 September 1980', 'Ziad El Weshahy is an Egyptian Film director. He has worked as an assistant director since 1997, mainly in feature films and TV series.'),
