('1978574', 'https://media.elcinema.com/uploads/_315x420_c2404be0c9e48ef4f9180897afce45cb16eabab6b7756d17ac4a6ef747ac8194.jpg', 'Umaima Talaat Zakaria', 'Egypt', '20 October 1989', 'Born in Cairo in 1989, Omaima Talaat Zakaria started her acting career working in television. She has starred in several TV series including: “Goz Mama” (My Mother’s Husband), “Hamid Kelbo Gamid” (Hamid’s Frigid Heart), “Ahla Eyam” (The Sweetest Days), and “El Zawga El Rabaa” (The Fourth Wife).'),
('1978575', 'https://media.elcinema.com/uploads/_315x420_a1b4634d1be2da0f3d3a54bd8fb86bd9243daac2771845307bf3ce1bc262d28b.jpg', 'Omar Talaat Zakria', 'Egypt', NULL, NULL),
