('1978585', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'عمر حنفي', 'Egypt', NULL, NULL),
('1978622', 'https://media.elcinema.com/uploads/_315x420_7c3d47dbb69be6236fb9102598e1c4daa267faff7c2ab22c40d7b3a272eec18e.jpg', 'Mohamed Yousry', 'Egypt', '10 August 1989', 'Mohamed is the son of (the performer) Ibrahim Yousry. He has loved acting from a young age despite his father’s objections.\nAfter completing his studies in (international commerce), Mohamed devoted himself to realizing his dream. He has since acted in more than one series.\nMohamed’s talents were apparent when he performed alongside the (well-known performer Abd Al Moneim Madbouly) in the television series “Shams Yawm Jadeed”.'),
('1978694', 'https://media.elcinema.com/uploads/_315x420_4fd810c9e061fea3eaeeb8cbb6c52defbd8d09bf238201fd218a94a16f01f22b.jpg', 'Mohamed El Sherbini', 'Egypt', ' 1 March 1978', NULL),
('1978697', 'https://media.elcinema.com/uploads/_315x420_fb2d5c245a88b79ef8e137f1b074dadf233d658b7543bef8bddccb2c49d14c43.jpg', 'Samia Asaad', 'Egypt', NULL, 'Samia Asaad is an Egyptian actress. She studied acting at the American University in Cairo, and started acting on stage while studying. She acted in plays in Arabic and English, and starred in the play “Al Less” (The Thied) on Rawabet Independent Theater, where she was noticed by film director and writer Dawood Abdel Sayyed who then cast her to star in his film “Rasayel El Bahr” (Messages from the Sea). She then appeared in the films “Asmaa” and “La Mo\'akhza” (Excuse my French) with director Amr Salama. She also co-starred alongside Mona Zaki in the television series “Asia”.'),
('1978762', 'https://media.elcinema.com/uploads/_315x420_125b200b010d0984fa3df9edf391cf3464f953bbbd230b7f0a5d4c0bb1e27e4a.jpg', 'Hamza Al-Eily', 'Egypt', '21 January 1983', NULL),
