('1979419', 'https://media.elcinema.com/uploads/_315x420_d7916de6ecaddb65bb82f94dee3cf269259c23250d5649fd2c2f54ebfb29234e.jpg', 'Abdel Basset Hamouda', 'Egypt', ' 5 January 1960', 'Abdel Basset Hamouda is an Egyptian Shaabi singer. He was born in Alexandria in 1960, and started his singing career by performing in weddings and religious gatherings at his hometown and its neighbouring towns. He then started recording singles, which after achieving widespread fame across the country, were later compiled in one album. He followed it with his second album in 1996, and since then, he has released numerous successful albums. He also appeared as an actor in several films and television series.'),
