('1980089', 'https://media.elcinema.com/uploads/_315x420_5626fc8f478eccf55d5cd961e511d2c8bd11116f61c294a3c1a094099e24b4d8.jpg', 'Medhat Tekha', 'Egypt', '15 December 1986', 'Medhat Esma’eel is an Egyptian young actor who started his acting career ten years ago, he is well-known with his stage name “Medhat Tekh-kha”. Medhat started his career playing small roles until he succeeded to impose himself to the artistic scene because of his talent that he exploited well. Although he limited himself in comedy roles, but he proved his talent and was awarded by “Al-Ahram Foundation” for playing the role of “Al-Sheikh Sallaam” in the TV series “Sheikh al-‘Arab Hammaam”.'),
('1980094', 'https://media.elcinema.com/uploads/_315x420_932a0a9e60efa1bb509315d62a001df78a136dddd3b24ee390a12c26fc6d42f0.jpg', 'Muhammad Jamal Al Adl', 'Egypt', NULL, 'Mohamed graduated from (the directing division of the Institute of Cinema) in 2008. He has so far worked as a directing assistant in the production of five cinematic productions and six television series.\nAmong the (best known) directors that he has worked with are Edrees and Gamal Abd Al Hamid, Magdy Abo Umaira and the Syrian director Mohamed Azizah.\nThe (judges) at the (Alexandria International Film Festival) award him a prize for “Dastour ya Sayyidah”.'),
