('1980545', 'https://media.elcinema.com/uploads/_315x420_b5582e025efacdc2526003f2355975b36ff3456aee3fd92dfc42a362a8e97858.jpg', 'Inas Ezz Al-Din', 'Egypt', '24 September 1980', 'Egyptian actress Ines Ezz El Din was born on September 24, 1984. She got her start in television in series such as, “Shabab Rayiq Gidan” (The Kids Are Alright, 1998), “El Ragil El Akhir” (The Other Man, 1999), and “El Raks ‘Ala Salalim Mutiharika” (The Dance on the Escalator, 2001). She later appeared in a number of successful drama series, which contributed to her fame including, “El Haqiqa wal Sirab” (Truth and Mirage, 2003), “Al ‘Ar” (The Shame, 2010), and “Adam” (2011). With regard to cinema, she has appeared in a few films including “Falah fil Congress” (A Farmer in Congress, 2002) and “Rud Sugun” (Repeat Offender, 2014).'),
