('1980835', 'https://media.elcinema.com/uploads/_315x420_2a88a47c19a0cb0ec473b9c2e386877ae48d3531398c310bc1348b138cf819cb.jpg', 'Scott Adkins', 'UK', '17 June 1976', 'Scott Adkins, an English actor and compact arts player.  Famously known as (Yuri Bojka) from the movie (Undisputed II: Last Man Standing) and (Undisputed II: Redemption), also known as (Bradley Hume) in the English drama series (Holby City), and (Ed Russell) in the English series (Mile High) and (Hector) in the movie (the Expendables 2) bombarded with many action stars, he also started in the TV series (Dangerfield) and (Hollyoaks), in addition to many other movies. Adkins born in (Sutton Field) Southeast (Birmingham), England in 1976. His interest in compact arts began at age of ten, when he visited his father and his brother, at a local judo club; afterwards, he began training in the garage of their home, where he used to bend to a picture of (Bruce Lee). His interests in compact arts increased when he considered famous martial arts actors like (Bruce Lee) and (Van Damme) his mentors. He began training on taekwondo and earned the black belt at the age of nineteen. He also trained himself on the kickboxing since the age of sixteen. As well as training in Ninjutsu sports, judo, karate, Jojotsu, wushu, Alkrav Maga, Alkubira, Jeet Kune Do and athletics. Since childhood, he decided to study drama at the College (Sutton Field) and the difficulty faced him in the beginning facing people in public due to his shyness. At the age of twenty-one, he began to study acting in (Webber Douglas) Academy, for performing arts, but did not manage to get a certificate, and he thought this is the end of his acting career, however, his chance came when he was offered a role in a movie named (Dei Seung Chui Keung) or (blatant challenge) in 2001. He drew the attention of (Wai Tong) Director and Chairman of the Hong Kong takers association, as well as (Bai Logan), an expert movie maker from Hong Kong. Adkins continued his work in the Middle of working with a group of senior directors of action movies such as (Woo-ping Yuen), (Corey Yuen), (Sammo Hong Kam-Po) and the legend (Jackie Chan). In 2000, his biggest hit came, when he was offered the role of guest of honor in the series (Doctors), a couple of episodes of the series (City Central), (City Central) and then was offered a major role in the series (Mile High) in 2003, and then continues to the role of the Series ( Holby City). In 2006, he was able to enter the world of Hollywood through his role in (Undisputed II: Last Man Standing). In 2008, he stood before (Van Damme), one of his childhood heroes in the movie (The Shepherd: Border Patrol (2008)) the role of the main opponent! In 2012 also starred in the movie (Zero Dark Thirty). In 2014 he acted as the king (Omfitrion) in the 3D imaginary movie (The Legend of Hercules).'),
