('1981818', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'Ali Abdel Gelel', 'Egypt', NULL, NULL),
('1981822', 'https://media.elcinema.com/uploads/_315x420_9effb3c637ba3e890cc5f7d219140dc043fc8b13174ea9e0c9a2028b1af08ac5.jpg', 'Safwat Wahib', 'Egypt', '20 April 1965', NULL),
('1981825', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'نرمين فرنسيس', 'Egypt', NULL, NULL),
('1981872', 'https://media.elcinema.com/uploads/_315x420_590e7593c4a7e872c6ca069aae0e359846de2cefeac9541d8fd70b70973d62e3.jpg', 'Rania Mallah', 'Syria', '13 March 1987', 'Syrian actress Rania Mallah was born in Damascus in 1987. She began her career in advertisements and video clips before she started working in cinema in 2006 when she appeared in two films: “Ala El Hawa” (Over the Wind) and “El Ghawas” (The Diver). Her third film, “Masjoun Transit” (Transit Prisoner) was considered her breakout film in Egypt, followed by “El Bey Romansy” (The Romantic Bey) and “Muhtarim Ila Ruba” (Almost Respected) in 2009 and 2010. With respect to television, she has appeared in a number of series including “El Safa’a” (The Slap) and “Kharam Ibra” (Eye of a Needle). Mallah also appeared in the Syrian drama series “Sabaya” (The Girls) in 2013.'),
('1981885', 'https://media.elcinema.com/uploads/_315x420_f31629d3cea06e193204e61666c1aa0f2bed5f9fdb6d5330cabe74d05aa6fab8.jpg', 'Alaa Elsherif', 'Egypt', '15 August 1975', NULL),
