('1982048', 'https://media.elcinema.com/uploads/_315x420_fef526e704d7a52980202c50b4cd2e145ab4bb4d66166b7711c9dc7c223e4d5a.jpg', 'Mohamed Abdul Rahman', 'Egypt', ' 1 August 1976', NULL),
('1982049', 'https://media.elcinema.com/uploads/_315x420_25c8a45c3effcf645c0430f40b8577fd9fa3e8a58f5001ec2590ad36dc5da2b8.jpg', 'Ahmed Farouk', 'Egypt', '20 January 1969', NULL),
('1982068', 'https://media.elcinema.com/uploads/_315x420_c4349f84becdc1af0fe0f82eeb42543bac94fd3bbb42a1888793faa91406a1c5.jpg', 'Mohammed Alaa', 'Egypt', ' 1 May 1982', 'Mohamed Alaa Jamaica is an Egyptian actor. He was born in Helwan in 1982, and started his professional career in 2005 in the television series “Al Rimal” (Sands). His debut film role was in the action film “Al Shayateen: Al Awda” (The Devils: The Return) with Sherif Monir. He then starred in the films including “Wahed/Sefr” (One/Zero) and “Tilk Al Ayam” (Those Days) and the television series “Al Hara” (The Alley), “Al Mowaten X” (Citizen X) and “Ser Alany” (Public Secret).'),
('1982230', 'https://media.elcinema.com/uploads/_315x420_4921c5c5b2ffce09cfb56685b3a90179efc77df6712455f5899fa1aacc9befab.jpg', 'Mohamed Ismail Amin', 'Egypt', NULL, NULL),
('1982231', 'https://media.elcinema.com/uploads/_315x420_fb633b4038f1177f830e0a5a9f8d43e9c7bb32457c10fa1ffa5f504bd431dd3c.jpg', 'Hisham Hilal', 'Egypt', '15 October 1983', 'Hesham Helal is an Egyptian screenwriter. He studied English language at the faculty of arts, and started his career as a teacher, after which he started participating as a staff writer in several comedy series and sit-coms. He then went on to create and write entire television series on his own, specializing in social/action/crime dramas, like \"Taraf Talet\" (Third Party), \"Taht El Ard\" (Underground) and \"Hawary Bucharest\" (Bucharest Alleys).'),
('1982233', 'https://media.elcinema.com/uploads/_315x420_f2a81e72aecd3028ed2f98394c545c81871dcbdea28531cb2a2a38f70579dfbf.jpg', 'Hamdy Nada', 'Egypt', ' 3 May 1964', NULL),
