('1982740', 'https://media.elcinema.com/uploads/_315x420_9d3637bddd36244e22f05b626e8b0216f410bc6a53243a27dc0630a4a73803c7.jpg', 'Mohamed Yahia', 'Egypt', '22 September 1980', 'Mohammed Yahya is an Egyptian music composer. He has worked with many Arab singing stars like Elissa, Amr Diab, and Carole Samaha. His breakthrough came with his first collaboration with Amr Diab in his album \"Leily Nahary\". Following his success with Amr Diab, Yahya started working with Egyptian stars like Samira Said and Mohamed Hamaqi. Yahya also composed the score for several television series, including \"Keid El Nesa 2\" and \"Baad El Foraa\'\".'),
