('1983002', 'https://media.elcinema.com/uploads/_315x420_264e06b16c7965c93c692ee84437547ced67357043f428e9c6d2668144aadd35.jpg', 'Reham Haggag', 'Egypt', '22 September 1986', 'Reham Hagag was born in Milano, Italy in 1986 to Egyptian parents, and she spent most of her life abroad, where she studied mass communication and worked in the marketing field for some time. Upon her return to Egypt, she started an acting career with her role in the film “Safari” in 2010, and in the same year she took a role in the TV series “Azmet Sokkar” (A Sugar Crisis) which was met with audience praise. In 2012 she portrayed the famous Egyptian belly dancer Samia Gamal in the biopic “Karioka.” Her role in the film “Ba\'d El Toufan” (After the Flood) was met with critical acclaim, and she won a prize for her role in the Marrakesh film festival.'),
