('1983842', 'https://media.elcinema.com/uploads/_315x420_cbad5cf4954330c3587ed5cb3cfcefba2a7b0eec31cc4e245417b87699d227b0.jpg', 'Muhammad Fouad', 'Egypt', NULL, NULL),
('1983846', 'https://media.elcinema.com/uploads/_315x420_a8665a84316522539fcdaa3200317d9984b737e592f638fd4cce67326ae47eb1.jpg', 'Raafat Elbauomy', 'Egypt', NULL, NULL),
('1983847', 'https://media.elcinema.com/uploads/_315x420_e903428d091e47b5dce101e112e3b6c6102424b68401fbeedeb525fb80bf3ab7.jpg', 'Donia Maher', 'Egypt', '15 November 1979', 'Donia Maher is an Egyptian actress. She was born in Cairo in 1979, and studied acting at the High Institute of Theatrical Arts. After her graduation, she acted on stage in several plays, until her breakthrough came with her role in the independent film “Al Khorug lel Nahar” (Coming Forth by Day), which was highly regarded in Egypt and many international film festivals. She then appeared in a highly praised role in the television series “Segn El Nesa” (Women\'s Prison).'),
('1983851', 'https://media.elcinema.com/uploads/_315x420_54526eea902282e3034176bc3b4bc113beb3e24303533063d3009ecd48862cd7.jpg', 'Ahmed Al-Shazly', 'Egypt', ' 6 March 1989', NULL),
('1983852', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'معتصم شعبان', 'Egypt', NULL, NULL),
('1983856', 'https://media.elcinema.com/uploads/_315x420_034b5865b2f2b499f871efe352052842439e5b75a6e4a0db03ad1e6183ad02b3.jpg', 'Karim Afify', 'Egypt', '24 November 1987', NULL),
('1983857', 'https://media.elcinema.com/uploads/_315x420_6aa7a6aa7902a0701ac3138d95cabf3e17a0391aa35441d20c6640acb023c064.jpg', 'Ali Rabie', 'Egypt', '29 March 1989', 'Ali Rabie is an Egyptian actor. He was born in 1989. He graduated from the faculty of commerce in Cairo, where he started his career as an actor on the faculty\'s stage and made 25 plays that participated in various acting and theater festivals across the country. He then joined the third class of Khaled Galal\'s acting school, where he participated in the plays “Ayna Ashbahy” (Where are my Ghosts?) and “Helw Elkalam” (Sweet Talk). Rabie\'s breakthrough came when he joined Ashraf Abdel Baky\'s theater show “Teatro Masr”. He also appeared in supporting roles in films by the comedy trio Shiko, Ahmed Fahmy and Hisham Maged (“Banat El Am” (Female Cousins) and “Elharb ElAlameya Eltalta” (The Third World War)), and their television series “Elragol Elennaab” (The Hibiscus Man)>'),
('1983862', 'https://media.elcinema.com/uploads/_315x420_847e580895b0ef193955e6cea93db8206235c20497bf1c59299b2cef53ca6ea6.jpg', 'Ahmed Al-Dubaiky', 'Egypt', NULL, NULL),
