('1983879', 'https://media.elcinema.com/uploads/_315x420_b0ba569bb4a2af7644bf5125318ae22160bd8f4c3cfea36087e9a99f26d13d91.jpg', 'Mohamed El Hagrasy', 'Egypt', '28 June 1976', NULL),
