('1990093', 'https://media.elcinema.com/uploads/_315x420_073d7bc67659da8c402ce6218922e63986e977a322dd0c55ee4647c6bc1476d7.jpg', 'Essam Al Wareeth', 'Egypt', NULL, NULL),
('1990162', 'https://media.elcinema.com/uploads/_315x420_9139e9eaa0fdd3295332392b6849685ea7d52ddb3bf15211266148f84e06c633.jpg', 'Mazen Said', 'Egypt', '25 October 1980', 'Mazen Saeed a young director who graduated from the university of media and journalism. He worked as a director and producer for a Lebanese channel  doing video clips for songs. In 2009 he directed the Permedia Production Company  and later on that year he built his own production company and produced his very own first documentary  called “18/11” portraying the real events between both Egyptian and Algerian football teams in Sudan. Later on he produced and acted in another documentary “114” portraying  the story of on of the Egyptian brigades in the 6th of  October war.'),
('1990178', 'https://media.elcinema.com/uploads/_315x420_a9be6b58c68e7121d9629e74e8b3f02da8055d9aa640d3dc5bccd306133c0343.jpg', 'Mrwan Erfan', 'Egypt', '18 August 1989', NULL),
('1990201', 'https://media.elcinema.com/uploads/_315x420_0d8bf2312d22509180ab69a4df620aafb6df0e49b4ab98aa097557d8ec2f0088.jpg', 'Wael Jassar', 'Lebanon', '22 November 1976', 'Lebanese singer born in 1972, started singing at a very young age. He sang at local parties and neighborhood events. He participated in a local contest and came first place as well as his participation in Al Fan Studio contest. \nHis first album was “Leaving” or “Mashi” which created massive success. Following that album was a long period of disappearance, he then returned stronger and with a bigger entrance singing opening titles for movies like his song “Rolette” for the movie “Chief Omar Harb”'),
