INSERT INTO `MOVIES` (`id`, `Name`, `img`, `age_rate`, `Release_date`, `Duration`, `Revenue`, `Rating`, `Description`) VALUES
('1010347', 'Aswar El Amar', 'https://media.elcinema.com/uploads/_315x420_e72c3fafe47b95a9b7d2992124b790d20168a50cae3c85254e60c530d6bd6c5b.jpg', 'All Ages', '24 January 2015', '120', '3127355', '7', 'After re-gaining her consciousness, Zeina is stupefied to find that she got blind and has lost her memory. She finds herself aboard a boat with Ahmed who gets involved in a serious boat chase with Rasheed. From her diary she slowly starts remembering the love triangle life in which she had two lovers who now seem to be in a death-inducing rivalry.'),
('1011138', 'Newspaper Talk', 'https://media.elcinema.com/uploads/_315x420_7a081d9905ada8923a7338003551ab07473d18dc91355452dfe371d20c852266.jpg', 'All Ages', ' 1 January 2014', '100', NULL, '4.6', 'A depiction of the problems caused by the rumors that newspapers spread about celebrities, through the story of a television presenter whose show, Newspaper Talk, causes her a lot of problems due to the news she discusses.'),
('1033398', 'Kafa alqamar', 'https://media.elcinema.com/uploads/_315x420_ef98e3a8af62b5c62c20845c97465e8e1787fcaeb21d916d75d4a8eabc42eacf.jpg', NULL, ' 2 November 2011', '122', '4729225', '5.6', 'Following the death of her husband, Amar is left to carry out her deceased husband’s dream of building a brick house with her five children. The five boys move to Cairo to earn some money, but they struggle to make ends meet and achieve their dreams in the capital.'),
('1053377', 'Wahid Saheeh', 'https://media.elcinema.com/uploads/_315x420_d2a617328524a9ff703eba61de6734b3d748b9c7b51825ee1a929cefdcdb0b98.jpg', NULL, '11 December 2011', '100', '4696880', '6.2', 'Abdullah\'s mother tries to convince him to marry, but he  has an affair with businesswoman Farida, while reporter Maryam seeks to marry him. His ex-girlfriend Nadine tries to get him back after her separation from her husband, but Abdullah doesn\'t care about them as he\'s in love with the Christian girl Amira.'),
('1056748', 'El- Haram Street', 'https://media.elcinema.com/uploads/_315x420_6b1066fc9856171e35f77d0847ab58c11eab902fbdb251a70bee8f0524551a9e.jpg', NULL, '30 August 2011', '95', '12736549', '4.2', 'A dancer leaves a folklore troupe to work in a nightclub on El-Haram street. Three men get into a conflict over her. Which one will she choose?'),
('1064773', 'Tita Rahiba', 'https://media.elcinema.com/uploads/_315x420_2d559cbcbd1d1c2303ca3dde756aa3426e93b581dc4ad5fdd3241a7f071141d9.jpg', NULL, '19 August 2012', '100', '14825470', '6.3', 'After his grandfather\'s death, Raouf\'s domineering grandmother returns to Egypt, and her stay with her grandson stands in the way of his aspirations. How will he cope?'),
('1068941', '365 Days of Happiness', 'https://media.elcinema.com/uploads/_315x420_5c829d891643cbef1236f012c4146d1b109bbab67bccacab507ff2d1661d1985.jpg', '+12', '26 January 2011', '130', '8132866', '7', 'A romantic comedy, about a playboy, Hady, who refuses to get married until he encounters a charming girl, Nesma, and falls for her.'),
('1069375', 'Al-Fgomi', 'https://media.elcinema.com/uploads/_315x420_186d9152eb62c49822bb87697d38a9a9735cfa2e0e527f312793e5b7df4594e2.jpg', NULL, ' 1 June 2011', '95', '542840', '6.6', 'A biography about Ahmed Fouad Negm, the famous poet of the Egyptian colloquial, depicting the important historical and revolutionary stages, from his struggle fighting the English occupation and political oppression, to his imprisonment and his relationship with his companion the composer Sheikh Imam Issa.'),
('1077548', 'Haz West Al-Balad', 'https://media.elcinema.com/uploads/_315x420_071243f7419ca9825b73eec9ce6645ed9428e92c73983c4e53874eb0d5b2462f.jpg', NULL, '25 January 2015', '112', '549309', '4', 'Set in the span of eight hours in the region of downtown Cairo, exploring the variety of characters present in the busy area, and several problems they face in their daily lives, in addition to the economical crisis the whole country is facing.'),
('1079361', 'Got a Minute?', 'https://media.elcinema.com/uploads/_315x420_2c5c6a23155001b846494b5cd8d80267d52266a541bc7aaddab729378ef7ea23.jpg', NULL, ' 1 January 2011', '9', NULL, '3.8', 'The story revolves around the unemployment problem and how society has turned into a group of sellers without a single buyer. We find the protagonist being subjected to many harassments from sellers who turn his dreams into nightmares.'),
('1090254', 'Bibo and Beshir', 'https://media.elcinema.com/uploads/_315x420_ca874c0e91c2d473430b3a5be4da972c0893b4d679bde1db3864b3472f541066.jpg', NULL, '30 August 2011', '119', '7447970', '7.3', 'Bashir is an Egyptian young man who lived a big part of his life in Africa, when he returns to Egypt, he starts a friendship with Bebo, then they discover that they share the same apartment.'),
('1098370', 'Fasel Wa Na‘oud', 'https://media.elcinema.com/uploads/_315x420_e5c1b63639ae4f1580f49a4fd8b00b085a6113c4eadd9bfd7248885af9715747.jpg', NULL, '19 January 2011', '104', '8452410', '8.3', 'A taxi driver, Araby (Karim Abdel Aziz) goes to battle with his father-in-law over the custody of his son after Araby is widowed. Though he wins custody, his son is kidnapped and Araby is attacked, losing his memory in the process.'),
('1127441', 'علاقات خطرة', 'https://media.elcinema.com/uploads/_315x420_2ce3f0fd375325f56e9af4224a4e09d29efd4dae38e30868c54170b81182fe72.jpg', NULL, NULL, '90', NULL, '5', NULL),
('1140013', 'Microphone', 'https://media.elcinema.com/uploads/_315x420_7408d1bba213e0d3c7fcc86759bc9b923a210b76621cffe6f427914ec6e40307.jpg', NULL, '26 January 2011', '120', NULL, '8.2', 'Khaled returns to Alexandria after being away in the US to work things out with his beloved and his father. But he finds his love is about to travel and his relationship with hisis father has reached a dead end. He stumbles upon a group of young people with their own style and he gets mixed up in this new world.'),
('1166163', 'Me Or Him', 'https://media.elcinema.com/uploads/_315x420_5f033e985086e3e9eef92f0f2fda74fc32e9121378b7d83bbc559493d8c9ed48.jpg', NULL, ' 1 September 2011', '89', '2116870', '4.3', 'A comedy that revolves around a journalist who faces many problems because of his \"Schizophrenia\", as he tries hard to defeat the evil side of him.'),
('1173494', 'Banat ElA\'m', 'https://media.elcinema.com/uploads/_315x420_5b68a45fa34cf3d917f16a3f28a3ae6a4b819cc385a7c1e8ee29b28ced513a18.jpg', NULL, '26 January 2012', '100', '13223680', '7.3', 'Three girls live with their grandmother, are looking to sell the palace in which they live, but their grandmother warns them against it. They get cursed and turn into three men, and throughout the events they seek to return the palace to break the curse.'),
('1178712', 'Haflet Montasaf El-Leil', 'https://media.elcinema.com/uploads/_315x420_35e8fb0a4ccf193dd4fad4008f328a420c2b7f7d96daae418824ce5293ec8d92.jpg', 'All Ages', '26 December 2012', '85', '1459800', '5.8', 'Shahd throws a party in her villa and invites many of her friends, everyone is surprised by strange things that starts happening, as Shahd locks them inside the villa to find out the woman who had an affair with her husband.'),
('1198595', 'Rad Fe\'l', 'https://media.elcinema.com/uploads/_315x420_dc5c72e7d77008b8a39b47058eed72987028d036f0d7ebf488fc05326e1a5106.jpg', NULL, '28 March 2012', '90', '1533980', '5.8', 'Officer Hassan investigates a murder, using the help of forensic doctor Saad al-Dumairi, who confirms that there is no criminal suspicion in the death, then several murders happen in the same building, and Radwa, the researcher in Family crimes, helps them solve the case and uncovers a shocking conclusion.'),
('1205892', 'EUC', 'https://media.elcinema.com/uploads/_315x420_78687889873e4811ca240c4e41d2321184be5a7310e914f004576beaba68631c.jpg', NULL, '30 March 2011', '122', '2614880', '6.4', 'A group of youngsters establishes a private university after failing to get high grades in high school. They reveal through this university a lot of errors and constraints in the educational system in Egypt, which affect even their personal lives.'),
('1210825', 'Gowa El Le\'ba', 'https://media.elcinema.com/uploads/_315x420_d9298501b6578086db76fe8dba3202962e3f375811be447a34afd16f4e45d254.jpg', NULL, '24 October 2012', '109', '541590', '4.3', 'This thriller revolves around the director of an ad agency who is accused of involvement in a murder, as he sets out to clear his name.'),
('1242904', 'X Large', 'https://media.elcinema.com/uploads/_315x420_75ffb46ed95b519c0ac408410be322dd9a8aa66c9dbd9d8f42c54fd653078b82.jpg', 'All Ages', ' 2 November 2011', '130', '30226320', '7.7', 'Magdy is an overweight man who suffers from loneliness, in spite of having many friends who prefer talking to him about their problems, his obesity makes them not think of him as a husband. But when he meets his childhood friend Dina, he tries to get closer to her but discovers that she took him as a case for her research in the University.'),
('1263843', 'Knocking on the Doors', 'https://media.elcinema.com/uploads/_315x420_d6ca3608fc14bec32b562ed364de6f8260e117d568f6a7b537357752b925db0f.jpg', NULL, ' 1 January 2012', '45', NULL, '5.6', 'A film about the complicated relationships between a group of people of different backgrounds, asking a number of big questions over its five acts.'),
('1275307', 'Harag we Marag', 'https://media.elcinema.com/uploads/_315x420_e732e86cf99a4e35b1329e3b298972c097bc015e4f64f2e5597e2f65578e3362.jpg', 'All Ages', ' 5 June 2013', '87', '359070', '5.8', 'This social fantasy revolves around a love triangle as Zaki and Mounir try desperately to win the heart of Manal, while all three struggle to realize their dreams and meet their basic needs in spite of what\'s going on in the country.'),
('1279210', 'Al-Markib', 'https://media.elcinema.com/uploads/_315x420_798c75ceec1dc22b701db521cea279096dd8d6807023d7ed692bbcd722ebeb66.jpg', NULL, '22 June 2011', '113', '177830', '8.1', 'A group of friends are spending a day out in the sea on a boat when unforeseen circumstances force them to stay longer than anticipated. While waiting to be rescued, each one of them reveals their story which highlights their inner struggles.'),
('1289005', 'El Shoa\'', 'https://media.elcinema.com/uploads/_315x420_c25f6f452ab74e8dfe3316d05a02a876ac2058eea19313eaad9a7dad744c7b68.jpg', NULL, ' 5 January 2011', '134', '841405', '6.4', 'In Alexandria, Fatma needs money for her youngest son\'s weekly kidney dialysis. She travels to Cairo to beg away from home, after she collects enough money she returns to discover her son\'s death. She decides to protect her two daughters from poverty so she returns to Cairo to continue to beg.'),
('1294243', 'El Haramy wel Abeet', 'https://media.elcinema.com/uploads/_315x420_7aa19972d2615c7a86d56f6e339ea1ac12fb3b6ce7bb80d8e60dae88369b97aa.jpg', 'All Ages', '22 May 2013', '100', '3488034', '7.4', 'Fathi, a foolish man down on his luck is befriended by Salah, who lost his eye in a brawl. Little does he know that Salah is scheming to steal his eye and has enlisted the help of his nurse friend (Ruby), who works in an organ-trading hospital.'),
('1334680', 'Abdo Motah', 'https://media.elcinema.com/uploads/_315x420_c1ac901dde8e0630321a9678738ca61c76f7e0b520bdb4f592fc0421e48d60d4.jpg', 'All Ages', '24 October 2012', '90', '22447720', '5.4', 'Abdo (Mohamed Ramadan) is a thug working in the drug trade after losing his parents, using force to impose royalties on the people of the neighborhood, while Angham (Houria Farghali) is looking to marry him, and  the dancer Rabyia (Dina)  has an affair with him, and so is his cousin Alyia (Rehab al-Jamal).'),
('1341537', 'Wahed Sa\'idy', 'https://media.elcinema.com/uploads/_315x420_c75477406733c895ad6e6f52aa0031a286ea7991e2965f0bcf783db2a0992c34.jpg', 'All Ages', ' 2 October 2014', '85', '14731155', '4.5', 'A man from Upper Egypt (Mohamed Ramadan) leaves his hometown and goes to Cairo in search for a living. He manages to get a job as a security guard at a hotel. When he accidentally knows that a guest named Samah is going to get killed, he tries to stop this from happening.'),
('1373354', 'Bartita', 'https://media.elcinema.com/uploads/_315x420_ea245f45565e1261d6c1eb0246e0034e349d66f24aced5c49cb351f69ace46a3.jpg', NULL, '24 October 2012', '82', '1281460', '6.7', 'The film revolves around a girl who suffers psychological problems because of her family. She meets a crew of characters who help her change her life.'),
('1390468', 'Saeat wans', 'https://media.elcinema.com/uploads/_315x420_9875dd321801ff869bae0c826a1af83e0ef0f51b3481c63dc117bb694e046677.jpg', 'All Ages', ' 3 October 2012', '126', '8899700', '8.7', 'Based on the Ayyat train accident that killed 361 people in 2002, this ensemble drama delves into the intense human stories of the passengers in a third-class coach car during the hour and a half before the crash.'),
('1399339', 'El Khoroug', 'https://media.elcinema.com/uploads/_315x420_ffbc970c4051d05eef68f20e9acf262f973da4e724211743eb896fb64aefac9e.jpg', '+18', '17 December 2010', '100', NULL, '5.7', 'A raw depiction of life in modern-day Cairo about an ill-fated romance between a Coptic girl, Amal, and a Muslim youth named Tarek. Much like many other young men his age Tarek dreams of travelling abroad in order to realize the dreams that have thus far eluded him in Egypt.'),
('1411403', 'Geddo Habiby', 'https://media.elcinema.com/uploads/_315x420_2df0c1d8bf0992aa7bcc8762118d8298a8e391c2b9315a1cf0a2716029de0417.jpg', NULL, ' 1 February 2012', '120', '1267750', '6.6', 'After she learns that her grandfather\'s health condition is not well, Fekriya returns to Egypt hoping to enjoy his wealth after she lost her money at the stock market. They get into comedic situations as she helps him find his old sweetheart, while she falls for his grandson.'),
('1416070', 'Omar wa Salma 3', 'https://media.elcinema.com/uploads/_315x420_7f4591e347d2709c39713b11096100e2e3cbd68dd8c5253890347b630f68c4f6.jpg', 'All Ages', '11 January 2012', '96', '16151520', '7', 'Omar and Salma learn that their daughters have been kidnapped by a mafia cell based in South Africa compelling the pair to undergo a series of adventures in that part of the world.'),
('1445314', 'Cry of An Ant', 'https://media.elcinema.com/uploads/_315x420_d3f14d197c7f948d7a22db7beb60aabcd690a36aea14c56e1ed0e6739418633e.jpg', NULL, ' 2 June 2011', '107', '2677660', '7', 'Gouda suffers from tough living conditions as he lives in the slums. He is forced to work for one of the parliament’s deputies, who exploits him in his corruption. He implicates himself in several problems and tries to prove his innocence.'),
('1453872', 'al-Share3 Lana', 'https://media.elcinema.com/uploads/_315x420_aeca44785f5c9db0c9d2aef6f237ea7237b334b58d793cc23a83254d50031dd7.jpg', 'Family (all ages)', NULL, '47', NULL, '4.5', 'This title discusses the climate of corruption which was prevalent prior to the revolution. Screenwriter Nasser ‘Abd Al Rahman had concluded writing the script some time ago so that director Khaled Youssif could commence filming following the conclusion of work on his latest title “Kaff al-Qammar” (“Palm of the Moon”). However the historic events which took place in Egypt beginning on the 25th of January have necessitated some revisions. One such alteration has meant that the film will now feature the revolution in its conclusion.'),
('1476116', 'Lamah albasar', 'https://media.elcinema.com/uploads/_315x420_21d438422d9b794e1676995b764ae07ae120068b98669acf8c40dba62bd6ee19.jpg', NULL, '20 June 2012', '90', '56470', '6', 'Fouad is a very ambitious young man who meets the experienced and much older businessman, Gaber. Fouad becomes certain that Gaber will help him fulfill his dreams and goes with him to a trip but he rediscovers many of the facts he didn\'t know before.'),
('1479180', 'Ya Tahadi Ya Taadi', 'https://media.elcinema.com/uploads/_315x420_bad73cf59c0ea5dec259ee32e3a1f0d3a9170bafcb2bb7594d0d0c73690b73ed.jpg', 'All Ages', '22 February 2017', '90', '615308', '5.9', 'Hany is looking for a good driving instructor for his mother. He receives a recommendation to hire Hend (Ayten Amer), he soon starts falling in love with her , despite his mother\'s objection to her social level. Then Hend finds herself in an unenviable position.'),
('1488293', 'Yabani Asli', 'https://media.elcinema.com/uploads/_315x420_715efac5f15d09d0772b25024c3af301d0bcf08689f9cde2c7ad22fe609d76aa.jpg', 'All Ages', '18 January 2017', '96', '7369117', '6.4', 'Muharram falls in love with a Japanese diplomat named Sakura, they get married and have twins.  But she returns to Japan with the kids without his knowledge because of the difficult living conditions. Seven years later, they reach an agreement that the children come for six months to stay with him, but under conditions.'),
('1521400', 'Garconiera', 'https://media.elcinema.com/uploads/_315x420_3ed9bd8e5f2953d4a36cef40b0a9018a8f26125d145a709bd1c6277e8b054587.jpg', 'Adults Only (18+)', '28 December 2013', '90', '2570783', '6.5', 'Set in a single location, an appartment that its owner call the Garconira, a thrilling sequence of events take place between three characters, the diplomat, his muse and a thief breaking into the appartment.'),
('1522922', 'The Elephant in a Handkerchief: Said Harakat', 'https://media.elcinema.com/uploads/_315x420_3097a24eb4f67edbabc90f3135c99e8ba75ad5c2da4f56bde1c0a3dee9acf57f.jpg', NULL, '16 June 2011', '86', '555320', '3.8', 'The fruit vendor Saeed Harakat is assigned to a large national mission, after which he turns into a national hero. On the other hand, officer Ramy Waheed is in charge of discovering a nuclear reactor in Israel and is trying to find data related to the operation.'),
('1537236', 'Eza\'et Hobb', 'https://media.elcinema.com/uploads/_315x420_8157abb024fae74c15a751f66dba26989b73e9535ac16bc96fed830fa811da8b.jpg', NULL, '28 June 2011', '97', '4576530', '7.3', 'A rom-com movie, that shows how people choose voluntarily to hide behind phony masks  so as to cover their real personalities.'),
('1569471', 'Akher Ayam Al-Madina', 'https://media.elcinema.com/uploads/_315x420_490e7677b6ec6f6d987aec9f1e98b9e977a79f3944547c70a416dad1c6a76cfb.jpg', NULL, NULL, '118', NULL, '6.2', 'In 2009, the majestic Cairo is the subject of Khaled\'s film-making plan, with a special focus on its people\'s hopes and dreams. He reminisces about his childhood when his city was picturesque and fabulous. Meanwhile, Khaled risks being evicted and his beloved wants to immigrate outside Egypt.'),
('1609015', 'Al-Leila Al-Kebira', 'https://media.elcinema.com/uploads/_315x420_8e77ba17cbfd265b53f596c2783bdb7e9cbfa93cc03d27e5f4213b8de16077c6.jpg', NULL, ' 2 December 2015', '123', '2889804', '5.6', 'Spanning one day, the film takes place in a “Muled” (An Islamic saint\'s day celebration), following the curious and intertwined stories of a variety of different characters living nearby, working in or visiting the Muled.'),
('1633762', 'ترانزيت', 'https://media.elcinema.com/uploads/_315x420_ad993d0bad2ddc728d6dd8e2c0819807a38808e4408045b484ff431d48305fb2.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('1644198', 'Al-Maslaha', 'https://media.elcinema.com/uploads/_315x420_f4bbb27f8f6a248e0dff6612bde0a33f84ce85fc8dcad0b8cd29dd18f2ee4403.jpg', NULL, '16 May 2012', '114', '21754490', '8.2', 'Police officer Hamza requests his transfer to the Anti-Narcotics Administration, following the killing of his brother by Suleiman Al-Muslimi. He monitors his brother Salem, the big drug dealer, who smuggled Suleiman and fabricated a charge for Hamza\'s wife.'),
('1716943', 'One One Four', 'https://media.elcinema.com/uploads/_315x420_763ae7a6cbedbb6f0e9504eff8252bba52b65084a01c88cb6a03cbd6e37119d9.jpg', NULL, NULL, NULL, NULL, '5.8', NULL),
('1724389', 'Yoam Lel Settat', 'https://media.elcinema.com/uploads/_315x420_397e6d3b998ca42d4180ae65a26ea6f3c533cdf7ead6ec9895a5a73f98d97a0b.jpg', '+16', '15 November 2016', '111', '1205435', '5.1', 'The news about opening a new swimming pool at a local community wins the excitement of women who come from different social backgrounds. At the pool, Laila starts seeking consolation for losing her son, while Shamiya looks for empathetic listeners to her personal life\'s stories and Azza is simply joyful about putting on a swimming suit for the first time at this all-women gathering!'),
('1778748', 'Ali Baba', 'https://media.elcinema.com/uploads/_315x420_806ee63f77612ee2458e63c5864d5d83804013bf1514af38d6d888ae0e6731ad.jpg', '+16', '28 March 2018', '110', '10831302', '5.8', 'Ali is an opportunistic person who only cares about his own interests, even at the expense of others. When he discovers that he has a daughter in her twenties, he experiences a number of comedic paradoxes.'),
('1799229', 'Shaqawet Banat Shubra', 'https://media.elcinema.com/uploads/_315x420_e2c5e4b546b8a89c6bab978991d437dda3c07ad2dfa4c0ea1480d7a873baabc4.jpg', NULL, ' 2 January 2012', '90', NULL, '4.6', 'Two women work at a hospital owned by a corrupt businessman who trades in human organs, and tests new medications on patients. When one of the doctors discovers this, she attempts to inform the authorities, resulting in a grim murder and a threat to two witnesses.'),
('1810634', 'Samy Carbon Oxide', 'https://media.elcinema.com/uploads/_315x420_11c4d498e5bc4b2ae8cc8b0200683c2d2eac4bc4186ee73559705dde3c6a8d1f.jpg', NULL, ' 8 June 2011', '110', '8404950', '5.6', 'Jihan opposes the prevalent injustice and corruption that surrounds her. When she meets the pilot Samy, she is turned off by his self-centered view and careless attitude. But when love blossoms between them, Samy tries to get involved in her world and interests.'),
('1840913', 'Ana Badea Ya Wadia', 'https://media.elcinema.com/uploads/_315x420_771aa61ca9f7c7881929bfcb66bc6246750faf004170fc71d7aad8c43fc7f72e.jpg', NULL, '30 August 2011', '90', '3317420', '7', 'When Tohamy Pasha, a producer, tries to find a way to evade taxes, his associate Wadi\' comes up with an unusual idea: to produce a bad movie that the audience won\'t see.'),
('1849452', 'Asmaa', 'https://media.elcinema.com/uploads/_315x420_20eeba3d2e670dd35fddc2d776a4c1acc0ad63e9682bf2ea03035ac600e80508.jpg', NULL, ' 7 December 2011', '96', '893710', '8.2', 'When Asmaa contracts AIDS, she refuses to surrender to her illness and rather chooses to fight, whether by seeking treatment or by inspiring hope in those afflicted by the same disease.'),
('1899554', 'Hello...Cairo', 'https://media.elcinema.com/uploads/_315x420_dc6365c1ad33837da6cd1eaf8d521b6be052c92da82027b50248bb1746b1f396.jpg', NULL, '27 January 2011', '107', NULL, '6.2', 'A comedy that conveys a humane message about Egypt\'s place as the refuge for any Arab citizen that loses their way due to strenuous circumstances and how Egypt will always help the Arabs, regardless of their country of origin.'),
('2003806', 'Illa Khamsa', 'https://media.elcinema.com/uploads/_315x420_cf71139f2515c94b5a1c0854ae2147bffa2fc377d865152f2c2661675e6c6b6d.jpg', NULL, ' 1 January 2012', '92', NULL, '4.5', 'A young man from a wealthy family loves a poor girl and decides to marry her; but his mother refuses and he marries his cousin. He agrees with his sweetheart, who was also married to congratulate each other on their birthday every year.'),
('2003869', 'Haddotah Mn Saaj', 'https://media.elcinema.com/uploads/_315x420_ed7b395cf01228dedfb5ce6c619ef78ba487930ae74a8c4b5697d89236127ed2.jpg', NULL, ' 1 January 2011', '22', NULL, '5.3', 'A short film based on a true story of a troubled young girl named Mona Farkha, as she recounts to the screenwriter Omar Khaled and director Aida El Kashef her difficult life story leading up to her becoming a prostitute.'),
('2003875', 'صعبة', 'https://media.elcinema.com/uploads/_315x420_c13b8f9395770134f5be54119e2235f96e717903c9c2a9c168b218af72104f54.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2003922', 'Wa Baad El Tofan', 'https://media.elcinema.com/uploads/_315x420_99562405988019b8b456ff8f833fcd0da8e1b238c4f186991e053f2a50105613.jpg', 'All Ages', '18 December 2013', '100', '51906', '5.4', 'A psychologist conducts a study on a group of corrupt ministers to uncover the psychological reasons that led them to this path. As she follows the different stages of their lives and the events that followed their appointment to office, unexpected events turn everyone\'s lives upside down.'),
('2003980', '18 Youm', 'https://media.elcinema.com/uploads/_315x420_88274f7ade8c1818b29fcdd46abbd0b9530b3f4af9e96f91f34098b3308ecad8.jpg', '+18', NULL, '125', NULL, '7.4', 'A series of short films, each of them covering a different facet of the 18 days between the outbreak of the Egyptian revolution of 2011 and President Hosni Mubarak\'s decision to step down, whether from inside or outside Tahrir Square.'),
('2004777', 'Ana wel Agenda', 'https://media.elcinema.com/uploads/_315x420_779df2473dc724268fda96321dc74fc131c8986675dc97e329f6344e972437d8.jpg', 'Family (all ages)', '16 May 2012', '47', NULL, '0', NULL),
('2004879', 'million to Ethiopia', 'https://media.elcinema.com/uploads/_315x420_96c2deb9fae2b4c35d619a54aa25d93191771ab33169238066e9d7bc45e1142f.jpg', NULL, ' 1 January 2011', '30', NULL, '0', NULL),
('2005011', 'حكاية مصرية', 'https://media.elcinema.com/uploads/_315x420_aa7e509eab24eb0fd0ad7b3ed136ab8a5b0d129502b0620479987e5ded7a93f1.jpg', NULL, NULL, NULL, NULL, '4.7', NULL),
('2005087', 'Reklam', 'https://media.elcinema.com/uploads/_315x420_0c107b11b091ef5fc13543fee79adba6dc5c138754f4935df5169452312ba309.jpg', '+18', '15 February 2012', '107', '4758400', '4.2', 'Shadyia is forced to marry a drug dealer, and from here her life begins to decline after her husband is arrested.  She meets three other girls ,Dawlat, Shukryia and Suzy, who are also going a dark path.'),
('2005249', 'El Sheta Eli Fat', 'https://media.elcinema.com/uploads/_315x420_2f632c88f1f360e4e93701e0ccd9835a9dc3eb5dd69edc61545334ab051229bb.jpg', 'All Ages', '20 March 2013', '92', '310637', '6.9', 'Set during the Egyptian revolution of 2011, this drama moves between the interlocking lives of a state security officer, a television anchor, and a computer engineer with ties to the youth who inspired the revolution, displaying the reasons that led to the rise of corruption in the past 30 years.'),
('2005450', 'Fokak Menny', 'https://media.elcinema.com/uploads/_315x420_3ddd8b8d68d01477069e4347580d50ceda1420c8d4bbb49108c2b33dc01d61ec.jpg', NULL, '29 June 2011', '93', '604930', '3.5', 'Walid is a college student who wants to join the Arts Academy. But his father, a diplomat, wants him to go abroad to complete his political and economics studies. As his dreams go against his father\'s wishes, Walid enlists the help of their maid, Donia, to help with his graduation project.'),
('2005518', 'Qalb El-Assad', 'https://media.elcinema.com/uploads/_315x420_c360bf0b28d9cf0db782aec63a645379ccf4f9f24a3877fd18f687efe0ee3349.jpg', 'All Ages', ' 7 August 2013', '116', '16438526', '6.6', 'This action thriller set in a dark criminal underworld revolves around the tough, self-reliant Faris, who was kidnapped as a child and raised at the circus among the lions and the tigers. Faris now works at the circus as a lion tamer, but gets sucked into a murder mystery.'),
('2005521', 'Tek Tek Boom', 'https://media.elcinema.com/uploads/_315x420_eaa1432fadbd14b3ba4f3d6627a97161273d6781193c97b577a9710f89f6a7f9.jpg', 'All Ages', '30 August 2011', '117', '8609330', '5.2', 'Tika, the owner of a toy store, lives in a local area. When the Egyptian revolution of 2011 breaks out, he rallies the youth of his neighborhood to form a neighborhood watch to stand up to thugs.'),
('2005930', 'Zigzag', 'https://media.elcinema.com/uploads/_315x420_5d0528c1bd72480959deff777434b30fb38618315d357d9e702fede043c493c3.jpg', 'All Ages', '24 December 2014', '150', '982512', '4.3', 'A social drama about four middle-class girls who lead simple lives with their families. Although they have independent love relationships and face the challenges that common people face in their daily lives, they work at an unexpected place that helps to financially support them and their families: A five-star discotheque.'),
('2005931', 'Tahrir 2011: The Good, The Bad and The Politician', 'https://media.elcinema.com/uploads/_315x420_31cd657486478a9a67a0c5981e70569a154c6f9b0e9da14cb58eab50f5def6e8.jpg', NULL, ' 7 December 2011', '100', '45070', '7.2', 'A documentary protraying 3 different perspectives of the egyptian revolution made by 3 different directors.'),
('2005960', 'Baad Al Mawkea', 'https://media.elcinema.com/uploads/_315x420_7fd7f8f0c57ce20a9652c1c6602f7ed1aaaeff0b60a4742e876ea68bdc79165e.jpg', 'All Ages', '19 September 2012', '116', '969370', '6.5', 'Reem is a young political activist who works for an advertisement company. As she tries to uncover the truth behind the incide of the Battle of the Camel, she accompanies her friend Farah to Nazlet Al Seman where she meets and falls for Mahmoud, one of the people involved in the incident.'),
('2006077', 'جرح سطحي', 'https://media.elcinema.com/uploads/_315x420_362adb2d6d966cc46be9aed493454fb5f08f1d0d23308214ecb5f22b5fd61988.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2006532', 'Ghesh El Zawgeya', 'https://media.elcinema.com/uploads/_315x420_51780de0b2c579782c04aabe80514e5f0f75077b2dc8686ffa9b26cade3d02a1.jpg', NULL, '20 June 2012', '110', '8715260', '6.7', 'Salem is a playboy known for his multi-womanizing. He has a good relationship with the manager of his father\'s company. Salem is so spoiled that he can get as much money as he wants and spend it on his girl friends. His father and his wife discover his playboy antics and the events escalate in a comic atmosphere.'),
('2006601', 'Dawlat Security', 'https://media.elcinema.com/uploads/_315x420_bac64c7b8fa68a7f56a9769358e40c6c57f9e9a245ffd1f201fce93e5b6ba780.jpg', NULL, ' 5 November 2011', '104', '5891890', '3.5', 'Hossam is a state security officer whose new mission lands him in an unexpected situation. When he is assigned to protect the family of the UN ambassador Dawlat from Israeli threats, he finds himself teaming up with Malak, the babysitter of Dawlat\'s children, to save the family'),
('2006732', 'Cima Ali Baba', 'https://media.elcinema.com/uploads/_315x420_a99fd581477b706db2d4c29860ae9e73ee7ad0d9df9df5d36876c32073adfd24.jpg', NULL, ' 2 November 2011', '120', '7731300', '5.9', 'The first part of the moves covers the story of Hazaloum who impersonates the identity of the leader of the planet Revo who looks just like him. In the second part, a rooster tries to protect the farm animals from the wolves and hyenas that threaten the farm and force them to pay them money.'),
('2006874', 'Mosawer Qateel', 'https://media.elcinema.com/uploads/_315x420_16d64aa7d0d100e6bec0bb15253190f98ad5823abfce571b80fca28fc51b0ea4.jpg', 'All Ages', ' 5 December 2012', '95', '1299720', '7.2', 'A photojournalist bears witness to a murder and takes photos of the incident, only to find himself involved in the crime. When he becomes a suspect, it\'s up to him to prove his innocence.'),
('2006903', 'Helm Aziz', 'https://media.elcinema.com/uploads/_315x420_408581f86dd8e19567bdfc120bc6a1f8d28eb9e4767b9f744e673d60a746727a.jpg', NULL, ' 6 June 2012', '110', '9344360', '7.6', 'Aziz is a businessman who seeks to achieve his dreams at any cost, using his power and influence to further his interests without a care about anyone or anything. But fate lands him in a situation that turns his life upside down and forces him to change his lifestyle. What prompted that change?'),
('2007223', 'Tom wa Jimmy', 'https://media.elcinema.com/uploads/_315x420_b4a02e2d3f6d087ae96a3383079649febbea5f3f942d8c296579eefce6be39ed.jpg', 'All Ages', ' 7 August 2013', '88', '747325', '5.4', 'The story of a grown man who is developmentally disabled. Despite having the physical appearance of an adult, his mental capacity is that of a 7-year-old child. As he goes through various situations, his admirable characteristics shine right through, as do the characteristics of those around him.'),
('2007825', 'Febrayer Al-Aswad', 'https://media.elcinema.com/uploads/_315x420_b0cb05eec47d9b9cd5a6a6183cacb36a9ee586d316240495de2e9e9d7f706527.jpg', 'All Ages', ' 6 March 2013', '117', '2364321', '8', 'Hassan is a college professor and his brother Tarek is a chemist who ends up working at a pickle factory. When tragedy strikes, both brothers consider either leaving the country with their families or marrying their children off to wealthy spouses.'),
('2007909', 'Taw’am Rouhy', 'https://media.elcinema.com/uploads/_315x420_fcfa90c5ba1fafad00bdb9c8498e7e5ba531d2dbb9f857461fc527f40f6c06b2.jpg', 'All Ages', '19 August 2020', '103', '13801843', '7.5', 'A romantic film presenting a love story that is both sweet and bitter. Can love be found amidst clashes and troubles?'),
('2008130', 'El Almany', 'https://media.elcinema.com/uploads/_315x420_a9721ebfae86ebf4d90fb4db4f650be1b98b0d3485a1672009fbc4b958ae4775.jpg', NULL, '26 June 2012', '130', '1766660', '4.7', 'A registered felon, known as Al-Almany, lives in the slums and tries to find his way out by any means necessary, including criminal acts and harassment.'),
('2008157', 'Ala Wahda Wa Nos', 'https://media.elcinema.com/uploads/_315x420_b2e5c79300b6e8b79d7b81e14c4ffcbe3cbac84983c4ee1126b0e53a84d60e4e.jpg', NULL, '14 March 2012', '80', '126840', '3.5', 'Horia\'s  (Sama El Masry) aunt\'s husband tries to rape her, and she runs away. She works as a journalist, and the newspaper editor, Marwan, forces her to participate in questionable acts. At first, she refuses, but Akram (Reda Edres) deceives her and makes her sign on a customary marriage contract as a work contract. She finds herself trapped and works as a dancer in a night club where she discovers a monuments smuggling operation.'),
('2008207', 'Hazz Sa\'id', 'https://media.elcinema.com/uploads/_315x420_56a9e311c7e390c776be8005d1fc7231d190dbee6a0d622a1890817b4cf0e740.jpg', NULL, '21 March 2012', '106', '2382110', '5.5', 'Sa\'ied is trying to wed his fiancé Samah but he has trouble finding an apartment. When he finally reserves an apartment in a government project, the 2011 revolution breaks out and he is unable to receive it. Hopeless and defeated, he finds himself joining the protests in the streets.'),
('2008275', 'SIRA', 'https://media.elcinema.com/uploads/_315x420_f727380e464cb1276d6e4aa16f84407b352a7d08050afe248fe82f7aff13a6d2.jpg', NULL, '24 November 2011', NULL, NULL, '0', NULL),
('2008377', 'The Bar', 'https://media.elcinema.com/uploads/_315x420_be96059bee07ce25dd4aad9d621f742b9b9ca9e43f14c9599d20bf831fbc8feb.jpg', '+18', '19 August 2012', '95', '1013240', '3.2', 'The story of four girls who work in a bar, including the problems they face, the disputes they have due to their different personalities and backgrounds, and their troubles with the guy who has control of their lives.'),
('2008574', '1/2 Revolution', 'https://media.elcinema.com/uploads/_315x420_4333c8d31be082123504412d70c3eb07797a75b9413ce957d03486d3b807d002.jpg', NULL, NULL, '5', NULL, '0', NULL),
('2008578', 'Settou Zad, My first passion', 'https://media.elcinema.com/uploads/_315x420_576750170a09476efa6f70060d495c3ecedc865b8f186c2c44d0fdf6faed376e.jpg', NULL, '17 April 2013', '82', NULL, '0', 'The movie tells the story of the artistic life of \"Shahrazad\" through the details provided by her granddaughter.'),
('2008633', 'zafeir', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, ' 8 April 2012', '19', NULL, '6', 'Nothing is heard through that far away window, just the old couple\'s breaths, as they sit around calmly watching life as it goes by and doing nothing except their routine daily staff.'),
('2008656', 'عش الدبابير', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2008799', 'روكسى', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2008910', 'Papa', 'https://media.elcinema.com/uploads/_315x420_d0b8f46d45ae6a4fd49410b1957b1f3cd74b27133a5e89be641a37217ad62c03.jpg', '+18', '19 August 2012', '110', '12019500', '5.5', 'The story of Dr. Hazem, a gynecologist, as he crosses paths with the interior designer Farida and they soon get married, only for him to learn that he is sterile, the thing that encourages him to consider having an IVF operation.'),
('2009027', 'Arweqat El Kasr', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', 'It\'s a narrative documentary movie that reveals Mubarak\'s last days as an Egyptian president, illustrating all the glamorous revolution events starting from the 25th of January up till the 11th of February. Egypt is reborn !!'),
('2009222', 'Bard Yanayer', 'https://media.elcinema.com/uploads/_315x420_4d06d7d9e61a2a0295b3490d4aa263c5ee2e936c85b323d9734286e99142cbd2.jpg', NULL, ' 1 October 2011', '12', NULL, '6.4', NULL),
('2009227', 'The Doll', 'https://media.elcinema.com/uploads/_315x420_f00a01c1c953e0dc95e2854402d3c2f5d9614941e52faf444ef8086a7fba04cd.jpg', NULL, '22 July 2011', '7', NULL, '0', NULL),
('2009241', 'Pay back', 'https://media.elcinema.com/uploads/_315x420_7a528c158050f682bd617da20e0fde1aa0afd3f6c36585b18bc61d9ef2524ff1.jpg', NULL, NULL, '15', NULL, '4.7', NULL),
('2009260', 'Book of the Entry', 'https://media.elcinema.com/uploads/_315x420_c2cd14a4f65a14dfca8bd50391ecfedb5bafd063fabc71b63a7febc8be025249.jpg', NULL, ' 1 January 2011', '7', NULL, '0', NULL),
('2009268', 'Reporting A Revolution', 'https://media.elcinema.com/uploads/_315x420_7a3e90d64a9a861d07e6d0673999240780db9557f1608f9ef9bd2cc00b004287.jpg', NULL, ' 9 February 2012', '62', NULL, '6', NULL),
('2009289', 'My Brother the Devil', 'https://media.elcinema.com/uploads/_315x420_d8cd6d203b8d57a9f800d4cbdf5e76128a1d663d794a1ab80eb51c68f84a5fdb.jpg', NULL, NULL, '111', NULL, '0', 'The film concerns two brothers (Mo and Rashid) who become Arab-British gangsters in London. They have exceptional courage that allows them to keep well in the wars of the streets.'),
('2009606', 'I am Asser', 'https://media.elcinema.com/uploads/_315x420_99b447b33700c9468fb2951fb825bd37e04bc23c87161ce2494e53fa6507024b.jpg', NULL, NULL, NULL, NULL, '5.6', NULL),
('2009611', 'Proud To Be An Arab', 'https://media.elcinema.com/uploads/_315x420_cf1796c78a14577266ddb36d52d39be466adb0ea5b5d1f52eb5ef94f166d9af5.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2009616', 'Sariqcho', 'https://media.elcinema.com/uploads/_315x420_31650bba7f53b2cc890f04fa01b2ab19f088b23d71c902c846a2c214e9c55b33.jpg', NULL, ' 6 February 2012', NULL, NULL, '6.4', NULL),
('2009803', 'هى بئت كده', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2009818', 'أسود ملون', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, '13', NULL, '0', NULL),
('2009821', 'فيها حاجة بنا', 'https://media.elcinema.com/uploads/_315x420_3166380a82b3078a89a21ddcc8d4810f0d2d51c1caa6ef95e1a283bc95333c9d.jpg', NULL, '10 December 2012', '9', NULL, '5.8', NULL),
('2009824', 'THE WAY BACK', 'https://media.elcinema.com/uploads/_315x420_ffe4eb94bd9c1e916d26051cbb8546048070ea50cf51268f0e83cae7fc465cb6.jpg', NULL, '21 July 2011', '38', NULL, '5.8', NULL),
('2009837', 'The White Door', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, '5', NULL, '0', NULL),
('2009856', 'Mr. and Mrs. Oweis', 'https://media.elcinema.com/uploads/_315x420_d85d8ed7dbdc4330326b78a9275bf6412537fd88e6c61d3a2ecd493c3cc20a7a.jpg', NULL, '19 August 2012', '110', '5104630', '4.4', 'The story of a reckless playboy who squanders his late father\'s wealth, the thing that urges the mother to marry him off. However, he rejects every possible bride, until he crosses paths with a simple village girl who soon brings about his transformation.'),
('2009868', '41Day', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, '20', NULL, '0', NULL),
('2010133', 'Al Molhed', 'https://media.elcinema.com/uploads/_315x420_2cdcd152e460ea8cd8b64aca0f196497e4fb09f1372cbe09ae27715c3865a2a4.jpg', '+18', '26 February 2014', '85', '107612', '4.1', 'Based on a true story, the film tells the story of a man who starts entertaining the thought of becoming an atheist. As the son of a known Muslim preacher, the decision incurs the ire of his family and friends, considering the religious background he has.'),
('2010388', 'Farsh wa Ghatta', 'https://media.elcinema.com/uploads/_315x420_ce394bbf5665519c5dfb6ab22eb9e2e5077dc474812b1710b4b6da0d2877f98e.jpg', 'All Ages', '20 November 2013', '90', '168550', '7.1', 'As the 25th of January revolution erupts, a young man joins hundreds of escaped prisoners as they flee into the desert. As he tries to find his way back, he comes in contact with a lot of marginalized people and realizes that he has to fight to save himself.'),
('2010407', 'A cry of regret', 'https://media.elcinema.com/uploads/_315x420_123d958361705397f5fb3bfe8856a3551707fdd9d6adf291e66e89965d799580.jpg', NULL, NULL, NULL, NULL, '0', '\"Nagwa Fouad\" is playing the role of a mother who is traveling to the pilgrimage, leaving her young daughter with her decay and ethical brother. As a result of careless the young girl was about to cast her faith in a tragic car accident. \nThe movie revolves around an important social phenomenon that has invaded the   Arab societies: The weak personality of unreasonable youth who suffers from self-alienation towards his family and society.'),
('2010446', 'Hasal Kh\'eer', 'https://media.elcinema.com/uploads/_315x420_24c5246ea83942b4eb78d32c4cadda52b71db7da72fd7a4228bfd80378d53545.jpg', 'All Ages', '30 May 2012', '100', '6617540', '5.2', 'Qamar is a belly dancer who moves into building inhabited by several families. When she moves in, she is bombarded by the husbands\' attention. The husbands are Fawzi, a tax authority employee, an Arabic teacher and a singer. Their family lives are disrupted, and their wives attempt to keep their husbands in a comedy setting.'),
('2010476', 'الحرامية', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2010553', 'White Chocolate', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2011068', 'Azazeel', 'https://media.elcinema.com/uploads/_315x420_edebc0af1d6f53e3798afb1badbc8051326508860cb318e0fed681392da28617.jpg', NULL, '22 April 2015', '120', NULL, '5.1', 'The story of a Sheikh and his three disciples as he approaches death and advises the three of them to stay at his apartment for 30 days following his death. At the apartment, however, the devil Azazel tries to lure them into sin. Will they renounce or succumb to him?'),
('2011099', 'el tarab al sha3by', 'https://media.elcinema.com/uploads/_315x420_91d8fd8f3ff7489c6008873161a51c6b35f5420aebc35935caed78864e2a5409.jpg', NULL, NULL, '50', NULL, '5.8', NULL),
('2011165', 'Pantalon Juliet', 'https://media.elcinema.com/uploads/_315x420_4567e75f290ce748dc5d524937c4cc371ee6cdae656a9bc04f3070e33dbb5c81.jpg', 'All Ages', '11 April 2012', '81', '315220', '7.3', 'A young man becomes jealous when his girlfriend wears tight trousers, which becomes the cause of all their differences, and through that idea it addresses the problems that happen between couples in general.'),
('2011518', 'Ana Masry', 'https://media.elcinema.com/uploads/_315x420_c57b03f8c3210906681514f9dfd738c4126f162135765f5c75edcb0e75d44265.jpg', NULL, '13 May 2015', NULL, NULL, '0', 'A biopic about Egyptian discus throw Olympic champion Omar Elghazaly.'),
('2011520', 'Bulaq', 'https://media.elcinema.com/uploads/_315x420_378dbf0f198264189014dfaa30330a98ec28342c3b84784702f688a442e6d24a.jpg', NULL, NULL, '25', NULL, '0', NULL),
('2012045', 'Esh Al-Bolbol', 'https://media.elcinema.com/uploads/_315x420_62542eb6781f6ef7b7dcf1900da07c3c1d2da201d53a81d278251235e74e70a3.jpg', 'All Ages', '13 October 2013', '102', '9683767', '4.1', 'A comedy about a taxi driver who wants to achieve his goal of becoming a famous singer. He finds himself inside the world of nightclubs and befriends a belly dancer who helps him on his way to stardom where he faces fierce competition.'),
('2012060', 'Jews of Egypt', 'https://media.elcinema.com/uploads/_315x420_43803dcc93c3ffcae4836ebf004cebda68faa8f37e48df29abffebde1742bf86.jpg', 'All Ages', '27 March 2013', '90', '103520', '6.8', 'This documentary, from director Amir Ramsis, presents a nuanced picture of the Egyptian Jewish community in the decades leading up to the 1956 war. An examination of changing identities and how a community transformed from neighbors and partners to enemies in the eyes of Egyptians.'),
('2012325', 'The Virgin, the Copts and Me', 'https://media.elcinema.com/uploads/_315x420_995dc8cef78ed99c12ac27889ee2e0f9ded877683dd8e5df7069347d0792db27.jpg', 'All Ages', '12 May 2015', '85', NULL, '0', 'A non-believer born in Egypt and raised in France by his Copt parents, filmmaker Namir Abdel Messeeh has a complicated relationship with his ethnoreligious heritage. The Virgin, The Copts, And Me is the playful and warm personal account of his attempt to better understand his roots, and a  personal exploration of Egypt\'s Copt community and the alleged sightings of the Virgin Mary in his home town.'),
('2012331', 'My Name is not Ali', 'https://media.elcinema.com/uploads/_315x420_29ab664d6d2074878cf61b269ebae6eebd2d9f9d7cbf74f2579b9b101caf6b13.jpg', NULL, NULL, '92', NULL, '0', NULL),
('2012371', 'Fil Tariq Le West El Balad', 'https://media.elcinema.com/uploads/_315x420_89bf4c6692250ba1416673e45d817de533b56dca53b5351e7d60221cb11f328b.jpg', 'All Ages', '15 March 2012', '53', NULL, '0', NULL),
('2012422', 'Asham', 'https://media.elcinema.com/uploads/_315x420_cb86e89a21d62adc3e11afd5cb7f2644a144f460848f50f385b839b20e81f835.jpg', NULL, '19 June 2013', '87', '19180', '5.8', 'Set against the backdrop of the unrest during the pre-revolution period of January 25, 2011, by following the stories of six relationships in different stages that express ambition, happiness and disappointments, that are connected with Asham , a street vendor, who expresses optimism about Egypt\'s future.'),
('2012454', 'Asad Sinaa', 'https://media.elcinema.com/uploads/_315x420_15da2f7c0f811e7829b20aab6448863cf28b1ba8f93848fea67a8cfa4069c84c.jpg', NULL, '27 January 2016', '90', '67255', '5.8', 'The 1973 October war saw many tales of heroism, including that of Sayed Zakareya Khalil, an Egyptian paratrooper whose battalion was decimated during the war. Despite the setback, he still managed to thwart an attack by an Israeli regiment single-handedly.'),
('2016632', '31/12', 'https://media.elcinema.com/uploads/_315x420_edb9aae739861b856f619d1ef4ce15175322f89509597a06e93e49ac5361db5d.jpg', 'All Ages', '12 June 2013', '75', '297228', '4.7', 'This action-thriller revolves around a police officer (Edward) who begins to investigate a businessman as a suspect in a murder case when he discovers that another police officer is somehow tied up in the crime.'),
('2016635', 'Saboba', 'https://media.elcinema.com/uploads/_315x420_c49c7ded9eae86599c93c0658d34ebda2a3a0b3777fed760c9521f0436e87730.jpg', 'All Ages', '28 December 2012', '97', '216860', '5.2', 'The events revolve around Sayed Gharib and his daughter, who lead a tight gang, and decide to rob a bank. But as things go as planned, they find out that there\'s a traitor among them, which affects the robbery and ends in disaster.'),
('2017059', 'Ayoun el Horeya, Sharia el Moot', 'https://media.elcinema.com/uploads/_315x420_a3987e3c5390ddbf9bdebff8bd3d60f84353a98ec5e5d3a80a0763f68b15c2a4.jpg', NULL, ' 3 December 2012', NULL, NULL, '0', NULL),
('2017313', 'Al-Anissa Mamy', 'https://media.elcinema.com/uploads/_315x420_d9e79140f5ff3f47657aa45e93583efb80fca390f2987b5b18d56dd3012f44dc.jpg', 'All Ages', '24 October 2012', '100', '15318070', '5.6', 'Nabila has only one persistent concern in her life: her job. One day she falls into a deep sleep on the plane and dreams she\'s married to Khaled and has two children. What will happen when she wakes up?'),
('2017329', 'my beautiful country', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2017379', 'waiting', 'https://media.elcinema.com/uploads/_315x420_ce43990e4477f7f7e048e0b753d703fb415480039683f4f79884bf5f129f83d6.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2017531', 'Kalby Dalily', 'https://media.elcinema.com/uploads/_315x420_6ef3214e820ba15b28fa0838398f100ef8ce65d55bc804ba617fb5a20dcd5f91.jpg', 'All Ages', ' 7 August 2013', '105', '2974705', '5.9', 'A police officer from Upper Egypt is transferred to Marina, where he runs into some problems. As he tries to prove himself to his boss, he starts to fall for a girl who is his exact opposite in everything.'),
('2017768', 'Met\'eb and Shadya', 'https://media.elcinema.com/uploads/_315x420_eefa92a4bca528aacb5e76ccdfffee86f6b495fc093536c6b769dd542a767589.jpg', 'All Ages', ' 7 June 2013', '82', '110117', '3.1', 'Met\'eb and Shadya meet at an Islamic saint commemorating celebration (mawlid). As they face the obstacles of everyday life together, their chance encounter blossoms into young love.'),
('2017801', 'روليت', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2018084', 'Mohema Fi Film Adeem', 'https://media.elcinema.com/uploads/_315x420_a7a8171238bc6f5b94b8567f6e46740d07957ac84395d6aa1779ea7c101e6fb8.jpg', 'All Ages', '24 October 2012', '85', '2569730', '4.3', 'A fame-seeking young man who considers himself a great talent imagines that he is spending his evenings with the late singer Abdel Halim Hafez who wants him to join him in a play. All the while, his mother remains the staunchest supporter of his talent and tries to help him achieve his dreams.'),
('2018285', 'La Mo\'akhza', 'https://media.elcinema.com/uploads/_315x420_6edd6db23bd59c9e61feb3bebd10e27efb21e9329463b9dab097a4299c025e71.jpg', 'All Ages', '22 January 2014', '99', '8012121', '7.2', 'A Christian child named, Hani Abdullah Peter is forced to switch to a public school after his private one. At the new school, he claims that he\'s a Muslim with fear of religious persecution.');
INSERT INTO `MOVIES` (`id`, `Name`, `img`, `age_rate`, `Release_date`, `Duration`, `Revenue`, `Rating`, `Description`) VALUES
('2018290', 'The Pinter', 'https://media.elcinema.com/uploads/_315x420_e140ca5de67805a41b2c74d69b30d9619a27caf7474aadbd232be28c520bab7b.jpg', NULL, NULL, NULL, NULL, '6.4', NULL),
('2018380', 'عيد الحب', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2018480', 'Howa Fi Keda', 'https://media.elcinema.com/uploads/_315x420_72c463e9486cedbf95023ee31e6268fa4510f99fbe6a0ab2393a15aa5934843c.jpg', 'All Ages', '30 January 2013', '95', '181020', '4.2', 'When a girl leaves Upper Egypt for Cairo, she faces a lot of problems that she tries to work through, but she is forced to give up the traditions and customs of her village.'),
('2018558', 'February the 30th', 'https://media.elcinema.com/uploads/_315x420_4b72b02554bf20598edb722d1f4c23f0583c30c4addcbf57708d5c6198ad2c48.jpg', 'All Ages', '24 October 2012', '95', '3051760', '7.4', 'Nour and Nader can\'t escape their bad luck. Nour, a news correspondent, always ends up stumbling into unlucky situations, and Nader runs into trouble wherever he goes. Suddenly, unexpected events change their lives for the better.'),
('2018611', 'A Guinea Pig', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, '3', NULL, '0', NULL),
('2018689', 'Ala Gothety', 'https://media.elcinema.com/uploads/_315x420_b05c311e75556285ca25230ac6ea3f8dd885cc5ea1f2643d02e2b8ddfb5a1181.jpg', 'All Ages', '16 January 2013', '108', '13067838', '5.6', 'Raoof (Ahmed Helmy) is an interior designer who falls into a coma, his soul gets suspended between the two worlds. While floating around, he discovers what his loved ones truly think of him and tries to discover his mistakes before it\'s too late.'),
('2018696', 'Sameer Abu Elneel', 'https://media.elcinema.com/uploads/_315x420_ef9b05471d8b8f2e4b2f21fe26b126008cf7f42b41c977009cba8b47bb650f22.jpg', 'All Ages', '24 April 2013', '105', '8500773', '5.4', 'Samir Abo El-Nil (Ahmed Makki) lives in a local neighborhood where he gets into problems with its residents because of his stinginess . When his cousin Hussein Abo El-Nil (Husseinin Al-Imam) leaves him a fortune , he starts a satellite channel where he discusses his relations with those around him.'),
('2018733', 'Daght A\'aly', 'https://media.elcinema.com/uploads/_315x420_dc63c7c713d9581f86a05d925b2f160f7e793f7ffc8fa83518a43326ac63bcce.jpg', '+12', ' 3 April 2019', '105', '453893', '4.1', 'When a young electrical engineer accidentally gets electrocuted, he becomes a source of electric power for his entire neighborhood. As he falls in love with a girl whom he electrocuted, the government tries to take advantage of his power to make up for the power crisis.'),
('2018829', 'Al Hafla', 'https://media.elcinema.com/uploads/_315x420_79c1848e36fe3d59e1ee102ce48e330444c80772b0ead1c733ea715cee428212.jpg', 'All Ages', '23 January 2013', '92', '7058595', '8.4', 'When businessman Sherif (Ahmed Ezz) reports his wife\'s          Sara (Ruby) mysterious disappearance to the police,  investigation led by officer (Mohamed Ragab) reveals conflicting testimonies and the possibility of a very sinister abduction.'),
('2018834', 'In The Shadow Of A Man', 'https://media.elcinema.com/uploads/_315x420_f500dcee1259ad8364fde77792570027b1741658cea70411bd5f2c023ac966ac.jpg', 'Unrated', '12 February 2012', '64', NULL, '5.7', 'Four women talk about how is it to be a woman in Egypt, a country in the wake of a revolution, they also speak their aspirations and fight for the future.'),
('2018918', 'Al-Me\'addeya', 'https://media.elcinema.com/uploads/_315x420_b5ca8823841cfdd46b94437850ebca71b9ff899ac8e51aa6fbf5ec107816d7f4.jpg', 'All Ages', '12 March 2014', '89', '269069', '5.3', 'In the poor island of Dahab, a deprived young-man takes the drug dealing road to support himself. Gaining wealth and power, he\'s now in a dilemma with his old poor friend who wants to meet the basic needs and marry the love of his life.'),
('2018931', 'Nazareyet Amity', 'https://media.elcinema.com/uploads/_315x420_50bc731c4d1b2704b23d9e306c06cf0fadfd06118ab671ccc59067a5339b9e15.jpg', 'All Ages', ' 7 August 2013', '109', '1177192', '5.7', 'A famous talk show presenter gets into a number of comedic situations due to his growing fanbase. When the writer for his show falls for him, she seeks the advice of a men\'s expert to get him to notice her.'),
('2018950', 'Life, Thou Art Wicked', 'https://media.elcinema.com/uploads/_315x420_f756ae5e9f6e6310a42d94b481a4ae088cb0389f2f8c7b1edc502b8401f5bc1b.jpg', NULL, NULL, '90', NULL, '5.1', 'The film depicts the world of drug dealing through showing life in a casino opened by a man as a cover for his drug-dealing business.'),
('2018955', 'Al-Khoroug Lel-Nahar', 'https://media.elcinema.com/uploads/_315x420_dc2eae06f8079bdada7ea025ce3c62270252e95e2de4a360071854f16320778e.jpg', 'All Ages', '23 April 2014', '96', '11144', '6.9', 'A struggling poor family at one of Cairo\'s local neighborhoods, where a disabled father, a nurse mother, and daughter having problems expressing her feelings ,after becoming thirty years old and not yet engaged, she only takes care of a father absent from the world with the voice of (Umm Kulthum).'),
('2019219', 'Akhlaa Elabid', 'https://media.elcinema.com/uploads/_315x420_e88987d35c1570246139c9037ada75450c3d8f52f5488c067b403673333b5f52.jpg', '+16', '29 March 2017', '106', '997072', '4.5', 'Businessman Radwan Al-Gamal (Khaled Al-Sawy) suffers from a mental disorder, which makes him prone to any nervous breakdown. He returns to Egypt from abroad to start over but faces many challenges that change the course of his life.'),
('2019392', 'هيصة', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2019606', 'TaTah', 'https://media.elcinema.com/uploads/_315x420_75e40cc8bfbf3f8ba7c08620f5b6d5fefc7c7b619f942581e186fb28ffadb986.jpg', 'All Ages', ' 5 May 2013', '110', '9867135', '7.1', 'This satirical comedy revolves around Tatah, a maladjusted, poor man from Abdeen who befriends a woman online with help from his nephew. Just as his life starts to change, the woman is kidnapped and he sets out to save her.'),
('2019611', 'Mamluks', 'https://media.elcinema.com/uploads/_315x420_5031300763160d39d688c262546065bf49a1f79384a995a2cb1a9097a8dfe580.jpg', NULL, '13 February 2013', '90', NULL, '0', 'The film depicts the lives of a group of young people who sell themselves into modern-slavery, through the portrayal of a young man who leaves the countryside for the city where he does away with his morals to land a job at a real estate company, only to be constantly bullied and blackmailed.'),
('2019662', 'El Feel El Azraq', 'https://media.elcinema.com/uploads/_315x420_af66a2bc372508ec81f5101518c3c0f1352ab7d1b2af1152a41dd305a5ca1402.jpg', 'All Ages', '28 July 2014', '170', '31395445', '8.9', 'The story of Dr. Yehia, a psychotherapist at Al Abbasia hospital,who works in the department of the criminally insane. He finds that his patient is his old friend Sherif Al-Kordy and when he tries to help him, he gets himself in serious trouble.'),
('2019799', 'El Harb El A\'lameya El Talta', 'https://media.elcinema.com/uploads/_315x420_9ca12313bdcc3dd5ba74a45a53dcc8ff76b2acc1c94de1ae50b3376cb2bc1cb9.jpg', 'All Ages', '28 July 2014', '105', '30675474', '7.3', 'At the wax Museum, the statues of the most famous figures of history come to life after 5 pm until 5 am. Shortly before they wake up, Khamis enters the building, and he\'s chased by the living statues headed by King Tutankhamun ,then Aladdin rescues him, in exchange for helping him travel to Disneyland.'),
('2019901', 'I\'m Going to Space', 'https://media.elcinema.com/uploads/_315x420_395851cbdb6c07e2e44f19d509d45422f2482646b4202cded22d761ff1843e99.jpg', NULL, ' 1 January 2012', '7', NULL, '5.3', 'A short film that made it to the Cairo 48 Hour Film Project, featuring a young man whose sole purpose in life is to travel to space. As he decides to finally fulfill his dream, he visits friends and relatives to inform them of the decision and say goodbye.'),
('2020082', 'Boussy Cat', 'https://media.elcinema.com/uploads/_315x420_4489ea47f1ac9bd5e834bfd8bf654239004304fca096819ea7c08a0365893c40.jpg', 'All Ages', '22 May 2013', '95', '242037', '4.1', 'The beautiful Boussy owns a hair salon in a poor neighborhood in Cairo. Her wild persona creates problems for her sister whose boyfriend\'s family disapproves of their marriage. All the while, Boussy begins to fall for the mysterious Hamada.'),
('2020188', 'kobri el khashab', 'https://media.elcinema.com/uploads/_315x420_812a1af03c8c8a4cc7e9c1353ef8a81ab5af71703d081cc656318408a1fe8826.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2020240', 'El Gezira 2', 'https://media.elcinema.com/uploads/_315x420_a1c51c3656e80a902cf70f7bd04a1553c20fe74a5e38a3ee25532c807a2ad03d.jpg', 'All Ages', ' 1 October 2014', '165', '35132780', '8.1', 'Mansour Al-Hefni (Ahmad al-Saqqa) escapes from prison and reunites with his brother Fadl and his son Ali, and return to the island to recover what they have lost.  Mansour must stand against his old love Karima (Hind Sabri) while the leader of the travelers Sheikh Jaafar (Khalid Saleh) enters the conflict.'),
('2020280', 'El Brinseesa', 'https://media.elcinema.com/uploads/_315x420_a2c91ada83d9342e362d7fd347f8f15ad7785d89e776c2bb1ee14f97acbe98b8.jpg', 'All Ages', ' 7 August 2013', '90', '1166649', '4', 'After a poor girl is forcibly married off by her older brother, she has an affair with a guy who promises to marry her if she gets a divorce, only to abandon her afterward. Forced to work as a prostitute at a nightclub, her plans to marry the club\'s owner end in an unexpected tragedy.'),
('2020668', 'Report', 'https://media.elcinema.com/uploads/_315x420_dbec879899d59239ec5e667f3e8375da00c3a4e8f5181a5e72302af15b4b8167.jpg', NULL, ' 1 January 2013', '45', NULL, '5', NULL),
('2020669', 'Akher Waraqa', 'https://media.elcinema.com/uploads/_315x420_4859667a7e97ebff0e65a808bb11db391e86cb31b9586d5902d114478c6e7a90.jpg', NULL, ' 1 January 2015', '80', NULL, '4.2', 'After killing an orphan boy called (Karim) with her car, (Mona) suffers a psychological shock that made her imagine that Karim lived and grew up. She writes a novel about him and imagined herself to be (Nour) the heroine of the novel,who loved (Karim) and wished to live with him.'),
('2020682', 'Such A Reviving Apartment', 'https://media.elcinema.com/uploads/_315x420_9c491bd2176dabe4d78d96812416f3fa73315ef3b49c4b0dea3df624b757276b.jpg', NULL, '22 May 2012', '46', NULL, '5.8', NULL),
('2020930', 'The night of Eid', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2021036', 'Asrar Aa\'eleya', 'https://media.elcinema.com/uploads/_315x420_b565980ba4d8dba006c6393b1fa45811a887b1fd4557cc7b9f7443ebbc1a36f0.jpg', '+18', '22 January 2014', '110', '289519', '6.2', 'A film that deals with the controversial issue of homosexuality, through the eyes of both homosexual youths and those around them. The film follows a young man with homosexual tendencies who comes from a middle-class family, and his ongoing struggle to discern his true identity.'),
('2021414', 'Hatoli Ragel', 'https://media.elcinema.com/uploads/_315x420_629da9aa437a3d93ed6151cc090cf2f65271b57534dfed9ea159f88ea1e764da.jpg', 'All Ages', '13 October 2013', '100', '6782141', '6.6', 'What happens if women controlled the world and men were only there to entertain them? The film deals with a scenario where the roles are reversed in society with men being treated unfairly and reduced to beings means of pleasure for the women.'),
('2021511', 'Al Qashash', 'https://media.elcinema.com/uploads/_315x420_ab7f907d08de5a05a7bb7c59f79899269b150f0efcaaf654b0ef7e82046df031.jpg', 'All Ages', '12 October 2013', '90', '5699241', '4.5', 'Set in a local neighborhood, a young man is accused of murder and on the run, he meets a belly dancer that helps him as the relationship between them develops. Through his journey, he gets to know many people who help him prove his innocence.'),
('2021758', 'Khetet Jimmy', 'https://media.elcinema.com/uploads/_315x420_58395a4b267e2fc1958e15817e0f1ec6b62eee6c4f41d61d928d16505e8a9718.jpg', 'All Ages', '29 January 2014', '91', '1656129', '5.3', 'As a chemist tries to find a way to win back her lover, she decides to invent a chemical solution to compel him to return to her, which lands her in a lot of troubles as she faces many comedic situations.'),
('2021917', 'مترو', 'https://media.elcinema.com/uploads/_315x420_3493f97c4d4ea496b6ab2ff6dd225eb1f9d879f2b03cbe9f4d194f44914f6906.jpg', 'All Ages', '14 May 2014', '77', '66458', '4.8', 'A thriller about a young woman (Haim Gebai) who finds herself navigating a complex world in which someone is trying to kill her. She does everything she can to save herself and understand the terrifying events around her. Suspense grows as things become more complicated and mysterious at every turn.'),
('2021924', 'Fill & Give Him', 'https://media.elcinema.com/uploads/_315x420_7426ec77308a338833088ce92e2ce4124610d96090a096d3fd5595226d0777e6.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2022161', 'My wife fiance', 'https://media.elcinema.com/uploads/_315x420_ed2848d6439094c60db9bcf3dbd31583ffc563fde3e166b534f4bd994f232dc1.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2022171', 'Turab el Mass', 'https://media.elcinema.com/uploads/_315x420_88a789aeff4ccf3a4408e9f5369f0dd34028c8f313da2a052898ecb273cbc26d.jpg', '+18', '16 August 2018', '162', '31436262', '8.3', 'Taha works at a pharmacy and lives with his paraplegic father. When Taha comes home to find his father murdered, he discovers previously-unknown dark secrets about his father\'s life through the latter\'s diaries which reveal a world of crime and corruption that Taha knew nothing about.'),
('2022240', 'Saeid Claquette', 'https://media.elcinema.com/uploads/_315x420_576b2aa566ae71e723dd03159a1c05cbbdb1889f8c48d8972eeffcf6c9a04c43.jpg', 'All Ages', '29 January 2014', '90', '3288065', '6.8', 'On a film set, one of the workers encounters a dilemma when his daughter is kidnapped and the kidnappers ask him to kill the film\'s lead actor in order to get his daughter back.'),
('2022405', 'Merati w Zogati', 'https://media.elcinema.com/uploads/_315x420_9366a15d3bfbe120614d07c7886d947802f5c4306d86e74519a25c5792a2b7de.jpg', 'All Ages', '20 April 2014', '100', '7396984', '6.6', 'A comedy about (Ramez Galal) who marries a girl interested in women\'s rights , which makes her too busy and lacks interest in her marital life and that leads him to marry another woman, and he gets into many problems, and comical paradoxes that turn his life into hell.'),
('2022409', 'erwst albahr', 'https://media.elcinema.com/uploads/_315x420_be26727f28da116c55d4fce985c6f91c06083b578156d70e8ac7c772eb577b5a.jpg', NULL, ' 5 December 2012', '53', NULL, '0', 'A social drama that depicts the difference in thinking between parents and their children and the restrictions imposed on the latter, through the story of young Laila who gets forcibly married to a merciless sadist.  Forced to give up the love of her life, Laila struggles to live with her heartless husband.'),
('2024755', 'Karat maymuri', 'https://media.elcinema.com/uploads/_315x420_050ac1bc421ce7bd4321c524616301b4845f0f1c865c6ba674b1594adf1a7094.jpg', '+16', ' 6 December 2017', '92', '186869', '4.7', 'The film follows several separate stories, which are all connected by a young lawyer who re-opens some cases in which a final judgment was thrown, including death penalties. The lawyer thinks that suspected criminals are not the real ones, and submits a request to re-investigate the cases to the attorney general, with the help of some information stored on a memory card.'),
('2024960', 'Already happened', 'https://media.elcinema.com/uploads/_315x420_6855f0a8449223f6561ec7a1679e0ce9f84476538241756036f3eb7b3dfbe18b.jpg', NULL, NULL, '90', NULL, '0', NULL),
('2025123', 'جارة القمر', 'https://media.elcinema.com/uploads/_315x420_d277bd353ac0d073ae9a3b3d92166aee11d846e98665be63829ed26c39589dee.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2025510', 'Abl Elrabiea\'', 'https://media.elcinema.com/uploads/_315x420_d5e40974cc34301df96ec82968bfc68c34635e9f0474a217bb96e7fef8b7789e.jpg', NULL, ' 1 January 2013', '90', NULL, '3.8', 'Before Spring is a film that tackles the three months prior to the Egyptian Revolution of 2011, with special emphasis on the reasons and motives that sparked it as well as the general state of affairs that prompted the youth to revolt.'),
('2025529', 'The Square', 'https://media.elcinema.com/uploads/_315x420_f21a0c8182d29b261fb6f801257e73421278d59052f75e0e171c37324ecab8d9.jpg', 'NR', NULL, '95', NULL, '3.3', 'An intimate documentary that tells the story of the Egyptian struggle through six different protesters. We see them in Tahrir tents during the first days of the revolution,we share their victory euphoria and their fear and anguish during the transitional period of the military rule.'),
('2025534', '8%', 'https://media.elcinema.com/uploads/_315x420_ce05caab88b2b2289a13802fb496afbae10324b6522a65f6e4aa7aea18e9c03a.jpg', 'All Ages', '12 October 2013', '80', '2823080', '5.9', 'A comedy about three singers who form a local band, performing in small concerts. In one of their shows in a school, a kidnapping happens and the band is accused of the crime. Situations unfold as the band manager tries to get them out of their dilemma.'),
('2025594', 'Cairo Drive', 'https://media.elcinema.com/uploads/_315x420_88235c5221473bb1b48d68da18c3c33ae8f9b8c34a4dc40f8629a8a37f2eb467.jpg', NULL, ' 8 January 2015', '77', NULL, '0', 'Cairo Drive is an intimate documentary that explores the life of one of the world’s most populated cities—from its streets. Shot in 2009-2012 (before and during the Egyptian revolution, and ending with the most recent presidential elections), the film explores the country’s collective identity, inherent struggles, and the sentiments that lead through the historic changes taking place in Egypt today.'),
('2025632', 'Halawet Rouh', 'https://media.elcinema.com/uploads/_315x420_5598eecd6044fc0138d73dd53220c042bd6780d6138607963e8141c040b6e7f0.jpg', '+18', ' 3 April 2014', '101', '6742179', '4.2', 'With her husband out of the country. Rouh lives in Bolak El Dakror with her mother-in-law. Rouh\'s neighbors cause her a lot of problems since several of them desire her and want to pressure her into having an affair. As Rouh pushes back against her neighbors\' lust, two of them set her up.'),
('2025730', 'Villa 69', 'https://media.elcinema.com/uploads/_315x420_1a6b358ca400e8e1abb8d29cb0a33e03321e9cfb745d028abca5e45f1cd690a3.jpg', 'All Ages', ' 4 December 2013', '108', '485872', '7.7', 'Hussein is a terminally ill architect who enjoys a solitary routine in his old family home, and a variety of female visitors. Not realising his past is about to catch up with him, Hussein\'s sister and her grandson move into the house, disrupting a well established lifestyle, and forcing him to re-examine his ideas about life, love, and family.'),
('2025830', 'Mr. Know It All', 'https://media.elcinema.com/uploads/_315x420_4b60606e31976ac34c1fc05b477e702f48875fc2a72ccf25ee61d1e67efbc508.jpg', NULL, ' 1 January 2014', '94', NULL, '4.9', 'In a comical-political portrayal of the living condition in Egypt, the story follows a young man who struggles to fulfill his dreams and aspirations in a volatile atmosphere where unemployment and poverty hover around. Can he find his way through life and serve as a role model to other people?'),
('2025865', 'Soni\'a Fi Misr', 'https://media.elcinema.com/uploads/_315x420_8b9f9ca592195b7cfdf03603dfdc1a8a01a04c06e5d063d7a3e8cf3c14694486.jpg', 'All Ages', '28 July 2014', '102', '10259747', '5.8', 'Through a series of exchanges between friends and relatives, this film explores the artificial relationships that people form through social media sites like Facebook and how these connections significantly influence personal relationships in reality.'),
('2025897', 'Experimental Summer', 'https://media.elcinema.com/uploads/_315x420_1f1f1a373b14c22a6308537a17a4a1303c0ff44e6a7ab28be391a808cb7d3289.jpg', NULL, '27 September 2017', '69', NULL, '5.8', 'As Mahmoud and Zeinab embark on a painstaking journey in search of the original copy of a classic Egyptian movie made in the 1980s and confiscated by the Government Film Agency, their search takes them into the labyrinthine-yet-fascinating world of film-making.'),
('2026145', 'Salem Abu Okhto', 'https://media.elcinema.com/uploads/_315x420_af875773a1481f978bac891793a3161ded7a8480dc92287dbd5c24bccee55e6c.jpg', 'All Ages', '15 April 2014', '100', '8892188', '5.4', 'Salem is a poor street vendor who has been taking care of his sister since their parents died. After the 25th of January revolution, his life turns into a nightmare when he gets into trouble with both thugs and policemen.'),
('2026156', 'Antar Ibn Ibn Ibn Ibn Shaddad', 'https://media.elcinema.com/uploads/_315x420_8615a4b84a1810f40873af617fc011a9dee1fa7f464dd3e185c540f3748b7cea.jpg', 'All Ages', '25 June 2017', '110', '7389648', '5.2', 'The grandson of Antar Abassi enters a fierce battle with Asad Alrijal, and tries to beat him with all his strength in order to win the heart of the most beautiful girl in the tribe.'),
('2026233', 'Zarf Sehhy', 'https://media.elcinema.com/uploads/_315x420_f04efd717b48c5be570f3fdec9dfa924fb66a78b7bd6bb61818a5bc42970786b.jpg', 'All Ages', '23 April 2014', '95', '527474', '3.6', 'Sayed is a plumber who is in love with Batta. He finds himself in a lot of ironic situations until his daily life is interrupted by a situation that turns his life upside down.'),
('2026451', 'Odet El Firan', 'https://media.elcinema.com/uploads/_315x420_40cf4b1b97c5b34d5540bb816384bd2bf9a0b012e53b0ce3cbca190e65c72603.jpg', NULL, ' 7 December 2013', '85', NULL, '4.1', 'A movie about fear and how people respond to it, through the lives of 6 separate characters struggling with their fear, from the guy who couldn\'t express his feelings to his dying father, to the girl who is terrified of being married, to the widow who can\'t sleep early ever since her husband died.'),
('2026456', 'Fatat Al Masna\'', 'https://media.elcinema.com/uploads/_315x420_731e8241691a2ac2af5aaba79f6183abaf90327a64f67f98178c4b0160deee69.jpg', 'All Ages', '19 March 2014', '90', '1279458', '7.1', 'The film follows Hayam, 21, who works like the rest of the girls in her poor neighborhood in a clothing factory. Her sole and emotions open up to a new romantic experience which she lives as an adventure, not knowing that she stands alone against a society that fears love and hides behind its strict and inhumane traditions.'),
('2026544', 'Antar Bin Shaaban', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2027056', 'Hasallena Elroa\'b', 'https://media.elcinema.com/uploads/_315x420_1abb6ab91d3846970a19f65652bea5d9dd232a1c45326edf4fcb18e43dc5e55e.jpg', 'All Ages', ' 8 January 2014', '108', '88277', '6.8', 'Two students take a trip to Ajami in Alexandria to complete some projects for their studying.  But things quickly take a strange path when they find that a skull related to their project becomes the reason behind all their problems.  The two friends try to find a way out of this cycle of disasters.'),
('2027144', 'Al Mahragan', 'https://media.elcinema.com/uploads/_315x420_d64bd3fff835a904f418d1609d41c3a8c5d3441c6c60e37e88cd5bf3d242d2b7.jpg', 'All Ages', '29 January 2014', '96', '771220', '3.7', 'This feature depicts the new local trend in music called “Mahragan”, through the story of two singers,Alaa Fifti and Sadat, who live in a local area. They face many challenges to prove themselves in the world of making Mahragan music.'),
('2027294', 'Welad Rizk', 'https://media.elcinema.com/uploads/_315x420_779243c14757d8c4c715ba34f4115f07e794480ffca02ca376ca3d8e5b2008d6.jpg', '+12', '16 July 2015', '100', '22827341', '7.7', 'Four brothers make a pact to abandon their life of crime one day. When a failed operation brings back old feuds, their older brother, Rezk, leaves them to work in the family\'s workshop. His brothers get involved in a dangerous deal with a drug dealer and find the police on their tail.'),
('2027319', 'Kudurat Gheir Adiya', 'https://media.elcinema.com/uploads/_315x420_6f1715c3e395b5ca9f6b0ce149131544c855523e2c32f605ac844d402999f690.jpg', '+12', ' 9 December 2015', '133', '518778', '6.8', 'After his scientific research on the extraordinary abilities of human beings, Yehia takes a break and goes to stay at a motel by the sea where he falls with the owner and her charismatic daughter. As he sees something extraordinary inside each of them, he starts to think that he might have it too.'),
('2027320', 'Decor', 'https://media.elcinema.com/uploads/_315x420_d97f0550e641cc4a6e655a40965beb1140d7fc2485cfac609b78fdc46b7398da.jpg', 'All Ages', '17 December 2014', '105', '467266', '7.2', 'Maha is a film set designer who finds herself torn between two worlds as she gets attached to the fictional world of her new film. As fiction and reality start to blur together, Maha needs to choose between reality and fiction, symbolized in the choice between Mostafa and Sherif.'),
('2027425', 'Why Are You Silent', 'https://media.elcinema.com/uploads/_315x420_7947f975dd9bc59a637800d990fdee3dbbf0ad7b3b738f3b27b589a191e15caa.jpg', NULL, '28 September 2013', '85', NULL, '0', 'A portrayal of the lives of Muslims and Christians in Egypt, and the attempts of some infamous minorities to stir discord between them and ignite sectarian strife.'),
('2027650', 'Men Dahr Ragel', 'https://media.elcinema.com/uploads/_315x420_b8279945b1f7161b9a9be89e2436f75611bd175c7a77a8b614c5119536dd5465.jpg', '+12', ' 6 January 2016', '145', '7553289', '7.1', 'An aspiring boxer Adham is thriving to become a successful professional.  He falls in love with a girl, Mai, living in a slum, who suffers from her thug brother\'s possessive personality. Adham and his dad\'s lives turn torrid when Mai\'s brother knows of their affair.'),
('2027711', 'Wesh Sogoon', 'https://media.elcinema.com/uploads/_315x420_9c044a31830b4915d567677469912dc5dea1c4b4fb2eb1782a5884331b4e35cb.jpg', 'All Ages', ' 3 October 2014', '97', '1353329', '6.2', 'The film follows a man in jail who gets sentenced to death by hanging for committing rape, and the details of his life inside the jail and his relationships with his mates.'),
('2028402', 'Romio El-Sayeda', 'https://media.elcinema.com/uploads/_315x420_98a8e257b9501c87c341b568394c90608c2169963b9ab8590d259707329d2d61.jpg', 'All Ages', ' 1 April 2014', '83', NULL, '0', 'Ramy, who is known as “Romeo of Sayeda”, lives in Al-Sayeda Zainab. He meets Dr. Hanan, who is trying to uncover a big corruption plot by several authority figures. With Romeo\'s help, Hanan finds refuge from the corrupt officials chasing her in the warmth of Al-Sayeda Zainab.'),
('2028512', 'Shaaket Dabows', 'https://media.elcinema.com/uploads/_315x420_c6c413a694e995922413db56115cbc41239015d618afbf630c51ed5491692c47.jpg', NULL, ' 6 January 2016', '82', '469746', '5.8', 'After a long stay in Kuwait, (Saif) decides to return to Egypt to settle and start establishing a chain of pharmacies. In the midst of his work, he enters a love relationship but leads to an unpleasant surprise because of (Truecaller ) application, that identifies the caller\'s name.'),
('2028770', 'كاريكاتير الثورة', 'https://media.elcinema.com/uploads/_315x420_4e561fd7ef1197f400b46d5ff71c777d30969f7afbb7be576d1d5637a712bda8.jpg', NULL, NULL, NULL, NULL, '5.8', NULL),
('2029041', 'A Very Hot Day', 'https://media.elcinema.com/uploads/_315x420_6cbc4c9d3d0c2384f0d9a7ebc7d6eb5ddfaa04902415971cb5c994020ad776e7.jpg', NULL, ' 1 January 2014', '52', NULL, '0', NULL),
('2029160', 'Antar & Beesa', 'https://media.elcinema.com/uploads/_315x420_f24c9f99184623986d19a6f4185697e0c95f6ff9a56ee0fcd242f9d12f64d8eb.jpg', 'All Ages', '28 July 2014', '90', '3547716', '3.7', 'Bisa is an unlucky girl who works as a singer at a nightclub. Her sweetheart, Antar, is a thief who was just released from prison with his two friends. As the three of them kidnap a little girl in order to ransom her off, their plot proves unsuccessful but Antar and Bisa grow to love the little girl'),
('2029316', 'The Places of Silent', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2029347', 'Giran El Saa\'d', 'https://media.elcinema.com/uploads/_315x420_034b0ecaf122c1616510de0e0104f060ac5867d7cad718cdef0c7d79a23767ff.jpg', 'All Ages', '16 April 2014', '88', '2370882', '5.4', 'A group of neighbors experience a series of unfortunate events caused by their children, to find themselves in a malaise of complications, but they discover that they have to cooperate in order to get out of trouble.'),
('2029798', 'Bent min Dar Elsalam', 'https://media.elcinema.com/uploads/_315x420_81533161e8c4853ff5bbbd91ff328318b28f472901cf7b1fb712994b33a41b89.jpg', NULL, '21 May 2014', '95', '262061', '3.8', 'Manal is a young girl from Dar Elsalam in Cairo. After graduating from a commercial high school, she gets a job as a maid in an old man\'s house. But her life turns upside down when the man rapes her and she is forced to marry him.'),
('2029813', 'Hamaty Bet-hebbeny', 'https://media.elcinema.com/uploads/_315x420_486b7c9b320d124b9a514e8b305e5d663ecfa3edb0c9e47b5d31ff4442928b42.jpg', 'All Ages', ' 2 October 2014', '96', '4331941', '3.8', 'A plastic surgeon gets into trouble because of his extreme passion with women, so he decides to visit a shrink, who eventually discovers that he is in a relationship with her daughter, so she decides to stop him in every way possible.'),
('2029814', 'Gawaza Meery', 'https://media.elcinema.com/uploads/_315x420_090a6e8d3e869a3ad8a1de1a0e07a95ec4fd6f3811bca4fa73e165d64304e2fc.jpg', 'All Ages', '28 July 2014', '80', '12286878', '5.3', 'The film follows a young girl “Yasmin Abdel Aziz” who is searching for a husband, due to her constant loneliness and feelings of negligence by men. After a lot of attempts she meets two men who fall for her at the same time, and she doesn\'t let go of one of them and decides to keep both to her benefit.'),
('2029989', 'El Nabatshy', 'https://media.elcinema.com/uploads/_315x420_3a5b04359dfbca192de8b9644843784ea6deb582bddbb76518aaea2343822c0b.jpg', 'All Ages', ' 2 October 2014', '100', '2734506', '4.8', 'Saad is a master of ceremonies who introduces singers and dance numbers on stage at local weddings. He aspires to gain wealth to escape his poor neighborhood and marry the girl he loves, but many hardships stand in his way.'),
('2029993', 'El Dassas', 'https://media.elcinema.com/uploads/_315x420_02baeb215fd645372e97389b44da51f8c8e43ee8f70e000b9321362923c83885.jpg', 'All Ages', '21 May 2014', '80', '205049', '5.4', 'A horror/comedy about Al-Harrawy family\'s mysterious house where strange phenomena occur that make the locals believe that it is haunted by ghosts and peculiar creatures.'),
('2030243', 'Nashet fi Haraket Eyal', 'https://media.elcinema.com/uploads/_315x420_5c958cd90e287e2af64cadbd9d4e22897766ff40781f8dbcbf3c0c2cdd07936c.jpg', 'All Ages', ' 3 September 2014', '95', '70585', '4', 'The story follows two fresh graduates, one of which dreams of building a factory, and kidnaps a child from a wealthy family to ask for ransom that would help him fulfill his dream. But he then faces another financial distress which leads him to kidnap another child, and events take a wild turn.'),
('2030297', 'Eldonia Maa\'louba', 'https://media.elcinema.com/uploads/_315x420_bbd074e3547237be314e71a2184a812dd84b4db1d9c5e2017fce405ee2b015c9.jpg', 'All Ages', '25 February 2015', '85', '823566', '3.7', 'The film is set in a parallel reality where The United States are a developing country and Egypt is a major world force. An American man (Bassem Samra) tries in every way possible to immigrate to Egypt, the country where dreams come true, but his country\'s extensive bureaucratic procedures stand in his way.'),
('2030359', 'Manteka Mahzoura- Kasr El Baron', 'https://media.elcinema.com/uploads/_315x420_5bd4adf8923bc09de966e64c11ad938ed606bd1adc84df184144143e8aa5c5fa.jpg', '+16', '16 November 2016', '85', '802606', '7', 'A filming crew decides to shoot a documentary about the palace of the famous Belgain millionaire, Baron Empain, in Cairo to explore its extraordinary history. Following several attempts to obtain the impossible permits to enter and film the documentary, the crew decide to trespass the palace and end up being in the middle of the mysterious events that are known to have plagued the palace for years.'),
('2030377', 'Ma Baad Wada\' Hagar Al Asas Le Mashroua\' Alhamam Bel Kilo 375', 'https://media.elcinema.com/uploads/_315x420_dc17ec63fad80b3f2ca97c79fd8ef6296269687ba9a59906ebe3268a765ec40f.jpg', NULL, NULL, '18', NULL, '5.5', 'Fear is an instinct lying under the skin. But what if it mutates?'),
('2030431', 'Harah Maznua\'a', 'https://media.elcinema.com/uploads/_315x420_e709bf99cc5b2fc87979f670db281892db304d654a7d57bcb486e371b529fe5a.jpg', '+12', '12 August 2015', '95', '229771', '3.7', 'Haidy is a criminal who gets three young and poor men involved in illegal activities and exploits them. Will she manage to deceive them till the end? Are they going to believe Haidy?'),
('2030475', 'Tesaaa', 'https://media.elcinema.com/uploads/_315x420_d8bdb5ef323fcafad302a80598a827bb2b15fd71f3f95d4abc89436170b90a12.jpg', '+18', ' 8 April 2015', '119', NULL, '5.4', 'Nine people with mutual history meet in one place, which eventually reveals a lot of dark secrets that were hidden for too long. The host decides to get rid of them as they were fugitives from previous crimes. A ruthless battle ensues between them, and events climax to show who has the upper hand.'),
('2030601', 'Al-Mowaten Bors', 'https://media.elcinema.com/uploads/_315x420_1242a3ca29ae501d35737291ef8cc75e8213e9d8cf4c3fadfc146f2eb6eadac8.jpg', 'All Ages', ' 1 October 2014', '95', '382982', '2.3', 'The film follows an unemployed man called Bors (Gecko), who comes from one of Cairo\'s slums, and the hardships he faces while trying to get married to the girl he loves.'),
('2030742', 'El Ott', 'https://media.elcinema.com/uploads/_315x420_944e51e0ab39fd14ab0118218e63d1cdead099bf0d0ed4f5e78485a3b9ac6b3c.jpg', '+18', '15 November 2014', '92', '355675', '5.3', 'When Al-Ott learns that a group of his neighborhood\'s children was kidnapped as a part of an organ-trafficking scheme, he kills one of Master Fathy\'s men and rescues the lone survivor. He and Ghagary find themselves a part of a long chase to find Master Fathy.'),
('2030800', 'Sukkar Mor', 'https://media.elcinema.com/uploads/_315x420_6f4d84b4f11be7c5a4fccdcec3612f75169d5d550aec65c2616114189c9dc428.jpg', '+12', '16 July 2015', '120', '2949428', '7.1', 'The film follows the stories of five men and women connected together by romantic relationships, and how they get influenced by the social transformations of the past few years. Some persons change unexpectedly, and others stay the same.'),
('2030999', 'The Humanoid Park', 'https://media.elcinema.com/uploads/_315x420_486c448c5ad2939ca824e0198f828cf9d485c8a16e2af765f154378c86b1a058.jpg', NULL, ' 1 January 2015', '25', NULL, '0', 'Set in the future, the comic artist Mesbah objects to the government\'s decision to turn criminals and personas non gratas into trees. Five years after Mesbah disappears in mysterious circumstances, he eventually realizes how far the decision to \'tree-tize\' human beings has gone.'),
('2031108', 'Omar we Salwa', 'https://media.elcinema.com/uploads/_315x420_f973e5e6f08d4f0867efd4cd324886cf14414a07f3061b51e5391ea3996018df.jpg', 'All Ages', ' 2 October 2014', '102', '10636129', '2.9', 'A romantic comedy about a love story between Omar and Salwa, who tries to fulfill her only dream of becoming a show dancer. But Omar rejects that idea, and tries hard to keep her away from it, but she\'s able to work in a nightclub; and problems begin to emerge between them.'),
('2032248', 'Khetta Badila', 'https://media.elcinema.com/uploads/_315x420_ef20f4313f86dcaf512b294a485194e4fbbfbb43b6f6b1b4d337cc60825836b5.jpg', 'All Ages', ' 4 February 2015', '100', '749291', '7.1', 'Lawyer Adel Abdel Aziz faces a terrible event that turns his life upside down as a result of his honor and dignity. Accordingly, he decides to adopt a surrogate plan, taking matters into his own hands and avenging himself.'),
('2032459', 'Suicidal Notions', 'https://media.elcinema.com/uploads/_315x420_ac1c2471a9a13515ae568062a59a0153bfd60d5fecc82aa2cf8e1def7f889ae6.jpg', 'Unrated', '17 November 2016', '89', NULL, '0', 'Three days before her departure to Australia, Marwa\'s mother passes away, and she discovers her mother\'s wish to be buried elsewhere. As she struggles to get everything done before she leaves, Marwa is torn between leaving and fulfilling her mother\'s wish, while the Egyptian revolution is looming.'),
('2032499', '4 Cotshina', 'https://media.elcinema.com/uploads/_315x420_c507c1556da4199178aed15645546031fb69329411d15acdb3f7f1b39ef895ce.jpg', 'All Ages', '23 September 2015', '95', '659351', '2.1', 'The film follows the story of three boys and a girl whose friendship survived Mai\'s departure from the country at the age of 5. When she returns, she reunites with her friends and helps them to launch a local music band.'),
('2032525', 'Planet Shegof', 'https://media.elcinema.com/uploads/_315x420_5dcc85f4cb026eac7f78e7ab4bec19748d844313a46855285cbaa2fa158d6ed1.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2032773', 'Ababeel', 'https://media.elcinema.com/uploads/_315x420_bb09ee3a965b02f5af4ccf7b510674695394ea7322e68e797d29a77a68fffd6a.jpg', 'Adult Supervision', '13 October 2014', '50', NULL, '5.9', 'A documentary that tells the truth about the airstrike waged by former president Hosni Mubarak in the October War of 1973.'),
('2032817', 'Ott we Far', 'https://media.elcinema.com/uploads/_315x420_8390ad6bf6cc42e11bfc637577310f933a73621c3a2acd1d0cf7bbbe8af980fa.jpg', 'All Ages', '21 January 2015', '95', '649967', '7.4', 'Hamada gets involved in a furious conflict with the minister of interior affairs with all the power he has, as he searches for his mother, who does simple daily jobs to provide for her family. Through the conflict, Hamada discovers how big the gap between him -and others of his social status, and the government is.'),
('2032873', 'Betawqit Elqahera', 'https://media.elcinema.com/uploads/_315x420_81ebb8d2deed9c382432714c14875632cb71b5b65cede16dd39a423d30c23b58.jpg', 'All Ages', '14 January 2015', '110', '661757', '6.4', 'Three stories take place over the course of a single day in Cairo. Lila, a retired actress, is looking for Sameh, her last co-star. Salma, is dating Wael and is in Wael’s friend’s apartment. Hazem is a drug dealer on the run from Alexandria to Cairo who picks up an old man with Alzheimer’s disease.'),
('2032926', 'Tampola', 'https://media.elcinema.com/uploads/_315x420_360fc3e30c69d3a1ec85fb5624b29b4f3caa77867e548920bac1fa7d118ea12f.jpg', NULL, ' 1 January 2014', '95', NULL, '3.9', 'The story of the stingy fraud Tambola Al-Far who partners up with his wife Marzouka to defraud whoever they can. As he cooperates with Colonel Farid to cover his crimes, he clashes with chief Ezzat who eventually goes bankrupt, and the police eventually learn of this circle of deceit.'),
('2033032', 'Al-Thaman', 'https://media.elcinema.com/uploads/_315x420_93943f3284ac97de6db3050236ea80e328388e09eaf08a6c18404660c95d0084.jpg', NULL, ' 2 March 2016', '98', '139576', '5.3', '(Safwat) hires (Magdy) a hardworking cab driver to assassinate the novelist (Jalal Mahmoud) on the grounds that he is an atheist,which cause him to enter a cycle of confusion. At the same time, (Dima) a Syrian refugee and Safwat\'s wife suffers from his cruelty and exploiting her and wants to leave him.'),
('2033057', 'Primus Stove', 'https://media.elcinema.com/uploads/_315x420_b2f9daf8b428814936a93fb95e0333e9054cc32dc5255085f89e9cf0302422e9.jpg', NULL, ' 1 September 2013', '30', NULL, '0', NULL),
('2033058', 'Monsieur Naguib\'s Wife', 'https://media.elcinema.com/uploads/_315x420_399c8d753792e499ed7f6acbe657b190bee1132940421f76a8d74ed737b3bf8b.jpg', NULL, '24 December 2016', NULL, NULL, '0', NULL),
('2033060', 'An Yahood Masr; Nehayet Rehla', 'https://media.elcinema.com/uploads/_315x420_cde19f00af71f315a2391147b8e7ef02814d730c863997b8315597498c526193.jpg', 'All Ages', '20 August 2014', NULL, NULL, '0', 'The film follows the stories of twelve Jewish women who are still living in Egypt till now, and refuse leaving, despite the departure of all but very few of Egypt\'s Jews from their country, starting from Abdel Nasser\'s era, specially following the Six Days War. The film also focuses on the changes that re-shaped the Egyptian society and inevitably influenced Egyptian Jews since then.'),
('2033156', 'Hadeed', 'https://media.elcinema.com/uploads/_315x420_6c98dd19284cfe3173343c33af64fa4c1079d19840bd79d085bba6c6c3bc1d3e.jpg', 'All Ages', ' 3 October 2014', '120', '2838262', '6.1', 'Ammar (Amr Saad) is young artist, who falls in love with wealthy girl Nadine (Dorra), but her rich uncle Mahdy disapproves . They decide to get married without his knowledge. But Mahdy\'s men kidnap Nadine, severely beat Ammar and put him in prison after which his life completely changes'),
('2033272', 'Eastern Gate', 'https://media.elcinema.com/uploads/_315x420_23dc031e5286a37dbf4df3c3ed00dbcc25dca24568fd7777781f22decf61b6b2.jpg', NULL, ' 1 January 2013', NULL, NULL, '0', NULL),
('2033320', 'Men Awel Elsatr', 'https://media.elcinema.com/uploads/_315x420_e327f620fb22482eda3fffe0d39398cf9b83bf71e80a653d46701af90ce37369.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2033386', 'The Best is Yet to Come', 'https://media.elcinema.com/uploads/_315x420_cdad925dd664a2bbdb97478cc43a35764ebd475f7dfca007f4bcd558b9099297.jpg', NULL, NULL, '90', NULL, '4.3', 'A TV presenter discusses several issues concerning the Arab region and Arab identity through the representation of a Kuwaiti student who travels to Egypt to resume his studies and crosses paths with an Egyptian girl whose parents oppose their marriage.'),
('2033456', 'The Mall', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2033526', 'El Khalbous', 'https://media.elcinema.com/uploads/_315x420_fbf0c6689505961e69d42fdfc9a065eb00cfe6e24f6294ea45fa586034a8279f.jpg', 'All Ages', '29 July 2015', '113', '4186154', '4.7', 'A romantic comedy about a playboy who gets in serious trouble with four different girls when they discover that he is seeing them all at the same time over the course of his journey to find his dream girl.'),
('2033574', 'HIV', 'https://media.elcinema.com/uploads/_315x420_0576e8eafd981d0ab0722cfcd666a18a14847f3089eeb128bb5fc3cc1d14f6f8.jpg', NULL, ' 1 January 2014', '50', NULL, '5.8', 'The film follows the story of Youssef, an HIV patient, from when he started his journey with disease, to how he faced his family and the society at large after he got his diagnosis, to his relationship with his sweetheart who left him when she learned of his illness.'),
('2033593', 'Om Amira', 'https://media.elcinema.com/uploads/_315x420_a6d7bc8ee0302a903948d39280c2b482aeb6adcae8d825f98b65ef8b68625d88.jpg', NULL, '15 June 2014', '25', NULL, '0', 'The film follows a woman called Halima Mohamed Ahmed, known as “Om Amira” (Amira\'s Mother), who lives in a Cairo outskirt with her daughter, who suffers from heart disease, and her impeded, unemployed husband. She works all night long selling French fries in the street near Tahrir Square, which is her only financial resource.'),
('2033652', 'Elly Beyebb Rabena Yerfaa Edoo Lfou', 'https://media.elcinema.com/uploads/_315x420_082f10fbbc31a2232d68851adc747b7cb60f0b5f84e74aa61171b48d0baebd58.jpg', 'All Ages', '10 December 2013', '68', '18055', '3.9', 'A documentary that covers the popularity of a new music genre, Mahragant, through the story of some Mahragant singers like Oka, Ortega, and Wezza, exploring how the new genre gained popularity so quickly and how the singers rose to fame.'),
('2033777', 'E\'dam Baree\'', 'https://media.elcinema.com/uploads/_315x420_34ea46b59d2c9dd6689cf70d1f533f048323d5aa1955fc4e54be372b1b6d6692.jpg', NULL, ' 4 October 2014', '92', NULL, '4.4', 'The film focuses on the life of two brothers. One of them worked in the police force and the other is a Doctor specializing in medical analysis which leads him to the discovery of carcinogenic pesticides in Egypt. While he tries to find out the people responsible , a disagreement happens between the two brothers.'),
('2033831', 'All Around Alexandria', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2033923', 'أهل العيب', 'https://media.elcinema.com/uploads/_315x420_38a1823bf9eb7afbdcf616dd5094a62f58fdd19db5455c3e270ea136542ed5b1.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2033958', 'Naughty Boys', 'https://media.elcinema.com/uploads/_315x420_6a7b5d1e28db2214fb4443fe14ea75f3020447160774450c900a25c7a3b01049.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2034029', 'Warda', 'https://media.elcinema.com/uploads/_315x420_dbfa990a2f21cb08374f25afddc67791d2d6c7a698c50cd318bc5a3a2ca7143d.jpg', NULL, '13 November 2014', '75', '1141447', '6.6', 'A supernatural thriller that follows a girl who falls victim to a demonic possession, which turns her life and the lives of people surrounding her into a nightmare. Her brother tries to help by putting up a camera inside the house.'),
('2034041', 'Regata', 'https://media.elcinema.com/uploads/_315x420_9d769ca4b88fe821ca7a2b235d4ccf0b0cc609ddf06169195c78dabfd0b928ec.jpg', 'All Ages', '21 January 2015', '100', '4254188', '5', 'Regatta (Amr Saad) is engaged in several illegal activities with businessman Sari (Mahmoud Hamida). Regatta gets a quarter of a million pounds in one operation, which will allow him to travel with his mother to Italy ,then he discovers the betrayal of Nasra, the wife of his brother Awad by chance.'),
('2034135', 'Crop', 'https://media.elcinema.com/uploads/_315x420_8978b32eb32bbce29aee0431ce296c24b59d7a3c0e0c99d8005fe6b380752b2a.jpg', NULL, NULL, NULL, NULL, '5.5', NULL),
('2034236', 'Bab alwadae', 'https://media.elcinema.com/uploads/_315x420_9276c0d5f002f61765c22616e697379722ce1cc4100b0eeb2af1a8e585031629.jpg', NULL, '11 November 2014', '65', NULL, '5.4', 'A young man raised by his mother and grandmother, is completely isolated from the outside world by his mother, fearing that he will leave her like his father did or get hurt. But the young man dreams of discovering the world. Will his mother stand between him and his dreams?'),
('2034286', 'Qabl Zahmet Elsaif', 'https://media.elcinema.com/uploads/_315x420_83a1988462000f2a66b4d06ad7dc7d5ff6db06be451796873fe08ddb2253de4b.jpg', '+18', '13 April 2016', '90', '341818', '5.9', 'In a tourist resort on the northern coast, Dr. Yahya decides to spend the holiday with his wife Magda before the coast gets crowded . The two are introduced to a recently divorced translator and a mother of two called Hala .'),
('2034299', 'Gomhureyet Imbaba', 'https://media.elcinema.com/uploads/_315x420_26834119e605456261cc8a6a569606bab25f9c578b36898b4a27220ce6fa5313.jpg', '+18', '10 April 2015', '90', '1044508', '4', 'The film follows a group of characters living on the edge of society after the 25th of January revolution inside a local neighborhood, including a microbus driver and an opportunist girl.'),
('2034384', 'Yom Malosh Lazma', 'https://media.elcinema.com/uploads/_315x420_d299995fe95a3bbdbe9daa4e5e95e553ef8b3c3d37adf019233982496d6fab6e.jpg', 'All Ages', '22 January 2015', '100', '10555996', '6.5', 'It\'s the wedding day of Yehia (Mohamed Heneidy) and Maha (Reham Hajjaj), but as soon as the day begins the two of them get into an endless series of difficult situations. To make matters worse, the obsessive girl Possy (Robby) is chasing Yehia and is determined to be his wife instead of Maha.'),
('2034435', 'Mohammed Ali Street', 'https://media.elcinema.com/uploads/_315x420_9e5b4932b458872c891887dda13f4c2e61c9df23e102c323e179a8a3ae1a9baf.jpg', NULL, '14 September 2017', '80', NULL, '0', 'Joe comes back to Egypt after a long time living abroad. As nostalgia sends him back to Mohamed Ali Street to relive his old memories, he is shocked to see what the street has become and how the belly dancers\' standards and morality have deteriorated. He saves a girl from a gang and falls for her.'),
('2034447', 'Zay Oud Al-Kabrit', 'https://media.elcinema.com/uploads/_315x420_17adba0cb456aefb5156c3826995541eb3cc93f3355893ef4856eb70ab3b33ef.jpg', NULL, '24 August 2016', '84', NULL, '4.3', 'A comedic tale created by the late actor Hussein Imam to pay tribute to the stars of the Egyptian cinema in its golden age. The main story is based on mixing scenes of 21-star from black and white period with other scenes written by and starring Imam so that the final product is the rediscovering of old stars in a new context.'),
('2034715', 'Half Dozen of Girls', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2034735', 'Soua\' Tafahom', 'https://media.elcinema.com/uploads/_315x420_117086716013e64e90e4f65f8279217b484dcfd47e9753d81e59eac207f1e0fa.jpg', NULL, '11 February 2015', '120', '565546', '5.7', 'Omar is trying to reclaim the inheritance of his father from his uncle. He uses his colleague Rauof, who turns out to be a crook and then flees to Lebanon and Omar goes to jail.  Lina the Lebanese girl falls in love with Raouf, and they agree to marry, but he escapes to Cairo.'),
('2034825', 'Zan', 'https://media.elcinema.com/uploads/_315x420_9b6c79d44eaf0875798d998c70203c99aa4c5d93e6a458c7c3d3778d49e0eab4.jpg', NULL, ' 1 January 2014', '90', NULL, '0', 'Hamad is a Saudi businessman who is desperate to have a son. After five years, his wife Laila fears that he has run out of patience, despite her ardent efforts to give him a child. Out of desperation, she resorts to charlatanism and sorcery. But when Zan appears in their lives, all bets are off.');
INSERT INTO `MOVIES` (`id`, `Name`, `img`, `age_rate`, `Release_date`, `Duration`, `Revenue`, `Rating`, `Description`) VALUES
('2034826', 'Alb Eswed', 'https://media.elcinema.com/uploads/_315x420_c9dde2f6937a1d8d31ce86319e9b27988110be6501f77118074f15e7f4ed7c56.jpg', '+18', '11 April 2018', '90', NULL, '4.6', 'Shehab (Ahmed Haroun) is a corrupt businessman who collects his fortune illegally and has doubts about his wife\'s behavior and decides to leave her. He then disappears in mysterious circumstances until his family learns that he died in an accident. But his spirit returns to haunt his wife and family.'),
('2034829', 'Sugar on the side', 'https://media.elcinema.com/uploads/_315x420_81589b46549f5e34cc749fba2695265e9c875954b3c7bfd539a13c1a0be174d9.jpg', NULL, ' 1 January 2014', '77', NULL, '0', 'The film takes place in Egypt in 2013, a time when political power was being reshaped and a new authority was rising. Nhamdouh, Hanan and other girls and women from the villages of Southern Giza in the Hawamidya area live between the dream of personal salvation through quick marriages to men from the Gulf region, and how those marriages affect them and their children socially, psychologically and humanly on the long run.'),
('2035103', 'Captain Masr', 'https://media.elcinema.com/uploads/_315x420_2cddb60bb6b7ef30fa330892b1be7fa437b84e187be93ab6f4035b5b5649d74c.jpg', 'All Ages', ' 8 April 2015', '91', '18656276', '6.5', 'Football player Kamal Naguib nicknamed (Congo) became the most prominent football player in Egypt, but when he runs over a police officer by mistake, he\'s sentenced to 3 years , he decides to form professional football team of fellow inmates in prison.'),
('2035123', 'Bard alshatta', 'https://media.elcinema.com/uploads/_315x420_52c1b9d5745f40dd192e087770745666845bd420259be7d38951b7b54c1770e9.jpg', NULL, ' 1 January 2015', '98', NULL, '6', 'The journey of Resident doctor (Ramez Amir) in his first night shift at Kasr Eleni hospital, on a cold winter night, and the negatives and positives he encounters because of the lack of resources, different types of people and the motives of his colleagues doctors at the beginning of their career.'),
('2035228', 'Moment', 'https://media.elcinema.com/uploads/_315x420_3f56d12987b7a5dff3fa886cfd0ca211be544dcbf75e1ec0b635b30e31a50a28.jpg', NULL, ' 1 January 2014', '15', NULL, '0', NULL),
('2035332', 'Zana\'et Settat', 'https://media.elcinema.com/uploads/_315x420_8e41a7d4f40f9cb450872ae9e37d9354fbe74d828405c923514adc6589c28db4.jpg', '+12', ' 1 April 2015', '110', '17022946', '5.7', 'Ali Munir Al-Jahsh is a wealthy young man who picks \nup women who visit his father\'s psychiatric clinic.  They both have a bet, where Ali must help a patient recover from his complex with women by deceiving three girls the patient knows and they rejected him, namely Siham, Shukriya  and Samiha.'),
('2035453', 'Eyal Herryfa', 'https://media.elcinema.com/uploads/_315x420_5a4261c6ef33df4f3bc38ff3ab4c9fde81f610240393b903c3175b475515febd.jpg', '+12', '23 September 2015', '105', '11792584', '2.1', 'Seba\'y is an unsuccessful football coach in the Dokki Sports Club. As he tries to marry his sweetheart Osha, his final chance to prove himself to her father lies in coaching the women\'s football team, but he discovers a lot of corruption by an important official in the Egyptian Football Association.'),
('2035757', 'Shadd Agzaa\'', 'https://media.elcinema.com/uploads/_315x420_52066cd8f7d0736a34918cc0bef25f7e0b61faaa55f72e21141dcde7ba0fbc8a.jpg', '+12', '16 July 2015', '94', '22226619', '6.6', 'When his wife Aya is killed, Officer Omar vows revenge on the gang that killed her which brings him in conflict with his superiors and he ends up a fugitive from the law.'),
('2035825', 'Caeserion (The Last Pharaoh)', 'https://media.elcinema.com/uploads/_315x420_2922caa25e3f0d3e429779ce88b0d453a5a7f61be52878d75dda1356a0814dbb.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2035981', 'Bayt al toot', 'https://media.elcinema.com/uploads/_315x420_5095ee74bc8e3f35c6c2595a5843148b07bbd87fafb634eae11628d660943d9b.jpg', NULL, NULL, '70', NULL, '0', 'Sara Ishaq is Yemeni-Scottish and spent her childhood in Yemen. At the onset of puberty, she agreed with her father that she should go live with her mother in Scotland. Ten years later, in 2011, she traveled back to her birth country and took her camera along. She wants to feel at home in the place that was once so close to her, but it’s more complicated than that. Outside the gates, people are protesting against President Ali Abdullah Saleh’s authoritarian rule, and Ishaq and her family get involved.'),
('2036064', 'Khareg Al-Khedma', 'https://media.elcinema.com/uploads/_315x420_1cba63313c9f899096113329391dc3928e8101225fa92384b41d9333bdfda4e4.jpg', 'All Ages', '25 February 2015', '99', '203102', '6.4', 'A peculiar relationship ensues between two opposites: Sa\'eid who leads a miserable life close to that of the homeless, and Sherine who lives alone and does nothing but watch and reflect.'),
('2036270', 'Fazza\'', 'https://media.elcinema.com/uploads/_315x420_d15cd431e73cb69339aad584a42b15939825fe04f58c6f5366417904aae24294.jpg', 'All Ages', ' 8 April 2015', '100', '284065', '4.7', 'After living his whole life in Mazarita, Fazza\' finally decides to turn his life around once and for all. He moves to Cairo to experience city life, to which he is unaccustomed, and goes through all of its difficulties and comedic contrasts.'),
('2036338', 'Gay Al-Zaman', 'https://media.elcinema.com/uploads/_315x420_c45d11509309f621ac79af805ea94e94400b22f25ef2f57862e50742473f2c65.jpg', NULL, '26 May 2015', '100', NULL, '0', 'A documentary in which the director Dina Hamza discusses the life of her father, the late poet Mohamed Hamza who wrote songs for famous singers like Abdel Halim Hafez, Shadia, and Warda. Mohamed Hamza died in 2010, leaving his devastated daughter battling feelings of loss, loneliness, and grief.'),
('2036398', 'Al-Matour', 'https://media.elcinema.com/uploads/_315x420_d5b70879c63ba4917ac673fadfd2fb2cb0617a42618c606981c496d739f4283c.jpg', 'Adult Supervision', ' 1 January 2014', '14', NULL, '0', 'As three young men try to go to the beach, they end up in a remote area and they try to get a ride out. As their attempts prove unsuccessful, they confront each other.'),
('2036402', 'Rest In Peace', 'https://media.elcinema.com/uploads/_315x420_f0e971b9c94003525fb8b7390e6e39339b7a82ef3b136d4c8101653161e2190c.jpg', NULL, ' 1 January 2014', '15', NULL, '0', NULL),
('2036403', 'The Ka and Ba', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, '12', NULL, '0', NULL),
('2036512', 'The Tea Cart', 'https://media.elcinema.com/uploads/_315x420_f0d5286adab3e048f2d649d8a3af2163a0454d1d8df44de0237d2610e67da7bd.jpg', NULL, ' 1 January 2014', '11', NULL, '0', NULL),
('2036522', 'Helm Shahrazad', 'https://media.elcinema.com/uploads/_315x420_7be1fad5eb950b42c857ec1635bd8fc2018ba63ac06e21fb6fa9f677e3f6cc74.jpg', NULL, ' 1 April 2015', '110', NULL, '0', 'A documentary film which locates political expression before, during and after the Egyptian revolution – and also within recent times in Turkey and Lebanon – within a broader historical and cultural framework: that of storytelling and music.  More particularly, it looks at the legacy of the famous collection of stories known as THE 1001 (or “ARABIAN”) NIGHTS.'),
('2036528', 'Waves', 'https://media.elcinema.com/uploads/_315x420_c2ef30e48f8f7882f2101e6756d670fc544ee710ec7a12446b48f6ccf00a0cbe.jpg', NULL, '15 February 2017', '70', NULL, '0', 'The movie artistically merges real footage, archived shots and animated scenes to deliver a powerful narrative of Ahmed Nour\'s (director) family stories, his childhood memories of life in Suez, growing up under Mubarak\'s reign in the early 80s, and the events unfolding in the city after the outset of the Jan25 revolution.'),
('2036535', 'Sa3yokom Mashkoor Ya Bro', 'https://media.elcinema.com/uploads/_315x420_c14314f3016466fae9a154bd6e6d681409859877208590d2470ddbc5a0441a92.jpg', '+12', ' 9 September 2015', '95', '88376', '3.5', 'When a family reunites after the death of one of its members, a series of misunderstandings and mistakes sends the family into many comedic paradoxes.'),
('2036545', 'brivet', 'https://media.elcinema.com/uploads/_315x420_e7640791e2976ef25da90a650e614beac98fa4dbfa79ab7ede7605ef7458f9e6.jpg', NULL, ' 2 May 2015', '32', NULL, '0', NULL),
('2036554', 'Amod Faqrey', 'https://media.elcinema.com/uploads/_315x420_2289d2275d3c3eca99695b19f86f4630e7cb80c6dd667eaa2e6a54d1caaf2533.jpg', NULL, '26 October 2016', '91', '29847', '3.7', 'A man in his thirties goes through a lot of jobs as he attempts to gather enough money to marry his long-time fiancée. His various jobs put him through a lot of awkward, yet hilarious, situations.'),
('2036604', 'Almorsy Abo Elabaas', 'https://media.elcinema.com/uploads/_315x420_93d20dc4f12ceedacdeb6d8991cfeb4e82f8815fed57929cfe8ba7c02b83f8ea.jpg', '+8', ' 7 September 2015', '100', NULL, '6.4', 'During his search for his identity, a guy who thinks that he is a descendant of the renowned pious man Al-Mursi Abu Al-Abbas, discovers that he is originally from Morocco. As he travels to learn about his roots and family, he discovers that he is the descendant of a famous Jewish family.'),
('2036620', 'Hayaty Mebahdela', 'https://media.elcinema.com/uploads/_315x420_a4d31e826c76c7a639689cf3fb2796a135d572b3204b50a4b094654d952ee34a.jpg', 'All Ages', '16 July 2015', '98', '8702196', '5.4', 'Tattah’s one unlucky mall guard whose life gets even more complicated after running over a cat and getting cursed for it; he also affects Faten,the woman he secretly loves with the same curse, making life even more difficult.'),
('2036658', 'عزبة أبو حشيش', 'https://media.elcinema.com/uploads/_315x420_bc19d922b881335425b2a215eb610ef07f6f6c009c96620c1f8212087a33492d.jpg', NULL, NULL, NULL, NULL, '5', NULL),
('2036839', 'ebn kar', 'https://media.elcinema.com/uploads/_315x420_3c6e928e18ac4b1ff6fb197c1623cb0c28068f4553a919669d653d0775d130fd.jpg', NULL, NULL, NULL, NULL, '3', NULL),
('2036881', 'Karam El-King', 'https://media.elcinema.com/uploads/_315x420_79b10344a0554e19b049c00b7d24fe6ca78352a5be1edf64c93376786ce6e061.jpg', 'All Ages', '15 April 2015', '86', '426200', '5.2', 'The rise of Karam El-King(Mahmoud Abdelmoghni)\n, starting form Cairo slums, owning an electrical appliance shop, to becoming a major drug dealer. Ironically, he’s chased out by thehe police who accuse him of a crime he didn\'t commit.'),
('2036938', 'And on a Different Note', 'https://media.elcinema.com/uploads/_315x420_86eb8b615a4384d53e017e823982507ce17e6f9f8596a3e0044b2685d2e54596.jpg', NULL, ' 1 January 2015', '24', NULL, '0', NULL),
('2036950', 'مش وش نعمة', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2037031', 'Eazazil abn alshaytan', 'https://media.elcinema.com/uploads/_315x420_82c13693d51cbe3d523a5f69233f1de9dce39d2f187ebdaa7830714077bc9639.jpg', '+18', '22 April 2015', '88', '89770', '4.8', 'With an evil sorcery talisman, the devil Azazel is resuscitated to harm an innocent girl. Azazel first requests a sacrifice, which he is granted. So he haunts the innocent girl, driving her to commit mad and horrific acts. But the girl\'s childhood friend, who happens to have experience in revealing sorcery, finds out the plot, and the lovers eventually unite against Azazel the devil.'),
('2037198', 'The Three Disappearances of Soad Hosni', 'https://media.elcinema.com/uploads/_315x420_786df5b1202806742ae239d3774ae483c68db0858ec9b565b6eda5de88f7e639.jpg', 'All Ages', ' 6 May 2015', '68', NULL, '5.8', NULL),
('2037288', 'Star of David', 'https://media.elcinema.com/uploads/_315x420_eb891cd86bdd0b0d3baa85bbb7a434826ecfddeb666a526ba495bfb7f9cf5f82.jpg', NULL, ' 5 May 2015', '56', NULL, '6.1', 'In the wake of an accident that took the lives of her parents, Sarah decides to leave the country. When she returns, she is in for many surprises when the symbol of the star of David keeps appearing on the walls, writ in blood, and Sarah finds herself trapped in a terrifying world of dreams.'),
('2037337', 'Al-Armouti Fe Ard El-Nar', 'https://media.elcinema.com/uploads/_315x420_55e63e8b0bfffcf6917813ac713fbbafe6d0cd45b58be118cd8b944c8d84b203.jpg', '+12', '18 January 2017', '100', '6612175', '4.5', 'The film revolves around the use of technology by El Qarmouti, when he travels on vacation, he accidentally gets captured by Isis regime, as he shows their misinterpretation of religion.  He\'s confronted by more than a scenario; will he joins them, or try to correct their views, or escape.'),
('2037433', 'Paparazzi', 'https://media.elcinema.com/uploads/_315x420_fa5183c960824c1b97114b4604874dc45d3a1ea4d97175f57fb4a1bc89a3b86e.jpg', NULL, '16 December 2015', '110', '447242', '5.2', 'When an Egyptian young woman travels to Lebanon, she faces lots of trouble throughout her journey, until a Lebanese man offers help. Their relationship develops into a deeper connection.'),
('2037550', 'Zaman Abu Al-Dahab', 'https://media.elcinema.com/uploads/_315x420_171e7eebd42126de0c2e44241ada4ec2ea56e746efc2fd8e6f8a05153158f307.jpg', NULL, ' 1 January 2014', '100', NULL, '3.4', 'The film deals with the spread of narcotics, especially chemical, among young people in local neighborhoods, and the consequent change in the behavior of young people to the worst.'),
('2037625', 'Satow Mosalath', 'https://media.elcinema.com/uploads/_315x420_28c2898a343e23005394a0802174fc0153171de5299d3728bd6b9bb95f7c9f1d.jpg', '+12', '27 August 2016', '76', '1358908', '4', 'A comedy about a young man called Ali El-Marakby who finds one of his grandfathers\' will from ancient Egypt.'),
('2037684', 'Oshan 14', 'https://media.elcinema.com/uploads/_315x420_ba907bfff60a7e7b6d0358727fd3bee8c22867798164cc5bcb11153cbf7430c4.jpg', '+12', '20 January 2016', '101', '16388764', '5', 'As Ta’oun plots to rob the famous singer Ahlam, he recruits his fiancée and her brother to accompany him to Sharm El-Sheikh to carry out the heist. But he is unaware that he is being followed by the police officer who was terminated because of him.'),
('2037742', 'Al-Katiba 418', 'https://media.elcinema.com/uploads/_315x420_b3891b7ef2fc98bf241056c32d57ad4066a5167a8bfcb2445ce6f62cff309e32.jpg', 'All Ages', ' 8 October 2015', '76', NULL, '5.8', 'A look into the Arab-Israeli conflict from the Six-Day War, through the War of Attrition, to the October War, displaying the heroics of the Egyptian air forces, especially the 418 battalion, in facing off against enemy forces.'),
('2037860', 'El Bar El Tany', 'https://media.elcinema.com/uploads/_315x420_91054bdb5743ae1d4275b324ff1162b8327aa32921df7596d91ac15f4c38d289.jpg', 'All Ages', '19 November 2016', '98', '600674', '6.7', 'A group of young men who live in a poverty-stricken village aspire to migrate to Italy seeking a better life. In their journey towards their dream life, they are faced with the treacherous waves of the Mediterranean Sea while boarding an old, worn-out boat and carrying no legal documents.'),
('2039299', 'Noum Eltalat', 'https://media.elcinema.com/uploads/_315x420_16157f5dc6e1455b5afdb61d6c4e58e7c867c5d364fee914b9c9535ff7a538cc.jpg', 'All Ages', '16 July 2015', '96', '1305965', '4.4', 'Mo\'taz has a rare condition that causes him to forget anything that happens on Tuesdays. When important documents are stolen from the Real Estate Registry Office where he works, his sweetheart, the rich girl Nada, and his friend Serag try to help him.'),
('2039389', 'wilderness eagle', 'https://media.elcinema.com/uploads/_315x420_822e7bdc7ab39e21501861278461a10f330cff70e3b7cc297f06905bd47f430c.jpg', NULL, NULL, '148', NULL, '6.6', NULL),
('2039425', 'Ahwak', 'https://media.elcinema.com/uploads/_315x420_c6c0fce1f0ce21a9745c36699ce5eb45c516bc8704e94d653e665e47c668195c.jpg', 'All Ages', '20 September 2015', '120', '22491686', '6.9', 'The film tells the story of Dr. Sherif (Tamer Hosny) who works as a plastic surgeon. During his work, he gets to know a young lady whom he falls in love with her.  But when he got introduced to her single mum (Ghada Adel) and staying with her for a period of time; he falls in love with her as well, and gets confused in choosing between the mum and the daughter.'),
('2039433', 'Devil Hymns', 'https://media.elcinema.com/uploads/_315x420_e432620158a41de47426b6c3f975516cc8de945ef64f905d35c344695c0776d9.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2039611', 'Maskh', 'https://media.elcinema.com/uploads/_315x420_e478d0a24fae52b09e2f2182631d854136e8a27088f8dad412c2581134ce0a2a.jpg', NULL, ' 1 January 2016', '80', NULL, '0', 'Nasser is a police officer who breaks the law all the time. During one such time, the businessman, Ra\'ouf Al-Qattan, starts to apply the law of the jungle to their dealings, sending them into turmoil as Nasser, who quit his job in order to get his rights back, plots to take revenge on Ra\'ouf'),
('2040051', 'Abo Shanab', 'https://media.elcinema.com/uploads/_315x420_542a9784aca44e78f5d67ebaab3323d666cd8248d142dceb8565acac54af8e58.jpg', '+12', ' 5 July 2016', '114', '17326771', '5.9', 'The film tells the story of a female police officer who faces sexual harassment and decides to fight this widespread phenomenon. She is assigned to arrest sexual harassers in public places.'),
('2040092', 'Nawara', 'https://media.elcinema.com/uploads/_315x420_88e526ce2019cb849d93affec34d91469c2141ab7b9fa81fe888b79f5ec6310d.jpg', 'Unrated', '23 March 2016', '122', '1761132', '8', 'Nawwara, a poor house maid working in the house of one of Egypt’s ministers, and is engaged to Ali, a poor guy from the slums. When January 25th revolution erupts, her life, work, and love story take some unforeseen turns with everyone else in the country.'),
('2040112', 'Phobia', 'https://media.elcinema.com/uploads/_315x420_71479bfa807c3b66738134a592a374c1287b56b9e294ead8c59d58a2e14fbb97.jpg', NULL, '26 April 2017', '93', '35877', '5.7', 'A comedic tale about two people who suffer from phobias and the paradoxes they encounter in a creative dramatic context.'),
('2040159', 'Fas Malh We Dakh', 'https://media.elcinema.com/uploads/_315x420_d17ad119ba4595c50ec908eff867f9f6f7fa1c163211fd3910826d73643cfcdf.jpg', 'All Ages', '20 April 2016', '114', '749082', '6.1', 'A very unlucky guy, Bakry, ends up with an abandoned and cursed theater house, and he must find a way to elevate the curse, as it affects him every time he enters the theater.'),
('2040189', 'Khanet Al Yak', 'https://media.elcinema.com/uploads/_315x420_a0c1e8ea004fbbc9717750b739c9b3ad64a880254813bc1fe158608123d5076e.jpg', 'All Ages', '23 December 2015', '91', '614600', '6.2', 'Five young fellows wake up to find themselves in a deserted place. Failing to remember who they are or who/what got them there in the first place, they embark on a long journey to recapture memories and find their way back.'),
('2040313', 'I\'m The Director', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2040324', 'Ali Meaza wa Ibrahim', 'https://media.elcinema.com/uploads/_315x420_6605e769883125de2cb2761631f7733fcdf9372169ae6753bad2329ea1f8ee45.jpg', '+16', ' 1 March 2017', '97', '252394', '6.5', 'Ali is a man in his twenties who grows attached to a goat which earns him ridicule from everyone around him. When his mother forces him to go to a spiritual healer, he meets Ibrahim who suffers from severe depression and hears mysterious noises. Ali, his goat, and Ibrahim take a trip across Egypt.'),
('2040327', 'The Fourth Generation', 'https://media.elcinema.com/uploads/_315x420_86a0b24cae35b0ea90ee36dee90b9cd6eeb3086ecb25b3388eb9efa07e250c2b.jpg', 'All Ages', '23 September 2015', '110', '3446318', '6.7', 'Four friends find themselves in an unexpected dilemma after one of them falls for their principal\'s daughter. They find themselves on the run from a drug gang, a terrorist organization, and the police after they are accused of trying to assassinate the Minister of Interior.'),
('2040384', 'An Egyptian Woman', 'https://media.elcinema.com/uploads/_315x420_bf33bb6647051d927daa5d3564e38fa766b6776520c4b42337aa48ed98c4b4fc.jpg', NULL, ' 1 January 2013', '85', NULL, '0', 'Wafaa is a social researcher conducting a study about Egyptian women. She records the results of her research using the hidden camera method in order to document people\'s reactions to different situations.'),
('2040399', 'Hepta: El Mohadra El Akhyra', 'https://media.elcinema.com/uploads/_315x420_4a234cda91b737a8179228576435bfbce3e00cc182952ffc34e13a9495fa52b2.jpg', 'All Ages', '20 April 2016', '120', '27000103', '8.1', 'The renowned psychologist Dr. Shukry Mokhtar dedicates his final lecture to answering the most important question ever asked: how does love start? He explains the seven stages of love via four different love stories, going through their ups and downs.'),
('2040428', 'Baraet Raya We Sakina', 'https://media.elcinema.com/uploads/_315x420_830d0fb0f235d86884bcef82905639fc657084f1acadd98fac4b69a844edb79e.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2040430', 'Neaama', 'https://media.elcinema.com/uploads/_315x420_f028f229e0f2209630c2efab78deee5db5d91d15d0fcd65c8ff65c391b588621.jpg', '+18', '16 March 2016', '90', '102310', '4.4', 'Na\'ma is a beautiful girl who lives in a local neighborhood. As some of her dangerous neighbors start to pursue her, her brother is forced to step in to protect her from their harassment. Meanwhile, Na\'ma falls into a lot of suspicious relationships.'),
('2040518', 'Konghor Hobena', 'https://media.elcinema.com/uploads/_315x420_16d48eff9ea80e35711ba52b9720959fe47220f6179e3d3b98dc77f8b9571192.jpg', 'All Ages', '20 April 2016', '107', '4751489', '5.8', 'A young man who works for a freight forwarding agency finds himself responsible for a shipment of real live Kangaroos instead of small statues of Kangaroos. He has to look after the animals himself until he can find their owner, with the help of a pretty young vet.'),
('2040696', 'إن عاش', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2040734', 'Kedbet Kol Youm', 'https://media.elcinema.com/uploads/_315x420_0b5871181d3159f5ff12098c5173354b7dcfef662216fb3f0f7b973f671371d4.jpg', 'All Ages', '20 January 2016', '98', '4060483', '6.9', 'Hisham and Hadia, who work at the same advertising agency, an invitation to spend a vacation in Marsa Alam, in a resort owned by Sherihan. Hisham takes his wife, Aida, and Hadia takes her husband, Adel, and the four of them go on a vacation that will put their marriages to the test.'),
('2040814', 'Haraam El-Gasad', 'https://media.elcinema.com/uploads/_315x420_5ee2dcff52e6bc5663ed263d581b0c131c1314c962e81ca2709b04601a6dc362.jpg', '+18', '29 March 2016', '121', '573982', '6.9', 'Hassan and Fatma are a couple who work for a wealthy and powerful farm owner called Mourad. When Hassan\'s cousin Ali escapes from prison during the 25th of January revolution, Mourad discovers that Fatma and Ali had a romance years ago, which brings serious ramifications for everyone involved.'),
('2040848', 'Mother Of The Unborn', 'https://media.elcinema.com/uploads/_315x420_d07a1cd40e1feb5d030e2d57a85935a648a1be7b815c43887ba7033dd1185fa0.jpg', NULL, ' 4 November 2015', '95', NULL, '5.5', NULL),
('2040967', 'أبناء إبليس', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2041004', 'Hedeya Men El Madei (20 September)', 'https://media.elcinema.com/uploads/_315x420_c47c6ff75637b421eff1a3d795d5b95975204a2f4c4a2fa539c32f6a644ed791.jpg', 'All Ages', '30 November 2016', '78', NULL, '5.9', 'On his 75th birthday, Dr. Mokhtar Younis receives a wondrous present from his young daughter who is also a film student; two plane tickets to Rome so he could find his long-lost love, Patricia, to whom he hopes to give the wedding ring which he should have given to her 33 years ago.'),
('2041091', 'Mawlana', 'https://media.elcinema.com/uploads/_315x420_bae93e74a088612551db96c6575b1ad19d89d52294d4ead5c0cbfdbf294996f3.jpg', '+12', ' 4 January 2017', '107', '13178387', '6.4', 'Based on the novel by Ibrahim Issa, the movie revolves around Sheikh Hatem El Shenawy (Amr Saad), the most influential religious preacher through media who has his creditability shaken up due to his close relationship with politicians.'),
('2041105', 'Fi Youm', 'https://media.elcinema.com/uploads/_315x420_ffe178a2b4cf96a2ca01b83976748f44c7d69b88816b3fd7b29993134bec893b.jpg', NULL, '13 November 2015', '63', NULL, '0', 'A story about the lives of six people that show how they lost hope, dignity and their sense of security as they struggle for a good life, exploring the hurdles standing in their way.'),
('2041171', 'Something Wrong', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, '20 June 2013', NULL, NULL, '0', NULL),
('2041229', 'El Sandok El Aswad', 'https://media.elcinema.com/uploads/_315x420_850c3137cb96005fa07abafcaeb23cfff53e95f2c2c0e6a5ccb16a6e7b345497.jpg', '+12', '28 October 2020', '90', '8824255', '5.8', 'Two strangers break into Yasmine’s house determined to locate and steal an important object. She fights back and tries to escape, will she be successful?'),
('2041273', 'Min Talatin Sana', 'https://media.elcinema.com/uploads/_315x420_7e0326884b99a72af4805b2fe87f4e3f3bf0243d12258289ec6b123443d7b434.jpg', 'All Ages', ' 6 July 2016', '146', '23207995', '8.3', 'Omar returns from abroad to divide his wealth equally between his nine family members. He tells them that his money is cursed, and that the curse follows anyone who has it. His cousin, Emad, observes a strange pattern where each family member is a target of a tragedy, and tries to solve the mystery behind the curse.'),
('2041306', 'الزومبي جوز أمي', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2041322', 'Elly Ekhtasho Mato', 'https://media.elcinema.com/uploads/_315x420_2b0f59c0ffd7d9b27c7bd6b5018ebdb73fe1507af13216a1b25cbe92adae1440.jpg', '+16', '20 April 2016', '110', '3237197', '4.2', 'The film tells the story of seven women who live in the same boarding house and have a deep bond with one another. They discuss their personal issues, looking for love and laughter in a dark society dominated by men in all aspects.'),
('2041419', 'Al-Mon\'ataf', 'https://media.elcinema.com/uploads/_315x420_13a682a477758667a26f5f66b3356804ce5dfc78d3b6bf149ba12f031c1cda06.jpg', NULL, NULL, '81', NULL, '0', 'A Jordanian man with Palestinian roots suffers from mental issues that cause him to avoid all kinds of social interaction. He lives in a small truck designed by himself, and on his journey meets three different people who each affect his sheltered life in their own way.'),
('2041432', 'Hassan Wa Bo\'loz', 'https://media.elcinema.com/uploads/_315x420_b0f00fa522a930621f3b5c26e1c2d2105fdf2aa211cdd836c5292aad98d1eab2.jpg', 'All Ages', '14 April 2016', '98', '11530343', '6.7', 'The story of two conjoined brothers (Ali Rabea and Karim Fahmy) who are exposed to funny situations, along with their cousin (Muhammad Osama) who got involved in their problems.'),
('2041442', 'We Have Never Been Kids', 'https://media.elcinema.com/uploads/_315x420_1e5210ab9e4e574110f9a88f1f8ef3d50e6cc6f972980e87a833180cae436ed6.jpg', NULL, ' 1 December 2015', '104', NULL, '0', NULL),
('2041445', 'Hijab', 'https://media.elcinema.com/uploads/_315x420_e862f2953efadc848fca21a4f63aa2dfcbe8ca8c4240b65bc75aecef30a72279.jpg', NULL, NULL, '78', NULL, '0', NULL),
('2041500', 'El Haram El Rabea', 'https://media.elcinema.com/uploads/_315x420_9ee8565cdb95693477c6d0ae9f82e2656f5ce5b1ecd98e27f51b2ff65ec47bab.jpg', NULL, ' 3 February 2016', '92', '5845645', '7', 'This suspense-thriller looks into the hidden world of online hacking through several methods, such as social media, different forums, and so on. Yusuf, a brilliant engineering student, is behind a lot of the operations that are being talked about.'),
('2041620', 'Al-Meshakhsaty 2', 'https://media.elcinema.com/uploads/_315x420_090508bffec531b0e08202a16667be5813a420592cb198aa6c7c3665206e6383.jpg', NULL, '17 February 2016', '95', '1038902', '2', 'In the wake of the 25th of January revolution, the authorities ask the Impersonator to take on the identity of the ousted president Mohamed Morsi and a number of Muslim Brotherhood leaders in order to save Egypt from the growing control of the Muslim Brotherhood.'),
('2041669', 'Yoom Men El-Ayam', 'https://media.elcinema.com/uploads/_315x420_1e507e6f8c1f7c6e74647a1670e754d3c6f6251d840babc754accc6f6242efff.jpg', 'All Ages', '22 February 2017', '120', '375133', '6.5', 'The intertwining love stories that take place during the travel of a number of passengers on board a tour bus  between Cairo and Mansoura.'),
('2041706', 'Ta3weza 2', 'https://media.elcinema.com/uploads/_315x420_84aac8732754a5ef35d2a0d46e8101c23f426604bdd4096c419486aafa0c8595.jpg', NULL, ' 5 April 2017', NULL, '142579', '4.8', 'Three young men create fake profiles on Facebook and they all befriend the same girl, which leads to a series of endless comic paradoxes.'),
('2041708', 'ليلة شتا', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2041761', 'Bra Fi El Sharee', 'https://media.elcinema.com/uploads/_315x420_fc933c7974a5c88aad75608ac360f61791999895bf03a2bf051768ebe6ef003b.jpg', NULL, '26 March 2017', '72', NULL, '5.8', 'Working-class suburb Helwan, where ten factory workers enrol in an acting workshop and re-enact lived-through cases of injustice in the workplace, police violence, fabricated lawsuits and countless other stories of corruption and abuse. It all takes place on a building rooftop overlooking the heart of Cairo where a space is born spanning both fiction and reality, and where attendees step into and out of character, moulding the show that narrates their daily lives.'),
('2041968', 'Selah Al-Talamiz', 'https://media.elcinema.com/uploads/_315x420_0b952f1a2adefb860a143774942a7d46e4957f1dcdbc05c8bcc12136554cbb91.jpg', NULL, '27 January 2016', '97', '101846', '3.1', 'A comedic exploration of the issue of education in our schools and the various situations that both students and teachers find themselves in, through the story of Usha and his little friends and what happens in their school.'),
('2041981', 'The Black Dress', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2041988', 'Tofahet Hawa', 'https://media.elcinema.com/uploads/_315x420_b6219e548190e6e1c0a633bc383df2b169e4aa56897809d5555d9c2054102c49.jpg', NULL, '20 July 2016', '70', '58035', '4.4', 'A story of two young women who enjoy a close friendship. One of them is infatuated with the other one\'s lifestyle, and dreams of having the same life. Eventually, she enters the world she was dreaming about, and discovers that it is not what it seems.'),
('2042023', 'باركينج', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2042090', 'El Bab Yefuwt Amal', 'https://media.elcinema.com/uploads/_315x420_b0f64ac490aa5849cb8252f05dd546e5389835c6bd85c36f5b2af6a9e6b0329c.jpg', 'All Ages', ' 3 August 2016', '86', '306840', '4.7', 'A married couple, the laywer Amal (Dora) and her veterinarian husband Tawfiq (Sherif Salama), are in constant problems, as Amal is continuing to work in the final months of her pregnancy, which leads to getting her into labor while she\'s in court.'),
('2042201', 'Qesti Beyewga\'ni', 'https://media.elcinema.com/uploads/_315x420_9e7d82cc2731fa8eeb5f076002e0863bbcb079ad3e4874a8bad831a03db28d4e.jpg', '+12', ' 4 April 2018', '110', '746799', '5.4', '(Hani Ramzi) lives a simple life, working as a bill and installments collector for electrical appliances, where he faces many comic paradoxes during his work due to the high prices in Egypt.'),
('2042309', 'Asal Abyad', 'https://media.elcinema.com/uploads/_315x420_5a02d790d18431f519586eb87353582c34ec75c5bd2ed66a7986566ddebce13d.jpg', 'All Ages', ' 5 July 2016', '107', '1128384', '6.3', 'A son of a wealthy family is kidnapped by a gang, and they get into plenty of ironic situations in order to get him back.'),
('2042417', 'The American Game', 'https://media.elcinema.com/uploads/_315x420_e27d04f1fa727e88f5c56dd6650aa839babda98b40cafa0d329b75057fcf80f4.jpg', NULL, '27 March 2019', '91', '652987', '3.4', 'As a young couple faces many financial and social difficulties that impede their marriage, the owner of the company where they both work unexpectedly makes them a tempting proposal that could help them solve their problems but will put their love to the test.'),
('2042435', 'The Mischievous Fathalla Mahrous', 'https://media.elcinema.com/uploads/_315x420_e67c3a8056b6cf14a9dda28c5e52b1e593327c1fbb640a01a8465ee1f3cc2b58.jpg', NULL, ' 1 January 2015', '52', NULL, '0', NULL),
('2042446', 'Khaltet Omry', 'https://media.elcinema.com/uploads/_315x420_47ea97fce3b3653307cf2133881f533800639470b5c08661d3c662e47fb74250.jpg', NULL, NULL, '80', NULL, '0', 'A social romance about the problems facing today\'s youth, like unemployment and marriage hardships, in addition to reflecting the social status of the Egyptian population in current times.'),
('2042523', 'Hamlet Freezer', 'https://media.elcinema.com/uploads/_315x420_902aab08315f761f7dc843549de582ba6b848fed832400338c94c64a0c50bc41.jpg', '+12', '10 September 2016', '123', '8404352', '6.5', 'When Egypt\'s climate changes , turning the country into a frozen state, a group of intelligence officers travel to Italy to get a device that can stop the frost, posing as a movie crew.'),
('2042558', 'Kalb Baladi', 'https://media.elcinema.com/uploads/_315x420_65e7d221f655e39041a880253bb3bbb2d92edaa77977f5a9915a6b4d5f8259e6.jpg', '+12', ' 8 September 2016', '100', '16656137', '5.8', 'A comedy movie about a thief who steals street dogs and sells them. Oddly he learned this profession from a female dog that breastfed him when he was a baby, which led him to acquire special powers.'),
('2042743', 'Samaka Wa Sennara', 'https://media.elcinema.com/uploads/_315x420_cc3e593503e37ecd0cf1952663040fb32192555cb4745175c3bb7360de628749.jpg', NULL, ' 2 August 2017', '100', '248402', '6.2', 'Two con-men embark on a comic adventure, where they start out with small conning jobs, and decide to plan for a bigger job to land them more money. However, things don\'t go as expected.'),
('2042884', 'El-Qerd Beytkalem', 'https://media.elcinema.com/uploads/_315x420_cc039b4eb47a125a8981f4bf36d8526240abf86e1f0aff42db3fc299f5d63540.jpg', '+16', '25 January 2017', '91', '11837400', '5.8', 'Two magician brothers, Taha and Rashad El-Shenawy, prepare to pull off a magic trick to free their wrongfully imprisoned father.'),
('2042974', 'Gahim Fe El Hend', 'https://media.elcinema.com/uploads/_315x420_50871fbee77666775fd1320810cbe617b88c202407bd17bef656c43dcc967f03.jpg', 'All Ages', ' 5 July 2016', '107', '32166584', '6.9', 'A Special Forces team is assembled to retrieve the Egyptian ambassador after he was kidnapped in India. It is then discovered that the team isn\'t from the Special Forces, but rather a musical band.'),
('2043112', 'El-Kenz: Al-Haqiqa wa Al-Khayaal', 'https://media.elcinema.com/uploads/_315x420_aa0c15b0fdfc2b1bcacfa4d52582f273e05bd056ebc7fbe78090308889259287.jpg', 'All Ages', '31 August 2017', '165', '19143730', '8', 'The Treasure revolves around three eras: the Pharaonic era, the Mamluk era and the first half of the 20th century. It discusses corruption and how some clerics have involved religion in politics in order to obtain high positions and gain power which they have abused over the ages.'),
('2043126', 'Rehlat Yusuf', 'https://media.elcinema.com/uploads/_315x420_80df084a053d3616ac9d1beb5601327888bdb47c75db39af02d7a3851a352a6f.jpg', 'All Ages', '14 March 2018', '99', '343769', '4.7', 'As a multinational gang attempts to steal a scroll from Egypt, their leader discovers that he has a daughter he didn\'t know about that got involved in one of his crimes.'),
('2043167', 'Rouge', 'https://media.elcinema.com/uploads/_315x420_e563035c7284e941e0c986a2d54d4be60e86cd695e3eebd7bcdbfc346ceb8adf.jpg', 'Adult Supervision', ' 2 November 2016', NULL, '69010', '5.8', 'The story follows the poor girl Wafaa who works in a beauty center, and has an affair with the husband of the center\'s owner. When she gets pregnant by him, she decides to commit suicide, but the delivery guy Mohsen saves her life, and they spend an exciting night together.'),
('2043342', 'Kitabah Ala Al-Talj', 'https://media.elcinema.com/uploads/_315x420_682764adb2df3d29704dde61f1b04157daaa348606d2dd6edce7060d31fe646f.jpg', NULL, NULL, '90', NULL, '0', 'The film discusses different ideologies in terms of religion, geography and intellect reflected as well in the current rifts between different parts of the Arab world. A group of individuals strive to find the hidden truths about themselves.'),
('2043491', 'Believe', 'https://media.elcinema.com/uploads/_315x420_df80ecdedcc541896d8da7ff9ac1eb4793133dba3e293e4f6fa09fdbba5f0efb.jpg', NULL, NULL, '119', NULL, '0', 'Matthew is a business owner in a small town going through tough economic times. As his desperate measures to save his business anger his employees, a chance meeting with a joyful boy settles his struggle between doing what\'s best for his business, or funding a Christmas pageant for his community.'),
('2043798', '30 Youm Fi Ezz', 'https://media.elcinema.com/uploads/_315x420_b635795ac78b7851a6cd9c0da4496eccb8d108c8e38b6fe4bd426d5cae54baee.jpg', '+12', ' 5 July 2016', '90', '6080798', '3.3', 'Inside a prison, a man decides to help five convicts to escape in order to help him on a 30-day mission. The mission is to retrieve a nightclub that Shafika has inherited from her late husband, and is currently feuding with her husband\'s son over it. The son would do anything to get Shafika out of his way.'),
('2043853', 'Party Fe Harty', 'https://media.elcinema.com/uploads/_315x420_f7c68cb65b210445f894428fbeb04bb7d4c0a0155d021007acfa1c6f63d2a56c.jpg', '+12', ' 5 July 2016', '104', '243107', '3.7', 'In a local alley, Shuman seems to have Superpower, which he has inherited from his superhero father who happens to be Iron Man. A gang member, Diab, decides to use Shuman\'s powers for his personal benefit, and wants his protection as well as his help in stealing from a nightclub.'),
('2043953', 'Akhdar Yabis', 'https://media.elcinema.com/uploads/_315x420_d87f30a28acab69b83eeb79729e26ebeeaf6d5f3960f2ab8495c5cb06a1a20e3.jpg', '+18', '25 October 2017', '73', '111127', '6.3', 'A week in the life of Iman, who is trying to convince her relative to attend the engagement of her little sister, on behalf of their deceased father. She insists on complying with the traditions that she has been brought up with, making them her first priority.'),
('2043957', 'Saber Google', 'https://media.elcinema.com/uploads/_315x420_459d3f26369a7af4179f0ee0b0a91e67627cbbce165ff924b1a32166eaddcc2a.jpg', '+12', ' 7 September 2016', '123', '4505489', '4.7', 'Saber Ali Tmany (Mohamed Ragab) is a technology geek, who everyone calls Saber Google, his skills make him enter a world of suspicious and illegal deals with businessmen , which makes him escape to a European country, but the risk continues.'),
('2044027', 'Tahet El-Tarabiza', 'https://media.elcinema.com/uploads/_315x420_e386d7b65d7ca439b6ae48cc7fed84ab6f54218afeb355d55a25c949d010a4b1.jpg', '+12', ' 7 September 2016', '81', '2469224', '4.8', 'After the lawyer Asem Sinjari gets into a train accident, he\'s transformed into someone else called Hnko, who defends ministers in corruption cases.'),
('2044028', 'Talq Sina\'iee', 'https://media.elcinema.com/uploads/_315x420_24bb11d26b3425fdb03c0120d4df00220b9016bfd847b657ff100adfcd54975e.jpg', '+16', ' 3 January 2018', '90', '14287138', '7.4', 'A husband discovers that his pregnant wife has taken pills to speed up the delivery process while seeking a visa to America, in order to give birth on American soil so that their son would obtain the citizenship'),
('2044097', 'Ashan Khargen', 'https://media.elcinema.com/uploads/_315x420_bf7003fdc30560e70777272c5903f5a45f29287f7e1317cf498b8b325d122256.jpg', 'All Ages', ' 8 September 2016', '99', '9986447', '5.3', 'Ramzy is a playboy whose boss tries to wed to his daughter, Laila. When Ramzy and Laila meet, a man they don\'t know leaves them a bag full of money which sends the real owner of the bag after them.'),
('2044189', 'Alkhrog An Elnas', 'https://media.elcinema.com/uploads/_315x420_2aa4c17b04293def1442bad34ca229cfc3e955ec63fbeb00c88b31cc9e673889.jpg', '+18', '28 March 2018', '85', '163070', '4.4', 'A film director who is facing a major financial crisis turns his life upside down when he turns to drug trafficking.'),
('2044228', 'Ward Masmoum', 'https://media.elcinema.com/uploads/_315x420_2d69fc36c736b336622c3ef5d51932745e72bf5af2e59b53875401fb48f5db8d.jpg', '+16', '28 November 2018', '70', NULL, '4.1', 'Tahiyya is a young woman who works as a cleaning lady, cleaning toilets. She has one brother, Sakr, who she depends on for everything. Sakr decides to illegally immigrate to Italy, causing her to lead a sad and lonely life without a hope to change her dreams into reality.'),
('2044266', 'Feen Qalbi', 'https://media.elcinema.com/uploads/_315x420_40ff319c661cf468d5ff7d6f3ef42797859614ae13cf030c26e71981828239fd.jpg', 'All Ages', '18 January 2017', '110', '1718114', '5.6', 'A man marries the woman he loves, but an accident leaves her in a coma for three years. During that time, the husband meets another woman, and lives in a conflict between his feelings for her and his feelings for his  wife. He is unable to marry her until his wife wakes up from her coma.'),
('2044358', 'Horob Edterary', 'https://media.elcinema.com/uploads/_315x420_67fa9e06425e2a26446ba05f14e6cf025ca247bcef3b2fae0d238ae3d1727175.jpg', '+12', '25 June 2017', '103', '55551644', '7.6', 'When the businessman Yahya Zakaria (Mohamed Farrag) is killed, four people are accused: Adham (Ahmed El Sakka), Mostafa (Amir Karara), Youssef (Mostafa Khater) and Nada (Ghada Adel). Events begin to escalate as the four try to work together to prove their innocence.'),
('2044362', 'El-Asleyeen', 'https://media.elcinema.com/uploads/_315x420_3eaf7b42dc89a935c35d02092b6887a4d6f5f2cd4e43de9f913218eb64b5c8b4.jpg', '+12', '25 June 2017', '120', '8676740', '7.4', 'Samir Alaiwa, a bank employee who is suddenly fired after a decision to cut labor. He tries to look for a new job, then he finds a cell phone at his door step that contains photos and videos from his past, before receiving a call that will change his life forever.'),
('2044411', 'Laf We Dawaran', 'https://media.elcinema.com/uploads/_315x420_d93f53dd1100fca49804d230d2fa5b7249129c401334ccadcc5471163fb2497d.jpg', '+12', '11 September 2016', '101', '43277037', '7.2', 'Nour Kabbani is a tour guide who goes with his family to Sharm el-Sheikh, taking advantage of the company\'s offer to spend the honeymoon in order to meet an Italian girl named Perla. He finds a girl called Layla who lives in the same villa.  Nour\'s family plot with Layla to ruin Nour\'s plans with Perla.'),
('2044666', 'Titanic: The Arabic Version', 'https://media.elcinema.com/uploads/_315x420_c2c82b67fbada69150ae8c09bb83d3ee5ed881aa4ff8ae21f56ebda757fa74a8.jpg', NULL, '11 September 2016', '30', NULL, '2.6', 'A satirical version of James Cameron\'s Titanic that follows the love story between a poor guy from Port Said who takes the ship Titanic on the way to Dubai, and a wealthy girl who is being pressured by everyone around her to marry a rich man from the Gulf.'),
('2044793', 'المتمرد', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2045006', 'Tesbah Ala Khair', 'https://media.elcinema.com/uploads/_315x420_2847be120f89e74fb10b6beb7c75cb6f8a56cca452639cc0d6c7d35f07d242d1.jpg', 'All Ages', '25 June 2017', '100', '27469602', '8', 'A successful and wealthy engineer named Hossam El-Khedaiwy, who has recently suffered from problems in his normal life, resorts to an alternative life through a new device to enter the dream world.'),
('2045043', 'Akher Deek Fe Masr', 'https://media.elcinema.com/uploads/_315x420_187cc0c486e0532c43e33c291f3b374fd835b5158ee0aec899c794320bbffc81.jpg', '+12', '25 January 2017', '110', '8916769', '6.1', 'Alaa Al-Deek (Mohammed Ramadan) is a bank employee, who hates women from a young age and avoids dealing with his family women. When all the men in his family die in a Nile cruise, he has to take full responsibility for the affairs of his family, all of whom have become women.'),
('2045048', 'We\'re Not Heading Into Trouble', 'https://media.elcinema.com/uploads/_315x420_317abec0dc37a545eefa2bd877595cc20221788e3e5d838e1488c46e8d9caf08.jpg', '+16', '12 April 2017', '82', '232825', '4.5', 'A group of careless, aimless youth can only live their lives recklessly. They spend their time at nightclubs with women, until an incident forces them to change the way they think. But what is this incident and how will it change the course of their lives?'),
('2045085', 'تاج السريان', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2045275', 'We Are Egyptian Armenians', 'https://media.elcinema.com/uploads/_315x420_b431a1f434ab8c73cd7b049a01b1dfe34dee84bd2aeaab061203880d78d5c1a1.jpg', 'Unrated', '17 November 2016', '90', NULL, '6.3', NULL),
('2045277', 'The last journey together', 'https://media.elcinema.com/uploads/_315x420_c465d237a650d91c2be4fdbed771292a85042beea05a859db7cae66f753f4735.jpg', 'Unrated', '18 November 2016', '15', NULL, '0', NULL),
('2045418', 'Photocopy', 'https://media.elcinema.com/uploads/_315x420_7ba8c476b422acb31b1f8a059aee7590b4ab80c4978bdad30fe2f227565fe448.jpg', NULL, '20 December 2017', '90', '758249', '7.6', 'Mahmoud is man in his late 50s, who owns a photocopying store.  When he comes across a topic about dinosaurs, he becomes obsessed with searching for the causes of its extinction, which leads him to rediscover love, friendship, paternity and the real meaning of life.'),
('2045538', 'The builders', 'https://media.elcinema.com/uploads/_315x420_7e798ac3cad2f8ccf89c7a677f5100121863fbc202997b376fec35948671db45.jpg', 'PG', NULL, '18', NULL, '0', NULL),
('2045556', 'Egyptian Jeanne D\'Arc', 'https://media.elcinema.com/uploads/_315x420_ad31b0847351c2ff01050488bb0a321c94b550a74820285373d38219e21ec4e2.jpg', 'PG', ' 8 December 2016', '85', NULL, '0', 'The film tackles the emancipation of women in post-revolution Egypt, highlighting issues of oppression, guilt-tripping, and the religious categorization of women, which are problems encountered by all women, especially artists.'),
('2045601', 'Shantet Hamza', 'https://media.elcinema.com/uploads/_315x420_6b76a40b27ff1792480f312e4633f4e25ac633ce501ba0df87ee5262fe0c0e84.jpg', '+12', '31 August 2017', '85', '3347807', '6.4', 'A professional con man (Hamada Hilal) falls in love with a powerful woman who used to work for an infamous con gang.'),
('2045603', 'Bashtery Ragel', 'https://media.elcinema.com/uploads/_315x420_13dc17612f4cc597f1819eb05f165130b306a4fdbf633596e2258a6a208e1428.jpg', '+16', '14 February 2017', '100', '5272567', '7.2', 'Shams Nour El Din is an Egyptian bank employee who dreams of becoming a mother and having her own baby, but the problem is that she refuses the idea of marriage.  She finds a solution to her dilemma when she meets a veterinarian called Bahgat Abou El Saad.'),
('2045632', 'The Unknown Sweet Potato Seller', 'https://media.elcinema.com/uploads/_315x420_458333856b489113bc20995370f88bdf6f50c656378a50f63660b620c1482a4b.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2045674', 'Mamnoo\' Al-Ekterab Aw El-Tasweer', 'https://media.elcinema.com/uploads/_315x420_f024ee7a10c387bab48358539f31b8d19eb7750972737f2fbbc5c92770c846ae.jpg', '+16', '15 March 2017', '106', '463940', '5.6', 'Thoraia comes from a wealthy, aristocratic family. She owns a building in Helwan, and part of the building has been taken over by a Police Station. Thoraia decides to file a lawsuit in order to get back that part of the building that is rightfully hers.'),
('2045753', 'Bank El Hazz', 'https://media.elcinema.com/uploads/_315x420_a6573a42c97205c3a4329886aa69c5ad4aa239eeef5598547e907961f0158d0d.jpg', '+16', ' 5 April 2017', '122', '6072396', '6.8', 'After Mohamed Saleh (Mohamed Mamdouh) gets fired  because of his ongoing abuses against customers, he plots with his colleague Amr (Akram Hosni), and Zaro (Mohamed Tharwat) their partner in the PlayStation Store , to steal 15 million pounds from the bank where he used to work.'),
('2045976', 'Raghda Motawahesha', 'https://media.elcinema.com/uploads/_315x420_8d105ec55d54e3092047d546802881f920e9c1e2499da36fd823049885fa23e9.jpg', '+12', '17 January 2018', '92', '20542796', '7.4', 'Ismail ( Ramez Galal) works as a makeup artist at a beauty salon. He has recently got divorced and is now raising his son on his own. When he learns that an ad director is looking to hire a young lady, he uses his professional makeup skills to disguise as a female and he wins the part.'),
('2046071', 'Rahaf', 'https://media.elcinema.com/uploads/_315x420_1459221444b3a7669c2311a0af580351d487830482adc39fc38b017569d695a7.jpg', NULL, NULL, '85', NULL, '0', 'On the way to Hurghada for their honeymoon, a couple\'s car runs out of fuel which forces them to go to the first villa they encounter to look for help, only for the villa\'s guard to put them in a serious predicament.'),
('2046365', 'Movies Scenes', 'https://media.elcinema.com/uploads/_315x420_a2f340e9770729b2d678dc2f6f9ba8acdb4ffc3f79e9eb90479c8690ff339623.jpg', NULL, ' 3 February 2017', NULL, NULL, '5', NULL),
('2046367', 'Remote Control', 'https://media.elcinema.com/uploads/_315x420_22a84ea386e11ca5a3119e51e4d6e18de93cde1d6123fb65b179d89e8c0f36ab.jpg', NULL, '19 February 2017', NULL, NULL, '0', NULL),
('2046368', '1984', 'https://media.elcinema.com/uploads/_315x420_2b2b3ee6151f163296a97b4255ef09250ea06c00b583133dbb148463ae42f6de.jpg', NULL, '31 December 2014', '22', NULL, '0', 'Ali communicates with Mona by accident over the phone, and during the events of the revolution they restore their old friendship, and witness the many events that the country is going through.');
INSERT INTO `MOVIES` (`id`, `Name`, `img`, `age_rate`, `Release_date`, `Duration`, `Revenue`, `Rating`, `Description`) VALUES
('2046449', 'Endama Yaqa\' El Insan Fi Mostanqa\' Afkaro Fayanahi Bi Al-Amr Ela Al-Mahzala', 'https://media.elcinema.com/uploads/_315x420_f46164ac2511b7bb22345bf755b3190b58192e90da3e5d624f893a61baf58878.jpg', '+16', ' 5 April 2017', '97', '2042680', '5', 'Hani, a beautician, Bebo, a jihadist who recently joined an Islamic extremist group, and Samir, a drug dealer, are on a trip to Lebanon. The three of them are captured by the extremist group and try to find a way to escape the grip of its leader Abu Imad.'),
('2046473', '3otl fanny', 'https://media.elcinema.com/uploads/_315x420_fdb1804f6f17c570803e4d3200afceb419bd074070ea4d6023bf37fa624c8cdd.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2046518', 'Petra: The Gate Of Time', 'https://media.elcinema.com/uploads/_315x420_f197c3235062f6603dc5c68dace03a295829d97786f9a1919f3d07666b7db3fc.jpg', NULL, '29 March 2017', '86', '113410', '6.3', 'A group of young people travels to the Jordanian city, Petra, in order to prove a scientific theory associated with the city, but they end up facing countless problems.'),
('2046519', 'Yeg\'alo \'amer', 'https://media.elcinema.com/uploads/_315x420_8ed7be43d5ea2596b790ea92fd955991f4c9997af658281b00573dbc4d74c3b8.jpg', '+12', '12 April 2017', '88', '2351148', '3.8', 'Amer (Ahmed Rizk) is a hesitant person who doubts all those around him, including his wife whom he divorces three time and it affects their only child, Karim.'),
('2046547', 'Khair W Baraka', 'https://media.elcinema.com/uploads/_315x420_c5621c67b3e7396fb7440b960891603a07f7521fe9d890ba67cfd808e3447720.jpg', '+12', '30 August 2017', '110', '10164227', '5.5', 'Two brothers who are looking for a job, find themselves in many comedic situations during their search journey and when they work in professions they know nothing about.'),
('2046552', 'Biat set', 'https://media.elcinema.com/uploads/_315x420_5bebbfa4a7c3f931ee626f88d74c3a5718dcf35e10874b4453db296e2351fa6c.jpg', '+16', '11 December 2019', '77', '566522', '5.3', 'A lot of evil organizations have awaited for the myth about the resurrection of Set, the God of Evil, to come true. For years, the blood of innocents has been shed as offerings in preparation for his return. Is it time for him to return? Can the journalist Salma uncover the secrets behind the myth?'),
('2046590', 'Hold Your Position', 'https://media.elcinema.com/uploads/_315x420_4e16ad73cc1807369de4eb457034a7ca409070ac8ed1202a254df4ddfd8f3bbe.jpg', NULL, '12 April 2017', '86', '871241', '3.8', 'Ayman is a casting agent who lives a very liberal life. Hazem is a responsible man who lives a routine life with his wife and kids. As their different personalities pit them against each other, their lives intertwine in the wake of a strange experiment.'),
('2046595', 'Sokkar Barra', 'https://media.elcinema.com/uploads/_315x420_7c864da58b6990bcd10a2dc3974496cb20bc4371cb1b6bc2ad91f2e37b425568.jpg', '+12', '29 March 2017', '88', '40006', '5.5', 'A group of friends meet at a wedding party after years of separation. During the wedding, an event takes place that changes the course of the night and all their lives.'),
('2046596', 'Les Petits Chats', 'https://media.elcinema.com/uploads/_315x420_9cba7324200ce734a39f9c112cbe3fc5d1e3fb2428687dfa7dc49e57ef701987.jpg', NULL, NULL, '80', NULL, '0', 'The film follows the history of the Egyptian rock band Les Petits Chants that emerged to the world of music in the 1960s as Wagdi Francis founded it. The film includes interviews with the band members who came together for a reunion in 2010.'),
('2046700', 'Eigaba Namozagia', 'https://media.elcinema.com/uploads/_315x420_3f4c46d1e95956a64cf69ca99e968916346ffb5d0e97d993379dc57b4d41d1c8.jpg', NULL, '10 October 2016', '25', NULL, '0', 'The story of a woman who becomes the acting director of a cinematic magazine as she finds herself in a dilemma when she is asked to interview many applicants for the art editor vacancy, but she is shocked that the selection criteria is far from fair.'),
('2046701', 'Jesus was here', 'https://media.elcinema.com/uploads/_315x420_43a9cb62eada846b6322728a8b69508ccee559e11d907bd50c53d1be1edf591b.jpg', NULL, NULL, '76', NULL, '0', NULL),
('2046702', 'Oil: The Three Appearances', 'https://media.elcinema.com/uploads/_315x420_d3391c3db44f3da9d57b8db28c1a0b9740a45502831f39fe5e3e3186a0f55c03.jpg', NULL, NULL, '19', NULL, '0', NULL),
('2046742', 'Omaret Roushdy', 'https://media.elcinema.com/uploads/_315x420_dff2a15d3e5a4f245e150646d484fbbcf2c4443ea561049ff71b3a84714f6c75.jpg', NULL, '13 December 2017', '93', '206181', '4', 'The story of the infamous Roushdy building in Alexandria which is believed to be haunted, leaving anyone who tries to live in it in the street. An evil guy tries to prove that the rumors are true.'),
('2046868', 'Top Secret', 'https://media.elcinema.com/uploads/_315x420_fc799ad875bf53bc27b67bf43257abd4ffdfab6d915e54f5927545c9ed759ce6.jpg', NULL, NULL, NULL, NULL, '0', 'A dramatization of the turbulent political circumstances in Egypt between the 25th of January revolution in 2011 and the 30th of June revolution in 2013'),
('2046899', 'Little Eagles', 'https://media.elcinema.com/uploads/_315x420_a389b461555429fa3570aa4b48f94e21521a64a5ef76b4954243ccc430f776af.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2046934', 'Omar El-Azraq', 'https://media.elcinema.com/uploads/_315x420_fbef1f79cdbdf33c62e3c2171912516c610b5f280881eba9beb9683f013f18c0.jpg', NULL, ' 2 August 2017', '110', '405814', '4.9', 'The story follows a drug dealer\'s long journey until he became a major trader who has many enemies in the market. When a number of competing traders bloc to eliminate him, he decides to escape from this trap.'),
('2046940', 'Dear Animal', 'https://media.elcinema.com/uploads/_315x420_ba7685c1dd1364014e4cf182c0c0bf8d7196776d314f3a61289c254f499264d5.jpg', NULL, NULL, '30', NULL, '0', NULL),
('2047084', 'Grandpa, the Troublemaker', 'https://media.elcinema.com/uploads/_315x420_3659ecfcae8c7068707a87c34533bf49d0ebb1f1d708866118c16e8b06544104.jpg', NULL, NULL, NULL, NULL, '4.2', 'An introverted, shy young man struggles to find his place in society while dealing with its people and his surroundings, until an accident turns his life upside down. But will it be enough to bring about his transformation?'),
('2047416', 'اغتصاب (اسلوب حياة)', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2047456', 'Nos Gawaza', 'https://media.elcinema.com/uploads/_315x420_26b7f3b7aa717ceab6eb9067028e7a53d12d0a4fa6c10e94fa7ce7365550c033.jpg', '+12', '14 February 2018', '87', '248579', '5.6', 'When an accident causes a couple to lose their memory of the last ten years, they get into a lot of comedic situations.'),
('2047604', 'Leil Dakheli', 'https://media.elcinema.com/uploads/_315x420_be1b2b1b5dd9e4037597b34b43397db42aba05d1ca0083eed3295a0ab2f1d4bc.jpg', '+16', '16 August 2017', '85', '111172', '4', 'A portrayal of the behind-the-scenes struggles of movie-making.  A crime during filming uncovers the corrupted nature of some producers as well as the illicit ways funding is received through famous producer Rasha Farid.'),
('2047624', 'Hadeth Al-Nile Hilton', 'https://media.elcinema.com/uploads/_315x420_5fef7a5c5206fe11e924a7bb59474012fb3b146cfd35acf21484626c4196a181.jpg', 'Adult Supervision', NULL, '106', NULL, '6.5', 'As the Egyptian revolution breaks out, an officer investigates the murder of a prostitute. What initially appears like an ordinary case takes a turn when he discovers the complicity of some of the elite in the murder.'),
('2047725', 'Al-Khawaga\'s Dilemma', 'https://media.elcinema.com/uploads/_315x420_e385fcda676239d7c9a99a1c20ba6837fa2dcd3697520c9e3e208704c97510bf.jpg', 'All Ages', ' 6 January 2018', '110', '9715957', '5.9', 'The movie revolves around the ambitious middle-class young man Faris, who is in love with the daughter of an influential businessman. The duo gets into many mishaps, as Faris sets out to avenge the death of his brother.'),
('2047740', 'Khat Al-Mout', 'https://media.elcinema.com/uploads/_315x420_146d0e5d5583c6378d089478b622e8c929833c02673f544b1ff0163666a88742.jpg', '+16', '27 March 2019', '90', '43106', '5.1', 'A story about what is happening in Egypt and the Middle East in the wake of the revolutions of 2011, as well as the constant and ongoing struggle of the Masonic organizations and the countries supporting terrorism to control Egypt and the Arab countries.'),
('2047774', 'Mesteka and Rehan', 'https://media.elcinema.com/uploads/_315x420_58a9b36cccf558bd3c8f38c4211ba9e565526583767b91777710d61a7a7839ee.jpg', NULL, NULL, '60', NULL, '0', NULL),
('2047852', 'El-Diesel', 'https://media.elcinema.com/uploads/_315x420_30f4082a1081af3f779f43c22666bce99e1f3161040a1659604e5d73844b957c.jpg', '+12', '21 August 2018', '93', '24021728', '3.7', 'Stuntman Badr the Diesel lives in a poor neighborhood. He meets Donia El- Sayad, a famous movie star, whose assistant, Afaf, is Badr’s Fiancée. When Afaf gets killed, he decides to seek revenge and find those who are responsible for her death.'),
('2047854', 'Etla\'ooli Barra', 'https://media.elcinema.com/uploads/_315x420_0167fdf9e7943299c94556a2d608bc5fdec72e38327516b1c0c6ba55f4f59750.jpg', 'All Ages', '17 January 2018', '90', '3021688', '5.1', 'A young man living in a local area, one day finds a book called \" Let\'s Take This Outside\" about how each person has many personalities inside of him, and when he reads it, a number of characters emerge that dominate his life and decisions.'),
('2047883', 'Bath Mobasher', 'https://media.elcinema.com/uploads/_315x420_32cacecb52e793fea2bd2d5256e738ba2aa907da84b2b5e05c8b7a2fd93b54a1.jpg', '+12', '31 August 2017', '90', '1366030', '6.5', 'As the night goes on, Faris, a suspended officer, finds himself involved in a growing number of events. His life becomes more complicated when someone starts filming his troubles and broadcasting them live on social media to high viewership.'),
('2047919', 'MSH INDE', 'https://media.elcinema.com/uploads/_315x420_241c9ea731ca2c75d4a1fe87868720b383418999b324b6169188e69aa1a6872a.jpg', 'All Ages', NULL, '90', NULL, '0', NULL),
('2047938', 'Karma', 'https://media.elcinema.com/uploads/_315x420_4f3c1eb141c9b705910a14a59f8eeec56a1eb1e8aa5a406c539c29c44adac6bf.jpg', '+12', '16 June 2018', '122', '8108994', '6.3', 'The film covers two parallel stories, one about a wealthy Muslim called Adham who is extremely classist, and the other about a poor Christian named Watany who dreams of finding a treasure and getting rich. Through an unexpected paradox, they get swapped with each other.'),
('2047941', 'صعيدي في الجامعة الأمريكية 2', 'https://media.elcinema.com/uploads/_315x420_13e764a646200967003bc377f9448f9f911323637b34705a2de07e3fec3bbae0.jpg', NULL, NULL, NULL, NULL, '5.8', NULL),
('2047945', 'Aman Ya Sahabi', 'https://media.elcinema.com/uploads/_315x420_ae706dc2ef51234cd5e2cd70a283d0e5fb0cb02fb03be5fc7683385e0d5702b7.jpg', '+12', '31 August 2017', '79', '4604152', '3.1', 'Two singers living on Mohammed Ali Street with tough financial conditions. A friend of theirs suggests that they meet women from well-off families and marry them. They set out to meet Shaira and Bahira and they trick them in the name of love, but they enter countless conflicts with the women\'s brothers.'),
('2048016', 'Horoob Mofagi', 'https://media.elcinema.com/uploads/_315x420_cfb477814384be587a93435701e7ec07afb385d6ca22eea55467e84243a2546b.jpg', '+16', '31 August 2017', '88', '409357', '2.4', 'Nader is a former pilot who retired because of the embezzlement cases in which his father is accused of. He sets out to look for Zeina, the girl he was in a relationship with, who suddenly disappeared, and is believed to have been kidnapped.'),
('2048098', 'Bekia', 'https://media.elcinema.com/uploads/_315x420_f891fccd850adee69500463c9dd41df029c660b5ca61bf6f4e34dd8813852450.jpg', '+12', '19 August 2018', '98', '2567562', '5.5', 'An international organization tries to kidnap Mustafa (Mohammed Ragab), an Egyptian cancer and AIDS medicine researcher, who could save humanity from these diseases, which leads him to escaping and faking memory loss. Mustafa ends up living in a landfill until he finishes his research.'),
('2048148', 'Colored Dress', 'https://media.elcinema.com/uploads/_315x420_376b9a35cb8642a0ba6771545f15fb8b71dc42b2a830e624a5b6ca80b3b9d1f2.jpg', NULL, '18 January 2018', '40', NULL, '0', 'The story of the lives of 15 women and their various stories of success despite the difficult circumstances they go through, demonstrating how they fit the idea of a strong independent woman.'),
('2048167', 'Eyar Nari', 'https://media.elcinema.com/uploads/_315x420_4f01acad59a19040aa7be70957a9a8627136ea82c8da6f37918e76bad8aa2c50.jpg', '+16', ' 3 October 2018', '97', '7181345', '6.8', 'After a clash between demonstrators and security forces, a body from the clash is returned to the morgue.  Forensic doctor, Yassin, writes his medical report stating that the victim was shot at close range, unlike the other bodies , problems begin when the medical report is leaked to the media.'),
('2048572', 'My Festival', 'https://media.elcinema.com/uploads/_315x420_f857ba29db21c5221a147a0c0da7fd9c8a03b4439fd95dc24b25581345eb9752.jpg', NULL, NULL, '8', NULL, '0', NULL),
('2048573', 'Newton\'s Third Law', 'https://media.elcinema.com/uploads/_315x420_416c112a8a023ccb6ef4a13e0f9c79bfef0e3fd968e558e58e1f053d287ccb05.jpg', NULL, NULL, '11', NULL, '0', NULL),
('2048605', 'I Have A Picture: Film No. 1001 In The Life Of The Oldest Extra In The World', 'https://media.elcinema.com/uploads/_315x420_80e3c6108958aa84ed3089180db835e7288b79b441571b6f7a79ddae6d419f51.jpg', 'All Ages', '24 September 2017', '72', NULL, '0', 'With the help of El Homossany, one of the oldest assistant directors in Egypt, Zedan, a young indie filmmaker, is making a documentary about Motawe Eweis, who has worked as an extra in about 1000 films in the Egyptian Cinema from the forties till now. Zedan finds himself stuck between how he wants to make his documentary and how the two old friends view filmmaking in general. As an extra, Motawe is expecting the director to tell him what to say and how to play his role. As an assistant director, El Homossany finds ways to dramatize every situation and help his friend, Motawe, to get into character.'),
('2048615', 'Nawrt Masr', 'https://media.elcinema.com/uploads/_315x420_f631aadead10dacd63105515db228c80f176d23da1188c267334d707fa174cca.jpg', 'All Ages', ' 4 April 2018', '88', '2765850', '3.9', 'Hamed comes back home after fifteen years in Kuwait. When he reunites with his college friends, they go through many comedic situations together.'),
('2048650', 'Harb Karmooz', 'https://media.elcinema.com/uploads/_315x420_bbc8ec81bd3a00f78d24c42627c8770669ebf3769ea6d67477a081db5ccb6d60.jpg', '+12', '16 June 2018', '116', '57634545', '8.2', 'In the forties, a girl gets raped by a group of English soldiers. One of the English soldiers is held at the Karmouz police station in the custody of General Youssef Al-Masry. When General Adams has his men besiege the police station to rescue his soldier, it\'s up to Youssef to hold him off.'),
('2048727', 'El Kenz 2: Al-Hobb wa Al-Maseer', 'https://media.elcinema.com/uploads/_315x420_6026c956567457d53512e3ed1a161103ceb7374d59047b2133b49780aaf78da3.jpg', 'All Ages', '10 August 2019', '128', '6141568', '7.3', 'The sequel resumes with Hassan setting out to find the treasure buried in his father, Bashir Al-Katatni\'s mansion. The clues in the ancient papyrus documents are within the stories of Hatshepsut in the Pharaonic era, Ali-the-Mercury during the Ottoman era and his father, Bashir Al-Katatini, who\'s facing new challenges in work and love.'),
('2048780', 'The Cave', 'https://media.elcinema.com/uploads/_315x420_45ba5b6b6c6a2012cc951cc5b5c8e7619d9ab9d22d4ce6a61350ecd0961a34eb.jpg', '+18', '21 February 2018', '85', '453402', '4.3', 'A look into how people deal with each other and with the circumstances they face, as well as the role of friendship during these hardships, demonstrating the meaning of true friendship and how valuable friendship bonds are.'),
('2048887', 'Al-Fondoq', 'https://media.elcinema.com/uploads/_315x420_bb83442e1c12de9909bb04ca583e1e2fe35c2e82ab3158aec6f0df9b1cf4c4e1.jpg', '+16', '25 October 2017', '99', '337809', '4.3', 'The intertwined lives of a group of people residing at the same hotel as their stories complicate and unfold revealing their darkest secrets and desires.'),
('2048944', 'Al-Bahth An Um Kalthoum', 'https://media.elcinema.com/uploads/_315x420_e565be65f644ed36a9e6c99aa8748cb740efbe0155ccc718974c6454a00f02b2.jpg', NULL, NULL, '90', NULL, '4.1', 'An Iranian filmmaker is searching for an actress that resembles Umm Kulthum. Through this journey, we get a depiction of how strong and persistent Umm Kulthum was.'),
('2049077', 'Doctor Bes Bes', 'https://media.elcinema.com/uploads/_315x420_6dbfa3eb138b2b4ab0028d5e8632aec7a6b7504a59ee0e2102ae380ed4b29f5e.jpg', 'All Ages', NULL, NULL, NULL, '5.8', NULL),
('2049108', 'Souq Algouma\'a', 'https://media.elcinema.com/uploads/_315x420_712e8bdc0e8c47869a4ca17b7d4af459a56048f9ea706c50def2a07b5893e9ea.jpg', '+16', '19 August 2018', '90', '3418480', '5.9', 'An inside look at the Friday Market that is frequented by poor people each week that offers a close-up look at merchants and how they deal with customers.'),
('2049137', 'Al-\'Aref - Awdet Younis', 'https://media.elcinema.com/uploads/_315x420_95ef5b1cd254839b6d3acb6615c85d756a12d36a15e27ee8907f6f203999191e.jpg', '+12', '12 May 2021', '110', NULL, '0', 'The film tackles cybercrime through the story of Younis, a man who lives with his wife and their baby girl, as he decides to rob a bank through the internet, but then finds himself chased by a dangerous gang.'),
('2049146', 'Matryoshka', 'https://media.elcinema.com/uploads/_315x420_38298f242bc82140378869e4a67f7b388919edca57c4434f01e09605186c5a99.jpg', NULL, '17 November 2019', '100', NULL, '0', 'In the 90s, and following the dissolution of the Soviet Union and the resulting conflicts, four Russian girls travel to Egypt and start to mingle in the Egyptian society, developing a shared admiration towards it in a way that makes them unwilling to return to their homeland.'),
('2049218', 'Hassan Delivery', 'https://media.elcinema.com/uploads/_315x420_01028e2fc89870b27fedca5aa37668c5a74c599ebe23e68bd3d4c5f037f96baf.jpg', NULL, ' 1 January 2016', '85', NULL, '3.7', 'A comedy about a food delivery guy who experiences numerous awkward situations every time he delivers an order.'),
('2049532', 'Khalawees', 'https://media.elcinema.com/uploads/_315x420_53f0a4d7a6677923e5e5265eb737057ba62d3153dd93c97da86347eea10cdf4c.jpg', 'All Ages', '17 January 2018', '90', '1125034', '6.7', 'Aly Hassan, a five-year old child, gets arrested for a name mix-up with a wanted criminal. His father rushes to free him, and clear the misunderstanding, while there’s a crazy media campaign to prove that the boy is actually the criminal.'),
('2049581', 'Kl alturuq tuadiy \'iilaa ruma', 'https://media.elcinema.com/uploads/_315x420_2c066e2f74104e582a5607b2435759a4b729c279d2457f105f3164e0578ed64c.jpg', NULL, '24 November 2017', '15', NULL, '0', 'Amal, a young Egyptian woman, decides to flee the country and migrate behind her family\'s back, but she is shocked to learn that she\'s pregnant by her boyfriend whom she left a month earlier.'),
('2049585', 'Something Cold', 'https://media.elcinema.com/uploads/_315x420_e3097d94f1020641d56f9e8502ae5ba2606453090c879e4878d550f48f841a15.jpg', NULL, NULL, '20', NULL, '0', NULL),
('2049586', 'Red Velvet', 'https://media.elcinema.com/uploads/_315x420_077a94c7f15e843a6409c7eea778ad08e9c784f4c233e900f566316c0be88cb2.jpg', NULL, NULL, '15', NULL, '0', NULL),
('2049624', 'El Badla', 'https://media.elcinema.com/uploads/_315x420_d3be2ecb2d6318f48f93b93bf98e9ecf3c04740a801df2fc494fb8e1c4b20f4a.jpg', 'All Ages', '20 August 2018', '96', '67339111', '7.5', 'When two friends decide to go to a costume party, they pick police uniforms to don as their costumes, only for their old classmates to mistake them for actual policemen, which puts them in many unexpected situations.'),
('2049699', 'The Secret History Of Kawthar', 'https://media.elcinema.com/uploads/_315x420_cecd20658104c36c64a50710d1606328efda5f9c8b60f3d8f4854fc135a87aaa.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2049762', 'Bani Adam', 'https://media.elcinema.com/uploads/_315x420_25bc7776321c58c1c24a3e530bcc36d0163a8bf0fa4bbf6a1998b2331754a057.jpg', '+12', '18 August 2018', '114', '9177121', '7.1', 'A thriller about the businessman Adam who faces criminal charges until the police enlist him for a critical mission. Will he deliver, or show an unexpected hidden side?'),
('2049782', 'Feather', 'https://media.elcinema.com/uploads/_315x420_b415cddc16f6fb2cb45374a4f23447168d8881753009f58de277c53f3627ea20.jpg', NULL, NULL, '10', NULL, '0', NULL),
('2049802', 'Cactus Flower', 'https://media.elcinema.com/uploads/_315x420_f675603b78737699387aae7190bafd197d77a2828d1d8fd25cefdbf06bff4352.jpg', NULL, '28 January 2017', '102', NULL, '6.7', 'Aida, a rising actress from a rural background, finds herself overnight thrown out on the streets with her bourgeois withdrawn neighbor, Samiha. With the help of a young man named Yassin, they begin their journey of self-exploration, while developing an extraordinary friendship.'),
('2049915', '122', 'https://media.elcinema.com/uploads/_315x420_a1d79c7b5ed41ebb56ecdca869e5847ef2d4c393c35edeec4b24f0237ac47733.jpg', '+18', ' 2 January 2019', '95', '24808161', '6.5', 'As love blossoms between a man from a simple background and a deaf and mute woman, they find themselves drawn into a world of crime. When they are injured in a terrible accident, they are rushed to the hospital where they have to face their worst nightmare.'),
('2049932', 'Yomeddine', 'https://media.elcinema.com/uploads/_315x420_fae5ec035bdcd6ca935dc87668e0a2deda9d63a5ee2121782f624765c7e23f0d.jpg', 'All Ages', '24 September 2018', '97', '1093737', '8.1', 'In the wake of his wife\'s death, a middle-aged Coptic leper named Beshay, who grew up in the confines of the leper colony, embarks on a journey across Egypt with his young Nubian friend, Obama, and his donkey, in an attempt to reconnect with his family in Qena.'),
('2050036', 'Gedo Nahnoh', 'https://media.elcinema.com/uploads/_315x420_abfe21fa170c23d7d509d8a5de6147fe4737712fa16b6a39b7a4750241b98ed4.jpg', 'All Ages', '17 January 2018', '110', '382832', '5.3', 'When their wealthy grandfather dies, a group of young men discovers that he didn\'t leave them any money, only a will telling them to search for a hidden treasure. When they discover that their treasure is kept at an asylum for the mentally ill, their comic treasure hunt begins.'),
('2050042', 'High Fences', 'https://media.elcinema.com/uploads/_315x420_bdf2908d2ccc65c669be5f13a79445ae5540aaf09ab2f4d12569207f08cbab8c.jpg', NULL, NULL, '97', NULL, '4.3', 'A depiction of the different social paths and classes within the Egyptian society, shedding light on the intertwined lives and fates of people of different classes, while highlighting issues like the drug trade and its calamitous impact on people and society.'),
('2050051', 'The Guest', 'https://media.elcinema.com/uploads/_315x420_42597cef5091f242c2b4ed6fd5c0718414c11675ffc9f21af5291b570778f0bb.jpg', '+16', ' 8 January 2019', '99', '7507774', '6.4', 'A young man is invited for dinner with the family of Dr. Yehia Hussein Al-Tijani at the invitation of Yehia\'s lovestruck daughter. But Yehia is under a lot of pressure ever since his bold opinions put a target on his back, which turns the dinner into a stirring debate between Yehia and his guest.'),
('2050062', 'Qarmat Bitamrmat', 'https://media.elcinema.com/uploads/_315x420_a642c89f05a3dba82d2741382095dea70ece8f6f118bdb2c419d612f876db622.jpg', 'All Ages', '16 January 2019', '110', '4101246', '6.2', 'Qarmouti builds a graveyard for his ancestors, and makes it a paid tourists attraction; this causes him lots of problems with the government. Meantime, a journalist videos an antiquities smuggling operation and the tape ends up with Qarmouti who finds himself chased by the smugglers.'),
('2050172', 'رمسة كريم‎', 'https://media.elcinema.com/uploads/_315x420_b3882bd6fce01ea32fa663b4ce5066870c47e17bdf6996ee491f3b292e6464f8.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2050323', 'Torbal Rayeh Jayy', 'https://media.elcinema.com/uploads/_315x420_c83459a2415e86422350951ff2067efe74955a6d938c486d27775e546ef48f09.jpg', 'All Ages', NULL, '105', NULL, '5', 'When Torbal and his brother Ghorbal take their mother to Cairo for medical care, and only resort to a quack to cure her illness, Torbal decides to become one himself – that leads to many hilarious situations.'),
('2050421', 'GAREMET AL IMMOBILIA', 'https://media.elcinema.com/uploads/_315x420_a926d67f100db247da83a8830131bf9a2e3cbd1cb2f522d16754814feb09dac0.jpg', '+12', '20 February 2019', '123', '646020', '5.8', 'Kamel Helmi is a famous writer who lives in the famous Immobilia building. When he starts feeling lonely, he invites Samah, a girl he met on Facebook, to his apartment in an attempt to ease his loneliness. But when an accident happens, both he and his neighbor discover that Samah is using him.'),
('2050502', 'The Titans', 'https://media.elcinema.com/uploads/_315x420_ad1d597990f556559b5a79e31971874488658150aa8cf649e998b44f885fefd6.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2050591', 'Saeat Reda', 'https://media.elcinema.com/uploads/_315x420_aff5fdeb8da8a19506b94e1266852aea7520d3c8dc7dafcfd0b1f6d6276bb63e.jpg', 'All Ages', ' 9 January 2019', '33', '3141008', '5', 'In a local neighborhood, the mechanic Reda harbors unrequited feelings for Nour. When he finds an old clock that turns out to be an enchanted time machine, he goes back in time to win his girl’s heart, but he finds himself in some unexpected awkward situations.'),
('2050637', 'Is It Chemistry؟', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2050641', 'Piece Of Wood', 'https://media.elcinema.com/uploads/_315x420_99bcf5ca3c34c483c64e64c46137d8214bf939caf0644b40f364ddfdadedb447.jpg', NULL, NULL, '17', NULL, '0', NULL),
('2050653', 'Kazanova', 'https://media.elcinema.com/uploads/_315x420_14900ec998fe9094877437fb89a0b739a916b7071186b5cd736f5d3177550870.jpg', '+12', '17 April 2019', '101', '273184', '4.1', 'A love story between a director and a fashion designer that faces an unexpected turn of events that threatens their romance.'),
('2050756', 'Layl/ Khariji', 'https://media.elcinema.com/uploads/_315x420_3e67cdd9c06051e7234ce6452bdb89407fa9e601200f0bfb9dd49416c77eebdc.jpg', '+16', '19 December 2018', '98', '709307', '6', 'Moe, Tutu and Mustafa, cross paths during unusual circumstances. They get involved into events that were not taken into account by any of them, and witness a hidden and unknown side of the city.'),
('2050815', 'Singers About Food', 'https://media.elcinema.com/uploads/_315x420_a6a8fd112924f2856b9dd01a8ec8cd56b1c96f20c03cbea5ca73577753b460e6.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2050823', 'عدو البشر', 'https://media.elcinema.com/uploads/_315x420_8786a7cd3c8293b3ddae38f75a04668a930eec9dea02de13a52688067d4debd7.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2051035', 'El Kowayeseen', 'https://media.elcinema.com/uploads/_315x420_f39d9f57c8159663052ed1d75cac16252f782d97de1c262ae90d4e2b7b839698.jpg', 'All Ages', '19 August 2018', '124', '21291943', '5.4', 'Muftah and his sister Ghazal are a team of cons. When Muftah hears about a rare jewel that belongs to El-Kowayeseen family, he pretends to be the family\'s long lost son, Mazhar, to get close to them. Despite the plan\'s initial success, Muftah faces many difficulties later on.'),
('2051036', 'Qalb Ommoh', 'https://media.elcinema.com/uploads/_315x420_85122aecfaa1a7982e82ed315d010da19f469245076b0102e6b6e3502bed6e07.jpg', 'All Ages', '16 June 2018', '104', '17160237', '7.3', 'When Magdy is critically injured in a fight, the doctors struggle to save his life when he requires a heart transplant. But Younis\' mother dies and the doctors transplant her heart to Magdy who starts acting in a motherly way towards Younis.'),
('2051037', 'Lelyt Hana w Sorour', 'https://media.elcinema.com/uploads/_315x420_cfee010902e2e2fdc92be00cadc3b9d45bc69be3d57ea623ca9d050ec2349cec.jpg', '+12', '16 June 2018', '99', '35064058', '6.5', 'Reda is a professional swindler who claims to be a businessman called Souror so that he could steal an antique statue. When he meets Hana, he claims that he is working for the General Intelligence Directorate and that Mossad is after him to steal the statue.'),
('2051055', 'Nadi El-Regal El-Serri', 'https://media.elcinema.com/uploads/_315x420_8f163822dd57ddb402fd3ef834d2ee5485bbf7e991b0ed390adb7d9c6ec49580.jpg', '+12', '23 January 2019', '105', '59719314', '8.2', 'Adham helps a group of his friends join a getaway club for men called “The Secret Men’s Club”. But Adham\'s own marriage is in trouble as his wife of ten years starts following him to find out what he is keeping from her, which results in many funny situations.'),
('2051096', 'Shar Assal', 'https://media.elcinema.com/uploads/_315x420_2c6ae0a743ca7aaef3c52ceb1d1db86cae8a84b1c4be05b36d05243969737881.jpg', 'All Ages', '21 March 2018', '102', '50519', '6.6', 'Yusuf and Dalia discover the high costs of their wedding, so they decide to use the money to go on a honeymoon instead. They choose the Malaysian capital of Kuala Lumpur, and when they get there, Dalia gets kidnapped in mysterious circumstances.'),
('2051193', 'Eish Hayatak', 'https://media.elcinema.com/uploads/_315x420_30ea596e36ced53111820b1dcf2a171f2fd7826195b6f553e773c1ae3322f73b.jpg', 'All Ages', '13 February 2019', '110', '468209', '7.2', 'Ibrahim is a creative advertising professional who is extremely boring and reserved. As he embarks on a journey to win over his son who seems to prefer his stepfather, Ibrahim seizes the chance when he goes on a business trip to film an ad campaign titled “live your life!\" to get close to his son.'),
('2051227', 'Sargy margy', 'https://media.elcinema.com/uploads/_315x420_284e3e4d703b8e5408999d9cd7623e7e3307c8d02a1b868e31668f5c741341be.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2051400', 'AL-Abla Tamtam', 'https://media.elcinema.com/uploads/_315x420_38672cbfabc18f16bf0db925f9d4a4c7287bd9d3ca9d237fa8f0586c091b178d.jpg', 'All Ages', '16 June 2018', '109', '10213416', '4.8', 'A group of prisoners breaks out of prison using an underground tunnel that leads them into a school. When they discover where they are, they decide to remain in the school until further notice, but Ms. Tam Tam pushes back against them.'),
('2051546', 'Kedba Bidaa (Masricani)', 'https://media.elcinema.com/uploads/_315x420_a344995e338512c35b312ac1771a428135f8542335d33ffef3de5321d99fa6cc.jpg', '+12', '17 October 2018', '100', '1832354', '6.4', 'Ahmed falls in love with an American girl called Ashley whom he takes to Cairo for a family visit, causing many paradoxes due to the difference in customs and traditions. Ashley is surprised to learn that Ahmed wants to marry her and stay in Egypt, which she has not taken into account.'),
('2051591', 'The City will Pursue You', 'https://media.elcinema.com/uploads/_315x420_ba55d4f0f0050fcc44e5bbd9f6b03a54490d7a04474fbe979f9caa9ad911fdc5.jpg', NULL, NULL, '70', NULL, '0', 'In a country that is suffocating inside a bubble of corruption and deterioration, Ossama follows stories of old buildings being demolished and historical landmarks disappearing. He encounters different characters recounting their connections to certain places in the city that are on the verge of vanishing. Some are quite nostalgic and take the matter as a sign of the city’s downfall, while others are more “practical”.'),
('2051610', 'Happily Ever After', 'https://media.elcinema.com/uploads/_315x420_59896f94bbe0f47ae173909c206c34fa309df95a58a6ba3d4ea1183e6673ecc6.jpg', NULL, NULL, '71', NULL, '5.4', 'In the midst of the chaos of Egypt’s Arab Spring, filmmaker Nada Riyadh falls in love with Ayman. The initial euphoria makes way for doubt, anxiety and blame – a metaphor for the disappointing trajectory of events in Egypt. When Ayman decides to leave the country because of the deteriorating social and political conditions, she does everything she can to convince him to stay. The escalating tension puts her own commitment to remain in the country to the test.'),
('2051677', 'The Wardrobe Man', 'https://media.elcinema.com/uploads/_315x420_24060abba2c28796c6622d3bb1aa230202e13d943ab0f3404bbbbe0a7324255f.jpg', NULL, '17 February 2019', '50', '4157', '4.3', 'Bassem Yousri finds himself in the West Jutland area, in Denmark, on a research mission about the life of the peculiar Wardrobe Man; Kristian Vandet Jørgensen a hermit who lived in his wardrobe by the shore of Oddesund, Denmark, from 1917 until he died in 1956.\nFrom inside his wardrobe in Cairo, Yousri tells the story of his research to his friend Shadi. The film combines documentary footage and archival material with fictional scenes. The lines between fact and fiction are blurred. In the Wardrobe Man, Yousri attempts to grasp the relationship between geography, reality, history, and imagination.'),
('2051732', 'El-Mamarr', 'https://media.elcinema.com/uploads/_315x420_a736b93ffd2500ebfe48f895cacb83ab6cb81c3d1066e78b32315ceffd51195c.jpg', 'All Ages', ' 4 June 2019', '150', '74495223', '8.5', 'After the Six-Day War in June, 1967, Egypt lost Sinai to Israel. The Egyptian military then confronted the need to re-build its strategic, infrastructure and manpower abilities.  The War of Attrition was soon initiated and Major Nour\'s assignment with his Special Forces Shock troop was a reprisal raid to destroy the largest Israeli camp in central Sinai with the aid of the heroic Sinai tribesmen.'),
('2051735', 'Wezo School', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2051804', 'Drifters', 'https://media.elcinema.com/uploads/_315x420_f2bdd2b28b2e444a5632044979662f1077be00c59f8d5ef3c93aee6ea95bbb67.jpg', NULL, NULL, '46', NULL, '5.3', NULL),
('2051855', 'The 90th generation', 'https://media.elcinema.com/uploads/_315x420_299a89c9d8caafe99e3a457fe2c4344c3cd06a6ef1ad18b8750cc7efe7d23f8e.jpg', NULL, NULL, '19', NULL, '0', NULL),
('2051898', 'We\'re Sorry, Sir', 'https://media.elcinema.com/uploads/_315x420_d41a00ceb697a36dd44ebaf9610b57c5d03486228d68a68aeac7ad377542fec9.jpg', '+12', ' 9 May 2018', '97', '4416', '3.9', 'A drama that depicts the life of a group of young people as they decide to be of use to society, but their benevolence is met with malevolence and threats.'),
('2051923', 'The Most Dangerous Man', 'https://media.elcinema.com/uploads/_315x420_13c36308f915e463d265dc88586f489e96e5b0ea1a2d42177f46aaaa1fc7d92d.jpg', 'All Ages', '11 July 2018', '90', '511253', '5.5', 'Omar returns to Egypt after 28 years to take back his father\'s building which was seized by those who rented its apartments. When he fails to convince the owners of the bank that occupies the ground floor to leave, he decides to rob the bank.'),
('2052179', 'Taslim \'ahali', 'https://media.elcinema.com/uploads/_315x420_eec434d2ca11e53d635b8c96b0301ec28b57226626255461f29e5d2d76830b85.jpg', NULL, NULL, NULL, NULL, '0', 'Events take place in a social comic framework.'),
('2052322', 'Watch out for the next', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2052323', 'Qesat Hob', 'https://media.elcinema.com/uploads/_315x420_ddcb8f3427deeddeb62fd6727a1e1587d427ee64118414309f9227748554db3e.jpg', 'All Ages', '13 February 2019', '125', '11159600', '8.4', 'Youssef, a successful engineer, loses his sight in a terrible accident, and he crosses paths with Gamila. As the two start developing feelings for one another, their love is tested.'),
('2052471', 'Welad Rizk 2: A\'wdat Osoud Al-Ard', 'https://media.elcinema.com/uploads/_315x420_6d27e74c19efbaf8ad3d928c48f3739a222166f7e3600abd631bc47fbeb08b3d.jpg', '+12', ' 8 August 2019', '128', '100753422', '8', 'Three years after the events of the first part, the four brothers try their best to keep their oath to stay away from the life of crime. As one unexpected incident takes place in their lives, everything changes and they find themselves stepping into new worlds in which they must face deadly criminals.'),
('2052495', 'Omar Khresto', 'https://media.elcinema.com/uploads/_315x420_814187280a2c18d5e1714a50a3fc1e231fbfe60c4ab154771cd73ccaa279ab04.jpg', 'All Ages', ' 2 January 2019', '90', '885110', '3.5', 'In this suspenseful thriller, a captain roaming the high seas receives threats from a terrorist organization that they will harm his daughter if he doesn’t assist them on a deadly mission to blow a gas pipe in Sinai.'),
('2052679', 'Demagh Shetan', 'https://media.elcinema.com/uploads/_315x420_92c1e89ce0494244d0999ca7ca911c99c48a2e7000bff2feeb074f15abe5a77d.jpg', '+16', '22 January 2020', '82', '86479', '4.1', 'A suspense drama about a family that has a tragic accident, which makes the family members get into a major conflict because of their involvement in a crime.'),
('2052708', 'Hamlet Pharoan', 'https://media.elcinema.com/uploads/_315x420_1965fa652f9c4bcfe209dfa653859ea609d067cd84117b23a5b0b695620ba78d.jpg', '+12', ' 4 June 2019', '110', '18574977', '5.6', 'Yehia, known as Pharaoh, reassembles a group of six of his old friends, each with a unique combating skill, to travel to Syria under the pretense of bounty hunting. Their real mission is to save his kidnapped son from the hands of Franco and his ISIS gangsters after they assaulted Syrian refugees, including Yehia\'s wife, and took away the children to a district that is currently under his control.'),
('2052720', 'Mohamed Hussein', 'https://media.elcinema.com/uploads/_315x420_367c9541ff34d27c033b85289a7334675ca8f09dd3fbca4f7d6e31c32b469c34.jpg', 'All Ages', ' 4 June 2019', '96', '4790605', '6.3', 'When world-renowned artist Sherif Kamal returns to Egypt after 37 years abroad, his step-daughter refuses to allow him to complete his last painting and takes revenge on him. However, she soon learns that before his death, Sherif sketched a painting on the back of Mohamed Hussein, a driver.'),
('2052844', 'Lees Baghdad', 'https://media.elcinema.com/uploads/_315x420_caedcc9a050d5fd0ad6d0dcdcc205dcd8b6e3830bb83ab23bf5cd11d2cf5605f.jpg', '+12', '22 January 2020', '102', '33224245', '6.9', 'In an atmosphere of suspense and excitement, Yousef, Khaled, and Nadia embark on a journey to locate the tomb of Alexander the Great, which has been sought by everyone for years.'),
('2052991', 'Bein Bahrain', 'https://media.elcinema.com/uploads/_315x420_49c7f1c74685789d31bd808d146f76e6fcdfae6f8532ac6e0aff9f331d50a4ff.jpg', '+12', '16 October 2019', '88', '49008', '5.7', 'On a visit to a suburb of Cairo, Zahraa\'s daughter has a tragic accident, and the mother tries to help the daughter overcome the adversity and continue her education.'),
('2053153', 'Manican', 'https://media.elcinema.com/uploads/_315x420_b1e3ab2fa9bdd18f77721f241bdf1cf931604291fa1fe98a0cd567345621130b.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2053246', 'Yom W Leila', 'https://media.elcinema.com/uploads/_315x420_5b8629ea4a4f07c9a49c7e50101b27087b05dd62f534a260b62c8f86fb0191e0.jpg', '+16', ' 6 January 2020', '99', '2824834', '5.5', 'The story revolves around a policeman who\'s investigating some social issues, especially those related to the crises of the poor inside the Mawlid of Al-Sayeda Zainab and the problems they face.'),
('2053663', 'Al Gamiya', 'https://media.elcinema.com/uploads/_315x420_594e74d0cc16f5b457dca10e329db2f064a595b1f2a73e3944f0b8572080cc34.jpg', NULL, NULL, '79', NULL, '0', 'At one of Cairo’s poor neighborhoods, providing for daily life necessities is a true challenge; yet the sense of belonging among people is helping them keep things going somehow. They share this saving routine, Al Gami\'ya, to help them provide for their lives’ needs – an intimate close-up on people’s lives.'),
('2053666', 'Alhelm Albaed', 'https://media.elcinema.com/uploads/_315x420_d438c90339262eb8fa8bc3863b9f2811921854385f6d00155e6b856144315313.jpg', 'All Ages', '18 February 2019', '85', NULL, '4.2', 'A look at the touristic city of Sharm El Sheikh in the aftermath of the 2011 Arab Spring and the Egyptian revolution, highlighting the devastating effects on tourism by depicting resort employees as they become the sole inhabitants of the abandoned hotels.'),
('2053667', 'Samouni Road', 'https://media.elcinema.com/uploads/_315x420_534915aa5891fa7f670fb873bf11ff08aacdaf0780436ff67c58d0d1e94882f3.jpg', NULL, '16 April 2019', '126', NULL, '0', NULL),
('2053759', 'Zenzana 7', 'https://media.elcinema.com/uploads/_315x420_b92ec6c5634704de942827da0ffe63465a1350501c8a407dfe1a466d0629c8d9.jpg', '+12', '16 September 2020', '115', '8638538', '5.3', 'As Harby serves his sentence in prison, the friendship he forms with Mansour survives their incarceration and release. As they manage to make a name for themselves in the crime world, one of their rivals drivers a wedge between them, leaving the two to clash.'),
('2053987', 'Ra’s El Sana', 'https://media.elcinema.com/uploads/_315x420_6bf02a7d525fa3dcee92c5f4e092a42432d78501bdcfa84e79419ef5fbbffd38.jpg', '+18', ' 5 February 2020', '100', '3038141', '5.1', 'The events of the film takes place on new year\'s eve of 2019 in the Red Sea at a resort near the city of Hurgahda,inside the world of the wealthy where difficult situations and crises happen when they get together.'),
('2054027', 'Casablanca', 'https://media.elcinema.com/uploads/_315x420_3b0d92646b7b8d92c10ae096638ba1ad90443fa48ae53b44b6a23514043dcd3f.jpg', '+12', ' 4 June 2019', '104', '79156808', '7.9', 'Three friends: Omar,Oraby and Rashid form a gang of pirates called “Sea Burglars”. They get assigned to a mission against the Mob after a large cargo of diamonds was heisted. Things turn into a web of rivalries and paybacks, when Oraby decides to do the mission on his own and escapes to Morocco.'),
('2054123', 'Lama Benetweled', 'https://media.elcinema.com/uploads/_315x420_388f57576e086c43fc2070206bea4a1356b7f441ef17e8257f6241352649c9dc.jpg', '+16', '23 October 2019', '110', '493525', '7.1', 'The story of three different characters: the first is a guy aspires to have a singing career, the second is a dreamy Christian woman who falls in love with a young Muslim, and the third is a man who works in the field of sports training.'),
('2054216', 'Estedaa Wale Amr', 'https://media.elcinema.com/uploads/_315x420_3b845746407ecef0d8ffd2857f21bc0b5b911f2ec6ef0bd655c15eb02fb6e5ad.jpg', 'All Ages', '11 December 2019', '98', '448159', '4.8', 'Amr\'s school principal summons his guardian to address the problems he keeps causing. His father, Ragheb, has problems with his wife Sarah, who wants to relive the early days of their love story by reuniting their high school friends.'),
('2054468', 'El Feel El Azraq 2', 'https://media.elcinema.com/uploads/_315x420_7b4c8d58094b167c8c8fc9317e6b3be476e31f47359ecd7d424af369dae05e14.jpg', '+8', '25 July 2019', '130', '103633291', '8.8', 'Five years after the events of the first part, Dr. Yehia marries Lobna and is assigned to a new case from the 8-West Women\'s Ward. He finds that someone is trying to manipulate his life as well as his family\'s. In an attempt to take control of all ongoing events and solve the mysteries he\'s facing, Yehia turns to the \"Blue Elephant\" pills .'),
('2054540', 'Mousa', 'https://media.elcinema.com/uploads/_315x420_4a021232d725517c435973230f6e9b2551c3ff4507b1ac24f4396e053c29a3b1.jpg', NULL, NULL, NULL, NULL, '0', 'An engineering college student invents the first of its kind robot in the Middle East, in an attempt to avenge his father\'s death and achieve justice, which gets him pursued by the authorities.'),
('2054548', 'Parking', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2054788', 'Kilo 64', 'https://media.elcinema.com/uploads/_315x420_788bb4e790b64519e501527b8b7cb7302b7942a72e9335cc85ab882c907fd418.jpg', NULL, NULL, '61', NULL, '0', NULL),
('2054795', 'No one is there', 'https://media.elcinema.com/uploads/_315x420_057257b3a0ff22a03c119469da00da1a9775f2c210b82f42cc747b9a572e668f.jpg', NULL, '16 April 2019', '75', NULL, '5.3', 'On the streets of Cairo, Ahmed is helping a girl he doesn\'t know to get an abortion, while he\'s trying to come up with the money, he gets involved with a group led by a girl who wants to uncover the secret of a giraffe hidden in the zoo.'),
('2054886', 'Experiment: SORRY', 'https://media.elcinema.com/uploads/_315x420_88fdc908fc17e444bec1603304cf7384646be53525877fff27e8651a5da7b311.jpg', NULL, NULL, '12', NULL, '0', NULL),
('2054916', 'Intense Practice to Improve Performance', 'https://media.elcinema.com/uploads/_315x420_657c8067e494e6504488afddc8cc6f8b37e69673cf3294fb0d1c25b8d8fc0b56.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2054954', 'Fragile', 'https://media.elcinema.com/uploads/_315x420_2bd5fc873c58de75e3a3e658e3e1714bcf456f60bb2ba34c30472c54daca0474.jpg', NULL, ' 4 March 2021', NULL, NULL, '4.8', NULL),
('2055064', 'Show Day', 'https://media.elcinema.com/uploads/_315x420_6c7b75a23752d2911625cae423e957933e46fd2194ca0bbfa7c469a6d3d165ef.jpg', 'All Ages', '10 April 2019', '79', '129026', '4', 'The film follows a major scam operation that takes place in one of the major theaters.'),
('2055115', 'Akhenaten Fi Marrakech', 'https://media.elcinema.com/uploads/_315x420_04b4fc2b74e4f427cb932694865d5e5d47d484765ff1ebce1cafed460582901f.jpg', 'All Ages', NULL, '120', NULL, '5.1', 'When a famous singer is hired to perform in the closing ceremony of the Arabic Music Festival in Marrakesh, he soon finds himself falling victim to the machinations of a smuggler, who makes use of the singer\'s fame to smuggle a papyrus, which hails from the Akhenaten era, from Morocco to Europe.'),
('2055129', 'Al-Felos', 'https://media.elcinema.com/uploads/_315x420_7d4357267d6502afd425a2cda0302c9efd3ca74d989323c7a1c4cc16af34aa5c.jpg', 'All Ages', '24 December 2019', '118', '47856702', '6.9', 'Sief is a conman who is hired by the beautiful rich woman, Hala, to help her get her money back from another conman. Their relationship gets them entangled in a web of deceit as they start questioning their stances regarding love, friendship, and the meaning of life.'),
('2055208', 'Mako', 'https://media.elcinema.com/uploads/_315x420_87cdecb08722079acef66e09fe5ab9e185b88171cfb98fb1eda6f9bbb572a179.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2055450', 'Aeaza Alwalad', 'https://media.elcinema.com/uploads/_315x420_0e3b2045260da502760436b03fad9ec23bdbd5f500fbc43d5fcd1eaa75c8bb16.jpg', 'All Ages', NULL, NULL, NULL, '6.5', NULL),
('2055503', 'Sab\'e Alboromba', 'https://media.elcinema.com/uploads/_315x420_dc6fb1590d21995a851a46793ceab4bff4bb296eef5915c1e14de73b230e1213.jpg', 'All Ages', ' 4 June 2019', '92', '35082656', '6.7', 'Omar marries Nesma despite her father\'s objection. After the wedding ceremony, they\'re attacked by unknown men. During her escape, Nesma is injured.  Awakening from a coma, she refuses to see Omar because she doesn\'t feel safe with him. He goes to a psychiatrist to help him solve the problem.'),
('2055531', 'Plastic', 'https://media.elcinema.com/uploads/_315x420_3cbf7a79e8640c915b1438e6a08efc9e952590f48fd74aeb3f919080f17c896c.jpg', NULL, NULL, NULL, NULL, '5.6', NULL),
('2055843', 'The Demon', 'https://media.elcinema.com/uploads/_315x420_1514c4a3306941c9fcf0bedec3d645f87181dc4c17fd62e89628e8840766c103.jpg', NULL, '16 February 2019', '10', NULL, '0', 'Omar is a timid young man who catches feelings for Passant, but his timidness poses a stumbling block in the way of him confessing his love. Until one day, a supernatural creature emerges and promises to help.'),
('2055932', 'Ahlaa men Eltalaq', 'https://media.elcinema.com/uploads/_315x420_5379b97562110b3099fb14e85378c63e39fd8f50337d28e2c51da07ce840c795.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2055990', 'سقراط ونبيلة', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2056267', 'Khassesny shokran', 'https://media.elcinema.com/uploads/_315x420_29546a05cfa4d35bf077d96ad9e83dbb2a32d1acd9aa9f4508249f07718221c6.jpg', NULL, NULL, '94', NULL, '4.3', NULL),
('2056281', 'Qahwat Bursat Misr', 'https://media.elcinema.com/uploads/_315x420_75c8babe55cb2ca361052cf3fd19f528b4ff8abbca99e38aaa0561f4ca0d4299.jpg', 'All Ages', '26 June 2019', '90', '197535', '4', 'In this modern real-life drama, the intertwined lives of a group of regulars in a popular downtown café highlight the inner conflicts of their different personalities, and how they reflect the changes in the traditions and values of the Egyptian society.'),
('2056313', 'Hazr Tagaoul', 'https://media.elcinema.com/uploads/_315x420_f61177c8d629b2cd0041d504b5ba27f9f37f15d41a2b23761928f92f65c9c68b.jpg', '+12', ' 4 December 2020', '96', '394522', '6.9', 'In the fall of 2013 after a curfew was imposed in Egypt, Faten is released after spending 20 years in prison for a horrific crime. She\'s forced to spend the night with her daughter Laila, who subjects her to a second trial in search of answers for unanswered questions.'),
('2056323', 'Complex', 'https://media.elcinema.com/uploads/_315x420_5a27fea39fcd1f44777b19cf12c6bf3d3c3d352586e1f4b9bff6223bc3d943a9.jpg', NULL, NULL, '30', NULL, '0', NULL),
('2056566', 'Boody: The Sumo Pharaoh', 'https://media.elcinema.com/uploads/_315x420_7a087ea567f5a169949177060fc9b1e056e31bee047b51561f571ce842fb0c0c.jpg', NULL, '24 February 2019', '60', NULL, '6.4', NULL),
('2056692', '7th Century Before Birth', 'https://media.elcinema.com/uploads/_315x420_7781049665fcf1f0aa37cf636960f81a96c7f994657d9914e110a40b6d5f8c4e.jpg', NULL, ' 6 March 2019', '55', '2310', '7.6', NULL);
INSERT INTO `MOVIES` (`id`, `Name`, `img`, `age_rate`, `Release_date`, `Duration`, `Revenue`, `Rating`, `Description`) VALUES
('2056773', 'Khayaal Ma\'atah', 'https://media.elcinema.com/uploads/_315x420_14c5f791f7c4622d9235fa7fc13c41723820d3fe257cb4ce9ce6649efe3e042c.jpg', 'All Ages', '12 August 2019', '126', '38440061', '5.5', 'The story revolves around a grandfather who stole a rare masterpiece belonging to the late singer (Umm Kulthum) in his youth. Years later, he finds himself chased by those who want to have this piece, which makes him resort to the help of his only grandson.'),
('2056981', 'Ex-Cons', 'https://media.elcinema.com/uploads/_315x420_5e2560986a4b14d87beb9be6055e3ae4fd3c611e27319ea4815c7ba4cf5a0ad7.jpg', NULL, '10 August 2016', '120', NULL, '7.6', 'A bunch of extremely dangerous TODOs, each specializing in a certain weapon or has a special superpower are locked inside high security prisons and are asked to go on a special national mission and save the city of Gamasa from the hands of an evil witch.'),
('2056984', 'The Chocolate Rascals', 'https://media.elcinema.com/uploads/_315x420_e378f764386b7f78cc35baf8f5c9295756654734e7fbaecb2dff20db6557bd32.jpg', NULL, ' 8 July 2015', '91', NULL, '7.7', 'The Chocolate Rascals were looking for an evil genius to assist when they hear about a village where a villain called Sekena lives. Kimo remembers Sekena and that he was once in love with her when they attended Todo’s Joint School at El Senbellawein together. So Kimo, Boudy  and Sayed set out together to help her take over the village and move to Aswan after they accomplish their mission but when things start getting boring, they move on to the next villain.'),
('2057069', 'Fe Studio Masr', 'https://media.elcinema.com/uploads/_315x420_942b6dfc8f9f49039467d4f741d4be89f92852fd6a01411bbe21815c790a57da.jpg', 'All Ages', '13 April 2019', '95', NULL, '0', NULL),
('2057077', 'Taaton Mn Baaed', 'https://media.elcinema.com/uploads/_315x420_6f8913ce0f415a728f392fb06e47cc4c45222fd469b9e02fc9e4c6d7353a6b52.jpg', 'All Ages', '14 April 2019', '84', NULL, '0', NULL),
('2057079', 'Alkahf', 'https://media.elcinema.com/uploads/_315x420_d5b7b492c4c24ec1f37232f4fcb59f3fa5268c613c1d669a455fe947aab739e4.jpg', 'All Ages', NULL, '23', NULL, '0', NULL),
('2057080', 'Juzur Tarabulus', 'https://media.elcinema.com/blank_photos/315x420.jpg', 'All Ages', NULL, '16', NULL, '0', NULL),
('2057211', 'Sound', 'https://media.elcinema.com/uploads/_315x420_8a6ee3a9e14a1332afad5020376d9de116ecc2e139580314a3fd92799d618e91.jpg', NULL, NULL, '75', NULL, '0', NULL),
('2057214', 'Alfunduq alghamid', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2057246', 'Sawah', 'https://media.elcinema.com/uploads/_315x420_629b2f91cf4f2d6e543f877050e538f2b67992a23bc9b884086670698139fd50.jpg', NULL, NULL, '100', NULL, '6.2', 'An Egyptian DJ who wins an invitation to take part in a big concert in Brussels, finds himself in Luxembourg instead. He gets into big trouble when he loses his passport and everyone thinks he is an illegal refugee.'),
('2057363', 'The Name Caller', 'https://media.elcinema.com/uploads/_315x420_95ad11f58065a1a3b696cc4b30d8a5c8074da53fc22aad11ff92c9d9c3fa4081.jpg', NULL, NULL, '60', NULL, '0', NULL),
('2057459', 'Ramses Rah Fen', 'https://media.elcinema.com/uploads/_315x420_3ced8f5b3a57bb462425d5c61c34bff77b1b82e7637b0fc88bcaa3227db9c0ae.jpg', NULL, '17 October 2020', NULL, NULL, '4.3', 'A documentary that follows the transfer of the statue of Ramses II from Ramses Square to the Grand Egyptian Museum, shedding light on the history of various presidents and kings, including their various degrees of success in taking on a paternal role and fulfilling their duties to the people.'),
('2057823', 'Anta Habiby We Bas', 'https://media.elcinema.com/uploads/_315x420_04e42b37e744082a5519f4a363a75f8a22293343c1dcb14ef5b51022a882a0c8.jpg', '+12', '10 August 2019', '81', '3729735', '2.5', 'A comedy about famous artist Zico, who\'s forced to marry (Bossy), as their grandfather stipulated in his will that they have to get married to have an inheritance of five million pounds , and as events develop their relation turns into true love.'),
('2057952', 'Four Wheel Drive', 'https://media.elcinema.com/uploads/_315x420_f02d86fd7488c02c689ae993a1505ed78d9dd8c69966730c7a64b101af7690f3.jpg', '+12', ' 1 January 2020', '95', '140055', '4.1', 'A father who had big dreams for his three children, returns after many years, only to find them living a different life from what he had envisioned. As the three brothers get involved in a terrorist operation, they try to stop it with the help of a group of girls.'),
('2058180', 'Elankabot', 'https://media.elcinema.com/uploads/_315x420_052c85e89536d7a42c7a91821bb5888bc00a35c7af0333ddf42aa60bbe4f6bea.jpg', NULL, NULL, NULL, NULL, '0', 'An action thriller that revolves around a dangerous drug dealer, who is able to manufacture new drugs and sells them but falls into many problems and is chased by the police.'),
('2058218', 'King Size', 'https://media.elcinema.com/uploads/_315x420_f9e8c7b50c9eaae137b41cc2f97fb0410cc7c8d86634d80427e2535eb81bc7af.jpg', 'All Ages', NULL, NULL, NULL, '5.8', NULL),
('2058233', 'Saheb El-Maqam', 'https://media.elcinema.com/uploads/_315x420_b440a2db3fe9d6b1ee0afebec65e502a32da37ecf75094aef2dafaeacb870107.jpg', '+12', '30 July 2020', '111', NULL, '7', 'When the young businessman Yehia goes through a crisis, he finds that his only hope is a mysterious holy woman named Rouh who starts to help him.'),
('2058234', 'Dido', 'https://media.elcinema.com/uploads/_315x420_ffc77cc6ff342f397621dbe2e7710fb4cd2cc5d20d4f5a7fbf55fc9d9b2c3467.jpg', 'All Ages', '13 May 2021', '96', NULL, '0', 'A comedy about Dido who plans with his friends to rob the rich scientist (Bayoumi Fouad), who discovers the matter and transforms them by one of his experiments into tom thumbs, which makes them encounter many exciting adventures.'),
('2058370', 'El Tayeb We Elshares We Elaoob', 'https://media.elcinema.com/uploads/_315x420_351213f97d3c88b80e107dbac72793d8abf5631bb813331ea65219213353fec8.jpg', 'All Ages', ' 2 October 2019', '99', '989251', '5.2', 'Three retired actors abruptly decide that they want to go back to acting and work together to make a movie about aliens. Will it earn them any recognition?'),
('2058423', 'The Knight and The Princess', 'https://media.elcinema.com/uploads/_315x420_e8bf2c6373e1bd4a45c878a316f8f080478a37ecc8fcdab9f2dd7b642b1513fb.jpg', 'All Ages', '29 January 2020', '95', '143385', '7.9', 'The story of the Arab knight Muhammad Bin Qasim Al-Thaqafi who rescued many women and children from pirates in the Indian Ocean. He entered a fierce war against King Dahr who was sharing the spoils with the pirates, with the help of his friend Ziad and his mentor Abu Al-Asud.'),
('2058816', 'Rima', 'https://media.elcinema.com/uploads/_315x420_e12fa74ef0e150bfeac202fb7f30b5f507d7d68415cdbfd95e1ca991cdae039d.jpg', '+16', '23 December 2020', '90', '2266081', '7', 'The movie revolves around a young girl who has the ability to foresee events before they happen. Will this special ability that she possesses become a curse or a blessing for those around her?'),
('2058957', 'Al-Baa’d La Yazhab L Al-Ma’zoun Maratayen', 'https://media.elcinema.com/uploads/_315x420_f2bf271a8e22cfa605158b5ba5e4bcee3537e0e386b3caf280de6906e34c56dc.jpg', 'All Ages', '13 May 2021', '100', NULL, '0', 'A comedy that revolves around the experience of marriage, and if husbands can go back in time will they marry their wives again?'),
('2058967', 'Pasta', 'https://media.elcinema.com/uploads/_315x420_0a723eb56db94fc750a0e0fc46578e529a10940cabdeef1d418283a7e856b6c3.jpg', NULL, NULL, '5', NULL, '5.5', NULL),
('2059095', 'Be3elm El Wosol', 'https://media.elcinema.com/uploads/_315x420_00bed8491307b6707890c839cd64c811d90c0809b5e37e12a8ccfe8e3db08c44.jpg', 'All Ages', '26 February 2020', '98', '85604', '5.1', 'Hala has just become a mother, she suffers from depression after the imprisonment of her husband who she\'s trying to get him out, and her fear of abandonment since her father died, until she finds a message that gives her a new perspective on life.'),
('2059124', 'You Will Die at 20', 'https://media.elcinema.com/uploads/_315x420_06caca8956489a0605b3313b6ac275af6988de21b04594313c1a19fdfd86d64f.jpg', NULL, ' 4 March 2020', '103', NULL, '6.8', 'In a small Sudanese village, Sakina takes her newborn Muzamil to a holy man to bless him, but the joyful occasion turns into a funeral when the man predicts that the boy will die at twenty. Muzamil is forced to deal with people\'s pity his whole life. Can he escape such a tragic end?'),
('2059248', 'Beyond the Raging Sea', 'https://media.elcinema.com/uploads/_315x420_0057ddc54e394384c26020a17e4e15459b92bee795664df0c7c413f781996d0e.jpg', NULL, '21 September 2019', '70', NULL, '0', NULL),
('2059281', 'Sherit 6', 'https://media.elcinema.com/uploads/_315x420_ad3171aa445e02cb77955fd7c468fdd9bfef1c454866128db3ec5782aa22fda6.jpg', NULL, NULL, NULL, NULL, '0', 'The events revolve around a psychiatrist who tries to solve youth issues, and through the crises they are exposed to in their daily lives, he finds that it is not an easy job.'),
('2059288', 'Lailet Hob', 'https://media.elcinema.com/uploads/_315x420_62ae3ad6623c9e8f7fdfb846abaafbbfb014696161ccf6d5af2441ed3dc882e5.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2059298', 'Ashbah Europa', 'https://media.elcinema.com/uploads/_315x420_d9f1170fe28ee561afa26200db5d972864f5124bdb7e54b9d1542d2825b52925.jpg', '+12', NULL, NULL, NULL, '0', 'A wife gives birth to sextuplets, forcing the husband to sell three of their children due to poverty. When the wife finds out, she decides to leave her husband and travel abroad and many conflicts arise between siblings in the future.'),
('2059355', 'Sundooq Al Dunya', 'https://media.elcinema.com/uploads/_315x420_2e1247922628146be2b3b9e3c40b687bdb75bed1d4984714320e6bce1fe37bad.jpg', '+18', '19 February 2020', '90', '1050979', '5', 'The film follows the touching stories of various people struggling to survive in Downtown Cairo as they try to find balance in their lives and deal with its ups and downs.'),
('2059465', 'سيدي بشر', 'https://media.elcinema.com/uploads/_315x420_3a4f0d431d67bc12f1086b3a0b62dbd88835d3f95e2725d8e8d2445219c79034.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2059698', 'El Hoot El Azraq', 'https://media.elcinema.com/uploads/_315x420_7df74142851788326170f7638f296261aa440f0e7e7f9558de607e0214e73d52.jpg', '+12', '26 August 2020', '83', '114130', '6.7', 'The film revolves around the \"Blue Whale Challenge\" game used by many young people and adolescents, after the spread of technology and the parents are too busy to look after their children which might lead to their exposure to great risks.'),
('2059750', 'Enta Eih', 'https://media.elcinema.com/uploads/_315x420_329b2c8b65f6448c6e850a9178b52f8950789b6801ae0931401e81132992ee55.jpg', NULL, '16 October 2019', '80', '162488', '5.5', 'A comedy drama about an alien who comes to earth and asks people many questions in an innocent way, during that journey he makes friends with good people and enemies with bad ones.'),
('2059808', 'Habib', 'https://media.elcinema.com/uploads/_315x420_a6632db326db63963ef5183f9d8df34abb8d1a94a1b8a74daecc804bd30de7d3.jpg', NULL, NULL, '23', NULL, '6.8', 'Habib is a barber in his late sixties who works in his own home barbershop. One day he decides to break his daily routine and go through an adventure to delight his wife. Habib seems to be in psychological pain and suffering so much, however, he insists on living his life in full.'),
('2059822', 'Sunday at Five', 'https://media.elcinema.com/uploads/_315x420_df2e782eb1b3f77646cae0ded4a5227d3a3bd3a1003fbe943e91474792631b95.jpg', NULL, NULL, '20', NULL, '4.3', 'The 30-year-old Hadil decides to take a risk and go to audition for Khairy Beshara, hoping to land a role in his new film, only to find herself at a crossroads as she goes through the audition.'),
('2060069', 'Bab Maazoul', 'https://media.elcinema.com/uploads/_315x420_26ebcdf0cec3f5a4067c19bacb96b8dd76c2874a77f6af6152c076989df171e8.jpg', NULL, NULL, '30', NULL, '0', NULL),
('2060143', 'Banat Sanawy', 'https://media.elcinema.com/uploads/_315x420_5d1c906cd4c9b827688d9e936f87ea8204b2af53b0301406a17173ca944c7894.jpg', '+12', ' 6 January 2020', '99', '7904611', '5.5', 'The story follows five teenage girls as they try to discover themselves but they face a lot of trouble and difficulties during high school.'),
('2060176', 'Let’s Talk', 'https://media.elcinema.com/uploads/_315x420_3cad5de3d5a039e016cdd5239a139f0ea52d41b4cd846b2a81185f0b62aa90c5.jpg', NULL, '23 November 2019', '98', NULL, '6.4', 'What begins as a normal conversation between the director and her daughter, quickly develops into a discussion that touches values like motherhood , generational communication and what it means to be a member of a family, especially when that family has given birth to the most famous Egyptian film director, Youssef Chahine.'),
('2060188', 'Amin', 'https://media.elcinema.com/uploads/_315x420_8676ee127b96dd65f27e885b4bd5ffa8baedf4b529b14f92fd09f4acb23006b8.jpg', NULL, NULL, '16', NULL, '0', 'The Ministry of Culture announces the discovery of a rare version of an incomplete film by legendry director Shadi Abdel Salam. Amin seeks to obtain the copy before it falls into the hands of a notorious director.\n\nAhmed Abuelfadl takes us in a strange journey, in which the truth blends with the protagonist’s imagination, and mixes what seems to be an aborted love story with something else. All of this takes place in one night.'),
('2060227', 'Sea of Dunes', 'https://media.elcinema.com/uploads/_315x420_63b7722bcacbecc0c6c0e88306d1f93efa1f874f3da2e035370d67e5df566b05.jpg', NULL, NULL, '4', NULL, '0', NULL),
