('2064814', 'Before Forty', 'https://media.elcinema.com/uploads/_315x420_0b6cc3e4da6b4495e82efc8aa52fa334a66393cf0be67f050b4a512260ede042.jpg', '+16', ' 3 February 2021', '93', '2166641', '5.9', 'As Moataz suffers from a strong trauma following the death of his mother, his aunt Sama thinks that he is a psychopath. But with repeated mysterious deaths in the family, it turns out that Moataz has demonic abilities and a curse that destroys everyone around him.'),
('2064839', 'Saber w Rady', 'https://media.elcinema.com/uploads/_315x420_27d657fd0b2955517d9f960e9f3fbb007fcb90ab9450c9b8ed1a423ae3ce3542.jpg', 'All Ages', '30 December 2020', '85', '709490', '6.9', 'As the paralyzed businessman named Rady decides to hire a caretaker to look after him, Saber applies for the job, and they get into many comedic situations.'),
