('2064930', 'Khan Tiuola', 'https://media.elcinema.com/uploads/_315x420_6c5bbea1468c46eb01a4d871b728ad0b2f3c5354a2062427aa08b329ea8d3e81.jpg', '+18', ' 2 December 2020', '100', '1281548', '6.4', 'The events take place in the 1940s  during WWII inside a hotel in El-Alamein city, which is owned by a man who lives there with his family. But things take a turn with the arrival of a new guest who finds himself witnessing bizarre incidents there.'),
('2064980', 'Afreet Transit', 'https://media.elcinema.com/uploads/_315x420_1028f876708112214bfb170598980f79f8c4b074b327baa6959d4903ce122e56.jpg', 'All Ages', '11 November 2020', '90', '2515064', '4.3', 'The story follows a drug dealer who is exposed to many problems after he becomes accused of murder, which drives him to try to prove his innocence and repent.'),
('2065004', 'Today Is A Beautiful Day', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2065010', 'أهل الكهف', 'https://media.elcinema.com/uploads/_315x420_a19e9bd26939768d4bf703f55716842182115433cbe28d799433f435634bdbd2.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2065192', 'Guild Paper', 'https://media.elcinema.com/uploads/_315x420_1eb03e359aa4e4c77688e49a275fd724fc622a4a8865ac195d98a3ee4271eab5.jpg', NULL, NULL, '90', NULL, '5.5', 'Umm Abdullah is a woman of humble origin, who lives in a local neighborhood and fends for her family by running a hairdresser\'s.'),
('2065225', 'تحت تهديد السلاح', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2065277', '3 in Trouble', 'https://media.elcinema.com/uploads/_315x420_b84e7cad1166e3b010228b4321b35de75fbacf8d68e06c37623ff194bc138b1b.jpg', NULL, NULL, NULL, NULL, '3.9', 'The story follows three talented musicians who travel to Cairo to pursue their dreams in the field of music, but they face unfortunate consequences when they discover that they\'re smuggling drugs without their knowledge.'),
('2065401', 'Thaneya Wahda', 'https://media.elcinema.com/uploads/_315x420_ead3a272bc447588a113753cd78f79f02844c86cd680b6bf7c6288f4a3250601.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2065450', 'ريتسا', 'https://media.elcinema.com/uploads/_315x420_4bfcd946935358a5dcd4ebb5c0b927207c1d69d9d23c15d0fc3498483d48fb66.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2065488', 'عيد جواز', 'https://media.elcinema.com/uploads/_315x420_b5a24507a23e51c8c567ddd89a535d820f4747ef7d530029b13de6d68d02251c.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2065769', 'El Khetta El Aayma', 'https://media.elcinema.com/uploads/_315x420_ee730841d52373f293f9fdf6433580c9ba0f52407ce36d2e4e15237dc8a176d1.jpg', 'All Ages', ' 6 October 2020', '90', '12454372', '7.6', 'A light comedy about a man who enlists the help of two people in order to steal important documents from a bank safe, which leads them to pick and train two clueless thieves to do the job.'),
('2065948', 'Amar', 'https://media.elcinema.com/uploads/_315x420_5059857839654458661a2ada6d49d8fe2438afc3f6b7998320dd8cba59f9b660.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2066402', 'Luxor', 'https://media.elcinema.com/uploads/_315x420_a42665894f9c865a4794aae8e36d2220bcf150d0a44f1a146fba4edad9b0638b.jpg', NULL, NULL, '85', NULL, '5', 'The British aid worker Hana tries to get over her dark past by visiting the ancient city of Luxor, where she meets her ex-lover Sultan, but she finds herself torn between a troubling past and an uncertain present.'),
('2066560', 'Waafet Reggala', 'https://media.elcinema.com/uploads/_315x420_ee7d1e70db1abdcbd1357e88553b9dd7330ca8357cb633fbb6350caeb3a676ca.jpg', 'All Ages', '13 January 2021', '120', '24808543', '8.9', 'A comedy about a group of friends as they get reunited to help one of their own find his way out of major trouble. As the situation gets more complicated, they are forced to take a trip to a coastal town.'),
('2066608', 'Bloodline', 'https://media.elcinema.com/uploads/_315x420_78ec96a7918c49d39cc0725baaeac363e72aafe7de7a5c026998a7f63446eec0.jpg', '+18', '30 October 2020', '92', NULL, '4.3', NULL),
('2066792', 'I am afraid to forget your face', 'https://media.elcinema.com/uploads/_315x420_177024ba7720a6f1c434347329b051cc097a13ec163c8ac5d13e562ffc4d9ff5.jpg', NULL, '18 February 2021', '15', NULL, '5.6', NULL),
('2067013', 'السرب', 'https://media.elcinema.com/uploads/_315x420_2392a8e418f4bc2e3de57b94593d0d4bf36a3101eb3ad60b8affdfd8d5ab1201.jpg', NULL, NULL, NULL, NULL, '0', NULL),
('2067020', 'mama hamil', 'https://media.elcinema.com/blank_photos/315x420.jpg', NULL, NULL, NULL, NULL, '0', NULL),
